(802, 'chan-chong-xe-dap', 'Chân chống xe đạp', '<p><strong><em>Chân chống xe đạp</em></strong></p>\n<ul>\n<li data-spm-anchor-id=\"a2o4n.pdp_revamp.product_detail.i3.537d595ent0xU3\">Chân chống xe đạp linh hoạt và tiện lợi, với khả năng điều chỉnh chiều dài từ 33 đến 38cm.</li>\n<li data-spm-anchor-id=\"a2o4n.pdp_revamp.product_detail.i3.537d595ent0xU3\">Thiết kế kẹp vào sườn xe, phù hợp với mọi loại xe đạp.</li>\n<li data-spm-anchor-id=\"a2o4n.pdp_revamp.product_detail.i3.537d595ent0xU3\">Chất liệu hợp kim nhôm đảm bảo độ bền tốt.</li>\n<li data-spm-anchor-id=\"a2o4n.pdp_revamp.product_detail.i3.537d595ent0xU3\">Sản phẩm nhẹ nhàng và dễ sử dụng, phù hợp cho các loại địa hình và loại xe đạp khác nhau.</li></ul>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-dap-1-4bcfdad6-42c1-48f3-9438-a10e87464f1b.jpg?v=1714208995441\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-dap-4-211f0d4a-64aa-4a1c-bb1f-44059a5b3b70.jpg?v=1714209003400\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-dap-3-4a293414-ed0f-4472-87d3-2314fe31c768.jpg?v=1714209016758\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-dap-2-23dbe8ba-48d5-4ace-80c5-6b4b1b65a949.jpg?v=1714209030970\" /></p>', '', 'Chân chống xe đạp', 'chân chống xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/35578278/chan-chong-xe-dap.jpg', '<ul>\n<li data-spm-anchor-id=\"a2o4n.pdp_revamp.product_detail.i3.537d595ent0xU3\">Chân chống xe đạp linh hoạt và tiện lợi, với khả năng điều chỉnh chiều dài từ 33 đến 38cm.</li>\n<li data-spm-an', '35578278', '