(807, 'moi-sau-cau-ca-lo-120-sau', 'Mồi sâu câu cá lọ 120 sâu', '<p><em><strong>Mồi sâu câu cá lọ 120 sâu</strong></em></p>\n<p>Sâu Câu Sống: Mỗi lọ đều chứa đến 120 con sâu câu sống, đủ để thu hút chép, diếc và mương từ xa..</p>\n<p>Chất Lượng Chăm Sóc: Sâu câu được chọn lọc và chăm sóc cẩn thận, đảm bảo chúng có sức khỏe tốt và giữ được sự sống lâu dài.</p>\n<p>Sâu Sống sẽ tăng cơ hội bắt cá thành công khi bạn câu chép, diếc hoặc mương.</p>\n<p>Không cần phải lo lắng về việc chuẩn bị sâu câu, chỉ cần mở lọ và bắt đầu câu cá.</p>\n<p>An Toàn và Tự Nhiên: Sản phẩm được sản xuất từ nguyên liệu tự nhiên và an toàn cho môi trường.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sau-cau-ca-v10.jpg?v=1710472834394\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sau-cau-ca-v6.jpg?v=1710472840625\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sau-cau-ca-v3.jpg?v=1710472863595\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sau-cau-ca-v1.jpg?v=1710472871010\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sau-cau-ca-v9.jpg?v=1710472877474\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p><iframe width=\"100%\" height=\"645\" src=\"https://www.youtube.com/embed/R_nfCzQm7q8\" title=\"Sâu câu cá lọ 120 sâu chuyên câu tự nhiên cực nhạy #phukienxedap #phụkiệnxemáy\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>', '', 'Mồi câu', 'câu cá, mồi câu cá, sâu câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '',