(808, 'chot-cai-day-an-toan-xe-o-to-dinh-da-chalen', 'Chốt Cài Dây An Toàn Xe Ô Tô Đính Đá CHALEN', '<p><em><strong>Chốt Cài Dây An Toàn Xe Ô Tô Đính Đá CHALEN</strong></em></p>\n<p>Chất liệu hợp kim, thiết kế cắm chồng (hàng dởm trên thị trường không có lỗ cắm chồng), hình ảnh và video mô tả cam kết giống 100% thực tế.</p>\n<p>Tắt&nbsp;tiếng kêu khó chịu của chuông báo cài dây an toàn, cũng có lúc bạn đi một đoạn đường rất ngắn trong thành phố mà bạn không nhất thiết phải cài dây an toàn.</p>\n<p>Kính thước của chốt đai an toàn là 10cm x 4cm.</p>\n<p>Kích thước đầu cắm dây an toàn phù hợp là 2cm.</p>\n<p>Phân loại: Đính hình hoa trà, Hình Gấu.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-dinh-dan-toan-dinh-da-chanlen-v4-5414cb60-f356-4b7a-aa68-4632d2a058da.jpg?v=1709257022553\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-dinh-dan-toan-dinh-da-chanlen-v1-db04fc48-5ae1-43e5-a8f0-1f644ceeb823.jpg?v=1709257034236\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-dinh-dan-toan-dinh-da-chanlen-v5-a0e8c73a-edaf-4b13-bcbc-a68f81e47efb.jpg?v=1709257041850\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-dinh-dan-toan-dinh-da-chanlen-v2-df37cd3e-042a-400e-84ce-5f5e891459b0.jpg?v=1709257047871\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"645\" src=\"https://www.youtube.com/embed/lDUhA-EGsmk\" title=\"Chốt Cài Dây An Toàn Xe Ô Tô Đinh Đá CHALEN0301 1 #quangcaofacebook #phutungxedap #phukienxedap\" width=\"100%\"></iframe></p>', '', 'Chốt Cài Dây An Toàn', 'chốt an toàn, chốt an toàn ô tô, chốt cài dây an toàn, Chốt Cài Dây An Toàn Xe Ô Tô Đinh Đá CHALEN, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Hình', 'Hoa trà', 'Phân loại', '1 chiếc', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/34724418/chot-cai-day-an-toan-xe-o-to-dinh-da-chalen.jpg', '<p>Chất liệu hợp kim, thiết kế cắm chồng (hàng dởm trên thị trường không có lỗ cắm chồng), hình ảnh và video mô tả cam kết giống 100% thực tế.</p>\n<p>Tắt&nbsp;tiếng kêu khó chịu của chuông bá', '34724418', '110819918', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:49', '2024-05-29 06:10:49'),
(809, 'kinh-chan-gio-xe-may-cg05', 'Kính chắn gió xe máy CG04 có viền', '<p><strong><em>Kính chắn gió xe máy CG04 có viền</em></strong></p>\n<p>Chất Lượng Vững Chắc: Với độ dày 2.5mm, sản phẩm cung cấp sự chắc chắn và ổn định.</p>\n<p>Kích thước: 71x62CM.</p>\n<p>Dễ Dàng Sử Dụng: Thiết kế thuận tiện giúp bạn dễ dàng.</p>\n<p>Bảo Vệ Hiệu Quả: Kính chắn gió không chỉ giúp bảo vệ người lái khỏi gió, mưa, và bụi bẩn, mà còn tạo điều kiện lái xe thoải mái hơn.</p>\n<p>Trải Nghiệm Lái Xe Tốt Hơn: Giảm mệt mỏi và tăng thoải mái khi lái xe ở tốc độ cao với kính chắn gió chất lượng.</p>\n<p>Lắp Đặt Dễ Dàng: Thiết kế dễ lắp đặt, tiết kiệm thời gian và công sức.</p>\n<p>Phù hợp với loại xe máy của bạn để đảm bảo hiệu suất tốt nhất.</p>\n<p><strong>#KínhChắnGió #PhụKiệnXeMáy #LàmĐẹpXe #BảoVệNgườiLái</strong></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg06-v5-37c7c9f7-c0dd-4d13-a0bd-a66edc6d6739.jpg?v=1704862831219\" /></p>\n<p><img data-thumb=\"original\" original-height=\"665\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg06-v3.jpg?v=1704862841004\" /></p>\n<p><img data-thumb=\"original\" original-height=\"672\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg06-v4-7713837b-12e5-4297-ab76-0573dcab74c8.jpg?v=1704862848187\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg06-v2-326e6e44-ed73-48f3-a8a2-0af1a2d24758.jpg?v=1704862853795\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg07.jpg?v=1704862865657\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg08.jpg?v=1704862871912\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cg06-6c914ce3-7f12-47ff-99d0-007a434f9382.jpg?v=1704862879016\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"645\" src=\"https://www.youtube.com/embed/5MMse6FcxAE\" title=\"Kính chắn gió xe máy CG05 #KínhChắnGió #PhụKiệnXeMáy #LàmĐẹpXe #BảoVệNgườiLái\" width=\"100%\"></iframe></p>', '', 'Kính chắn gió xe máy', 'Bảo Vệ Người Lái, Kính Chắn Gió, Làm Đẹp Xe, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '9', 'kg', 'images/34208468/kinh-chan-gio-xe-may-cg05.jpg', '<p>Chất Lượng Vững Chắc: Với độ dày 2.5mm, sản phẩm cung cấp sự chắc chắn và ổn định.</p>\n<p>Kích thước: 71x62CM.</p>\n<p>Dễ Dàng Sử Dụng: Thiết kế thuận tiện giúp bạn dễ dàng.</p>\n<p>Bảo Vệ H', '34208468', '107416525', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:49', '2024-05-29 06:10:49'),
(810, 'chan-bun-xe-o-to-hyundai-elantra-2011-2019', 'Chắn Bùn Xe Ô Tô Hyundai Elantra 2011-2019', '<p><em><strong>Chắn Bùn Xe Ô Tô Hyundai Elantra 2011-2019</strong></em></p>\n<p>Sản phẩm làm từ&nbsp;chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Hyundai Elantra.</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm cho chiếc xe của bạn&nbsp;trông cá tính, mạnh mẽ hơn nhiều. P</p>\n<p>Phân loại: chia làm 2 loại áp dụng cho xe&nbsp;Hyundai Elantra 2011-2015,&nbsp;Hyundai Elantra 2016-2019.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v1-594234d1-6fa2-4c89-8def-8df19837e2a4.jpg?v=1703492275279\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v3-7297b7e1-ef87-4cd9-b9a4-5d7e5b1c7825.jpg?v=1703492275873\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v2-9b5b60a4-91ad-487d-9a62-4181ffb0cbd3.jpg?v=1703492291747\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v5-6c80b5ec-adfb-4628-896e-235abde9624d.jpg?v=1703492292537\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v6.jpg?v=1703492293203\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v7.jpg?v=1703492294076\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v9.jpg?v=1703492294946\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-elantra-v10.jpg?v=1703492295619\" /></p>', '', 'Chắn bùn cho xe ô tô', 'chắn bùn cho xe ô tô, Chắn Bùn Xe Ô Tô Hyundai Elantra 2011-2019, Volcano, volcano.vn', '1', 'Đời', '2011-2015', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/33973173/chan-bun-xe-o-to-hyundai-elantra-2011-2019.jpg', '<p>Sản phẩm làm từ&nbsp;chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Hyundai Elantra.</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm ', '33973173', '106025571', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:49', '2024-05-29 06:10:49'),
(811, 'bo-goi-dua-dau-tua-lung-cao-su-non-niracp-cho-ghe-xe-o-to-ghe-van-phong', 'Bộ gối đựa đầu tựa lưng cao su non Niracp cho ghế xe ô tô, ghế văn phòng', '<p><em><strong>Bộ gối đựa đầu tựa lưng cao su non Niracp cho ghế xe ô tô, ghế văn phòng</strong></em></p>\n<p>Chất liệu Su Non Chất Lượng Cao&nbsp;bộ gối đựa đầu và tựa lưng Niracp mang đến cảm giác êm ái và thoải mái ngay từ lần sử dụng đầu tiên.</p>\n<p>Với thiết kế linh hoạt, sản phẩm dễ dàng điều chỉnh để phù hợp với mọi loại ghế xe ô tô. Trải nghiệm thoải mái và linh hoạt trong mọi hành trình.</p>\n<p>Thiết kế đặc biệt nhằm cung cấp hỗ trợ chính xác cho đầu và lưng, giúp giảm mệt mỏi và đau nhức.</p>\n<p>Sản phẩm không chỉ dễ dàng lắp đặt mà còn thuận tiện cho việc vệ sinh, giúp bạn duy trì không gian xe luôn sạch sẽ và thoải mái.</p>\n<p>Sản phẩm mang đến không chỉ là sự thoải mái mà còn là phong cách và thẩm mỹ cho không gian nội thất xe của bạn.</p>\n<p>Kích thước: gối tựa đầu 29*20*12CM, gối tựa lưng&nbsp;39*29*11CM</p>\n<p>Màu sắc: Đen, Hồng, Ghi.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v1.jpg?v=1702713254279\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v1-0.jpg?v=1702713255140\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v5.jpg?v=1702713257074\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v6.jpg?v=1702713257928\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v7.jpg?v=1702713258784\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v8.jpg?v=1702713259426\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-tua-dau-tua-lung-xe-o-to-v3.jpg?v=1702713256435\" /></p>', '', 'Bộ gối đựa đầu tựa lưng cao su non', 'Bộ gối đựa đầu tựa lưng cao su non, bộ gối tựa ô tô, ô tô, phụ  kiện ô tô, tựa đầu ô tô, tựa lung ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Ghi', '', '', '', '', '', '', '', 'deny', '', '290000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/33885428/bo-goi-dua-dau-tua-lung-cao-su-non-niracp-cho-ghe-xe-o-to-ghe-van-phong.jpg', '<p>Chất liệu Su Non Chất Lượng Cao&nbsp;bộ gối đựa đầu và tựa lưng Niracp mang đến cảm giác êm ái và thoải mái ngay từ lần sử dụng đầu tiên.</p>\n<p>Với thiết kế linh hoạt, sản phẩm dễ dàng đi', '33885428', '105629853', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:49', '2024-05-29 06:10:49'),
(812, 'day-treo-guong-o-to-canh-buom', 'Dây treo gương ô tô cánh bướm', '<p><em><strong>Dây treo gương ô tô cánh bướm</strong></em></p>\n<p>Nhiều người chọn lựa cánh bướm làm vật trang trí vì chúng thường mang đến một cảm giác nhẹ nhàng, tinh tế và năng động.&nbsp;</p>\n<p>Đây là phụ kiện phổ biến được sử dụng để làm đẹp và tạo không khí riêng biệt cho xe hơi,&nbsp;được treo để tạo điểm nhấn thẩm mỹ và cá nhân hóa không gian nội thất.</p>\n<p>Chất liệu: nhựa kèm dây bọc da PU</p>\n<p>Kích thước: 8*6.5*0.3CM</p>\n<p>Màu: Hồng, tím.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phu-kien-treo-kinh-lai-trang-tri-o-to-v7.jpg?v=1702631637905\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phu-kien-treo-kinh-lai-trang-tri-o-to-v2.jpg?v=1702631650468\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phu-kien-treo-kinh-lai-trang-tri-o-to-v3.jpg?v=1702631656731\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phu-kien-treo-kinh-lai-trang-tri-o-to-v1.jpg?v=1702631662562\" /></p>', '', 'Dây treo gương ô tô cánh bướm', 'Dây treo gương ô tô cánh bướm, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu', 'Tím', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33879103/day-treo-guong-o-to-canh-buom.jpg', '<p>Nhiều người chọn lựa cánh bướm làm vật trang trí vì chúng thường mang đến một cảm giác nhẹ nhàng, tinh tế và năng động.&nbsp;</p>\n<p>Đây là phụ kiện phổ biến được sử dụng để làm đẹp và tạo', '33879103', '105408540', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:49', '2024-05-29 06:10:49'),
(813, 'kep-sap-thom-cua-gio-dieu-hoa-hinh-sieu-cute', 'Sáp Thơm Ô Tô Kẹp Cửa Gió Điều Hoà Hình Cute Đính Đá', '<p><em><strong>Sáp Thơm Ô Tô Kẹp Cửa Gió Điều Hoà&nbsp;Hình Cute Đính Đá</strong></em></p>\n<p>Sáp thơm ô tô kẹp cửa gió với hình dáng dễ thương và đính đá là một cách tuyệt vời để không chỉ làm mới không khí trong chiếc xe của bạn mà còn tạo điểm nhấn thú vị, làm tăng thêm sự sang trọng và cá tính cho không gian nội thất ô tô của bạn.</p>\n<p>Hình Dáng Dễ Thương và Độc Đáo&nbsp;chất liệu đính đá tinh xảo, giúp tạo nên một sản phẩm thơm mắt và thu hút.</p>\n<p>Sản phẩm tặng kèm sắp thơm&nbsp;với mùi thơm dễ chịu và gắn liền với các loại hình đáng yêu như hoa, cánh bướm, cánh ong.</p>\n<p>Kích thước sản phẩm khác nhau cho mỗi loại hình.</p>\n<p>#SápThơmÔTô #HươngThơmXeHơi #ÔTôĐiềuHoà #KẹpCửaGió #KhôngGianXeHơi #TrangTríÔTô #ThơmMátTrongXe #PhụKiệnXeHơi #SángTạoTrongÔTô #XeHơiĐẹp<button></button></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-v9.jpg?v=1702606523567\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/products/nuoc-hoa-kep-cua-gio-dieu-hoa-v6-3c4b0af2-a3a7-4a2a-aae4-c9f0279db1bb.jpg?v=1702548419700\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/products/nuoc-hoa-kep-cua-gio-dieu-hoa-v1-89ebb770-21d3-4047-85d9-5b028d16220c.jpg?v=1702548420217\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/products/nuoc-hoa-kep-cua-gio-dieu-hoa-v8-62c323cf-2094-4b7e-84fc-a54165e7d7bf.jpg?v=1702548420707\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/n