(816, 'nhip-gap-da-nang-mui-cong-dung-di-cau-trang-tri-tieu-canh-gap-nhung-vat-kho-size-13cm', 'Nhíp gấp đa năng mũi nhọn đầu cong dùng đi câu, trang trí tiểu cảnh, gấp những vật khó size 13cm', '<p><strong><em>Nhíp gấp đa năng mũi nhọn đầu cong dùng đi câu, trang trí tiểu cảnh, gấp những vật khó size 13cm</em></strong></p>\n<p>Là sự lựa chọn phù hợp để trang trí tiểu cảnh, vì chúng có đầu mũi nhọn và có thể giúp bạn dễ dàng kiểm soát khi làm việc với cây cỏ nhỏ.</p>\n<p>Nhỏ gọn và có thể dễ dàng mang theo bên mình, có thể được sử dụng cho việc gắp những vật nhỏ.</p>\n<p>Kích thucớ dài 13CM.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhip-gap-giun-di-cau-v6.jpg?v=1702450287216\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhip-gap-giun-di-cau-v2.jpg?v=1702450300625\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhip-gap-giun-di-cau-v3.jpg?v=1702450307239\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhip-gap-giun-di-cau-v1.jpg?v=1702450314805\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhip-gap-giun-di-cau-v5.jpg?v=1702450322645\" /></p>', '', 'Nhip đa năng', 'nhíp mũi cong, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '8000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33855524/nhip-gap-da-nang-mui-cong-dung-di-cau-trang-tri-tieu-canh-gap-nhung-vat-kho-size-13cm.jpg', '<p>Là sự lựa chọn phù hợp để trang trí tiểu cảnh, vì chúng có đầu mũi nhọn và có thể giúp bạn dễ dàng kiểm soát khi làm việc với cây cỏ nhỏ.Nhỏ gọn và có thể dễ dàng mang theo bên mình, có th', '33855524', '10527353