(817, 'phu-kien-giu-luoi-cau-cuon-truc-theo-can-cau-tay', 'Phụ kiện giữ lưỡi câu, cuốn trục thẻo cần câu tay', '<p><em><strong>Phụ kiện giữ lưỡi câu, cuốn trục thẻo cần câu tay</strong></em></p>\n<p>Món phụ kiện rất tiện ích cho cần câu tay, câu đơn, câu đài</p>\n<p>Gắn trực tiếp tiếp lên&nbsp; thân cần, có kèm băng dính.</p>\n<p>Chất liệu nhựa chịu bền cao</p>\n<p>Kích&nbsp;thước sử dụng tùy chỉnh dài 19.5cm hoặc 34.5cm, rộng 1.8cm, cao 0.6cm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-quan-theo-gan-cau-cau-don-v86-16dbced9-d4d9-47e3-be39-2c5878001a6d.jpg?v=1702538885969\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-quan-theo-gan-cau-cau-don-v1-cebecc18-0bf9-4211-a9d0-a743831294fe.jpg?v=1702538894855\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-quan-theo-gan-cau-cau-don-v3-dd341672-0bcf-44fe-97f2-ba50fa54b619.jpg?v=1702538899934\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-quan-theo-gan-cau-cau-don-v5-dba891d9-1838-43aa-a6bd-aa2fd4eba70a.jpg?v=1702538906082\" /></p>', '', 'Phụ kiện giữ lưỡi câu', 'cuốn trục thẻo cần câu tay, phụ kiện cầu câu tay, Phụ kiện giữ lưỡi câu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33854858/phu-kien-giu-luoi-cau-cuon-truc-theo-can-cau-tay.jpg', '<p>Món phụ kiện rất tiện ích cho cần câu tay, câu đơn, câu đài</p>\n<p>Gắn trực tiếp tiếp lên&nbsp; thân cần, có kèm băng dính.</p>\n<p>Chất liệu nhựa chịu bền cao</p>\n<p>Kích&nbsp;thước sử dụn', '33854858', '105271583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL