(818, 'keo-bam-cat-chi-cat-day-cau-co-nap', 'Kéo bấm cắt chỉ, cắt dây câu có nắp', '<p><em><strong>Kéo bấm cắt chỉ, cắt dây câu có nắp</strong></em></p>\n<p>Kéo bấm chỉ/ cắt chỉ có nắp đậy loại tốt sử dụng êm tay, nhỏ gọn, tiện lợi và an toàn.</p>\n<p>Lưỡi kéo bằng thép, bén, cắt trơn, nhẹ nhàng cho người sử dụng.</p>\n<p>Khối lượng: 20g.</p>\n<p>Kích thước: 12*1.8*1.1CM</p>\n<p>Màu giao&nbsp;ngẫu nhiên.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-chi-day-cau-co-nap-v3.jpg?v=1702374950440\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-chi-day-cau-co-nap-v5.jpg?v=1702374960751\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-chi-day-cau-co-nap-v7.jpg?v=1702374966479\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-chi-day-cau-co-nap-v8.jpg?v=1702374971148\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-chi-day-cau-co-nap-v10.jpg?v=1702374978553\" /></p>', '', 'kéo bấm chỉ', 'kéo bấm chỉ, kéo bấm dây câu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '20000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33850335/keo-bam-cat-chi-cat-day-cau-co-nap.jpg', '<p>Kéo bấm chỉ/ cắt chỉ có nắp đậy loại tốt sử dụng êm tay, nhỏ gọn, tiện lợi và an toàn.</p>\n<p>Lưỡi kéo bằng thép, bén, cắt trơn, nhẹ nhàng cho người sử dụng.</p>\n<p>Khối lượng: 20g.</p>\n<p', '33850335', '105262445', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:50', '2024-05-29 06:10:50'),
