(822, 'dau-gac-can-cau-chan-vit-8mm', 'Đầu V gác cần câu chân vít 8MM', '<p><em><strong>Đầu V gác cần câu chân vít 8MM</strong></em></p>\n<p>Chất liệu nhựa cao cấp giúp giữ cần tốt hơn</p>\n<p>Chó chân vít 8MM&nbsp;cho gác cần</p>\n<p>Màu sắc khá đa dạng đucợ shop giao màu ngẫu nhiên</p>\n<p>Kích thước: V rộng 1-3.5CM, V cao 3.5CM.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v6.jpg?v=1702284616785\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v3.jpg?v=1702284685137\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v5.jpg?v=1702284690916\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v4.jpg?v=1702284696237\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v2.jpg?v=1702284709456\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-gac-can-cau-v1.jpg?v=1702284717056\" /></p>', '', 'Đầu gác cần câu chân vít 8MM', '', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/33838783/dau-gac-can-cau-chan-vit-8mm.jpg', '<p>Chất liệu nhựa cao cấp giúp giữ cần tốt hơn</p>\n<p>Chó chân vít 8MM&nbsp;cho gác cần</p>\n<p>Màu sắc khá đa dạng đucợ shop giao màu ngẫu nhiên</p>\n<p>Kích thước: V rộng 1-3.5CM, V cao 3.5CM', '33838783', '105172468', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(823, 'keo-bam-chi-bam-day-dau-cao-cap', 'Kéo bấm chỉ, bấm dây đâu cao cấp', '<p><em><strong>Kéo&nbsp;bấm chỉ, bấm dây đâu cao cấp</strong></em></p>\n<p>Kéo&nbsp;bấm&nbsp;lưỡi có độ bền cao, cắt trơn, bén, nhẹ nhàng.</p>\n<p>Dụng cụ nhỏ nhắn và tiện lợi cho nhu cầu văn phòng chuyên môn.</p>\n<p>Kiểu dáng nhỏ gọn, có bao đựng an toàn sau khi sử dụng.</p>\n<p>Kích cỡ chiều dài toàn kéo chỉ khoảng 10.5 x 3 x 0.5 cm ( lưỡi dài 3.6cm).</p>\n<p>Chuyên dụng cắt chỉ, cắt dây câu cá.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v7.jpg?v=1702108143200\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v8.jpg?v=1702108150009\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v6.jpg?v=1702108155210\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v9.jpg?v=1702108160549\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v3.jpg?v=1702108166580\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-bam-cat-day-cat-chi-v2.jpg?v=1702108175990\" /></p>', '', 'Kéo bấm chỉ, bấm đây đâu cao cấp', 'bấm đây đâu cao cấp, kéo bấm, Kéo bấm chỉ, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33823192/keo-bam-chi-bam-day-dau-cao-cap.jpg', '<p>Kéo&nbsp;bấm&nbsp;lưỡi có độ bền cao, cắt trơn, bén, nhẹ nhàng.</p>\n<p>Dụng cụ nhỏ nhắn và tiện lợi cho nhu cầu văn phòng chuyên môn.</p>\n<p>Kiểu dáng nhỏ gọn, có bao đựng an toàn sau khi ', '33823192', '105078154', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(824, 'balo-du-lich-gap-sieu-gon-play-king', 'Balo du lịch gấp siêu gọn Play-king', '<p><em><strong>Balo du lịch gấp siêu gọn Play-king</strong></em></p>\n<p>Balo Play-king nhỏ gọn đi du lịch, đi học, tập thể thao gấp gọn chống thấm nước.</p>\n<p>Balo thể thao Play-king với thiết kế siêu nhẹ, nhỏ gọn nhưng lại chứa được dung tích lớn giúp bạn có thể mang đi khắp mọi nơi như đi học, đi chơi, đi tập thể thao, đi đạp xe, đi leo núi đường dài. Phù hợp với mọi lứa tuổi.</p>\n<p>- Với chất liệu chống thấm nước, ba lô Play-king thách thức các cơn mưa bất chợt, bạn có thể yên tâm về các vật dụng bên trong. Kết hợp màu sắc hài hòa, đa dạng, giúp bạn có nhiều sự lựa chọn trẻ trung năng động và tiện lợi.</p>\n<p>- Balo gấp gọn siêu nhẹ Play-king thiết kế 1 ngăn rộng rãi vừa giúp việc xếp đồ, lấy đồ nhanh gọn vừa đựng được nhiều đồ dùng hơn.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v1.jpg?v=1702027055159\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v6.jpg?v=1702027060832\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v7.jpg?v=1702027066158\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v2.jpg?v=1702027075227\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v9.jpg?v=1702027080621\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v3.jpg?v=1702027085954\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/balo-du-lich-gap-sieu-gon-play-king-v5.jpg?v=1702027091027\" /></p>', '', 'Balo du lịch gấp siêu gọn Play-king', 'Balo du lịch gấp siêu gọn, Balo du lịch gấp siêu gọn Play-king, Volcano, volcano.vn', '1', 'Màu sắc', 'Xanh', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33815318/balo-du-lich-gap-sieu-gon-play-king.jpg', '<p>Balo Play-king nhỏ gọn đi du lịch, đi học, tập thể thao gấp gọn chống thấm nước.</p>\n<p>Balo thể thao Play-king với thiết kế siêu nhẹ, nhỏ gọn nhưng lại chứa được dung tích lớn giúp bạn có', '33815318', '105021886', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(825, 'dung-cu-bat-ca-5-tieu-co-nganh-ban-nho', 'Dụng cụ bắt cá 5 tiêu ngang có ngạnh bản nhỏ', '<p><em><strong>Dụng cụ bắt cá 5 tiêu ngang có ngạnh bản nhỏ</strong></em></p>\n<p>Dụng cụ bắt cá chuyên dụng cho các vùng, địa hình đầm, ao, hồ có mức nước ít có thể nhìn thấy và phát hiện cá di chuyển.</p>\n<p>Chất liệu từ thép không gỉ, có thêm ngạch giữ cá&nbsp;sau khi xiên chúng mục tiêu.</p>\n<p>Đầu xiên là chân ren 8mm phù hợp lắp chung cán các loại vợt bắt cá thông dụng.</p>\n<p>Kích thước: dài 21cm đường kích chân tiêu 7mm, 3 tiêu rộng 6.5cm</p>\n<p>Bạn có thể tham khảo thêm phần cán vợt khi mua Xiên 3 tiêu:&nbsp;Kích thước thu gọn chỉ 110CM kéo dái 3 khúc dài 3M, đường kính 2.5CM&nbsp;khá&nbsp;to đảm bảo&nbsp;được độ chắc chắn, chân Ren&nbsp;8MM.</p>\n<p>Cán Vợt Câu Cá Thép Không Gỉ Dài 3M bán riêng có giá 120.000vnđ</p>', '', 'Dụng cụ bắt cá', 'chía bắt cá, ô tô, Volcano, volcano.vn, Xiên bắt cá', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/33803918/dung-cu-bat-ca-5-tieu-co-nganh-ban-nho.jpg', '<p>Dụng cụ bắt cá chuyên dụng cho các vùng, địa hình đầm, ao, hồ có mức nước ít có thể nhìn thấy và phát hiện cá di chuyển.</p>\n<p>Chất liệu từ thép không gỉ, có thêm ngạch giữ cá&nbsp;sau kh', '33803918', '104870227', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(826, 'bao-tay-di-xe-may-mua-dong-chong-ngam-co-phan-quang', 'Bao tay đi xe máy mùa đông chống thấm có phản quang', '<p><em><strong>Bao tay đi xe máy mùa đông chống thấm có phản quang</strong></em></p>\n<p>Mùa đông lạnh làm cho đôi tay bạn tê buốt mỗi khi đi xe đến trường, công ty hay đi chơi cùng bạn bè. Đó là nỗi ám ảnh lớn khi nghĩ đến đi đâu đó bằng xem máy, nhưng bây giờ bạn hoàn toàn yên tâm khi đi đâu đó cùng ai vì đã có Bao tay đi xe máy chuyên dụng dùng cho đi xe máy trong những ngày đông giá lạnh.</p>\n<p>Chất liệu da PU siêu bền chắc chắn đến từng đường chỉ chống thấm nước, bên trong lót lớp nỉ dày giữ ấm tuyệt đối cho đôi tay của bạn.</p>\n<p>Có phản quang cảnh báo rất hữu ích, màu sắc phối màu đẹp shop giao hàng ngẫu nhiên các màu.</p>\n<p>Sử dụng đơn giản chùm lên tay lái có dây thắt lại&nbsp;với chân gương chắn chắn.</p>\n<p>Kích thước: 35*28cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-tay-di-xe-may-mua-dong-co-phan-qua-chong-tham-sieu-am-v3.jpg?v=1701677996406\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-tay-di-xe-may-mua-dong-co-phan-qua-chong-tham-sieu-am-v10.jpg?v=1701678017852\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-tay-di-xe-may-mua-dong-co-phan-qua-chong-tham-sieu-am-v18.jpg?v=1701678026227\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-tay-di-xe-may-mua-dong-co-phan-qua-chong-tham-sieu-am-v13.jpg?v=1701678036675\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-tay-di-xe-may-mua-dong-co-phan-qua-chong-tham-sieu-am-v16.jpg?v=1701678051979\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"645\" src=\"https://www.youtube.com/embed/LFO2nK77B3A\" title=\"\" width=\"100%\"></iframe></p>', '', 'Bao tay đi xe máy', 'phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/33741598/bao-tay-di-xe-may-mua-dong-chong-ngam-co-phan-quang.jpg', '<p>Mùa đông lạnh làm cho đôi tay bạn tê buốt mỗi khi đi xe đến trường, công ty hay đi chơi cùng bạn bè. Đó là nỗi ám ảnh lớn khi nghĩ đến đi đâu đó bằng xem máy, nhưng bây giờ bạn hoàn toàn y', '33741598', '104518122', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(827, 'voi-tuoi-cay-nho-giot-tu-dong-chay-tuy-chinh-lap-vua-nhieu-mau-chai', 'Vòi Tưới Cây Nhỏ Giọt Tự Động Chảy Tùy Chỉnh - Lắp Vừa Nhiều Mẫu Chai', '<p><strong><em>Vòi Tưới Cây Nhỏ Giọt Tự Động Chảy Tùy Chỉnh - Lắp Vừa Nhiều Mẫu Chai Trên Thị Trường ( Lavie, Coca, 0 Độ...)</em></strong></p>\n<p>Nhờ vòi tưới nước nhỏ giọt chảy chậm tự động này, tốc độ dòng chảy có thể được kiểm soát dễ dàng.</p>\n<p>Van điều khiển có thể kiểm soát tốc độ nhỏ giọt 0-60 giây / 1 giọt và tùy vào lượng nước trong chai, vòi có thể giúp duy trì việc tự động tưới kéo dài trong 0-15 ngày, rất an tâm khi đi công tác, du lịch xa nhà.</p>\n<p>✔️ Màu sắc: Ngẫu nhiên</p>\n<p>✔️ Chất liệu: Nhựa PP bền bỉ</p>\n<p>✔️ Kích thước: 13,5 * 3,2cm / 5,31 \"* 1,26\".</p>\n<p>Có thể sai khác đôi chút không đáng kể</p>\n<p>✔️ Phù hợp với rất nhiều loại chai trên thị trường như chai lavie</p>\n<section>\n<p>#voi #tuoi #nho #giot #chay #cham #tu #dong #nuoc #he #thong #tuoinhogiot #hethongtuoinhogiot</p></section>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gio-nhot-chai-nuoc-v2.jpg?v=1700726989241\" /></p>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gio-nhot-chai-nuoc-v8.jpg?v=1700726996512\" /></p>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gio-nhot-chai-nuoc-v3.jpg?v=1700727002831\" /></p>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gio-nhot-chai-nuoc-v1.jpg?v=1700727009357\" /></p>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gio-nhot-chai-nuoc-v7.jpg?v=1700727015303\" /></p>\n\n<p><img data-thumb=\"original\" original-height=\"750\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gi