(829, 'dai-cuon-co-chan-bang-cuon-bao-ve-mat-ca-chan-chong-tron-truot-chuyen-gym-01-chiec', 'Đai quấn cổ chân, Băng quấn bảo vệ mắt cá chân chống trơn trượt chuyên gym (01 chiếc)', '<p><strong><em>Đai quấn cổ chân, Băng quấn bảo vệ mắt cá chân chống trơn trượt chuyên gym (01 chiếc)</em></strong></p>\n<p>Quấn bảo vệ mắt cá chân thể thao giúp giữ chắc vùng cổ chân, thêm bộ đôi dây đai tăng cường sức mạnh.</p>\n<p>Chất liệu: Nylon 65% + Cao su 25% + Spandex 10%</p>\n<p>Kiểu dáng dạng tất, dễ đeo.</p>\n<p>Có thêm 2 dây đai trợ lực dùng để quấn chặt bên ngoài, bảo vệ an toàn hơn cho vùng mắt cá chân</p>\n<p>Đặc tính vải co giãn, thoát mồ hôi nhanh.</p>\n<p>Tạo cảm giác dễ chịu khi vận động co gập cổ chân.</p>\n<p>Không bí bách, không quá nóng khi mang</p>\n<p>Bộ đôi dây đai siêu bảo vệ được gắn chặt tại vị trí bàn chân, dễ quấn, kéo giãn tối đa.</p>\n<p>Cách chọn size: L (35-38); XL (38-41); 2XL (41-44)</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/quan-co-chan-v1.jpg?v=1700118751985\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/quan-co-chan-v7.jpg?v=1700118763269\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/quan-co-chan-v2.jpg?v=1700118769395\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/quan-co-chan-v5.jpg?v=1700118776843\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/quan-co-chan-v6.jpg?v=1700118929753\" /></p>', '', 'Đai quốn cổ chân', 'Đai quốn cổ chân, quấn cổ chân tập gym, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Kích thước', 'L', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33475755/dai-cuon-co-chan-bang-cuon-bao-ve-mat-ca-chan-chong-tron-truot-chuyen-gym-01-chiec.jpg', '<p><strong><em>Quấn</em></strong> bảo vệ mắt cá chân thể thao giúp giữ chắc vùng cổ chân, thêm bộ đôi dây đai tăng cường sức mạnh.</p>\n<p>Chất liệu: Nylon 65% + Cao su 25% + Spandex 10%</p>\n<', '33475755', '102872458', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(830, 'gang-tay-chong-nang-xo-ngon-bao-tay-choi-the-thao-ngoai-troi-di-may-chong-tia-uv', 'Găng tay chống nắng xỏ ngón, bao tay chơi thể thao ngoài trời, đi máy, chống tia UV', '<p><strong><em>Găng tay chống nắng xỏ ngón, bao tay chơi thể thao ngoài trời, đi máy, chống tia UV</em></strong></p>\n<p>Kiểu dáng: Thiết kế mẫu mới nhất phù hợp cho nam và nữ</p>\n<p>Chất liệu: Vải thun lạnh mềm mại, mỏng, thoáng mát dễ chịu</p>\n<p>Khử khuẩn và An toàn với mọi loại da, không gây kích ứng khi sử dụng</p>\n<p>Có Khả năng thoáng khí, thấm hút mồ hôi tốt. Đặc biệt với những người bị ra mồ hôi tay thì găng tay giúp cho tay của các bạn lúc nào cũng khô ráo, giúp bạn lái xe tự tin hơn.</p>\n<p>✔ Chống lại tia UV, ngăn cản tác nhân của mặt trời</p>\n<p>✔ Độ co giãn và đàn hồi tốt</p>\n<p>✔ Cổ tay có phần xỏ ngón có thể đeo và kéo dài che nắng luôn phần bàn tay rất tiện lợi</p>\n<p>✔ Một thiết kế đơn giản nhưng tinh tế; đáp ứng mọi nhu cầu.</p>\n<p>✔ Phù hợp với đi làm, đi chơi và hoạt động tập thể dục thể thao</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v1.jpg?v=1699951813150\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v5.jpg?v=1699951818386\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v2.jpg?v=1699951826021\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v3.jpg?v=1699951832330\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v6.jpg?v=1699951837860\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-chong-nag-xo-ngon-v7.jpg?v=1699951843184\" /></p>', '', 'Găng tay chống nắng xỏ ngón', 'bao tay chơi thể thao ngoài trời, chống tia UV, đi máy, gắng tay, găng tay chống nắng, Găng tay chống nắng xỏ ngón, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/33459284/gang-tay-chong-nang-xo-ngon-bao-tay-choi-the-thao-ngoai-troi-di-may-chong-tia-uv.jpg', '<p>Kiểu dáng: Thiết kế mẫu mới nhất phù hợp cho nam và nữ</p>\n<p>Chất liệu: Vải thun lạnh mềm mại, mỏng, thoáng mát dễ chịu</p>\n<p>Khử khuẩn và An toàn với mọi loại da, không gây kích ứng khi', '33459284', '102815162', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(831, 'gang-tay-chong-nang-the-thao-lai-xe-golovejoy', 'Găng tay chống nắng thể thao, lái xe Golovejoy', '<p><em><strong>Găng tay chống nắng thể thao, lái xe Golovejoy</strong></em></p>\n<p>Găng tay chống nắng dạng ống tay che nửa bắp tay tới cổ tay.</p>\n<p>Vải dày chống tia UV tốt, chất liệu thun lạnh co giãn đeo thoải mái khi đi nắng, không gây kích ứng da.</p>\n<p>Ngoài ra, còn dùng chống muỗi, côn trùng khi đi leo núi, deo khi lái xe, đi câu, chơi tập luyện các môn thể thao ngoài trời.</p>\n<p>Họa tiết đen phối tráng đẹp mắt.</p>\n<p>kích thước: 40CM co dãn thoải&nbsp;mái.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gamh-tay-dai-v1.jpg?v=1699936202749\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gamh-tay-dai-v3.jpg?v=1699936210590\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gamh-tay-dai-v5.jpg?v=1699936219219\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gamh-tay-dai.jpg?v=1699936227397\" /></p>', '', 'Găng tay chống nắng', 'Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/33455330/gang-tay-chong-nang-the-thao-lai-xe-golovejoy.jpg', '<p>Găng tay chống nắng dạng ống tay che nửa bắp tay tới cổ tay.</p>\n<p>Vải dày chống tia UV tốt, chất liệu thun lạnh co giãn đeo thoải mái khi đi nắng, không gây kích ứng da.</p>\n<p>Ngoài ra,', '33455330', '102755341', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:51', '2024-05-29 06:10:51'),
(832, 'gang-tay-bida-ho-ngon-chong-mo-hoi-tay-golovejoy', 'Găng Tay Bida Hở Ngón Chống Mồ Hôi Tay Golovejoy', '<p><em><strong>Găng Tay Bida Hở Ngón Chống Mồ Hôi Tay Golovejoy</strong></em></p>\n<p>Chất vải thun lạnh, trơn mịn, co dãn 4 chiều, chống mồ hôi tay, thoáng khí, ôm sát.</p>\n<p>In chữ màu trắng.</p>\n<p>Freesize, vừa vặn nhiều cỡ tay.</p>\n<p>Độ dài các ngón tay bằng nhau, giao động từ 5,5 - 6cm.</p>\n<p>Thiết kế hở ngón giúp kê ngón thật tay và chắc chắn hơn. Có phần đai dán điều chỉnh rộng chật ở cổ tay.</p>\n<p>Màu sắc: đen</p>\n<p>Giá niêm yết là giá cho 01 chiếc găng.</p>\n<p>#bida #cơbida #găngtaybida #baotaybida #găngIBS #găngtayIBS #bảotayIBS #ibs #găngtaychơibida</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ga-tay-choi-bida-v5.jpg?v=1699929493271\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ga-tay-choi-bida-v3.jpg?v=1699929502277\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ga-tay-choi-bida-v8.jpg?v=1699929509799\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ga-tay-choi-bida-v6.jpg?v=1699929517658\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ga-tay-choi-bida-v9.jpg?v=1699929525773\" /></p>\n<p>&nbsp;</p>', '', 'Gang tay bida', 'Găng Tay Bida Hở Ngón Chống Mồ Hôi Tay Golovejoy, gnag tay chơi bida, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/33453193/gang-tay-bida-ho-ngon-chong-mo-hoi-tay-golovejoy.jpg', '<p>Chất vải thun lạnh, trơn mịn, co dãn 4 chiều, chống mồ hôi tay, thoáng khí, ôm sát.</p>\n<p>In chữ màu trắng.</p>\n<p>Freesize, vừa vặn nhiều cỡ tay.</p>\n<p>Độ dài các ngón tay bằng nhau, gi', '33453193', '102739160', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:52', '2024-05-29 06:10:52'),
(833, 'gang-tay-tap-gym-the-thao-the-hinh-yoga-rexchi-chinh-hang-thoang-khi-tham-hut-mo-hoi-sieu-bam-chong-truot-chong-tray', 'Găng Tay Tập Gym Thể Thao Thể Hình Yoga REXCHI Chính Hãng Thoáng Khí Thấm Hút Mồ Hôi Siêu Bám Chống Trượt Chống Trầy', '<p><em><strong>Găng Tay Tập Gym Thể Thao Thể Hình Yoga REXCHI Chính Hãng Thoáng Khí Thấm Hút Mồ Hôi Siêu Bám Chống Trượt Chống Trầy</strong></em></p>\n<p>Chất liệu: Vải chống thấm cao cấp + Silicon + Da lộn</p>\n<p>Thiết kế găng tay dạng nửa ngón, hiện đại, đẹp mắt - Chất siêu nhẹ, cực bền, không nhanh rách, không thô cứng đôi tay</p>\n<p>Mặt dưới lót miếng silicon đảm bảo an toàn cho bàn tay, không đau ráp, tránh tổn thương khi tập luyện.</p>\n<p>Bề mặt silicon được làm sần tăng độ bám khi cầm nắm</p>\n<p>Mặt trên gồm hàng trăm lỗ nhỏ giúp thoáng khí, thoát mồ hôi, giữ tay khô ráo, không ẩm ướt</p>\n<p>Băng dán giữ chặt găng, thoải mái vận động không trơn tuột</p>\n<p>Người dùng đo chu vi của lòng bàn tay để lựa chọn size: Size M: 18 - 19.5 cm - Size L: 19 - 21,5 cm&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v5.jpg?v=1699865970257\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v6.jpg?v=1699865976587\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v1.jpg?v=1699865984127\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v2.jpg?v=1699865991448\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v3.jpg?v=1699865999966\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v7.jpg?v=1699866006120\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-the-duc-ngan-v8.jpg?v=1699866012117\" /></p>', '', 'Găng Tay Tập Gym', 'Găng Tay Tập Gym, Găng Tay Tập Gym Thể Thao Thể, găng tay thể thao, Volcano, volcano.vn', '1', 'Màu sắc', 'Hồng', 'Kích thước', 'M', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33445931/gang-tay-tap-gym-the-thao-the-hinh-yoga-rexchi-chinh-hang-thoang-khi-tham-hut-mo-hoi-sieu-bam-chong-truot-chong-tray.jpg', '<p>Chất liệu: Vải chống thấm cao cấp + Silicon + Da lộn</p>\n<p>Thiết kế găng tay dạng nửa ngón, hiện đại, đẹp mắt - Chất siêu nhẹ, cực bền, không nhanh rách, không thô cứng đôi tay</p>\n<p>Mặt', '33445931', '102680448', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:52', '2024-05-29 06:10:52'),
(834, 'quan-co-tay-co-moc-thep-tro-luc-nang-day-ta-keo-xa-keo-xo-deadlift', '02 Quấn cổ tay có móc thép trợ lực nâng đẩy tạ, kéo xà, kéo xô, Deadlift', '<p><em><strong>02 Quấn cổ tay có móc thép trợ lực nâng kéo xà, kéo xô, Deadlift</strong></em></p>\n<p>Phụ kiện&nbsp;trợ lực tuyệt vời trong tập luyện các môn để kéo xà, kéo tạ...</p>\n<p>Bổ sung thêm đệm cao su chống trượt , dễ dàng điều chỉnh kích thước để giảm áp lực lên tay</p>\n<p>Móc làm bằng kim loại , lớp bọc vải tăng cường ma sát</p>\n<p>Đường kính móc kim loại từ 3cm-3.8cm.</p>\n<p>Đường kính đay có thể tùy chỉnh phù hợp cho cả ban và nữ.</p>\n<p>HƯỚNG DẪN SỬ DỤNG:</p>\n<p>- Đặt cổ tay vào phần đệm cao su</p>\n<p>- Cuốn và cố định cổ tay, điều chỉnh miếng dán sao cho không khít quá cũng không rộng quá - Đặt móc vào tạ và bắt đầu nâng tạ</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v3.jpg?v=1699326511707\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v2.jpg?v=1699326517805\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v76.jpg?v=1699326528005\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v6.jpg?v=1699326535152\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v79.jpg?v=1699328068692\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v77.jpg?v=1699326541660\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-keo-xa-v70.jpg?v=1699327966693\" /></p>', '', 'Quấn cổ tay có móc trợ lực nâng đẩy tạ', 'Deadlift, kéo xô, Quấn cổ tay có móc thép trợ lực nâng kéo xà, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/33351406/quan-co-tay-co-moc-thep-tro-luc-nang-day-ta-keo-xa-keo-xo-deadlift.jpg', '<p>Phụ kiện trợ lực tuyệt vời trong tập luyện các môn để kéo xà, kéo tạ...</p>\n<p>Bổ sung thêm đệm cao su chống trượt , dễ dàng điều chỉnh kích thước để giảm áp lực lên tay</p>\n', '33351406', '101981619', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:52', '2024-05-29 06:10:52');
