(839, 'bang-bao-ve-dau-goi-kep-ho-tro-bao-ve-tranh-chan-thuong', 'Băng Bảo Vệ Đầu Gối Kép Hỗ Trợ Bảo Vệ, Tránh Chấn Thương (01 chiếc)', '<p><em><strong>Băng Bảo Vệ Đầu Gối Kép Hỗ Trợ Bảo Vệ, Tránh Chấn Thương (01 chiếc)</strong></em></p>\n<p>Băng Bảo Vệ Đầu Gối sử dụng cho người tập luyện các môn thể thao: Đạp xe, đi bộ, cầu lông, tennis, bóng bàn,...&nbsp;Người có nhu cầu sử dụng loại đai bảo vệ gối kích thước vừa phải, không to lớn bó thít khó chịu.</p>\n<p>Dễ dàng vận động, gập gối, dịch chuyển. Bảo vệ khớp gối, giảm lực tác động, phòng trừ các sự cố như: Đứt dây chằng, chấn thương bong gân, sụn khớp, va quệt,…Phù hợp với cả nam lẫn nữ, freesize.</p>\n<p>Có chức năng bảo vệ trực tiếp phần dây chằng khớp gối sau, trước, bên, sụn và túi hoạt dịch.</p>\n<p>Chất liệu: Vải Lyrca + Silicone + SBR.</p>\n<p>Kiểu dáng vòng từ sau ra trước và dính. Có hai miếng Silicone đệm nổi trên và dưới phần mặt gối giúp giảm chấn động và bảo vệ tốt.&nbsp; Tại mặt sau phần gối, phần vải quấn của đai bảo vệ có lỗ thoáng khí, thoát mồ hôi nhanh, không cảm giác bí bách</p>\n<p>Tổng chiều dài: 41cm + Chiều ngang: 7cm. Thích hợp cho chân chu vi: 35-48 cm</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v11.jpg?v=1698292166176\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v7.jpg?v=1698292176362\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v1.jpg?v=1698292183719\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v8.jpg?v=1698292189677\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v9.jpg?v=1698292195556\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v2.jpg?v=1698292204506\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v5.jpg?v=1698292210294\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-goi-v4.jpg?v=1698292226874\" /></p>\n<p>HƯỚNG DẪN SỬ DỤNG</p>\n<p>+ Đặt phần vải có lỗ tại vị trí đằng sau gối</p>\n<p>+ Vòng đai bảo vệ từ sau ra trước mặt gối</p>\n<p>+ Lần lượt băng dán 2 phần đai bảo vệ</p>', '', 'Băng Bảo Vệ Đầu Gối', 'Băng Bảo Vệ Đầu Gối, băng đầu gối thể thao, băng gối, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33209563/bang-bao-ve-dau-goi-kep-ho-tro-bao-ve-tranh-chan-thuong.jpg', '<p><em><strong>Băng Bảo Vệ Đầu Gối sử dụng cho n</strong></em>gười tập luyện các môn thể thao: Đạp xe, đi bộ, cầu lông, tennis, bóng bàn,...&nbsp;Người có nhu cầu sử dụng loại đai bảo vệ gối ', '33209563', '101155020', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:52', '2024-05-29 06:10:52'),
(840, 'gang-tay-tap-gym-the-thao-cho-nu', 'Găng Tay Tập Gym, Thể Thao kết hợp bảo vệ cổ tay cho nữ', '<p><em><strong>Găng Tay Tập Gym, Thể Thao kết hợp bảo vệ cổ tay cho nữ</strong></em></p>\n<p>Với thiết kế có lỗ thoáng khí giúp các gymer vừa bảo vệ đôi tay của mình vừa tạo cảm giác thoải mái khi luyện tập</p>\n<p>Lòng bản tay thiết kế cao su chống trơn trượt- đồng thời tạo cảm giác êm tay khi cầm nắm</p>\n<p>Màu sắc: Hồng- Đen</p>\n<p>Kích thước: M- L</p>\n<p>Cách chọn size sản phẩm:</p>\n<p>- Size M: Chu vi từ 18-19cm</p>\n<p>- Size L: Chu vi từ 20-21cm</p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v1.jpg?v=1698205892393\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v2.jpg?v=1698205899190\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v3.jpg?v=1698205908698\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v5.jpg?v=1698205916889\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v4.jpg?v=1698205924171\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v6.jpg?v=1698205936810\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v9.jpg?v=1698205943396\" /></p>\n<p><img data-thumb=\"original\" original-height=\"800\" original-width=\"800\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-tap-cho-nu-v10.jpg?v=1698205948864\" /></p>\n<p>&nbsp;</p>', '', 'Găng Tay Tập Gym', 'găng tập gym, Găng Tay Tập Gym, gay tay the thao cho nữ, Volcano, volcano.vn', '1', 'Màu sắc', 'Hồng', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33196704/gang-tay-tap-gym-the-thao-cho-nu.jpg', '<p>Với thiết kế có lỗ thoáng khí giúp các gymer vừa bảo vệ đôi tay của mình vừa tạo cảm giác thoải mái khi luyện tập</p>\n<p>Lòng bản tay thiết kế cao su chống trơn trượt- đồng thời tạo cảm gi', '33196704', '101063618', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:52', '2024-05-29 06:10:52'),
(841, 'dai-deo-lung-tap-gym-co-dinh-xuong-don-chong-gu-lung-veo-cot-song', 'Đai Đeo Lưng Tập Gym Cố Định Xương Đòn, Chống Gù Lưng, Vẹo Cột Sống', '<p><strong><em>Đai Đeo Lưng Tập Gym Cố Định Xương Đòn, Chống Gù Lưng, Vẹo Cột Sống</em></strong></p>\n<p>✦ Người nên sử dụng: Dân văn phòng ngồi máy tính nhiều bị gù lưng, vai / Người chơi thể thao hoặc gặp chấn thương, tai nạn / Tài xế lái xe ô tô đường dài</p>\n<p>✦ Giúp điều chỉnh định hình đúng tư thế, tránh ngồi hoặc đứng sai khiến lưng bị gù, vẹo cột sống</p>\n<p>✦ Hỗ trợ quá trình phục hồi sau phẫu thuật, chấn thương điều trị vật lý trị liệu</p>\n<p>✦ Phù hợp với tất cả mọi người, thiết kế thông minh, có dây đai tùy chỉnh</p>\n<p>✦ Chất liệu: Cao su SBR + Nylon</p>\n<p>✦ Ích lợi: Điều chỉnh tư thế vai, lưng. Sửa dáng chống gù, giữ form người thẳng. Hạn chế tối đa tác động xấu gây sai lệch hoặc vẹo cột sống</p>\n<p>✦ Kiểu dáng đeo vai đơn giản, dễ sử dụng. Không gây áp lực nặng lên vai hoặc vùng lưng khiến đau nhức cơ bắp</p>\n<p>✦ Có hệ thống dây đai tự điều chỉnh theo cơ thể. Chất liệu thoáng khí thoát hơi ẩm nhanh, dù đeo lâu vẫn không cảm thấy nóng bức, bí bách.</p>\n<p>✦ Đai giữ vai thẳng cố định, tránh tình trạng vai ngả về trước, sai tư thế</p>\n<p>✦ Với chất liệu và dây đai thiết kế đặc biệt có thể điều chỉnh kéo ra hoặc thu vào, đai dùng được cho mọi hình dáng cơ thể, nam hay nữ.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-chong-gu-v9.jpg?v=1698115176840\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-chong-gu-v1.jpg?v=1698115186313\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-chong-gu-v2.jpg?v=1698115660825\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-chong-gu-v5.jpg?v=1698115667573\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-chong-gu-v7.jpg?v=1698115673120\" /></p>', '', 'Đai Đeo Lưng Tập Gym', 'Chống Gù Lưng, Đai Đeo Lưng Tập Gym, Đai Đeo Lưng Tập Gym Cố Định Xương Đòn, Vẹo Cột Sống, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33185244/dai-deo-lung-tap-gym-co-dinh-xuong-don-chong-gu-lung-veo-cot-song.jpg', '<p>Hỗ trợ quá trình phục hồi sau phẫu thuật, chấn thương điều trị vật lý trị liệu.</p>\n<p>Phù hợp với tất cả mọi người, thiết kế thông minh, có dây đai tùy chỉnh.</p>\n<p>Chất liệu: Cao su SBR', '33185244', '101011678', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:53', '2024-05-29 06:10:53'),
(842, 'bang-bao-ve-co-tay-tranh-chan-thuong-ho-tro-choi-the-thao-xo-ngon', 'Băng quấn  bảo vệ cổ tay tránh chấn thương - Hổ trợ chơi thể thao xỏ ngón', '<p><em><strong>Băng quấn bảo vệ cổ tay tránh chấn thương - Hổ trợ chơi thể thao xỏ ngón</strong></em>Băng quấn cổ tay phụ kiện thể thao không thể thiếu khi bạn chơi thể thao, tập gym, yoga.. đặc biệt những môn dùng tay nhiều như bóng rổ, bóng chuyển, tennis, cầu lông.</p>\n<p>Chất liệu mềm mại co giãn cực kì tốt, sẽ cố định cổ tay của bạn một cách chắc chắn nhất có thể</p>\n<p>✭ Giúp bạn tự tin khi tập những bài nặng mà không hề sợ hãi. Vì khớp cổ tay là khớp dễ bị chấn thương nhất khi tập nặng</p>\n<p>✭ Giúp vượt qua ngưỡng của bản thân giúp mình mau đạt được kết quả nhất -&gt; chinh phục những reps cuối cùng –&gt; reps quan trọng nhất</p>\n<p>✭ Thiết kế nhỏ gọn cùng chất liệu co giãn nên dễ đeo, tháo và phù hợp với nhiều kích cỡ tay. Dễ dàng mang đi bất cứ nơi đâu</p>\n<p>✭ Có khả năng giảm đau khớp, phục hồi và cố định các khớp xương đang bị tổn thương</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v6.jpg?v=1697856919824\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v7.jpg?v=1697856920786\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v8.jpg?v=1697856921558\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v2.jpg?v=1697856939842\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v1.jpg?v=1697856946065\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-quan-co-tay-v5.jpg?v=1697856952764\" /></strong></em></p>', '', 'Băng quấn bảo vệ cổ tay', 'Băng quấn bảo vệ cổ tay, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen xanh', 'Loại', 'Tay trái', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/33144829/bang-bao-ve-co-tay-tranh-chan-thuong-ho-tro-choi-the-thao-xo-ngon.jpg', '<p>Băng quấn cổ tay phụ kiện thể thao không thể thiếu khi bạn chơi thể thao, tập gym, yoga.. đặc biệt những môn dùng tay nhiều như bóng rổ, bóng chuyển, tennis, cầu lông.</p>\n<p>Chất liệu mềm', '33144829', '100804154', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:53', '2024-05-29 06:10:53'),
(843, 'kim-tap-co-tay-bop-tap-luc-tay-dieu-chinh-luc-5-60kg-co-dem-so-tu-dong', 'Kìm Tập Cơ Tay, bóp tập lực tay, Điều Chỉnh Lực 5-60kg Có Đếm số tự động', '<p><em><strong>Kìm Tập Cơ Tay, bóp tập lực tay, Điều Chỉnh Lực 5-60kg Có Đếm số tự động</strong></em></p>\n<p>Kìm bóp tay chữ A điều chỉnh lực là dụng cụ tập cơ tay bàn tay và ngón tay, đặc biệt thích hợp cho người tập võ, tập thể lực hoặc cho nhân viên văn phòng muốn luyện tập cơ tay do gõ bàn phím nhiều.</p>\n<p>&nbsp;</p>\n<p>Phần ngoài của tay cầm bọc nhựa cao cấp chống trơn, thấm mồ hôi và lò xo có độ đàn hồi lớn.</p>\n<p>Núm điều chỉnh lực bóp từ 5=&gt;60kg.</p>\n<p>Kích thước:15 x 12 x 3 cm.</p>\n<p>Chất liệu: Nhựa + Thép lò xo đàn hồi cao.</p>\n<p>Tập cơ bàn tay, ngón tay.</p>\n<p>Khóa lò xo: Làm bằng thép không rỉ chất lượn cao tay cầm chắc chắn.</p>\n<p>Thiết kế nhỏ gọn, có thể mang đi chơi hoặc đi du lịch.</p>\n<p>#kim #kimboptay #kimthethao #gym #kimtaptay #dungcutapcotaychuyennghiep #dungcutapgym #tap #bop #kimboptapcotay #kimtap #dungcutapcotay #dungcutaptay #kimboptaykimloai #kimboptapcotaychuyennghiep #kimbopcotay #kimboptapcotaychinhluctu5den60kg #kimboptaydieuchinhluc #kimbopcot</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v7.jpg?v=1697431232909\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v1.jpg?v=1697431239211\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v2.jpg?v=1697431244827\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v6.jpg?v=1697431258553\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v8.jpg?v=1697431266243\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v4.jpg?v=1697431272904\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tap-tay-v3.jpg?v=1697431279909\" /></p>\n<p>&nbsp;</p>', '', 'Kìm Tập Cơ Tay', 'Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/33077198/kim-tap-co-tay-bop-tap-luc-tay-dieu-chinh-luc-5-60kg-co-dem-so-tu-dong.jpg', '<p>Phần ngoài của tay cầm bọc nhựa cao cấp chống trơn, thấm mồ hôi và lò xo có độ đàn hồi lớn.</p>\n<p>Núm điều chỉnh lực bóp từ 5=&gt;60kg.</p>\n<p>Kích thước:15 x 12 x 3 cm.</p>\n<p>Chất liệu:', '33077198', '100457052', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:53', '2024-05-29 06:10:53'),
(844, 'bong-tap-tay-ta-p-co-tay-bong-co-tay-tu-khoi-dong-gyro-ball', 'Bóng tập tay,Tập cơ tay, Bóng cổ tay tự khởi động Gyro Ball', '<p><strong><em>Bóng tập tay,Tập cơ tay, Bóng cổ tay tự khởi động Gyro Ball</em></strong></p>\n<p>Kích thước: 70 x 70 x 55mm</p>\n<p>Trọng lượng: 270g</p>\n<p>Chất liệu: nhựa polycarbonate trong suốt và phần lõi bên trong được mạ hợp kim nhôm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/qua-cau-tao-co-tay-v6.jpg?v=1697425726229\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/qua-cau-tao-co-tay-v11.jpg?v=1697425740604\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/qua-cau-tao-co-tay-v9.jpg?v=1697425747098\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/qua-cau-tao-co-tay-v10.jpg?v=1697425752375\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/qua-cau-tao-co-tay-v112.jpg?v=1697425775571\" /></p>\n<p>Cách sử dụng Bóng tập cổ tay : Khi trong quá trình hoạt động, người dùng chỉ cần đẩy theo chiều mũi tên, động cơ sẽ tự động quay và tạo ra lực khoảng 14kg (tương đương 8000 vòng / phút) và lực 22kg (tương đương 10000 vòng / phút). Sau đó, người dùng có thể xoay cổ tay hoặc lên xuống khi cần</p>\n<p>Các biện pháp chú ý:</p>\n<p>1 Bóng tập tay là một loại dụng cụ thể thao phức tạp, bạn phải cẩn thận để không bị rơi khi sử dụng.</p>\n<p>2 Khi sử dụng tránh để vật lạ xâm nhập vào bóng.</p>\n<p>3 Khi bóng cổ tay quay ở tốc độ cao, không được dùng ngón tay chạm vào bóng bên trong để tránh trầy xước ngón tay.</p>\n<p>4 Không ném bóng với tốc độ cao vào người để đề phòng tai nạn</p>', '', 'Bóng tập tay', 'Bóng tập tay, dụng cụ tập cơ tay, tập cơ tay, Volcano, volcano.vn', '1', 'Màu sắc', 'Xanh', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/33074057/bong-tap-tay-ta-p-co-tay-bong-co-tay-tu-khoi-dong-gyro-ball.jpg', '<p>Kích thước: 70 x 70 x 55mm</p>\n<p>Trọng lượng: 270g</p>\n<p>Chất liệu: nhựa polycarbonate trong suốt và phần lõi bên trong được mạ hợp kim nhôm</p>\n<p>Cách sử dụng Bóng tập cổ tay : Khi tro', '33074057', '100451021', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:53', '2024-05-29 06:10:53'),
(845, 'but-may-net-thanh-dam-luyen-viet-chu-dep-cao-cap-bm02-khac-laser-theo-yeu-cau', 'Bút Máy Nét Thanh Đậm Luyện Viết Chữ Đẹp Cao Cấp BM02 - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Bút Máy Nét Thanh Đậm Luyện Viết Chữ Đẹp Cao Cấp BM02 - Khắc Laser Theo Yêu Cầu&nbsp;</strong></em></p>\n<p>Bút máy là loại ngòi mài dẹt, viết nét thanh đậm rất đẹp</p>\n<p>Ngòi sử dụng bằng piston hút mực siêu tiện lợi</p>\n<p>Đầu ngòi được mài bằng máy cho nét bút êm trơn và dễ dàng viết được nét thanh đậm, nét tạo ra đều</p>\n<p>Ruột bút: bên trong có bi đánh đều mực không tạo cặn</p>\n<p>Thân bút làm bằng kim loại trơn bóng chắc chắn cầm rất đầm tay khi viết, màu sắc sang trọng, tinh tế&nbsp;</p>\n<p>Bút có thể cắm được ống mực 3.4mm bằng cách rút Piston bên trong ra, rồi cắm ông mực lên</p>\n<p>Đầu bút 0.5mm</p>\n<p>Đặc biệt shop có khắc tên, logo theo yêu cầu lên thân bút và nắp bút</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-may-v1.jpg?v=1697093085674\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-may-v2-83f0af74-b82f-4095-b945-d77c7d1aee6f.jpg?v=1697093091572\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-may-v8-096414d5-0b2a-4d1d-9daa-98ccd72bf7d5.jpg?v=1697093098399\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-may-v7-e87d2d02-f618-499a-8a23-094257da545b.jpg?v=1697093105643\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-may-v91.jpg?v=1697093122588\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" origi