(851, 'cum-phanh-truoc-xe-dap', 'Cụm phanh trước xe đạp', '<p><em><strong>Cụm phanh trước xe đạp</strong></em></p>\n<p>Lắp phù hợp cho các dòng xe - cào cào - mini - asama - xe đạp trẻ em.</p>\n<p>chất liệu: sắt mạ kẽm.</p>\n<p>Kích thước: 11.5*13*8CM, đầu ốc lắp 5CM, REN 4MM.</p>\n<p>#phanhxedap #maphanhxedap #cumphanhtruoc #phanhxedapphothong.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-truoc-xe-dap-1-50a0e56a-5c98-4911-a217-8a79c9141b35.jpg?v=1695803657282\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-truoc-xe-dap-2-09158e1a-1e71-4636-8f40-7f8fcce18f9e.jpg?v=1695803658045\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-truoc-xe-dap-4-6df93798-3f72-46f3-a9ea-98f804337df0.jpg?v=1695803658983\" /></strong></em></p>', '', 'Cụm phanh trước xe đạp', 'Cụm phanh trước xe đạp, phụ kiện xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/32819223/cum-phanh-truoc-xe-dap.jpg', '<p>Lắp phù hợp cho các dòng xe - cào cào - mini - asama - xe đạp trẻ em.</p>\n<p>chất liệu: sắt mạ kẽm</p>\n<p>Kích thước: 11.5*13*8CM, đầu ốc lắp 5CM, REN 4MM.</p>', '32819223', '99032396', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:54', '2024-05-29 06:10:54');
