(852, 'may-hut-bui-o-to-gia-dinh-khong-day-di-dong-hut-cong-suat-cao', 'Máy hút bụi ô tô, gia đình không dây di động hút công suất cao', '<p><strong><em>Máy hút bụi ô tô, gia đình không dây di động hút công suất cao</em></strong></p>\n<p>Thiết kế nhỏ gọn, dễ cầm nắm và di chuyển. Bạn có thể sử dụng để làm sạch mọi ngõ ngách trong nhà mà không cần mang vác hay kéo nặng nhọc. Ngoài ra, bạn cũng dễ dàng cất giữ và bảo quản máy mà không tốn nhiều diện tích</p>\n<p>✔ Công suất hoạt động 120W mạnh mẽ, bền bỉ và ít gây tiếng ồn trong quá trình sử dụng.&nbsp;</p>\n<p>✔ Ba đầu hút đi kèm giúp hút được ở nhiều vị trí hơn: sàn nhà, salon, bàn ghế, thảm, góc tường, các khe nhỏ, gầm tủ, cầu thang… giúp ngôi nhà luôn sạch sẽ, thoáng đãng.</p>\n<p>✔ Ngoài ra, sản phẩm được trang bị cán và tay cầm được thiết kế 2 trong 1 có thể tháo rời và nhiều đầu hút khác nhau, rất thuận tiện cho bạn khi sử dụng</p>\n<p>✔ Pin&nbsp; 2000mAh, sử dụng liên tục khoảng 3.5h, sạc cổng USB, độ hút 8500pa, cốc lọc bụi 600ML</p>\n<p>✔ Kích thước: 115*17CM (Kích thước sử dụng ống hút dài nhất) kích thước máy 45*17*9CM), trọng lượng 1050g.</p>\n<p>#mayhutbui #mayhutbuicamtay #mayhutbuigiuong #mayhutbuimini #mayhutbuikhongday #mayhutbuioto #mayhuybuikhongdaycamtay #mayhutbuicamtaykhongday #mayhutbuicamtaymini #mayhutbuiminicamtay #mayhutbuiotocaocap #mayhutbuiototcamtay #hutbuioto #hutbuinhacua #hutbuigiadinh</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v2-7bcf76b3-db7a-48a8-864a-4b6cd0d9a13c.jpg?v=1695802030904\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v1-a2d20f78-c6c1-4dc3-a237-94213ce3243b.jpg?v=1695802038096\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v5-ab217fad-a9f7-4046-a5b5-49d223348414.jpg?v=1695802045259\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v4-d675e382-d430-4de7-87db-bbd1685f3083.jpg?v=1695802056085\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v7-f949adfb-8616-46a9-bfdb-04224fa41809.jpg?v=1695802073982\" /></p>\n<p><img data-thumb=\"original\" original-height=\"941\" original-width=\"941\" src=\"//bizweb.dktcdn.net/100/200/904/files/v8-f5b5e54f-5455-4b2a-8122-3adec6b13d15.jpg?v=1695802088121\" /></p>', '', 'May hút bụi', 'gia đình không dây di động hút công suất cao, máy hút bụi, máy hút bụi cầm tay, Máy hút bụi ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '280000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/32818219/may-hut-bui-o-to-gia-dinh-khong-day-di-dong-hut-cong-suat-cao.jpg', '<p>Công suất hoạt động 120W mạnh mẽ, bền bỉ và ít gây tiếng ồn trong quá trình sử dụng.&nbsp;</p>\n<p>Ngoài ra, sản phẩm được trang bị cán và tay cầm được thiết kế 2 trong 1 có thể tháo rời và', '32818219', '99015265', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:54', '2024-05-29 06:10:54'),
(853, 'bang-dan-so-dien-thoai-hinh-dan-piano-dan-taplo-o-to', 'Bảng dán số điện thoại hình đàn piano dán taplo ô tô', '<h2><strong><em>Bảng Dán Số Điện Thoại Hình Đàn Piano Dán Taplo Ô Tô</em></strong></h2>\n<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần.</p>\n<p>Bảng gắn số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giản tiện dụng gắn&nbsp;số đơn giản.</p>\n<p>Sử dụng&nbsp;đơn giản với 6 dãy số từ 0 đến 9&nbsp;có thể thay đổi số điện thoại dễ dàng.</p>\n<p>Chất liệu nhựa ABS, hình cây đàn Piano độc lạ kèm các stick dán cute.</p>\n<p>Kích thước: nhỏ gọn 148*49*14MM</p>\n<p>#bangdansodienthoia #dansodienthoaioto #bangsodienthoaioto</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dan-so-dt-v7.jpg?v=1695193148285\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dan-so-dt-v8.jpg?v=1695193156724\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/products/bang-dan-so-dt-v112.jpg?v=1695279117330\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dan-so-dt-v6.jpg?v=1695193171744\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dan-so-dt-v4.jpg?v=1695193184522\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dan-so-dt-v3.jpg?v=1695193191088\" /></p>\n<p>&nbsp;</p>', '', 'Bảng dán số điện thoại', 'Bảng dán số điện thoại, Bảng Dán Số Điện Thoại Hình Dàn Piano Dán Taplo Ô Tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/32623485/bang-dan-so-dien-thoai-hinh-dan-piano-dan-taplo-o-to.jpg', '<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần.</p>\n<p>Bảng gắn số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giả', '32623485', '98222428', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:54', '2024-05-29 06:10:54'),
(854, 'dung-cu-nho-co-cam-tay-thong-minh', 'Dụng Cụ Nhổ Cỏ Cầm Tay Thông Minh', '<p>Giúp việc làm cỏ trở nên dễ dàng và không đau đau tay khi làm việc.</p>\n<p>Loại bỏ cỏ dại hiệu quả các loại cỏ dại thông thường trong vườn như cây kế, bồ công anh, cỏ cua, chickweed.</p>\n<p>Đế có đòn bẩy và nĩa hình chữ V chắc chắn.</p>\n<p>Chất liệu thép không gỉ sử dụng bền bỉ.</p>\n<p>Kích thước: Chia làm 2 phân loại:&nbsp;40CM. 50CM màu&nbsp;trắng, 50CM màu xám.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-7.jpg?v=1693794888013\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-6.jpg?v=1693794898421\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-4.jpg?v=1693794908030\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-3.jpg?v=1693794918160\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-2.jpg?v=1693794925386\" /></p>\n<p><img data-thumb=\"original\" original-height=\"100%\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/dung-cu-nho-co-cam-tay-1.jpg?v=1693794933670\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"557\" src=\"https://www.youtube.com/embed/SDLMCZvcclo\" title=\"Dụng Cụ Nhổ Cỏ Cầm Tay Thông Minh\" width=\"100%\"></iframe></p>', '', 'Dụng cụ nhổ cỏ', 'dụng cụ nhổ cỏ, Dụng Cụ Nhổ Cỏ Cầm Tay Thông Minh, nhổ cỏ cầm tay, ô tô, phụ  kiện ô tô', '1', 'Kích thước', '40CM', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/32462620/dung-cu-nho-co-cam-tay-thong-minh.jpg', '<p>Giúp việc làm cỏ trở nên dễ dàng và không đau đau tay khi làm việc.</p>\n<p>Loại bỏ cỏ dại hiệu quả các loại cỏ dại thông thường trong vườn như cây kế, bồ công anh, cỏ cua, chickweed.</p>\n<', '32462620', '97240308', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:54', '2024-05-29 06:10:54'),
(855, 'chai-xit-tao-bot-ve-sinh-khu-khuan-noi-that-xe-o-to', 'Chai xịt tạo bọt vệ sinh, khử khuẩn nội thất xe ô tô', '<p><strong><em>Chai xịt tạo bọt vệ sinh, khử khuẩn nội thất xe ô tô</em></strong></p>\n<p>Vệ sinh sạch sẽ mọi vị trí trên xe (taplo, tapi, ghế ngồi, trần xe, lót sàn, ...)</p>\n<p>Hiệu quả với hầu hết các loại vật liệu (da, nỉ, nhựa, cao su, kính, kim loại, ...)</p>\n<p>Có chứa các thành phần diệt khuẩn, giúp loại trừ và khử mùi ẩm mốc.</p>\n<p>Thẩm thấu nhanh, đẩy chất bẩn ra ngoài -&gt; tiết kiệm thời gian.</p>\n<p>Dung dịch dạng bọt dung tích lên đến 620ml -&gt; tiết kiệm chi phí.</p>\n<p>Không chứa axit hay các chất ăn mòn -&gt; an toàn cho bề mặt vật liệu và da tay người sử dụng.</p>\n<p>Đặc biệt an toàn với các thiết bị, da tay con người, không ăn mòn như dung dịch hóa chất.&nbsp; Cách dùng: lắc đều&nbsp;Xịt 1 lượng vừa đủ lên bề mặt cần làm sạch (với bề mặt cứng đầu để từ 1-2 phút để ion Kiềm ngấm sâu vào vết bẩn). Dùng khăn lau sạch bề mặt vết bản, không cần lau lại bằng nước.</p>\n<p>#xitbotvesinhnoithat #vesinhnoithat #vesinhoto #vesinhxehoi</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xit-ve-sinh-noi-tha-xe-hoi-v1.jpg?v=1692930680234\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xit-ve-sinh-noi-tha-xe-hoi-v2.jpg?v=1692930688123\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xit-ve-sinh-noi-tha-xe-hoi-v3.jpg?v=1692930695086\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xit-ve-sinh-noi-tha-xe-hoi-v10.jpg?v=1692930709407\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xit-ve-sinh-noi-tha-xe-hoi-v4.jpg?v=1692930727600\" /><