(856, 'bua-riu-kiem-luoi-liem-da-nang-co-can-30cm', 'Búa rìu kiêm lưỡi liềm đa năng có cán 40CM', '<p><em><strong>Búa rìu kiêm lưỡi liềm đa năng có cán 40CM</strong></em></p>\n<p>Sản phẩm đa năng tích dụng cụ vô cùng tiện ích cho việc đi rừng, đi rẫy, làm vườn, đi câu....</p>\n<p>Lưỡi rìu, lưỡi liềm sắc bén làm từ thép cao cấp. Được hàn sẵn cán bằng ống thép, tay cầm bọc nhựa chắc chắn, không đau tay.</p>\n<p>Kích thước: Dài 43CM, phần cán 31.5cm, phần lưỡi dài 20.5cm rộng 9.8cm.</p>\n<p>Kích thước lưỡi: lưỡi liềm 14.5CM, lưỡi rìu 9.8CM, dày 2.5MM.</p>\n<p>Trọng lượng: 380G</p>\n<p>#loiriu #luoiliemdanang #buariudanang #liem #luoiliem</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v6.jpg?v=1692692081952\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v5.jpg?v=1692692089184\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v7.jpg?v=1692692097028\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v2.jpg?v=1692692123669\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v8.jpg?v=1692692150220\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-riu-v4.jpg?v=1692692115595\" /></p>\n<p>&nbsp;</p>', '', 'Lưỡi liềm đa năng', 'Búa rìu kiêm lưỡi liềm đa năng có cán 30CM, lưỡi dao, lưỡi liềm, lưỡi rìu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/32321650/bua-riu-kiem-luoi-liem-da-nang-co-can-30cm.jpg', '<p>Sản phẩm đa năng tích dụng cụ vô