(857, 'luoi-dao-may-cat-co-6-canh-dung-cu-lam-vuon-chuyen-nghiep-cat-co-tan-goc', 'Lưỡi dao máy cắt cỏ 6 cánh dụng cụ làm vườn chuyên nghiệp cắt cỏ tận gốc', '<p><em><strong>Lưỡi dao máy cắt cỏ 6 cánh dụng cụ làm vườn chuyên nghiệp cắt cỏ tận gốc</strong></em></p>\n<p>Được làm bằng hợp kim chất lượng cao.</p>\n<p>Lưỡi dao có độ sắc bén và độ cứng cao.</p>\n<p>Không sợ va chạm đá sỏi khi sử dụng.</p>\n<p>Dễ dàng cài đặt và tiện lợi để sử dụng.</p>\n<p>Lưỡi có thể xoay 360 độ.</p>\n<p>Lỗ gắn Đường Kính: Xấp Xỉ. 25.4mm, đường kính: Xấp Xỉ. 17cm, lưỡi dao dài 5cm, đường kính làm việc 24.5cm.</p>\n<p>#luoidaomatcatco #luoimaycatco #maycatco #luoicatco #dungcucatco&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-1.jpg?v=1692585697755\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-2.jpg?v=1692585698942\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-4.jpg?v=1692585700128\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-5.jpg?v=1692585700950\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-6.jpg?v=1692585701700\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-7.jpg?v=1692585703069\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-may-cat-co-8.jpg?v=1692585704491\" /></p>', '', 'Lưỡi dao máy cắt cỏ', 'Lưỡi dao máy cắt cỏ 6 cánh dụng cụ làm vườn chuyên nghiệp cắt cỏ tận gốc, lưỡi máy cắt cỏ, Volcano', '1'