(869, 'day-phanh-xe-suzuki-gz125-chinh-hang', 'Dây phanh xe SUZUKI GZ125 chính hãng', '<p><em><strong>Dây phanh xe SUZUKI GZ125 chính hãng</strong></em></p>\n<p>Đây là loại dây cao cấp, lõi cáp to, ít dãn đàn hồi đảm bảo cho phanh không bị nún khi bóp phanh. Với khả năng chống rão tốt dây phanh loại này sẽ làm cho quá trình phanh an toàn hơn, người lái xe có cảm giác phanh tốt hơn.</p>\n<p>Thay thế lắp ráp zin cho xe.</p>\n<p>Khích thước: 130cm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-phanh-xe-suzuki-125-hs-v2.jpg?v=1690518668747\" /><img data-thumb=\"original\" original-height=\"3024\" original-width=\"3024\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-phanh-xe-suzuki-125-hs-v3.jpg?v=1690518670242\" /><img data-thumb=\"original\" original-height=\"2609\" original-width=\"2609\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-phanh-xe-suzuki-125-hs-v4.jpg?v=1690518673018\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-phanh-xe-suzuki-125-hs-v1.jpg?v=1690518882233\" /></p>\n<p>&nbsp;</p>', '', 'Dây phanh xe máy', 'dây phanh gz 125, Dây phanh xe SUZUKI GZ125 chính hãng, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/32032002/day-phanh-xe-suzuki-gz125-chinh-hang.jpg', '<p>Đây là loại dây cao cấp, lõi cáp to, ít dãn đàn hồi đảm bảo cho phanh không bị nún khi bóp phanh. Với khả năng chống rão tốt dây phanh loại này sẽ làm cho quá trình phanh an toàn hơn, ngườ', '32032002', '94518482', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:56', '2024-05-29 06:10:56');
