(870, 'moc-chia-khoa-kim-loai-day-mo-khac-laser-theo-yeu-cau', 'Móc chìa khóa kim loại đẩy mở khắc laser theo yêu cầu', '<p><em><strong>Móc chìa khóa kim loại đẩy mở khắc laser theo yêu cầu</strong></em></p>\n<p>Chất liệu kim loại cao cấp phủ sơn bóng màu ghi sang trọng.</p>\n<p>Thiết kế đẩy mở mới lạ, phong cách.</p>\n<p>Đặc biết có khắc logo miễn phí logo, số điện thoại, biểm số... theo yêu cầu.</p>\n<p>Kích thước: 8.5.*3*1CM.</p>\n<p>Trọng lượng: 30g.</p>\n<p>Đóng gói có kèm hộp đựng phù hợp làm quà tặng.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-lim-loai-day-mo-3.jpg?v=1688540040005\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-lim-loai-day-mo-2.jpg?v=1688540224081\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-lim-loai-day-mo-6.jpg?v=1688436903604\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-lim-loai-day-mo-1-e7b98791-fc17-4968-878f-58ece74aa26e.jpg?v=1688540190746\" /></p>\n<p>&nbsp;</p>', '', 'móc khóa', 'móc khóa, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/31687810/moc-chia-khoa-kim-loai-day-mo-khac-laser-theo-yeu-cau.jpg', '<p>Chất liệu kim loại cao cấp phủ sơn bóng màu ghi sang trọng.</p>\n<p>Thiết kế đẩy mở mới lạ, phong cách.</p>\n<p>Đặc biết có khác logo miễn phí logo, số điện thoại, biểm số... theo yêu cầu.</', '31687810', '92400923', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:56', '2024-05-29 06:10:56'),
(871, 'vo-boc-vo-lang-xe-o-to-toyota', 'Vỏ Bọc Vô Lăng Xe Ô Tô Toyota', '<p><em><strong>Vỏ Bọc Vô Lăng Xe Ô Tô Toyota</strong></em></p>\n<p>Bọc vô lăng ô tô&nbsp;không chỉ giúp tay lái vô lăng được trang bị thêm một lớp bên ngoài dày hơn vừa tay hơn đồng thời giúp cho người lái xe nắm chắc tay cùng cảm giác êm ái không lo bị trượt tay khi lái, tránh gây nguy hiểm khi đang lái xe.<br />\nSản phẩm không chỉ mang đến sự an toàn cho người lái và cộng động mà còn mang đến sự thoải mái và không đau tay cho người lái.</p>\n<p>Với chất liệu da PU mềm&nbsp;cao cấp, tạo cảm giác chắc tay, êm ái.</p>\n<p>Màu sắc đen sang trọng, logo của hãng Toyota&nbsp;màu trắng nổi bật.</p>\n<p>Size: 38 CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-53de9ce3-3111-44c8-9023-d25d2a37ba2d.jpg?v=1684986695297\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-9365163a-1724-4c00-9576-1863b1722588.jpg?v=1684986702111\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/1-e25ed811-28da-48d4-a980-396733f14b14.jpg?v=1684986710730\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/6-4ac814b0-f419-4216-9ebb-25339c552502.jpg?v=1684986719975\" /></strong></em></p>', '', 'Bọc vô lăng', 'bọc vô lăng ô tô, ô tô, phụ  kiện ô tô, Vỏ Bọc Vô Lăng Xe Ô Tô Toyota, vô lăng ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '290000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/31070321/vo-boc-vo-lang-xe-o-to-toyota.jpg', '<p>Bọc vô lăng ô tô&nbsp;không chỉ giúp tay lái vô lăng được trang bị thêm một lớp bên ngoài dày hơn vừa tay hơn đồng thời giúp cho người lái xe nắm chắc tay cùng cảm giác êm ái không lo bị t', '31070321', '88995328', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:56', '2024-05-29 06:10:56'),
(872, 'mieng-lot-ghe-mat-truc-cao-cap-cho-o-to-ghe-van-phong-mlg', 'Miếng Lót Ghế Mắt Trúc Cao Cấp Cho Ô Tô, Ghế Văn Phòng MLG', '<p><em><strong>Miếng Lót Ghế Mắt Trúc Cao Cấp Cho Ô Tô, Ghế Văn Phòng MLG</strong></em></p>\n<p>Miếng nệm&nbsp;lót ghế, thoáng mát dễ chịu chính giữa là gỗ&nbsp;trúc&nbsp;cao cấp.</p>\n<p>Lớp dưới&nbsp;chống trượt ngồi cực mát, thoáng khí.</p>\n<p>Phù hợp lót ghế xe đi đường dài vào&nbsp;mùa hè,&nbsp;lót ghế văn phòng đa chức năng, rất dễ sử dụng.</p>\n<p>Kích thước: 42X42CM.</p>\n<p>Màu sắc: Màu nâu, phối màu nâu vàng.</p>\n<p>Giá sản phẩm: 01&nbsp;miếng lót ghế.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v1.jpg?v=1683166139216\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v6.jpg?v=1683166149292\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v5.jpg?v=1683166160306\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v8.jpg?v=1683166167282\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v9.jpg?v=1683166173923\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v3.jpg?v=1683166190549\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-tre-truc-v4.jpg?v=1683166198063\" /></p>', '', 'Miếng lót ghế ô tô', 'Ghế Văn Phòng MLG, lót ghế mắt trúc, lót ghế ô tô, lót nghế tre trúc, Miếng Lót Ghế Mắt Trúc Cao Cấp Cho Ô Tô, ô tô