(873, 'thung-dung-do-xe-may-vip-co-den-led', 'Thùng đựng đồ xe máy VIP có đèn led', '<p><em><strong>Thùng đựng đồ xe máy VIP có đèn led</strong></em></p>\n<p>Thùng đồ với thiết kế kiểu dáng đẹp, đuôi thùng có cánh gió ấn tượng</p>\n<p>Dung tích thùng lơn chứa được 2 mũ bảo hiểm&nbsp;fullface.</p>\n<p>Chất liệu nhựa ABS cao cấp phủ sơn bóng.</p>\n<p>Điểm nhấn đặc biệt của thùng là có tích hợp bóng đèn led, kèm sẵn dây để kết nối với đèn phanh và đèn xi nhan trên xe máy, dễ dàng tự lắp đặt.</p>\n<p>Kích thước thùng: 48*38*39CM.</p>\n<p>Bộ sản phẩm: Thùng và phụ kiện lắp đặt chưa gồm gác baga cho xe.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v11.jpg?v=1680928078567\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v8.jpg?v=1680928086079\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v9.jpg?v=1680928108698\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v10.jpg?v=1680928115914\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v1.jpg?v=1680928130209\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v2.jpg?v=1680928136730\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-vip-v4.jpg?v=1680928155856\" /><img data-thumb=\"original\" original-height=\"720\" original-wi