(874, 'dung-cu-xuc-da-xeng-xuc-da-inox-khong-gi-nhieu-kich-thuoc', 'Dụng cụ xúc đá - xẻng xúc đá inox không gỉ', '<p><em><strong>Dụng cụ xúc đá - xẻng xúc đá inox không gỉ</strong></em></p>\n<p>Muỗng xúc đá inox là dụng cụ không thể thiếu trong các quán cafe, bar.. hoặc tại gia đình.</p>\n<p>Muỗng không chỉ có công dụng trong việc xúc đá, mà bạn có thể xúc đường, hạt rang…</p>\n<p>Với thiết kế gọn nhẹ, làm từ inox, muỗng xúc đá sẽ mang đến cho bạn cảm giác chắc chắn và bền bỉ trong quá trình sử dụng.</p>\n<p>Phân loại 2 loại: có móc treo và không có móc treo.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-1.jpg?v=1679131905595\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-8.jpg?v=1679131916833\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-2.jpg?v=1679131924184\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-10.jpg?v=1679131934941\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-4.jpg?v=1679131943157\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-6.jpg?v=1679131949712\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-11.jpg?v=1679131962012\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-xuc-da-inox-112.jpg?v=1679131962947\" /></p>', '', 'Dụng cụ xúc đá', 'Dụng cụ xúc đá, Dụng cụ xúc đá - xẻng xúc đá inox không gỉ, muõng xúc đá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/30073930/dung-cu-xuc-da-xeng-xuc-da-inox-khong-gi-nhieu-kich-thuoc.jpg', '<p>Muỗng xúc đá inox là dụng cụ không thể thiếu trong các quán cafe, bar.. hoặc tại gia đình.</p>\n<p>Muỗng không chỉ có công dụng trong việc xúc đá, mà bạn có thể xúc đường, hạt rang…</p>\n<p>', '30073930', '84034984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:56', '2024-05-29 06:10:56'),
