(881, 'dung-cu-bat-ca-3-tieu-co-nganh', 'Dụng cụ bắt cá 3 tiêu có ngạnh bản nhỏ', '<p><em><strong>Dụng cụ bắt cá 3 tiêu có ngạnh bản nhỏ</strong></em></p>\n<p>Dụng cụ bắt cá chuyên dụng cho các vùng, địa hình đầm, ao, hồ có mức nước ít có thể nhìn thấy và phát hiện cá di chuyển.</p>\n<p>Chất liệu từ thép không gỉ, có thêm ngạch giữ cá&nbsp;sau khi xiên chúng mục tiêu.</p>\n<p>Đầu xiên là chân ren 8mm phù hợp lắp chung cán các loại vợt bắt cá thông dụng.</p>\n<p>Kích thước: dài 17cm đường kích chân tiêu 7mm, 3 tiêu rộng 4cm</p>\n<p>Bạn có thể tham khảo thêm phần cán vợt khi mua Xiên 3 tiêu:&nbsp;Kích thước thu gọn chỉ 110CM kéo dái 3 khúc dài 3M, đường kính 2.5CM&nbsp;khá&nbsp;to đảm bảo&nbsp;được độ chắc chắn, chân Ren&nbsp;8MM.</p>\n<p>Cán Vợt Câu Cá Thép Không Gỉ Dài 3M bán riêng có giá 120.000vnđ</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v9.jpg?v=1673575988237\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v11.jpg?v=1673576002236\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v2.jpg?v=1673576015691\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v3.jpg?v=1673576021376\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v4.jpg?v=1673576029187\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/xien-3-tieu-v7.jpg?v=1673576042713\" /></p>', '', 'Xiên bắt cá', 'dụng cụ bắt cá, Volcano, volcano.vn, Xiên bắt cá', '1', 'Phân loại', 'Xiên không cán', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/29259450/dung-cu-bat-ca-3-tieu-co-nganh.jpg', '<p>Chất liệu từ thép không gỉ, có thêm ngạch giữ cá&nbsp;sau khi xiên chúng mục tiêu.</p>\n<p>Đầu xiên là chân ren 8mm phù hợp lắp chung cán các loại vợt bắt cá thông dụng.</p>\n<p>Kích thước: ', '29259450', '79786425', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:58', '2024-05-29 06:10:58'),
(882, 'bo-boc-ghe-xe-o-to-5-cho-cao-cap-gt02', 'Bộ bọc ghế, áo ghế xe ô tô 5 chỗ Cao Cấp GT02', '<p><em><strong>Bộ bọc ghế, áo ghế xe ô tô 5 chỗ Cao Cấp GT02</strong></em></p>\n<p>Bọc ghế da ô tô giúp&nbsp;cho xế trông đẹp và sang trọng hơn, đồng thời tạo cảm giác thoải mái khi ngồi trên xe.</p>\n<p>Ghế da chống thấm nước tốt, việc vệ sinh ghế xe đơn giản, nhất là đối với các gia đình có con nhỏ thường xuyên ăn uống trên xe.</p>\n<p>Màu sắc&nbsp;cá tính cho khoang nội thất cải thiện tính thẩm mỹ, làm tăng giá trị của chiếc xe.</p>\n<p>Kèm phụ kiện lắp đặt đơn giản tại nhà.</p>\n<p>Màu sắc: Đen phối đỏ</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v11.jpg?v=1672479670321\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v1.jpg?v=1672479688276\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v2.jpg?v=1672479694037\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v4.jpg?v=1672479707025\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v6.jpg?v=1672479713686\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v7.jpg?v=1672479721337\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/gt02-v8.jpg?v=1672479729021\" /></strong></em></p>', '', 'Bọc ghế, áo ghê ô tô', 'bộ bọc ghế xe ô tô, Bộ bọc ghế xe ô tô 5 chỗ C