(885, 'bo-02-tham-roi-lot-san-xe-o-to-cao-cap-hinh-hoa-tra', 'Bộ 02 Thảm rối lót sàn xe ô tô cao cấp hình hoa trà ', '<p><em><strong>Bộ 02 Thảm rối lót sàn xe ô tô cao cấp hình hoa trà</strong></em></p>\n<p>Thảm sàn rối chống trơn trượt tốt, dễ vệ sinh, nhanh khô, không để lại mùi khi rửa xe và an toàn cho người sử dụng, Sang trọng, thời trang, kiểu dáng trẻ trung.</p>\n<p>Chất liệu: PVC sợi&nbsp;đan rồi chống trơn.</p>\n<p>Kích thước: thảm trước&nbsp;65*50CM, thảm sau&nbsp;50*50CM</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-2.jpg?v=1671682261568\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-5.jpg?v=1696495888369\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-1.jpg?v=1671682269253\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-3.jpg?v=1671682277764\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-4.jpg?v=1671682285455\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thm-lot-chan-hoa-tra-7.jpg?v=1696496220464\" /></p>\n<p>&nbsp;</p>', '', 'Bộ 02 Thảm rối lót sàn xe ô tô cao cấp hình hoa trà ', 'Bộ 02 Thảm rối lót sàn xe ô tô cao cấp hình hoa trà, ô tô, phụ  kiện ô tô, Thảm rối lót sàn xe ô tô cao cấp hình hoa trà, Volcano, volcano.vn', '1', 'Phân loại', 'Thảm trước', '', '', '', '', '', '', '', 'deny', '', '330000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/29016733/bo-02-tham-roi-lot-san-xe-o-to-cao-cap-hinh-hoa-tra.jpg', '<p>Thảm sàn rối chống trơn trượt tốt, dễ vệ sinh, nhanh khô, không để lại mùi khi rửa xe và an toàn cho người sử dụng, Sang trọng, thời trang, kiểu dáng trẻ trung.</p>\n<p>Chất liệu: PVC sợi&n', '29016733', '78555298', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:59', '2024-05-29 06:10:59'),
(886, 'moc-chia-khoa-kim-loai-kiem-khui-mo-bia-khac-laser-theo-yeu-cau', 'Móc chìa khóa kim loại kiêm khui mở bia khắc laser theo yêu cầu', '<p><em><strong>Móc chìa khóa kim loại kiêm khui mở bia khắc laser theo yêu cầu</strong></em></p>\n<p>Trong những lần vui chơi cùng bạn bè, bạn đã bao giờ phải loay hoay tìm cho mình dụng cụ khui bia và để cho cuộc vui bị gián đoạn. Vậy hãy để Volcano giới thiệu cho bạn chiếc&nbsp;Móc chìa khóa đa chức năng vô cùng hữu ích bạn nhé!</p>\n<p>Chất liệu: Hợp kim kẽm màu trắng bạc sáng bóng. Vừa dùng làm móc khóa trang trí, vừa có thể khui bia.</p>\n<p>Đặc biệt shop có khắc laser MIỄN PHÍ&nbsp;logo, tên, số điện thoại, biển số xe...Theo yêu cầu của khách hàng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v5-aa0f17a0-2e25-4c95-a919-8393116c931c.jpg?v=1671595379700\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v1-603b2888-4d75-43f4-a9ee-169d527f448f.jpg?v=1671595388795\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v6-bc4af620-0763-4ba1-b81e-2467718ff098.jpg?v=1671595400476\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v4-ae07f6d9-4166-4f48-a078-a0f281b40053.jpg?v=1671595406547\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v8-f2c2359a-60a1-40aa-b4f1-0551e6daf9e4.jpg?v=1671595415258\" /></strong></em></p>', '', 'Móc chìa khóa kim loại', 'móc chìa khóa, móc chìa khóa kim loại, móc khóa, móc khóa kim loại, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/29006526/moc-chia-khoa-kim-loai-kiem-khui-mo-bia-khac-laser-theo-yeu-cau.jpg', '<p>Trong những lần vui chơi cùng bạn bè, bạn đã bao giờ phải loay hoay tìm cho mình dụng cụ khui bia và để cho cuộc vui bị gián đoạn. Vậy hãy để Volcano giới thiệu cho bạn chiếc&nbsp;Móc chìa', '29006526', '78506876', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:59', '2024-05-29 06:10:59'),
(887, 'thung-dung-do-gan-duoi-xe-may-td608', 'Thùng Đựng Đồ Gắn Đuôi Xe Máy TD608', '<p><em><strong>Thùng Đựng Đồ Gắn Đuôi Xe Máy TD608</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn không thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>&nbsp;Có thể đựng được nón bảo hiểm và phụ kiện&nbsp;rất tiện dụng cho những cuộc đi chơi, đi phượt.</p>\n<p>&nbsp;Dung tích 22L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, không sợ mưa làm ướt đồ.Thùng lắp được đa&nbsp;trên mọi loại xe có phần đuôi kiểu giá rộng.</p>\n<p>Chất liệu nhựa ABS siêu bền, dán viền phản quang&nbsp;đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm đế,&nbsp;thanh ngang, ốc lắp&nbsp;đặt đơn giản lên khung đuôi (BAGA) xe.</p>\n<p>Kích thước :&nbsp; 38*27*37.5cm.</p>\n<p>&nbsp;Dung tích: 22L.</p>\n<p>Lắp đặt cho các dòng xe có phần đuôi sau dài và bằng, các xe không có đuôi bằng và dài cần chế hoặc lắp thêm gá để lắp đặt.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-td-608-v10.jpg?v=1670904121101\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-td-608-2.jpg?v=1670904127070\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-td-608-1.jpg?v=1670904136255\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-td-608-3.jpg?v=1670920614810\" /></strong></em></p>\n<p><img src=