(890, 'ban-gan-so-dien-thoai-gau-bearbrick-dan-taplo-o-to', 'Bản gắn số điện thoại Gấu Bearbrick dán taplo ô tô', '<p><strong><em>Bản gắn số điện thoại Gấu Bearbrick dán taplo ô tô</em></strong></p>\n<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần.</p>\n<p>Bảng gắn số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giản tiện dụng gắn&nbsp;số đơn giản.</p>\n<p>Sử dụng&nbsp;đơn giản với 5 dãy số từ 0 đến 9&nbsp;có thể thay đổi số điện thoại dễ dàng.</p>\n<p>Chất liệu cao su dẻo bền bỉ, viền đính đá và gắn hoa trà rất tinh tế sang trọng.</p>\n<p>Kích thước: nhỏ gọn 143*20*10MM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-gan-so-dien-thoai-3.jpg?v=1670041218746\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-gan-so-dien-thoai-4.jpg?v=1670041225015\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-gan-so-dien-thoai-2.jpg?v=1670041231571\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-gan-so-dien-thoai-1-32d4dfd4-ce81-4de4-96ea-81fae062dac3.jpg?v=1670041237318\" /></p>', '', 'Bản gắn số điện thoại Gấu Bearbrick dán taplo ô tô', 'Bản gắn số điện thoại Gấu Bearbrick dán taplo ô tô, Bảng dán số điện thoại, bảng dán số đt, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/28711962/ban-gan-so-dien-thoai-gau-bearbrick-dan-taplo-o-to.jpg', '<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần.</p>\n<p>Bảng gắn số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giả', '