(892, 'bo-02-mieng-dan-silicon-chong-va-dap-goc-cua-xe-o-to', 'Bộ 02 Miếng dán silicon chống va đập góc cửa xe ô tô', '<p><em><strong>Bộ 02 Miếng dán silicon chống va đập góc cửa xe ô tô</strong></em></p>\n<p>Sản phẩm gồm 2 miếng dán sillicon chống xước góc cửa được làm từ chất liệu decal nylon trong suốt giúp bảo vệ góc cửa xe ô tô không bị trầy xước va đập luôn sáng bóng.</p>\n<p>Được thiết kế với chất liệu keo dán chắc chắn, không bong tróc khi rửa xe.</p>\n<p>Sản phẩm dễ dàng sử dụng vói thao tác bóc dán có thể thực hiện ngay tại nhà.</p>\n<p>Kích thước 6cmx4,5cm, dày 2mm.</p>\n<p>Phân loại: Trong suốt, logo toyota, Doremon.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-5-cad2488c-a3be-49f9-8d76-a483d359b9f7.jpg?v=1669881860525\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-6.jpg?v=1669881866668\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-7.jpg?v=1669881896446\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-8.jpg?v=1669881902186\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-1.jpg?v=1669881687660\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-4.jpg?v=1669881693294\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-dan-mep-cua-xe-o-to-v3.jpg?v=1669881699651\" /></p>\n<p>&nbsp;</p>', '', 'Miếng dán silicon chống va đập góc cửa xe ô tô', 'Bộ 02 Miếng dán silicon chống va đập góc cửa xe, Bộ 02 Miếng dán silicon chống va đập góc cửa xe ô tô, miếng dán góc cửa xe, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Loại', 'Toyota', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/28694124/bo-02-mieng-dan-silicon-chong-va-dap-goc-cua-xe-o-to.jpg', '<p>Sản phẩm gồm 2 miếng dán sillicon chống xước góc cửa được làm từ chất liệu decal nylon trong suốt giúp bảo vệ góc cửa xe ô tô không bị trầy xước va đập luôn sáng bóng.</p>\n<p>Được thiết kế', '28694124', '77089689', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:10:59', '2024-05-29 06:10:59'),
(893, 'moc-treo-do-o-to-hoa-tra-dan-trang-tri-noi-that-xe-sieu-xinh', 'Móc treo đồ ô tô hoa trà dán trang trí nội thất xe siêu xinh', '<p><em><strong>Móc treo đồ ô tô hoa trà dán trang trí nội thất xe siêu xinh</strong></em></p>\n<p>Tiện lợi, hữu ích sử dụng được cho mọi loại xe.</p>\n<p>Chất liệu nhựa cao cấp, đính hoa trà đẹp mắt.</p>\n<p>Kích thước: 3*2.2*1.2CM.</p>\n<p>Giá sản phẩm 01 chiếc.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-dinh-hoa-tra-3-0e50b991-fbbc-479b-9fd9-4c295badeb4f.jpg?v=1669791695389\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-dinh-hoa-tra-1-9a0f1789-a9fd-47fb-8c20-5018e90c2729.jpg?v=1669791702103\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-dinh-hoa-tra-2-6b50e6be-3529-4b1d-b805-08cb18ff7f25.jpg?v=1669791709407\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-dinh-hoa-tra-5.jpg?v=1669793758411\" /></p>', '', 'Móc treo đồ ô tô hoa trà dán trang trí nội thất xe siêu xinh', 'móc treo đồ, Móc treo đồ ô tô hoa trà dán trang trí nội thất xe siêu xinh, móc treo đồ trên xe ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/28676775/moc-treo-do-o-to-hoa-tra-dan-trang-tri-noi-that-xe-sieu-xinh.jpg', '<p><em><strong>Móc treo đồ ô tô hoa trà dán trang trí nội thất xe siêu xinh</strong></em></p>\n<p>Tiện lợi, hữu ích sử dụng được cho mọi loại xe.</p>\n<p>Chất liệu nhựa cao cấp, đính hoa trà đẹ', '28676775', '76974043', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '20