(896, 'chot-cai-day-an-toan-xe-o-to-dinh-hoa-tra', 'Chốt cài dây an toàn xe ô tô đính hoa trà', '<p><em><strong>Chốt cài dây an toàn xe ô tô đính hoa trà</strong></em></p>\n<p>Chốt cài dây an toàn xe ô tô, cắm nối tiếp chống kêu&nbsp;giúp cho người ngồi trong xe không phải nghe tiếng \"bíp\" của xe khi không cài dây an toàn nữa. Đây cũng là vật trang trí cho xe với kiểu dáng đẹp và dễ sử dụng.</p>\n<p>Chất liệu: Hợp kim thép mạ crom và vỏ nhựa ABS đính hoa trà đẹp mắt.</p>\n<p>Sử dụng: Chốt vừa tất cả các loại xe.</p>\n<p>Kích thước sản phẩm: 8*5.2*3CM, chốt 4*2.2CM.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-hoa-tra-v7.jpg?v=1669685645349\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-hoa-tra-v3.jpg?v=1669685651805\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-hoa-tra-v4.jpg?v=1669685658481\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-hoa-tra-v5.jpg?v=1669685665641\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-hoa-tra-v1.jpg?v=1669685670508\" /></p>\n<p>&nbsp;</p>', '', 'Chốt cài dây an toàn xe ô tô đính hoa trà', 'chốt an toàn ô tô, chốt cài dây an toàn, Chốt cài dây an toàn xe ô tô đính hoa trà, chốt dây an toàn, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', '1 Chiếc', '', '', '', '', '', '', '', 'deny', '', '75000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/28665940/chot-cai-day-an-toan-xe-o-to-dinh-hoa-tra.jpg', '<p>Chất liệu: Hợp kim thép mạ crom và vỏ nhựa ABS đính hoa trà đẹp mắt.</p>\n<p>Sử dụng: Chốt vừa tất cả các loại xe.</p>\n<p>Kích thước sản phẩm: 8*5.2*3CM, chốt 4*2.2CM.</p>', '28665940', '76916462', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:00', '2024-05-29 06:11:00'),
