(898, 'thung-xang-dau-du-phong-10l-cho-xe-offroad-xe-ban-tai', 'Thùng Xăng Dầu Dự Phòng 10L Cho Xe Offroad, Xe Bán Tải', '<p><em><strong>Thùng Xăng Dầu Dự Phòng 10L Cho Xe Offroad, Xe Bán Tải</strong></em></p>\n<p>Thùng được thiết kế với tay cầm phía sau có tỷ lệ đặc biệt để việc đổ nhiên liệu dễ dàng và cân bằng hơn.</p>\n<p>Chất liệu: Cao Cấp Nhựa Kỹ Thuật,&nbsp;độ bền cao,&nbsp;chống ăn mòn, chống tĩnh điện, chống tia cực tím.</p>\n<p>Có &nbsp;lỗ thông hơi&nbsp;thiết kế để ngăn thấm ngược của áp suất âm tạo ra</p>\n<p>Dung tích: 10Lít,&nbsp;phù hợp cho xe offroad, leo núi, cắm trại...</p>\n<p>Kích Thước: 47x10x335cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-xang-du-phong-1.jpg?v=1669602156368\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><br />\n&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-xang-du-phong-3.jpg?v=1669604130034\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-xang-du-phong-4.jpg?v=1669604136860\" /></strong></em></p>', '', 'Thùng Xăng Dầu Dự Phòng 10L', 'ô tô, phụ  kiện ô tô, Thùng Xăng Dầu Dự Phòng 10L, Thùng Xăng Dầu Dự Phòng 10L Cho Xe Offroad, Volcano, volcano.vn, Xe Bán Tải', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '990000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/28656654/thung-xang-dau-du-phong-10l-cho-xe-offroad-xe-ban-tai.jpg', '<p>Chất liệu: Cao Cấp Nhựa Kỹ Thuật,&nbsp;độ bền cao,&nbsp;chống ăn mòn, chống tĩnh điện, chống tia cực tím.</p>\n<p>Có &nbsp;lỗ thông hơi&nbsp;thiết kế để ngăn thấm ngược của áp suất âm tạo r', '28656654', '76790914', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:00', '2024-05-29