(900, 'kep-bao-da-dung-de-kinh-tren-o-to-dinh-hoa', 'Hộp Đựng Kính Kẹp Tấm Chắn Nắng Trên Xe Hơi đính hoa trà', '<p><strong><em>Hộp Đựng Kính Kẹp Tấm Chắn Nắng Trên Xe Hơi đính hoa trà</em></strong></p>\n<p>Dễ dàng lắp đặt, sử dụng để kẹp kính, thẻ phí, thẻ ngân hàng, danh thiếp và hóa đơn...Ngoài ra còn là món phụ kiện trang trí sang trọng trên xe.</p>\n<p>Thiết kế từ chắt liệu da PU chất liệ cao cấp chống nổ, chống bong, bên trong lót nhung chống xước mặt kính.</p>\n<p>Nắp đậy sử dụng nam châm tiện dụng.</p>\n<p>Kích thước: 18*7.5*CM.</p>\n<p>Màu sắc: Đen.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-c11fcdcb-3a5c-4e2b-b7a7-c026d49773cd.jpg?v=1669197189774\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/6-7afa0f19-02ae-44a6-b052-86e098d8084b.jpg?v=1669197199541\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-c6cd3640-283a-4f0c-917c-14b986f5c0cf.jpg?v=1669197208279\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/1-dd9a9bcf-4c3d-49a9-88f3-badb88af37dd.jpg?v=1669197214184\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-b8a15425-5006-4ba4-82d2-8d7316030daa.jpg?v=1669197222184\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/7-5cba88f2-2c85-4909-a59d-e96d53157192.jpg?v=1669197228671\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-578e9c4c-53ff-404d-9db1-ef6ba6745c5e.jpg?v=1669197235160\" /></p>', '', 'Kẹp bao da đựng để kính trên ô tô đính hoa', 'Kẹp bao da đựng để kính trên ô tô đính hoa, kẹp đựng kính ô tô, kẹp kinh ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/28617580/kep-bao-da-dung-de-kinh-tren-o-to-dinh-hoa.jpg', '<p>Dễ dàng lắp đặt, sử dụng để kẹp kính, thẻ phí, thẻ ngân hàng, danh thiếp và hóa đơn...Ngoài ra còn là món phụ kiện trang trí sang trọng trên xe.</p>\n<p>Thiết kế từ chắt liệu da PU chất liệ', '28617580', '76500597', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:00', '2024-05-29 06:11:00'),
(901, 'bo-10-dai-chong-tron-lop-o-to-off-road', 'Bộ 10 Đai chống trơn, chống ban, sa lầy lốp ô tô off-road', '<p><em><strong>Bộ 10 Đai chống trơn, chống ban, sa lầy&nbsp;lốp ô tô off-road</strong></em></p>\n<p>Dù xe có trang bị công nghệ dẫn động 4 bánh, khóa vi sai đi chăng nữa, vẫn có những địa hình không thể vượt qua.</p>\n<p>Bộ sản phẩm Đai chống trơn trượt cho lốp xe ô tô off-road cực hiệu quả đối với những mẫu xe thường xuyên phải di chuyển vào vùng lún như sa mạc đầy cát, hố bùn, đầm lầy, nguy cơ xe bị sa lầy luôn hiện hữu.</p>\n<p>Chất liệu: Nhựa cứng Đai chống trơn trượt cho lốp xe ô tô off-road một sản phẩm tiện dụng gọn gàng dễ dàng mang trên mỗi chyến đi.</p>\n<p>Với thiết kế tạo các bậc, gai&nbsp;sẽ giúp bánh xe dễ dàng đi lên mà không bị ban bánh.&nbsp;</p>\n<p>Dây đai vải dù bền bỉ, khóa kim loại chắc chắn.</p>\n<p>Bộ sản phẩm gồm 10 đai gắn 2 lốp sau.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v7.jpg?v=1669178986959\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v6.jpg?v=1669178999849\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v4.jpg?v=1669179006679\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v3.jpg?v=1669179013089\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v1.jpg?v=1669179018435\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-banh-xe-v2.jpg?v=1669179024536\" /></strong></em></p>', '', 'Bộ 10 Đai chống trơn lốp ô tô off-road', 'Bộ 10 Đai chống trơn lốp ô tô off-road, chống trơn ô tô, đai lốp ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '200', 'kg', 'images/28614288/bo-10-dai-chong-tron-lop-o-to-off-road.jpg', '<p>Chất liệu: Nhựa cứng Đai chống trơn trượt cho lốp xe ô tô off-road một sản phẩm tiện dụng gọn gàng dễ dàng mang trên mỗi chyến đi.</p>\n<p>Với thiết kế tạo các bậc, gai&nbsp;sẽ giúp bánh xe', '28614288', '76477676', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:00', '2024-05-29 06:11:00'),
(902, 'o-cam-sac-dien-thoai-hai-cong-usb-qc3-0-co-den-led-hien-thi-dien-ap-12v-cho-xe-toyota', 'Ổ cắm sạc điện thoại hai cổng USB QC3.0 có đèn led hiển thị điện áp 12V-24V cho xe Toyota', '<p><em><strong>Ổ cắm sạc điện thoại hai cổng USB QC3.0 có đèn led hiển thị điện áp 12V-24V cho xe Toyota</strong></em></p>\n<p>Sử dụng thay thế trực&nbsp;tiếp ổ cũ trên xe toyota đời cũ không cần tùy&nbsp;chỉnh, hay khoan vỏ xe.</p>\n<p>Có đèn đèn led hiển thị điêph áp trên xe</p>\n<p>Sử dụng cho xe 12-24V.</p>\n<p>Chất liệu vỏ nhựa cao cấp, chân gài chắc chắn.</p>\n<p>Lưu ý đo đúng kích thước ổ sạc cũ trên xe: 40x50mm, chân 24mm.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v1.jpg?v=1669086147497\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v2.jpg?v=1669086148340\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v3.jpg?v=1669086149006\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v5.jpg?v=1669086149677\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v6.jpg?v=1669086150769\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v4.jpg?v=1669086169016\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cu-sac-2-cong-usb-12v-v7.jpg?v=1669086178116\" /></p>', '', 'Ổ cắm sạc điện thoại hai cổng USB QC3.0', 'Ổ cắm sạc điện thoại hai cổng USB QC3.0, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title'