(903, 'bo-20-oc-vit-nhua-cho-tam-chan-bun-gan-can-va-long-de-xe-o-to-lo-8mm', 'Bộ 20 ốc vít nhựa cho tấm chắn bùn, gắn cản và lòng dè xe ô tô lỗ 8mm tặng kèm tua vít', '<p><strong><em>Bộ 20 ốc vít nhựa cho tấm chắn bùn, gắn cản và lòng dè xe ô tô lỗ 8mm tặng kèm tua vít</em></strong></p>\n<p>Sản phẩm được sử dụng rộng rãi cho chắn bùn xe, cản, cửa, tấm chắn bên hoặc bề mặt khác của xe .</p>\n<p>Trọng lượng nhẹ và dễ sử dụng</p>\n<p>Phù hợp với: Mọi loại xe - Số lượng: 20 - Chất liệu: Nhựa - Đường kính đầu (tối đa): 20mm - Màu sắc: xám&nbsp;- Phù hợp kích thước lỗ: 8 mm.</p>\n<p>Tặng kèm 01 tua vít nhỏ để lắp.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vit-nhua-v7.jpg?v=1669081123645\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vit-nhua-v8.jpg?v=1669081130505\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vit-nhua-v2.jpg?v=1669081138980\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vit-nhua-v3.jpg?v=1669081144980\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vit-nhua-v4.jpg?v=1669081151648\" /></p>', '', 'Bộ 20 ốc vít nhựa', 'Bộ 20 ốc vít nhựa, ô tô, ốc vít chắn bung ô tô, ốc vít nhựa, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/28593592/bo-20-oc-vit-nhua-cho-tam-chan-bun-gan-can-va-long-de-xe-o-to-lo-8mm.jpg', '<p>Sản phẩm được sử dụng rộng rãi cho chắn bùn xe, cản, cửa, tấm chắn bên hoặc bề mặt khác của xe .</p>\n<p>Trọng lượng nhẹ và dễ sử dụng</p>\n<p>Phù hợp với: Mọi loại xe - Số lượng: 20 - Chất ', '28593592', '76268508', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:02', '2024-05-29 06:11:02'),
(904, 'tau-sac-xe-o-to-2-cong-usb-remax-rcc220-chinh-hang', 'Tẩu sạc xe ô tô 2 cổng USB Remax RCC-220 chính hãng', '<p><em><strong>Tẩu sạc xe ô tô 2 cổng USB Remax RCC-220 chính hãng</strong></em></p>\n<p>Model:RCC-220, chính hãng Hãng:Remax.</p>\n<p>Input:12-24V</p>\n<p>Output: DC5V-2.4V</p>\n<p>Kích thước: 59.8*24mm</p>\n<p>Màu sắc: Đen, ghi.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-remax-5.jpg?v=1669022428601\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-remax-3.jpg?v=1669022435746\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-remax-4.jpg?v=1669022441158\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-remax-2.jpg?v=1669022449236\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-remax-1.jpg?v=1669022454417\" /></p>', '', 'Tẩu sạc xe ô tô 2 cổng USB Remax RCC-220 chính hãng', 'ô tô, phụ  kiện ô tô, tẩu ô tô, tẩu sạc xe hơi, tẩu sạc xe ô tô, Tẩu sạc xe ô tô 2 cổng USB Remax RCC-220 chính hãng, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/28587054/tau-sac-xe-o-to-2-cong-usb-remax-rcc220-chinh-hang.jpg', '<p>Model:RCC-220, chính hãng Hãng:Remax.</p>\n<p>Input:12-24V</p>\n<p>Output: DC5V-2.4V</p>\n<p>Kích thước: 59.8*24mm</p>\n<p>Màu sắc: Đen, ghi.</p>', '28587054', '76130654', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:02', '2024-05-29 06:11:02'),
(905, 'coc-dung-do-treo-lung-ghe-o-to-dinh-hoa', 'Cốc đựng đồ treo lưng ghế ô tô đính hoa', '<p><em><strong>Cốc đựng đồ treo lưng ghế ô tô đính hoa</strong></em></p>\n<p>Cốc tiện đựng chống thâm nước đa năng có thể để ô dù, đựng rác, chai nước...</p>\n<p>Chất liệu nhựa ABS cứng cáp chắc chắn.</p>\n<p>Quai treo lưng ghế ô tô tiện dụng.</p>\n<p>Kích thước: 19.5*10.5*8CM.</p>\n<p>Giá sản phẩm: 01 cốc.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v2-8d921242-532f-4b6b-84f5-7ac492139916.jpg?v=1669014765657\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v3-9eb51800-604d-4c01-9e25-02305185ada4.jpg?v=1669014771738\" /></strong></em><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v4-7af62ee8-f8fd-4b1a-a6f1-cc537295a42d.jpg?v=1669014787086\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v5-2f8fc6ef-189a-4cfa-87bc-d86bdef11b80.jpg?v=1669014792788\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v1-55a72fba-c8d2-4fd5-979e-4c4342db9e19.jpg?v=1669014798212\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v7-58e06a18-12ce-4aed-b0f7-c97b067f42ef.jpg?v=1669014804720\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v6-17c9beae-8b36-4def-bf6b-e33b1b600782.jpg?v=1669014811163\" /></strong></em></p>', '', 'Cốc đựng đồ treo lưng ghế ô tô đính hoa', 'cố đựng đồ, Cốc đựng đồ treo lưng ghế ô tô đính hoa, cốc đựng rác, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/28583650/coc-dung-do-treo-lung-ghe-o-to-dinh-hoa.jpg', '<p>Cốc tiện đựng chống thâm nước đa năng có thể để ô dù, đựng rác, chai nước...</p>\n<p>Chất liệu nhựa ABS cứng cáp chắc chắn.</p>\n<p>Quai treo lưng ghế ô tô tiện dụng.</p>\n<p>Kích thước: 19.5', '28583650', '76094394', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:02', '2024-05-29 06:11:02'),
(906, 'bo-dung-cu-sua-chua-xe-dap-da-nang', 'Bộ dụng cụ sửa chữa xe đạp đa năng 11 món', '<p><strong><em>Bộ dụng cụ sửa chữa xe đạp đa năng 11 món</em></strong></p>\n<p>Dụng Cụ Sửa Chữa Cầm Tay Đa Năng 11 món. Với kích thước nhỏ gọn, tiện lợi có thể mang theo bên mình để lắp ráp, sửa chữa xe đạp khi gặp sự cố.</p>\n<p>Ngoài ra bạn có thể dùng trong gia đình và các trường hợp khẩn cấp.</p>\n<p>Sản phẩm được làm bằng thép&nbsp;cacbon&nbsp;có độ bền cao và thời gian sử dụng lâu dài.</p>\n<p>Dễ dàng mang theo và cất giữ. Kích thước gấp: 7,5 * 4,1 * 2,4cm.</p>\n<p>Bộ sản phẩm&nbsp;gồm: lục giác 2 / 2.5 / 3/4 / 5/6/8 mm;Thiết bị xích dao; Tuốc nơ vít Phillips PH1; Tuốc nơ vít có rãnh; Cờ lê ổ cắm.</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-1.jpg?v=1668764968922\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-2.jpg?v=1668764985419\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-3.jpg?v=1668764986299\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-6.jpg?v=1668764987014\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-4.jpg?v=1668764998375\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-10-mon-sua-chua-xe-dap-5.jpg?v=1668765003894\" /></em></strong></p>\n<p>&nbsp;</p>', '', 'Bộ dụng cụ sửa chữa xe đạp đa năng', 'Bộ dụng cụ sửa chữa xe đạp đa năng, dụng cụ sửa chữa xe đạp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Xanh', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/28562325/bo-dung-cu-sua-chua-xe-dap-da-nang.jpg', '<p>Sản phẩm được làm bằng thép&nbsp;cacbon&nbsp;có độ bền cao và thời gian sử dụng lâu dài.</p>\n<p>Dễ dàng mang theo và cất giữ. Kích thước gấp: 7,5 * 4,1 * 2,4cm.</p>\n<p>Bộ sản phẩm&nbsp;gồm', '28562325', '75882267', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:02', '2024-05-29 06:11:02'),
(907, 'bo-va-lop-khong-xam-cho-xe-may-o-to', 'Bộ vá lốp không xăm cho xe máy, ô tô', '<p><em><strong>Bộ vá lốp không xăm cho xe máy, ô tô</strong></em></p>\n<p>Bộ dụng cụ&nbsp;tiện dụng gồm: 1 cây gắp đinh, 1 cây chịu lực để đưa cao su vào, 1 chai keo và 3 cây cao su, giúp bạn có thể tự tay xá xe khi bị lủng lốp vô cùng tiện dụng.</p>\n<p>Dùng vá bánh xe máy, xe ô tô loại không xăm.</p>\n<p>Cây gắp&nbsp;chịu lực để đưa cao su vào làm bằng chất liệu inox sáng bóng, tay cầm bọc nhựa chắc chắn, chịu lực tốt, dễ sử dụng.</p>\n<p>Thiết kế gọn nhẹ, tiện lợi bỏ vào cốp xe mang theo sử dụng bất cứ khi nào cần.</p>\n<p>Cách dùng:</p>\n<p>Dùng cây dùi hình xoắn (dùng để dùi nong lổ thủng) chấm vào keo cho trơn rồi làm gọn mép vết thủng và rộng thêm một chút nếu lỗ thủng quá nhỏ so với tiết diện dây cao su. Lồng dây cao su non vào lổ của dùi xâu, nhúng dây cao su non vào keo, gập đôi dây cao su qua đầu dùi, sau đó đút ngập đầu dùi có dây cao su qua lỗ thủng của lốp xe.</p>\n<p>Khi rút dùi ra nên rút từ từ sao cho phần gấp của dây cao su ở lại trong lòng lốp, dùng kéo cắt 2 đầu thừa phía ngoài.</p>\n<p>Sau vài phút bắt đầu bơm hơi từ từ vào lốp cho đến khi áp suất trong lốp đạt độ căng theo tiêu chuẩn của loại lốp đó.<em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-v11.jpg?v=1668740519133\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-v10.jpg?v=1668740528634\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-v3.jpg?v=1668740537010\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-