(910, 'bo-02-guong-chieu-hau-xe-may-sf-019', 'Bộ 02 Gương Chiếu Hậu Xe Máy SF-019', '<p><em><strong>Bộ 02 Gương Chiếu Hậu Xe Máy SF-019</strong></em></p>\n<p>Bộ 02 gương chiếu hậu với phong cách thiết kế mới lạ mặt gương trong giúp người dùng quan xát tốt khi lái xe.</p>\n<p>Chân gương và tay gương được thiết kế từ nhựa ABS siêu bền, mặt gương từ kính trong. Tay gương định hình sẵn chân gương có thể xoay 360 độ theo tùy chỉnh người dùng.</p>\n<p>Lắp đặt được cho mọi loại xe với 3 bộ ốc chân gương 10mm và 8mm có đủ ốc ren thuận và ren ngược.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-1-d1f86fd4-ddaf-4bee-8c8a-442d6d4a64e0.jpg?v=1668564949961\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-2-ac90c76c-02cf-4ca5-a90b-2fba1ecfff0c.jpg?v=1668564950905\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-4-dc7fdbab-f102-431e-9dbc-0c92da2f0e5b.jpg?v=1668564951823\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-5-b3552fa7-4b6c-4551-9b7b-e223a272eb05.jpg?v=1668564952628\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-6-945e48de-d32c-4a86-a1cc-d5ad7d9caf20.jpg?v=1668564953577\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-sf-019-7-bc65c589-c60c-4182-96c0-0abfcb764be9.jpg?v=1668564954314\" /></strong></em></p>', '', 'Gương xe máy', 'giá đỡ gắn chân gương xe máy, guong chiếu hậu xe máy, gương xe máy, gương xe máy đẹp, gương xe máy thời trang, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '185000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/28541863/bo-02-guong-chieu-hau-xe-may-sf-019.jpg', '<p>Bộ 02 gương chiếu hậu với phong cách thiết kế mới lạ mặt gương trong giúp người dùng quan xát tốt khi lái xe.</p>\n<p>Chân gương và tay gương được thiết kế từ nhựa ABS siêu bền, mặt gương t', '28541863', '75679011', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:03', '2024-05-29 06:11:03'),
