(915, 'choi-gat-nuoc-quet-san-dau-silicon-mem-thong-minh-tien-loi-tang-kem-01-dau-choi', 'Chổi Gạt Nước, Quét Sàn Đầu Silicon Mềm Thông Minh Tiện Lợi (Tặng Kèm 01 Đầu Chổi)', '<p><em><strong>Chổi Gạt Nước, Quét Sàn Đầu Silicon Mềm Thông Minh Tiện Lợi (Tặng Kèm 01 Đầu Chổi)</strong></em></p>\n<p>Chất liệu: Thân chổi bằng inox, lưỡi chổi bằng silicon&nbsp;</p>\n<p>Thiết kế: Có thể tháo khúc gọn gàng.</p>\n<p>Kích thước: cao 92CM, đầu chổi rộng 31CM.</p>\n<p>Màu sắc: Ghi, hồng, xanh&nbsp;</p>\n<p>Bạn có thể dùng quét nhà, quét nước, quét bẩn ở sàn, trên tường, lau kính&nbsp;mà không lo bị hư đầu chổi, 1 cây chăc xài cả năm không hư.</p>\n<p>Cấu tạo phần gạt nước silicon thông minh gạt nước siêu nhanh sau khi cọ rửa, cực sạch sẽ.</p>\n<p>Đặc biệt mua 1 chổi được tặng kèm&nbsp;1 đầu chổi.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v3-aca95461-6c00-4358-8b74-e05dc9a5e495.jpg?v=1667877419134\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v1.jpg?v=1667873208408\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v2.jpg?v=1667873209326\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v4.jpg?v=1667873211006\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v5.jpg?v=1667873211672\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v9.jpg?v=1667877293707\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v11.jpg?v=1667877300525\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/choi-quet-san-dau-silicon-v12.jpg?v=1667877309038\" /></strong></em></p>', '', 'Chổi Gạt Nước, Quét Sàn Đầu Silicon', 'Chổi Gạt Nước, Quét Sàn Đầu Silicon, Volcano, volcano.vn', '1', 'Màu sắc', 'Ghi', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/28432574/choi-gat-nuoc-quet-san-dau-silicon-mem-thong-minh-tien-loi-tang-kem-01-dau-choi.jpg', '<p>Chất liệu: Thân chổi bằng inox, lưỡi chổi bằng silicon&nbsp;</p>\n<p>Thiết kế: Có thể tháo khúc gọn gàng.</p>\n<p>Màu sắc: Ghi, hồng, xanh&nbsp;</p>\n<p>Bạn có thể dùng quét nhà, quét nước, q', '28432574', '75002149', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:05', '2024-05-29 06:11:05'),
(916, 'bo-goi-tua-dau-tua-lung-thien-nga', 'Bộ gối tựa đầu tựa lưng thiên nga', '<p><strong><em>Bộ gối tựa đầu tựa lưng thiên nga</em></strong></p>\n<p>Với tông màu thật tinh tế với sự pha trộn một chút màu đen và trắng mát mẻ.&nbsp;</p>\n<p>Chất liệu da mềm cao cấp, đính đá và logo thiêm nga sang trọng.</p>\n<p>Bộ sản phẩm gồm: 2 gối tựa đầu 19*28*10cm&nbsp;, 2 gối tựa lưng 37*37*14cm.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v1.jpg?v=1667615698949\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v2.jpg?v=1667615699874\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v3.jpg?v=1667615700763\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v4.jpg?v=1667615701456\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v5.jpg?v=1667615702180\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v6.jpg?v=1667615703059\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-goi-tua-lung-tua-dau-thien-nga-dinh-da-v7.jpg?v=1667615703944\" /></em></strong></p>\n<p><img data-thumb=\"original\" origi