(917, 'thanh-kim-loai-co-dinh-hang-hoa-tren-thung-xe-ban-tai', 'Thanh kim loại cố định hàng hóa trên thùng xe bán tải Isuzu Dmax', '<p><em><strong>Thanh kim loại cố định hàng hóa trên thùng xe bán tải Isuzu Dmax</strong></em></p>\n<p>&nbsp;Với&nbsp;cả một thùng chở hàng rộng lớn phía sau trên thùng xe bán tải,&nbsp;Thế nhưng không phải lái xe nào cũng biết cách để hàng hoá, đồ đạc trên thùng xe sao cho khoa học và an toàn?</p>\n<p>Thanh kim loại cố&nbsp;định hàng hóa trên thùng xe bán tải sẽ là một giải pháp hữu ích cho Anh em lái xe.</p>\n<p>Chất liệu loại, 2 bên là đế cao su chống trượt, tùy chỉnh được kích thước, thêm thanh ngang để giữ hoạc phân loại hàng hóa.</p>\n<p>Sử dụng đơn giản với phần tùy chỉnh và cố định răng cưa&nbsp;chắc chắn.</p>\n<p>Kích thước tùy chỉnh: 135-171CM, đường kính 4CM, trọng lượng 3.7KG.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thanh-chan-thung-xe-ban-tai-4.jpg?v=1667446390741\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thanh-chan-thung-xe-ban-tai-8-7146e9c5-1118-4d2d-a6ae-f45678c2f80d.jpg?v=1667446409547\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thanh-chan-thung-xe-ban-tai-2.jpg?v=1667442229649\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thanh-chan-thung-xe-ban-tai-3.jpg?v=1667442235186\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thanh-chan-thung-xe-ban-tai-6.jpg?v=1667442251169\" /></strong></em></p>', '', 'Thanh kim loại cố định hàng hóa trên thùng xe bán tải', 'hanh kim loại cỗ định hàng hóa trên thùng xe bán tải, ô tô, phụ  kiện ô tô, Thanh kim loại cố định hàng hóa trên thùng xe bán tải, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '1600000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/28339586/thanh-kim-loai-co-dinh-hang-hoa-tren-thung-xe-ban-tai.jpg', '<p>Thanh kim loại cố&nbsp;định hàng hóa trên thùng xe bán tải sẽ là một giải pháp hữu ích cho Anh em lái xe.</p>\n<p>Chất liệu loại, 2 bên là đế cao su chống trượt, tùy chỉnh được kích thước, ', '28339586', '74687446', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:05', '2024-05-29 06:11:05'),
(918, 'khau-trang-vai-anti-dust-mask-khang-khuan', 'Khẩu Trang Vải ANTI DUST MASK lọc bụi mịn PM2.5, có van thở 1 chiều', '<p><em><strong>Khẩu Trang Vải ANTI DUST MASK lọc bụi mịn PM2.5, có van thở 1 chiều</strong></em></p>\n<p>CHỐNG BỤI MỊN, KHÁNG KHUẨN</p>\n<p>Chất liệu vải&nbsp;thoáng mát không chạm tới miệng khi đeo.</p>\n<p>Quai đeo được pha thêm sợi vải spandex đảm bảo độ co dãn đàn hồi, có thể tùy chỉnh.</p>\n<p>Chống giọt bắn, lọc 99% tia UVa và Uvb.</p>\n<p>Tặng kèm lọc bụi mịn PM2.5.</p>\n<p>Van thở 1 chiều chất lượng cao được làm từ nhựa PP nguyên sinh và silicone, thiết kế 1 chiều, không khí chỉ có thể thoát ra mà không thể vào ngược lại, loại bỏ tình trạng đọng độ ẩm, hơi thở làm mờ mắt kính.</p>\n<p>Tái sử dụng được&nbsp;nhiều lần.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v7.jpg?v=1666256203440\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v4.jpg?v=1666256155052\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v3.jpg?v=1666256161499\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v1.jpg?v=1666256169867\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v2.jpg?v=1666256181353\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v5.jpg?v=1666256186590\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khau-trang-pm-2-5-v8.jpg?v=1666256192876\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Khẩu Trang Vải ANTI DUST MASK', 'có van thở 1 chiều, Khẩu trang, khẩu trang đi xe đạp, Khẩu Trang Vải ANTI DUST MASK, Khẩu Trang Vải ANTI DUST MASK lọc bụi mịn PM2.5, Khẩu trang vải cao cấp, phụ kiện xe máy, Volcano, volcano', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/28153581/khau-trang-vai-anti-dust-mask-khang-khuan.jpg', '<p>Chất liệu vải&nbsp;thóang mát không chạm tới miệng khi đeo.</p>\n<p>Quai đeo được pha thêm sợi vải spandex đảm bảo độ co dãn đàn hồi, có thể tùy chỉnh.</p>\n<p>Chống giọt bắn, lọc 99% tia UV', '28153581', '73905400', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:05', '2024-05-29 06:11:05'),
(919, 'bo-dung-cu-va-dau-tra-phanh-dia-xe-dap-the-thao', 'Bộ dụng cụ và dầu tra phanh đĩa xe đạp thể thao', '<p><em><strong>Bộ dụng cụ và dầu tra phanh đĩa xe đạp thể thao</strong></em></p>\n<p>Một cách khoa học và dễ dàng hơn để thay dầu</p>\n<p>Ống tiêm được làm từ chất liệu cao cấp có khả năng chống dầu khoáng, bền cho thời gian sử dụng lâu dài mà không bị biến dạng.</p>\n<p>Phễu được thiết kế để phù hợp với hầu hết các xe đạp đĩa, nó có thể giúp bạn bơm dầu nhanh chóng mà không làm bẩn tay.</p>\n<p>Nhẹ và di động, dễ dàng mang theo và lưu trữ, bạn có thể đặt nó trong túi dụng cụ xe đạp trong trường hợp tai nạn.&nbsp;</p>\n<p>Dầu tra dung tích 60lm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v6.jpg?v=1666074822761\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v2.jpg?v=1666074830695\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v3.jpg?v=1666074837169\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v8.jpg?v=1666074862491\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v9.jpg?v=1666074869253\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v10.jpg?v=1666075844961\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dau-phanh-dia-xe-dap-leo-nui-v11.jpg?v=1666075850339\" /></p>\n<p><img data-thu