(921, 'khoa-so-day-xich-boc-du-chong-chom-xe-may-xe-dap', 'Khóa số dây xích bọc dù chống trộm xe máy, xe đạp', '<p><em><strong>Khóa số dây xích bọc dù chống trộm xe máy, xe đạp</strong></em></p>\n<p>Khóa xe đạp có độ bền cao có thể chịu được áp lực mạnh mà không bị biến dạng.</p>\n<p>Dây thép cực kỳ chắc chắn với vỏ bọc dù.</p>\n<p>Mật mã 5 số cực kỳ an toàn giúp bạn nhanh chóng khóa và mở tiết kiệm thời gian.</p>\n<p>An toàn tiện dụng chống trộm cho xe đạp xe máy và ngôi nhà của bạn.</p>\n<p>Chiều dài : 90cm - Mã Khóa 5 số chống trộm có thể thay đổi được mã số theo ý muốn.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-3.jpg?v=1666000934685\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-2.jpg?v=1666000942116\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-1.jpg?v=1666000950079\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-4.jpg?v=1666001489705\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-5.jpg?v=1666001490382\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-6.jpg?v=1666001850908\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-so-xe-dap-day-xich-7.jpg?v=1666001857090\" /></p>', '', 'Khóa số dây xích bọc dù chống chộm xe máy, xe đạp', 'phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '1