(926, 'dia-nhua-dung-trai-cay-tho-cung', 'Đĩa Nhựa Đựng Trái Cây Thờ Cúng', '<p><em><strong>Đĩa Nhựa Đựng&nbsp;Trái Cây Thờ Cúng</strong></em></p>\n<p>Trong tín ngưỡng của người Việt, mỗi gia đình đều có một ban thờ riêng, là nơi trang nghiêm nhất, mà chúng ta thờ cúng gia tiên, tưởng nhớ những người đã khuất, cháu và ông bà, tổ tiên, những người đã khuất.</p>\n<p>Chất liệu: Nhựa cao cấp.&nbsp;không phai màu khi sử dụng.</p>\n<p>Kích thước: shop có 2 size:&nbsp;</p>\n<p>Size 8 inch: 20,5 x 7 x 11 cm (đường kính to x chiều cao x đường kính đáy)</p>\n<p>Size 10 inch: 25,5 x 8,3 x 12,8 cm (đường kính to x chiều cao x đường kính đáy)</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v113.jpg?v=1665482045663\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v12.jpg?v=1665482052643\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v10.jpg?v=1665482061183\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v11.jpg?v=1665482067548\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v8.jpg?v=1665482079518\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dia-dung-qua-thap-huong-v1.jpg?v=1665482092370\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net