(927, 'day-co-chang-hang-2-dau-moc-chu-j-1-6-150cm-cho-xe-may-xe-dap', 'Dây co chằng hàng 2 đầu móc chữ J 1.6*150CM cho xe máy, xe đạp', '<p><em><strong>Dây co chằng hàng 2 đầu móc chữ J 1.6*150CM cho xe máy, xe đạp</strong></em></p>\n<p>Dây co, dây buộc hàng dài gần 1.5m, bản to 1.5cm, dày 4.5mm&nbsp;</p>\n<p>Dùng để buộc, chằng các hàng nặng, cồng kềnh</p>\n<p>Chất liệu cao su cao cấp đàn hồi cao.</p>\n<p>2 móc chữ J thép cap cấp.</p>\n<p>##dâyco ##daychanghang</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-co-chang-hang-v1.jpg?v=1665029083351\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-co-chang-hang-v4.jpg?v=1665029085784\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-co-chang-hang-v3-61b8ecfc-68ab-420c-b4df-b40206519ee2.jpg?v=1665029182126\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-co-chang-hang-v5-77af3d42-c948-4ed9-afd2-f58793e77e19.jpg?v=1665029183079\" /></strong></em></p>', '', 'Dây co chằng hàng 2 đầu móc', 'dây co, Dây co chằng hàng, Dây co chằng hàng 2 đầu móc chữ J 1.6*150CM cho xe máy, Volcano, volcano.vn, xe đạp', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/27983040/day-co-chang-hang-2-dau-moc-chu-j-1-6-150cm-cho-xe-may-xe-dap.jpg', '<p><em><strong>Dây co chằng hàng 2 đầu móc chữ J&nbsp; 1.6*150CM</strong></em></p>\n<p>Dây co, dây buộc hàng dài gần 1.5m, bản to 1.5cm, dày 4.5mm&nbsp;</p>\n<p>Dùng để buộc, chằng các hàng nặn', '27983040', '73020968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-2