(928, 'tui-gan-ghi-dong-xe-dap-da-nang', 'Túi Gắn Ghi Đông xe đạp đa năng', '<p><strong><em>Túi Gắn Ghi Đông xe đạp đa năng</em></strong></p>\n<p>Lý tưởng cho những chuyến đi du lịch đường dài. Chuyên dụng để chứa những vật cồng kềnh như túi ngủ, quần áo, ví, kính, điện thoại...</p>\n<p>Được làm từ vật liệu nhẹ, kháng nước cao và bền, dễ dàng lắp đặt và tháo ra bằng dây đai.</p>\n<p>Túi chống nước dung tích 8 lít giúp giữ vật dụng bên trong luôn khô ráo</p>\n<p>Dung tích: 8 lít</p>\n<p>Kích thước: 22 x 15 x 15cm / 50 x 15 x 15cm (túi chống nước)</p>\n<p>Màu sắc: Đen, hồng, xanh dương.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v7.jpg?v=1664944653616\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v9.jpg?v=1664944661008\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v10.jpg?v=1664944669985\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v3.jpg?v=1664944676915\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v4.jpg?v=1664944688417\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v11.jpg?v=1664944698197\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-do-treo-dau-xe-dap-da-nang-v12.jpg?v=1664944704801\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizw