(929, 'day-con-cho-xe-satria-fi-raider-fi', 'Dây côn, Dây ly hợp cho Suzuki GZ150-A', '<p><em><strong>Dây côn, Dây ly hợp cho Suzuki GZ150-A</strong></em></p>\n<p>Sau 1 thời gian chạy dây côn của xe có dấu hiệu nhão và dãn nên thay thế dây mới sẽ bảo vệ bộ li hợp và làm cải thiện cảm giác lái xe.</p>\n<p>Sử dụng cho Suzuki GZ150-A&nbsp;</p>\n<p>Thay thế lắp ráp như zin không cần chế thêm gì.</p>\n<p>Chiều dài 130CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-5.jpg?v=1661505336095\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-1.jpg?v=1661505348214\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-2.jpg?v=1661505349181\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-3.jpg?v=1661505349852\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-4.jpg?v=1661505350582\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-6.jpg?v=1661505351077\" /></strong></em><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-phanh-xe-xe-may-suzuki-7.jpg?v=1661505351960\" /></strong></em></p>', '', 'Dây côn cho xe Szuki', 'Dây côn cho xe Szuki, dây côn xe, phụ kiện xe máy, Volcano, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'imag