(930, 'hop-dung-do-da-nang-gan-be-ty-tay-xe-o-to', 'Hộp đựng đồ đa năng gắn bệ tỳ tay xe ô tô', '<p><em><strong>Hộp đựng đồ đa năng gắn bệ tỳ tay xe ô tô</strong></em></p>\n<p>Hộp lưu trữ đa chức năng với dung&nbsp;lượng lưu trữ lớn và đẹp mắt, chuyên dụng để khăn giấy, điện thoại, cốc nước, chai nước.</p>\n<p>Thiết kế có thể điều chỉnh 180 ngăn đựng cốc có thể di chuyển được</p>\n<p>Chất liệu nhựa&nbsp;cao cấp, khung làm từ hợp kim nhôm.</p>\n<p>Kích thước: 18*11.5*11.5CM, 2 khay đựng cốc đường kính 7CM.</p>\n<p>Sản phẩm có kèm dây dạng dán để gắn lên bệ tỳ tay.</p>\n<p><img data-thumb=\"original\" original-height=\"1242\" original-width=\"1242\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v1.jpg?v=1661327962952\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v4-f77ce036-bb1b-4a25-94cf-5d4225ab5fce.jpg?v=1661330833398\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v6.jpg?v=1661330834097\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v114.jpg?v=1661330873866\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v2.jpg?v=1661330895955\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v113.jpg?v=1661330904010\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-de-do-gan-hop-ty-tay-o-to-v12.jpg?v=1661330910952\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//biz