(933, 'day-thong-cong-dung-cho-may-khoan', 'Dây Thông Cống dùng cho máy khoan', '<p><strong><em>Dây Thông Cống dùng cho máy khoan</em></strong></p>\n<p>Dây làm bằng thép mangar bền chắc</p>\n<p>Có thể thông rất nhiều loại kích cỡ đường ống thoát nước, ống cống nhỏ, ống thoát nước ngoài ban công, sân thượng, phòng tắm...</p>\n<p>Được thiết kế với lò xo thép cơ động,&nbsp;dễ sử dụng để loại bỏ các chất cặn bã từ trong ống nhờ vào sự cơ động của lò xo thép.&nbsp;</p>\n<p>Dây lò xo Ф16 mm có thể đi sâu vào trong các đường ống, thông các đường ống có kích thước từ 25-150mm</p>\n<p>Dây dài 9M, được nối với nhau từ 2 đoạn.</p>\n<p>Lưu ý: Sản phẩm chỉ có dây&nbsp;chưa kèm phụ kiện.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-3.jpg?v=1660380600696\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-5.jpg?v=1660380610586\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-6.jpg?v=1660380611107\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-7.jpg?v=1660380611771\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-8.jpg?v=1660380619057\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuon-day-thong-cong-9m-11.jpg?v=1660380631311\" /></p>', '', 'Dây Thông Cống dùng cho máy khoan', 'dây thông cống, Dây Thông Cống dùng cho máy khoan, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '398000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/27310693/day-thong-cong-dung-cho-may-khoan.jpg', '<p>Dây làm bằng thép mangar bền chắc</p>\n<p>Có thể thông rất nhiều loại kích cỡ đường ống thoát nước, ống cống nhỏ, ống thoát nước ngoài ban công, sân thượng, phòng tắm...</p>\n<p>Được thiết k', '27310693', '69988304', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:07', '2024-05-29 06:11:07'),
(934, 'cay-danh-trung-inox-co-truc-xoay-tu-dong-tien-dung', 'Cây Đánh Trứng Inox Có Trục Xoay Tự Động Tiện Dụng', '<p><em><strong>Cây Đánh Trứng Inox Có Trục Xoay Tự Động Tiện Dụng</strong></em></p>\n<p>Với thiết kế đầu đánh trứng dạng xòe, có tác dụng tạo độ bông cho trứng khi khuấy đều tay.</p>\n<p>Tay cầm dài, không gây mỏi, đảm bảo khoảng cách vệ sinh giữa tay và dụng cụ đựng trứng.</p>\n<p>Sản phẩm gọn nhẹ, dễ sử dụng và dễ vệ sinh.&nbsp;</p>\n<p>Chất liệu INOX cao cấp đảm bảo vệ sinh, không ảnh hưởng sức khỏe người dùng.</p>\n<p>Kích thước: dài 30cm, tay cầm đường kính 2cm, đầu đánh 6.5cm.</p>\n<p>#caydanhtrungcamtay#danhtrunginox#danhtrungcotrucxoay#danhtrungtrucxoaytudong#danhtrunginoxtudong#dogiadungnhabep#</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"719\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-7c7b9266-ea2b-4704-99b8-317bd9337a45.jpg?v=1660360618152\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-21c7d2cb-cefa-4626-ba61-494458919928.jpg?v=1660360624542\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-724de10c-b335-4bcc-b18d-3b5f96649523.jpg?v=1660360636528\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-b8b354f0-bed3-4be1-83e0-0a11eb19ead4.jpg?v=1660360644430\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/6-e9f299ab-6155-487f-854c-18a9a9316c28.jpg?v=1660360661038\" /></strong></em></p>', '', 'Cây đánh trứng', 'cây đánh trứng, Cây Đánh Trứng Inox Có Trục Xoay Tự Động Tiện Dụng, dụng cụ đánh trứng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', ''