(936, 'dui-bong-den-loi-su-chong-chay-chong-nuoc-chiu-nhiet-duoi-e27', 'Đui bóng đèn lõi sứ chống cháy, chống nước, chịu nhiệt đuôi E27', '<p><em><strong>Đui bóng đèn lõi sứ chống cháy, chống nước, chịu nhiệt đuôi E27</strong></em></p>\n<p>Đuôi đèn E27 kín nước Lõi sứ Chịu nhiệt</p>\n<p>Kiểu đuôi&nbsp;xoáy E27 Treo thông dụng -</p>\n<p>Thông số: Từ 6A đến 10A&nbsp;- 250V</p>\n<p>Vỏ PVC kín nước, lõi sứ chịu nhiệt bao nóng chảy luôn, cầm rất nặng tay.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/6-4eaed94b-1bfe-4dfc-8e3d-1aef4e86b7a0.jpg?v=1660294896737\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-66d93466-f5f9-493a-8b2d-588cf5ab8558.jpg?v=1660294903373\" /></p>\n<p><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-ec5478c2-40fb-4ced-a7d5-ed6cdbaed2bc.jpg?v=1660294911554\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-7477a43c-6e8a-4b9b-b183-02b4021a846f.jpg?v=1660294920739\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-0e531b59-b723-4d66-8df5-038f5cd35ce9.jpg?v=1660294927458\" /></p>', '', 'Đui đèn e27 lõi sứ', 'chịu nhiệt đuôi E27, chống nước, Đui bóng đèn lõi sứ chống cháy, đui đèn e27 lõi sư, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '12000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/27302033/dui-bong-den-loi-su-chong-chay-chong-nuoc-chiu-nhiet-duoi-e27.jpg', '<p>Đuôi đèn E27 kín nước Lõi sứ Chịu nhiệt</p>\n<p>Kiểu đuôi&nbsp;xoáy E27 Treo thông dụng -</p>\n<p>Thông số: Từ 6A đến 10A&nbsp;- 250V</p>\n<p>Vỏ PVC kín nước, lõi sứ chịu nhiệt bao nóng chảy ', '27302033', '69957039', NULL, NULL