(940, 'chuong-coi-xe-dap-ld-067', 'Chuông, còi xe đạp LD-067', '<p><em><strong>Chuông, còi xe đạp LD-067</strong></em></p>\n<p>Chuông xe đạp nhỏ gọn và dễ dàng lắp đặt, không chỉ dành cho xe đạp của các bé mà những dòng xe đạp khác cũng có thể lắp được một cách đơn giản.</p>\n<p>Chất liệu nhôm và nhựa ABS bền bỉ.</p>\n<p>Phần chuông làm bằng nhôm giúp tiếng kêu to và đanh hơn.</p>\n<p>Kích thước: 6.5*6CM, đường kính chuông 3.5CM</p>\n<p>Màu sắc: Trắng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-1.jpg?v=1658979652567\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-2.jpg?v=1658979653245\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-3-1800768e-8ffe-4957-bdba-859efe3541c1.jpg?v=1658979653963\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-4-6d1c0260-c19c-40f7-ae03-8edf1461d003.jpg?v=1658979654872\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-5-5e5065fd-9230-49ac-ba8f-808b4a0f3b45.jpg?v=1658979665633\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chuong-xe-dap-6.jpg?v=1658979800054\" /></p>', '', 'Chuông xe đạp', 'chuông xe đạp, còi xe đạp, kèn xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '15000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/27103694/chuong-coi-xe-dap-ld-067.jpg', '<p>Chuông xe đạp nhỏ gọn và dễ dàng lắp đặt, không chỉ dành cho xe đạp của các bé mà những dòng xe đạp khác cũng có thể lắp được một cách đơn giản.</p>\n<p>Chất liệu nhôm và nhựa 