(941, 'phot-tang-kep-co-ghi-ghi-dong-xe-dap-dai-20cm', 'Pô tăng, kẹp cổ ghi ghi đông xe đạp dài 20CM', '<p><em><strong>Pô tăng, kẹp cổ ghi ghi đông xe đạp dài 20CM</strong></em></p>\n<p>Cổ kẹp ghi đông, kẹp tay lái Potang xe đạp thông dụng cho nhiều dòng&nbsp;xe đạp.</p>\n<p>Chiều dài 20CM, đường kính 22.2M, Phần kẹp ghi đông 25.5MM.</p>\n<p>Chất liệu: Hợp kim nhôm và thép không gỉ.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/pht-tang-xe-dap-1.jpg?v=1658889880694\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/pht-tang-xe-dap-4.jpg?v=1658889887665\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/pht-tang-xe-dap-2.jpg?v=1658889895367\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/pht-tang-xe-dap-3.jpg?v=1658889901683\" /></strong></em></p>', '', 'Phốt tăng xe đạp', 'kẹp cổ ghi ghi đông xe đạp dài 20CM, Phốt tăng, phốt tăng xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '50000', 'kg', 'images/27094723/phot-tang-kep-co-ghi-ghi-dong-xe-dap-dai-20cm.jpg', '<p>Cổ kẹp ghi đông, kẹp tay lái Potang xe đạp thông dụng cho nhiều dòng&nbsp;xe đạp.</p>\n<p>Chiều dài 20CM, đường kính 22.2M, Phần kẹp ghi đông 25.5MM.</p>\n<p>Chất liệu: Hợp kim nhôm và thép ', '27094723', '69211679', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:09', '2024-05-29 06:11:09'),
(942, 'keo-cat-tia-canh-cay-sieu-sac-sk5-v8', 'Kéo Cắt Tỉa Cành Cây Siêu Sắc SK5-V8', '<p><em><strong>Kéo Cắt Tỉa Cành Cây Siêu Sắc SK5-V8</strong></em></p>\n<p>Kéo Cắt Cành chuyên dùng để cắt tỉa cành.</p>\n<p>Tay cầm thiết kế uốn lượn&nbsp;tạo lực và thao tác dễ dàng, nhanh chóng.</p>\n<p>Lưỡi kéo cứng chắc, sắc bén, Chuyên dùng để cắt tỉa cành. Phục vụ cho công việc chăm sóc cây cảnh</p>\n<p>Chất liệu:&nbsp; thép sk5&nbsp;không gỉ + Tay cầm kim loại.</p>\n<p>Tặng kèm 01 lò xo để thay thế.</p>\n<p>Kích thước: Dài 21cm, lưỡi 8cm, đường kính cắt 2cm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d1-f559c824-faa8-4837-8f07-739a7186f8fb.jpg?v=1658720987881\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d4-285c2bee-af5a-4fbf-8e58-0661f96994d7.jpg?v=1658720744555\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d5-4d8f10b8-8b8a-4578-98da-b1cfbb131d29.jpg?v=1658720752592\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d3-08610b5b-44a4-4701-aeba-f7819eafec69.jpg?v=1658720758190\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d2-062a92ad-424e-43ca-8ed8-0bc3b7476998.jpg?v=1658720766723\" /></strong></em><br />\n&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/aNqo4pjJao4\" title=\"Kéo Cắt Tỉa Cành Cây Siêu Sắc SK5-V8\" width=\"100%\"></iframe></p>', '', 'kéo cắt cành', 'kéo cắt tỉa cành