(944, 'bo-de-hit-nam-cham-do-dien-thoai-xoay-360-do-tren-xe-o-to', 'Bộ đế hít nam châm đỡ điện thoại xoay 360 độ trên xe ô tô', '<p><em><strong>Bộ đế hít nam châm đỡ điện thoại xoay 360 độ trên xe ô tô</strong></em></p>\n<p>Chất liệu: hợp kim nhôm.</p>\n<p>Kích thước: đường kính 35mm cao 33mm. Trọng lượng: 46g.</p>\n<p>Áp dụng cho tất cả các điện thoại di động (có bảng từ tính).</p>\n<p>Vòng quay xoay tùy chỉnh&nbsp;360 độ.</p>\n<p>Tặng kèm 01 miếng tấm kim loại tròn từ tính dán sau điện thoại/ốp lưng điện thoại.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-dien-thoai-tu-tinh-3.jpg?v=1657014047773\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-dien-thoai-tu-tinh-1.jpg?v=1657013779689\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-dien-thoai-tu-tinh-5.jpg?v=1657014020855\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-dien-thoai-tu-tinh-2.jpg?v=1657013785455\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-dien-thoai-tu-tinh-4.jpg?v=1657014035774\" /></strong></em></p>', '', 'Đế hít nam châm đỡ điện thoại', 'Bộ đế hít nam châm đỡ điện thoại xoay 360 độ trên xe ô tô, đế hít điện thoại, đế hít đỡ điện thoại, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/26755510/bo-de-hit-nam-cham-do-dien-thoai-xoay-360-do-tren-xe-o-to.jpg', '<p>Chất liệu: hợp kim nhôm.</p>\n<p>Kích thước: đường kính 35mm cao 33mm. Trọng lượng: 46g.</p>\n<p>Áp dụng cho tất cả các điện thoại di động (có bảng từ tính).</p>\n<p>Vòng quay xoay tùy chỉnh&', '26755510', '68147999', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:09', '2024-05-29 06:11:09'),
(945, 'tui-tote-vai-canvas-nut-bam-phong-cach-han-quoc', 'Túi tote vải canvas nút bấm phong cách Hàn Quốc', '<p><em><strong>Túi tote vải canvas nút bấm phong cách Hàn Quốc</strong></em></p>\n<p>Túi tote được mệnh danh là chiếc túi thời trang và tiện lợi.</p>\n<p>Với mẫu túi này, bạn có thể biến hóa với nhiều phong cách thời trang khác nhau như năng động cá tính hay ngay cả dịu dàng, nữ tính cũng rất phù hợp.</p>\n<p>Túi vải&nbsp;được làm từ chất liệu vải canvas dày dặn, không nhuộm màu, đẹp với đường may vô cùng tỉ mỉ và chắc chắn</p>\n<p>Phần túi tote đựng được thiết kế rộng rãi giúp bạn có thể đựng nhiều đồ vật như sách, vở, mỹ phẩm, đồ dùng cá nhân…</p>\n<p>Phần quai đeo tinh tế với độ rộng vừa phải và cân đối -</p>\n<p>Với chiếc túi tote họa tiết dễ thương, bạn hoàn toàn có thể tự tin lựa chọn làm phụ kiện để đi học, đi chơi, du lịch, công tác, …</p>\n<p>Kích thước: 35x10x32CM.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-2.jpg?v=1656320305327\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-5.jpg?v=1656320313565\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-6.jpg?v=1656320321283\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-1.jpg?v=1656320329543\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-3.jpg?v=1656320336220\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-4.jpg?v=1656320342460\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-8.jpg?v=1656320351820\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-9.jpg?v=1656320357632\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-11.jpg?v=1656320363951\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-tote-10.jpg?v=1656320371843\" /></p>', '', 'Túi tote vải canvas', 'túi tote, Túi tote vải canvas nút bấm phong cách Hàn Quốc, túi vải, túi vải tote, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '86000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/26581252/tui-tote-vai-canvas-nut-bam-phong-cach-han-quoc.jpg', '<p>Túi tote được mệnh danh là chiếc túi thời trang và tiện lợi.</p>\n<p>Với mẫu túi này, bạn có thể biến hóa với nhiều phong cách thời trang khác nhau như năng động cá tính hay ngay cả dịu dàn', '26581252', '67573567', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:09', '2024-05-29 06:11:09');
