(947, 'chot-cai-day-an-toan-xe-o-to-dinh-da', 'Chốt cài dây an toàn xe ô tô đinh đá', '<p><em><strong>Chốt cài dây an toàn xe ô tô đinh đá</strong></em></p>\n<p>Chốt cài dây an toàn xe ô tô, cắm nối tiếp chống kêu&nbsp;giúp cho người ngồi trong xe không phải nghe tiếng \"bíp\" của xe khi không cài dây an toàn nữa. Đây cũng là vật trang trí cho xe với kiểu dáng đẹp và dễ sử dụng.</p>\n<p>Chất liệu: Hợp kim thép mạ crom và vỏ nhựa ABS đính đá lấp lánh bề mặt.</p>\n<p>Sử dụng: Chốt vừa tất cả các loại xe.</p>\n<p>Kích thước sản phẩm: 9*5.2*3.5CM, chốt 4*2.2CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-da-2.jpg?v=1656042883699\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-da-3.jpg?v=1656042889479\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-da-1.jpg?v=1656042897627\" /></strong></em><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-da-4.jpg?v=1656042907841\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chot-an-toan-dinh-da-5.jpg?v=1656042915013\" /></strong></em></p>', '', 'Chốt an toàn', 'chốt an toàn ô tô, Chốt cài dây an toàn xe ô tô đinh đá, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Số lượng', '01 chiếc', '', '', '', '', '', '', '', 'deny', '', '75000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/26553170/chot-cai-day-an-toan-xe-o-to-dinh-da.jpg', '<p>Chốt cài dây an toàn xe ô tô, cắm nối tiếp chống kêu&nbsp;giúp cho người ngồi trong xe không phải nghe tiếng \"bíp\" của xe khi không cài dây an toàn nữa. Đây cũng là vật trang trí cho xe vớ', '26553170', '67318212', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:09', '2024-05-29 06:11:09'),
(948, 'tui-tote-tui-vai-canvas-co-khoa-phong-cach-han-quoc', 'Túi tote vải canvas có khóa phong cách Hàn Quốc', '<p><em><strong>Túi tote vải canvas có khóa phong cách Hàn Quốc</strong></em></p>\n<p>Túi tote được mệnh danh là chiếc túi thời trang và tiện lợi.</p>\n<p>Với mẫu túi này, bạn có thể biến hóa với nhiều phong cách thời trang khác nhau như năng động cá tính hay ngay cả dịu dàng, nữ tính cũng rất phù hợp.</p>\n<p>Túi vải&nbsp;được làm từ chất liệu vải canvas dày dặn, không nhuộm màu, đẹp với đường may vô cùng tỉ mỉ và chắc chắn</p>\n<p>Phần túi tote đựng được thiết kế rộng rãi giúp bạn có thể đựng nhiều đồ vật như sách, vở, mỹ phẩm, đồ dùng cá nhân…</p>\n<p>Phần quai đeo tinh tế với độ rộng vừa phải và cân đối -</p>\n<p>Với chiếc túi tote họa tiết dễ thương, bạn hoàn toàn có thể tự tin lựa chọn làm phụ kiện để đi học, đi chơi, du lịch, công tác, …</p>\n<p>Kích thước: 35x8x40CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v1.jpg?v=1655452656659\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v4.jpg?v=1655452686215\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v3.jpg?v=1655452692997\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v6.jpg?v=1655452700947\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v14.jpg?v=1655452708309\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v7.jpg?v=1655452715068\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v12.jpg?v=1655452727094\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v10.jpg?v=1655452736512\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-vai-henrima-v13.jpg?v=1655452743309\" /></strong></em></p>', '', 'Túi tote', 'Túi tote túi vải canvas có khóa, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/26481126/tui-tote-tui-vai-canvas-co-khoa-phong-cach-han-quoc.jpg', '<p>Túi tote được mệnh danh là chiếc túi thời trang và tiện lợi.</p>\n<p>Với mẫu túi này, bạn có thể biến hóa với nhiều phong cách thời trang khác nhau như năng động cá tính hay ngay cả dịu dàn', '26481126', '67021230', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:10', '2024-05-29 06:11:10'),
(949, 'tui-vai-canvas-theu-hello', 'Túi vải canvas thêu chữ Hello', '<p><strong><em>Túi vải canvas thêu chữ Hello</em></strong></p>\n<p>Túi vải cao cấp được làm từ chất liệu vải canvas dày dặn, không nhuộm màu, đẹp với đường may vô cùng tỉ mỉ và chắc chắn</p>\n<p>Phần túi tote đựng được thiết kế rộng rãi giúp bạn có thể đựng nhiều đồ vật như sách, vở, mỹ phẩm, đồ dùng cá nhân…</p>\n<p>Phần quai đeo tinh tế với độ rộng vừa phải và cân đối</p>\n<p>Túi vải cao cấp in họa tiết sắc nét, thêu chữ hello&nbsp;vô cùng trẻ trung, hiện đại.</p>\n<p>Với chiếc túi tote họa tiết dễ thương, bạn hoàn toàn có thể tự tin lựa chọn làm phụ kiện để đi học, đi chơi, du lịch, công tác.</p>\n<p>Kích thước: 40x40x8CM.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-5bb7166b-3ae0-45ac-b432-e63a8beabc24.jpg?v=1655437706913\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/7-b08c3c62-bbef-45c5-a793-2e083e310e50.jpg?v=1655437714599\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/8-d062a973-c99a-417f-8063-60c75d5ef66c.jpg?v=1655437721735\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-0d89d1b8-4789-40ec-9465-5d16f9f0155b.jpg?v=1655437731231\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/1-8566edcb-197b-4983-997e-779990deec49.jpg?v=1655437737124\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-420694cd-8156-484e-8439-d35cafa3386e.jpg?v=1655437746858\" /></em