(957, 'thung-dung-do-gan-duoi-xe-may-td08', 'Thùng đựng đồ gắn đuôi xe máy TD08', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy TD08</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích lớn 20L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 32*32*27CM (20L)</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td08-1.jpg?v=1641285107764\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td08-2.jpg?v=1641285113643\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td08-8.jpg?v=1641288189988\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td08-9.jpg?v=1641288190494\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td08-5.jpg?v=1641285121184\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" s