(958, 'combo-10-tui-boc-hang-ep-bong-khi-chong-soc-30cm-25cm', 'Combo 10 túi bọc hàng ép bóng khí chống sốc 30CM*25CM', '<p><em><strong>Combo 10 túi bọc hàng ép bóng khí chống sốc 30CM*25CM</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>Kích thước: 30*25CM.</p>\n<p>&nbsp;Chất liệu:&nbsp;Giấy Kraft.</p>\n<p>&nbsp;Màu sắc: màu trắng, vàng.</p>\n<p><em><strong>&nbsp;</strong></em>Sản phẩm nhỏ gọn với bên trong là lớp bóng khí để bạn có thể để đồ bên trong thoải mái mà không lo đồ hay hàng hóa bị vỡ hay chày xước.</p>\n<p>Gửi hàng không lo phải lo nữa&nbsp;những chuyển động và va chạm đến làm ảnh hưởng đến&nbsp;hàng của bạn trong quá trình vận chuyển.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-3.jpg?v=1640763908117\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-4.jpg?v=1640763908564\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-5.jpg?v=1640763909421\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-7.jpg?v=1640763910065\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-8.jpg?v=1640763910713\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-kghi-chong-soc-1.jpg?v=1640763922699\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-bong-bong-1518-6-e938ed2a-0cdd-46a7-88c5-863ad464ac7b.jpg?v=1640763859181\" /></p>', '', 'Combo 10 túi ép bóng khí', 'Combo 10 túi bọc hàng ép bóng khí chống sốc 30CM*25CM, ô tô, phụ  kiện ô tô, túi ép bóng khi, túi ép bóng khí, Volcano, volcano.vn', '1', 'Màu sắc', 'Trắng', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/24234064/combo-10-tui-boc-hang-ep-bong-khi-chong-soc-30cm-25cm.jpg', '<p><em><strong>&nbsp;</strong></em>Kích thước: 30*25CM</p>\n<p>&nbsp;Chất liệu:&nbsp;Giấy Kraft</p>\n<p>&nbsp;Màu sắc: màu trắng, vàng.</p>\n<p><em><strong>&nbsp;</strong></em>Sản phẩm nhỏ gọn v', '24234064', '57345066', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:11', '2024-05-29 06:11:11'),
(959, 'thung-dung-do-gan-duoi-xe-may-td07', 'Thùng đựng đồ gắn đuôi xe máy TD07', '<p><strong><em>Thùng đựng đồ gắn đuôi xe máy TD07</em></strong></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích lớn 25L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Màu sắc: Đen, Ghi.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 36.5*37*27CM (25L)</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-6.jpg?v=1640675619161\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-5.jpg?v=1640675627419\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-7.jpg?v=1640675809647\" /></em></strong></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-8.jpg?v=1640680406939\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-9.jpg?v=1640680414593\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-10.jpg?v=1640680420894\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-11.jpg?v=1640680615467\" /></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-1.jpg?v=1640675498221\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-2.jpg?v=1640675504842\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-3.jpg?v=1640675512853\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-td07-4.jpg?v=1640675519742\" /></em></strong></p>\n<p>&nbsp;</p>\n<p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Thùng đựng đồ gắn đuôi xe máy TD07', 'cốp đuôi xe máy, cốp xe máy, ô tô, phụ  kiện ô tô, thùng đồ gắn đuôi xe máy, thùng đựng đồ, Thùng đựng đồ gắn đuôi xe máy TD07, thùng đựng đồ xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '499000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/24221525/thung-dung-do-gan-duoi-xe-may-td07.jpg', '<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản q', '24221525', '57287583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:12', '2024-05-29 06:11:12'),
(960, 'moc-chia-khoa-dinh-da-gan-so-dien-thoai', 'Móc chìa khóa đính đá gắn số điện thoại', '<p><strong><em>Móc chìa khóa đính đá gắn số điện thoại</em></strong></p>\n<p>Móc chìa khóa xe ô đính đá cao cấp với thiết kế&nbsp;từ chất liệu kim loại&nbsp;.</p>\n<p>Bộ sản phẩm có kèm 6 dãy số từ 0 đến 9 để ghép số điện thoại.</p>\n<p>Đính đá lấp lánh, sanh trọng.</p>\n<p>Kích thước: Dài 11,5cm, phần dán số điện thoại 7.1.8cm, khuyên tròn đường kính 3.5cm.</p>\n<p><i style=\"font-weight: bold;\"><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-o-to-dinh-da-gan-so-dien-thoai-v1.jpg?v=1640660648453\" /></i></p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-o-to-dinh-da-gan-so-dien-thoai-v8.jpg?v=1640660671703\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-o-to-dinh-da-gan-so-dien-thoai-v2.jpg?v=1640660698682\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-o-to-dinh-da-gan-so-dien-thoai-v5.jpg?v=1640660711128\" /></em></strong></p>', '', 'Móc chìa khóa đính đá', 'móc chìa kháo ô tô, Móc chìa khóa đính đá, móc khóa ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/24219305/moc-chia-khoa-dinh-da-gan-so-dien-thoai.jpg', '<p>Móc chìa khóa xe ô đính đá cao cấp với thiết kế&nbsp;từ chất liệu kim loại&nbsp;.</p>\n<p>Bộ sản phẩm có kèm 6 dãy số từ 0 đến 9 để ghép số điện thoại.</p>\n<p>Đính đá lấp lánh, sanh trọng.<', '24219305', '57282472', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:12', '2024-05-29 06:11:12'),
(961, 'bo-02-den-tho-dau-dung-pin', 'Bộ 02 Đèn thờ dầu dùng pin', '<p><em><strong>Bộ 02 Đèn thờ dầu dùng pin</strong></em></p>\n<p>Cặp đèn led hoa sen pha lê trang trí bàn thờ thêm trang trọng , dùng bằng pin tiểu, công&nbsp;tắc bật / tắt&nbsp;rất tiện lợi.</p>\n<p>Tiết kiệm chị phí, Chất liệu nhựa sử dụng bền theo năm tháng.</p>\n<p>Đèn led công nghệ cao, công suất nhỏ tiết kiệm pin.<br />\nKích thước cao 21.5cm, đường kính 7cm.<br />\nGiá trên là giá một cặp đèn, tặng kèm 02 pin.<br />\n<em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v9.jpg?v=1640598378407\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v10.jpg?v=1640598385995\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v2.jpg?v=1640598401060\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v1.jpg?v=1640598408366\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v13.jpg?v=1640598416262\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"721\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-tho-v12.jpg?v=1640598423366\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/SompDm0xEp4\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Đèn thờ dùng pin', 'Bộ 02 Đèn thờ dầu dùng pin, Volcano, volcano.vn', '1', 'Title', '