(964, 'moc-chia-khoa-dinh-da-hinh-ngoi-sao', 'Móc chìa khóa đính đá hình ngôi sao', '<p><em><strong>Móc chìa khóa đính đá hình ngôi sao</strong></em></p>\n<p>Móc khóa hính ngôi sao&nbsp;đính đá sang trọng,&nbsp;tinh tế.</p>\n<p>Chất liệu dây da cao cấp, khuyên kim loại bền bỉ.</p>\n<p>Bề mặt đính đá màu sắc đẹp, lấp lánh thu hút mọi ánh nhìn.</p>\n<p>Kích thước: dài 13cm, ngôi sao 5.5*1.2CM.</p>\n<p>Màu sắc: Đỏ, Hồng, vàng gold, ghi đen.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v2.jpg?v=1640313168412\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v1.jpg?v=1640313174773\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v3.jpg?v=1640313181528\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v5.jpg?v=1640313188740\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v7.jpg?v=1640313212540\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v9.jpg?v=1640313311454\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-dinh-da-ngoi-sao-v8.jpg?v=1640315944053\" /></p>', '', 'Móc chìa khóa đính đá', 'móc khóa, móc khóa đính đá, móc khóa ngôi sao, ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/24184899/moc-chia-khoa-dinh-da-hinh-ngoi-sao.jpg', '<p>Móc khóa hính ngôi sao&nbsp;đính đá sang trọng,&nbsp;tinh tế.</p>\n<p>Chất liệu dây da cao cấp, khuyên kim loại bền bỉ.</p>\n<p>Bề mặt đính đá màu sắc đẹp, lấp lánh thu hút mọi ánh nhìn.</p>', '24184899', '56963108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:12', '2024-05-29 06:11:12'),
(965, 'bo-boc-ghe-ao-ghe-o-to-cao-cap-bg12', 'Bộ bọc ghế, áo ghế ô tô cao cấp BG12', '<p><strong>Bộ bọc ghế, áo ghế ô tô cao cấp BG12</strong></p>\n<p>Bộ bọc ghế,&nbsp;Áo ghế ô tô xe hơi bọc da là sản phẩm thiết thực giúp bạn giữ gìn chiếc ô tô của bạn.</p>\n<p>Bảo vệ ghế xe sạch sẽ bảo vệ ghế xe sạch sẽ, đẹp đẽ luôn mới mẻ.</p>\n<p>Sản phẩm được làm bằng da PU, có độ bền cao ~ 10 năm. Màu sắc đa dạng, dễ dàng cho bạn lựa chọn màu sắc theo mùa, theo mệnh, theo màu xe....&nbsp;</p>\n<p>Sản phẩm phù hợp với tất cả các loại xe 5 chỗ, ghế to dầy cũng như ghế nhỏ có phần tựa đầu kéo lên được như hình ảnh mô tả sản phẩm&nbsp;đều có thể bọc được.</p>\n<p>Dễ tháo lắp, dễ vệ sinh, dễ thay đổi. Kiểu dáng thời trang và sang trọng, sử dụng lắp đặt&nbsp;cho xe 5 chỗ.</p>\n<p>Bộ sản phẩm đầy đủ: Bộ bọc 02 ghế trước, bộ bọc ghế sau, 02 gối tựa đầu, 02 gối tựa lưng, kèm các phụ kiện lắp đặt.</p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-cao-cap-gg-v8-8de7e012-b0cb-42aa-8392-9da5d2f28530.jpg?v=1640253001253\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-cao-cap-gg-v1.jpg?v=1640252665446\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-cao-cap-gg-v4.jpg?v=1640252673168\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-cao-cap-gg-v5.jpg?v=1640252678869\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-cao-cap-gg-v7.jpg?v=1640252693017\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" origi