(966, 'moc-khoa-hinh-trai-tim-dinh-da', 'Móc khóa hình trái tim đính đá', '<p><em><strong>Móc khóa hình trái tim đính đá</strong></em></p>\n<p>Móc khóa hính trái tim đính đá sang trọng tinh tế.</p>\n<p>Chất liệu dây da cao cấp, khuyên kim loại bền bỉ.</p>\n<p>Bề mặt đính đá màu sắc đẹp, lấp lánh thu hút mọi ánh nhìn.</p>\n<p>Kích thước: dài 13cm, trái tim 4*4.8*1.2CM.</p>\n<p>Màu sắc: Đỏ, Hồng, Trắng.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-trai-tim-dinh-da-v2.jpg?v=1640229231526\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-trai-tim-dinh-da-v3.jpg?v=1640229239079\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-trai-tim-dinh-da-v1.jpg?v=1640229244997\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-trai-tim-dinh-da-1.jpg?v=1640229251318\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-khoa-trai-tim-dinh-da-v5.jpg?v=1640229258138\" /></p>', '', 'Móc khóa đính đá', 'móc kháo đính đá, móc kháo trái tim, móc khóa, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/24175706/moc-khoa-hinh-trai-tim-dinh-da.jpg', '<p>Móc khóa hính trái tim đính đá sang trọng tinh tế.</p>\n<p>Chất liệu dây da cao cấp, khuyên kim loại bền bỉ.</p>\n<p>Bề mặt đính đá màu sắc đẹp, lấp lánh thu hút mọi ánh nhìn.</p>\n<p>Kích th', '24175706', '56906486', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:12', '2024-