(969, 'bua-cao-su-2-dau-da-nang-sieu-ben', 'Búa Cao Su 2 Đầu Đa Năng Siêu Bền', '<p><strong><em>Búa Cao Su 2 Đầu Đa Năng Siêu Bền</em></strong></p>\n<p>Đầu búa không phát ra tia lửa hay làm ảnh hưởng đến bề mặt vật dụng, giúp bạn có thể lát nền gạch khít hơn, gõ nhôm, chắc chắn hơn hoặc dùng để làm đồ thủ công mỹ nghệ hay đóng những vật liệu dễ vỡ, trầy xước...</p>\n<p>Búa cao su rất được ưa chuộng trong các ngành xây dựng và công nghiệp, sử dụng ốp lát gạch tường, đóng sàn gỗ hay đóng giữ các vật liệu dễ vỡ, dễ xước…</p>\n<p>&nbsp;Kích cỡ: 370g, Đường kinhs đầu búa 3,5cm, dài 25cm, đường kính cán 1.6cm.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-cao-su-sda-nang-co-the-thao-roi-3.jpg?v=1638588883910\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-cao-su-sda-nang-co-the-thao-roi-4.jpg?v=1638588892951\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-cao-su-sda-nang-co-the-thao-roi-2.jpg?v=1638588899463\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-cao-su-sda-nang-co-the-thao-roi-5.jpg?v=1638588905293\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bua-cao-su-sda-nang-co-the-thao-roi-1.jpg?v=1638588910797\" /></em></strong></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/3yn4wtLIqE4\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Búa Cao Su 2 Đầu Đa Năng Siêu Bền', 'búa cầm tay, búa cầm tay đa năng, búa cao su, Búa Cao Su 2 Đầu Đ