(970, 'bat-lua-dien-usb-day-mo-g-08', 'Bật lửa điện USB đẩy mở G-08', '<p><em><strong>Bật lửa điện USB đẩy mở G-08</strong></em></p>\n<p>Không sợ gió thổi tắt, chạy bằng điện hết pin có thể nạp lại, thiết kế đơn giản, tinh tế...</p>\n<p>Sản phẩm sở hữu kích thước siêu mỏng chỉ 8 x 2.6 x 1.2cm. Nên người dùng có thể dễ dàng bỏ vào túi áo, túi quần hay balo, túi xách để mang theo sử dụng mọi lúc mọi nơi vô cùng tiện lợi.</p>\n<p>Lên lửa tự động bằng 1 cái gạt tay nhẹ&nbsp;lên, gặt ngược&nbsp;xuống để sạc điện với cổng USB&nbsp;&nbsp;tiện dụng&nbsp;.</p>\n<p>Màu sắc: Đỏ, vàng, trắng, xanh dương.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-gat-mo-v5.jpg?v=1638518937592\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-gat-mo-v2.jpg?v=1638518944067\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-gat-mo-v3.jpg?v=1638518950160\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-gat-mo-v4.jpg?v=1638518956003\" /></strong></em></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/9Zn0XBQm16M\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Bật lửa điện', 'BẬT LỬA ĐIỆN, bật lửa điện usb, Bật lửa điện USB đẩy mở G-08, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '88000', '', '', '', '', NULL, '', '', '', '', 'kg', 'images/23912683/bat-lua-dien-usb-day-mo-g-08.jpg', '<p>Không sợ gió thổi tắt, chạy bằng điện hết pin có thể nạp lại, thiết kế đơn giản, tinh tế...</p>\n<p>Sản phẩm sở hữu kích thước siêu mỏng chỉ 8 x 2.6 x 1.2cm. Nên người dùng có thể dễ dàng b', '23912683', '55606109', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:13', '2024-05-29 06:11:13'),
(971, 'luoi-cua-cam-tay-da-nang-co-moc-hai-qua', 'Lưỡi Cưa cầm tay đa năng có móc hái quả', '<p><em><strong>Lưỡi Cưa cầm tay đa năng có móc hái quả</strong></em></p>\n<p>Lưỡi&nbsp; cưa cầm tay siêu tiện dụng, siêu sắc bén&nbsp; từ chất thép thép SK-5.</p>\n<p>Tay cầm bọc nhựa cầm chắc tay.</p>\n<p>Cán có hỗ trợ lỗ bắt ốc để gắn với cắn cắt tỉa cành và thu hái quả trên cao.</p>\n<p>Kích thước: dài 52cm, lưỡi cưa dài 40cm, dày 2mm, đường kính ống 3cm.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-4.jpg?v=1638501602980\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-1.jpg?v=1638501609850\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-2.jpg?v=1638501617860\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-5.jpg?v=1638501624517\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-3.jpg?v=1638501630195\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-7.jpg?v=1638502151322\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cua-cam-tay-cat-canh-tren-cao-6.jpg?v=1638502157945\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"