(972, 'bat-lua-dien-jobon-da-nang', 'Bật lửa điện Jobon đa năng', '<p><em><strong>Bật lửa điện Jobon đa năng</strong></em></p>\n<p>Bật lửa điện sạc điện qua cổng&nbsp;USB tiện dụng.</p>\n<p>Lên lửa nhạy chỉ 1 cái gạt tay.</p>\n<p>Bật tích hợp 1 dao gấp nhỏ sắc bén.</p>\n<p>Màu trắng trơn sang trọng. Kích thước: 7.2*3.5*0.8CM</p>\n<p>Bộ sản phẩm có hộp đựng sang trọng có kèm cáp sạc USB.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-jonbon-da-nang-v6.jpg?v=1638435795419\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-jonbon-da-nang-v8.jpg?v=1638435809780\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-jonbon-da-nang-v9.jpg?v=1638435823058\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-jonbon-da-nang-v3.jpg?v=1638435831391\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-dien-jonbon-da-nang-v2-9a69502c-0c01-43fa-a128-3e2d3c84fab7.jpg?v=1638435963152\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/FbjfhnkMbLs\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Bật lửa điện Jobon đa năng', 'bật lửa đa năng, bật lửa điện, bạt lửa jobon, freeship, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '130000', '', '', '', '', NULL, '', '', '', '', 'kg', 'images/23905661/bat-lua-dien-