(973, 'bo-day-kem-yem-dat-cho-co-phan-quang', 'Bộ dây kèm yếm dắt chó có phản quang', '<p><em><strong>Bộ dây kèm yếm dắt chó có phản quang</strong></em></p>\n<p>Chất liệu dây vải mềm&nbsp;thoải mái khi sử dụng.</p>\n<p>Yếm sợi đan mềm được thiết kế đặc biệt cho cảm giác thoải mái,&nbsp;hạn chế gây đau, lực lên cổ chó mèo nhỏ.</p>\n<p>Dành cho thú cưng từ size&nbsp;nhỏ&nbsp;đến size lớn.</p>\n<p>Chất liệu: An toàn, bền chắc, mềm mại.</p>\n<p>Kích&nbsp;thước: Dây&nbsp;dài 150cm, phần yếm chia size từ XXS đến size L.</p>\n<p>Size phân loại theo kích thước vòng 1 của Boss:&nbsp;</p>\n<ul>\n<li>Size XXS 32-38CM</li>\n<li>Size XS 38-46CM</li>\n<li>Size S 42-45CM</li>\n<li>Size M&nbsp;47-57CM</li>\n<li>Size L 53-68CM</li></ul>\n<p>Lưu ý: Do may đo thủ công nên có thể sai số nhẹ 1-2cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-2.jpg?v=1638245607278\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-3.jpg?v=1638245615345\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-5.jpg?v=1638248343915\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-4.jpg?v=1638248351466\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-7.jpg?v=1638248361451\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/yem-xich-cho-1.jpg?v=1638245621581\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/YpwnHKHJ10I\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Bộ dây kèm yếm dắt cho có phản quang', 'Bộ dây kèm yếm dắt cho có phản quang, dây dắt chó phản quang, Volcano, volcano.vn, yếm dắt chó', '1', 'Kích thước', 'XXS', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23841463/bo-day-kem-yem-dat-cho-co-phan-quang.jpg', '<p>Yếm sợi đan mềm được thiết kế đặc biệt cho cảm giác thoải mái,&nbsp;hạn chế gây đau, lực lên cổ chó mèo nhỏ.</p>\n<p>Chất liệu: An toàn, bền chắc, mềm mại.</p>\n<p>Kích&nbsp;thước: Dây&nbsp;', '23841463', '55317411', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:13', '2024-05-29 06:11:13'),
(974, 'op-chup-mam-lazang-xe-o-to-mazda', 'Ốp chụp mâm (Lazang ) xe ô tô Mazda', '<p><em><strong>Ốp chụp mâm (Lazang ) xe ô tô Mazda</strong></em></p>\n<p>Sau quá trình sử dụng ốp lazang của xe không tránh được&nbsp; tình trạng chày xước sỉn màu mất thẩm mỹ...</p>\n<p>Bộ 4 ốp&nbsp;chụp mâm (Lazang ) xe ô tô&nbsp;Mazda 15 inch.</p>\n<p>Với vật liệu nhựa PP chắc chắn, bền màu với thời gian.</p>\n<p>Chuyên dụng cho&nbsp;Xe&nbsp;có thông số&nbsp;lốp&nbsp; R15</p>\n<p>Lắp đặt đơn giản với lẫy gài chắc chắn.</p>\n<p>Kích thước: 15 inch (ứng thông số lốp&nbsp;R15)</p>\n<p>Cách chọn đúng kính thước: Trên lốp ký hiệu R15 tương đương chọn sản phẩm 15&nbsp;inch.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chup-mam-mazda-v3.jpg?v=1638176298901\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chup-mam-mazda-1.jpg?v=1638176319198\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/chup-mam-lazang-xe-kia-9.jpg?v=1567134070650\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/chup-mam-lazang-xe-kia-7.jpg?v=1567221663717\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/chup-mam-lazang-xe-kia-8.jpg?v=1567221670570\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/op-chup-nam-lazang-dongpheng-4.jpg?v=1606877672318\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/npqYLK2jpP0\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Ốp chụp mâm (Lazang ) xe ô tô Mazda', 'ô tô, Ốp chụp mâm (Lazang ) xe ô tô Mazda, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Bộ 04 chiếc', '', '', '', '', '', '', '', 'deny', '', '750000', '', '1', '', '', NULL, '', '', '', '6', 'kg', 'images/23824510/op-chup-mam-lazang-xe-o-to-mazda.jpg', '<p>Bộ 4 ốp&nbsp;chụp mâm (Lazang ) xe ô tô Mazda 15 inch.</p>\n<p>Với vật liệu nhựa PP chắc chắn, bền màu với thời gian.</p>\n<p>Chuyên dụng cho&nbsp;Xe&nbsp;có thông số&nbsp;lốp&nbsp; R15.</p>', '23824510', '55285374', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:14', '2024-05-29 06:11:14'),
(975, 'vong-co-cho-cho-cung-lot-da-pu-mem-mai-dieu-chinh-duoc', 'Vòng cổ cho chó cưng lót da PU mềm mại điều chỉnh được', '<p><em><strong>Vòng cổ cho chó cưng lót da PU mềm mại điều chỉnh được</strong></em></p>\n<p>Vòng cổ cho chó cưng với lớp lót da mềm mại,&nbsp;dễ chịu có thể điều chỉnh được .</p>\n<p>Thiết kế vẻ ngoài tinh tế, đẹp mắt và đặc biết là sự mềm mại thoải mái từ lớp lót da PU&nbsp;cao cấp mà chiếc vòng đem lại.</p>\n<p>Sản phẩm gồm 3 size: Size S: 1.5 x 42cm (rộng x dài). Dành cho cún có vòng cổ từ 25 - 32 cm.</p>\n<p>Size M: 2.0 x 50cm (rộng x dài) Dành cho cún có vòng cổ từ 30- 40 cm.</p>\n<p>Size L: 2.5 x 60cm (rộng x dài). Dành cho cún có vòng cổ từ 35 - 45 cm.</p>\n<p>Dễ dàng thay đổi kích thước vừa vặn với cổ cún.</p>\n<p>Màu sắc: Đen, đỏ</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-co-cho-7.jpg?v=1638005090163\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-co-cho-7-abea4566-7d48-4f1e-b061-fff020a727a3.jpg?v=1638005098301\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-co-cho-8.jpg?v=1638005111185\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/708GmwpTpIY\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Vòng cổ cho chó cưng', 'Volcano, volcano.vn, vòng cổ cho chó, Vòng cổ cho chó cưng', '1', 'Kích thước', 'S', 'Màu sắc', 'Đỏ', '', '', '', '', '', 'deny', '', '35000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23802641/vong-co-cho-cho-cung-lot-da-pu-mem-mai-dieu-chinh-duoc.jpg', '<p>Vòng cổ cho chó cưng với lớp lót da mềm mại,&nbsp;dễ chịu có thể điều chỉnh được .</p>\n<p>Thiết kế vẻ ngoài tinh tế, đẹp mắt và đặc biết là sự mềm mại thoải mái từ lớp lót da PU&nbsp;cao c', '23802641', '55148053', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:14', '2024-05-29 06:11:14'),
(976, 'ung-lao-dong-di-mua-ong-thap', 'Ủng lao động, đi mưa ống thấp', '<p><em><strong>Ủng lao động, đi mưa ống thấp</strong></em></p>\n<p>Ủng chống thấm nước thích hợp làm vườn hoặc làm nông nghiệp.</p>\n<p>Đế cao su&nbsp;chống trơn trượt, bền và dẻo dai.</p>\n<p>Sáng bóng, bảo quản được lâu, thích hợp cho việc chống rỉ, chống độc, chống đâm, nông nghiệp, thả vườn động vật thủy sinh.</p>\n<p>Thiết kế&nbsp;hiện đại, đạt tiêu chuẩn, thời trang, đế dầy chống trơn trượt.</p>\n<p>Ống cao 16cm.</p>\n<p>Size 40 - 41 - 42</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-1.jpg?v=1637743413077\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-2.jpg?v=1637743413937\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-3.jpg?v=1637743414607\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-4.jpg?v=1637743415067\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-6.jpg?v=1637743583211\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ung-lao-dong-5.jpg?v=1637743423321\" /></p>\n<p>&nbsp;</p>', '', 'Ủng lao động, đi mưa ống thấp', 'đi mưa ống thấp, ủng đi mưa, Ủng lao động, Volcano, volcano.vn', '1', 'Size', '40', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/23759968/ung-lao-dong-di-mua-ong-thap.jpg', '<p>Ủng chống thấm nước thích hợp làm vườn hoặc làm nông nghiệp.</p>\n<p>Đế cao su&nbsp;chống trơn trượt, bền và dẻo dai.</p>\n<p>Sáng bóng, bảo quản được lâu, thích hợp cho việc chống rỉ, chống', '237