(977, 'den-dau-hoa-co-trang-tri-tho-cung', 'Đèn dầu cổ thờ, trang trí bằng đồng thau', '<p><em><strong>Đèn dầu cổ thờ, trang trí bằng đồng thau</strong></em></p>\n<p>Những chiếc đèn dầu được chếc tác cầu kỳ và rất hiếm, giá trị .<br />\n<img alt=\"\" src=\"http://file.thegioidoco.net/2015/04/4621_6.jpg\" />Chất liệu đồng thau trên các cạnh có dấu ấn thời Trung Cổ.</p>\n<p>Đèn có chụp thủy tinh.</p>\n<p>Đèn phù hợp làm đèn thờ, đèn trang trí, đèn decor...</p>\n<p>Kích thước: 16*7.5CM.</p>\n<p>Trọng lượng: 460G.</p>\n<p>Màu vàng đồng cổ.<br />\n&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v12.jpg?v=1637576346546\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v8.jpg?v=1637576357951\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v7.jpg?v=1637576368772\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v5.jpg?v=1637576380551\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v9.jpg?v=1637576401446\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-dau-hoa-co-trang-tri-va-tho-cung-v11.jpg?v=1637576416672\" /></p>', '', 'Đèn dầu cổ', 'đèn dầu cổ, đèn dầu thờ, đèn dầu trang trí, đèn thờ, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '0.8', 'kg', 'images/23742632/den-dau-hoa-co-trang-tri-tho-cun