(979, 'luoi-cuoc-lam-vuon-luoi-thep-cao-cap', 'Lưỡi cuốc làm vườn lưỡi thép cao cấp', '<p><em><strong>Lưỡi cuốc làm vườn lưỡi thép cao cấp</strong></em></p>\n<p>Cuốc làm vườn được làm bằng chất liệu thép rèn sắc bén.</p>\n<p>Cuốc được sử dụng cho công việc làm vườn, xới cỏ, vun gốc cây.</p>\n<p>Trên lưỡi có thiết kế lỗ sẵn để người dùng có thể tự chế cán vào khi sử dụng.</p>\n<p>Đặc biệt phần lưỡi bằng thép được tán bằng đinh với&nbsp;khung sắt đúc.</p>\n<p>Kích thước cuốc bầu bản lớn chiều rộng 31*15cm, lưỡi thép dày 1.5mm, phần khung đúc dày 5mm. Trọng lượng 840G.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuoc-lam-co-lam-vuon-d2.jpg?v=1637400534365\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuoc-lam-co-lam-vuon-d1.jpg?v=1637400541972\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cuoc-lam-co-lam-vuon-d3.jpg?v=1637400551214\" /></strong></em></p>', '', 'Lưỡi cuốc làm vườn lưỡi thép cao cấp', 'Lưỡi cuốc làm vườn, Lưỡi cuốc làm vườn lưỡi thép cao cấp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.8', 'kg', 'images/23726537/luoi-cuoc-lam-vuon-luoi-thep-cao-cap.jpg', '<p>Cuốc làm vườn được làm bằng chất liệu thép rèn sắc bén.</p>\n<p>Cuốc được sử dụng cho công việc làm vườn, xới cỏ, vun gốc cây.</p>\n<p>Trên lưỡi có thiết kế lỗ sẵn để người dùng có thể tự ch', '23726537', '54587389', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:14', '2024-05-29 06:11:14');
