(980, 'tui-treo-truc-yen-cot-sau-xe-dap', 'Túi gắn sau yên xe đạp Roswheel đựng đồ có phản quang', '<p><em><strong>Túi gắn sau yên xe đạp Roswheel đựng đồ có phản quang</strong></em></p>\n<p>Túi gắn sau yên xe đạp&nbsp;có khóa kéo chống thấm nước, phản quang an toàn hơn trong đêm.</p>\n<p>Kích thước: Khoảng 17*7.5*9cm</p>\n<p>Trọng lượng:&nbsp;70G Màu</p>\n<p>Sắc: Đỏ đen</p>\n<p>Chất liệu bên ngoài: vải và&nbsp;lót&nbsp;Nylon.&nbsp;</p>\n<p><em><strong>Lưu ý: Sản phẩm chỉ có&nbsp;01 túi&nbsp;</strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-1.jpg?v=1637208523787\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-5.jpg?v=1637209336306\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-4.jpg?v=1637208532610\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-2.jpg?v=1637208541736\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-3.jpg?v=1637208552130\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-cot-sau-xe-dap-6.jpg?v=1637209745854\" /></strong></em></p>', '', 'Túi gắn sau yên xe đạp', 'Túi gắn sau yên xe đạp Roswheel đựng đồ có phản quang, túi treo đuôi xe đạp, túi xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '110000', '', '1', '', '', NULL, '', ''