(985, 'nhan-nu-xoan-thung-bac-s925-cao-cap', 'Nhẫn nữ xoắn thừng bạc S925 cao cấp', '<p><em><strong>Nhẫn nữ xoắn thừng bạc S925 cao cấp</strong></em></p>\n<p>Nhẫn xoắn thừng phong cách mới, nổi bật.</p>\n<p>Phụ kiện kết hợp với nhiều loại nhẫn họa tiết đơn giản khác sẽ làm cho đôi tay bạn đầy ấn tượng.</p>\n<p>Điểm nhấn của phụ kiện dạng xoắn thừng đẹp mắt.</p>\n<p>Chất liệu Bạc nguyên chất 925 cao cấp,&nbsp;được gia công tỉ mỉ, sắc nét giúp bạn luôn bắt kịp xu hướng trang sức bạc và phụ kiện thời trang hot nhất.</p>\n<p>Màu sắc: Bạc, vàng.</p>\n<p>Trọng lượng: 0.5g,&nbsp;</p>\n<p>Đường kính 1.9cm. rộng 1.9mm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-bac-925-xoan-v6.jpg?v=1636948496979\" /></p>\n<p><img data-thumb=\"original\" original-height=\"799\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-bac-925-xoan-v8.jpg?v=1636948507949\" /></p>\n<p><img data-thumb=\"original\" original-height=\"799\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-bac-925-xoan-v9.jpg?v=1636948513875\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-bac-925-xoan-v4.jpg?v=1636948524405\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-bac-925-xoan-v5.jpg?v=1636948531381\" /></p>', '', 'Nhẫn xoắn thừng', 'Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '99000', 'kg', 'images/23665985/nhan-nu-xoan-thung-bac-s925-cao-cap.jpg', '<p>Nhẫn xoắn thừng phong cách mới, nổi bật.</p>\n<p>Phụ kiện kết hợp với nhiều loại nhẫn họa tiết đơn giản khác sẽ làm cho đôi tay bạn đầy ấn tượng.</p>\n<p>Điểm nhấn của phụ kiện dạng xoắn thừ', '23665985', '54199631', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NUL