(986, 'dao-phat-co-luoi-hai-gap-gon-luoi-thep-sk-5-can-tron', 'Dao phát cỏ, lưỡi hái gấp gọn lưỡi thép SK-5 cán tròn', '<p><em><strong>Dao phát cỏ, lưỡi hái gấp gọn lưỡi thép SK-5 cán tròn</strong></em></p>\n<p>Dụng cụ tuyệt vời cho dân làm vườn, các đội làm vườn cần làm sạch, phát quang bờ bụi.&nbsp;</p>\n<p>Nhỏ gọn, an toàn cao, lưỡi được bảo vệ. So với các nông cụ lưỡi hái lưỡi liềm cổ điển thì sản phẩm này có ưu điểm vượt trội.</p>\n<p>Bằng chất liệu thép gió (đây là loại thép sử dụng làm mũi khoan, mũi khoét) rất cứng và cán bằng kim loại.</p>\n<p>Vòng khoá rất linh hoạt và dễ dàng gấp và khóa chỉ trong vài giây.</p>\n<p>Khối lượng 270g. Kích thước 50 * 23cm. Gấp gọn : 50 * 7 * 2.5cm. Độ dày lưỡi 1.8mm. Đường kính cán 2.5cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-7.jpg?v=1636942857499\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-3.jpg?v=1636942866465\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-4.jpg?v=1636942872603\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-5.jpg?v=1636942880212\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-6.jpg?v=1636942888687\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-2.jpg?v=1636942903345\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-1.jpg?v=1636942921338\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luoi-hai-can-tron-8.jpg?v=1636943257408\" /></p>', '', 'Dao phát cỏ', 'Dao phát cỏ, liê, liềm cắt cỏ, liềm làm vườn, lưỡi hái gấp gọn lưỡi thép SK-5 cán tròn, lưới liềm, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/23663202/dao-phat-co-luoi-hai-gap-gon-luoi-thep-sk-5-can-tron.jpg', '<p>Dụng cụ tuyệt vời cho dân làm vườn, các đội làm vườn cần làm sạch, phát quang bờ bụi.&nbsp;</p>\n<p>Nhỏ gọn, an toàn cao, lưỡi được bảo vệ. So với các nông cụ lưỡi hái lưỡi liềm cổ điển thì', '23663202', '54194395', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:15', '2024-05-29 06:11:15'),
