(989, 'day-xich-cho-day-dat-cho-meo-dang-yem-1', 'Dây Xích Chó, Dây Dắt Chó Mèo Dạng Yếm phối màu', '<p><em><strong>Dây Xích Chó, Dây Dắt Chó Mèo Dạng Yếm phối màu</strong></em></p>\n<p>Chất liệu dây vải đan xoắn giúp tay cầm thoải mái khi sử dụng. Yếm sợi đan mềm được thiết kế đặc biệt cho cảm giác thoải mái và sự an toàn của thú cưng.</p>\n<p>Dành cho thú cưng từ size&nbsp;vừa&nbsp;đến size lớn.&nbsp;Thiết kế dạng yếm hạn chế gây đau, lực lên cổ chó mèo nhỏ.</p>\n<p>Chất liệu: An toàn, bền chắc, mềm mại.</p>\n<p>Kích&nbsp;thước dây&nbsp;dài 120cm.</p>\n<p>Size phân loại theo kích thước vòng 1 của Boss:&nbsp;</p>\n<ul>\n<li>Size M màu đỏ đen yếm 34-48cm.</li>\n<li>Size L màu đỏ phối màu xanh quân đội yếm 37-55cm.</li></ul>\n<p>Lưu ý: Do may đo thủ công nên có thể sai số nhẹ 1-2cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-4.jpg?v=1636705276491\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-6.jpg?v=1636705301888\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-1.jpg?v=1636705330138\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-2.jpg?v=1636705341886\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-3.jpg?v=1636705352100\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-5.jpg?v=1636705362619\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-xich-dat-cho-loai-to-v1.jpg?v=1636705371