(991, 'bom-xe-may-xe-dap-vo-nhom-co-dong-ho-cao-cap', 'Bơm xe máy, xe đạp có đồng hồ đo áp suất cao cấp', '<p><em><strong>Bơm xe máy, xe đạp có đồng hồ đo áp suất cao cấp</strong></em></p>\n<p>Bơm xe đa năng có đồng hồ rất thuận tiện cho gia đình không phải mang ra ngoài quán mất thời gian, tiện lợi và dễ sử dụng</p>\n<p>Ống bơm hơi được thiết kế đặc biệt sử dụng pit tông trong thân bơm to dùng để bơm phao, bơm bể phao, bóng hơi các loại ngoài xe đạp, xe máy, các loại van, gạo, giun, xe máy.</p>\n<p>Tốc độ bơm nhanh, dễ sử dụng, lực bơm nhẹ không tốn sức.</p>\n<p>Chất lượng bền, có đồng hồ đo áp lực và trợ lực.</p>\n<p>Áp suất bơm lên đến 160 PSI.</p>\n<p>Chất liệu ống thép không gỉ.</p>\n<p>Kích thước: Cao 63CM, đường kính ống 37MM.&nbsp;Trọng lượng 0.75Kg.</p>\n<p>Màu sắc: Đen, trắng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d3.jpg?v=1636512999319\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d5.jpg?v=1637914612247\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d4.jpg?v=1636513006972\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d1.jpg?v=1636513013494\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d2.jpg?v=1636513020692\" /></p>', '', 'Bơm xe đạp', 'Bơm xe máy, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe đạp vỏ nhôm có đồng hồ cao cấp, xe máy', '1', 'Màu sắc', 'Trắng', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/23602982/bom-xe-may-xe-dap-vo-nhom-co-dong-ho-cao-cap.jpg', '<p>Ống bơm hơi được thiết kế đặc biệt sử dụng pit tông trong thân bơm to dùng để bơm phao, bơm bể phao, bóng hơi các loại ngoài xe đạp, xe máy, các loại van, gạo, giun, xe máy.</p>\n<p>Tốc độ ', '23602982', '53860863', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:16', '2024-05-29 06:11:16'),
(992, 'lac-tay-vong-tay-nu-bac-925-cao-cap-khac-laser-theo-yeu-cau', 'Lắc tay, vòng tay nữ bạc 925 cao cấp - Khắc laser theo yêu cầu', '<p><strong><em>Lắc tay, vòng tay nữ bạc 925 cao cấp - Khắc laser theo yêu cầu</em></strong></p>\n<p>Vòng tay&nbsp;thiết kế trên công nghệ hiện đại nhất.</p>\n<p>Lắc tay khắc tên theo yêu cầu còn là món quà tặng ý nghĩa kỉ niệm tình yêu đôi lứa.</p>\n<p>Chất liệu 92,5% bạc nguyên chất phần còn lại là hợp chất làm tăng độ cứng và sáng bóng cho sản phẩm.</p>\n<p>Độ trắng sáng cao, không lo bị đen, xỉn màu.</p>\n<p>Khắc tên,&nbsp;ngày tháng miễn phí theo yêu cầu.</p>\n<p>Kích&nbsp; thước: Dài 16cm. phần mặt dài 2cm, rộng 4mm.</p>\n<p>Trọng lượng: 6G.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-925-v7.jpg?v=1636358579489\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-925-v10-ff0cab05-1dc7-4e85-b40b-eca95fd0d9b0.jpg?v=1636360888709\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-952-v2-24dc9e7c-1fa5-4464-a1ed-4988ac820cd1.jpg?v=1636360899201\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-952-v1.jpg?v=1636360425783\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-925-v9-1c2ef42e-0bd4-4559-90aa-cc58021e74ec.jpg?v=1636360976497\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lac-tay-bac-925-v.jpg?v=1636358531614\" /></em></strong></p>\n<p><str