(993, 'den-led-canh-bao-gan-xe-dap-6-che-do', 'Đèn led cảnh báo gắn xe đạp 7 chế độ', '<p><strong><em>Đèn led cảnh báo gắn xe đạp 7 chế độ</em></strong></p>\n<p>Đèn nháy gồm 5 bóng led, cho độ sáng cao, giúp cảnh báo&nbsp;an toàn khi đạp xe buổi tối.</p>\n<p>Pin 300mah cho độ sáng 8 tiếng ở chế độ liên tục và 12 tiếng ở chế độ nháy</p>\n<p>Ánh sáng 7 chế độ chuyển qua lại bằng nút công tắc.</p>\n<p>Sạc qua cổng USB tiện lợi.</p>\n<p>Chống nước tuyệt đối.</p>\n<p>Có thể gắn vào ghi đông, cốt yên...</p>\n<p>Kích thước: 7.5*2.5*1.8CM</p>\n<p>Màu sắc:&nbsp; Đỏ</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-canh-bao-gan-suon-duoi-xe-dap-1.jpg?v=1636354815025\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-canh-bao-gan-suon-duoi-xe-dap-2.jpg?v=1636354815685\" /></em></strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-canh-bao-gan-suon-duoi-xe-dap-3.jpg?v=1636354824868\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-canh-bao-gan-suon-duoi-xe-dap-4.jpg?v=1636354832733\" /></em></strong></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/0npvj-5xEsw\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Đèn led cảnh báo gắn xe đạp 6 chế độ', 'đèn cảnh báo xe đạp, đèn led cảnh báo, đèn led cảnh báo gắn đuôi xe, Đèn led cảnh báo gắn xe đạp 6 chế độ, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg