(994, 'cua-cam-tay-gap-gon-thep-sk5-luoi-35cm-sieu-ben', 'Cưa Cầm Tay Gấp Gọn Thép SK5 Lưỡi 35cm Siêu Bén', '<p><strong><em>Cưa Cầm Tay Gấp Gọn Thép SK5 Lưỡi 35cm Siêu Bén</em></strong></p>\n<p>Lưỡi cưa làm từ thép SK5 tiêu chuẩn, có sự cân bằng tuyệt vời giữa độ cứng và&nbsp;độ bền.</p>\n<p>Lưỡi cưa sắc bén, chống mài mòn tốt, chống gỉ, được xử lý nhiệt cứng đảm bảo cho lưỡi cưa bền bỉ theo thời gian.</p>\n<p>Bước răng 7 TPI với khoảng ngắt tối ưu cho cưa gỗ giúp thoát vụn cưa nhanh hơn, cưa ngọt hơn.</p>\n<p>Cấu tạo gấp gọn (có khóa an toàn) tiết kiệm diện tích và&nbsp;dễ dàng mang theo.</p>\n<p>Tay cầm nhựa bền bỉ, không đau tay khi sử dụng.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cua-gap-ngon-5.jpg?v=1636192288185\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cua-gap-ngon-2.jpg?v=1636191835093\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cua-gap-ngon-1.jpg?v=1636191215408\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cua-gap-ngon-3.jpg?v=1636191819655\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cua-gap-ngon-7.jpg?v=1636194930051\" /></em></strong></p>\n<p>&nbsp;</p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/JU8QdSUdclM\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Cưa Cầm Tay Gấp Gọn Thép SK5 Lưỡi 35cm Siêu Bén', 'Cưa Cầm Tay Gấ