(995, 'tay-vin-ghe-sau-xe-dap-gan-truc-yen-cho-tre', 'Tay vịn ghế sau xe đạp gắn trục yên cho trẻ', '<p><em><strong>Tay vịn ghế sau xe đạp&nbsp;gắn trục yên cho trẻ</strong></em></p>\n<p>Sản phẩm hữu ích gắn xe đạp cho trẻ vịn tay khi ngồi yên sau xe đạp.</p>\n<p>Thiết kế thông minh gắn trực tiếp lên trục yên xe đơn giản.</p>\n<p>Chất liệu kim loại chống gỉ, tay cầm bọc cao su chống trơn an toàn cho bé.</p>\n<p>Kích thước: dài 26cm, rộng 18cm, đường kính 2.5cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-1.jpg?v=1636174573868\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-2.jpg?v=1636174581375\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-5.jpg?v=1636174587997\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-2-077374ad-cab7-4bb8-aca8-9b5171294bff.jpg?v=1636174598294\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-v1.jpg?v=1636173080252\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-v2.jpg?v=1636173085736\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-vin-gan-truc-yen-xe-dap-v3.jpg?v=1636173091671\" /></strong></em></p>', '', 'Tay vịn ghế sau xe đạp gắn trục yên cho trẻ', 'Tay vịn ghế sau xe đạp gắn trục yên cho trẻ, Volcano, volcano.vn', '1', 'Title', 'Defa