(996, 'diem-gan-gac-baga-xe-dap-cao-cap', 'Đệm lót yên sau gắn gác baga xe đạp', '<p><strong><em>Đệm lót yên sau gắn gác baga xe đạp&nbsp;</em></strong></p>\n<p>Đệm lót yên xe đạp được làm từ chất liệu cao cấp có lớp đệm dày 3cm chống sốc cực êm ái.</p>\n<p>Là phụ kiện cần thiết dành cho người thường xuyên đi xe đạp, đặc biệt là ghế ngồi sau xe</p>\n<p>Đệm được thiết kế êm ái, bên dưới đệm lót có 2 dây co dãn có chốt cài để cố định đệm lót vào ghế sau xe, ôm sát khung ghế xe, hạn chế xô lệch.</p>\n<p>Lớp da bọc đệm lót được bắn ghim chắc chắn xung quanh nên bạn không sợ đệm bị bong chóc phần bọc da bên ngoài.</p>\n<p>Phân loại: Màu đen, đen trắng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-5.jpg?v=1636107256739\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-6.jpg?v=1636107263129\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-8.jpg?v=1636107363763\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-9.jpg?v=1636107772675\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-1.jpg?v=1636106383270\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-gan-yen-xe-dap-2.jpg?v=1636106391083\" /></strong></em></p>', '', 'Đệm lót yên sau gắn gác baga xe đạp ', 'đệm yên xe máy, ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/23560101/diem-gan-gac-baga-xe-dap-cao-cap.jpg', '<p>Là phụ kiện cần thiết dành cho người thường xuyên đi xe đạp, đặc biệt là ghế ngồi sau xe</p>\n<p>Đệm được thiết kế êm ái, bên dưới đệm lót có 2 dây co dãn có chốt cài để cố định đệm lót vào', '23560101', '53666423', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:16', '2024-05-29 06:11:16'),
