(998, 'bua-riu-kiem-luoi-liem-da-nang-co-can', 'Búa rìu kiêm lưỡi liềm đa năng có cán', '<p><em><strong>Búa rìu kiêm lưỡi&nbsp;liềm đa năng có cán</strong></em></p>\n<p>Sản phẩm đa năng tích dụng cụ vô cùng tiện ích cho việc đi rừng, đi rẫy, làm vườn, đi câu....</p>\n<p>Lưỡi rìu, lưỡi liềm sắc bén làm từ thép cao cấp. Được hàn sẵn cán bằng ống thép, tay cầm bọc nhựa chắc chắn, không đau tay.</p>\n<p>Kích thước: Dài 60CM, phần cán 45cm, phần lưỡi dài 15cm rộng 20.5cm.</p>\n<p>Kích thước lưỡi: lưỡi liềm 14.5CM, lưỡi rìu 9.5CM, dày 2.5MM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-1.jpg?v=1635933414009\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-2.jpg?v=1635933419926\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-3.jpg?v=1635933426669\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-4.jpg?v=1635933437094\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-5.jpg?v=1635933444157\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/liem-kiem-ruu-da-nang-6.jpg?v=1635933450323\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Búa rìu kiêm lưỡi liềm đa năng có cán', 'búa rìu, Búa rìu kiêm lưỡi liềm đa năng có cán, lưỡi liềm, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', ''