(999, 'den-xe-dap-the-thao-sieu-sang-co-kem-coi-pin-sac-usb-chong-nuoc', 'Đèn xe đạp thể thao siêu sáng có kèm còi pin sạc USB chống nước', '<p><em><strong>Đèn xe đạp thể thao siêu sáng có kèm còi pin sạc USB chống nước</strong></em></p>\n<p>Thiết kế nhựa cao cấp kết hợp cao su theo tiêu chuẩn chống nước ip44 đủ để hoạt động trong bất kỳ thời tiết như nắng nóng hay mưa rào.</p>\n<p>Sản phẩm có 2 nút bấm 1 nút trên đèn để điều chỉnh đèn 1 nút bấm trên dây(dây dài khoảng 30cm) điều chỉnh còi.</p>\n<p>Sản phẩm sử dụng pin liền sạc lại qua cổng usb dung lượng pin lên đến 1200mah theo công bố của nhà sản xuất pin có thể sạc trên 500 lần và khi sạc đầy (rơi vào khoảng 2 giờ) tùy chế độ thời gian sử dụng sẽ khác nhau chế độ cường độ sáng (lumen) thời gian sáng mạnh 250LM 2.5H sáng mờ 125LM 5.0H nháy sáng 250LM 3.5H</p>\n<p>Đèn sử dụng bóng led T6 nhập khẩu mỹ công suất 3w hiệu suất cao với 3 chế độ sáng giúp người dùng di chuyển dễ dàng trong đêm tối</p>\n<p>Còi với cường độ âm thanh 140db dư sức để cảnh báo các phương tiện xung quanh giúp người sử dụng tham gia giao thông an toàn hơn. Chế độ âm thanh 1 chế độ.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-co-kem-coi-gan-xe-dap-3.jpg?v=1635849348845\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-co-kem-coi-gan-xe-dap-v1.jpg?v=1635849355325\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-co-kem-coi-gan-xe-dap-1.jpg?v=1635849366392\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-co-kem-coi-gan-xe-dap-v10.jpg?v=1635849373101\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/fpD7hygxdZc\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Đèn xe đạp', 'còi xe, còi xe đạp, đèn led xe đạp, Đèn xe đạp thể thao siêu sáng có kèm còi pin sạc USB chống nước, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '190000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23527409/den-xe-dap-the-thao-sieu-sang-co-kem-coi-pin-sac-usb-chong-nuoc.jpg', '<p>Sản phẩm có 2 nút bấm 1 nút trên đèn để điều chỉnh đèn 1 nút bấm trên dây(dây dài khoảng 30cm) điều chỉnh còi.</p>\n<p>Sản phẩm sử dụng pin liền sạc lại qua cổng usb dung lượng pin lên đến ', '23527409', '53521407', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:17', '2024-05-29 06:11:17'),
(1000, 'dung-cu-trat-tuong-sieu-toc', 'Dụng cụ trát tường siêu tốc', '<p><em><strong>Dụng cụ trát tường siêu tốc</strong></em></p>\n<p>Dụng cụ trát tường siêu tốc làm từ chất liệu inox dày dặn, cứng cáp, sáng bóng, chống gỉ sét, dễ lau chùi, vệ sinh sau khi sử dụng.</p>\n<p>Thiết kế 2 tay cầm trên-dưới giúp người thợ dễ dàng lấy vữa và trát nhanh chóng.</p>\n<p>Phía dưới máng có khe hở giúp độ dày lớp trát đều nhau.</p>\n<p>Sản phẩm được gia công với phương pháp hàn đa điểm nên mỗi hàn rất chắc chắn, đảm bảo không bị rạn nứt trong quá trình sử dụng.</p>\n<p>Ứng dụng cho việc bả tường, trát vữa xi măng ở những công trình có diện tích rộng lớn. Sản phẩm giúp tiết kiệm thời gian và công sức gấp 5 lần so với khi sử dụng những dụng cụ trát vữa truyền thống. Máng trát vữa nhanh dễ dàng sử dụng ngay cả cho người mới bắt đầu.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-2.jpg?v=1635844810087\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-3.jpg?v=1635844817071\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-7.jpg?v=1635844823423\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-5.jpg?v=1635844834629\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-4.jpg?v=1635844840362\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-6.jpg?v=1635844846715\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-chat-tuong-1.jpg?v=1635844853162\" /></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/Gjciq861cBE\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Dụng cụ trát tường siêu tốc', 'đồ trát tường, Dụng cụ trát tường siêu tốc, máng trát tường, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '160000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/23526339/dung-cu-trat-tuong-sieu-toc.jpg', '<p>Dụng cụ trát tường siêu tốc làm từ chất liệu inox dày dặn, cứng cáp, sáng bóng, chống gỉ sét, dễ lau chùi, vệ sinh sau khi sử dụng.</p>\n<p>Thiết kế 2 tay cầm trên-dưới giúp người thợ dễ dà', '23526339', '53516338', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:17', '2024-05-29 06:11:17'),
(1001, 'o-doi-dau-cau-ca-gap-ngon-cao-cap', 'Ô đội đầu câu cá gấp ngọn cao cấp', '<p><em><strong>Ô đội đầu câu cá gấp ngọn cao cấp</strong></em></p>\n<p>Luôn thảnh thơi 2 tay để câu cá không cần phải mang theo chiếc ô nặng nề khi đi câu</p>\n<p>Thể hiện dân câu chuyên nghiệp của một cần thủ. Ngoài đội đi câu thì hoàn toàn có thể đi chơi du lịch hoặc làm viếc cũng rất tiện dụng...</p>\n<p>Kích thước nhỏ gọn khi đóng dài 46cm, kích thước ô mở 80CM đảm bảo che chắn mưa nắng toàn thân cho người dùng.</p>\n<p>Chất liệu: vải dù&nbsp;Oxford chống thấm, khung thép chắc chắn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-doi-dau-cau-ca-4.jpg?v=1635758339347\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-doi-dau-cau-ca-1.jpg?v=1635758346062\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-doi-dau-cau-ca-2.jpg?v=1635758351701\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-doi-dau-cau-ca-3.jpg?v=1635758358583\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"567\" src=\"https://www.youtube.com/embed/wSGNIYrHI9k\" title=\"Ô đội đầu câu cá gấp ngọn cao cấp\" width=\"100%\"></iframe></p>', '', 'Ô đội đầu câu cá gấp ngọn cao cấp', 'ô câu cá, ô câu cá cao cấp, ô câu cá giá rẻ, ô đội đầu, Ô đội đầu câu cá gấp ngọn cao cấp, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '75000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23515008/o-doi-dau-cau-ca-gap-ngon-cao-cap.jpg', '<p>Luôn thảnh thơi 2 tay để câu cá không cần phải mang theo chiếc ô nặng nề khi đi câu</p>\n<p>Thể hiện dân câu chuyên nghiệp của một cần thủ. Ngoài đội đi câu thì hoàn toàn có thể đi chơi du ', '23515008', '53464806', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:17', '2024-05-29 06:11:17'),
(1002, 'tem-decal-van-dam-binh-an-dan-trang-tri-xe-tai-xe-o-to-xe-dau-keo', 'Tem decal  Vạn Dặm Bình An dan trang trí xe tải, xe ô tô, xe đầu kéo', '<p><em><strong>Tem decal &nbsp;Vạn Dặm Bình An dán trang trí xe tải, xe ô tô, xe đầu kéo</strong></em></p>\n<p>Chất liệu PVC chống nước&nbsp;</p>\n<p>Mực Nhật không ảnh hưởng đến môi trường.</p>\n<p>Cán màng bảo vệ chống bay màu, chống tia cực tím</p>\n<p>Không ảnh hưởng đến bề mắt dán sau khi bóc ra</p>\n<p>Màu sắc rõ nét,có cắt sẵn theo viền, khách chỉ bóc ra là sử dụng được.</p>\n<p>Kích thước: dài 1M, cao 15CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/6-387aa9a3-1485-4f92-aca2-c5c578c5e090.jpg?v=1635751774548\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-c66f5ab9-a0ed-459e-b20e-243108c920fd.jpg?v=1635751753390\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-a4279874-3475-4eb0-83f1-68c597c028d4.jpg?v=1635751759114\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Decal dán xe tải', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23513658/tem-decal-van-dam-binh-an-dan-trang-tri-xe-tai-xe-o-to-xe-dau-keo.jpg', '<p>Chất liệu PVC chống nước&nbsp;</p>\n<p>Mực Nhật không ảnh hưởng đến môi trường.</p>\n<p>Cán màng bảo vệ chống bay màu, chống tia cực tím</p>\n<p>Không ảnh hưởng đến bề mắt dán sau khi bóc ra<', '23513658', '53462066', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:17', '2024-05-29 06:11:17'),
(1003, 'cay-go-luoi-cau-cao-cap', 'Cây gỡ lưỡi câu cao cấp', '<p><em><strong>&nbsp; Cây gỡ lưỡi câu cao cấp</strong></em></p>\n<p>Thao tác cực nhanh và đơn giản, gỡ cá nuốt lưỡi chỉ trong 3 giây</p>\n<p>Tay cầm làm từ kim loại chắc chắn, có tích họp nam châm vĩnh cửu để nhặt hút lưỡi câu.&nbsp;</p>\n<p>&nbsp;Chất liệu kim loại không gỉ nhỏ gọn, kích thước: Dài17.5cm, trọng lượng 27g.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-go-ca-cao-cap-4.jpg?v=1635750081362\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-go-ca-cao-cap-5.jpg?v=1635750089374\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-go-ca-cao-cap-2.jpg?v=1635749404092\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-go-ca-cao-cap-3.jpg?v=1635749410182\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-go-ca-cao-cap-1.jpg?v=1635749415843\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/EiND8fJel-o\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Cây gỡ lưỡi câu cao cấp', 'cây gỡ cá, cây gỡ lưỡi câu cá, Cây gỡ lưỡi câu cao cấp, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23513125/cay-go-luoi-cau-cao-cap.jpg', '<p>Thao tác cực nhanh và đơn giản, gỡ cá nuốt lưỡi chỉ trong 3 giây</p>\n<p>Tay cầm làm từ kim loại chắc chắn, có tích họp nam châm vĩnh cửu để nhặt hút lưỡi câu.&nbsp;</p>\n<p>&nbsp;Chất liệu ', '23513125', '53460040', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1004, 'voi-tuoi-cay-cao-ap-nhieu-dau', 'Vòi Tưới Cây Cao Áp Nhiều Đầu', '<p><strong><em>Vòi Tưới Cây Cao Áp Nhiều Đầu</em></strong></p>\n<p>Vòi Tưới Cây Áp Lực tạo dòng chảy lớn, tia nước nhỏ, không làm sói mòn đất, trôi đất ở rễ, tưới nước thuận tiện hơn và sẽ không làm hỏng, dập nát hoa và cây trồng.</p>\n<p>Được làm từ nhựa ABS chất lượng cao&nbsp;đầu phun áp lực.</p>\n<p>Với thiết kế vòi phun nước quay, bạn sẽ dễ dàng điều chỉnh lượng nước và chế độ đầu ra của nước, xả đều nước, điều chỉnh góc của vị trí tưới và điều chỉnh mật độ, kích thước và phạm vi của nước.</p>\n<p>Chỉ cần kết nối đầu nối nước với ống nước và sử dụng để tưới nước. Rất thích hợp để tưới nước ở khu vườn rộng, cánh đồng canh tác, sân nhà,...</p>\n<p>Kích thước lắp vừa cho ống 32.</p>\n<p>Phân loại: Vòi 3 đầu, vòi&nbsp;4 đầu,&nbsp;vòi&nbsp;5 đầu, vòi&nbsp;6 đầu.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-3.jpg?v=1635394037267\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-1.jpg?v=1635394043319\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-4.jpg?v=1635395389013\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-9.jpg?v=1635396264691\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-10.jpg?v=1635396271569\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-7.jpg?v=1635396279697\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-phun-nuoc-8.jpg?v=1635396286650\" /></p>', '', 'Vòi Tưới Cây Cao Áp Nhiều Đầu', 'vòi tưới cây, Vòi Tưới Cây cao áp, Vòi Tưới Cây Cao Áp Nhiều Đầu, Volcano, volcano.vn', '1', 'Loại', '3 Đầu', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.6', 'kg', 'images/23444475/voi-tuoi-cay-cao-ap-nhieu-dau.jpg', '<p>Được làm từ nhựa ABS chất lượng cao&nbsp;đầu phun áp lực.</p>\n<p>Với thiết kế vòi phun nước quay, bạn sẽ dễ dàng điều chỉnh lượng nước và chế độ đầu ra của nước, xả đều nước, điều chỉnh gó', '23444475', '53246305', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1005, 'bo-02-tem-decal-dan-cua-xe-o-to-xe-tai', 'Bộ 02 Tem decal dán cửa xe ô tô, xe tải - in số điện thoại theo yêu cầu', '<p><em><strong>Bộ 02 Tem decal dán cửa xe ô tô, xe tải - in số điện thoại theo yêu cầu</strong></em></p>\n<p>Tem dán cánh cửa xe có có in số điện thoại theo yêu cầu khách hàng!</p>\n<p>Tem chất liệu decal cao cấp nổi bật khi dán lên xe.</p>\n<p>Phù hợp dán nhiều dòng xe khác nhau, vị trí dán gần tay mở cửa.</p>\n<p>Kích thước: Dài 14CM, cao 6cm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-a47c12e4-674a-43a7-9ee5-152cfc91de51.jpg?v=1635328585055\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"900\" original-width=\"900\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-f482f410-d4ab-42a5-ac1b-3acb9f40daa9.jpg?v=1635328542858\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"900\" original-width=\"900\" src=\"//bizweb.dktcdn.net/100/200/904/files/9-b99f3c02-37ba-469b-a10e-707ecf7b3497.jpg?v=1635328553348\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Tem decal dán cửa xe ô tô', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23437673/bo-02-tem-decal-dan-cua-xe-o-to-xe-tai.jpg', '<p>Tem dán cánh cửa xe có có in số điện thoại theo yêu cầu khách hàng!</p>\n<p>Tem chất liệu decal cao cấp nổi bật khi dán lên xe.</p>\n<p>Phù hợp dán nhiều dòng xe khác nhau, vị trí dán gần ta', '23437673', '53168925', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1006, 'thung-dung-ca-di-cau', 'Thùng đựng cá đi câu gấp gọn', '<p><em><strong>Thùng đựng cá đi câu gấp gọn</strong></em></p>\n<p>Chất liệu nhựa dẻo cao cấp EVA chống thấm nước tốt mà vô cùng thân thiện với môi trường không chỉ có tác dụng đựng cá mà còn có thể sử dụng vào nhiều mục đích khác nhau và vô cùng tiện dụng .</p>\n<p>Sử dụng khóa kéo tiện lợi, thiết kế chống rò rỉ nước, yên tâm di chuyển.</p>\n<p>Có đây xách đi kèm, kèm dây thả dài có thể giữ cá dưới nước.</p>\n<p>Kích thước: 18CM - 5L(19&nbsp;X 18cm),&nbsp;20CM - 7L(20X 20X 18cm),&nbsp;24 - 13LCM(24 X 24 X 22cm).</p>\n<p>Phân loại: 18cm&nbsp;tròn không có nắp, 20cm có nắp, 24cm có nắp quai dây, 24cm quay nhựa.</p>\n<p>Lưu ý: màu sắc dây xách và dây thả là ngẫu nhiên các màu.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-ca-di-cau-v4.jpg?v=1635240593220\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-ca-di-cau-1.jpg?v=1635240599765\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-ca-di-cau-v12.jpg?v=1635317353998\" /></strong></em></p>', '', 'Thùng đựng cá đi câu', 'câu cá, thùng đựng cá, Thùng đựng cá đi câu, Volcano, volcano.vn', '1', 'Kích thước', '18CM', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23416641/thung-dung-ca-di-cau.jpg', '<p>Chất liệu nhựa dẻo cao cấp EVA chống thấm nước tốt mà vô cùng thân thiện với môi trường không chỉ có tác dụng đựng cá mà còn có thể sử dụng vào nhiều mục đích khác nhau và vô cùng tiện dụn', '23416641', '53092915', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1007, 'dai-quan-can-cau-tay-cao-cap-quan-can-vot-cau-long-1', 'Đai Quấn Cần Câu Tay Cao Cấp, Quấn Cán Vợt Cầu Lông', '<p><em><strong>Đai Quấn Cần Câu Tay Cao Cấp, Quấn Cán Vợt Cầu Lông</strong></em></p>\n<p>Phụ kiện dùng cho quấn tay cầm câu đơn câu đài chất lượng tốt.</p>\n<p>Chất liệu Sợi kim loại microporous cao cấp chống trơn, êm tay khi dùng.</p>\n<p>Kích thước: Dài 1.1M, rộng 25CM, dày 0.17CM.</p>\n<p>Màu sắc: Đen, hồng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-1.jpg?v=1635220740341\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-2.jpg?v=1635220746585\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-5.jpg?v=1635220855686\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-v7.jpg?v=1635220754329\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-7.jpg?v=1635220935807\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-4.jpg?v=1635220944768\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-quan-can-vot-can-cau-3.jpg?v=1635220951304\" /></p>', '', 'Đai Quấn Cần Câu Tay Cao Cấp', 'đai quấn cần câu, Đai Quấn Cần Câu Tay Cao Cấp, Quấn Cán Vợt Cầu Lông, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '20000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23412504/dai-quan-can-cau-tay-cao-cap-quan-can-vot-cau-long-1.jpg', '<p>Phụ kiện dùng cho quấn tay cầm câu đơn câu đài chất lượng tốt.</p>\n<p>Chất liệu Sợi kim loại microporous cao cấp chống trơn, êm tay khi dùng.</p>\n<p>Kích thước: Dài 1.1M, rộng 25CM, dày 0.', '23412504', '53079452', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1008, 'bo-02-den-led-gan-xe-dap-powerbeam', 'Bộ 02 Đèn Led gắn xe đạp PowerBeam', '<p><em><strong>Bộ 02 Đèn Led gắn xe đạp PowerBeam</strong></em></p>\n<p>Đèn Led trước được làm bằng chất liệu nhựa ABS sử dụng để gắn vào gi đông xe đạp. Chức năng chính của loại sản phẩm này chính là giúp chiếu sáng cho người sử dụng khi phải đạp xe vào lúc trời tối.</p>\n<p>Đèn Led gắn xe đạp PowerBeam được thiết kế với kích thước rất nhỏ gọn và vô cùng tiện dụng. Đồng thời, khả năng chiếu sáng của loại đèn này là vô cùng tốt, có khả năng chống nước mà giá thành thì cực kỳ rẻ.</p>\n<p>Đèn hậu gắn vào trục yên xe có 4&nbsp;chế độ ánh sáng đỏ.</p>\n<p>Đèn sử dụng pin tiểu vô cùng tiện dụng.</p>\n<p>Kích thước đèn trước: 10*3.5CM, đè hậu 7*4*3CM.</p>\n<p>Màu sắc: Đen, trắng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-7.jpg?v=1635152061561\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-11.jpg?v=1635155605252\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-5.jpg?v=1635152068106\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-1.jpg?v=1635152076706\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-2.jpg?v=1635152083294\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-10.jpg?v=1635155529534\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-4.jpg?v=1635152095711\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-6.jpg?v=1635152102181\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-3.jpg?v=1635152110108\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-xe-dap-power-beam-8.jpg?v=1635152319360\" /></strong></em></p>', '', 'Đèn Led gắn xe đạp', 'đèn led, đèn led xe đạp, ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23404417/bo-02-den-led-gan-xe-dap-powerbeam.jpg', '<p>Đèn Led trước được làm bằng chất liệu nhựa ABS sử dụng để gắn vào gi đông xe đạp. Chức năng chính của loại sản phẩm này chính là giúp chiếu sáng cho người sử dụng khi phải đạp xe vào lúc t', '23404417', '52992494', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18'),
(1009, 'dai-quan-can-cau-tay-cao-cap-quan-can-vot-cau-long', 'Đai Quấn Cần Câu Tay Cao Cấp, Quấn Cán Vợt Cầu Lông Họa Tiết Ngôi Sao', '<p><em><strong>Đai Quấn Cần Câu Tay Cao Cấp, Quấn Cán Vợt Cầu Lông Họa Tiết Ngôi Sao</strong></em></p>\n<p>Phụ kiện dùng cho quấn tay cầm câu đơn câu đài chất lượng tốt.</p>\n<p>Họa tiết hình ngôi sao đẹp mắt cực ngầu.</p>\n<p>Chất liệu Sợi kim loại microporous cao cấp chống trơn, êm tay khi dùng.</p>\n<p>Kích thước: Dài 1.5M, rộng 28CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-quan-can-cau-1.jpg?v=1634956512305\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-quan-can-cau-3.jpg?v=1634956518975\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-quan-can-cau-2.jpg?v=1634956524531\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-quan-can-cau-5.jpg?v=1634956531819\" /></p>', '', 'Đai Quấn Cần Câu Tay', 'Đai Quấn Cần Câu Tay, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23382561/dai-quan-can-cau-tay-cao-cap-quan-can-vot-cau-long.jpg', '<p>Phụ kiện dùng cho quấn tay cầm câu đơn câu đài chất lượng tốt.</p>\n<p>Họa tiết hình ngôi sao đẹp mắt cực ngầu.</p>\n<p>Chất liệu Sợi kim loại microporous cao cấp chống trơn, êm tay khi dùng', '23382561', '52891197', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:18', '2024-05-29 06:11:18');
