(1010, 'coi-dien-xe-dap-sb-205', 'Còi điện xe đạp SB-205', '<p><strong><em>Còi điện xe đạp SB-205</em></strong></p>\n<p>Còi điện xe đạp sử dụng pin 9V 6F22 dùng được trong lâu dài hết hoàn toàn có thể thay. Tiếng kêu rất to để cảnh báo nguy hiểm cho người đi trước hoặc phát tín hiệu xin vượt. Còi phát tiếng hú xe cảnh sát khi ấn giữ.</p>\n<p>Thiết kế kiểu chuông thu nhỏ đẹp mắt dễ lắp đặt có sẵn đai để lắp xiết chặt,chắc chắn với ghi đông xe.</p>\n<p>Kích thước còi: 9*6CM.</p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/2185785f542ccb06b8062e365934aee3.jpg\" /></strong></p>\n<p>&nbsp;</p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/3ce39883bfe7ff826720ce7bda81f98c.jpg\" /></strong></p>\n<p>&nbsp;</p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/d4cb52dcbf2c4e39f8fa2506ad2d7d48.jpg\" /></strong></p>\n<p>&nbsp;</p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/9c3efbb3842d93c99377e987ef4c9ebf.jpg\" /></strong></p>\n<p>&nbsp;</p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/32d3e29cc91303635788a9e0fed5293d.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/735b01158b09beaea74c6ff12329dc1a.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/245910b52192c0737ab281c3a87abac1.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/e23115f3a5b8ecf258b6f767429969b5.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/27cfa0f83614d37a8172c56286422ad3.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/3cc18c40746a0f98bd7c44d3211ea3ab.jpg\" /></strong></p>\n<p><strong><img src=\"https://vn-live-02.slatic.net/original/55fdbc6aa93de7ec5f935b0ad5fa83a8.jpg\" /></strong></p>\n<p><strong><em>Lưu ý:</em></strong>sản phẩm chưa nối đầu nguồn điện khách hàng vui lòng tháo nắp dưới đuôi còi để đấu với nguồn bên trong trước khi sử dụng.</p>\n<p data-