(1011, 'cao-cam-tay-mini-trong-rau-trong-hoa-cay-canh-tien-dung', 'Cào cầm tay mini trồng rau, trồng hoa, cây cảnh tiện dụng', '<p><em><strong>Cào cầm tay mini trồng rau, trồng hoa, cây cảnh tiện dụng</strong></em></p>\n<p>Cào làm cỏ, trồng rau rất tiện lợi phù hợp chăm sóc trồng cây trong vườn, trồng hoa, cây cảnh</p>\n<p>Chất liệu thép không gỉ cao cấp.</p>\n<p>Kích thước: dài 35CM, lưỡi rộng 15CM cao 9.5CM, tay cầm 2.2CM.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cao-lam-co-trong-hoa-cay-canh-1.jpg?v=1634785428385\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cao-lam-co-trong-hoa-cay-canh-3.jpg?v=1634785429019\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cao-lam-co-trong-hoa-cay-canh-4.jpg?v=1634785439647\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cao-lam-co-trong-hoa-cay-canh-5.jpg?v=1634785449722\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cao-lam-co-trong-hoa-cay-canh-6.jpg?v=1634785456297\" /></strong></em></p>', '', 'Cào cầm tay mini trồng rau', 'Cào cầm tay mini trồng rau, cây cảnh tiện dụng, trôgng hoa, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.4', 'kg', 'images/23362831/cao-cam-tay-mini-trong-rau-trong-hoa-cay-canh-tien-dung.jpg', '<p>Cào làm cỏ, trồng rau rất tiện lợi phù hợp chăm sóc trồng cây trong vườn, trồng hoa, cây cảnh</p>\n<p>Chất liệu thép không gỉ cao cấp.</p>\n<p>Kích thước: dài 35CM, lưỡi rộng 15CM cao 9.5CM,', '23362831', '52801163', NULL,