(1012, 'dao-phat-co-luoi-hai-gap-gon-luoi-thep-sk-5', 'Dao phát cỏ, lưỡi hái gấp gọn lưỡi thép SK-5', '<p><em><strong>Dao phát cỏ, lưỡi hái gấp gọn lưỡi thép SK-5</strong></em></p>\n<p>Dụng cụ tuyệt vời cho dân làm vườn, các đội làm vườn cần làm sạch, phát quang bờ bụi.&nbsp;</p>\n<p>Nhỏ gọn, an toàn cao, lưỡi được bảo vệ. So với các nông cụ lưỡi hái lưỡi liềm cổ điển thì sản phẩm này có ưu điểm vượt trội.</p>\n<p>Bằng chất liệu thép gió (đây là loại thép sử dụng làm mũi khoan, mũi khoét) rất cứng và cán bằng kim loại.</p>\n<p>Vòng khoá rất linh hoạt và dễ dàng gấp và khóa chỉ trong vài giây.</p>\n<p>Khối lượng 0.4 kg Kích thước 42 * 23cm. Gấp gọn : 39 * 5 * 3cm.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v1.jpg?v=1634613870999\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v2.jpg?v=1634613871708\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v3.jpg?v=1634613872345\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v7.jpg?v=1634616825324\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v5.jpg?v=1634615500759\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-gap-gon-v6.jpg?v=1634615510991\" /></strong></em></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/BNzmT7T1Px0\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Dao phát cỏ, lưỡi hái gấp gọn lưỡi thép SK-5', 'Dao phát cỏ, dao phát gấp gọn, dao phát gấp họn, lưỡi dao, lưỡi hái, lưỡi hái gấp gọn lưỡi thép SK-5, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23334638/dao-phat-co-luoi-hai-gap-gon-luoi-thep-sk-5.jpg', '<p>Dụng cụ tuyệt vời cho dân làm vườn, các đội làm vườn cần làm sạch, phát quang bờ bụi.&nbsp;</p>\n<p>Nhỏ gọn, an toàn cao, lưỡi được bảo vệ. So với các nông cụ lưỡi hái lưỡi liềm cổ điển thì', '23334638', '52654614', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:19', '2024-05-29 06:11:19'),
(1013, 'gia-do-da-mai-dao-gan-bon-rua-bat-bang-nhua-cung', 'Giá Đỡ Đá Mài Dao Gắn Bồn Rửa Bát Bằng nhựa cứng', '<p><em><strong>Giá Đỡ Đá Mài Dao Gắn Bồn Rửa Bát Bằng nhựa cứng</strong></em></p>\n<p>Thay đổi kích cỡ từ 33&nbsp;đến 45CM phù hợp với chiều rộng bồn.</p>\n<p>Chất nhựa cứng, chịu lục tốt&nbsp;sử dụng lâu dài&nbsp;</p>\n<p>Chắc chắn, dễ lắp đặt và cất gọn khi không sử dụng.</p>\n<p>Tiện lợi mài dao ngay trên bồn rửa bát, xả nước bổ xung ngay.</p>\n<p>Kích thước tùy chỉnh 33-43CM, rộng 7.4CM, có kèm đầy đủ phụ kiện lắp đặt.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-de-da-mai-bang-nhua-abs-2.jpg?v=1634542280360\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-de-da-mai-bang-nhua-abs-3.jpg?v=1634542290820\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-de-da-mai-bang-nhua-abs-6.jpg?v=1634542301400\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-de-da-mai-bang-nhua-abs-4.jpg?v=1634542316265\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-de-da-mai-bang-nhua-abs-5.jpg?v=1634542329617\" /></strong></em></p>', '', 'Giá Đỡ Đá Mài Dao', 'Giá Đỡ Đá Mài Dao, Giá Đỡ Đá Mài Dao Gắn Bồn Rửa Bát Bằng nhựa cứng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '168000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23317939/gia-do-da-mai-dao-gan-bon-rua-bat-bang-nhua-cung.jpg', '<p>Thay đổi kích cỡ từ 33&nbsp;đến 45CM phù hợp với chiều rộng bồn.</p>\n<p>Chất nhựa cứng, chịu lục tốt&nbsp;sử dụng lâu dài&