(1015, 'khoa-xe-dap-khoa-cang-cua-xe-dap', 'Khóa Xe Đạp, Khóa Càng Cua Xe Đạp', '<p><strong><em>Khóa Xe Đạp, Khóa Càng Cua Xe Đạp</em></strong></p>\n<p>Khóa càng cua xe đạp lắp được cho tất cả các loại xe đạp vành thường, vành 1 lớp nhờ đai ốc bám vào càng xe.</p>\n<p>Khóa sử dụng tiện lợi, nhỏ gọn nhưng vẫn đảm bảo độ an toàn cho chiếc xe đạp của bạn Khóa sử dụng nhẹ nhàng, không lo bị kẹt.</p>\n<p>Lưu ý: Vành địa hình, vành 2 lớp, bánh có lốp to không nắp được.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-xe-dap-4.jpg?v=1634525390554\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-xe-dap-1.jpg?v=1634525402969\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-xe-dap-2.jpg?v=1634525403430\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-xe-dap-3.jpg?v=1634525411805\" /></p>', '', 'Khóa Xe Đạp, Khóa Càng Cua Xe Đạp', 'Khóa Càng Cua Xe Đạp, khóa càng xe đạp, Khóa Xe Đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23315538/khoa-xe-dap-khoa-cang-cua-xe-dap.jpg', '<p><strong><em>Khóa càng cua xe đạp lắp được cho tất cả các loại xe đạp vành thường, vành 1 lớp nhờ đai ốc bám vào càng xe.</em></strong></p>\n<p><strong><em>Khóa sử dụng tiện lợi, nhỏ gọn như', '23315538', '52535770', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:19', '2024-05-29 06:11:19'),
(1016, 'mu-bao-hiem-xe-dap-the-thao-cho-tre', 'Mũ bảo hiểm xe đạp, trượt patin thể thao cho trẻ em', '<p><em><strong>Mũ bảo hiểm xe đạp, trượt patin thể thao cho trẻ em</strong></em></p>\n<p>Thân mũ làm bằng một vật liệu xốp đặc biệt, vừa đảm bảo an toàn cho bé, vừa siêu nhẹ.</p>\n<p>Phần đệm trong lòng mũ và quai mũ mềm mại, chắc chắn, dễ tháo lắp.</p>\n<p>Mũ ôm chắc chắn và ổn định trên đầu bé.</p>\n<p>Kích thước mũ: Kích thước 22*20*9CM,vòng đầu tuỳ chỉnh 48-52CM, Phù họp cho trẻ từ 3-13 tuổi.</p>\n<p>Màu sắc: Xanh dương, đỏ, hồng.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mua-bao-hiem-theo-thao-cho-tre-em-3.jpg?v=1634360391847\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mua-bao-hiem-theo-thao-cho-tre-em-1.jpg?v=1634360401256\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mua-bao-hiem-theo-thao-cho-tre-em-2.jpg?v=1634360383841\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mua-bao-hiem-theo-thao-cho-tre-em-4.jpg?v=1634360468543\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mua-bao-hiem-theo-thao-cho-tre-em-5.jpg?v=1634360469052\" /></strong></em></p>', '', 'Mũ bảo hiểm xe đạp, trượt patin thể thao cho trẻ em', 'Mũ bảo hiểm xe đạp, phụ kirnj xe đpạ, trượt patin thể thao cho trẻ em, Volcano, volcano.vn, xe đạp', '1', 'Màu sắc', 'Hồng', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23299018/mu-bao-hiem-xe-dap-the-thao-cho-tre.jpg', '<p>Thân mũ làm bằng một vật liệu xốp đặc biệt, vừa đảm bảo an toàn cho bé, vừa siêu nhẹ.</p>\n<p>Phần đệm trong lòng mũ và quai mũ mềm mại, chắc chắn, dễ tháo lắp.</p>\n<p>Mũ ôm chắc chắn và ổn', '23299018', '52459956', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:19', '2024-05-29 06:11:19'),
(1017, 'combo-5m-day-ong-pe-4-7-cho-dau-tuoi-nho-giot-bec-tuoi-phun-suong-loai-cao-cap', 'Combo 5M dây ống PE 4/7 cho đầu tưới nhỏ giọt, béc tưới phun sương loại cao cấp', '<p><em><strong>Combo 5M dây ống PE 4/7 cho đầu tưới nhỏ giọt, béc tưới phun sương loại cao cấp</strong></em></p>\n<p>Là linh kiện xương sống trong hệ thống tưới tiêu, phun sương, tạo độ ẩm, làm mát môi trường</p>\n<p>Thành phần chính từ nhựa PE nguyên sinh có độ bền cao, chịu áp lực lớn, đáp ứng mọi nhu cầu.</p>\n<p>Bền bỉ với thời tiết, mưa, nắng tốt, thích hợp cho các hệ thống ngoài trời như sân vườn, trang trại nông nghiệp.</p>\n<p>Dễ dàng lắp đặt, mềm dẻo, đảm bảo vặn xoắn, bẻ gập xong có thể trở lại nguyên trạng ban đầu.</p>\n<p>Ống màu đen ngăn cản ánh sáng mặt trời, loại bỏ tình trạng đóng rêu gây tắc nghẽn đường ống.</p>\n<p>Kích thước: Đường kính ngoài 6mm, đường kính trong 4mm, ống dày 1mm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-mem-pe-1.jpg?v=1634202881817\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-mem-pe-2.jpg?v=1634202889341\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-mem-pe-4.jpg?v=1634202898393\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-mem-pe-3.jpg?v=1634202910274\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-mem-pe-5.jpg?v=1634202916636\" /></p>', '', 'Dây ống PE 4/7', 'béc tưới phun sương loại cao cấp, Combo 5M dây ống PE 4/7 cho đầu tưới nhỏ giọt, ống mềm pe, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23278858/combo-5m-day-ong-pe-4-7-cho-dau-tuoi-nho-giot-bec-tuoi-phun-suong-loai-cao-cap.jpg', '<p>Là linh kiện xương sống trong hệ thống tưới tiêu, phun sương, tạo độ ẩm, làm mát môi trường</p>\n<p>Thành phần chính từ nhựa PE nguyên sinh có độ bền cao, chịu áp lực lớn, đáp ứng mọi nhu c', '23278858', '52326224', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1018, 'chong-can-cau-dong-ca-tu-dong', 'Chống Cần Câu Tự Động Giật Cá ', '<p><strong><em>Chống Cần Câu Tự Động Giật Cá&nbsp;</em></strong></p>\n<p>Dụng cụ câu cá&nbsp;tự giật&nbsp;giúp các cần thủ nhàn hạ hơn khi câu cá, chỉ cần đặt cần và đợi cá cắn câu là chống cần sẽ tự động giật, lưỡi câu sẽ găm vào cá giúp bạn không bỏ lỡ bất cứ một con cá nào.</p>\n<p>Sản phẩm thiết kế từ&nbsp;kim loại chắc chắn, có cò như cò.&nbsp;Hoạt động dựa trên nguyên lý chỉ cần vòng cước qua cò, khi đóng cá cá kéo đi tác động lên cò bật lẫy, lập tức giương cần và giòng cá.</p>\n<p>Không lo cá lôi cần đi với 2 chân cắm chắc chắn xuống đất.</p>\n<p>Chỉ cần cắm cần xuống và mọi chuyện cứ để cần giật cá tự động lo.</p>\n<p>Kích thước: 44*5.5CM, đường kính 5.93MM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-dong-ca-tu-dong-1.jpg?v=1634089682999\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-dong-ca-tu-dong-2.jpg?v=1634089689242\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-dong-ca-tu-dong-5.jpg?v=1634089902075\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-dong-ca-tu-dong-3.jpg?v=1634089696536\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-dong-ca-tu-dong-4.jpg?v=1634089702773\" /></strong></em></p>', '', 'Chống cần câu đóng cá tự động', 'chống cần, chống cần câu cá, chống cần giật cá tự động, chống cần kim loại, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23262039/chong-can-cau-dong-ca-tu-dong.jpg', '<p>Dụng cụ câu cá&nbsp;tự giật&nbsp;giúp các cần thủ nhàn hạ hơn khi câu cá, chỉ cần đặt cần và đợi cá cắn câu là chống cần sẽ tự động giật, lưỡi câu sẽ găm vào cá giúp bạn không bỏ lỡ bất cứ', '23262039', '52271410', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1019, 'voi-xit-nen-khi-cao-ap', 'Súng xịt khí, thổi bụi, xì khô cao áp', '<p><em><strong>Súng xịt khí, thổi bụi, xì khô cao áp</strong></em></p>\n<p>Súng xịt khí, thổi bụi, xì khô chịu áp lực cao, dùng kèm với máy nén khí, chịu lực va đập tốt, độ bền cao.</p>\n<p>Ứng dụng trong rửa xe xịt nhanh khô, thổi bụi trong dây chuyền sản xuất, nhà máy, xưởng....</p>\n<p>Là loạt súng xịt cao cấp tại cửa hàng chúng tôi, chất lượng cao, tuổi thọ lâu dài.</p>\n<p>Chất liệu kim loại chịu áp lực cao.</p>\n<p>Áp lực làm việc:&nbsp;8(MPa)</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-xit-cao-ap-2.jpg?v=1634027064895\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-xit-cao-ap-3.jpg?v=1634027065568\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-xit-cao-ap-4.jpg?v=1634027067014\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-xit-cao-ap-1.jpg?v=1634027077359\" /></strong></em></p>', '', 'Súng xịt khí, thổi bụi', 'súng xịt, Súng xịt khí, thổi bụi, Volcano, volcano.vn, xì khô cao áp', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23253601/voi-xit-nen-khi-cao-ap.jpg', '<p>Súng xịt khí, thổi bụi, xì khô chịu áp lực cao, dùng kèm với máy nén khí, chịu lực va đập tốt, độ bền cao.</p>\n<p>Ứng dụng trong rửa xe xịt nhanh khô, thổi bụi trong dây chuyền sản xuất, n', '23253601', '52240964', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1020, 'may-cau-ca-yumoshi-reelsking-ef', 'Máy câu cá Yumoshi REELSKING EF', '<p><em><strong>Máy câu cá Yumoshi REELSKING EF</strong></em></p>\n<p>Máy câu cá EF5000 nhẹ thích hợp với mọi nơi, tay quay và nồi được làm bằng chất liệu kim cao cấp, máy có nhiều chế độ thu dây và thả dây rất tiện dụng theo ý của mình.</p>\n<p>Trọng lượng 315g tốc độ quay 5.5.1 cho mức thu dây nhanh và mượn mà ngay cả khi câu được cá có trọng lượng lớn.</p>\n<p>Máy câu cá Yumoshi REELSKING EF vó 2 size 5000 và 6000.</p>\n<ul>\n<li>&nbsp;Thông số máy EF 500:&nbsp;&nbsp;Vào đây câu 0.25/320M, 0.3/250M, 0.35/200M</li>\n<li>&nbsp;Thông số máy EF 600:&nbsp;&nbsp;Vào đây câu 0.25/320M, 0.3/250M, 0.35/200M</li></ul>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-3.jpg?v=1633772040947\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-2.jpg?v=1633772034437\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-1.jpg?v=1633772050408\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-4.jpg?v=1633772059233\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-7.jpg?v=1633774645050\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-yumoshi-ef-8.jpg?v=1633774653284\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100