(1021, 'tay-quay-may-cau-ca-num-go', 'Tay quay máy câu cá núm gỗ', '<p><em><strong>Tay quay máy câu cá núm gỗ</strong></em></p>\n<p>Tay quay máy câu với 3 kích thước phù hợp thay thế hầu hết các loại máy câu cá trên thị trường hiện nay.</p>\n<p>Phù hợp với các dòng máy phổ thông Như Yolo, Yumoshi... Dùng để thay thế khi tay máy câu bị&nbsp;gãy.</p>\n<p>Phân loại: Màu đen cán nhựa núm gỗ, màu trắng làm từ kim loại núm gỗ</p>\n<p>Kích thước: 3 cỡ M, L, S tương đương với kích thước trên hình ảnh.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-may-cau-num-go-7.jpg?v=1633765520360\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-may-cau-num-go-8.jpg?v=1633765527660\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-may-cau-num-go-1.jpg?v=1633754080089\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-may-cau-num-go-5.jpg?v=1633754080779\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-may-cau-num-go-6.jpg?v=1633754081428\" /></strong></em></p>', '', 'Tay quay máy câu', 'tay quay câu cá, Tay quay máy câu cá núm gỗ, Volcano, volcano.vn', '1', 'Loại', 'Đen cán nhựa', 'Kích thước', 'S', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/23230731/tay-quay-may-cau-ca-num-go.jpg', '<p>Tay quay máy câu với 3 kích thước phù hợp thay thế hầu hết các loại máy câu cá trên thị trường hiện nay.</p>\n<p>Phù hợp với các dòng máy phổ thông Như Yolo, Yumoshi... Dùng để thay thế khi', '23230731', '52145499', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21');
