(1022, 'may-cau-ca-yumoshi-kb', 'Máy câu đứng Yumoshi KB', '<p><strong><em>Máy câu đứng&nbsp;Yumoshi KB</em></strong></p>\n<p>Trục máy, bánh răng là kim loại tay quay thiết kế kiểu hiện đại (như dòng shimano, daiwa...)</p>\n<p>Thông số vào cước:</p>\n<ul>\n<li>KB5000:&nbsp;0.30/200m, 0.35/160m, 0.4/120m</li>\n<li>KB6000:&nbsp;0.4/155m, 0.45/125m, 0.5/100m</li></ul>\n<p>Thông số Tốc độ (gear ratio):&nbsp;5.2:1</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-kb-1.jpg?v=1633593970908\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-kb-3.jpg?v=1633593977634\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-kb-4.jpg?v=1633593991622\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-kb-6.jpg?v=1633594030607\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-kb-5.jpg?v=1633594040872\" /></em></strong></p>', '', 'Máy câu đứng Yumoshi KB', 'máy câu, Máy câu cá Yumoshi KB, máy câu đứng, Volcano, volcano.vn', '1', 'Loại', '5000', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23208113/may-cau-ca-yumoshi-kb.jpg', '<p>Trục máy, bánh răng là kim loại tay quay thiết kế kiểu hiện đại (như dòng shimano, daiwa...)</p>\n<p>Thông số vào cước:</p>\n<ul>\n<li>KB5000:&nbsp;0.30/200m, 0.35/160m, 0.4/120m</li>\n<li>KB6', '23208113', '52085571', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1023, 'dia-xich-xe-dap-3-tang-24-34-42t-170mm-cot-vuong', 'Đĩa xích xe đạp 3 tầng 24/34/42T-170mm cốt vuông', '<p><em><strong>Đĩa xích xe đạp 3 tầng 24/34/42T-170mm cốt vuông</strong></em></p>\n<p>Đĩa xích&nbsp;là bộ phận để thay đổi tốc độ của xe khi vận hành, nên việc lựa chọn bộ giò dĩa phù hợp với mục đích sữ dụng rất quan trọng.</p>\n<p>Bộ Đĩa xích xe đạp 3 tầng 24/34/42T-170mm phần giò làm bằng hợp kim nhôm rất nhẹ và có độ bền cao, đặc biệt là tính thẩm mỹ cao, còn 3 dĩa làm bẳng thép được tôi cứng có độ mài mòn thấp tăng tuổi thọ rất phù hợp cho xe đạp leo núi, xe đạp địa hình, muontain bike.</p>\n<p>Thông số kỷ thuật: 24/34/42T-170mm, cốt vuông.</p>\n<p>Loại xe phù hợp: Xe đạp địa hình, xe đạp leo núi, mountain bike.</p>\n<p>Vật liệu: Hợp kim nhôm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sen-xe-dap-v2.jpg?v=1633577964409\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sen-xe-dap-1.jpg?v=1633577971722\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sen-xe-dap-2.jpg?v=1633577981136\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sen-xe-dap-v8.jpg?v=1633577995504\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sen-xe-dap-v7.jpg?v=1633578006892\" /></strong></em></p>', '', 'Đĩa xích xe đạp 3 tầng', 'dĩa xích xe đạp, Đĩa xích xe đạp 3 tầng 24/34/42T-170mm cốt vuông, đĩa xích xe đpạ, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23206797/dia-xich-xe-dap-3-tang-24-34-42t-170mm-cot-vuong.jpg', '<p>Đĩa xích&nbsp;là bộ phận để thay đổi tốc độ của xe khi vận hành, nên việc lựa chọn bộ giò dĩa phù hợp với mục đích sữ dụng rất quan trọng.</p>\n<p>Bộ Đĩa xích xe đạp 3 tầng 24/34/42T-170mm ', '23206797', '52058761', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1024, 'bo-nang-cao-co-xe-dap-dia-hinh-the-thao', 'Bộ Nâng Cao Cổ Xe Đạp Địa Hình, Thể Thao', '<p><em><strong>Bộ Nâng Cao Cổ Xe Đạp Địa Hình, Thể Thao</strong></em></p>\n<p>Bộ nâng&nbsp;cổ&nbsp;xe đạp thể thao có tác dụng nâng cao ghi đông xe đạp lên tử 5-8cm giúp người đi xe đỡ của&nbsp;người hơn, thoải mái hơn.</p>\n<p>Bộ nâng cố xe đạp thể thao chất liệu hợp kim nhôm nhẹ thiết kế dày dặn, chắc chắn.</p>\n<p>Sử dụng cho các loại xe đạp thể thao có cổ phốt 2.86cm. Có thể nâng ghi đông xe thêm 5-8cm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-2.jpg?v=1633515764312\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-1.jpg?v=1633515769654\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-3.jpg?v=1633515775187\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-5.jpg?v=1633515781037\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-6.jpg?v=1633515972804\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tang-o-xe-dap-7.jpg?v=1633515983781\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Bộ Nâng Cao Cổ Xe Đạp Địa Hình, Thể Thao', 'Bộ Nâng Cao Cổ Xe Đạp, Bộ Nâng Cao Cổ Xe Đạp Địa Hình, Thể Thao, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '115000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23202268/bo-nang-cao-co-xe-dap-dia-hinh-the-thao.jpg', '<p>Bộ nâng&nbsp;cổ&nbsp;xe đạp thể thao có tác dụng nâng cao ghi đông xe đạp lên tử 5-8cm giúp người đi xe đỡ của&nbsp;người hơn, thoải mái hơn.</p>\n<p>Bộ nâng cố xe đạp thể thao chất liệu hợ', '23202268', '51973675', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:21', '2024-05-29 06:11:21'),
(1025, 'dung-dich-boi-tron-xich-xe-dap-wolfs-50ml', 'Dung Dịch Bôi Trơn Xích Xe Đạp Wolfs 50ml', '<p><em><strong>Dung Dịch Bôi Trơn Xích Xe Đạp Wolfs 50ml</strong></em></p>\n<p>Được làm bằng chất liệu chất lượng cao, tăng cường khả năng chống oxy hóa và lão hóa, được thiết kế để bảo dưỡng và sửa chữa xe đạp.</p>\n<p>Chống gỉ và chống bụi, tạo thành một lớp bảo vệ mạnh mẽ cho bề mặt và tăng tuổi thọ của các bộ phận xe đạp.</p>\n<p>Đóng&nbsp;lọ nhỏ 50ml&nbsp;chống rò rỉ, nắp có thể ngăn dầu rò rỉ, van giúp cho dầu dễ dàng chảy vào các khe hở hẹp.</p>\n<p>Nhỏ gọn và nhẹ, dễ dàng mang theo, có thể bôi trơn xe đạp ở bất cứ đâu bạn muốn.</p>\n<p>Thích hợp cho bánh đà, xích, khớp truyền động, ống dây, trục vít và các bộ phận khác cần bôi trơn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-tra-sen-xich-wolfs-3.jpg?v=1633511228679\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-tra-sen-xich-wolfs-4.jpg?v=1633511236999\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-tra-sen-xich-wolfs-2.jpg?v=1633511242656\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-tra-sen-xich-wolfs-1.jpg?v=1633511249431\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-tra-sen-xich-wolfs-5.jpg?v=1633511254908\" /></strong></em></p>', '', 'Dung Dịch Bôi Trơn Xích Xe Đạp Wolfs 50ml', 'dung dịch bôi trơn xích xe đạp, Dung Dịch Bôi Trơn Xích Xe Đạp Wolfs 50ml, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '20000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23201428/dung-dich-boi-tron-xich-xe-dap-wolfs-50ml.jpg', '<p>Được làm bằng chất liệu chất lượng cao, tăng cường khả năng chống oxy hóa và lão hóa, được thiết kế để bảo dưỡng và sửa chữa xe đạp.</p>\n<p>Chống gỉ và chống bụi, tạo thành một lớp bảo vệ ', '23201428', '51970671', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:22', '2024-05-29 06:11:22'),
(1026, 'tay-nghi-xe-dap-the-thao-cao-cap', 'Tay nghỉ xe đạp thể thao cao cấp', '<p><strong><em>Tay nghỉ xe đạp thể thao cao cấp</em></strong></p>\n<p>Tay nắm sử dụng thay thế và lắp đặt cho các loại xe đạp địa hình, xe đạp leo núi để đạp đường dài.</p>\n<p>tay nghỉ được thiết kế theo hình dạng nắm tay của người đạp xe giúp cầm nắm dễ dàng và chống mỏi tay</p>\n<p>Chất liệu hợp kim nhôm cao cấp,&nbsp;chống rung tay, chống tê tay khi di chuyển đường dài.</p>\n<p>Phù hợp với ghi đông có đường kính 22.2 mm trở xuống kích cỡ 12 * 3 cm.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nghi-xe-dap-1.jpg?v=1633494661980\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nghi-xe-dap-3.jpg?v=1633494670753\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nghi-xe-dap-5.jpg?v=1633494679537\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nghi-xe-dap-6.jpg?v=1633494685053\" /></em></strong></p>', '', 'Tay nghỉ xe đạp thể thao cao cấp', 'ô tô, phụ  kiện ô tô, Tay nghỉ xe đạp thể thao cao cấp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23196563/tay-nghi-xe-dap-the-thao-cao-cap.jpg', '<p>Tay nắm sử dụng thay thế và lắp đặt cho các loại xe đạp địa hình, xe đạp leo núi để đạp đường dài.</p>\n<p>tay nghỉ được thiết kế theo hình dạng nắm tay của người đạp xe giúp cầm nắm dễ dàn', '23196563', '51929369', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:22', '2024-05-29 06:11:22'),
(1027, 'po-tang-xe-dap-the-thao', 'Pô tăng xe đạp thể thao', '<p><em><strong>Pô tăng xe đạp thể thao</strong></em></p>\n<p>Phụ tùng thay thế cho xe đạp thể thao, xe leo núi&nbsp;chất lượng cao</p>\n<p>Kích thước: 31.8\\ 25.4mm phù hợp lắp cho tất tay nắm xe đạp 31,8mm.</p>\n<p>Chất liệu: Hợp kim nhôm cao cấp.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/po-tang-xe-dap-the-thao-v11.jpg?v=1633422725566\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/po-tang-xe-dap-the-thao-3.jpg?v=1633422732689\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/po-tang-xe-dap-the-thao-1.jpg?v=1633422739977\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/po-tang-xe-dap-the-thao-2.jpg?v=1633422754566\" /></strong></em></p>', '', 'Pô tăng xe đạp thể thao', 'Pô tăng xe đạp thể thao, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23190348/po-tang-xe-dap-the-thao.jpg', '<p>Phụ tùng thay thế cho xe đạp thể thao, xe leo núi&nbsp;chất lượng cao.</p>\n<p>Kích thước: 31.8\\ 25.4mm phù hợp lắp cho tất tay nắm xe đạp 31,8mm.</p>\n<p>Chất liệu: Hợp kim nhôm cao cấp.</p', '23190348', '51901682', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:22', '2024-05-29 06:11:22'),
(1028, 'dai-an-toan-cho-be-ngoi-xe-may-co-tui', 'Đai An Toàn Cho Bé Ngồi Xe Máy Có Túi', '<p><em><strong>Đai An Toàn Cho Bé Ngồi Xe Máy Có Túi</strong></em></p>\n<p>Thiết kế dành riêng cho bé giúp các bé an toàn hơn khi đi đường.</p>\n<p>Sản phẩm rất chắc chắn, cố định được tư thế cho bé.</p>\n<p>Có phần dây vai. Giúp an toàn hơn loại bình thường</p>\n<p>Khóa bấm an toàn, dễ sử dụng.</p>\n<p>Chất vải thoáng mát với nhiều lớp: vải chính, lớp tạo độ cứng, lớp đệm, vải lót, lớp vải xốp.</p>\n<p>Đai xe máy chính hãng nên các khóa chốt rất chắc chắn và có dây thắt điều chỉnh cho phù hợp với cơ thể bé.</p>\n<p>Có nhiều màu sắc&nbsp;khác nhau: Xanh dương, xanh ngọc, hồng, đỏ.</p>\n<p>Phân loại: dây đeo thường và loại có thêm tay cầm ở dây.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-5.jpg?v=1633408742205\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-1.jpg?v=1633408748763\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-9.jpg?v=1633408754881\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-10.jpg?v=1633408760931\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-4.jpg?v=1633408771499\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-di-xe-may-cho-be-co-tui-va-tay-cam-v2.jpg?v=1633503830572\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-di-xe-may-cho-be-chu-m-2.jpg