(1029, 'yen-xe-dap-the-thao-gel-em-thoang-khi', 'Yên xe đạp thể thao Gel cao cấp siêu êm thoáng khí', '<p><em><strong>Yên xe đạp thể thao Gel cao cấp siêu êm thoáng khí</strong></em></p>\n<p>Thiết kế cho phép cho phù hợp, chặt chẽ với yên xe</p>\n<p>Thoải mái, êm ái, dễ chịu khi sử dụng.</p>\n<p>Khả năng chịu bền, chịu sức nặng tốt.</p>\n<p>Kích thước: 27*17*7CM, khoảng cách 2 thanh hắn trục 5CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-8f5e4a16-dfc8-48fe-83be-0af7ad0e7055.jpg?v=1633334908776\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/8-759f3d7f-7ca5-42c4-b659-c2a79f49d861.jpg?v=1633336464872\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/7-e59dbc5b-881d-4195-b3c2-b91799458614.jpg?v=1633334936370\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/1-b6a48d65-91cd-437f-8709-835143f004cc.jpg?v=1633334946849\" /></strong></em></p>', '', 'Yên xe đạp thể thao', 'phụ kiện xe máy, Volcano, volcano.vn, yên xe đạp, yên xe đạp thể thao, Yên xe đạp thể thao Gel cao cấp siêu êm thoáng khí, yên xe thể thao', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23180650/yen-xe-dap-the-thao-gel-em-thoang-khi.jpg', '<ul>\n<li>Thiết kế cho phép cho phù hợp, chặt chẽ với yên xe</li>\n<li>Thoải mái, êm ái, dễ chịu khi sử dụng.</li>\n<li>Khả năng chịu bền, chịu sức nặng tốt.</li>\n<li>Kích thước: 27*17*7CM, khoả', '23180650', '51864565', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:22', '20