(1030, 'dai-an-toan-cho-be-ngoi-xe-may-hoa-tiet-kute', 'Đai An Toàn Cho Bé Ngồi Xe Máy Họa Tiết Kute', '<p><em><strong>Đai An Toàn Cho Bé Ngồi Xe Máy Họa Tiết Kute</strong></em></p>\n<p>Thiết kế dành riêng cho bé giúp các bé an toàn hơn khi đi đường. Sản phẩm rất chắc chắn, cố định được tư thế cho bé. Có phần dây vai.</p>\n<p>Giúp an toàn hơn loại bình thường. Khóa bấm an toàn, dễ sử dụng.</p>\n<p>Chất vải thoáng mát với nhiều lớp: vải chính, lớp tạo độ cứng, lớp đệm, vải lót, lớp vải xốp.</p>\n<p>Có nhiều họa tiết khác nhau, ngộ nghĩnh và xinh xắn.</p>\n<p>Màu sắc: xanh lá, vàng, hồng, xanh ngọc.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-2.jpg?v=1633323245322\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-4.jpg?v=1633323250975\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-5.jpg?v=1633323257168\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-8.jpg?v=1633330875082\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-10.jpg?v=1633330883459\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-v11.jpg?v=1633330893271\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-7.jpg?v=1633323450945\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-1.jpg?v=1633323263086\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dai-ngoi-xe-may-cho-be-6.jpg?v=1633323269563\" /></p>', '', 'Đai An Toàn Cho Bé Ngồi Xe Máy', 'Đai An Toàn Cho Bé Ngồi Xe Máy, Đai An Toàn Cho Bé Ngồi Xe Máy Họa Tiết Kute, đai đi xe máy, đai ngồi xe cho bé, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu', 'Milion', '', '', '', '', '', '', '', 'deny', '', '78000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/23176622/dai-an-toan-cho-be-ngoi-xe-may-hoa-tiet-kute.jpg', '<p>Thiết kế dành riêng cho bé giúp các bé an toàn hơn khi đi đường. Sản phẩm rất chắc chắn, cố định được tư thế cho bé. Có phần dây vai.</p>\n<p>Giúp an toàn hơn loại bình thường. Khóa bấm an ', '23176622', '51858757', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:22', '2024-05-29 06:11:22'),
(1031, 'tui-trong-cay-2-quai-xach-tien-dung', 'Túi trồng cây 2 quai xách tiện dụng', '<p><em><strong>Túi trồng cây 2 quai xách tiện dụng</strong></em></p>\n<p>Sản phẩm được làm từ vải địa kỹ thuật siêu bền, đựng khối lượng lớn, quai sách đảm bảo chịu được khối lượng đất trồng và cây....</p>\n<p>Túi trồng sử dụng trồng cà chua,&nbsp;dưa chuột, dưa lưới,&nbsp;cây cảnh, các loại cây ăn củ như khoang lang, khai tây, cà rốt... Sử dụng trồng trong thành thị cũng như nông thôn đều vô cùng tiện dụng, phù hợp trồng ban công, sân vườn, sân thượng....</p>\n<p>Túi có 2 quai xách 2 bên tiện dụng cho di chuyển, thu hoặc, đổi đất...</p>\n<p>Túi trồng cây 2 quai cao 35CM, đường kính 34CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-5.jpg?v=1633161933374\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-7.jpg?v=1633161940264\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-4.jpg?v=1633161946080\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-2.jpg?v=1633161955421\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-3.jpg?v=1633161966612\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-trong-cay-1.jpg?v=1633161972702\" /></p>', '', 'Túi trồng cây 2 quai xách tiện dụng', 'túi trồng cây, Túi trồng cây 2 quai xách tiện dụng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23166261/tui-trong-cay-2-quai-xach-tien-dung.jpg', '<