(1032, 'mu-bao-hiem-xe-dap-the-thao-xd2', 'Mũ bảo hiểm xe đạp thể thao XD2', '<p><em><strong>Mũ bảo hiểm xe đạp thể thao XD2</strong></em></p>\n<p>Mũ bảo hiểm đúc tích hợp lỗ thoáng gió&nbsp;cho đạp xe đạp thể thao</p>\n<p>Đặc trưng: bảo vệ đầu để tránh bị thương.</p>\n<p>Vỏ composite trọng lượng nhẹ bền. Bảo vệ toàn diện phía sau của đầu đảm bảo an toàn. Thiết kế tiện dụng cho cảm giác thoải mái khi đội.</p>\n<p>Kích thước 27*21*15CM, trongh lượng 250g.</p>\n<p>Màu sắc: đen viền đỏ.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-giem-xe-dap-theo-thao-xd2-3.jpg?v=1633080033298\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-giem-xe-dap-theo-thao-xd2-1.jpg?v=1633080043740\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-giem-xe-dap-theo-thao-xd2-4.jpg?v=1633080051400\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-giem-xe-dap-theo-thao-xd2-6.jpg?v=1633080013033\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-giem-xe-dap-theo-thao-xd2-5.jpg?v=1633080022541\" /></p>', '', 'Mũ bảo hiểm xe đạp', 'Mũ bảo hiểm xe đạp thể thao XD2, mũ đi xe đạp, mũ xe đạp thể thao, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/23153133/mu-bao-hiem-xe-dap-the-thao-xd2.jpg', '<p>Mũ bảo hiểm đúc tích hợp lỗ thoáng gió&nbsp;cho đạp xe đạp thể thao</p>\n<p>Đặc trưng: bảo vệ đầu để tránh bị thương.</p>\n<p>Vỏ composite trọng lượng nhẹ bền. Bảo vệ toàn diện phía sau của ', '23153133', '51760654', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NU