(1037, 'dai-an-toan-cho-be-ngoi-xe-may-dang-luoi', 'Đai an toàn cho bé ngồi xe máy dạng lưới', '<p><em><strong>Đai an toàn cho bé ngồi xe máy dạng lưới</strong></em></p>\n<p>Thiết kế dành riêng cho bé giúp các bé an toàn hơn khi đi đường.</p>\n<p>Sản phẩm rất chắc chắn, cố định được tư thế cho bé.</p>\n<p>Có phần dây vai. Giúp an toàn hơn loại bình thường</p>\n<p>Khóa bấm an toàn, dễ sử dụng.</p>\n<p>Chất vải lưới thoáng mát</p>\n<p>Có họa tiết ngộ nghĩnh và xinh xắn.</p>\n<p>Phân loại: Họa tiết, có túi.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-tre-em-di-xe-may-hellol-v6.jpg?v=1632886877101\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-tre-em-di-xe-may-hellol-v8.jpg?v=1632886882868\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-tre-em-di-xe-may-hellol-1.jpg?v=1633081227635\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-tre-em-di-xe-may-hellol-v9.jpg?v=1632886891192\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/diu-tre-em-di-xe-may-hellol-v7.jpg?v=1632886898505\" /></p>', '', 'Đai an toàn cho bé ngồi xe máy dạng lưới', 'Đai an toàn cho bé ngồi xe máy dạng lưới, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Phân loại', 'Họa tiết', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23117159/dai-an-toan-cho-be-ngoi-xe-may-dang-luoi.jpg', '<p>Thiết kế dành riêng cho bé giúp các bé an toàn hơn khi đi đường.</p>\n<p>Sản phẩm rất chắc chắn, cố định được tư thế cho bé.</p>\n<p>Có phần dây vai. Giúp an toàn hơn loại bình thường</p>\n<p', '23117159', '51646118', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25'),
(1038, 'gang-tay-chuot-lam-vuon-co-mong-vuot-chuyen-dung-dao-xoi-dat', 'Găng tay chuột chũi Làm Vườn Có Móng Vuốt Chuyên Dụng Đào Xới Đất', '<h1><em><strong>Găng Tay Chuột Chũi Làm Vườn Có Móng Vuốt Chuyên Dụng Đào Xới Đất</strong></em></h1>\n<p>Móng vuốt bằng nhựa ABS cứng có thể thay thế cho xẻng, dao... trong những trường hợp nhẹ nhàng. Vô cùng tiện dụng.</p>\n<p>Chất liệu nỉ cao cấp chống thấm nước, chống bẩn&nbsp;tốt, chắc chắn không lo bị rách khi làm vườn</p>\n<p>Tiện lợi , dùng được mọi lúc mọi nơi , dễ dàng làm sạch bằng nước</p>\n<p>Móng vuốt ngón tay được làm bằng vật liệu ABS, đào xới rất mạnh mẽ, giúp bảo vệ ngón tay.</p>\n<p>Phân loại: móng vuốt 1 tay và loại móng vuốt cả 2 tay.&nbsp;Chiều dài 24cm.&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-6-de1f69fa-49bc-4508-823d-d5561fe181fc.jpg?v=1632812606658\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-7-e50b9a01-cc35-479f-9395-8f1fca6b2d2d.jpg?v=1632812612966\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-5-d2a755be-e96c-4d8e-8f48-3e34662f5653.jpg?v=1632812621740\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-4-47850052-f274-4a46-8dfb-eaaded554ff8.jpg?v=1632812627950\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-3.jpg?v=1632812635291\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-2-34cadc76-f4ec-4f8a-a613-405d121f2d7e.jpg?v=1632812641607\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-trong-rau-1.jpg?v=1632812650531\" /></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/1tt4-W9KmyU\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'găng Tay Chuột Chũi Làm Vườn', 'găng tay làm vườn, găng tay làm vườn có móng vuốt, ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Móng vuốt 1 tay', '', '', '', '', '', '', '', 'deny', '', '32000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23111781/gang-tay-chuot-lam-vuon-co-mong-vuot-chuyen-dung-dao-xoi-dat.jpg', '<p>Móng vuốt bằng nhựa ABS cứng có thể thay thế cho xẻng, dao... trong những trường hợp nhẹ nhàng. Vô cùng tiện dụng.</p>\n<p>Chất liệu nỉ cao cấp chống thấm nước, chống bẩn&nbsp;tốt, chắc chắ', '23111781', '51589870', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25'),
(1039, 'bo-tay-dua-tay-nghi-xe-dap-cao-cap', 'Bộ tay đua, tay nghỉ xe đạp cao cấp', '<p><em><strong>Bộ tay đua, tay nghỉ xe đạp cao cấp</strong></em></p>\n<p>Bộ tay đua, tay&nbsp;nghỉ với tay nối dài được thiết kế để tạo ra hiệu suất cũng như khả năng tuỳ chỉnh vượt trội, giúp bạn đi nhanh hơn.&nbsp;</p>\n<p>Thiết kế đẹp cầm tay nghỉ rất tiện lợi, gắn trực tiết lên ghi đông xe.</p>\n<p>Chất liệu thép không gỉ.</p>\n<p>Kích thước: 34*7,5CM, đường kính 2.1CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-3.jpg?v=1632801253900\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-5.jpg?v=1632801246208\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-4.jpg?v=1632801268888\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-6.jpg?v=1632801260923\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-2.jpg?v=1632800858804\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-02-tay-nghi-xe-dap-1.jpg?v=1632800865282\" /></strong></em></p>', '', 'Bộ tay đua, tay nghỉ xe đạp cao cấp', 'Bộ tay nghỉ xe đạp, ô tô, tay đua xe đạp, tay lái xe đạp, tay nghỉ xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/23110739/bo-tay-dua-tay-nghi-xe-dap-cao-cap.jpg', '<p>Bộ tay đua, tay&nbsp;nghỉ với tay nối dài được thiết kế để tạo ra hiệu suất cũng như khả năng tuỳ chỉnh vượt trội, giúp bạn đi nhanh hơn.&nbsp;</p>\n<p>Thiết kế đẹp cầm tay nghỉ rất tiện lợ', '23110739', '51588127', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25'),
(1040, 'bang-do-the-thao-doi-dau-bang-do-the-duc-chay-bo-di-xe-dap', 'Băng đô thể thao Đội đầu Băng đô thể dục, chạy bộ, đi xe đạp', '<p><em><strong>Băng đô thể thao Đội đầu Băng đô thể dục, chạy bộ, đi xe đạp</strong></em></p>\n<p>Vải sợi ngang, mềm mại, thoải mái và thoáng khí, bao gồm cả các thành phần lycra.&nbsp;</p>\n<p>Giữ mồ hôi khỏi dính vào mắt của bạn, giữ cho tóc không bám khuôn mặt của bạn.&nbsp;</p>\n<p>Băng đô đàn hồi có thể dễ dàng điều chỉnh để phù hợp với nhu cầu cụ thể của bạn và đảm bảo sự thoải mái tối đa.</p>\n<p>Thích hợp cho tất cả các hoạt động, chẳng hạn như chạy, marathon, yoga và đi du lịch, mua sắm hoặc thậm chí mặc đi làm hoặc đi học.</p>\n<p>Kích thước: 23 * 4.5cm.</p>\n<p>Màu: Hồng, xám đen</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-doi-dau-the-thao-west-biking-1.jpg?v=1632734307370\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-doi-dau-the-thao-west-biking-v3.jpg?v=1632734315421\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-doi-dau-the-thao-west-biking-4.jpg?v=1632734382926\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-doi-dau-the-thao-west-biking-2.jpg?v=1632734322201\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-doi-dau-the-thao-west-biking-3.jpg?v=1632734328607\" /></p>', '', 'Băng đô thể thao Đội đầu', 'Băng đô thể thao Đội đầu, Băng đô thể thao Đội đầu Băng đô thể dục, chạy bộ, đi xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23102020/bang-do-the-thao-doi-dau-bang-do-the-duc-chay-bo-di-xe-dap.jpg', '<p>Vải sợi ngang, mềm mại, thoải mái và thoáng khí, bao gồm cả các thành phần lycra.&nbsp;</p>\n<p>Giữ mồ hôi khỏi dính vào mắt của bạn, giữ cho tóc không bám khuôn mặt của bạn.&nbsp;</p>\n<p>B', '23102020', '51571733', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25'),
(1041, 'bo-va-lop-xe-may-xe-dap-khong-xam', 'Bộ vá lốp xe máy, xe đạp không xăm', '<p><em><strong>Bộ vá lốp xe máy, xe đạp không xăm</strong></em></p>\n<p>Bộ dụng cụ giúp Bạn Có Thể Tự Vá Xe Khi Bị Lủng Lốp.</p>\n<p>Dùng vá bánh xe máy, xe đạp, xe điện loại không ruột.</p>\n<p>Cây gắp đinh và cây chịu lực để đưa cao su vào làm bằng chất liệu inox sáng bóng, tay cầm kim loại&nbsp;chắc chắn, chịu lực tốt, dễ sử dụng.</p>\n<p>Thiết kế dang ống gọn nhẹ, tiện lợi bỏ vào cốp xe mang theo sử dụng bất cứ khi nào cần.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-3.jpg?v=1632726760850\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-6.jpg?v=1632726767086\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-5.jpg?v=1632726775903\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-4.jpg?v=1632726781544\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-1.jpg?v=1632725429219\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-va-lop-khong-xam-2.jpg?v=1632725436018\" /></strong></em></p>', '', 'Bộ vá lốp xe máy, xe đạp không xăm', '', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23101346/bo-va-lop-xe-may-xe-dap-khong-xam.jpg', '<p>Bộ dụng cụ giúp Bạn Có Thể Tự Vá Xe Khi Bị Lủng Lốp.</p>\n<p>Dùng vá bánh xe máy, xe đạp, xe điện loại không ruột.</p>\n<p>Cây gắp đinh và cây chịu lực để đưa cao su vào làm bằng chất liệu i', '23101346', '51559577', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25');
