(1042, 'bao-da-chia-khoa-xe-hoi-vuong-mien-cao-cap', 'Bao da chìa khóa xe hơi vương miện cao cấp', '<p><em><strong>Bao da chìa khóa xe hơi vương miện cao cấp</strong></em></p>\n<p>Sử dụng cho tất cả các loại chìa khóa thông minh smart key, chìa khóa gập hay chìa khóa thường kích thước không quá 8x5CM.</p>\n<p>Bảo vệ chìa khóa tránh trầy xước, va đập, hay hư hỏng bộ điều khiển.</p>\n<p>Được thiết kế sang trong quý phái lịch lãm, thể hiện đẳng cấp.</p>\n<p>Chất liệu da cao cấp chống nước có độ bền cao. Gắn logo vương miện đính đá đẹp sang trọng.</p>\n<p>Có móc treo tiện dụng.</p>\n<p>Kích thước 9.5*5.5*2CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-xe-hoi-vuong-mien-v1.jpg?v=1632709621391\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-xe-hoi-vuong-mien-v4.jpg?v=1632709628387\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-xe-hoi-vuong-mien-v2.jpg?v=1632709637104\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-xe-hoi-vuong-mien-v3.jpg?v=1632709643256\" /></strong></em></p>', '', 'Bao da chìa khóa xe hơi', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/23100000/bao-da-chia-khoa-xe-hoi-vuong-mien-cao-cap.jpg', '<p>Bảo vệ chìa khóa tránh trầy xước, va đập, hay hư hỏng bộ điều khiển.</p>\n<p>Được thiết kế sang trong quý phái lịch lãm, thể hiện đẳng cấp.</p>\n<p>Chất liệu da cao cấp chống nước có độ bền ', '23100000', '51556042', NULL, NULL, 