(1043, 'bom-xe-dap-xe-may-dap-chan-de-cop-xe-nho-gon', 'Bơm xe đạp, xe máy đạp chân để cốp xe nhỏ gọn', '<p><strong><em>Bơm xe đạp, xe máy đạp chân để cốp xe nhỏ gọn</em></strong></p>\n<p>Bơm đạp chân cho xe đạp, xe máy, bóng gơi, đồ chơi.... tiện lợi có thiết kế nhỏ gọn.</p>\n<p>Dễ dàng bỏ vào cốp xe với trọng lương rất nhẹ rất tiện lợi khi đi phượt xa.</p>\n<p>Sản phẩm được làm từ chất liệu cao cấp; chắc chắn Bơm áp lực cao; đáp ứng được tất cả các loại xe đạp, xe máy và cả xe ô tô.</p>\n<p>Chất liệu: nhựa ABS + hợp kim nhôm</p>\n<p>Kích thước sản phẩm khi chưa sử dụng: cao 15cm , dài 9cm, rộng 7cm Kích thước sản phẩm khi sử dụng: cao 25cm, dài 9cm, rộng 7cm</p>\n<p>Tổng trọng lượng: 300g Ứng dụng: xe đạp, xe máy... bơm lên đến Max 160&nbsp;PSI.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-dap-chan-west-biking-5.jpg?v=1632565934919\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-dap-chan-west-biking-4.jpg?v=1632565941216\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-dap-chan-west-biking-1.jpg?v=1632565953168\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-dap-chan-west-biking-3.jpg?v=1632565971913\" /></p>\n<p>&nbsp;</p>', '', 'Bơm xe đạp, xe máy đạp chân để cốp xe nhỏ gọn', 'BƠM ĐẠP CHÂN, Bơm xe đạp, Volcano, volcano.vn, xe máy đạp chân để cốp xe nhỏ gọn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23086751/bom-xe-dap-xe-may-dap-chan-de-cop-xe-nho-gon.jpg', '<p>Bơm đạp chân cho xe đạp, xe máy, bóng gơi, đồ chơi.... tiện lợi có thiết kế nhỏ gọn.</p>\n<p>Dễ dàng bỏ vào cốp xe với trọng lương rất nhẹ rất tiện lợi khi đi phượt xa.</p>\n<p>Sản phẩm được', '23086751', '51503836', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:25', '2024-05-29 06:11:25'),
(1044, 'bao-da-chia-khoa-xe-hoi-dinh-da-cao-cap', 'Bao da chìa khóa xe hơi đính đá cao cấp', '<p><strong><em>Bao da chìa khóa xe hơi đính đá cao cấp</em></strong></p>\n<p>Bảo vệ chìa khóa xe hơi toàn diện,chống bụi bẩn và va đập.</p>\n<p>Tiện lợi trong việc treo, móc chìa khóa và mang theo bên mình khi di chuyển.</p>\n<p>Chất liệu da, gắn nơ đính đá sang trọng Giúp \"định hình cá tính\" và \"nâng tầm đẳng cấp\" cho mỗi chủ sở hữu.</p>\n<p>Ảnh chụp sản phẩm thật 100%.</p>\n<p>Kích thước: 9*5.5*2CM.</p>\n<p>Màu sắc: Đen, hồng, trắng, tím.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-no-dinh-da-1.jpg?v=1632537644146\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-no-dinh-da-4.jpg?v=1632537727442\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-no-dinh-da-2.jpg?v=1632537652244\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-da-chia-khoa-no-dinh-da-3.jpg?v=1632537658302\" /></em></strong></p>', '', 'Bao da chìa khóa', 'Bao da chìa khóa xe hơi đính đá cao cấp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Trắng', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/23084071/bao-da-chia-khoa-xe-hoi-dinh-da-cao-cap.jpg', '<p>Bảo vệ chìa khóa xe hơi toàn diện,chống bụi bẩn và va đập.</p>\n<p>Tiện lợi trong việc treo, móc chìa khóa và mang theo bên mình khi di chuyển.</p>\n<p>&nbsp;</p>\n<p>Chất liệu da, gắn nơ đín', '23084071', '51498094', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:26', '2024-05-29 06:11:26'),
(1045, 'kep-kinh-dinh-da-tren-o-to', 'Kẹp kính đính đá trên ô tô', '<p><em><strong>Kẹp kính đính đá&nbsp;trên ô tô</strong></em></p>\n<p>Vị trí thiết kế kẹp tại tấm chắn nắng trước ghế lái, thuận tay với và trong tầm mắt nhìn.</p>\n<p>Dễ dàng lắp đặt, sử dụng để kẹp kính, thẻ phí, thẻ ngân hàng, danh thiếp và hóa đơn...Ngoài ra còn là món phụ kiện trang trí sang trọng trên xe.</p>\n<p>Thiết kế từ chắt liệu nhựa ABS, bề mặt đính đá lấp lánh, nổi bật.</p>\n<p>Kích thước: 6.5*2.5*4CM.</p>\n<p>Màu sắc: Đỏ, Trắng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-4.jpg?v=1632469895603\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-3.jpg?v=1632469904651\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-6.jpg?v=1632469917870\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-1.jpg?v=1632469927772\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-2.jpg?v=1632469935209\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-8.jpg?v=1632469945567\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-kinh-kinh-da-tren-o-to-9.jpg?v=1632469952972\" /></p>\n<p>&nbsp;</p>', '', 'Kẹp kính đính đá trên ô tô', 'kẹp kính râm trên ô tô, kẹp treo kính trên ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Trắng', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23077241/kep-kinh-dinh-da-tren-o-to.jpg', '<p>Vị trí thiết kế kẹp tại tấm chắn nắng trước ghế lái, thuận tay với và trong tầm mắt nhìn.</p>\n<p>Dễ dàng lắp đặt, sử dụng để kẹp kính, thẻ phí, thẻ ngân hàng, danh thiếp và hóa đơn...Ngoài', '23077241', '51485016', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:27', '2024-05-29 06:11:27'),
(1046, 'bo-02-moc-treo-do-dinh-da-gan-sau-ghe-truoc-xe-o-to', 'Bộ 02 móc treo đồ đính đá gắn sau ghế trước xe ô tô', '<p><em><strong>Bộ 02 móc treo đồ đính đá gắn sau ghế trước xe ô tô</strong></em></p>\n<p>Bộ 2 Móc Treo Đồ gắn Sau Ghế Ô Tô&nbsp;đa năng&nbsp;được làm từ vật liệu nhựa ABS rất chắc chắn, có độ bền cao, khả năng chịu trọng tải tốt.</p>\n<p>Móc thiết kế thông minh, dễ dàng lắp đặt và sử dụng. Sản phẩm phù hợp hầu hết với các loại xe, tiện ích khi cần cất giữ, treo đồ đạc.</p>\n<p>Bề nặt đính đá nổi bật&nbsp;góp phần đem đến sự tiện lợi, hữu ích cho không gian nội thất xe của bạn.</p>\n<p>Kích thước: 10.5*3.5CM</p>\n<p>Màu sắc: Đỏ, Trắng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-lung-ghe-dinh-da-7-7409a84c-3867-420c-b90f-ef9ad94de8d4.jpg?v=1632467116150\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-lung-ghe-dinh-da-4-02f52748-ec54-4960-b018-6a29ce950c30.jpg?v=1632467128531\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-lung-ghe-dinh-da-6-e034e32f-8879-4e95-8511-d9cf84f23fa5.jpg?v=1632467135200\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-lung-ghe-dinh-da-8-3c767150-2131-463e-9192-840326636740.jpg?v=1632467152807\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-lung-ghe-dinh-da-1-e4b53235-f807-41bc-9354-caec0a57485d.jpg?v=1632467163270\" /></p>', '', 'Bộ 02 móc treo đồ đính đá gắn sau ghế trước xe ô tô', 'Bộ 02 móc treo đồ đính đá gắn sau ghế trước xe ô tô, móc treo đồ ô tô, ô tô, phu kien o to, phụ  kiện ô tô, trang trí ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Trắng',