(1047, 'gia-do-kep-dien-thoai-gan-ghi-dong-xe-may-xe-dap-xoay-360-do', 'Giá đỡ, Kẹp điện thoại gắn ghi đông xe máy xe đạp xoay 360 độ', '<p><em><strong>Giá đỡ, Kẹp điện thoại gắn ghi đông xe máy xe đạp xoay 360 độ</strong></em></p>\n<p>Chất liệu: Hợp kim nhôm cắt CNC Kích thước tùy chỉnh từ phù hợp gắn ghi đông, giá đỡ đa năng đường kính 19-30mm.</p>\n<p>Dùng kẹp&nbsp;máy điện thoại xem&nbsp;bản đồ dẫn đường GPS, gắn điện thoại làm camera hành trình...Công việc bắt buộc di chuyển liên tục trên đường phố vừa di chuyển vừa sử dụng rất nguy hiểm.</p>\n<p>Kèm lớp mút đệm giúp giữ máy chắc chắn và không gây trầy xước, đế xoay tùy chỉnh 360 độ.</p>\n<p>Kích thước kẹp tùy chỉnh từ 65MM&nbsp;đến 100mm.</p>\n<p>Màu sắc: Đen, Đỏ.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-xe-dap-6.jpg?v=1632457267609\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-xe-dap-4.jpg?v=1632457273857\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-xe-dap-2.jpg?v=1632457279388\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-xe-dap-7.jpg?v=1632457285750\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-xe-dap-1.jpg?v=1632457291398\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoia-gan-ghi-dong-xe-may-