(1048, 'nap-nut-de-o-to-dinh-da', 'Nắp (ring) nút khởi động ô tô đính đá cao cấp', '<p><strong><em>Nắp (ring)&nbsp;nút khởi động ô tô đính đá cao cấp</em></strong></p>\n<p>Nắp (ring)&nbsp;nút khởi động&nbsp;vừa hầu hết các dòng xe có trang bị nút đề start/stop.</p>\n<p>Sản phẩm trang trí vừa là nắp che nút khởi động lại để tránh trẻ nhỏ có thể ấn vào gây ra nhưng hậu quả đáng&nbsp;tiếc.</p>\n<p>Chất liệu nhựa đính hạt đá trên bề mạt đẹp long lanh.</p>\n<p>Hoạt động linh hoạt đóng mở để để động đơn giản.</p>\n<p>Kích thước: Đường kính bề mặt nắp 4.5CM, đường kính nút khỏi động 3CM.</p>\n<p>Bộ sản phẩm có kèm băng dính 3M.</p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nap-nut-khoi-dong-dinh-da-5.jpg?v=1632297177593\" /></em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nap-nut-khoi-dong-dinh-da-1.jpg?v=1632297184298\" /></em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nap-nut-khoi-dong-dinh-da-4.jpg?v=1632297194681\" /></em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nap-nut-khoi-dong-dinh-da-2.jpg?v=1632297203925\" /></em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nap-nut-khoi-dong-dinh-da-3.jpg?v=1632297211098\" /></em></p>', '', 'Nắp (ring) nút khởi động ô tô đính đá cao cấp', 'nút khởi động ô tô đính đá cao cấp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '89000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23057868/nap-nut-de-o-to-dinh-da.jpg', '<p>Nắp (ring)&nbsp;nút khởi động&nbsp;vừa hầu hết các dòng xe có trang bị nút đề start/stop.</p>\n<p>Sản phẩm trang trí vừa là nắp che nút khởi động lại để tránh trẻ nhỏ có thể ấn vào gây ra n', '23057868', '51405366', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:27', '2024-05-29 06:11:27'),
(1049, 'bo-dung-cu-ve-sinh-xich-lip-xe-dap', 'Bộ Dụng Cụ Chùi Chải Vệ Sinh Sên Xích, Xích Líp, Nhông Đĩa Cho Xe Đạp', '<p><em><strong>Bộ Dụng Cụ Chùi Chải Vệ Sinh Sên Xích, Xích Líp, Nhông Đĩa Cho Xe Đạp</strong></em></p>\n<p>Vệ sinh sạch sẽ dây xích, bánh răng và líp xe đạp nhanh chóng và đơn giản,&nbsp;phù hợp với đa số các loại xe đạp trên thị trường Xe Đạp Thể Thao, Địa Hình.</p>\n<p>Kết hợp sử dụng nước vệ sinh như : nước rửa chén, xăng, dầu, nước rửa chuyên dụng...làm tăng hiệu quả.</p>\n<p>Cách sử dụng đơn giản dễ dàng.</p>\n<p>Chất liệu : Nhựa</p>\n<p>Kích thước: 13.6 x 7.2 cm</p>\n<p>Phân loại bộ sản phẩm: Bộ 3 món và bộ 4 món.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/12-915fddba-914b-4fb6-b7bf-c90447810669.jpg?v=1639013977547\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/14-ac994142-63de-49b6-9802-f56fb87d5ccf.jpg?v=1642643331093\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-1.jpg?v=1632293449913\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-2.jpg?v=1632293460432\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-9.jpg?v=1632293468761\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-4.jpg?v=1632293481468\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-5.jpg?v=1632293488539\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-3.jpg?v=1632293496419\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-6.jpg?v=1632293503137\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-7.jpg?v=1632293509307\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-8.jpg?v=1632293515543\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-ve-sinh-xich-sen-xe-dap-10.jpg?v=1632293530718\" /></p>', '', 'Bộ Dụng Cụ Chùi Chải Vệ Sinh Sên Xích, Xích Líp, Nhông Đĩa Cho Xe Đạp', 'Bộ Dụng Cụ Chùi Chải Vệ Sinh Sên Xích, bộ dụng cụ vệ sinh xe đạp, Nhông Đĩa Cho Xe Đạp, Volcano, volcano.vn, xe đạp, Xích Líp', '1', 'Phân loại', 'Bộ 3 món', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23056112/bo-dung-cu-ve-sinh-xich-lip-xe-dap.jpg', '<p>Vệ sinh sạch sẽ dây xích, bánh răng và líp xe đạp nhanh chóng và đơn giản,&nbsp;phù hợp với đa số các loại xe đạp trên thị trường Xe Đạp Thể Thao, Địa Hình.</p>\n<p>Kết hợp sử dụng nước vệ ', '23056112', '51389496', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:27', '2024-05-29 06:11:27'),
(1050, 'bo-dung-cu-sua-chua-xe-dap-tien-dung', 'Bộ dụng cụ sửa chữa xe đạp tiện dụng', '<p><em><strong>Bộ dụng cụ sửa chữa xe đạp tiện dụng</strong></em></p>\n<p>Bộ&nbsp;sửa chữa đa&nbsp;năng vô&nbsp;cùng thiết thực và tiện dụng nên được trang bị trên mỗi chiếc xe đạp thể thao, xe địa hình.</p>\n<p>Bộ sản phẩm gồm: Bơm mini; Bộ lục giác đa năng; Bộ vá săm; Móc lốp; Công ốc 6-15.</p>\n<p>Đặc biệt tất cả bộ sản phẩm được để trong 1 túi đựng chuyên dụng có dai treo trên khung sườn xe.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-sua-chua-xe-dap-3.jpg?v=1632216480924\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-sua-chua-xe-dap-2.jpg?v=1632216489871\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-sua-chua-xe-dap-1.jpg?v=1632216496050\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-sua-chua-xe-dap-4.jpg?v=1632216545196\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-sua-chua-xe-dap-78.jpg?v=1632216973288\" /></strong></em></p>', '', 'Bộ dụng cụ sửa chữa xe đạp tiện dụng', 'Bộ dụng cụ sửa chữa xe đạp tiện dụng, dụng cu sửa xe đạp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '205000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23052429/bo-dung-cu-sua-chua-xe-dap-tien-dung.jpg', '<p>Bộ&nbsp;sửa chữa đa&nbsp;năng vô&nbsp;cùng thiết thực và tiện dụng nên được trang bị trên mỗi chiếc xe đạp thể thao, xe địa hình.</p>\n<p>Bộ sản phẩm gồm: Bơm mini; Bộ lục giác đa năng; Bộ ', '23052429', '51378146', NU