(1051, 'dung-cu-thao-lap-lip-xe-dap', 'Dụng Cụ Tháo Lắp Líp Xe Đạp', '<p><strong><em>Dụng Cụ Tháo Lắp Líp Xe Đạp</em></strong></p>\n<p>Dụng cụ thiết kế theo kiểu vòng khóa phù hợp để tháo và lắp các trục.</p>\n<p>Chất liệu thép độ cứng cao tích hợp xích giữ và cán bọc nhựa pha cao su chống trơn trượt.</p>\n<p>Kích thước: 30*2.5CM, dây xích dài 21CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-7.jpg?v=1632196359220\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-7-6b6758b4-1c3f-421d-b667-187a46d0a4f6.jpg?v=1632196537166\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-1.jpg?v=1632196369526\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-3.jpg?v=1632196377054\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-5.jpg?v=1632196384830\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-4.jpg?v=1632196391889\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-thao-lap-lip-xe-dap-2.jpg?v=1632196399736\" /></p>', '', 'Dụng Cụ Tháo Lắp Líp Xe Đạp', 'dụng cụ lắp lip xe đạp, Dụng Cụ Tháo Lắp Líp Xe Đạp, dụng cụ tháo líp xe đạp, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23047020/dung-cu-thao-lap-l