(1053, 'bom-xe-dap-cam-tay-nho-gon', 'Bơm xe đạp cầm tay nhỏ gọn', '<p><em><strong>Bơm xe đạp cầm tay nhỏ gọn</strong></em></p>\n<p>Nhỏ gọn, dễ dàng treo vào khung xe hoặc đặt lên gác baga.</p>\n<p>Đầu van: Thích hợp van xe máy, van gạo, van giun.</p>\n<p>Chất liệu: Nhôm.</p>\n<p>Trọng lượng : 120g.</p>\n<p>Kích Thước : 20 cm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-xe-dap-cam-tay-v5.jpg?v=1632113575484\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-xe-dap-cam-tay-1.jpg?v=1632113752212\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-xe-dap-cam-tay-2.jpg?v=1632113758029\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bom-xe-dap-cam-tay-4.jpg?v=1632113825959\" /></strong></em></p>', '', 'Bơm xe đạp cầm tay nhỏ gọn', 'Bơm xe đạp cầm tay nhỏ gọn, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/23040347/bom-xe-dap-cam-tay-nho-gon.jpg', '<p>Nhỏ gọn, dễ dàng treo vào khung xe hoặc đặt lên gác baga.</p>\n<p>Đầu van: Thích hợp van xe máy, van gạo, van giun.</p>\n<p>Chất liệu: Nhôm.</p>\n<p>Trọng lượng : 120g.</p>\n<p>Kích Thước : 20', '23040347', '51353981', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1054, 'gia-do-gan-ghi-dong-xe-may-xe-dap', 'Giá đỡ gắn ghi đông xe máy xe đạp', '<p><em><strong>Giá đỡ gắn ghi đông xe máy xe đạp&nbsp;</strong></em></p>\n<p>Bộ giá đỡ đa năng để gắn được nhiều phụ kiện hơn như: đèn led, đồng hồ đo tốc độ, keph điện thoại....</p>\n<p>Ngoài ra còn có thể lamg một ghi dông độ cao hơn tiện dụng hơn.</p>\n<p>Chất liệu hợp kim nhôm cao cấp, sơn chống gỉ, bay màu.</p>\n<p>Kích thước: 20*9.5CM.</p>\n<p>Màu: đen, đỏ.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-4.jpg?v=1631957236094\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-2.jpg?v=1631957245065\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-10.jpg?v=1631957464406\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-7.jpg?v=1631957258284\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-1.jpg?v=1631957265016\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-5.jpg?v=1631957297791\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-ghi-dong-xe-dap-8.jpg?v=1631957304956\" /></strong></em></p>', '', 'Giá đỡ gắn ghi đông xe máy xe đạp ', 'giá đỡ gắn ghi đông, Giá đỡ gắn ghi đông xe máy xe đạp, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23027645/gia-do-gan-ghi-dong-xe-may-xe-dap.jpg', '<p>Bộ giá đỡ đa năng để gắn được nhiều phụ kiện hơn như: đèn led, đồng hồ đo tốc độ, keph điện thoại....</p>\n<p>Ngoài ra còn có thể lamg một ghi dông độ cao hơn tiện dụng hơn.</p>\n<p>Chất liệ', '23027645', '51327349', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1055, 'combo-5-bau-chiet-canh-cay-hop-chiet-cay-dung-cu-chiet-canh-chuyen-dung', 'Combo 5 Bầu chiết cành cây, hộp chiết cây, dụng cụ chiết cành chuyên dụng', '<p><em><strong>Combo 5 Bầu chiết cành cây, hộp chiết cây, dụng cụ chiết cành chuyên dụng</strong></em></p>\n<p>Dụng cụ chiết cành chuyên dụng, hộp ương chiết, hộp ghép cành là dụng cụ rất hữu ích với các chủ vườn, giúp chủ vườn làm việc nhanh gọn, ko tốn sức, mà lại thu được năng suất cao, khả năng chiết cành tuyệt đối.</p>\n<p>Dụng cụ gồm 2 nửa ghép lại với nhau, phần thân cây ở giữa 2 nửa bầu.</p>\n<p>Giữa 2 nửa bầu có khoảng trống để đất và chất kích mọc rễ.</p>\n<p>Bầu Chiết Cành có hở phía trên và phía dưới, để chủ vườn có thể tưới nước, giữ độ ẩm cho bầu, cũng như có chỗ thoát nước để thân cành không bị úng nước.</p>\n<p>Sản phẩm lắp ghép dễ dàng, 4 góc có lỗ để buộc dây.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-8.jpg?v=1631951412408\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-9.jpg?v=1631951418953\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-1.jpg?v=1631951434822\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-v2.jpg?v=1631951442576\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-10.jpg?v=1631951976511\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-4.jpg?v=1631951449955\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-3.jpg?v=1631951456614\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bau-chiet-canh-7.jpg?v=1631951467433\" /></p>', '', 'Bầu chiết cành cây', 'Bầu chiết cành cây, bầu hộp chiết cành, Volcano, volcano.vn', '1', 'Kích thước', '5CM', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23025205/combo-5-bau-chiet-canh-cay-hop-chiet-cay-dung-cu-chiet-canh-chuyen-dung.jpg', '<p>Dụng cụ chiết cành chuyên dụng, hộp ương chiết, hộp ghép cành là dụng cụ rất hữu ích với các chủ vườn, giúp chủ vườn làm việc nhanh gọn, ko tốn sức, mà lại thu được năng suất cao, khả năng', '23025205', '51318487', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1056, 'dao-don-luc-binh-tao-o-cau-di-rung-2-luoi-da-nang', 'Lưỡi Dao, liềm dọn lục bình tạo ổ câu, đi rừng 2 lưỡi đa năng', '<p><em><strong>Lưỡi Dao, liềm dọn lục bình tạo ổ câu, đi rừng 2 lưỡi đa năng</strong></em></p>\n<p>Sản phẩm đa năng hàng thép cao cấp chống gỉ siêu sắc.</p>\n<p>Lưỡi liềm cong phù hợp cho phát dọn ổ câu, phát dọn đương đi rừng, hái quả trên cao...Một đầu rìu có thể chặt bổ.</p>\n<p>Kích thước: 20.5*14CM, Lưỡi liềm 15CM, Lưỡi rìu 9.5CM, trọng lượng khoảng 239g.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luc-binh-don-co-da-nang-4.jpg?v=1631872710066\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luc-binh-don-co-da-nang-3.jpg?v=1631872717982\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luc-binh-don-co-da-nang-2.jpg?v=1631872725737\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dao-phat-luc-binh-don-co-da-nang-1.jpg?v=1631872732543\" /></strong></em></p>', '', 'Lưỡi Dao, liềm dọn lục bình tạo ổ câu', 'Dao dọn lục bình tạo ổ câu, đi rừng 2 lưỡi đa năng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/23012802/dao-don-luc-binh-tao-o-cau-di-rung-2-luoi-da-nang.jpg', '<p>Sản phẩm đa năng hàng thép cao cấp chống gỉ siêu sắc.</p>\n<p>Lưỡi liềm cong phù hợp cho phát dọn ổ câu, phát dọn đương đi rừng, hái quả trên cao...Một đầu rìu có thể chặt bổ.</p>\n<p>Kích t', '23012802', '51280607', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL