(1057, 'dung-cu-tra-hat-giong-cam-tay-tien-ich', 'Dụng cụ tra hạt giống cầm tay tiện ích', '<p><em><strong>Dụng cụ tra hạt giống cầm tay tiện ích</strong></em></p>\n<p>Dụng cụ nông ngiệp thông minh vô cùng hữu ích, giúp đỡ công và sức lao động tăng năng suất lao động.</p>\n<p>Dụng cụ tra hạt giống dễ sử dụng phù hợp cho trồng các giống&nbsp;ngô, đậu, lạc....</p>\n<p>Kích thước cao 94CM, ống đường kính 2.8CM, phễu 9CM.</p>\n<p>Lò xo trợ lực vận hàng nhẹ nhàng.</p>\n<p>Chất liệu ống théo không gỉ sử dụng lâu dài.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-10.jpg?v=1631848408735\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-9.jpg?v=1631848416189\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-5.jpg?v=1631848478537\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-7.jpg?v=1631848492769\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-3.jpg?v=1631848502386\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-2.jpg?v=1631848509891\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-tra-hat-giong-1.jpg?v=1631848523980\" /></strong></em></p>', '', 'Dụng cụ tra hạt giống cầm tay tiện ích', 'dụng cụ tra hạt giống, Dụng cụ tra hạt giống cầm tay tiện ích, dụng cụ tra ngô, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '1.2', 'kg', 'images/23009105/dung-cu-tra-hat-giong-cam-tay-tien-ich.jpg', '<p>Dụng cụ nông ngiệp thông minh vô cùng hữu ích, giúp đỡ công và sức lao động tăng năng suất lao động.</p>\n<p>Dụng cụ tra hạt giống dễ sử dụng phù hợp cho trồng các giống&nbsp;ngô, đậu, lạc.', '23009105', '51260963', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1058, 'dau-keo-kem-luoi-cua-cat-tren-cao-tia-cay-canh-hai-hoa-qua', 'Đầu Kéo kèm lưỡi cưa Cắt cành Trên Cao, Tỉa Cây Cảnh, Hái Hoa Quả', '<p><strong><em>Đầu Kéo kèm lưỡi cưa Cắt cành Trên Cao, Tỉa Cây Cảnh, Hái Hoa Quả</em></strong></p>\n<p>Dụng cụ hữu ích cho công việc cắt tỉa trên cao, sản phẩm thông minh nhất của con người cho công việc cắt tỉa cành trên cao.</p>\n<p>Kéo được thiết kế phù hợp với hầu hết các loại cây ăn trái, kéo có trọng lượng nhẹ , chiều cao thân cán có thể tăng giảm linh động,&nbsp;hoạt động rất dễ không mất nhiều sức.</p>\n<p>Đầu kéo có thẻ được gắn bằng cán (sào) chuyên dụng hoặc bằng gỗ, tre... tiện dụng.</p>\n<p>Bộ sản sản phẩm có thể lưỡi cưa có thể lắp hoặc không khi sử dụng.</p>\n<p>Kích thước: dài 31CM, Lưỡi kéo đường kính 6CM dài 5CM, lưỡi cưa 34CM, dây kéo dài 5M, đường kính đầu kéo 2.5CM.</p>\n<p>Lưu ý: sản phẩm không bao gồm cán&nbsp;(sào).</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-6.jpg?v=1631782110665\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-5.jpg?v=1631782121236\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-2.jpg?v=1631782093749\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-3.jpg?v=1631782132255\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-4.jpg?v=1631782139803\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-7.jpg?v=1631783880422\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-keo-va-cua-cat-tia-canh-cay-tren-cao-1.jpg?v=1631782147390\" /></em></strong></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/aVQMilmKw5E\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Đầu Kéo kèm lưỡi cưa Cắt cành Trên Cao', 'Đầu Kéo kèm lưỡi cưa Cắt cành Trên Cao, đầu kéo tỉa cây, kéo cắt cây, kéo tỉa cây trên cao, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '190000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/23002721/dau-keo-kem-luoi-cua-cat-tren-cao-tia-cay-canh-hai-hoa-qua.jpg', '<p>Dụng cụ hữu ích cho công việc cắt tỉa trên cao, sản phẩm thông minh nhất của con người cho công việc cắt tỉa cành trên cao.</p>\n<p>Kéo được thiết kế phù hợp với hầu hết các loại cây ăn trá', '23002721', '51246929', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1059, 'tham-lot-ghe-dai-ghe-sau-xe-hoi-tre-truc', 'Thảm lót ghế dải ghế sau xe hơi tre trúc thoáng khí', '<p><em><strong>Thảm lót ghế dải ghế sau xe hơi tre trúc thoáng khí</strong></em></p>\n<p>Thảm lót ghế sau xe ô tô thoáng khí giúp bạn ngồi lên lên cảm giác thoải mái thoáng mát.</p>\n<p>Chất liệu hạt tre, trúc đan mặt dưới chống trơn khi trải lên bền mặt da hoặc nỉ của ghế xe.</p>\n<p>Kích thước: Màu vàng ghế sau 128*42.5CM, ghế trước 42.5*42.5CM;&nbsp;Màu nâu&nbsp;ghế sau 128*44CM, ghế trước 44*44CM.</p>\n<p>Màu sắc: Vàng, nâu</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tam-lot-dai-ghe-sau-xe-o-to-4.jpg?v=1631764313513\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tam-lot-dai-ghe-sau-xe-o-to-3.jpg?v=1631764323519\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tam-lot-dai-ghe-sau-xe-o-to-v1.jpg?v=1631762960731\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-nghe-mau-nau-d2.jpg?v=1656756093428\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-nghe-mau-nau-d1.jpg?v=1656756111219\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tam-lot-dai-ghe-sau-xe-o-to-1.jpg?v=1631762967065\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tam-lot-dai-ghe-sau-xe-o-to-2.jpg?v=1631762974143\" /></strong></em></p>', '', 'Thảm lót ghế dải ghế sau xe hơi tre trúc', 'lót ghế ô tô, ô tô, phụ  kiện ô tô, thảm lót ghế ô tô, thảm lót ghế sau ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu', 'Nâu', 'Phân loại', '1 Lót ghế trước', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/22998104/tham-lot-ghe-dai-ghe-sau-xe-hoi-tre-truc.jpg', '<p>Thảm lót ghế sau xe ô tô thoáng khí giúp bạn ngồi lên lên cảm giác thoải mái thoáng mát.</p>\n<p>Chất liệu hạt tre, trúc đan mặt dưới chống trơn khi trải lên bền mặt da hoặc nỉ của ghế xe.<', '22998104', '51231082', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:28', '2024-05-29 06:11:28'),
(1060, 'dau-keo-cat-canh-cay-tren-cao-tia-cay-canh-hai-hoa-qua', 'Đầu kéo cắt cành cây trên cao, tỉa cây cảnh, hái hoa quả', '<p><em><strong>Đầu kéo cắt cành cây trên cao, tỉa cây cảnh, hái hoa quả</strong></em></p>\n<p>Được làm bằng thép tôi cứng và sắc, giúp bạn dễ dàng cắt tỉa cành trên cao hay hái hoa quả một cách nhanh chóng và an toàn thông qua dòng dọc kéo&nbsp; &nbsp; &nbsp;</p>\n<p>Được tráng men đen chống gỉ cho kim loại.</p>\n<p>kích thước&nbsp;: Đầu kéo dài khoảng 23 cm ứng với mỗi chiều lưỡi kéo.</p>\n<p>Sử dụng : Lắp thêm sào tre nứa hoặc sào chuyên dụng để có thể đưa dụng cụ lên cao để dùng kéo tỉa cành,cắt hoa quả.</p>\n<p>Lưu ý: sản phẩm không bao gồm cán&nbsp;(sào).</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-5.jpg?v=1631758784331\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-6.jpg?v=1631758791947\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-7.jpg?v=1631758797615\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-8.jpg?v=1631758806097\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-3.jpg?v=1631758500355\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-tren-cao-4.jpg?v=1631758506801\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"ori