(1061, 'may-tuot-ngo-gia-dinh-tay-quay-tien-loi', 'Máy tuốt ngô gia đình tay quay tiện lợi', '<p><strong><em>Máy tuốt ngô gia đình tay quay&nbsp;tiện lợi</em></strong></p>\n<p>Máy tuốt ngô tay quay vô cùng tiện lợi, sử dụng quay nhẹ nhành không tốn quá nhiều sức.</p>\n<p>Chất liệu kim loại chống gỉ sử dụng bền lâu dài.</p>\n<p>Chân dạng kẹp chắc chăn, tuốt hạt ngô không bị vỡ vụn mà vẫn giữ được nguyên hạt.</p>\n<p>Kích thước nhỏ gọn: 20*22CM.</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-1.jpg?v=1631693536722\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-4.jpg?v=1631693543664\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-2.jpg?v=1631693554251\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-3.jpg?v=1631693560881\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-5.jpg?v=1631693585028\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-ngo-6.jpg?v=1631693615318\" /></em></strong></p>', '', 'Máy tuốt ngô gia đình tay quay', 'Máy quay ngô, máy tuốt ngô, máy tuốt ngô tay quay, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22994350/may-tuot-ngo-gia-dinh-tay-quay-tien-loi.jpg', '<p>Máy tuốt ngô tay quay vô cùng tiện lợi, sử dụng quay nhẹ nhành không tốn quá nhiều sức.</p>\n<p>Chất liệu kim loại chống gỉ sử dụng bền lâu dài.</p>\n<p>Chân dạng kẹp chắc chăn, tuốt hạt ngô', '22994350', '51197743', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:29', '2024-05-29 06:11:29'),
(1062, 'moi-du-luon-tom-dang-xit-60ml-sieu-nhay', 'Mồi dụ lươn, tôm dạng xịt 60ml siêu nhạy', '<p><em><strong>Mồi dụ lươn, tôm&nbsp;dạng xịt 60ml siêu nhạy</strong></em></p>\n<p>Mồi dạng lỏng và có mùi Thơm có tác dụng kích thích và dụ lươn, tôm&nbsp;và các sinh vật nước ngọt khác trong phạm vi bán kính 5-10m.</p>\n<p>Mồi sử dụng xịt trực tiếp lên mồi bột sau khi trộn, có thể câu hoặc đặt trong lồng bẫy.</p>\n<p>Mồi triết xuất từ các loại nguyên liệu tự nhiên không gây ảnh hưởng đến nguồn nước và môi trường.</p>\n<p>Dung tích 60ml.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-du-luon-2.jpg?v=1631680275345\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-du-luon-5.jpg?v=1631680773453\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-du-luon-4.jpg?v=1631680781069\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-du-luon-3.jpg?v=1631680788892\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-du-luon-1.jpg?v=1631680282147\" /></p>', '', 'Mồi dụ lươn', 'mồi bẫy lươn, mồi dụ lươn, mồi lươn, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22992231/moi-du-luon-tom-dang-xit-60ml-sieu-nhay.jpg', '<p>Mồi dạng lỏng và có mùi Thơm có tác dụng kích thích và dụ lươn, tôm&nbsp;và các sinh vật nước ngọt khác trong phạm vi bán kính 5-10m.</p>\n<p>Mồi sử dụng xịt trực tiếp lên mồi bột sau khi t', '22992231', '51192409', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:1