(1063, 'hop-2-ngan-dung-moi-cau-giun-dat-cau-ca', 'Hộp 3 ngăn đựng mồi câu, giun đất câu cá', '<p><em><strong>Hộp 3 ngăn đựng mồi câu, giun đất câu cá</strong></em></p>\n<p>Hộp đựng mồi 3 ngăn, nhỏ gọn&nbsp;tiện ích có thể đụng mồi giả, giun đất...</p>\n<p>Thiết kế có dây treo, đeo tay, có lỗ thông hơi ở nắp đảm bảo các loại mồi câu sống k bị hỏng.</p>\n<p>Chất liệu nhựa ABS khay mồi 2 ngăn tách rời.</p>\n<p>Kích thước: 9.5*5.8*4.5CM.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-1.jpg?v=1631614198124\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-4.jpg?v=1631614205458\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-2.jpg?v=1631614218075\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-3.jpg?v=1631614223959\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-6.jpg?v=1631614233052\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-7.jpg?v=1631614248271\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-phu-kien-cau-ca-5.jpg?v=1631614255189\" /></strong></em></p>', '', 'Hộp mồi câu', 'hộp đựng giun câu cá, hộp đựng mồi câu, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22988769/hop-2-ngan-dung-moi-cau-giun-dat-cau-ca.jpg', '<p>Hộp đựng mồi 3 ngăn, nhỏ gọn&nbsp;tiện ích có thể đụng mồi giả, giun đất...</p>\n<p>Thiết kế có dây treo, đeo tay, có lỗ thông hơi ở nắp đảm bảo các loại mồi câu sống k bị hỏng.</p>\n<p>Chất', '22988769', '51161108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:29', '2024-05-29 06:11:29'),
(1064, 'theo-lo-xo-cau-dai-lang-xe-2-luoi', 'Bộ 02 Thẻo lò xo câu đài, lăng xê 2 lưỡi', '<p><em><strong>Bộ 02 Thẻo lò xo câu đài, lăng xê 2 lưỡi</strong></em></p>\n<p>Thẻo dây dù siêu bền, lò xo thép không gỉ, lưỡi thep carbon cao cấp.</p>\n<p>Thông số lưỡi từ số 5 đến số 10.</p>\n<p>Thông số lò xo: số 5, 6, 7, 8, 10 là 0.5*2CM, Số 9 là 1.2*3CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-2.jpg?v=1631593267382\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-3.jpg?v=1631593724885\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-v1.jpg?v=1631593108214\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-v3.jpg?v=1631593116657\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-v2.jpg?v=1631593123118\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/the-cau-lang-xe-2-luoi-1.jpg?v=1631593181672\" /></strong></em></p>', '', 'Thẻo lò xo câu đài, lăng xê 2 lưỡi', 'câu cá, đồ câu cá, lăng xê 2 lưỡi, phụ kiện câu cá, Thẻo lò xo câu đài, Volcano, volcano.vn', '1', 'Kích thước', '5', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22984881/theo-lo-xo-cau-dai-lang-xe-2-luoi.jpg', '<p>Thẻo dây dù siêu bền, lò xo thép không gỉ, lưỡi thep carbon cao cấp.</p>\n<p>Thông số lưỡi từ số 5 đến số 10.</p>\n<p>Thông số lò xo: số 5, 6, 7, 8, 10 là 0.5*2CM, Số 9 là 1.2*3CM</p>', '22984881', '51140780', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:29', '2024-05-29 06:11:29'),
(1065, 'can-cau-ca-cho-tre-em', 'Cần câu cá nhựa cho trẻ em', '<p><em><strong>Cần câu cá nhựa cho trẻ em</strong></em></p>\n<p>Thiết kế như 1 chiếc cần câu người lớn dùng, có tích hợp máy câu tay phải xịn sò.</p>\n<p>Cần câu cho trẻ thỏa sức vui chơi khám phá và tự mình trải nghiệm câu cá.</p>\n<p>Ngoài cho trẻ thì cần cũng có thể sử dụng để câu tôm, câu cá nhỏ giải trí.</p>\n<p>Chất liệu nhựa an toàn&nbsp;cho người dùng.</p>\n<p>Kích thước: dài 34CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-1.jpg?v=1631587698693\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-2.jpg?v=1631587699344\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-3.jpg?v=1631587926402\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-4.jpg?v=1631587932228\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-5.jpg?v=1631587938127\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-mini-6.jpg?v=1631587944484\" /></strong></em></p>', '', 'Cần câu cá nhựa cho trẻ em', 'cần câu cá, Cần câu cá nhựa cho trẻ em, cần câu cho trẻ em, cần câu nhựa, Volcano, volcano.vn', '1', 'Màu', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22983972/can-cau-ca-cho-tre-em.jpg', '<p>Thiết kế như 1 chiếc cần câu người lớn dùng, có tích hợp máy câu tay phải xịn sò.</p>\n<p>Cần câu cho trẻ thỏa sức vui chơi khám phá và tự mình trải nghiệm câu cá.</p>\n<p>Chất liệu nhựa an ', '22983972', '51139300', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1066, 'vi-bay-ruoi-vang-con-trung-duc-trai-pha-hoa-mau-dang-mieng-dinh-2-mat', '05 Vỉ bẫy ruồi vàng, côn trùng đục trái phá hoa màu dạng miếng dính 2 mặt', '<p><em><strong>05 Vỉ bẫy ruồi vàng, côn trùng đục trái phá hoa màu dạng miếng dính 2 mặt</strong></em></p>\n<p>Hiện nay Ruồi Vàng là một loại côn trùng chích chút trái cây gây rất nhiều ảnh hưởng đến hoa mầu của bà con nông dân. Gây thất thu khi không sử lý được nạn ruồi vàng.</p>\n<p>Với miếng dính&nbsp;ruồi vàngn côn trùng sé&nbsp;đem đến sự an toàn cho cây trái, hoa màu.</p>\n<p>Bẫy dính ruồi vàng chất lượng cao, an toàn tuyệt đối cho người sử dụng. 1 miếng có 2 mặt được tráng keo và rất thích hợp được dùng cho dàn phong lan hoặc vườn cây ăn quả, rau sạch khi bẫy ruồi ngoài môi trường mưa nắng và ẩm ướt thay đổi thường xuyên.</p>\n<p>Sử dụng đơn giản, dễ dàng chỉ việc tách lớp nilong và&nbsp;treo vỉ lên cây....</p>\n<p>Thời gian sử dụng của mỗi miếng&nbsp;chung bình 1 tháng cho đến khi ko còn diện tích để dính ruồi.</p>\n<p>Phân loại 2 kích thước: 20*15CM và 25*30CM</p>\n<p>Màu sắc: Vàng, xanh.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ci-dinh-con-trung-5.jpg?v=1631509220333\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ci-dinh-con-trung-1.jpg?v=1631509228411\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ci-dinh-con-trung-3.jpg?v=1631509236794\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ci-dinh-con-trung-2.jpg?v=1631509244505\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ci-dinh-con-trung-v5.jpg?v=1631509256825\" /></p>', '', 'Vỉ bẫy ruồi vàng, côn trùng', 'bẫy dính ruồi, côn trùng, Vỉ bẫy ruồi vàng, VỈ dính ruồi, Volcano, volcano.vn', '1', 'Kích thước', '20*15CM', 'Màu sắc', 'Vàng', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22973674/vi-bay-ruoi-vang-con-trung-duc-trai-pha-hoa-mau-dang-mieng-dinh-2-mat.jpg', '<p>Hiện nay Ruồi Vàng là một loại côn trùng chích chút trái cây gây rất nhiều ảnh hưởng đến hoa mầu của bà con nông dân. Gây thất thu khi không sử lý được nạn ruồi vàng.</p>\n<p>Với miếng dính', '22973674', '51093128', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1067, 'combo-2-lo-giun-do-trun-que-u-cau-ca-chep-diec-ro-tram', 'Giun đỏ, trùn quế ủ câu cá chép, diếc, rô, trắm', '<p><em><strong>Giun đỏ, trùn quế ủ câu cá chép, diếc, rô, trắm</strong></em></p>\n<p>Mồi giun được ủ sinh học giữ nguyên được hương giun thật, chuyên dụng để câu nhiều loài như chép, rô, trắm rất nhạy.</p>\n<p>Tặng kèm kéo nhỏ và nhíp để lấy mồi bên trong dễ dàng.</p>\n<p>Mồi sản xuất dựa trên các nguyên liệu tự nhiên không gây độc ảnh hưởng đến cá, nước ao hồ và người dùng.</p>\n<p>Tặng thêm 01 lọ nước phụ gia hấp dẫn cá. Trộn trực tiếp vào lọ mồi khi sử dụng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giun-do-1.jpg?v=1631501038582\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giun-do-2.jpg?v=1631501022759\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giun-do-3.jpg?v=1631501028706\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giun-do-6.jpg?v=1631501396508\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giun-do-5.jpg?v=1631501403360\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Mồi giun câu cá', 'Combo 2 lọ Giun đỏ, diếc, giun ủ câu cá, mồi giun câu cá, rô, trắm, trùn quế ủ câu cá chép, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22972614/combo-2-lo-giun-do-trun-que-u-cau-ca-chep-diec-ro-tram.jpg', '<p>Mồi giun được ủ sinh học giữ nguyên được hương giun thật, chuyên dụng để câu nhiều loài như chép, rô, trắm rất nhạy.</p>\n<p>Tặng kèm kéo nhỏ và nhíp để lấy mồi bên trong dễ dàng.</p>\n<p>Mồ', '22972614', '51089649', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1068, 'luoi-cau-ca-carbon-ryobi', 'Lưỡi câu cá Carbon Ryobi', '<p><em><strong>Lưỡi câu cá Carbon Ryobi</strong></em></p>\n<p>Lưỡi câu&nbsp;Siêu sắc nét và bền, được làm bằng thép carbon chất lượng cao.</p>\n<p>Phân loại nhiều size khác nhau: Số 6, 7, 8, 9, 11</p>\n<p>Phù hợp làm lưỡi câu đơn, câu lăng xê, câu cá mương...</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-6.jpg?v=1631353512884\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-2.jpg?v=1631353185306\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-4.jpg?v=1631353193769\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-3.jpg?v=1631353201345\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-5.jpg?v=1631353207276\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-ryobi-1.jpg?v=1631352932887\" /></strong></em></p>', '', 'Lưỡi câu', 'câu cá, lưỡi câu, lưỡi câu cá, Volcano, volcano.vn', '1', 'Số', '6', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/22960359/luoi-cau-ca-carbon-ryobi.jpg', '<p>Lưỡi câu&nbsp;Siêu sắc nét và bền, được làm bằng thép carbon chất lượng cao.</p>\n<p>Phân loại nhiều size khác nhau: Số 6, 7, 8, 9, 11</p>\n<p>Phù hợp làm lưỡi câu đơn, câu lăng xê, câu cá m', '22960359', '51053084', NULL, NULL, NULL, NULL,