(1069, 'den-led-doi-dau-pin-sac-a9-cao-cap-sieu-sang', 'Đèn led đội đầu pin sạc A9 cao cấp siêu sáng', '<p><em><strong>Đèn led đội đầu pin sạc A9 cao cấp siêu sáng</strong></em></p>\n<p>Đèn led &nbsp;Sử dụng chip LED độ sáng cao cho đèn pha led, tuổi thọ trên 50000 giờ.</p>\n<p>Tích hợp pin lithium-ion chất lượng cao và dung lượng cao</p>\n<p>Có 2 công tắc 3 chế độ làm mờ chức năng: ánh sáng mạnh, ánh sáng dịu, chớp cảnh báo&nbsp; &nbsp; &nbsp;</p>\n<p>Công suất kéo dài với ánh sáng mạnh&gt; 10h, ánh sáng dịu&gt; 20h.</p>\n<p>Sử dụng công tắc đôi cho ánh sáng mong muốn, bảo vệ IC tránh sạc quá mức và xả quá mức.</p>\n<p>Chống thấm nước tốt, vỏ siêu âm hàn, các thành phần kết nối với vòng chống thấm liền mạch.</p>\n<p>Đèn có tích hợp chân ren 6mm để gắn chân đèn trong câu cá, dã ngoại...</p>\n<p>Kích thước đèn: đường kính 9CM, chiều rộng và dài 9CM.</p>\n<p>Bộ sản phẩm gồm: Đèn, dây đeo và sạc.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-1.jpg?v=1631346552011\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-2.jpg?v=1631346558267\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-5.jpg?v=1631346894794\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-3.jpg?v=1631346901050\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-6.jpg?v=1631346910078\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-dau-sieu-sang-4.jpg?v=1631346915781\" /></strong></em></p>', '', 'Đèn led đội đầu', 'đèn câu cá, đèn đội đầu, đèn led câu cá, đèn led đi câu, Đèn led đội đầu pin sạc A9 cao cấp siêu sáng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '290000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22957910/den-led-doi-dau-pin-sac-a9-cao-cap-sieu-sang.jpg', '<p>Đèn led &nbsp;Sử dụng chip LED độ sáng cao cho đèn pha led, tuổi thọ trên 50000 giờ.</p>\n<p>Tích hợp pin lithium-ion chất lượng cao và dung lượng cao</p>\n<p>Có 2 công tắc 3 chế độ làm mờ c', '22957910', '51048005', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1070, 'voi-phun-nuoc-cao-ap-rua-xe-hoi-lam-vuon', 'Vòi phun nước cao áp rửa xe hơi, làm vườn', '<p><em><strong>Vòi phun nước cao áp rửa xe hơi, làm vườn</strong></em></p>\n<p>Vòi phun cao áp tiện dụng với khóa on/off, 2 đầu vòi xịt và phun cao áp.</p>\n<p>Thích hợp để rửa xe, tưới cây, tưới tiêu nông nghiệp, vệ sinh gia đình, v. v.</p>\n<p>Kết cấu chống gỉ và ăn mòn.Tay cầm PVC, mềm và chống trơn trượt.</p>\n<p>Chất liệu: Hợp kim chống gỉ.</p>\n<p>Kích thước: dài 46CM, đường kính ống 1.5CM,&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-rua-xe-cao-ap-3.jpg?v=1631330604712\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-rua-xe-cao-ap-2.jpg?v=1631330612262\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-rua-xe-cao-ap-1.jpg?v=1631330642303\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-rua-xe-cao-ap-5.jpg?v=1631333448932\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-rua-xe-cao-ap-6.jpg?v=1631336171907\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Vòi phun nước cao áp', 'ô tô, phụ  kiện ô tô, phụ kiện xe máy, vòi cao áp, vòi phun nước, Vòi phun nước cao áp, vòi rửa xe cao áp, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22955184/voi-phun-nuoc-cao-ap-rua-xe-hoi-lam-vuon.jpg', '<p>Vòi phun cao áp tiện dụng với khóa on/off, 2 đầu vòi xịt và phun cao áp.</p>\n<p>Thích hợp để rửa xe, tưới cây, tưới tiêu nông nghiệp, vệ sinh gia đình, v. v.</p>\n<p>Kết cấu chống gỉ và ăn ', '22955184', '51042418', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1071, 'luoi-may-cat-tia-cay-thep-sk02-nhat-ban', 'Lưỡi cắt thay thế cho máy cắt tỉa cành cây thép Carbon SK02 Nhật Bản', '<p><em><strong>Lưỡi cắt thay thế cho máy cắt tỉa cành cây thép Carbon&nbsp;SK02 Nhật Bản</strong></em></p>\n<p>Lưỡi cắt được làm bằng chất liệu thép carbon cường độ cao, độ cứng tới 60HRC, rất sắc bén và chống mài mòn cao.</p>\n<p>Lưỡi cắt có kích thước phổ thông, có thể thay thế cho nhiều loại máy có kích thước tương tự.</p>\n<p>Bộ sản phẩm bao gồm: một cặp lưỡi cắt như hình.</p>\n<p>Chia làm 2 phân loại: đường kính cắt 3CM và đường kính cắt 2.5CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-luoi-keo-cat-tia-cay-1.jpg?v=1631262763165\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-luoi-keo-cat-tia-cay-2.jpg?v=1631262769333\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-luoi-keo-cat-tia-cay-3.jpg?v=1631262776215\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Lưỡi cắt thay thế cho máy cắt tỉa cành cây', 'Lưỡi cắt thay thế cho máy cắt tỉa cành cây, lưỡi máy cắt tỉa cành cây, Volcano, volcano.vn', '1', 'Kích thước', '3CM', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/22949265/luoi-may-cat-tia-cay-thep-sk02-nhat-ban.jpg', '<p>Lưỡi cắt được làm bằng chất liệu thép carbon cường độ cao, độ cứng tới 60HRC, rất sắc bén và chống mài mòn cao.</p>\n<p>Lưỡi cắt có kích thước phổ thông, có thể thay thế cho nhiều loại máy ', '22949265', '51033538', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:30', '2024-05-29 06:11:30'),
(1072, 'bo-khung-vom-trong-rau-chan-con-trung-phu-nilong', 'Bộ Khung vòm trồng rau chắn côn trùng, phủ nilong', '<p><em><strong>Bộ Khung vòm trồng rau chắn côn trùng, phủ nilong</strong></em></p>\n<p>Bộ khung vòm, khung mái ché giúp cho việc hạn chế được côn trùng, sâu bệnh hại xâm nhập vào cây, hạn chế việc sử dụng thuốc BVTV.</p>\n<p>Thời gian sử dụng tối thiểu 5 năm ở nhiệt độ ngoài trời .</p>\n<p>Khung lắp&nbsp; đặt sử dụng đơn giản thuận tiện cho việc trong cấy rau củ trong vườn, sân thượng....</p>\n<p>Chất liệu:bên ngoài&nbsp;là nhựa phi 8, bọc bên trong là thép.</p>\n<p>Kích thước khung vòm 48x48cm, bộ sản phẩm gồm 3 thanh vòm và 3 thanh ngang dài 120cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v18.jpg?v=1631261471519\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v17.jpg?v=1631261477995\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v20.jpg?v=1631261816271\" /></p>\n<p><b style=\"font-style: italic;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v6.jpg?v=1631260184699\" /></b></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v7.jpg?v=1631260191454\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-kung-lam-vuon-v4.jpg?v=1631260199399\" /></strong></em></p>', '', 'Khung vòm trồng rau chắn côn trùng, phủ nilong', 'khung mái che trông rau, khung vòm trồng rau, Khung vòm trồng rau chắn côn trùng, phủ nilong, Volcano, volcano.vn', '1', 