(1075, 'combo-50-kep-canh-buom-chuyen-kep-co-dinh-lan-va-cac-loai-cay-canh', 'Combo 50 Kẹp cánh bướm chuyên kẹp cố định lan và các loại cây cảnh', '<h1 itemprop=\"headline\" title=\"KẸP BƯỚM 36MM ,CHUYÊN KẸP LAN VÀ CÁC LOẠI CÂY CẢNH.\"><em><strong>Combo 50 Kẹp cánh bướm chuyên kẹp cố định lan và các loại cây cảnh</strong></em></h1>\n<p>Kẹp bướm :dùng để kẹp và cố định cành cây vào một điểm nhất định nào đó.</p>\n<p>Chất liệu: Nhựa bền bỉ.</p>\n<p>Kích thước: 1.5*2.3, kẹp lên đến đường kính 2cm.</p>\n<p>Số lượng 50 kẹp.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-tao-dang-cay-3.jpg?v=1631087173095\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-tao-dang-cay-5.jpg?v=1631087296327\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-tao-dang-cay-4.jpg?v=1631087306988\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-tao-dang-cay-1.jpg?v=1631087313423\" /><br />\n<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-tao-dang-cay-6.jpg?v=1631089546863\" /></p>', '', 'Kẹp cánh bướm', 'Combo 50 Kẹp cánh bướm chuyên kẹp cố định lan và các loại cây cảnh, Kẹp cánh bướm chuyên kẹp cố định lan và các loại cây cảnh, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22930540/combo-50-kep-canh-buom-chuyen-kep-co-dinh-lan-va-cac-loai-cay-canh.jpg', '<p>Kẹp bướm :dùng để kẹp và cố định cành cây vào một điểm nhất định nào đó.</p>\n<p>Chất liệu: Nhựa bền bỉ.</p>\n<p>Kích thước: 1.5*2.3, kẹp lên đến đường kính 2cm.</p>\n<p>Số lượng 50 kẹp.</p>', '22930540', '50944769', NULL, NUL