(1076, 'bo-10-theo-cau-ca-2-luoi-buoc-san-50cm', 'Bộ 10 Thẻo câu cá 2 lưỡi buộc sẵn 50CM', '<p><strong><em>Bộ 10 Thẻo câu cá 2 lưỡi buộc sẵn 50CM&nbsp;</em></strong></p>\n<p>Bộ 10 theo 2 lưỡi buộc sẵn lưới câu tiện dụng không mất thời gian buộc hay cắt vụn dây lamg thẻo.</p>\n<p>Chất liệu lưỡi thép carbon siêu bền, dây cước trắng bền siêu khỏe chịu tải tốt.</p>\n<p>Phân loại dây được chọn phù hợp với size lưỡi: Số 2; Số 3;&nbsp;Số 4;&nbsp;Số 5;&nbsp;Số 6;&nbsp;Số 7;&nbsp;Số 8.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cau-ca-2-luoi-buoc-san-3.jpg?v=1631075870199\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cau-ca-2-luoi-buoc-san-2.jpg?v=1631075878713\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cau-ca-2-luoi-buoc-san-1.jpg?v=1631075922868\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cau-ca-2-luoi-buoc-san-4.jpg?v=1631075965114\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cau-ca-2-luoi-buoc-san-5.jpg?v=1631076531236\" /></em></strong></p>', '', 'hẻo câu cá 2 lưỡi', 'hẻo câu cá 2 lưỡi, Volcano, volcano.vn', '1', 'Kích thước', 'Số 3', '', '', '', '', '', '', '0', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22929684/bo-10-theo-cau-ca-2-luoi-buoc-san-50cm.jpg', '<p>Bộ 10 theo 2 lưỡi buộc sẵn lưới câu tiện dụng không mất thời gian buộc hay cắt vụn dây lamg thẻo.</p>\n<p>Chất liệu lưỡi thép carbon siêu bền, dây cước trắng bền siêu khỏe chịu tải tốt.</p>', '22929684', '50934992', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NUL