(1080, 'keo-cat-tia-canh-cay-cao-cap-elysin', 'Kéo cắt tỉa cành cây cao cấp Elysin', '<p><em><strong>Kéo cắt tỉa cành cây cao cấp Elysin&nbsp;</strong></em></p>\n<p>Kéo cắt tỉa cành chính hãng được sản xuất với lưỡi kéo sắc bén có độ cứng cao, độ bền đạt một triệu lần cắt được các thợ làm vườn, cắt tỉa cây cảnh, bonsai tin dùng.</p>\n<p>Thông số: Chiều dài kéo cắt cành : 21cm, Chiều dài lưỡi kéo : 6cm Độ mở lưỡi kéo : 5.5cm Vật liệu : Thép 75cr1 độ cứng cao chuyên dùng để sản xuất các sản phẩm khoan, cắt.</p>\n<p>Kéo còn được tặng thêm 01 lò xo để thay thế.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-ely-sin-1.jpg?v=1630750687893\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-ely-sin-2.jpg?v=1630750794953\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-ely-sin-v5.jpg?v=1630750365375\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-ely-sin-3.jpg?v=1630750831453\" /></p>\n<p>&nbsp;</p>', '', 'Kéo cắt tỉa cành cây', 'Kéo cắt tỉa cành cây, Kéo cắt tỉa cành cây cao cấp Elysin, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22886625/keo-cat-tia-canh-cay-cao-cap-elysin.jpg', '<p>Kéo cắt tỉa cành chính hãng được sản xuất với lưỡi kéo sắc bén có độ cứng cao, độ bền đạt một triệu lần cắt được các thợ làm vườn, cắt tỉa cây cảnh, bonsai tin dùng.</p>\n<p>Thông số: Chiều', '22886625', '50797443', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:31', '2024-05-29 06:11:31');
