(1081, 'dao-gap-da-nang-6-trong-1', 'Dao gấp gọn du lịch, đi phượt, cắm trại đi rừng đa năng', '<p><strong><em>Dao gấp gọn du lịch, đi phượt, cắm trại đi rừng đa năng</em></strong></p>\n<p>Một sản phẩm đươc tích hợp quá nhiều tính năng hữu ích như cắt, mở đồ hộp, mở chai bia. xoay ốc vít,...</p>\n<p>Dao có màu đen và khá nặng nên cầm có cảm giác rất đầm tay và chắc chắn không giống như kiểu mấy con dao gọt hoa quả, dao được làm bằng thép đặc không gỉ cao cấp, bền đẹp, sắc bén theo thời gian. Sau mỗi lần sử dụng, bạn có thể gấp gọn lại bỏ vào túi xách, ba lô thậm chí là túi quần áo cực kì tiện lợi.</p>\n<p>Dài: 20cm gấp gọn 11.5cm, nặng 225g (cả ốc vít và bao nặng 360g) Màu sắc: đen Chất liệu: thép đặc không gỉ.</p>\n<p>Bộ sản phẩm gồm: Kìm cắt dây thép - Mở đồ hộp - Mở chai bia - Xoay ốc vít (có kèm 10 đầu vít giúp bạn xoay 10 kiểu ốc khác nhau) và kèm bao dựng xịn xò.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-1.jpg?v=1630746551738\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-4.jpg?v=1630746559057\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-2.jpg?v=1630746564747\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-10.jpg?v=1630749378445\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-3.jpg?v=1630746570539\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-7.jpg?v=1630747495009\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-9.jpg?v=1630747501427\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-bam-da-nang-5.jpg?v=1630747508109\" /></strong></em></p>', '', 'Dao gấp đa năng', 'cắm trại đi rừng đa năng, Dao gấp, Dao gấp gọn đa năng, Dao gấp gọn du lịch, đi phượt, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22882384/dao-gap-da-nang-6-trong-1.jpg', '<p>Một sản phẩm đươc tích hợp quá nhiều tính năng hữu ích như cắt, mở đồ hộp, mở chai bia. xoay ốc vít,...</p>\n<p>Dao có màu đen và khá nặng nên cầm có cảm giác rất đầm tay và chắc chắn không', '22882384', '50792375', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:31', '2024-05-29 06:11:31'),
(1082, 'keo-cat-tia-canh-cay-hai-hoa-qua-tren-cao-3-met', 'Kéo cắt tỉa cành cây, hái hoa quả trên cao 3 Mét', '<p><em><strong>Kéo cắt tỉa cành cây, hái hoa quả trên cao 3 Mét</strong></em></p>\n<p>Bộ sản phẩm tiện dụng dùng trong thu hoạch hoa quả&nbsp;và cắt tỉa cành trên cao.</p>\n<p>Chiều dài: Tối thiểu 1.8 mét, kéo dài tối đa 3 mét</p>\n<p>Chất liệu : Cán được làm từ hợp kim nhôm, nhẹ &nbsp;bền, tiết kiệm sức lao động.</p>\n<p>Tích hợp lưỡi cưa để cắt tỉa cành lơn trên cao.</p>\n<p>Lưỡi kéo cắt có răng cưa giữ cuỗng quả và cành hiệu quả.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-1.jpg?v=1630482543598\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-3.jpg?v=1630482549794\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-2.jpg?v=1630482556686\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-4.jpg?v=1630482563871\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-9.jpg?v=1630488676685\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-8.jpg?v=1630488682981\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-5.jpg?v=1630488690748\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-hai-qua-cat-tia-canh-tren-cao-da-nang-6.jpg?v=1630488696715\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/S_vt46bNTB0\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Kéo cắt tỉa cành cây', 'hái hoa quả trên cao 3 Mét, Kéo cắt tỉa cành cây, Kéo cắt tỉa cành cây 3m, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/22855715/keo-cat-tia-canh-cay-hai-hoa-qua-tren-cao-3-met.jpg', '<p>Bộ sản phẩm tiện dụng dùng trong thu hoạch hoa quả&nbsp;và cắt tỉa cành trên cao.</p>\n<p>Chiều dài: Tối thiểu 1.8 mét, kéo dài tối đa 3 mét</p>\n<p>Chất liệu : Cán được làm từ hợp kim nhôm,', '22855715', '50736286', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:32', '2024-05-29 06:11:32'),
(1083, 'dung-cu-hai-qua-thu-hoach-trai-cay-tren-cao-1-5m', 'Dụng cụ hái quả, thu hoạch trái cây trên cao 1.5M', '<p><strong><em>Dụng cụ hái quả, thu hoạch trái cây trên cao&nbsp;1.5M</em></strong></p>\n<p>Dụng cụ&nbsp;dài 1.5m giúp cho công việc thu hoạch, hái quả&nbsp;hiệu quả ,an toàn khi thu hái , không làm trầy xước quả, phù hợp với tất cả các loại trái cây như: Bơ , xoài , cam , bưởi , vú sữa...</p>\n<p>Chất liệu ống thép không gỉ tay cầm dạng bóp nhả như dùng kéo.</p>\n<p>Tay đỡ quả nó làm từ nhựa có lót lớp cao su non mềm, giúp bảo vệ quả không trầy xước.</p>\n<p>Kích thước: 1.5M.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-hai-qua-3.jpg?v=1630401378858\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-hai-qua-4.jpg?v=1630401386383\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-hai-qua-2.jpg?v=1630397532136\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-hai-qua-1.jpg?v=1630397538910\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jHGpPrvxph0\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Dụng cụ hái quả trên cao', 'dụng cụ hái quả, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '190000', '', '1', '', '', NULL, '', '', '', '1.2', 'kg', 'images/22845719/dung-cu-hai-qua-thu-hoach-trai-cay-tren-cao-1-5m.jpg', '<p>Dụng cụ&nbsp;dài 1.5m giúp cho công việc thu hoạch, hái quả&nbsp;hiệu quả ,an toàn khi thu hái , không làm trầy xước quả, phù hợp với tất cả các loại trái cây như: Bơ , xoài , cam , bưởi ,', '22845719', '50691785', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:32', '2024-05-29 06:11:32'),
(1084, 'keo-cat-tia-canh-cay-lon-sk-5', 'Kéo cắt cành lớn cộng lực có tăng độ dài cán SK-5', '<p><em><strong>Kéo cắt cành lớn cộng lực có tăng độ dài cán SK-5</strong></em></p>\n<p>Lưỡi kéo được chế tạo bằng thép SK5 NHẬT cao cấp, đảm bảo độ bền và độ sắc bén.</p>\n<p>Thiết kế lưỡi kéo răng cưa giúp chống trượt khi cắt.</p>\n<p>Cán được chế tạo bằng hợp kim nhôm cao cấp, nhẹ, và có độ cứng tốt.</p>\n<p>Phần đuôi của lưỡi kéo thiết kế theo dạng cộng lực giúp tăng thêm lực cắt, giảm hao sức lực của người dùng.</p>\n<p>Tay cầm được bọc cao su giúp cầm nắm êm tay hơn, chống trơn trượt.</p>\n<p>Cán có thể tăng giảm đồ dài tùy ý từ 69-102CM, rộng 23.5CM.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-6.jpg?v=1630317145966\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-v3.jpg?v=1630316690594\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-1.jpg?v=1630316696945\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-2.jpg?v=1630316703358\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-3.jpg?v=1630316711214\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-can-keo-dai-5.jpg?v=1630316720737\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"origi