(1085, 'keo-cat-tia-canh-cay-cay-canh-hang-rao', 'Kéo cắt tỉa cành cây, cây cảnh, hàng rào KD1', '<p><strong><em>Kéo cắt tỉa cành cây, cây cảnh, hàng rào KD1</em></strong></p>\n<p>Kéo cắt tỉa cây cảnh dùng để&nbsp;cắt tỉa hoa, bãi cỏ,&nbsp;công viên cây xanh, môi trường đô thị, có thể cắt cành nhỏ.</p>\n<p>Kéo là lựa chọn tốt cho người làm vườn cần một dụng cụ ổn định, chất lượng giá cả phải chăng.</p>\n<p>Chất liệu thép cao cấp, tay cầm bọc nhựa chắc chắn.</p>\n<p>kích thước: Dài 55CM, lưỡi kéo 19CM rộng 3.5CM.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-2.jpg?v=1630143425148\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-7.jpg?v=1630143705678\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-1.jpg?v=1630143717901\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-3.jpg?v=1630143730567\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-4.jpg?v=1630143736726\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-tia-canh-cay-6.jpg?v=1630143744810\" /></em></strong></p>', '', 'Kéo cắt tỉa cành cây', 'cây cảnh, hàng rào, kéo cắt cành, Kéo cắt tỉa cành cây, kéo tỉa cành, kéo tỉa cây, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22811596/keo-cat-tia-canh-cay-cay-canh-hang-rao.jpg', '<p>Kéo cắt tỉa cây cảnh dùng để&nbsp;cắt tỉa hoa, bãi cỏ,&nbsp;công viên cây xanh, môi trường đô thị, có thể cắt cành nhỏ.</p>\n<p>Kéo là lựa chọn tốt cho người làm vườn cần một dụng cụ ổn địn', '22811596', '50607663', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:32', '2024-05-29 06:11:32'),
(1086, 'vo-chia-khoa-hyundai-accent-khoa-gap-khac-laser-mien-phi-theo-yeu-cau', 'Vỏ Chìa Khóa Hyundai Accent Khóa Gấp - Khắc Laser Miễn Phí Theo Yêu Cầu', '<p><em><strong>Vỏ Chìa Khóa Hyundai Accent Khóa Gấp - Khắc Laser Miễn Phí Theo Yêu Cầu</strong></em></p>\n<p>Vỏ&nbsp;chìa cho xe ô tô Hyundai&nbsp;Accent khóa gấp&nbsp;được làm từ chất liệu nhựa cao cấp rất cứng cáp, tránh va đập, hư hỏng do làm rơi.</p>\n<p>Ốp chìa khoá màu đen sần&nbsp;sẽ đem lại sự nổi bật.</p>\n<p>Lắp đặt thay thế vỏ chìa khóa cũ đơn giản.&nbsp;</p>\n<p>Sử dụng thay thế cho chìa khóa Hyundai Accent&nbsp;khóa gấp.</p>\n<p>Dịch vụ Khắc tên và số điện thoại theo yêu cầu Miến Phí lên ốp vỏ chìa khóa. Xóa tan nỗi lo để quên hay đánh rơi chìa khóa, đã có tên à số điện thoại của bạn trên sản phẩm!</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vo-chia-khoa-elantra-khoa-gap-1.jpg?v=1630124502639\" /></p>\n<p><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vo-chia-khoa-elantra-khoa-gap-2.jpg?v=1630124510072\" /></p>\n<p><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vo-chia-khoa-elantra-khoa-gap-4.jpg?v=1630124519019\" /></p>\n<p><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vo-chia-khoa-elantra-khoa-gap-3.jpg?v=1630124525104\" /></p>\n<p><img data-thumb=\"original\" original-height=\"384\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/vo-chia-khoa-elantra-khoa-gap-5.jpg?v=1630124531456\" /></p>', '', 'Vỏ Chìa Khóa Hyundai Accent', 'ô tô, phụ  kiện ô tô, Vỏ chìa khóa accent, Vỏ Chìa Khóa Hyundai Accent Khóa Gấp - Khắc Laser Miễn Phí Theo Yêu Cầu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.2