(1087, 'logo-vuong-mien-dinh-da-gan-trang-tri-xe-o-to', 'Logo Vương miện đính đá gắn trang trí xe ô tô', '<p><em><strong>Logo Vương miện đính đá gắn trang trí xe ô tô</strong></em></p>\n<p>Logo thiết kế đẹp và nổi bật với hình Vương miện nổi bên trong, viền ngoài đính đá trắng sáng lấp lánh, sang trọng.</p>\n<p>Chất liệu kim loại, có kèm băng dính 3M siêu dính.</p>\n<p>Kích thước: 65MM, 47MM.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-vuong-mien-dan-xe-o-to-3.jpg?v=1629966503781\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-vuong-mien-dan-xe-o-to-1.jpg?v=1629966513121\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-vuong-mien-dan-xe-o-to-v8.jpg?v=1629966525476\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-vuong-mien-dan-xe-o-to-4.jpg?v=1629966534937\" /></strong></em></p>', '', 'Logo ô tô', 'logo dán đuôi ô tô đẹp, logo đuôi xe, logo vương miện, Logo Vương miện đính đá gắn trang trí xe ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích thước', '65MM', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22785862/logo-vuong-mien-dinh-da-gan-trang-tri-xe-o-to.jpg', '<p>Logo thiết kế đẹp và nổi bật với hình Vương miện nổi bên trong, viền ngoài đính đá trắng sáng lấp lánh, sang trọng.</p>\n<p>Chất liệu kim loại, có kèm băng dính 3M siêu dính.</p>\n<p>Kích th', '22785862', '50538224', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:32', '2024-05-29 06:11:32'),
(1088, 'keo-cat-ghep-canh-cay-da-nang-kc2-cat-canh-ghep-canh-tia-cay-chiet-canh', 'Kéo Cắt Ghép Cành Cây Đa Năng KC2 - Cắt Cành, Ghép Cành, Tỉa Cây, Chiết Cành', '<p><strong><em>Kéo Cắt Ghép Cành Cây Đa Năng KC2 - Cắt Cành, Ghép Cành, Tỉa Cây, Chiết Cành</em></strong></p>\n<p>Công việc ghép cành đòi hỏi sự tỉ mỉ và chính xác của mối ghép để đảm bảo cành sau khi ghép nhận được dinh dưỡng từ gốc ghép.</p>\n<p>Với kéo chuyên dụng bạn chỉ cần làm các bước đơn giản sau (sau khi chọn được cành ghép và gốc ghép):</p>\n<ul>\n<li>Chọn lưỡi cắt phù hợp (bộ gồm 3 lưỡi cắt kèm theo).</li>\n<li>Đưa cành ghép và cắt.</li>\n<li>Tiếp theo đưa kéo và vị trí cần ghép trên gốc ghép và cắt tiếp.</li>\n<li>Ráp nối cành cần ghép vào gốc sao cho khít sau đó băng kính lại với cuộn băng nilon đi kèm.&nbsp;</li></ul>\n<p>Chất liệu tay cầm nhựa lưỡi kéo kim loại&nbsp;cứng siêu sắc.</p>\n<p>Bộ sản phẩm: 01 kéo tặng kèm 2 lưỡi cắt.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-1.jpg?v=1629963935990\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-2.jpg?v=1629963944167\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-3.jpg?v=1629963958996\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-4.jpg?v=1629963973255\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-5.jpg?v=1629963990291\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-cay-kc2-6.jpg?v=1629963998099\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v9-f1b36fb8-662f-4cbb-b20a-e9052fe5128a.jpg?v=1629964016328\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/P7-iHAEHfuI\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Kéo Cắt Ghép Cành Cây Đa Năng', 'Chiết Cành, Ghép Cành, Kéo Cắt Ghép Cành Cây Đa Năng KC2 - Cắt Cành, kéo ghép cành, kéo ghép cây, Tỉa Cây, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22784814/keo-cat-ghep-canh-cay-da-nang-kc2-cat-canh-ghep-canh-tia-cay-chiet-canh.jpg', '<p>Công việc ghép cành đòi hỏi sự tỉ mỉ và chính xác của mối ghép để đảm bảo cành sau khi ghép nhận được dinh dưỡng từ gốc ghép.</p>\n<p>Với kéo chuyên dụng bạn chỉ cần làm các bước đơn giản s', '22784814', '50504809', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:32', '2024-05-29 06:11:32'),
(1089, 'keo-cat-ghep-canh-cay-da-nang-cat-canh-ghep-canh-tia-cay-chiet-canh', 'Bộ Kéo cắt ghép cành cây đa năng KC1 - Cắt Cành, Ghép Cành, Tỉa Cây, Chiết Cành', '<p><em><strong>Bộ Kéo cắt ghép cành cây đa năng KC1 - Cắt Cành, Ghép Cành, Tỉa Cây, Chiết Cành</strong></em></p>\n<p>Công việc ghép cành đòi hỏi sự tỉ mỉ và chính xác của mối ghép để đảm bảo cành sau khi ghép nhận được dinh dưỡng từ gốc ghép.</p>\n<p>Với kéo chuyên dụng bạn chỉ cần làm các bước đơn giản sau (sau khi chọn được cành ghép và gốc ghép):</p>\n<ul>\n<li>Chọn lưỡi cắt phù hợp (bộ gồm 3 lưỡi cắt kèm theo).</li>\n<li>Đưa cành ghép và cắt.</li>\n<li>Tiếp theo đưa kéo và vị trí cần ghép trên gốc ghép và cắt tiếp.</li>\n<li>Ráp nối cành cần ghép vào gốc sao cho khít sau đó băng kính lại với cuộn băng nilon đi kèm.&nbsp;</li></ul>\n<p>Chất liệu tay cầm nhựa lưỡi kéo kim loại&nbsp;cứng siêu sắc.</p>\n<p>Bộ sản phẩm: 01 kéo tặng kèm 3 lưỡi cắt, 1 tua vít 4 cạnh, 1 cờ lê, 2 cuộn băng nolon, 2 túi dây thun và 1 hộp đưng chuyên dụng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v5.jpg?v=1629944951929\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v7.jpg?v=1629944958951\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v6.jpg?v=1629944967554\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v9.jpg?v=1629944974475\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-ghep-canh-v10.jpg?v=1629945339207\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\