(1090, 'bo-xeng-quan-dung-da-nang-de-cop-xe-di-cau-cam-trai-da-ngoai', 'Bộ xẻng quân dụng đa năng để cốp xe, đi câu, cắm trại, dã ngoại', '<p><em><strong>Bộ xẻng quân dụng đa năng để cốp xe, đi câu, cắm trại, dã ngoại</strong></em></p>\n<p>Bộ xẻng quân dụng với 13 chức năng tiện dụng cho nhưng chuyến đi câu, dã ngoại...</p>\n<p>Bộ phụ kiện đi kèm gồm có:</p>\n<p>Còi kết hợp đánh lửa.</p>\n<p>Dao kết hợp cưa và khui mở bia.</p>\n<p>Có đầu phá kính ở cán xẻng.</p>\n<p>Lưởi xẻng có khe lục giác vặn bu lông,&nbsp;lưỡi xẻng kèm cưa và dao.</p>\n<p>Xẻng tháo rời ra 3 đốt rất tiện dụng, dễ dàng gấp gọn nhét vừa ba lô khi đi du lịch, dã ngoại, làm vườn</p>\n<p>Gấp thành cuốc chỉ với 1 thao tác đơn giản, gấp thành móc để đu mình lên cành cây chỉ với 1 thao tác.</p>\n<p>Chất liệu: Lưỡi xẻng được làm bằng thép không rỉ 3CR13 dày 2.5mm cực dày và chắc chắn Cán bằng nhôm tiện CNC chính xác, dày dặn và cứng cáp, Có kèm túi đựng họa tiết quân đội.</p>\n<p>Kích thước:&nbsp;Xẻng dài 76cm, lưỡi xẻng 16.4cm x 13cm rất vừa tầm tay.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-xeng-quan-dung-da-nang-cam-tay-4.jpg?v=1629881376498\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-xeng-quan-dung-da-nang-cam-tay-v3.jpg?v=1629878274695\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-xeng-quan-dung-da-nang-cam-tay-6.jpg?v=1629881393405\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-xeng-quan-dung-da-nang-cam-tay-2.jpg?v=1629881403388\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-xeng-quan-dung-da-nang-cam-tay-3.jpg?v=1629881410390\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/rPKTjByy-YQ\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'xẻng quân dụng đa năng', 'Bộ xẻng quân dụng đa năng để cốp xe, cắm trại, dã ngoại, đi câu, Volcano, volcano.vn, xẻng đa năng, xẻng quân dụng', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '380000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22774592/bo-xeng-quan-dung-da-nang-de-cop-xe-di-cau-cam-trai-da-ngoai.jpg', '<p>Bộ xẻng quân dụng với 13 chức năng tiện dụng cho nhưng chuyến đi câu, dã ngoại...</p>\n<p>Bộ phụ kiện đi kèm gồm có:</p>\n<p>Còi kết hợp đánh lửa.</p>\n<p>Dao kết hợp cưa và khui mở bia.</p>\n', '22774592', '50485246', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:33', '2024-05-29 06:11:33'),
(1091, 'may-cat-co-cam-tay-khong-day-sac-pin', 'Máy cắt cỏ cầm tay không dây, sạc pin USB', '<p><em><strong>Máy cắt cỏ cầm tay không dây, sạc pin USB</strong></em></p>\n<p>Được thiết kế tinh tế, nhỏ gọn với trọng lượng chỉ 0.75kg. Bất kể&nbsp;là nam hay nữa đều có thể dễ dàng cầm nắm bằng 1 tay, dễ dàng thao tác.</p>\n<p>Phù hợp sử dụng cất tỉa cỏ trong khuân viên, trong vườn....</p>\n<p>Tiện dụng với cán nhôm&nbsp;có thể tùy chỉnh kích thước: từ 75cm lên 105cm.</p>\n<p>Điện thế pin: 3.7V Loại : PinLithium 18650 : 2000mAh. thời gian sạc 30 phút đến 2 giờ, công suất 3W-700mA.</p>\n<p>Bộ sản phẩm tặng kèm 05 lươi dao cắt (4 lưỡi nhựa, 1 lưỡi kim loại), 01 cáp sạc pin USB.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cat-co-4.jpg?v=1629778852695\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cat-co-3.jpg?v=1629778858780\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cat-co-5.jpg?v=1629778865875\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cat-co-v7.jpg?v=1629776980242\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cat-co-1.jpg?v=1629776986442\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/q3ETVRCNfiE\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Máy cắt cỏ cầm tay không dây', 'máy cắt, máy cắt cỏ, máy cắt cỏ cầm tay, Máy cắt cỏ cầm tay không dây, sạc pin USB, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '380000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/22762962/may-cat-co-cam-tay-khong-day-sac-pin.jpg', '<p>Được thiết kế tinh tế, nhỏ gọn với trọng lượng chỉ 0.75kg. Bất kể&nbsp;là nam hay nữa đều có thể dễ dàng cầm nắm bằng 1 tay, dễ dàng thao tác.</p>\n<p>Phù hợp sử dụng cất tỉa cỏ trong khuân', '22762962', '50460024', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:33', '2024-05-29 06:11:33'),
(1092, 'nuoc-hoa-thien-nga-dinh-da-kep-cua-gio-dieu-hoa-tang-kem-02-lo-tinh-dau-10ml', 'Nước Hoa Thiên Nga Đính Đá Kẹp Cửa Gió Điều Hòa (Tặng Kèm 02 Lọ Tinh Dầu 10ml)', '<p><em><strong>Nước Hoa Thiên Nga Đính Đá Kẹp Cửa Gió Điều Hòa (Tặng Kèm 02 Lọ Tinh Dầu 10ml)</strong></em></p>\n<p>Nước hoa kẹp cửa gió điều hoà hình thiên Nga đẹp mắt, đính đá sang trọng.</p>\n<p>Nước hoa thiên Nga đính đá kẹp cửa gió điều hoà giúp khử mùi&nbsp;xe ô tô,&nbsp;</p>\n<p>Sản phẩm được tặng kèm 02 lọ tinh dầu nước hoa cao cấp hương thơm dịu nhẹ.</p>\n<p>Kích thước: 4.7*3.7*0.7CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-tang-2-lo-tinh-dau-1.jpg?v=1629708232437\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-tang-2-lo-tinh-dau-4.jpg?v=1629708239435\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-tang-2-lo-tinh-dau-3.jpg?v=1629708248344\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-tang-2-lo-tinh-dau-v4.jpg?v=1629708265865\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-tang-2-lo-tinh-dau-5.jpg?v=1629708810485\" /></strong></em></p>', '', 'Nước Hoa Thiên Nga Đính Đá Kẹp Cửa Gió Điều Hòa', 'Nước Hoa Thiên Nga Đính Đá Kẹp Cửa Gió Điều Hòa, Nước Hoa Thiên Nga Đính Đá Kẹp Cửa Gió Điều Hòa (Tặng Kèm 02 Lọ Tinh Dầu 10ml), ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '',