(1094, 'mui-khoan-khoi-thuy-ong-nhua-pvc-16mm', 'Mũi Khoan Khởi Thủy Ống Nhựa PVC 16MM', '<p><em><strong>Mũi&nbsp;Khoan&nbsp;Khởi&nbsp;Thủy&nbsp;Ống&nbsp;Nhựa&nbsp;PVC 16MM</strong></em></p>\n<p>Mũi khoan dùng để khoan lỗ 16mm lên ống nhựa dạng cứng như PVC, HDPE ..vvv.</p>\n<p>Lỗ khoan sau đó được chèn zoăng cao su 16mm để nối các loại khởi thủy 16MM</p>\n<p>Chất liệu: hợp kim</p>\n<p>Có mũi định hướng ở tâm</p>\n<p>Kích thước: phi 16MM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mui-khoan-ong-16mm-3.jpg?v=1629432180307\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mui-khoan-ong-16mm-4.jpg?v=1629432186675\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-thang-thu-ong-to-ve-ong-nho-3-efd1725a-3d8f-48a3-999e-a200f55bc231.jpg?v=1629432192499\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mui-khoan-ong-16mm-2.jpg?v=1629432200031\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mui-khoan-ong-16mm-1.jpg?v=1629432205786\" /></p>', '', '', 'Mui khoan, Mũi Khoan Khởi Thủy Ống Nhựa PVC 16MM, mũi khoan ống nhựa, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22740017/mui-khoan-khoi-thuy-ong-nhua-pvc-16mm.jpg', '<p>Mũi khoan dùng để khoan lỗ 16mm lên ống nhựa dạng cứng như PVC, HDPE ..vvv.</p>\n<p>Lỗ khoan sau đó được chèn zoăng cao su 16mm để nối các loại khởi thủy 16MM</p>\n<p>Chất liệu: hợp kim</p>\n', '22740017', '50341053', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:34', '2024-05-29 06:11:34'),
(1095, '05-bit-dau-ong-pe-ldpe-hdpe-pvc-8-11mm-co-dai-siet', '05 Bịt đầu ống PE, LDPE, HDPE, PVC 8/11mm Có đai siết', '<p><em><strong>05 Bịt đầu ống PE, LDPE, HDPE, PVC 8/11mm Có đai siết</strong></em></p>\n<p>Bịt đầu cho ống 8/11mm Có đai siết để kết thúc một đoạn cho hệ thống tưới là sản phẩm không thể thiếu, là khớp nối cho hệ thống tưới, sản phẩm có độ đàn hồi cao, bền bỉ với môi trường.</p>\n<p>Bịt đầu cuối kế thúc nối lấy nước từ dây dẫn ống dây dẫn tưới 8/12mm và nối vào dây tưới Φ4/7 đầu tưới nhỏ giọt, hoặc que cắm nhỏ giọt.</p>\n<p>Sản phẩm này đã được ứng dụng rộng rãi trên nhiều loại cây trồng, nhiều mô hình tưới khác nhau như ngoài cánh đồng, tưới cảnh quan, tưới nhà kính, nhà lưới. Trong đó phổ biến nhất là dùng cho tưới hồ tiêu, tưới cà chua, tưới ớt ngọt...</p>\n<p>Chất liệu nhựa bền bỉ sử dụng lâu dài.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-5.jpg?v=1629431005575\" /></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-2.jpg?v=1629429895436\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-1.jpg?v=1629429902186\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-4-f0877aa4-4c31-4cd3-9abe-6566c5a9fba2.jpg?v=1629430997720\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-3-a3546331-f23a-46b6-82ed-a816ebd42488.jpg?v=1629431041438\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khoa-bit-dau-ong-nuoc-6-f7e93bdf-1158-41c6-861d-88fe45693229.jpg?v=1629431049257\" /></strong></em></p>', '', 'Bịt đầu ống PE, LDPE, HDPE, PVC 8/11mm', '05 Bịt đầu ống PE, bịt đầu ống nước, đầu bị ống nước, HDPE, LDPE, PVC 8/11mm Có đai siết, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '20000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/22739733/05-bit-dau-ong-pe-ldpe-hdpe-pvc-8-11mm-co-dai-siet.jpg', '<p>Bịt đầu cho ống 8/11mm Có đai siết để kết thúc một đoạn cho hệ thống tưới là sản phẩm không thể thiếu, là khớp nối cho hệ thống tưới, sản phẩm có độ đàn hồi cao, bền bỉ với môi trường.</p>', '22739733', '50340584', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:34', '2024-05-29 06:11:34'),
(1096, 'combo-05-bec-tuoi-phun-8-tia-cho-he-thong-tuoi-tu-dong', 'Combo 05 Bec tưới phun 8 tia cho hệ thống tưới tự động', '<p><em><strong>Combo 05 Bec tưới phun&nbsp;8 tia cho hệ thống tưới tự động</strong></em></p>\n<p>Béc tưới phun 8 tia chuyên tưới cây ăn trái, cây công nghiệp, cây nông nghiệp, cây bụi, tưới cảnh quan, vườn sân thượng…</p>\n<p>Áp suất hoạt động: 0.1-2 bar<br />\nBán kính phun khi đủ áp lực 30cm</p>\n<p>Lưu lượng: 0.5 – 80 lít/giờ</p>\n<p>Có thể tùy&nbsp;chỉnh bán kính, lưu lượng. Dễ dàng tháo rời để vệ sinh.</p>\n<p>Chân bec 4/7, đường kính 1.5cm.&nbsp;Có thể sử dụng kết hợp với ống mềm 4/7mm hoặc gắn trược tiếp lên ống dẫn.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-2.jpg?v=1629703111554\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-5.jpg?v=1629703118058\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-8.jpg?v=1629703125976\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-7.jpg?v=1629703132454\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-6.jpg?v=1629703139574\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-4.jpg?v=1629703147492\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bec-phun-mua-tuoi-tu-dong-1.jpg?v=1629703155597\" /></p>', '', 'Bec tưới phun 8 tia cho hệ thống tưới tự động', 'bec phun 8 tia\\, bec tưới p