(1099, 'bec-voi-phun-suong-xoay-360-do-co-kem-chan-cam', 'Béc (vòi) phun mưa xoay 360 độ có kèm chân cắm', '<p><strong><em>Béc (vòi) phun mưa xoay 360 độ có kèm chân cắm</em></strong></p>\n<p>Béc xoay 360 độ chuyên phun mưa cho cây hiệu quả đến bất ngờ, bạn sẽ mang đến cho vườn cây, vườn lan nhà bạn thêm xanh tốt với béc phun mưa xoay 360 độ giống như có một cơn mưa thật đang tưới cây nhà bạn.</p>\n<p>Giúp tiết kiệm công sức và thời gian tưới cây, thời gian đó bạn sẽ làm rất nhiều việc thay vì bạn phải kéo dây tưới từng cây một thì nay đã có béc phun mưa giúp bạn làm việc đó mỗi ngày mà không cảm thấy mệt nhọc.</p>\n<p>Chế độ phun: Phun mưa xoay đều 360 độ<br />\nChất liệu: Nhựa kỹ thuật độ bền cao<br />\nỨng dụng: Tưới nông nghiệp, lan, bãi cỏ, hoa viên, công viên, vườn ươm, vườn rau<br />\nĐường kính phun: 2.5-3,5 mét<br />\nTốc độ dòng chảy: 60-120 L/h<br />\nÁp lực: 2,5 – 3.5kg<br />\nĐầu nối: đầu khởi thủy 6mm</p>\n<p>Chân cắm cao 60CM, có 2 đầu khởi thủy 6mm và 8mm.<strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-1.jpg?v=1629342700933\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-2.jpg?v=1629342707629\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-3.jpg?v=1629342714441\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-4.jpg?v=1629342721184\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-6.jpg?v=1629342738466\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cot-phun-suong-tuoi-cay-5.jpg?v=1629342744375\" /></em></strong></p>', '', 'Béc (vòi) phun mưa xoay 360 độ có kèm chân cắm', 'béc 360 độ, béc phun sương, Béc (vòi) phun mưa xoay 360 độ có kèm chân cắm, Béc (vòi) phun sương xoay 360 độ có kèm chân cắm, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22730506/bec-voi-phun-suong-xoay-360-do-co-kem-chan-cam.jpg', '<p>éc xoay 360 độ chuyên phun mưa cho cây hiệu quả đến bất ngờ, bạn sẽ mang đến cho vườn cây, vườn lan nhà bạn thêm xanh tốt với béc phun mưa xoay 360 độ giống như có một cơn mưa thật đang tư', '22730506', '50308743', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1100, 'ong-dan-nuoc-pe-cao-cap-dung-cho-he-thong-tuoi-tu-dong', 'Ống Dẫn Nước PE cao cấp dùng Cho Hệ Thống Tưới Tự Động', '<p><em><strong>Ống Dẫn Nước PE cao cấp dùng Cho Hệ Thống Tưới Tự Động</strong></em></p>\n<p>Ống dùng dẫn nước trong hệ thống tưới phun mưa tự động, tưới nhỏ giọt quấn quanh gốc, tưới vườn rau, cây ăn quả, cây công nghiệp, vườn hoa, cây cảnh...</p>\n<p>Chất liệu:&nbsp;Nhựa polyetylen cao cấp chịu áp suất cao,&nbsp;được ứng dụng trong nông nghiệp.</p>\n<p>Sử dụng làm ống chính, ống nhánh trong hệ thống tưới.</p>\n<p>Ống chia làm 3 kích thước khác nhau: Ống PE25&nbsp;(phi 25mm dày 2mm),&nbsp;Ống PE20 (phi 20mm dày 1.5mm),&nbsp;Ống PE32 (phi 32mm dày 2mm).</p>\n<p>Giá sản phẩm: 1M</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-3.jpg?v=1629278162113\" /></strong></em></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-4.jpg?v=1629278176475\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-6.jpg?v=1629278191167\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-2-c3d39e29-05ea-4bf8-8124-68144ef43c1e.jpg?v=1629278198427\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-8.jpg?v=1629278205640\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-9.jpg?v=1629278212136\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ong-nhua-pe-cao-cap-7.jpg?v=1629278219523\" /></strong></em></p>', '', 'Nhựa polyetylen áp suất cao', 'ống cấp nước pe, Ống Dẫn Nước PE cao cấp dùng Cho Hệ Thống Tưới Tự Động, ống nhựa, ống nhựa PE, Volcano, volcano.vn', '1', 'Kích thước', 'PE20', '', '', '', '', '', '', '', 'deny', '', '12000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/22727393/ong-dan-nuoc-pe-cao-cap-dung-cho-he-thong-tuoi-tu-dong.jpg', '<p>Ống dùng dẫn nước trong hệ thống tưới phun mưa tự động, tưới nhỏ giọt quấn quanh gốc, tưới vườn rau, cây ăn quả, cây công nghiệp, vườn hoa, cây cảnh...</p>\n<p>Chất liệu:&nbsp;Nhựa polyetyl', '22727393', '50301955', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1101, 'dau-voi-tuoi-phun-mua-co-kem-chan-cam-va-day', 'Béc (vòi) tưới phun mưa có kèm chân cắm và ống mềm 4/7mm', '<p><em><strong>Béc (vòi) tưới phun mưa có kèm chân cắm và ống mềm 4/7mm</strong></em></p>\n<p><em><strong>Béc</strong></em> tưới 4&nbsp;tia có chân cắm thích hợp sử dụng trong hệ thống tưới lớn nhỏ như vườn cây ăn quả, vườn đồi, vườn sân thượng , vườn ban công… đặc biệt tiện dụng khi sử dụng tưới các loại cây không đồng đều.</p>\n<p>Chân cắm dài 18cm, ống mềm 4/7mm dài 50cm, đầu nối thẳng 4/7.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-nuoc-phun-suong-kem-day-dan-5.jpg?v=1629273962044\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-nuoc-phun-suong-kem-day-dan-6.jpg?v=1629274042680\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/voi-nuoc-phun-suong-kem-day-dan-7.jpg?v=1629274048344\" /></strong></em></p>', '', 'Đầu vòi tưới phun mưa', 'Đầu vòi tưới phun mưa có kèm chân cắm và dây, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '12000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/22725808/dau-voi-tuoi-phun-mua-co-kem-chan-cam-va-day.jpg', '<p><em><strong>Béc&nbsp;</strong></em>tưới 4&nbsp;tia có chân cắm thích hợp sử dụng trong hệ thống tưới lớn nhỏ như vườn cây ăn quả, vườn đồi, vườn sân thượng , vườn ban công… đặc biệt tiện d', '22725808', '50299725', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1102, 'dau-noi-ong-nuoc-chu-t-pe16', 'Đầu nối ống nước chữ T PE16', '<p><em><strong>Đầu nối ống nước chữ T PE16</strong></em></p>\n<p>Đầu nối chất liệu nhại cao cấp chịu áp suất cao.</p>\n<p>Sử dụng lắp đặt đơn giản, phù hợp cho như cầu chia nước tưới tiêu trong nông nghiệp.</p>\n<p>Lắp đặt cho ống nhựa phi 16.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-nuoc-chu-t-5.jpg?v=1629260964829\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-nuoc-chu-t-3.jpg?v=1629260976888\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-nuoc-chu-t-1.jpg?v=1629260982484\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-nuoc-chu-t-4.jpg?v=1629260987993\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-nuoc-chu-t-2.jpg?v=1629260997167\" /></p>', '', 'Đầu nối ống nước chữ T PE16', 'đầu nối ống chữ t 16, đầu nối ống nước, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22724542/dau-noi-ong-nuoc-chu-t-pe16.jpg', '<p>Đầu nối chất liệu nhại cao cấp chịu áp suất cao.</p>\n<p>Sử dụng lắp đặt đơn giản, phù hợp cho như cầu chia nước tưới tiêu trong nông nghiệp.</p>\n<p>Lắp đặt cho ống nhựa phi 16.</p>', '22724542', '50297289', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1103, 'bo-04-chan-bun-cho-xe-o-to-hyundai-accent-2016-2020', 'Bộ 04 chắn bùn cho xe ô tô Hyundai Accent 2016-2020', '<p><strong><em>Bộ 04 chắn bùn cho xe ô tô Hyundai Accent 2016-2020</em></strong></p>\n<p>Với thời tiết ở Việt Nam mưa khá nhiều khi đi xe ô to&nbsp;chạy gây văng nước, bùn, cát sỏi...&nbsp;ra sau, làm ảnh hưởng đến những xe chạy sau và cũng làm bẩn các bộ phận khác của xe. Với&nbsp;04 chắn bùn cho xe ô tô Hyundai Accent 2016-2020 giúp bạn loại bỏ hoàn toàn những vẫn đề trên, ngoài chắn bùn bộ sản phẩm còn giúp&nbsp;hạn chế trầy, tróc lớp sơn bảo vệ xe do đất đá bắn lên gây ra.&nbsp;</p>\n<p>Sản phẩm làm bằng chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Hyundai Accent 2016-2020.</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm cho chiếc xe của bạn&nbsp;trông cá tính, mạnh mẽ hơn nhiều.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-accent-v1.jpg?v=1629253079078\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-accent-v2.jpg?v=1629253087154\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-accent-v3.jpg?v=1629253094132\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-6-2152c3d4-4e4c-415a-9935-331c7330228b.jpg?v=1629253030691\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-7-81b5a55a-e7ef-44b9-999f-95f604c0c2fd.jpg?v=1629253038378\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-5-ba96eb05-685b-45c6-a7c1-58f203812ee2.jpg?v=1629253045638\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-4-9f97b1a3-80e0-4915-8a6f-a450f36944b8.jpg?v=1629253051813\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-3-6d0f10b4-b0f3-4c53-82f6-46d640a5bf09.jpg?v=1629253059559\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-oo-to-cheverlet-cruze-2-48f9ec93-b832-46aa-9c2a-caa2d7685f12.jpg?v=1629253066413\" /></p>', '', 'Chắn bùn cho xe ô tô', 'Bộ 04 chắn bùn cho xe ô tô Hyundai Accent 2016-2020, chắn bùn cho xe ô tô, chắn bùn xe hơi, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22723728/bo-04-chan-bun-cho-xe-o-to-hyundai-accent-2016-2020.jpg', '<p>Với&nbsp;04 chắn bùn cho xe ô tô Hyundai Accent 2016-2020 giúp bạn loại bỏ hoàn toàn những vẫn đề trên, ngoài chắn bùn bộ sản phẩm còn giúp&nbsp;hạn chế trầy, tróc lớp sơn bảo vệ xe do đất', '22723728', '50295567', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1104, 'but-ky-de-ban-co-day-xoan-khac-ten-theo-yeu-cau', 'Bút ký để bàn có dây xoắn khắc tên Miễn Phí theo yêu cầu', '<p><em><strong>Bút ký để bàn có dây xoắn khắc tên Miễn Phí theo yêu cầu</strong></em></p>\n<p>Đi kèm là đế có keo dán chất kết dính mạnh mẽ, chắc chắn và không dễ rơi ra khi dán cố định trên bàn.</p>\n<p>Dây xoắn lò xo có thể kéo giãn 100cm, không dễ biến dạng.</p>\n<p>Đế nhựa cao cấp có thể khắc tên, logo lên miễn phí theo yêu cầu của khắc hàng.</p>\n<p>Kích thước bút: dài 13.5CM, đế 6 x 4 CM.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-de-ban-co-day-xoan-1.jpg?v=1629189029700\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-de-ban-co-day-xoan-2.jpg?v=1629189036469\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-de-ban-co-day-xoan-3.jpg?v=1629189042528\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-de-ban-co-day-xoan-5.jpg?v=1629189446529\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-de-ban-co-day-xoan-4.jpg?v=1629189048183\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Bút ký để bàn', 'bút ký để bàn, Bút ký để bàn có dây xoắn khắc tên Miễn Phí theo yêu cầu, ô tô, Volcano, volcano.vn', '1', 'Màu', 'Đen', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22718865/but-ky-de-ban-co-day-xoan-khac-ten-theo-yeu-cau.jpg', '<p>Đi kèm là đế có keo dán chất kết dính mạnh mẽ, chắc chắn và không dễ rơi ra khi dán cố định trên bàn.</p>\n<p>Dây xoắn lò xo có thể kéo giãn 100cm, không dễ biến dạng.</p>\n<p>Đế nhựa cao cấ', '22718865', '50281039', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1105, 'bo-05-dau-noi-ong-nuoc-thang-4-7', 'Bộ 05 Khỏi thủy đầu nối ống thẳng 4/7', '<p><em><strong>Bộ 05 Khỏi thủy đầu nối ống thẳng 4/7</strong></em></p>\n<p>Đầu nối ống nước thẳng 4/7&nbsp;để chuyển từ dây dẫn nước to sang dây dẫn nhỏ hơn cho hệ thống tưới là sản phẩm không thể thiếu.</p>\n<p>Sản phẩm có độ đàn hồi cao, bền bỉ với môi trường.</p>\n<p>Sử dụng cho đầu tưới nhỏ giọt, hoặc que cắm nhỏ giọt.</p>\n<p>Kích thước: phi 4mm, chân 7mm, dài 26mm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-muoc-thang-2.jpg?v=1629183347792\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-muoc-thang-1.jpg?v=1629183360710\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-muoc-thang-v3.jpg?v=1629183262359\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-noi-ong-muoc-thang-v5.jpg?v=1629183375523\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Bộ 05 Khỏi thủy đầu nối ống thẳng 4/7', 'Đầu nối ống nước thẳng 4/7, đồi nối ống 4 phi, đồi nối ống nước, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/22717998/bo-05-dau-noi-ong-nuoc-thang-4-7.jpg', '<p>&nbsp;Đầu nối ống nước thẳng 4/7&nbsp;để chuyển từ dây dẫn nước to sang dây dẫn nhỏ hơn cho hệ thống tưới là sản phẩm không thể thiếu.</p>\n<p>Sản phẩm có độ đàn hồi cao, bền bỉ với môi trư', '22717998', '50277570', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:35', '2024-05-29 06:11:35'),
(1106, 'bo-05-dau-noi-ong-chu-t-9-12', 'Bộ 05 Đầu nối ống nước chữ T 9/12', '<p><em><strong>Bộ 05 Đầu nối ống nước chữ T 9/12</strong></em></p>\n<p>&nbsp;Sử dụng đầu nối kết nối nước tưới hoa, cây, cỏ, nông nghiệp</p>\n<p>Vòi nhựa đơn giản thuận tiện.Dễ dàng lắp đặt.</p>\n<p>Sản phẩm chất lượng bền lâu, được chấp nhận rộng rãi bởi người dùng.</p>\n<p>Kích thước: phi 9mm, chân 12mm chài 68mm.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-moi-ong-nuoc-chu-t-3.jpg?v=1629171099931\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-moi-ong-nuoc-chu-t-2.jpg?v=1629171106549\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-moi-ong-nuoc-chu-t-1.jpg?v=1629171112514\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-moi-ong-nuoc-chu-t-4.jpg?v=1629171118418\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-moi-ong-nuoc-chu-t-5.jpg?v=1629171124611\" /></strong></em></p>', '', 'Đầu nối ống nước chữ T', 'Bộ 05 Đầu nối ống chữ T 9/12, Đầu nối ống chữ T, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22717075/bo-05-dau-noi-ong-chu-t-9-12.jpg', '<p>&nbsp;Sử dụng đầu nối kết nối nước tưới hoa, cây, cỏ, nông nghiệp</p>\n<p>Vòi nhựa đơn giản thuận tiện.Dễ dàng lắp đặt.</p>\n<p>Sản phẩm chất lượng bền lâu, được chấp nhận rộng rãi bởi người', '22717075', '50275966', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 