(1110, 'keo-cat-tia-canh-cay-sieu-sac-sada-k06', 'Kéo cắt tỉa cành cây siêu sắc SADA -K06', '<p><em><strong>Kéo cắt tỉa cành cây siêu sắc SADA -K06</strong></em></p>\n<p>Kéo Cắt Cành chuyên dùng để cắt tỉa cành.</p>\n<p>Lưỡi kéo bén, to bảng thích hợp để cắt những cành to.</p>\n<p>Tay cầm thiết kế uốn lượn tạo lực và thao tác dễ dàng, nhanh chóng.</p>\n<p>Lưỡi kéo cứng chắc, sắc bén, Chuyên dùng để cắt tỉa cành,</p>\n<p>Phục vụ cho công việc chăm sóc cây cảnh.</p>\n<p>Chiều dài của kéo 210mm Chiều dài lưỡi kéo: 70mm Độ mở lưỡi kéo: 50mm</p>\n<p>Tay cầm thiết kế vừa tay, êm tay cắt không mỏi. Lưỡi kéo được tôi bằng thép cứng.</p>\n<p>Mỗi 1 hộp&nbsp;kéo được tặng kèm theo lò xo.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-1.jpg?v=1628908476369\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-2.jpg?v=1628908482848\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-3.jpg?v=1628908489113\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-4.jpg?v=1628908496507\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-8.jpg?v=1628908666787\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-6.jpg?v=1628908673512\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-canh-cay-sada-8-4ff5f562-597f-412a-8c9b-629ce1da880c.jpg?v=1628908680776\" /></p>', '', 