(1111, 'bat-phu-dat-chong-co-moc-chong-soi-mon-dat', 'Bạt phủ đất chống cỏ mọc, chống sói mòn đất', '<p><em><strong>Bạt phủ đất chống cỏ mọc, chống sói mòn đất</strong></em></p>\n<p>Bạt phủ đất&nbsp;chống cỏ &nbsp;mọc&nbsp;được dùng nhiều trong ngành nông nghiệp. Mục đính chính là dùng để chống cỏ mọc, giữ ẩm cho đất, hạn chế việc sử dụng thuốc diệt cỏ, đảm bảo an toàn cho môi trường sống và chất lượng cây trồng.</p>\n<p>Chống lèn chặt đất, tạo độ ẩm xốp cho đất giúp cây trồng hấp thụ tối đa.</p>\n<p>Hoàn toàn không cần làm cỏ trên mặt luống.</p>\n<p>Điều hoà độ ẩm vào mùa nắng, ngăn không cho nước bốc hơi lên.Tiết kiệm nước tưới tiêu,&nbsp;giúp cây trồng ra rễ nhanh hơn.</p>\n<p>Thiết kế lỗ thoáng một chiều thấm hút nước.</p>\n<p>Chống thất thoát phân bón , sói mòn đất</p>\n<p>Hạn chế côn trùng gây hại cho cây trồng.</p>\n<p>Bạt trải diệt cỏ được sản xuất từ nhựa Polyethylene cao phân tử (HDPE) siêu bền.</p>\n<p>Thời gian sử dụng trên 5 năm , tiết kiệm chi phí.</p>\n<p>Phân loại nhiều khổ khác nhau tính theo chiều rộng: Rộng 80CM, rộng 100CM, Rộng 120CM, Rộng 40CM.</p>\n<p>Kích thước chiều dài có thể tùy chỉnh theo yêu cầu của khách hàng. Số lượng bán ra nhỏ nhất là chiều dài 10 Mét.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-8.jpg?v=1628845599393\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-11.jpg?v=1628845606930\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-v3.jpg?v=1628845616585\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-5.jpg?v=1628845628044\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-6.jpg?v=1628845636106\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-1.jpg?v=1628845657001\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-2.jpg?v=1628845663530\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-3.jpg?v=1628845669452\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-4.jpg?v=1628845677488\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-10.jpg?v=1628845683251\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-phu-dat-chong-soi-mon-9.jpg?v=1628845690536\" /></p>', '', 'Bạt phủ đất chống cỏ mọc', 'Bạt phủ chống cỏ mọc, Bạt phủ đất chống cỏ mọc, bạt phủ nông nghiệp, chống sói mòn đất, Volcano, volcano.vn', '1', 'Kích thước', '10x0.4M', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22690958/bat-phu-dat-chong-co-moc-chong-soi-mon-dat.jpg', '<p>Bạt phủ đất&nbsp;chống cỏ &nbsp;mọc&nbsp;được dùng nhiều trong ngành nông nghiệp. Mục đính chính là dùng để chống cỏ mọc, giữ ẩm cho đất, hạn chế việc sử dụng thuốc diệt cỏ, đảm bảo an toà', '22690958', '56972885', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:36', '2024-05-29 06:11:36'),
(1112, 'keo-cat-tia-canh-cay-cao-cap-sk5-japan', 'Kéo cắt tỉa cành cây cao cấp SK5 JAPAN', '<p><em><strong>Kéo cắt tỉa cành cây cao cấp SK5 JAPAN</strong></em></p>\n<p>Kéo cắt tỉa cành chính hãng Nhật Bản là KÉO SẮC VĨNH VIỄN được sản xuất với lưỡi kéo sắc bén có độ cứng cao, độ bền đạt một triệu lần cắt được các thợ làm vườn, cắt tỉa cây cảnh, bonsai tin dùng.</p>\n<p>Thông số: Chiều dài kéo cắt cành : 21.5 cm, Chiều dài lưỡi kéo : 7cm Độ mở lưỡi kéo : 5cm Vật liệu : Thép SK5 độ cứng cao chuyên dùng để sản xuất các sản phẩm khoan, cắt.</p>\n<p>Kéo còn được tặng thêm 01 lò xo để thay thế.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-cay-sk5-japan-1.jpg?v=1628757912308\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-cay-sk5-japan-2.jpg?v=1628757919255\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-cay-sk5-japan-4.jpg?v=1628758028146\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-tia-cay-sk5-japan-3.jpg?v=1628757925512\" /></p>', '', 'Kéo cắt tỉa cành cây cao cấp SK5', 'kéo cắt cây cảnh, Kéo cắt tỉa cành cây cao cấp SK5 JAPAN, kéo cắt tỉa cây, kéo tỉa cây cảnh, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22682596/keo-cat-tia-canh-cay-cao-cap-sk5-japan.jpg', '<p>Kéo cắt tỉa cành chính hãng Nhật Bản là KÉO SẮC VĨNH VIỄN được sản xuất với lưỡi kéo sắc bén có độ cứng cao, độ bền đạt một triệu lần cắt được các thợ làm vườn, cắt tỉa cây cảnh, bonsai ti', '22682596', '50184118', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, N