(1113, 'keo-cat-tia-canh-cay-sieu-sac', 'Kéo cắt tỉa cành cây siêu sắc G016', '<p><em><strong>Kéo cắt tỉa cành cây siêu sắc G016</strong></em></p>\n<p>Kéo Cắt Cành chuyên dùng để cắt tỉa cành.</p>\n<p>Lưỡi kéo bén, to bảng thích hợp để cắt những cành to.</p>\n<p>Tay cầm thiết kế uốn lượn theo vị trí các ngón tay cầm, tạo lực và thao tác dễ dàng, nhanh chóng.</p>\n<p>Lưỡi kéo cứng chắc, sắc bén, Chuyên dùng để cắt tỉa cành,</p>\n<p>Phục vụ cho công việc chăm sóc cây cảnh</p>\n<p>Chất liệu:&nbsp; thép không gỉ + Tay cầm: nhựa cao cấp.</p>\n<p>Kích thước: 19*5CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-4.jpg?v=1628754913112\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-3.jpg?v=1628754920286\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-5.jpg?v=1628754927181\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-6.jpg?v=1628754932780\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-1.jpg?v=1628754405789\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/keo-cat-canh-g06-v2.jpg?v=1628754411944\" /></p>', '', 'Kéo cắt tỉa cành cây siêu sắc G016', 'kéo cắt cành\\, kéo cắt cành cây, Kéo cắt tỉa cành cây siêu sắc G016, kéo cắt tỉa cây, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/22682083/keo-cat-tia-canh-cay-sieu-sac.jpg', '<p>Kéo Cắt Cành chuyên dùng để cắt tỉa cành.</p>\n<p>Lưỡi kéo bé