(1115, 'nuoc-hoa-thien-nga-kep-cua-gio-dieu-hoa', 'Nước hoa thiên nga đính đá kẹp cửa gió điều hòa (tặng kèm lọ tinh dầu 10ml)', '<p><em><strong>Nước hoa thiên nga&nbsp;đính đá&nbsp;kẹp cửa gió điều hòa (tặng kèm lọ tinh dầu 10ml)</strong></em></p>\n<p>Nước hoa kẹp cửa gió điều hoà hình thiên Nga đẹp mắt, đính đá sang trọng.</p>\n<p>Nước hoa thiên Nga đính đá kẹp cửa gió điều hoà giúp khử mùi&nbsp;xe ô tô,&nbsp;</p>\n<p>Sản phẩm được tặng kèm một lọ tinh dầu nước hoa.</p>\n<p>Kích thước: 4*3.5*0.7CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-dinh-da-kep-cua-gio-dieu-hoa-tang-kem-lo-tinh-dau-10ml-2.jpg?v=1629447071785\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-dinh-da-kep-cua-gio-dieu-hoa-tang-kem-lo-tinh-dau-10ml-1.jpg?v=1629447080598\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-dieu-hoa-2.jpg?v=1628736313833\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-dieu-hoa-5.jpg?v=1628736324883\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-dieu-hoa-7.jpg?v=1628736342941\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-thien-nga-kep-cua-gio-dieu-hoa-8.jpg?v=1628736356526\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/file