(1117, 'but-ky-kim-loai-de-ban-khac-laser-theo-yeu-cau', 'Bút ký kim loại để bàn khắc laser theo yêu cầu', '<p><em><strong>Bút ký kim loại để bàn khắc laser theo yêu cầu</strong></em></p>\n<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà hoàn hảo giúp đối tác luôn nhớ đến bạn đầu tiên.</p>\n<p>Đây là loại bút dòng ruột bi size 0.5mm, thay thế khi sử dụng hết mực với cơ chế xoay nắp để viết. Thích hợp với những người vừa ký và vừa viết lách hàng ngày.</p>\n<p>Bút thiết kết chuyên dụng để bàn có kèm đế cắm và&nbsp;dây giữ bút.</p>\n<p>kích thước: đế 8.5*7.5CM, bút dài 17CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-de-ban-3-be84e9f4-db30-4ab0-b195-416639c26d60.jpg?v=1628562452634\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-de-ban-5-7c180dc1-6f93-4aa1-a8a1-a9dbd0e48f45.jpg?v=1628563940481\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-de-ban-4-fd5851c1-101f-490b-98d2-0cbf883c6041.jpg?v=1628562895680\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-de-ban-1-12eeed77-c803-42c0-9229-6349d687a674.jpg?v=1628562903620\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-de-ban-2-12c04c1f-acc0-4e18-bc61-00df21fde708.jpg?v=1628563034754\" /></p>', '', 'Bút ký kim loại để bàn khắc laser', 'bút bi, bút bi để bàn, bút bi kim loại, bút kim loại, Bút ký kim loại để bàn khắc laser, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22660632/but-ky-kim-loai-de-ban-khac-laser-theo-yeu-cau.jpg', '<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà ho', '22660632', '50111713', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:39', '2024-05-29 06:11:39'),
(1118, 'but-bi-kim-loai-de-ban-khac-ten-theo-yeu-cau', 'Bút bi kim loại để bàn khắc tên theo yêu cầu', '<p><em><strong>Bút bi kim loại để bàn khắc tên theo yêu cầu</strong></em></p>\n<p>Bút sử dụng theo&nbsp;cơ chế xoay thân để viết. Thích hợp với những người vừa ký và vừa viết lách hàng ngày.</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà hoàn hảo giúp đối tác luôn nhớ đến bạn đầu tiên.</p>\n<p>Bút thiết kế với thon 2 đầu đẹp mắt&nbsp;&nbsp;những đường nét chi tiết, tinh xảo mà vẫn giữ được nét đẹp thuần túy, toát lên vẻ tự tin, sang trọng cho người sử dụng.</p>\n<p>Đế để bàn có thể xoay tùy chỉnh, ngòi bút size 1.0.</p>\n<p>Màu xắc:&nbsp; Vàng, bạc, đồng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-1.jpg?v=1628500147292\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-2.jpg?v=1628500154800\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-3.jpg?v=1628500161353\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-4.jpg?v=1628500167679\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-6.jpg?v=1628501201979\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-bi-kim-loai-de-ban-5.jpg?v=1628501209398\" /></strong></em></p>', '', '', 'Bút bi kim loại để bàn khắc tên theo yêu cầu, ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22656961/but-bi-kim-loai-de-ban-khac-ten-theo-yeu-cau.jpg', '<p>Bút sử dụng theo&nbsp;cơ chế xoay thân để viết. Thích hợp với những người vừa ký và vừa viết lách hàng ngày.</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà hoàn hảo giúp đối t', '22656961', '50102778', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:39', '2024-05-29 06:11:39'),
(1119, 'moc-khoa-kim-loai-da-nang-hoa-tiet-quan-doi', 'Móc khóa kim loại đa năng họa tiết quân đội', '<p><em><strong>Móc khóa kim loại đa năng họa tiết quân đội</strong></em></p>\n<p>Móc khóa đa năng&nbsp;kèm dao, cưa, đèn led&nbsp;&nbsp;là món đồ tiện ích không thể bỏ lỡ của dân phượt, du lịch, câu cá, cắm trại, dã ngoại…</p>\n<p>Ngoài tác dụng treo chìa khóa, sản phẩm còn tích hợp lưỡi dao nhỏ khá bén để cắt dây, gọt đồ, đèn led sử dụng ban đêm.</p>\n<p>Kích thước vừa phải, khi cần thiết có thể xỏ dùng làm đấm gấu – như một công cụ tự vệ. Thao tác đóng mở dễ dàng, thiết kế đơn giản nhưng chú trọng hiệu năng.</p>\n<p>Bên ngoài là lớp sơn tĩnh màu họa tiết quân sự cực chất.</p>\n<p>kích thươc: gấp gọn 9*4.5CM, kích thước sử dụng 14.5CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v7.jpg?v=1628476849054\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v10.jpg?v=1628476857044\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v8.jpg?v=1628476867203\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v9.jpg?v=1628476873425\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v1032.jpg?v=1628477102986\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-da-nang-v101.jpg?v=1628477109237\" /></strong></em></p>', '', 'Móc khóa kim loại', 'móc khóa đa năng, Móc khóa kim loại, móc kim loại, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/22653154/moc-khoa-kim-loai-da-nang-hoa-tiet-quan-doi.jpg', '<p>Móc khóa đa năng&nbsp;kèm dao, cưa, đèn led&nbsp;&nbsp;là món đồ tiện ích không thể bỏ lỡ của dân phượt, du lịch, câu cá, cắm trại, dã ngoại…</p>\n<p>Ngoài tác dụng treo chìa khóa, sản phẩm', '22653154', '50091241', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:39', '2024-05-29 06:11:39'),
(1120, 'cho-canh-loi-than-hoat-tinh-khu-mui-trang-tri-de-taplo-o-to-ban-lam-viec', 'Chó cảnh lõi than hoạt tính khử mùi Trang trí để  taplo ô tô, bàn làm việc', '<p><em><strong>Chó cảnh lõi than hoạt tính khử mùi Trang trí để &nbsp;taplo ô tô, bàn làm việc</strong></em></p>\n<p>Chó cảnh lõi than hoạt tính khử mùi&nbsp;là phụ kiện tiện dụng không thể thiếu cho chiếc xe của bạn. Sản phẩm có thiết kế ngộ nghĩnh, đáng yêu đặc biệt gây thích thú cho trẻ nhỏ, có tính năng khử độc mang lại bầu không khí trong lành, sức khỏe tốt cho gia đình của bạn.</p>\n<p>Chất liệu: vải bông và bên trong là than hoạt tính.</p>\n<p>Phân loại chó đơn là các hạt than hoạt tính bên trong, Phân loại chó mẹ con bên trong lõi than hoạt tính được cho vào ngói nhỏ và tẩm hương nước hoa.</p>\n<p>Kích thước: chó mẹ con 26cm X 21cm X 10cm; chó đơn 24cm X 15cm X 9cm.</p>\n<p>Bạn có thể đặt chúng ở bất cứ đâu, trong phòng ngủ, phòng ăn, phòng khách, đặc biệt phù hợp khi sử dụng để trang trí trên chiếc xe thân yêu của bạn.</p>\n<p>Khi sử dụng khoảng 2-3 tháng bạn mang thú bông ra phơi nắng trong 1 ngày để tái tạo đặc tính hút mùi của than hoạt tính.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-3.jpg?v=1628216539081\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-1.jpg?v=1628216568976\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-2.jpg?v=1628216585176\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-8.jpg?v=1628216601776\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-4.jpg?v=1628216609580\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-taplo-5.jpg?v=1628216620223\" /></strong></em></p>', '', 'Chó cảnh lõi than hoạt tính khử mùi', 'Chó cảnh lõi than hoạt tính khử mùi, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Chó mẹ con', '', '', '', '', '', '', '', 'deny', '', '298000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22625301/cho-canh-loi-than-hoat-tinh-khu-mui-trang-tri-de-taplo-o-to-ban-lam-viec.jpg', '<p>Chó cảnh lõi than hoạt tính khử mùi&nbsp;là phụ kiện tiện dụng không thể thiếu cho chiếc xe của bạn. Sản phẩm có thiết kế ngộ nghĩnh, đáng yêu đặc biệt gây thích thú cho trẻ nhỏ', '22625301', '49959966', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:39', '2024-05-29 06:11:39'),
(1121, 'cap-sac-3-dau-dinh-da-cao-cap', 'Cáp sạc 3 đầu đính đá cao cấp', '<p><strong><em>Cáp sạc 3 đầu đính đá cao cấp</em></strong></p>\n<p>Tích hợp cùng một lúc 3 cổng&nbsp;kết nối Micro USB, Type-C và lightning dùng tiện lợi, tiết kiệm chi phí.</p>\n<p>Sử dụng để chép dữ liệu hay sạc pin (dùng với adapter riêng) cho các thiết bị tương thích.</p>\n<p>Sạc cùng lúc 3 thiết bị với dòng sạc tối đa&nbsp;2.4A&nbsp;nạp đầy pin&nbsp;nhanh chóng.</p>\n<p>Chiều dài dây 1.2m kết nối thuận tiện.</p>\n<p>Đầu dây được&nbsp;đính đá bề mặt&nbsp;sang trọng, mới lạ so với tất cả các cáp sạc thông thường trên thị trường.</p>\n<p>Phân loại: Dây bọc dù trắng, dây bọc dù đen, dây bọc silicon.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-3.jpg?v=1628069119845\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-5.jpg?v=1628069133622\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-4.jpg?v=1628069162151\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-2.jpg?v=1628069148311\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-8.jpg?v=1628069185444\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-3-dau-dinh-da-9.jpg?v=1659413513310\" /></em></strong></p>', '', 'Cáp sạc 3 đầu đính đá cao cấp', 'Cáp sạc 3 đầu đính đá cao cấp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Loại', 'Dây bọc dù trắng', '', '', '', '', '', '', '', 'deny', '', '128000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22612645/cap-sac-3-dau-dinh-da-cao-cap.jpg', '<p>Tích hợp cùng một lúc 3 cổng&nbsp;kết nối Micro USB, Type-C và lightning dùng tiện lợi, tiết kiệm chi phí.</p>\n<p>Sử dụng để chép dữ liệu hay sạc pin (dùng với adapter riêng) cho các thiết', '22612645', '69440979', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1122, 'combo-05-khay-uom-hat-giong-434-lo', 'Combo 05 Khay ươm hạt giống 434 lỗ', '<p><em><strong>Combo 05 Khay ươm hạt giống 434 lỗ</strong></em></p>\n<p>Công dụng: ươm hạt giống, độ bền cao, sử dụng được nhiều lần</p>\n<p>Số lỗ trồng: 343 lỗ</p>\n<p>Kích thước lỗ 60*33MM, đường kính lỗ 21MM, sâu 17MM.</p>\n<p>Chất liệu nhựa mỏng trong suốt.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-loai-nho-1.jpg?v=1628064743328\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-trong-1.jpg?v=1628065210821\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-trong-2.jpg?v=1628065217612\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-trong-3.jpg?v=1628065224286\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-trong-5.jpg?v=1628065231779\" /></strong></em></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/_aFjE6_Nz0c\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Khay ươm hạt giống 434 lỗ', 'Khay ươm hạt giống 434 lỗ, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22610851/combo-05-khay-uom-hat-giong-434-lo.jpg', '<p>Công dụng: ươm hạt giống, độ bền cao, sử dụng được nhiều lần</p>\n<p>Số lỗ trồng: 343 lỗ</p>\n<p>Kích thước lỗ 60*33MM, đường kính lỗ 21MM, sâu 17MM.</p>\n<p>Chất liệu nhựa mỏng trong suốt.</', '22610851', '49887385', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1123, 'meo-than-tai-dinh-da-nam-vay-tay-trang-tri-taplo-o-to', 'Mèo thần tài đính đá nằm vẫy tay trang trí taplo ô tô', '<p><strong><em>Mèo thần tài đính đá nằm vẫy tay trang trí taplo ô tô</em></strong></p>\n<p>Là chú mèo cầu may mắn, tài lộc nổi tiếng đến từ Nhật Bản. Với tay đung đưa, vẫy nhẹ nhàng, sẽ mang đến rất nhiều điều tốt đẹp tới cho gia chủ.</p>\n<p>Với các biểu tượng mang ý nghĩa tài lộc, may mắn trong phong thủy và nét mặt tươi cười, mèo thần tài mang tới một không khí vui tươi, náo nhiệt, cũng như sự bội thu trong kinh doanh buôn bán.</p>\n<p>Mèo Thần Tài Nằm Vẫy Tay&nbsp;màu trắng màu của sự tinh khiến, cao quý sẽ mang đến tiền tài, thu hút khách hàng, thúc đẩy hiệu quả của việc kinh doanh, buôn bán. Đặc biệt mèo giơ tay càng cao, vẫy càng nhiều thì càng nhiều may mắn&nbsp;</p>\n<p>Mèo Thần Tài Nằm Vẫy Tay&nbsp;chạy bằng năng lượng mặt trời vẫy tay quanh năm không cần dùng pin hay điện,&nbsp;thích hợp để taplo xe ô tô,&nbsp;&nbsp;tại bàn làm việc...</p>\n<p>Kích thước: 11*7*6.5CM, thảm 20*13CM, bong bóng 11.5*5.5CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/meo-than-tai-dinh-da-gan-taplo-o-to-3.jpg?v=1628041586627\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/meo-than-tai-dinh-da-gan-taplo-o-to-2.jpg?v=1628041566969\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/meo-than-tai-dinh-da-gan-taplo-o-to-4.jpg?v=1628041576555\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/meo-than-tai-dinh-da-gan-taplo-o-to-1.jpg?v=1628041558476\" /></p>', '', 'Mèo thần tài đính đá', 'mèo thần tài, Mèo thần tài đính đá, mèo thần tài trang trí taplo, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '280000', '', '', '', '', NULL, '', '', '', '', 'kg', 'images/22602958/meo-than-tai-dinh-da-nam-vay-tay-trang-tri-taplo-o-to.jpg', '<p>Với các biểu tượng mang ý nghĩa tài lộc, may mắn trong phong thủy và nét mặt tươi cười, mèo thần tài mang tới một không khí vui tươi, náo nhiệt, cũng như sự bội thu trong kinh doanh buôn b', '22602958', '49857658', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1124, 'combo-20-gat-phao-gan-ngon-phao-cau-don-phan-quang', 'Combo 20 Hạt phao gắn ngọn phao câu đơn phản quang', '<p><strong><em>Combo 20 Hạt phao gắn ngọn phao câu đơn phản quang</em></strong></p>\n<p>Hạt phao gắn ngọn phao giúp tăng tầm nhìn xa khi câu đơn, phản quang trong câu đêm.</p>\n<p>Có thể dử dụng làm phao câu.</p>\n<p>Kích thước: 1.5*0.4CM.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-phao-gan-ngon-phao-cau-dai-1.jpg?v=1627900079894\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-phao-gan-ngon-phao-cau-dai-4.jpg?v=1627900353497\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-phao-gan-ngon-phao-cau-dai-5.jpg?v=1627900824336\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-phao-gan-ngon-phao-cau-dai-2.jpg?v=1627900363751\" /></em></strong></p>', '', 'Hạt phao gắn ngọn phao', 'Combo 20 Hạt phao gắn ngọn phao câu đơn phản quang, hạt gắn ngọn phao, Hạt phao gắn ngọn phao, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '15000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/22594888/combo-20-gat-phao-gan-ngon-phao-cau-don-phan-quang.jpg', '<p>Hạt phao gắn ngọn phao giúp tăng tầm nhìn xa khi câu đơn, phản quang trong câu đêm.</p>\n<p>Có thể dử dụng làm phao câu.</p>\n<p>Kích thước: 1.5*0.4CM.</p>', '22594888', '49834996', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1125, 'but-ky-kim-loai-khac-ten-theo-yeu-cau-bk3', 'Bút ký kim loại khắc tên theo yêu cầu BK3', '<p><em><strong>Bút ký kim loại khắc tên theo yêu cầu BK3</strong></em></p>\n<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà hoàn hảo giúp đối tác luôn nhớ đến bạn đầu tiên.</p>\n<p>Đây là loại bút dòng ruột bi, thay thế khi sử dụng hết mực với cơ chế xoay nắp để viết. Thích hợp với những người vừa ký và vừa viết lách hàng ngày.</p>\n<p>Bút bi Parker được thiết kế với những đường nét chi tiết, tinh xảo mà vẫn giữ được nét đẹp thuần túy, toát lên vẻ tự tin, sang trọng cho người sử dụng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/1-7ac6acb5-621b-4788-96fe-2efacea64bbe.jpg?v=1627890331495\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-6b4b534f-865d-4f53-b325-ea7ebbf0359d.jpg?v=1627890346138\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/2-2331559a-6d95-44b9-b5aa-7ef2fce50e35.jpg?v=1627891390967\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-519aa22a-07e3-4e4e-ae17-debb91d7d3d6.jpg?v=1627891398722\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Bút ký kim loại', 'bút bi, bút ki, bút kim loại, bút ký, bút ký khắc tên, Bút ký kim loại khắc tên theo yêu cầu BK3, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.4', 'kg', 'images/22593503/but-ky-kim-loai-khac-ten-theo-yeu-cau-bk3.jpg', '<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà ho', '22593503', '49827441', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1126, 'kep-dien-thoai-dinh-da-360-gan-taplo-kep-khe-gio-xe-o-to', 'Kẹp điện thoại đính đá 360 gắn taplo, kẹp khe gió xe ô tô', '<p><strong><em>Kẹp điện thoại đính đá 360 gắn taplo, kẹp khe gió xe ô tô</em></strong></p>\n<p>Điều khiển xe ô tô khiến bạn khó sử dụng các thiết bị di động, smartphone như điện thoại hay máy tính bảng,.. Vì vậy, tìm một chiếc giá đỡ phù hợp thuận tiện sẽ giúp bạn thao tác dễ dàng và chuẩn xác hơn khi lái xe.</p>\n<p>Chất liệu nhựa&nbsp;ABS cao cấp đính đá bên ngoài đẹp lung linh, sang trọng.</p>\n<p>Phù hợp cho hầu hết các dòng điện thoại từ 3-8 inch.</p>\n<p>Tháo lắp nhanh gọn. Giá đỡ có thể dán&nbsp;trên taplo, kính lái&nbsp;hoặc kẹp trong khe gió đều được.</p>\n<p>Kích thước: 8.5*3.5CM.</p>\n<p>Màu sắc: màu trắng, màu trắng đen.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoai-dinh-da-1.jpg?v=1644377890780\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoai-dinh-da-gan-tapto-gan-cua-gio-dieu-hoa-o-to-3.jpg?v=1627723124047\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoai-dinh-da-gan-tapto-gan-cua-gio-dieu-hoa-o-to-1.jpg?v=1627723070141\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kep-dien-thoai-dinh-da-gan-tapto-gan-cua-gio-dieu-hoa-o-to-4.jpg?v=1627723357140\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/CW6b_B_ctl8\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Kẹp điện thoại đính đá', 'Kẹp điện thoại đính đá, Kẹp điện thoại đính đá 360 gắn taplo, kẹp khe gió xe ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Trắng', '', '', '', '', '', '', '', 'deny', '', '155000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22581786/kep-dien-thoai-dinh-da-360-gan-taplo-kep-khe-gio-xe-o-to.jpg', '<p>Chất liệu nhựa&nbsp;ABS cao cấp đính đá bên ngoài đẹp lung linh sang trọng.</p>\n<p>Phù hợp cho hầu hết các dòng điện thoại từ 3-8 inch.</p>\n<p>Tháo lắp nhanh gọn. Giá đỡ có thể dán&nbsp;tr', '22581786', '49783968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1127, 'khay-uom-hat-giong-cay-giong', 'Combo 05 Khay ươm hạt giống, cây giống', '<p><em><strong>Combo 05 Khay ươm hạt giống, cây giống</strong></em></p>\n<p>Dùng khay ươm cây rút ngắn được thời gian chăm sóc từ 5 – 7 ngày. Không mất thời gian để cây bén rễ.</p>\n<p>Ươm cây trong khay dễ chăm sóc hơn, không sợ sâu bệnh, chuột bọ phá hoại.</p>\n<p>Tỷ lệ nảy mầm của hạt cao hơn, đảm bảo hạt giống luôn được khỏe mạnh.</p>\n<p>&nbsp;Dễ dàng di chuyển cây con, không ảnh hưởng đến cây.</p>\n<p>Thuận tiện cho vườn ươm số lượng lớn.</p>\n<p>Chất liệu nhựa tấm.</p>\n<p>Kích thước chia làm 5&nbsp;loại:&nbsp;</p>\n<ul>\n<li>38 lỗ 57*32CM, đường kính lỗ 6CM, sâu 3CM, mật độ cây 7CM.</li>\n<li>54 lỗ 57*32CM, đường kính lỗ 5CM, sâu 2CM, mật độ cây 5.7CM.</li>\n<li>60 lỗ 56.5*35CM, đường kính lỗ 4.7CM, sâu 2CM, mật độ cây 5.4CM.</li>\n<li>70 lỗ 55*35CM, đường kính lỗ 4.5CM, sâu 1.6CM, mật độ cây 5CM.</li>\n<li>100 lỗ 58*32CM, đường kính lỗ 3.7CM, sâu 1.5CM, mật độ cây 4.2CM.</li></ul>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-7.jpg?v=1627699833759\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-5.jpg?v=1627699840563\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-10.jpg?v=1627701233291\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-9.jpg?v=1627701244520\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khay-uom-hat-giong-8.jpg?v=1627701251682\" /></strong></em></p>\n<p><em><strong