(1128, 'but-laze-da-nang', 'Bút Laser Trình Chiếu Vỏ Kim Loại đa năng (vừa viết vừa làm thước vừa có 2 đèn lazer)', '<p><em><strong>Bút Laser Trình Chiếu Vỏ Kim Loại đa năng (vừa viết vừa làm thước vừa có 2 đèn lazer)</strong></em></p>\n<p>Bút Laser Trình&nbsp;chiếu tiện lợi dùng cho giảng viên, giáo viên, sinh viên bảo vệ đồ án, nhân viên VP trình bày kế hoạch...</p>\n<p>Bút dài 15cm, kéo dài 45cm.</p>\n<p>Chế độ Lazer có tác dụng như trong cuộc họp chỉ bảng, dạy học chỉ bảng từ xa,...Chế độ đèn pin dành cho ae sử dụng lúc trời tối.</p>\n<p>Ngoài ra kéo dài ra được 45cm, giúp cho ae chỉ bảng để giảng dạy, hướng dẫn,...</p>\n<p>Có hộp nhôm để đựng bút, thêm 3 viên pin dự phòng nếu hết pin.</p>\n<p>Shop có dịch vụ khắc laser chữ, logo nội dung theo yêu cầu&nbsp;lên thân bút rất phù hợp sử dụng làm quà tặng tri ân thầy cô vào các ngày lễ.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-2-f884abdb-9647-464a-bde0-5587cb901cd8.jpg?v=1627608289204\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-7.jpg?v=1627636529398\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-8.jpg?v=1627636538965\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-3.jpg?v=1627608269332\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-6.jpg?v=1627636583517\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-1-e1aeff8c-1bb3-4220-b967-9d0ca3518796.jpg?v=1627608298118\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-4.jpg?v=1627608310310\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-thuoc-laser-da-nang-5.jpg?v=1627608310977\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/6flW8WNqioA\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Bút Laser Trình Chiếu', 'bút laser, bút laser đa năng, ô tô, thước trình chiếu, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22562836/but-laze-da-nang.jpg', '<p>Bút dài 15cm, kéo dài 45cm</p>\n<p>Chế độ Lazer có tác dụng như trong cuộc họp chỉ bảng, dạy học chỉ bảng từ xa,...Chế độ đèn pin dành cho ae sử dụng lúc trời tối</p>\n<p>Ngoài ra kéo dài ra', '22562836', '49528200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:40', '2024-05-29 06:11:40'),
(1129, 'dong-ho-treo-tuong-decor-khac-nhung-cau-noi-noi-tieng', 'Đồng hồ treo tường Decor khắc những câu nói nổi tiếng', '<p><em><strong>Đồng hồ treo tường Decor khắc những câu nói nổi tiếng</strong></em></p>\n<p>Chiếc đồng hồ treo tường được khắc câu nói nổi tiếng \"gia đình là thứ tồn tại duy nhất. Còn những cái khác, có hay không, không quan trọng\"</p>\n<p>Máy đồng hồ là loại máy kim trôi nhập từ Taiwan có độ chính xác cao và không phát ra tiếng động lạch cạch khi đêm xuống.</p>\n<p>Kim đồng hồ bao gồm 2 kim (kim giờ và kim phút) được làm từ gỗ&nbsp;không bị cong vênh, không gây ra tiếng tích tắc khó chịu cho bạn khi ngủ hay làm việc.</p>\n<p>Sản phẩm phù hợp để sử dụng cho nhiều không gian khác nhau như: nhà ở, văn phòng, quán cafe, nhà hàng, khách sạn,... Bạn có treo chúng ở nhiều nơi như phòng ngủ, phòng khách, nhà bếp, ban công, phòng làm việc hay bất cứ nơi nào bạn muốn.</p>\n<p>Kích thước: 29.5*0.3CM</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v3.jpg?v=1627541253650\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v1.jpg?v=1627541775616\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v2-7b205807-9de5-433d-996c-3e1fffb223b3.jpg?v=1627541781660\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/v4.jpg?v=1627541787588\" /></p>', '', 'Đồng hồ treo tường Decor khắc những câu nói nổi tiếng', 'Đồng hồ treo tường, Đồng hồ treo tường Decor khắc những câu nói nổi tiếng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22559221/dong-ho-treo-tuong-decor-khac-nhung-cau-noi-noi-tieng.jpg', '<p>Chiếc đồng hồ treo tường được khắc câu nói nổi tiếng \"gia đình là thứ tồn tại duy nhất. Còn những cái khác, có hay không, không quan trọng\"</p>\n<p>Máy đồng hồ là loại máy kim trôi nhập từ ', '22559221', '49515547', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1130, 'op-lung-silicon-lot-nhung-iphone-khac-chu-5-dieu-sep-day-khac-laser-theo-yeu-cau', 'Ốp lưng Silicon Lót Nhung Iphone khắc 5 Điều sếp dạy - Khắc laser theo yêu cầu', '<p><em><strong>Ốp lưng Silicon Lót Nhung Iphone khắc 5 Điều sếp dạy - Khắc laser theo yêu cầu</strong></em></p>\n<p>Chất liệu và thiết kế dày dặn&nbsp;Có lót nhung chống sốc, chống trày sướt máy, bảo vệ máy khi va chạm</p>\n<p>Full viền bảo vệ camera và loa. Tính năng chống bụi bẩn, vệ sinh dễ dàng bằng khăn ướt.</p>\n<p>Ốp lưng khắc cổ động “5 điều sếp dạy” tạo động lực thú vị, sáng tạo và độc đáo sẽ giúp bạn tươi vui và phấn khởi hơn trong công việc.</p>\n<p>Khắc laser đảm bảo ốp lưng không bị bay màu như in màu bình thường giúp lưu gữ nộ&nbsp;dung khắc theo thời gian.</p>\n<p>Shop còn có dịch vụ khắc ốp theo yêu cầu của khắc hàng như: tên, số điện thoại, hình....</p>\n<p>Phân loại: Iphone 11.&nbsp;Iphone 12,&nbsp;Iphone 11 pro,&nbsp;Iphone 12 pro,&nbsp;Iphone 11 pro max,&nbsp;Iphone 12 pro max.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-dieu-5.jpg?v=1627528195415\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-dieu-6.jpg?v=1627528196301\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-dieu-2.jpg?v=1627528205978\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-dieu-3.jpg?v=1627528211682\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/5-dieu-4.jpg?v=1627528217304\" /></strong></em></p>', '', 'Ốp lưng Silicon Lót Nhung', 'ô tô, Ốp lưng Silicon Lót Nhung, Ốp lưng Silicon Lót Nhung Iphone khắc chữ 5 Điều sếp dạy, Ốp lưng Silicon Lót Nhung Iphone khắc chữ 5 Điều sếp dậy - Khắc laser theo yêu cầu, Volcano, volcano', '1', 'Phân loại', 'IP 11', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22558316/op-lung-silicon-lot-nhung-iphone-khac-chu-5-dieu-sep-day-khac-laser-theo-yeu-cau.jpg', '<p>Chất liệu và thiết kế dày dặn&nbsp;Có lót nhung chống sốc, chống trày sướt máy, bảo vệ máy khi va chạm</p>\n<p>Full viền bảo vệ camera và loa. Tính năng chống bụi bẩn, vệ sinh dễ dàng bằng ', '22558316', '49514261', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1131, 'huan-chuong-kim-loai-khac-noi-dung-theo-yeu-cau', 'Huân chương kim loại khắc nội dung theo yêu cầu', '<p><strong><em>Huân chương kim loại khắc nội dung theo yêu cầu</em></strong></p>\n<p>Huân chương vàng chất liệu kim loại chưa khắc hay dán tên lên sản phẩm.</p>\n<p>Sản phẩm&nbsp;chia 2 phần bảng tên và logo go danh hiệu được ghim bằng kim băng phía sau.</p>\n<p>Dịch vụ khắc laser theo yêu cầu lên sản phẩm theo yêu cầu: khắc tên, logo, số điện thoại,...</p>\n<p>Phân loại thành 2 loại H01 đường kính 4.5 dày 0.3CM, H02&nbsp;đường kính 4.5 dày 0.5CM</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/huan-chuong-kim-loai-3.jpg?v=1627357189956\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/huan-chuong-kim-loai-2.jpg?v=1627357197148\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/huan-chuong-kim-loai-1.jpg?v=1627357203286\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/huan-chuong-kim-loai-4.jpg?v=1627357212977\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/huan-chuong-kim-loai-5.jpg?v=1627357220011\" /></em></strong></p>', '', 'Huân chương kim loại', 'huân chương kim loại, Huân chương kim loại khắc nội dung theo yêu cầu, huân chương vàng, huy chương vàng, Volcano, volcano.vn', '1', 'Phân loại', 'H01', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22541157/huan-chuong-kim-loai-khac-noi-dung-theo-yeu-cau.jpg', '<p>Huân chương vàng chất liệu kim loại chưa khắc hay dán tên lên sản phẩm.</p>\n<p>Sản phẩm&nbsp;chia 2 phần bảng tên và logo go danh hiệu được ghim bằng kim băng phía sau.</p>\n<p>Dịch vụ khắc', '22541157', '49427120', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1132, 'hop-kinh-trong-cay-canh-decor', 'Hộp kính trồng cây cảnh decor', '<p><em><strong>Hộp kính trồng cây cảnh decor</strong></em></p>\n<p>Hộp kính trồng cây&nbsp;là&nbsp;sản phẩm thủ công tinh tế, được chế tác bằng phương pháp ghép kính cổ điển của Châu Âu.</p>\n<p>Hộp có hình đa giác có cánh cửa,&nbsp;món đồ dùng trang trí cho văn phòng, góc làm việc, học tập hoặc bất cứ nơi nào bạn thích.</p>\n<p>Bạn có thể trồng các loại cây yêu thích như sen đá, hoặc xương rồng, chỉ cần trang trí thêm 1 vài phụ kiện là có được 1 chậu cây cảnh xịn xò do chính tay mình trồng.</p>\n<p>Kích thước: 16*10CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-kinh-decor-2.jpg?v=1627274230696\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-kinh-decor-3.jpg?v=1627274237946\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-kinh-decor-1.jpg?v=1627274244830\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-kinh-decor-5.jpg?v=1627275590001\" /></p>', '', 'Hộp kính trồng cây cảnh decor', 'hộp kính decor, Hộp kính trong cây cảnh decor, Hộp kính trồng cây cảnh decor, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '299000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22533390/hop-kinh-trong-cay-canh-decor.jpg', '<p>Hộp kính trồng cây&nbsp;là&nbsp;sản phẩm thủ công tinh tế, được chế tác bằng phương pháp ghép kính cổ điển của Châu Âu.</p>\n<p>Hộp có hình đa giác có cánh cửa,&nbsp;món đồ dùng trang trí c', '22533390', '49402656', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1133, 'am-pha-cafe-moka-pot-kieu-italia', 'Ấm Pha Cafe Moka Pot kiểu Italia', '<p><em><strong>Ấm Pha Cafe Moka Pot&nbsp;kiểu Italia</strong></em></p>\n<p>Cách pha cà phê bằng ấm moka kiểu Italia được đánh giá là tạo ra nước cà phê ngon hơn hẳn so với cách pha cà phê bằng phin kiểu Pháp. Hơi nước nhiệt độ cao và áp suất trong bình đã chiết xuất gần như toàn bộ tinh túy của hạt cà phê, đồng thời loại bớt a xít và vị đắng, để tạo ra những tách Espresso thơm ngon.</p>\n<p>Sản phẩm được làm từ chất liệu&nbsp;nhôm an toàn tuyệt đối cho người dùng.</p>\n<p>Kích thước: 150ML cao 14.5CM, rộng 8CM; 300ML&nbsp;cao 18.5CM, rộng 9CM; 450ML cao 21.5CM, rộng 12CM. 600ML cao 24CM, rộng 12CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-3.jpg?v=1626947680688\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-4.jpg?v=1626949405225\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-1.jpg?v=1626947688215\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-2.jpg?v=1626947696281\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-5-f80f3851-b391-4b21-95e8-bda459a5e657.jpg?v=1627007366814\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-moka-pha-cafe-v14.jpg?v=1626950196742\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/w4wSYWDr46c\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Ấm Pha Cafe Moka Pot', 'ấm cafe, ấm pha cafe, Ấm Pha Cafe Moka Pot, Ấm Pha Cafe Moka Pot kiểu Italia, Volcano, volcano.vn', '1', 'Kích thước', '150ml', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/22499452/am-pha-cafe-moka-pot-kieu-italia.jpg', '<p>Cách pha cà phê bằng ấm moka kiểu Italia được đánh giá là tạo ra nước cà phê ngon hơn hẳn so với cách pha cà phê bằng phin kiểu Pháp. Hơi nước nhiệt độ cao và áp suất trong bình đã chiết x', '22499452', '49289203', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1134, 'phin-cafe-inox-khac-laser-ten-logo-theo-yeu-cau', 'Phin cafe Inox LC1 khắc laser tên logo theo yêu cầu', '<p><strong><em>Phin cafe Inox LC1 khắc laser tên logo theo yêu cầu</em></strong></p>\n<p>Chất liệu Inox 100%, có lọc rời dễ vệ sinh.</p>\n<p>Kích thước: Loại lớn đường kính cốc 80MM, đường kính đáy 73MM, cao 64CM.</p>\n<p>Loại nhỏ&nbsp;đường kính cốc 70MM, đường kính đáy 63MM, cao 50CM.</p>\n<p>Dịch vụ khắc laser tên logo lên thân và nắp&nbsp;theo yêu cầu.</p>\n<p>Phù hợp sử dụng trong gia đình, làm quà tặng, sử dụng cho các tiệm quán Cafe....</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phin-cafe-1.jpg?v=1626940897284\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phin-cafe-3.jpg?v=1626940967148\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phin-cafe-2.jpg?v=1626940973781\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phin-cafe-4.jpg?v=1626942794538\" /></em></strong></p>\n<p>&nbsp;</p>', '', 'Phin cafe Inox', 'phin cafe, phin cafe inox, Phin cafe Inox LC1 khắc laser tên logo theo yêu cầu, Volcano, volcano.vn', '1', 'Kích thước', '50ml', 'Phân loại', 'Tiêu chuẩn', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22492980/phin-cafe-inox-khac-laser-ten-logo-theo-yeu-cau.jpg', '<p>Chất liệu Inox 100%, có lọc rời dễ vệ sinh.</p>\n<p>Kích thước: Loại lớn đường kính cốc 80MM, đường kính đáy 73MM, cao 64CM.</p>\n<p>Loại nhỏ&nbsp;đường kính cốc 70MM, đường kính đáy 63MM, c', '22492980', '49269104', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,