(1136, 'but-ky-kim-loai-khac-ten-theo-yeu-cau-bk2', 'Bút ký kim loại khắc tên theo yêu cầu BK2', '<p><em><strong>Bút ký kim loại khắc tên theo yêu cầu BK2</strong></em></p>\n<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà hoàn hảo giúp đối tác luôn nhớ đến bạn đầu tiên.</p>\n<p>Đây là loại bút dòng ruột bi, thay thế khi sử dụng hết mực với cơ chế xoay nắp để viết. Thích hợp với những người vừa ký và vừa viết lách hàng ngày.</p>\n<p>Bút bi Parker được thiết kế với những đường nét chi tiết, tinh xảo mà vẫn giữ được nét đẹp thuần túy, toát lên vẻ tự tin, sang trọng cho người sử dụng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-d4.jpg?v=1626861740125\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-d3.jpg?v=1626861746361\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-d2.jpg?v=1626861752653\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/but-ky-d1.jpg?v=1626861759795\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Bút ký kim loại khắc tên theo yêu cầu', 'bút khắc tên, bút kim loại khắc laser, bút ký khắc tên, ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22488664/but-ky-kim-loai-khac-ten-theo-yeu-cau-bk2.jpg', '<p>Bút ký là quà tặng sinh nhật, lễ kỉ niệm, ngày lễ lớn. Như ngày Quốc tế phụ nữ 08/03, ngày 20/10 hay ngày lễ nhà giáo 20/11….</p>\n<p>khắc laser logo hoặc tên người được tặng. Là món quà ho', '22488664', '49261468', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1137, 'thung-dung-do-gan-duoi-xe-may-xe-dien-td05', 'Thùng đựng đồ gắn đuôi xe máy, xe điện TD05', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy, xe điện TD05</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích khá lớn&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen nhám phối mắt giả màu đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 40*40*29CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-td06-d2.jpg?v=1626836026534\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-td06-d3.jpg?v=1626836033306\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-td06-d1.jpg?v=1626836039594\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-444-7cd0bc85-4c9d-40f0-a4dd-5785c0453fa8-2a5b0867-d450-4f74-a029-da8bbd0ae4ec.jpg?v=1622433922012\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Thùng đựng đồ', 'phụ kiện xe máy, THÙNG đồ xe máy, Thùng đựng đồ gắn đuôi xe máy, thùng đựng đồ xe máy, Volcano, volcano.vn, xe điện TD05, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/22482549/thung-dung-do-gan-duoi-xe-may-xe-dien-td05.jpg', '<p>Dung tích khá lớn&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, ', '22482549', '49222029', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:41', '2024-05-29 06:11:41'),
(1138, 'tuan-loc-nuoc-hoa-de-taplo-trang-tri-xe-o-to', 'Tuần Lộc nước hoa để taplo trang trí xe ô tô', '<p><em><strong>Tuần Lộc nước hoa để taplo trang trí xe ô tô</strong></em></p>\n<p>Bộ sản phẩm gồm 02 tuần lộc và 1 lọ đựng tinh dầu nước hoa, tặn kèm 1 lọ tinh dầu nước hoa, 01 miếng lót taplo gắn lông vũ đẹp mắt.</p>\n<p>Chất liệu làm từ nhựa sơm màu tinh xảo.</p>\n<p>Bộ sản phẩm sử dụng để taplo ô tô, để bàn trang trí đem lại may mắn.</p>\n<p>kích thước: tuần lộc 65*112CM, 60*95CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuan-loc-trang-tri-taplo-o-to-1.jpg?v=1626406360816\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuan-loc-trang-tri-taplo-o-to-v911juu.jpg?v=1626427702518\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuan-loc-trang-tri-taplo-o-to-v5.jpg?v=1626401878689\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuan-loc-trang-tri-taplo-o-to-3.jpg?v=1626427743011\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuan-loc-trang-tri-taplo-o-to-4.jpg?v=1626427750021\" /></strong></em></p>', '', 'Tuần Lộc nước hoa để taplo trang trí xe ô tô', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22400510/tuan-loc-nuoc-hoa-de-taplo-trang-tri-xe-o-to.jpg', '<p>Bộ sản phẩm gồm 02 tuần lộc và 1 lọ đựng tinh dầu nước hoa, tặn kèm 1 lọ tinh dầu nước hoa, 01 miếng lót taplo gắn lông vũ đẹp mắt.</p>\n<p>Chất liệu làm từ nhựa sơm màu tinh xảo.</p>\n<p>Bộ', '22400510', '48871507', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:42', '2024-05-29 06:11:42'),
