(1140, 'theo-day-cap-thep-cau-ca-chim-ca-tra-dai-10-day-dai-50cm', 'Thẻo dây cáp thép câu cá chim, cá tra 5 dây dài 50CM', '<p><em><strong>Thẻo dây cáp thép câu cá chim, cá tra 5 dây dài 50CM</strong></em></p>\n<p>Thẻo câu dây cáp chất liệu&nbsp;thép không&nbsp;gỉ&nbsp;bọc nhựa màu.</p>\n<p>Kích thước dài 30CM vó sẵn khóa.</p>\n<p>Màu sắc: đen, đỏ, xanh.</p>\n<p>Giá sản phẩm 5 thẻo.</p>\n<p><b style=\"font-style: italic;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-7.jpg?v=1626161172437\" /></b></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-2.jpg?v=1626161179324\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-3.jpg?v=1626161185456\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-5.jpg?v=1626161191287\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-6.jpg?v=1626161198564\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/theo-cap-cau-ca-1.jpg?v=1626161204682\" /></strong></em></p>', '', 'Thẻo dây cáp thép câu cá chim, cá tra dài 10 dây dài 50CM', 'câu cá, ô tô, phụ kiện câu cá, thẻo cáp câu cá, theo câu cá chim, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22358164/theo-day-cap-thep-cau-ca-chim-ca-tra-dai-10-day-dai-50cm.jpg', '<p>Thẻo câu dây cáp chất liệu&nbsp;thép không&nbsp;gỉ&nbsp;bọc nhựa màu.</p>\n<p>Kích thước dài 30CM vó sẵn khóa.</p>\n<p>Màu sắc: đen, đỏ, xanh.</p>\n<p>Giá sản phẩm 5 thẻo.</p>', '22358164', '48759391', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:42', '2024-05-29 06:11:42'),
(1141, 'bo-can-cau-but-mini-1m-fish-pen', 'Bộ cần câu bút mini 1M Fish Pen', '<p><strong><em>Bộ cần câu bút mini 1M Fish Pen</em></strong></p>\n<p>Được thiết kế như 1 chiếc bút máy, khi không sử dụng có thể nắp lại, vừa tiện lợi lại không bị móc vào đâu gây hỏng hóc cần.</p>\n<p>Máy ngang được đặt trên cần câu giúp tạo thêm lực bẩy phụ, làm tăng áp lực lên cá. Hệ thống hãm dây được kích hoạt ngay lập tức khi dây tuôn thẳng ra khỏi ổ cước, giúp cảm nhận mồi câu rất tốt mà không tốn nhiều sức lực.</p>\n<p>Vỏ ngoài của sản phẩm được làm từ hợp kim nhôm cao cấp, siêu nhẹ và có độ bền cao. Vật liệu trục câu được làm từ sợi thủy tinh Epoxy có đặc tính chịu nén, chịu mài mòn, chịu căng tốt,....phù hợp với nhu cầu câu ao, suối hay đi dã ngoại...</p>\n<p>Trọng lượng cần câu bút mini siêu nhẹ, chỉ 170g, thiết kế vô cùng độc đáo như một chiếc bút nhỏ, có ghim cài, thuận tiện bỏ vào túi quần, túi áo hoặc bỏ vào túi xách nhỏ mang theo khắp mọi nơi.</p>\n<p>Máy câu ngang tay trái 2.1:1</p>\n<p>Kích thước cần: sử dụng 1M thu ngọn 20CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-but-kem-may-cau-3.jpg?v=1626146518796\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-but-kem-may-cau-1.jpg?v=1626146529383\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-but-kem-may-cau-2.jpg?v=1626146529841\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-but-kem-may-cau-4.jpg?v=1626146549448\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-but-kem-may-cau-5.jpg?v=1626148125045\" /></p>', '', 'Bộ cần câu bút mini 1M Fish Pen', 'Bộ cần câu bút mini 1M Fish Pen, cần bút, cần bút mini, cần câu bút, cần câu cá, câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '220000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22355423/bo-can-cau-but-mini-1m-fish-pen.jpg', '<p>Máy ngang được đặt trên cần câu giúp tạo thêm lực bẩy phụ, làm tăng áp lực lên cá.</p>\n<p>Vỏ ngoài của sản phẩm được làm từ hợp kim nhôm cao cấp, siêu nhẹ và có đ', '22355423', '48749946', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:43', '2024-05-29 06:11:43'),
(1142, 'op-lung-silicon-iphone-khac-laser-theo-yeu-cau', 'Ốp lưng silicon lót nhung Iphone Khắc laser theo yêu cầu', '<p><em><strong>Ốp lưng silicon lót nhung Iphone Khắc laser theo yêu cầu</strong></em></p>\n<p>Chất liệu và thiết kế dày dặn&nbsp;Có lót nhung chống sốc, chống trày sướt máy, bảo vệ máy khi va chạm</p>\n<p>Full viền bảo vệ camera và loa. Tính năng chống bụi bẩn, vệ sinh dễ dàng bằng khăn ướt.</p>\n<p>Khắc laser theo yêu cầu: tên, số điện thoại, logo, mã QR, hình ảnh theo mẫu...Sản phẩm được khắc và gửi sau 1h chốt đơn.</p>\n<p>Màu sắc: Đen, đỏ đô, đỏ cam</p>\n<p>Phân loại: Iphone 11.&nbsp;Iphone 12,&nbsp;Iphone 11 pro,&nbsp;Iphone 12 pro,&nbsp;Iphone 11 pro max,&nbsp;Iphone 12 pro max.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-ip-11-12-v13.jpg?v=1626079424452\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-ip-11-12-v15.jpg?v=1626079424995\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-ip-11-12-v16.jpg?v=1626079425506\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-ip-11-12-v2.jpg?v=1626079445663\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-ip-11-12-v6.jpg?v=1626079466900\" /></strong></em></p>', '', 'Ốp lưng silicon lót nhung Iphone', 'ốp ip, op lung 12 pro, op lung ip 11, ôp lung ip 12, Ốp lưng silicon lót nhung Iphone Khắc laser theo yêu cầu, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Loại', 'iPhone12', '', '', '', '', '0', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22324158/op-lung-silicon-iphone-khac-laser-theo-yeu-cau.jpg', '<p>Chất liệu và thiết kế dày dặn&nbsp;Có lót nhung chống sốc, chống trày sướt máy, bảo vệ máy khi va chạm</p>\n<p>Full viền bảo vệ camera và loa. Tính năng chống bụi bẩn, vệ sinh dễ dàng bằng ', '22324158', '48599109', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:43', '2024-05-29 06:11:43'),
(1143, 'den-led-gan-mu-luoi-trai-di-cau-ca', 'Đèn led gắn mũ lưỡi trai đi câu cá TA-008', '<p><em><strong>Đèn led gắn mũ lưỡi trai đi câu cá TA-008</strong></em></p>\n<p>Chất liệu vỏ : Nhựa ABS cao cấp chống thấm nước tốt</p>\n<p>Thiết kế công tắc on/off tiện dụng với 2 chế độ đèn ánh sáng trắng.</p>\n<p>Đèn được trang bị bởi 5 hạt đèn led, nguồn ánh sáng trắng, phạm vi cao và xa.&nbsp;</p>\n<p>Sử dụng pin CR2032.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-gan-mu-doi-dau-v12.jpg?v=1625883391587\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-gan-mu-doi-dau-v11.jpg?v=1625883397563\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-gan-mu-doi-dau-v9.jpg?v=1625883406652\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-gan-mu-doi-dau-v8.jpg?v=1625883414728\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-doi-gan-mu-doi-dau-v10.jpg?v=1625883420751\" /></strong></em></p>', '', 'Đèn led gắn mũ lưỡi trai', 'đèn đo ccaau, đèn led gắn mũ lưới trai, Đèn led gắn mũ lưỡi trai đi câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22322077/den-led-gan-mu-luoi-trai-di-cau-ca.jpg', '<p>Chất liệu vỏ : Nhựa ABS cao cấp chống thấm nước tốt</p>\n<p>Thiết kế công tắc on/off tiện dụng với 2 chế độ đèn ánh sáng trắng.</p>\n<p>Đèn được trang bị bởi 5 hạt đèn led, nguồn ánh sáng tr', '22322077', '4