(1148, 'tui-doi-dung-do-treo-suon-xe-dap-da-nang-chong-nuoc', 'Túi đôi đựng đồ treo sườn xe đạp đa năng chống nước', '<p><em><strong>Túi đôi đựng đồ treo sườn xe đạp đa năng chống nước</strong></em></p>\n<p>Túi đựng đồ treo sườn xe đạp đa năng chống nước cao cấp&nbsp;phụ kiện xe đạp này sẽ giúp bạn tăng độ tiện lợi đồng thời bảo vệ bạn tốt hơn trong quá trình sử dụng.</p>\n<p>Sản phẩm chất lượng cao, thiết kế đặc biệt dành riêng cho xe đạp</p>\n<p>Chống trượt, dễ lắp đặt và tháo gỡ Có túi hai bên để chứa khăn, kính mát, v.v...</p>\n<p>Cả hai mặt đều có dây phản quang an toàn khi chạy xe vào ban đêm phong cách, mới lạ, bắt mắt.</p>\n<p>Kích thước: 11*12.5*12CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-1.jpg?v=1625042713802\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-2.jpg?v=1625042714458\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-3.jpg?v=1625042715087\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-4.jpg?v=1625042715737\" /></p>', '', 'Túi đôi đựng đồ treo sườn xe đạp đa năng chống nước', 'Túi đôi đựng đồ treo sườn xe đạp đa năng chống nước, túi sườn xe đạp, túi treo sườn, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22164547/tui-doi-dung-do-treo-suon-xe-dap-da-nang-chong-nuoc.jpg', '<p>Túi đựng đồ treo sườn xe đạp đa năng chống nước cao cấp&nbsp;phụ kiện xe đạp này sẽ giúp bạn tăng độ tiện lợi đồng thời bảo vệ bạn tốt hơn trong quá trình sử dụng.</p>\n<p>Sản phẩm chất lượ', '22164547', '47985165', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:45', '2024-05-29 06:11:45'),
(1149, 'tui-treo-suon-xe-dap-the-thao-chong-nuoc-cam-ung-dien-thoai-tang-kem-tui-trum-di-mua', 'Túi treo sườn xe đạp thể thao chống nước, cảm ứng điện thoại tặng kèm túi trùm đi mưa', '<p><em><strong>Túi treo sườn xe đạp thể thao chống nước, cảm ứng điện thoại tặng kèm túi trùm đi mưa</strong></em></p>\n<p>Túi treo sườn xe đạp thể thao cực chất có ngăn để điện thoại chống thấm nước, và có thể được sử dụng để lưu trữ các vật dụng nhỏ như chìa khóa, điện thoại di động,...</p>\n<p>Thực sự là một đối tác tuyệt vời Vừa đi xe vừa cảm ứng trên điện thoại, xem thông báo, cuộc gọi tin nhắn dễ dàng qua cửa sổ cảm ứng trong suốt Có ngăn để điện thoại chống thấm nước cực tốt.</p>\n<p>Thích hợp cho tất cả các loại xe đạp, chẳng hạn như xe đạp leo núi, xe đạp đường, xe đạp thông thường.Thuận tiện và an toàn trong khi đi xe đạp.</p>\n<p>Chất liệu vải:&nbsp;Oxford&nbsp;</p>\n<p>Kích thước: mỗi túi 17*5CM.</p>\n<p>Màu sắc: Họa tiết phối màu&nbsp;Đen&nbsp;đỏ,&nbsp;đen xanh dương,&nbsp;đen vàng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v3.jpg?v=1624952969581\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v4.jpg?v=1624952977602\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v5.jpg?v=1624952978479\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v7.jpg?v=1624952979330\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v8.jpg?v=1624953126669\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v9.jpg?v=1624953132542\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v10.jpg?v=1624953138429\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v1.jpg?v=1624953146293\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-xe-dap-de-dien-thoai-v2.jpg?v=1624953154060\" /></p>', '', 'Túi treo sườn xe đạp thể thao', 'cảm úng điện thoại tặng kèm túi trùm đi mưa, phụ kiện xe máy, túi treo sườn xe đạp, Túi treo sườn xe đạp thể thao chống nước, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/22155436/tui-treo-suon-xe-dap-the-thao-chong-nuoc-cam-ung-dien-thoai-tang-kem-tui-trum-di-mua.jpg', '<p>Túi treo sườn xe đạp thể thao cực chất có ngăn để điện thoại chống thấm nước, và có thể được sử dụng để lưu trữ các vật dụng nhỏ như chìa khóa, điện thoại di động,...</p>\n<p>Thực sự là một', '22155436', '47960659', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:45', '2024-05-29 06:11:45'),
(1150, 'bo-dung-cu-sua-chua-xe-dap-cam-tay-bo-luc-giac-da-nang', 'Bộ Dụng Cụ Sửa Chữa Xe Đạp Cầm Tay, Bộ Lục Giác Đa Năng', '<p><em><strong>Bộ Dụng Cụ Sửa Chữa Xe Đạp Cầm Tay, Bộ Lục Giác Đa Năng</strong></em></p>\n<p>Dụng Cụ Sửa Chữa Cầm Tay Đa Năng 15 món. Với kích thước nhỏ gọn, tiện lợi có thể mang theo bên mình để lắp ráp, sửa chữa xe đạp khi gặp sự cố.</p>\n<p>Ngoài ra bạn có thể dùng trong gia đình và các trường hợp khẩn cấp.</p>\n<p>Sản phẩm được làm bằng thép không gỉ có độ bền cao và thời gian sử dụng lâu dài.</p>\n<p>Bộ sản phẩm gồm: 1 tua vít dẹp. ➡ 1 tua vít Phillips. ➡ 1 ống nối kéo dài. ➡ 3 cờ lê đầu vòng 8/9/10mm. ➡ T3 cờ lê đầu mở 8/10/15mm. ➡ 6 chìa lục giác: 2/2. 5/3/4/5/6mm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-cam-tay-12-mon-3.jpg?v=1624868037482\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-cam-tay-12-mon-4.jpg?v=1624868047405\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-cam-tay-12-mon-6.jpg?v=1624868055475\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-cam-tay-12-mon-2.jpg?v=1624868066828\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-cu-cam-tay-12-mon-1.jpg?v=1624868074583\" /></strong></em></p>', '', 'Bộ Dụng Cụ Sửa Chữa Xe Đạp Cầm Tay, Bộ Lục Giác Đa Năng', 'Bộ Dụng Cụ Sửa Chữa Xe Đạp Cầm Tay, Bộ Lục Giác Đa Năng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg',