(1152, 'gac-baga-xe-dap-bat-truc-yen-cao-cap', 'Gác Baga xe đạp bắt trục yên cao cấp', '<p><em><strong>Gác Baga xe đạp bắt trục yên cao cấp</strong></em></p>\n<p>Gác baga&nbsp;xe đạp gắn trục&nbsp;yên phù hợp cho tất cả các loại xe đạp có đường kính cọc yên dưới 32mm.</p>\n<p>Gác Baga&nbsp;xe đạp bắt cọc yên, kèm chống bắt khung xe nên rất chắc chắn, chịu tải cao, phù hợp để trở thêm đồ cho các chuyến đi của bạn.</p>\n<p>Kẹp&nbsp;đàn hồi giữ quần áo, dụng cụ, túi đồ của bạn.</p>\n<p>Chất liệu: Kim loại&nbsp;lượng cao nhẹ, bền, đẹp.</p>\n<p>Chịu tải trọng cao.</p>\n<p>Dễ dàng lắp đặt.</p>\n<p>Phù hợp các loại xe thể thao vành 24, 26, 27,5 inch, 700c.</p>\n<p>Kích thước: 50cm x 12cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gac-baga-xe-dap-the-thao-3.jpg?v=1624692226242\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gac-baga-xe-dap-the-thao-1.jpg?v=1624612766811\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gac-baga-xe-dap-the-thao-2.jpg?v=1624612773564\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gac-baga-xe-dap-the-thao-4.jpg?v=1624692922442\" /></p>', '', 'Gác Baga xe đạp bắt trục yên cao cấp', 'baga xe đạp, gác baga xe, Gác Baga xe đạp bắt trục yên cao cấp, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '210000', '', '1', '', '', NULL, '', '', '', '0.8', 'kg', 'images/22109698/gac-baga-xe-dap-bat-truc-yen-cao-cap.jpg', '<p>Gác baga&nbsp;xe đạp gắn trục&nbsp;yên phù hợp cho tất cả các loại xe đạp có đường kính cọc yên dưới 32mm.</p>\n<p>Gác Baga&nbsp;xe đạp bắt cọc yên, kèm chống bắt khung xe nên rất chắc chắn', '22109698', '47816669', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:45', '2024-05-29 06:11:45'),
(1153, 'copy-of-tui-doi-treo-hanh-ly-sau-yen-xe-dap-tr1', 'Túi đôi treo hành lý sau yên xe đạp TR2', '<p><em><strong>Túi đôi treo hành lý sau yên xe đạp TR2</strong></em></p>\n<p>Sản phẩm tiện dụng với dung tích khá lớn với 2 túi 2 bên hông xe&nbsp;đạp.</p>\n<p>Phù hợp gắn cho mọi dòng xe&nbsp;đạo có gắn baga</p>\n<p>Chất liệu vải chống thấm nước, có phản quang.</p>\n<p>Mỗi túi có 2 ngăn trong và 1 ngăn ngoài.</p>\n<p>Màu xắc:&nbsp;Đen,&nbsp;đỏ phân loại màu theo màu túi nhỏ bên ngoài.</p>\n<p>Kích thước: 1 mảnh mảnh 70cm * 40cm * 50cm</p>\n<p>Kích thước: gấp đơn 30cm * 29cm</p>\n<p>Kích thước 1 túi:&nbsp;&nbsp;37cm * 33cm * 26cm</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-1.jpg?v=1624524939669\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-2.jpg?v=1624524947220\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-5.jpg?v=1624524956488\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-3.jpg?v=1624524963750\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-4.jpg?v=1624524975541\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-6.jpg?v=1624524991927\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-dung-do-xe-dap-tr2-7.jpg?v=1624524998743\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Túi treo đồ xe đạp', 'túi đồ xe đạp, Túi đôi treo hành lý sau yên xe đạp TR1, Túi đôi treo hành lý sau yên xe đạp TR2, túi treo đồ xe đạp, túi treo hành lý xe đạp, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '168000', '', '1', '', '', NULL, '', '', '', '0.8', 'kg', 'images/22100512/copy-of-tui-doi-treo-hanh-ly-sau-yen-xe-dap-tr1.jpg', '<p>Sản phẩm tiện dụng với dung tích khá lớn với 2 túi 2 bên hông xe&nbsp;đạp.</p>\n<p>Phù hợp gắn cho mọi dòng xe&nbsp;đạo có gắn baga</p>\n<p>Chất liệu vải chống thấm nước, có phản quang.</p>\n', '22100512', '47782320', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:45', '2024-05-29 06:11:45'),
(1154, 'nhan-titan-khac-ten-theo-yeu-cau', 'Nhẫn titan khắc tên theo yêu cầu', '<p><em><strong>Nhẫn titan khắc tên theo yêu cầu</strong></em></p>\n<p>Nhẫn được làm từ thép titan không gỉ 316L - 100% ko han gỉ (Loại thép chuyên dùng trong sx đồng hồ và nữ trang).</p>\n<p>Nhẫn&nbsp;có&nbsp; 6 Size: Size&nbsp; 6, 7, 8, 9, 10, 11 chiều rộng của nhẫn 6mm.</p>\n<p>Khắc tên theo yêu cầu khách hàng, có thể khắc mặt ngài hoặc trong của nhẫn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-khac-theo-yeu-cau-5.jpg?v=1623837420272\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-khac-theo-yeu-cau-9.jpg?v=1623837544253\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-khac-theo-yeu-cau-7.jpg?v=1623837555268\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhan-khac-theo-yeu-cau-8.jpg?v=1623837562997\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Nhẫn titan', 'nhẫn khác theo yêu cầu, nhẫn titan, Nhẫn titan khắc tên theo yêu cầu, ô tô, Volcano, volcano.vn', '1', 'Kích thước', '6', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/22023155/nhan-titan-khac-ten-theo-yeu-cau.jpg', '<p>Nhẫn được làm từ thép titan không gỉ 316L - 100% ko han gỉ (Loại thép chuyên dùng trong sx đồng hồ và nữ trang).</p>\n<p>Nhẫn&nbsp;có&nbsp; 6 Size: Size&nbsp; 6, 7, 8, 9, 10, 11 chiều rộng ', '22023155', '47386348', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:45', '2024-05-29 06:11:45');
