(1165, 'boc-vo-lang-dinh-da-logo-thien-nga-cao-cap', 'Bọc vô lăng đinh đá thiên nga cao cấp', '<p><em><strong>Bọc vô lăng đinh đá thiên nga cao cấp</strong></em></p>\n<p>Bọc vô lăng ô tô cao cấp đính đá sang trọng chất liệu da PU và được đính các hạt đá đẹp lung linh.</p>\n<p>Đỉnh vô lăng gắn logo hình Thiên nga ấn tượng và nổi bật.</p>\n<p>Vô lăng size 38CM phù hợp với đa số dòng xe ở Việt Nam.</p>\n<p>Lắp đặt tại nhà đơn giản.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-dinh-da-thien-nga-v2.jpg?v=1622450224094\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-dinh-da-thien-nga-v1.jpg?v=1622450230435\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-dinh-da-thien-nga-v5.jpg?v=1622450237901\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-dinh-da-thien-nga-v6.jpg?v=1622450245463\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"726\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-dinh-da-thien-nga-v4.jpg?v=1622450253184\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Bọc vô lăng', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21782711/boc-vo-lang-dinh-da-logo-thien-nga-cao-cap.jpg', '<p>Bọc vô lăng ô tô cao cấp đính đá sang trọng chất liệu da PU và được đính các hạt đá đẹp lung linh.</p>\n<p>Đỉnh vô lăng gắn logo hình Thiên nga ấn tượng và nổi bật.</p>\n<p>Vô lăng size 38CM', '21782711', '46457318', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:46', '2024-05-29 06:11:46'),
(1166, 'thung-dung-do-gan-duoi-xe-td04', 'Thùng đựng đồ gắn đuôi xe máy, xe điện TD04', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy, xe điện TD04</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích khá lớn&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 29*31*23CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-1.jpg?v=1622433701339\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-6.jpg?v=1622433886861\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-7.jpg?v=1622433892599\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-444-7cd0bc85-4c9d-40f0-a4dd-5785c0453fa8-2a5b0867-d450-4f74-a029-da8bbd0ae4ec.jpg?v=1622433922012\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-2.jpg?v=1622433708442\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-3.jpg?v=1622433716208\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-4.jpg?v=1622433721991\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dien-5.jpg?v=1622433728503\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"750\"></iframe></p>', '', 'Thùng đựng đồ gắn đuôi xe', 'phụ kiện xe máy, Thùng đựng đồ gắn đuôi xe, Thùng đựng đồ gắn đuôi xe máy, Thùng đựng đồ gắn đuôi xe TD04, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '450000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/21781773/thung-dung-do-gan-duoi-xe-td04.jpg', '<p>Dung tích khá lớn&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, ', '21781773', '46445625', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1167, 'nuoc-hoa-kep-cua-gio-o-to-hinh-canh-quat-dinh-da-thien-nga-cao-cap', 'Nước hoa kẹp cửa gió ô tô hình cánh quạt đính đá logo thiên nga cao cấp', '<p><em><strong>Nước hoa kẹp cửa gió ô tô hình cánh quạt đính đá logo thiên nga cao cấp</strong></em></p>\n<p>Là sản phẩm trang trí cực kỳ đôc đáo và thú vị.</p>\n<p>Tản mùi hương, khử mùi điều hòa và khuyếch tán mùi hương nước hoa trên xe ô tô.</p>\n<p>Thiết kế đọc đáo, mới lạ mặt đính đá và logo Thiên nga điệu đà và&nbsp;nữ tính cho chị em!</p>\n<p>Bộ sản phẩm&nbsp;có kèm sáp thơm,&nbsp;có chân sẵn có để kẹp vào quạt thông gió tản mùi hương đều đi khắp xe</p>\n<p>Sáp thêm được đặt trong túi bảo quản riêng, khi nào khách hàng sử dụng, tháo rời hai phần của quạt, đặt viên sáp xuống phía dưới cùng gần chốt kẹp.</p>\n<p>Kích thước nhỏ xinh: 5.5*2.5CM</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-chong-quay-thien-nga-1.jpg?v=1622274180136\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-chong-quay-thien-nga-2.jpg?v=1622274186777\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-chong-quay-thien-nga-3.jpg?v=1622274193306\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-chong-quay-thien-nga-4.jpg?v=1622274199075\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-chong-quay-thien-nga-5.jpg?v=1622274363148\" /></strong></em></p>\n<p>&nbsp;</p><iframe width=\"750\" height=\"380\" src=\"https://www.youtube.com/embed/IhXByfkqJHI\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Nước hoa kẹp cửa gió ô tô', 'Nước hoa kẹp cửa gió ô tô, Nước hoa kẹp cửa gió ô tô hình cánh quạt đính đá logo thiên nga cao cấp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21770198/nuoc-hoa-kep-cua-gio-o-to-hinh-canh-quat-dinh-da-thien-nga-cao-cap.jpg', '<p>Tản mùi hương, khử mùi điều hòa và ẩm mốc trên xe ô tô mùi hương được triết xuất hoàn toàn từ thiên nhiên.</p>\n<p>Bộ sản phẩm&nbsp;có kèm sáp thơm,&nbsp;có chân sẵn có để kẹp vào quạt thôn', '21770198', '46316842', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47');
