(1168, 'thung-dung-do-gan-duoi-xe-td03-30l', 'Thùng đựng đồ gắn đuôi xe TD03 -30L', '<p><em><strong>Thùng đựng đồ gắn đuôi xe TD03 -30L</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích lớn 30L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 40*37*28CM (30L)</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-1-8415fad2-6ea7-43a3-a9a4-1ce1e18fefce.jpg?v=1622270868802\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-2-d23b891d-5153-4be8-8ee3-b4e01984ad4a.jpg?v=1622270875423\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-8.jpg?v=1622271028607\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-7-eace51f7-3f56-4927-9dc9-cb0bf2f68ad8.jpg?v=1622270970592\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-444-7cd0bc85-4c9d-40f0-a4dd-5785c0453fa8-3427f435-74d0-4209-a71c-cf536d3c575d.jpg?v=1622271396999\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td03-mau-do-d2.jpg?v=1681443815775\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td03-mau-do-d1.jpg?v=1681443822886\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-td03-mau-do-d3.jpg?v=1681443932267\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-3-a06b6bdd-8033-48a6-b3cc-98f7e93053fc.jpg?v=1622270881842\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-4-0b0642f7-dac9-4f89-9466-a1f659038b6e.jpg?v=1622270887920\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-5-5fabe440-9f15-4a6b-9d1d-f9c7b0c2838e.jpg?v=1622270896132\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-6.jpg?v=1622270913903\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"750\"></iframe></p>', '', 'Thùng đụng đồ gắn đuôi xe TD03 -30L', 'phụ kiện xe máy, Thùng đụng đồ gắn đuôi xe TD03 -30L, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen bóng', '', '', '', '', '', '', '', 'deny', '', '489000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/21768839/thung-dung-do-gan-duoi-xe-td03-30l.jpg', '<p>Dung tích lớn 30L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng', '21768839', '46275485', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1169, 'boc-vo-lang-da-chu-d-cao-cap-vld2', 'Bọc Vô Lăng Da Chữ D cao cấp VLD2', '<p><em><strong>Bọc Vô Lăng Da Chữ D cao cấp VLD2</strong></em></p>\n<p>Bọc vô lăng làm từ da PU cao cấp.</p>\n<p>Chất lượng vô lăng rất tốt, kiểu dáng đẹp,&nbsp;rất chắc chắn cầm thích tay.</p>\n<p>Bọc vô lăng gồm lớp da cao cấp thật bên ngoài và lớp cao su thiên nhiên loại cao cấp bên trong.</p>\n<p>Thiết kế đường chỉ may nổi tinh tế bắt mắt.</p>\n<p>Bọc vô lăng kích thước 38cm vừa với hầu hết các loại vô lăng chữ D.</p>\n<p>Màu sắc: Đen chỉ đen, đỏ chỉ đen, đen chỉ xanh.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v7.jpg?v=1622168131464\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v8.jpg?v=1622168141082\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v5.jpg?v=1622168245917\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v4.jpg?v=1622168263884\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v6.jpg?v=1622168272095\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v9.jpg?v=1622168279138\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v3.jpg?v=1622168285144\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-2-v10.jpg?v=1622168292595\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"7