ay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/PfN1VwdgC30\" title=\"YouTube video player\" width=\"720\"></iframe></p>', '', 'Mặt dây truyền', 'Mặt dây truyền, mặt dây truyền khắc tay theo yêu cầu, Mặt dây truyền khắc tên theo yêu cầu cho bé, Volcano, volcano.vn', '1', 'Hình', 'Tròn', 'Kích thước', '20CM', '', '', '', '', '0', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21743200/mat-day-truyen-khac-ten-theo-yeu-cau-cho-be.jpg', '<p>Mặt dây chuyền thép titan cao cấp không gỉ,&nbsp;&nbsp;khắc tên theo yêu cầu Hình tròn, chữ nhật</p>\n<p>Khắc laze bền màu. Bạn có thể khắc tên, ngày sinh, con giáp cho bé Mặt sau khắc tên,', '21743200', '46119792', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1171, 'thung-dung-do-gan-duoi-xe-may-xe-dien-xe-dap-dien', 'Thùng đựng đồ gắn đuôi xe máy, xe điện, xe đạp điện GSB-02', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy, xe điện, xe đạp điện GSB-02</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích khá lớn&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm:36*33*17CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-1.jpg?v=1622085197892\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v1.jpg?v=1622085260804\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v6.jpg?v=1622085270415\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v5.jpg?v=1622085278425\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v7.jpg?v=1622085289402\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v4.jpg?v=1622085298389\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v11.jpg?v=1697700296519\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gan-duoi-xe-may-xe-dap-xe-dien-td03-v13.jpg?v=1697700306437\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"720\"></iframe></p>', '', 'Thùng đựng đồ gắn đuôi xe máy', 'phụ kiện xe máy, Thùng đựng đồ gắn đuôi xe, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/21739298/thung-dung-do-gan-duoi-xe-may-xe-dien-xe-dap-dien.jpg', '<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng', '21739298', '46102663', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1172, 'boc-vo-lang-da-chu-d-cao-cap', 'Bọc Vô Lăng Da Chữ D cao cấp VLD1', '<p><em><strong>Bọc Vô Lăng Da Chữ D cao cấp VLD1</strong></em></p>\n<p>&nbsp;Bọc vô lăng làm từ da PU cao cấp.</p>\n<p>Chất lượng vô lăng rất tốt, kiểu dáng đẹp,&nbsp;rất chắc chắn cầm thích tay.</p>\n<p>Bọc vô lăng gồm lớp da cao cấp thật bên ngoài và lớp cao su thiên nhiên loại cao cấp bên trong.</p>\n<p>Bọc vô lăng kích thước 38 cm vừa với hầu hết các loại vô lăng chữ D.</p>\n<p>Màu sắc: Đen, đỏ đen, cam.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-xe-o-to-6.jpg?v=1621999033245\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-xe-o-to-4.jpg?v=1621999039445\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d1-f5913b09-567c-409f-8007-7e647953cdff.jpg?v=1653468607959\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-xe-o-to-1.jpg?v=1621999047721\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-xe-o-to-2.jpg?v=1621999053952\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-xe-o-to-3.jpg?v=1621999061328\" /></strong></em></p>', '', 'Bọc vô lăng', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21714866/boc-vo-lang-da-chu-d-cao-cap.jpg', '<p>&nbsp;Bọc vô lăng làm từ da PU cao cấp.</p>\n<p>Chất lượng vô lăng rất tốt, kiểu dáng đẹp,&nbsp;rất chắc chắn cầm thích tay.</p>\n<p>Bọc vô lăng gồm lớp da cao cấp thật bên ngoài và lớp cao ', '21714866', '46022667', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1173, 'dao-thia-muong-khac-laser-ten-logo-theo-yeu-cau', 'Bộ DAO THÌA DĨA (Muỗng, nĩa) ăn bít tết inox - khắc laser tên, logo theo yêu cầu', '<p><em><strong>Bộ DAO THÌA DĨA (Muỗng, nĩa) ăn bít tết inox - khắc laser tên, logo theo yêu cầu</strong></em></p>\n<p>Dụng cụ, đồ dùng nhà bếp, phụ kiện bàn ăn bao gồm: \" Dao bít tết, Dĩa (nĩa) , Thìa, muỗng, Thìa cà phê và Dĩa (nĩa) trái cây cao cấp inox 304 tinh tế và sang trọng, mang phong cách châu âu phù hợp cho gia đình, nhà hàng, quán ăn...</p>\n<p>Bộ sản phẩm: Gồm 3 món 1 dĩa (nia) 1 thìa (muỗng nhỏ) 1 dao.</p>\n<p>Thật bất ngờ khi biết rằng chúng tôi có thể khắc trên các loại muỗng nĩa thìa bằng kim loại,&nbsp;có thể gia công khắc nhanh lấy liền chỉ trong vòng 2 giây xong 1 sản phẩm.</p>\n<p>Hiện tại chúng tôi đã và đang gia công khắc logo, hoa văn cho rất nhiều đơn vị sản xuất và gia công muỗng nĩa, dao, muôi, thìa trên địa bàn các tỉnh trên cả nước.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v12-bbc4cadd-f1f7-4664-80dc-f8e12020e736.jpg?v=1621939356518\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v9.jpg?v=1621941191787\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v1.jpg?v=1621940023383\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v6.jpg?v=1621940030559\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v10.jpg?v=1621940042197\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v3.jpg?v=1621940054155\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dao-dia-thia-v13.jpg?v=1621940183605\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/yCaddCzV14g\" title=\"YouTube video player\" width=\"720\"></iframe></p>', '', 'Thìa Dao, Muỗng Inox khắc laser tên, logo theo yêu cầu', 'Bộ DAO THÌA DĨA (Muỗng, logo theo yêu cầu, nĩa) ăn bít tết inox - khắc laser tên, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '70000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/21705519/dao-thia-muong-khac-laser-ten-logo-theo-yeu-cau.jpg', '<p>Dụng cụ, đồ dùng nhà bếp, phụ kiện bàn ăn bao gồm: \" Dao bít tết, Dĩa (nĩa) , Thìa, muỗng, Thìa cà phê và Dĩa (nĩa) trái cây cao cấp inox 304 tinh tế và sang trọng, mang phong cách châu âu', '21705519', '46000372', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1174, 'mat-duong-man-hinh-dvd-android-cho-xe-o-to-vinfast-fadil', 'Mặt dưỡng màn hình DVD Android cho xe ô tô Vinfast Fadil', '<p><em><strong>Mặt dưỡng màn hình DVD Android cho xe ô tô Vinfast Fadil</strong></em></p>\n<p>Mặt dưỡng lắp màn hình DVD&nbsp;là một trong những phụ kiện không thể thiếu nếu lái xe muốn thay thế màn hình hoặc đầu CD, đài FM bằng&nbsp;màn hình Android&nbsp;đời mới với những chức năng giải trí siêu đỉnh.</p>\n<p>Được thiết kế chuyên biệt cho dòng xe&nbsp;Vinfast Fadil nên có kích thước vừa vặn với màn hình Android 10.1 inch và loại màn 9 inch.</p>\n<p>Lắp lên cho diện mạo tổng thể hài hòa giữa xe và màn hình mới, không gây cảm giác gượng gạo và giúp lái xe dễ dàng hơn trong việc sử dụng màn hình mới.</p>\n<p>Chất liệu: nhựa ABS.</p>\n<p>Kích thước: 9 inch và 10.1Inch.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-man-dvd-vinfat-faldi-2.jpg?v=1621936062334\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-man-dvd-vinfat-faldi-3.jpg?v=1621936063207\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-man-dvd-vinfat-faldi-1.jpg?v=1621936070703\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-man-dvd-vinfat-faldi-4.jpg?v=1621936244644\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-man-dvd-vinfat-faldi-5.jpg?v=1621936250284\" /></p>', '', 'Mặt dưỡng màn hình DVD Android', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích thước', '9 inch', '', '', '', '', '', '', '', 'deny', '', '450000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21686878/mat-duong-man-hinh-dvd-android-cho-xe-o-to-vinfast-fadil.jpg', '<p>Được thiết kế chuyên biệt cho dòng xe&nbsp;Vinfast Fadil nên có kích thước vừa vặn với màn hình Android 10.1 inch và loại màn 9 inch.</p>\n<p>Lắp lên cho diện mạo tổng thể hài hòa giữa xe v', '21686878', '45934725', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:47', '2024-05-29 06:11:47'),
(1175, 'hop-ty-tay-xe-o-to-mitsubishi-xpander', 'Hộp Tỳ Tay Xe Ô Tô Mitsubishi Xpander', '<p><em><strong>Hộp Tỳ Tay Xe Ô Tô Mitsubishi Xpander</strong></em></p>\n<p>Hộp tỳ tay ô tô là phụ kiện sử dụng với mục đích tỳ tay, giúp tài xế giảm thiểu tình trạng đau mỏi vai, tay do để tay quá lâu trên bánh lái. Không chỉ có thế, các sản phẩm hộp tỳ tay hiện nay còn được trang bị thêm nhiều tính năng hữu ích như đựng đồ, sạc pin điện thoại..cực kỳ hữu ích cho người sử dụng.<br />\nNgoài việc dùng để tỳ tay, thì hộp tỳ tay còn có rất nhiều tính năng vượt trội khác:</p>\n<ul>\n<li>Khoang chưa đồ rộng nhưng không hề chiếm nhiều diện tích trên xe.</li>\n<li>Tích hợp cổng sạc USB vô cùng tiện dụng.</li>\n<li>Chất liệu: Nhựa ABS + da PU cao cấp.</li>\n<li>Tích hợp ngăn để chai nước, ngăn để tàn thuốc lá.</li>\n<li>Trọng lượng: 1.9kg.</li></ul>\n<p>Kích thước: Cao 31cm, Dài 33cm, Rộng 14cm.<br />\nKích thước đế: 14*9.5*15.5cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xpander-4.jpg?v=1621494659532\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xpander-2.jpg?v=1621494668360\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xpander-3.jpg?v=1621494675060\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xpander-1.jpg?v=1621494682352\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-6-f7b83cb1-cbe0-43f1-b897-1dac0c19fba7.jpg?v=1621073619704\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-3-9308abce-c6ba-47ba-9f30-d63a3c70a3b9.jpg?v=1621073605573\" /><