(1176, 'balo-vai-dung-can-cau-5-ngan', 'Balo Vải Đựng Cần Câu 7 Ngăn 123*24CM', '<p><em><strong>Balo Vải Đựng Cần Câu 7 Ngăn 123*24CM</strong></em></p>\n<p>Ngăn chính rộng&nbsp;giúp anh em dễ dàng sắp xếp vật dụng mang theo. Đụng được nhiều món như ô, vợt, máy câu, ....</p>\n<p>Ngăn phụ phân chia hợp lý và tỉ mỉ. 5 ngăn để cần bên ngoài kèm 1 ngăn đựng phụ kiện. Chất liệu vải chống thấm nước tốt, dây đeo tiện lợi.</p>\n<p>Kích thước: 123*24CM.</p>\n<p>Màu sắc: Xanh bộ đội, Đen.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-5-a3034319-125f-48ad-9dda-ff6bd121fb71.jpg?v=1621418259773\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-2-b759506e-39eb-4909-9786-a33eaf789414.jpg?v=1621418269453\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-1-a044e9db-94be-48eb-80bb-d2305b584bba.jpg?v=1621418374152\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-4-f14582c3-7adc-45fd-be88-e3c0a98e2a39.jpg?v=1621418375089\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-7.jpg?v=1621418390471\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-cau-ca-3-d928f6ce-ed65-4af2-87a3-25dbc85f44a5.jpg?v=1621418390038\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Balo Vải Đựng Cần Câu', 'balo câu cá, Balo Vải Đựng Cần Câu, túi cần câu cá, túi đựng cần câu, Volcano, volcano.vn', '1', 'Màu sắc', 'Xanh', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21640480/balo-vai-dung-can-cau-5-ngan.jpg', '<p>N