(1179, 'tam-luoi-tua-lung-ghe-o-to-hat-go', 'Tấm Lưới Tựa Lưng Ghế ô Tô Hạt Gỗ', '<p><em><strong>Tấm Lưới Tựa Lưng Ghế ô Tô Hạt Gỗ</strong></em></p>\n<p>Sản phẩm có tính đàn hồi, chịu lực, thoáng khí giảm nóng khi ngồi trên ô tô.<br />\nSử dụng gắn vào thành ghế tựa lưng dùng được trên ô tô và dùng được cho văn phòng, những người thường xuyên phải ngồi nhiều.</p>\n<p>Tạo dáng ngồi thẳng ngay ngắn và thoải mái.<br />\nNâng đỡ giảm lực lên cột sống, đặc biệt phần lưng dưới.<br />\nGiúp giảm căng thẳng, nhức mỏi phần lưng cổ.<br />\nThiết kế gọn nhẹ, gắn vào ghế một cách dễ dàng tiện dụng.<br />\nDễ dàng vệ sinh trong quá trình sử dụng.</p>\n<p>Sản phẩm chỉ có tác dụng hỗ trợ không có tác dụng chữa bệnh đau lưng.</p>\n<p>Kích thước: 40*43CM</p>\n<p>Giá sản phẩm: 01 tấm lót lưng 150.000đ, combo lót ghế tựa lưng và tựa đầu 410.000đ</p>\n<p><img data-thumb=\"original\" original-height=\"682\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v3.jpg?v=1620379009631\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v8.jpg?v=1620379018016\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/mieng-lot-ghe-hat-go-v3-fc9e02b4-32b5-4651-8ab5-3a977be2c0dc.jpg?v=1620379036758\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-v3.jpg?v=1620379077094\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-v2.jpg?v=1620379086096\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v912.jpg?v=1620383335270\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v6.jpg?v=1620379116929\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v7.jpg?v=1620379128817\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tua-lung-ghe-xe-o-to-v5.jpg?v=1620379144150\" /></p>', '', 'Tấm lót tựa lưng hạt gỗ', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Tựa lưng phối màu', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/21489600/tam-luoi-tua-lung-ghe-o-to-hat-go.jpg', '<p>Sản phẩm có tính đàn hồi, chịu lực, thoáng khí giảm nóng khi ngồi trên ô tô.<br />\nSử dụng gắn vào thành ghế tựa lưng dùng được trên ô tô và dùng được cho văn phòng, những người thường xuy', '21489600', '45143922', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:48', '2024-05-29 06:11:48'),
(1180, 'dung-dich-ve-sinh-lam-sach-bao-duong-noi-that-xe-o-to-c5c', 'Xịt tẩy, vệ sinh bảo dưỡng nội thất xe ô tô C5C', '<p><em><strong>Xịt tẩy, vệ sinh bảo dưỡng nội thất xe ô tô đa năng&nbsp;C5C</strong></em></p>\n<p>Xịt tẩy nội thất ô tô đa năng <em><strong>C5C&nbsp;</strong></em>giúp làm sạch đồ nhựa, vải, nỉ, da, gỗ, cao su...đặc biệt để làm sạch và bảo dưỡng phụ kiện da trong nội thất ô tô, ghế ô tô, da thuộc xe máy, túi xách, đồ gỗ và các bộ phận khác được làm từ da trơn.</p>\n<p>Cách dùng: Lắc đều chai sau đó phun một lớp mỏng lên mặt&nbsp;hoặc miếng vải, dụng cụ vệ sinh xe.</p>\n<p>Sản phẩm có mùi thơm nhẹ nhàng, dễ chịu</p>\n<p>Dung tích: 260ml.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v3.jpg?v=1620373223905\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v8.jpg?v=1620373529532\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v4.jpg?v=1620373236996\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v7.jpg?v=1620373242508\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v5.jpg?v=1620373251060\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-dich-ve-sinh-noi-that-c5c-v10.jpg?v=1620374916766\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-