(1181, 'baga-cang-sau-gan-thung-do-cop-sau-cac-loai-xe-may', 'Baga Cảng sau gắn thùng đồ, cốp sau các loại xe máy', '<p><strong><em>Baga Cảng sau gắn thùng đồ, cốp sau các loại xe máy</em></strong></p>\n<p>Chất liệu thép sơn tĩnh điện bền chắc. Có thể gắn thêm thùng đựng đồ, cốp đồ cho&nbsp;nhiều loại xe.</p>\n<p>Thiết kế kiểu dáng đẹp chi tiết lắp đặt zin theo từng dòng xe.</p>\n<p>Phân loại:</p>\n<p>Wave 110: Lắp đặt chuyên dụng cho các xe wave A 110, wave rsx, wave S 110.</p>\n<p>Sirius: Lắp được cho tất cả các loại xe&nbsp;&nbsp;​Yamaha Sirius</p>\n<p>Exciter 150.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v15.jpg?v=1620360821823\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v15-9f14a75d-d9d1-4c8c-850c-ecc5c576167c.jpg?v=1620360929516\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v16.jpg?v=1620360940663\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v2.jpg?v=1620360951033\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"682\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v4.jpg?v=1620360959520\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v1.jpg?v=1620360966023\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/baga-xe-may-v18.jpg?v=1620360980345\" /></em></strong></p>\n<p><strong><em><img d