(1183, 'tau-sac-o-to-dinh-da-2-cong-usb-dc-12-24v', 'Tẩu sạc ô tô đính đá 2 cổng USB DC-12/24V', '<p><em><strong>Tẩu sạc ô tô đính đá 2 cổng USB DC-12/24V</strong></em></p>\n<p>Bộ chia tẩu ra 2 cổng USB cao cấp</p>\n<p>Bộ chia tẩu hỗ trợ sạc nhanh chuẩn quickcharge 3.0</p>\n<p>Tẩu có thể cắm điện 12V trên xe con cũng như điện 24V trên xe tải lớn.&nbsp;</p>\n<p>Bộ chia tẩu hỗ trợ sạc nhanh chia ra 2 cổng usb dùng để sạc điện thoại, ipad cổng 1A và cổng 2.4A.&nbsp;IC thông minh điều chỉnh mức cho từng thiết bị.</p>\n<p>Chất liệu nhôm đính đá đẹp lung linh.</p>\n<p>Kích thước: 65*25MM</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-3.jpg?v=1620275493341\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-5.jpg?v=1620275504141\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-1.jpg?v=1620275241969\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-2.jpg?v=1620275248041\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-4.jpg?v=1620275522926\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-6.jpg?v=1620275530812\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-2-cong-usb-dinh-da-v