(1185, 'mat-day-chuyen-da-ngoc-bich-tu-nhien-hinh-phat', 'Mặt dây chuyền đá ngọc bích tự nhiên hình phật', '<p><em><strong>Mặt dây chuyền đá ngọc bích tự nhiên hình phật</strong></em></p>\n<p>Mặt đá ngọc bích tự nhiên&nbsp;hàng thủ công cao cấp.</p>\n<p>Mặt hình phật&nbsp;đem lại nhiều may mắn, thuận lợi trong mọi việc. Ngoài ra nó còn giúp giảm căng thẳng, cân bằng và giữ vững tinh thần, tạo sự thoải mái, bình tĩnh và tự tin.</p>\n<p>Kích thước: 6.2*4.0*1.9CM.</p>\n<p>Trọng lượng: 52gram.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v1.jpg?v=1620034401904\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v2.jpg?v=1620034412362\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v5.jpg?v=1620034420360\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v3.jpg?v=1620034429941\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v4.jpg?v=1620034439851\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v6.jpg?v=1620034447259\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/tuong-da-phat-to-nhu-lai-v7.jpg?v=1620034454854\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-hei