(1188, 'vong-dinh-da-trang-tri-nut-khoi-dong-start-stop-o-khoa-xe-o-to', 'Vòng đính đá trang trí nút khởi động Start stop ổ khóa xe ô tô', '<p><strong><em>Vòng đính đá trang trí nút khởi động Start stop ổ khóa xe ô tô</em></strong></p>\n<p>Vòng đính đá trang trí nút khởi động.</p>\n<p>Chất liệu thép không rỉ đính đá lấp lánh.</p>\n<p>Đường kính 4cm phù hợp với hầu hết xe hiện nay trên thị trường.</p>\n<p>Vừa đẹp trang trí vừa giúp chống xước nút start, ổ khóa.</p>\n<p>Lắp dán&nbsp;bằng keo 3M dễ dàng.</p>\n<p>4 màu: Trắng, hồng, đỏ, xanh&nbsp;cực sang trọng dễ phối với mọi tông nội thất.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-1.jpg?v=1619687592483\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-4.jpg?v=1619687599060\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-2.jpg?v=1619687609006\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-3.jpg?v=1619687616754\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vien-o-khoa-dinh-da-v4.jpg?v=1619687628247\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-v1.jpg?v=1619687639820\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-5.jpg?v=1619689663374\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-6.jpg?v=1619692202032\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-dinh-da-8.jpg?v=1619692210481\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/1NaGRDbIDs8\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Vòng đính đá trang trí nút khởi động Start stop ổ khóa xe ô tô', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn, Vòng đính đá trang trí nút khởi động Start stop ổ khóa xe ô tô, vòng trang trí nút khởi dộng', '1', 'Màu sắc', 'Xanh', '', '', '', '', '', '', '', 'deny', '', '19000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21438102/vong-dinh-da-trang-tri-nut-khoi-dong-start-stop-o-khoa-xe-o-to.jpg', '<p>Vòng đính đá trang trí nút khởi động.</p>\n<p>Chất liệu thép không rỉ đính đá lấp lánh.</p>\n<p>Đường kính 4cm phù hợp với hầu hết xe hiện nay trên thị trường.</p>\n<p>Vừa đẹp trang trí vừ', '21438102', '44812880', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:49', '2024-05-29 06:11:49'),
(1189, 'binhnuoc-tuoi-tieu-xit-thuoc-bang-dien-deo-lung-16l-nap-sac-8ah-12v', 'Bình Phun Thuốc Trừ Sâu, Phun Nước Tưới Tiêu Chạy Điện 20L Pin Lithium 10A', '<p><strong><em>Bình Phun Thuốc Trừ Sâu, Phun Nước Tưới Tiêu Chạy Điện 20L Pin Lithium 10A</em></strong></p>\n<p>Một thiết bị rất quen thuộc với bà con nông dân không thể thiếu trong việc chăm sóc cây trồng, giúp bà con không chỉ diệt trừ sâu bệnh, cỏ dại, mà còn nâng cao năng suất cây trồng nhờ khả năng bón phân, phun thuốc tăng trưởng.</p>\n<p>So với dòng máy phun thuốc trừ sâu bằng tay truyền thống thì dòng máy chạy điện có công suất và hiệu suất phun vượt trội vì máy có khả năng phun dạng tia, sương đều hơn, nhanh hơn, tiết kiệm thuốc hơn và đỡ tốn sức hơn.</p>\n<p>Cách vận hành của động cơ điện cũng đơn giản hơn nhiều so với bình phun bằng tay hay động cơ xăng.<br />\nTrọng lượng của máy khá nhẹ với dung tích bình chứa 20 lít, rất phù hợp cho đeo vai.</p>\n<p>Pin dùng được lâu khoảng 6 đến 8h.</p>\n<p>Bộ sản phẩm gồm:&nbsp; Bình phun 20L, 1 dây sạc, 3 vòi phun, ống dẫn,&nbsp;dây đeo.</p>\n<p>Thông số:</p>\n<p>Điện áp: 12V-10AH</p>\n<p>Công suất: 25W</p>\n<p>Thời gian dùng 4-6H</p>\n<p>Kích thước: 48*37*21CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v1.jpg?v=1619431949152\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v10.jpg?v=1619431961641\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v13.jpg?v=1619431967906\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v8.jpg?v=1619431977784\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v11.jpg?v=1619431984817\" /></strong></em></p>\n<p>Bình&nbsp;phun có thể điều chỉnh được áp lực phun thông qua bộ chiết áp (nún vặn tròn bên hông), tạo ra hiệu quả phun sương cực kỳ tốt cho từng loại cây trồng.&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v9.jpg?v=1619431993268\" /></strong></em></p>\n<p><em><strong>Phụ kiện sạc pin và vòi phun</strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v12.jpg?v=1619432000685\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v4.jpg?v=1619432028166\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v6.jpg?v=1619432029234\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v7.jpg?v=1619432030734\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/binh-phun-20-lit-v17.jpg?v=1619432031713\" /></strong></em></p>', '', 'Bình phụ điện', 'bình phun điện, Bình phun thuốc bằng, ô tô, phụ  kiện ô tô, phun nước tưới têu chạy điện 20L sạc pin Pin Lithium 10A, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '950000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/21408236/binhnuoc-tuoi-tieu-xit-thuoc-bang-dien-deo-lung-16l-nap-sac-8ah-12v.jpg', '<p>Một thiết bị rất quen thuộc với bà con nông dân không thể thiếu trong việc chăm sóc cây trồng, giúp bà con không chỉ diệt trừ sâu bệnh, cỏ dại, mà còn nâng cao năng suất cây trồng nhờ khả ', '21408236', '44582903', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:49', '2024-05-29 06:11:49'),
(1190, 'tem-logo-noi-chevrolet-dan-trang-tri-duoi-xe', 'Tem logo nổi Chevrolet dán trang trí đuôi xe', '<p><em><strong>Tem logo nổi Chevrolet dán trang trí đuôi xe</strong></em></p>\n<p>&nbsp;Tem logo xe Chevrolet có kích thước 19.6*1.8CM dùng thay thế&nbsp;logo&nbsp;cũ&nbsp;xe, chỉ cần bóc tách logo cũ và dán lên vị trí.</p>\n<p>&nbsp;Chất liệu nhựa ABS mạ nước bạc sáng bóng, được dán bằng keo dán 3M chắc chắn.</p>\n<p>&nbsp;Lưu ý: Làm sạch khô vị trí dán để đảm bảo độ kết dính của keo, tránh rửa,&nbsp;nước trong 24h.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-6.jpg?v=1619171318115\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-5.jpg?v=1619171273846\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-4.jpg?v=1619171328587\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-3.jpg?v=1619171334124\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-2.jpg?v=1619171341455\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-cheverrolet-1.jpg?v=1619171349688\" /></p>', '', 'Logo ô tô', 'logo ô tô, ô tô, phụ  kiện ô tô, tem chữ nổi, Tem logo nổi Chevrolet dán trang trí đuôi xe, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '98000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/21387490/tem-logo-noi-chevrolet-dan-trang-tri-duoi-xe.jpg', '<p>&nbsp;Tem logo xe Chevrolet có kích thước 19.6*1.8CM dùng