(1191, 'thung-do-cop-do-gan-duoi-xe-dap-dien-xe-may-dien', 'Thùng đồ, cốp đồ gắn đuôi xe đạp điện, xe máy điện', '<p><em><strong>Thùng đồ, cốp đồ gắn đuôi xe đạp điện, xe máy điện</strong></em></p>\n<p>Thùng đồ tiện dụng và rất hợp thời trang cho các bạn học sinh, sinh viên đang sử dụng xe đạp điện và xe máy điện để đi học, đi chơi.</p>\n<p>Chất liệu nhựa ABS cao cấp chống thấm nước.</p>\n<p>Thùng có trang bị khóa chống trộm.</p>\n<p>Bên trong thùng là túi đồ 3 ngăn đựng nhiều loại phụ kiện khác nhau.</p>\n<p>Kích thước: 34*34*16CM.</p>\n<p>Thùng lắp phù hợp với khá nhiều dòng xe điện trên thị trường, vui lòng tham khảo kỹ nội dung mô tả sản phẩm hoặc liên hệ trực tiếp shop để được tư vấn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-5.jpg?v=1619165751602\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-7.jpg?v=1619165759211\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-10.jpg?v=1619166034849\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong>Phù hợp với các dòng xe có đuôi sau như hình ảnh bên dưới:·<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-3.jpg?v=1619166054192\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-1.jpg?v=1619165815737\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-2.jpg?v=1619165832603\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-do-gan-dau-xe-dien-9.jpg?v=1619165895010\" /></p>\n<p>&nbsp;</p>', '', 'Thùng đồ, cốp đồ gắn đuôi xe đạp điện', 'cốp đồ xe điện, ô tô, phụ kiện xe máy, thùng đồ xe điện, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/21386526/thung-do-cop-do-gan-duoi-xe-dap-dien-xe-may-dien.jpg', '<p>Thùng đồ tiện dụng và rất hợp thời trang cho các bạn học sinh, sinh viên đang sử dụng xe đạp điện và xe máy điện để đi học, đi chơi.</p>\n<p>Chất liệu nhựa ABS cao cấp chống thấm nước.</p>\n', '21386526', '44491216', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:49', '2024-05-29 06:11:49'),
(1192, 'bong-den-halogen-tang-san-o-to-xe-hoi-h1-h3-h4-h11', 'Bóng đèn halogen tăng sáng ô tô xe máy H1,H3,H4,H11', '<p><em><strong>Bóng đèn halogen tăng sáng ô tô xe máy H1,H3,H4,H11</strong></em></p>\n<p>Là dòng sản phẩm đèn sáng nhất sử dụng công nghệ cắt Lazer tiên tiến giúp tăng 150% so với tiêu chuẩn sáng tối thiểu.</p>\n<p>Chiếu sáng tối đa và dễ dàng thay thế cho các dòng xe điện 12V -24V</p>\n<p>Giúp tiết kiệm chi phí cho người dùng.</p>\n<p>Dễ dàng sử dụng, lắp đặt cho nhiều loại xe máy, ô tô, xe tải&nbsp;trên thị trường.</p>\n<p>Phân loại:&nbsp;Đèn H1-12V100W,&nbsp;Đèn H1-24V100W,&nbsp;Đèn H3-12V100W,&nbsp;Đèn H3-24V100W,&nbsp;Đèn H7-12V100W,&nbsp;Đèn H7-24V100W, Đèn H4-12V100/90W,&nbsp;Đèn H4-24V100/90W,&nbsp;Đèn H11-12V55W,&nbsp;Đèn H11-24V100W</p>\n<p>Đèn 12V có thể lắp cho xe máy.</p>\n<p>Giá sản phẩm: 01 đèn</p>\n<p>Lưu ý: xác định chính xác bóng đèn zin trên xe trước khi đặt hàng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v1.jpg?v=1619064824028\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v2.jpg?v=1619064824929\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v3.jpg?v=1619064825612\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v4.jpg?v=1619064826280\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v5.jpg?v=1619064826934\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-pha-led-xe-o-to-xe-may-v6.jpg?v=1619064841197\" /></strong></em></p>', '', 'Bóng đèn ô tô', 'ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Điện áp', '12V', 'Loại', 'H11', '', '', '', '', '', 'deny', '', '100000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21376883/bong-den-halogen-tang-san-o-to-xe-hoi-h1-h3-h4-h11.jpg', '<p>Là dòng sản phẩm đèn sáng nhất sử dụng công nghệ cắt Lazer tiên tiến giúp tăng 150% so với tiêu chuẩn sáng tối thiểu.</p>\n<p>Chiếu sáng tối đa và dễ dàng thay thế cho các dòng xe điện 12V ', '21376883', '44448114', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1193, 'bo-tao-ren-trong-ren-ngoai-12-chi-tiet-hop-kim-sieu-cung', 'Bộ tạo ren trong, ren ngoài 12 chi tiết hợp kim siêu cứng', '<p><em><strong>Bộ tạo ren trong, ren ngoài 12 chi tiết hợp kim siêu cứng</strong></em></p>\n<p>Bộ&nbsp;taro&nbsp;ren là một trong những dụng cụ đồ nghề không thể thiếu cho các anh em làm máy. xử lý một cách nhanh chóng và hiệu quả.</p>\n<p>Vật Liệu Thích Hợp : Sắt , Nhôm , Đồng , kim loại mềm</p>\n<p>Bộ taro ren ngoài M6-12: M6x1.0, M7x1.0, M8x1.25, M10x1.5, M12x1.75</p>\n<p>Bộ taro tạo ren trong M6-M12: M6x1.0, M7x1.0, M8x1.25, M10x1.5, M12x1.75</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-1.jpg?v=1619061024387\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-2.jpg?v=1619061025058\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-3.jpg?v=1619061025482\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-6.jpg?v=1619060992823\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-4.jpg?v=1619061043168\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-dung-cu-tao-ren-12-mon-5.jpg?v=1619061051262\" /></strong></em></p>', '', '', 'Bộ tạo ren trong, dụng cụ tạo ren, dụng cụ tạo ren ngoài, dụng cụ tạo ren trong, ren ngoài 12 chi tiết hợp kim siêu cứng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21375901/bo-tao-ren-trong-ren-ngoai-12-chi-tiet-hop-kim-sieu-cung.jpg', '<p>Bộ&nbsp;taro&nbsp;ren là một trong những dụng cụ đồ nghề không thể thiếu cho các anh em làm máy. xử lý một cách nhanh chóng và hiệu quả.</p>\n<p>Vật Liệu Thích Hợp : Sắt , Nhôm , Đồng , kim', '21375901', '44442894', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1194, 'luoi-tua-dau-dan-hat-go-mat-xa-tren-o-to', 'Lưới tựa đầu đan hạt gỗ mát xa trên ô tô', '<p><em><strong>Lưới tựa đầu đan hạt gỗ mát xa trên ô tô</strong></em></p>\n<p>Thiết kế sang trọng tinh tế, trang trí không gian nội thất trong xe trở nên sang trọng hơn bao giờ hết</p>\n<p>Thoáng khí mang lại cho bạn 1 cảm giác thoải mái, dễ chịu hạn chế tối đa mệt mỏi đau nhức phần cổ khi lái xe</p>\n<p>Không mềm lún, gạt gỗ tự nhiên mát xa dễ chịu thoải&nbsp;mái...</p>\n<p>Có thể lắp cho tất cả các ghế, không riêng ghế lái</p>\n<p>Tháo lắp dễ dàng, trong 3 giây là xong</p>\n<p>Kích thước: 32*18.5*11CM</p>\n<p>Gía sản phẩm: Giá 01 chiếc</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-4.jpg?v=1618905867567\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-1.jpg?v=1618905403044\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-2.jpg?v=1618905409566\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-5.jpg?v=1618905883556\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-tua-dau-dan-hat-go-tren-xe-o-to-6.jpg?v=1618905892406\" /></p>', '', 'Lưới tựa đầu đan hạt gỗ mát xa trên ô tô', 'Lưới tựa đầu đan hạt gỗ mát xa trên ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/21364347/luoi-tua-dau-dan-hat-go-mat-xa-tren-o-to.jpg', '<p>Thiết kế sang trọng tinh tế, trang trí không gian nội thất trong xe trở nên sang trọng hơn bao giờ hết</p>\n<p>Thoáng khí mang lại cho bạn 1 cảm giác thoải mái, dễ chịu hạn chế tối đa mệt m', '21364347', '44395864', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1195, 'den-di-cau-nhieu-che-do-kem-chan-do', 'ĐÈN LED CÂU CÁ BAN ĐÊM KÈM CHÂN ĐỠ ĐÈN', '<p><em><strong>Đèn led câu&nbsp;cá&nbsp;ban đêm kèm chân đỡ đèn</strong></em></p>\n<p>Đèn led câu cá đêm là 1 trong những sản phẩm rất hữu dụng cho anh em cần thủ câu đêm.</p>\n<p>Đèn led này được thiết kế dạng sạc pin, công suất tối đa 60h giúp đỡ phải sạc nhiều lần hại pin. Điểm đáng chú ý của sản phẩm này đó là khoảng cách ánh sáng truyền tới maximum 500m</p>\n<p>Có đèn phụ bên sườn để mắc mồi tối dễ, hỗ trợ bặt tắt cảm biến hồng ngoại tiện ích mà chưa đèn nào có trên thị trường.&nbsp;</p>\n<p>Đây là sản phẩm led nên độ bền cực cao, chống mưa cực tốt.</p>\n<p>Đặc biệt bộ sản phẩm&nbsp;có kèm theo chân đỡ đèn inox cao cấp tùy chỉnh 360 độ.</p>\n<p>Đèn chính có 3 chế độ sáng 15h, 30h, 60h; đèn sườn có 2 màu led đỏ và trắng kèm 1 chế độ cảnh báo SOS tích hợp cảm ứng hồng ngoại tiện ích.</p>\n<p>Kích thước đèn: 140*50MM, kích thước chân đỡ tùy chỉnh cao thừ 40 đến 50CM.</p>\n<p>Ánh sáng đèn: Màu trắng</p>\n<p>Dung lượng pin: 9000mAH</p>\n<p>Sạc qua cáp sạc thông minh USB</p>\n<p>Công xuất: 200W</p>\n<p>Độ xa: 200-500M</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-7-08312d15-3978-40f4-ac81-5246c76c291e.jpg?v=1618893788215\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-5-4b27026d-2017-4c56-88d3-d47cf6558597.jpg?v=1618893796457\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-6-8b4a594a-7d58-4390-b12d-8e60c1bb2889.jpg?v=1618894522419\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-4-74d5ffce-e83f-470c-9b1b-59ae7b633dad.jpg?v=1618893812674\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-3-49a313e6-67e3-4e79-9184-5ae6846e948a.jpg?v=1618893824937\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-2-be0b63ee-fca0-4ae5-a523-4e0cff587754.jpg?v=1618893830774\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-cau-ca-kem-gia-do-1-f93f3809-ed4c-4cb2-9174-5a95747356a5.jpg?v=1618893839033\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/rLjbX0DSyO4\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'ĐÈN LED CÂU CÁ', 'ĐÈN CÂU CÁ, đèn đi câu, đèn đi câu đem, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '400000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/21361113/den-di-cau-nhieu-che-do-kem-chan-do.jpg', '<p>Đèn led câu cá đêm là 1 trong những sản phẩm rất hữu dụng cho anh em cần thủ câu đêm.</p>\n<p>Đèn led này được thiết kế dạng sạc pin, công suất tối đa 60h giúp đỡ phải sạc nhiều lần hại pin', '21361113', '44344005', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1196, 'loa-bluetooth-phong-cach-co-dien-classic-ft-05-cong-suat-5w', 'Loa Bluetooth phong cách cổ điển classic FT-05 công suất 5W', '<p><em><strong>Loa Bluetooth phong cách cổ điển classic FT-05 công suất 5W</strong></em></p>\n<p>Bạn có thể vừa nghe nhạc vừa dùng&nbsp;điện thoại khi đang kết nối bluetooth với loa. Ngoài ra, loa bluetooth FT-05 sử dụng công nghệ loa đơn diaphragm, lọc nhiễu tiên tiến, đem lại âm thanh vượt cả mong đợi so với các sản phẩm cùng tầm giá.</p>\n<p>Loa Bluetooth FT-05 có thiết kế độc lạ hình hoa loa kèn màu vân gỗ, style cổ điển.</p>\n<p>Loa có công suất 5W nên âm thanh trầm ấm, giúp bạn có một không gian lắng trong âm nhạc.</p>\n<p>Kích thước: 95*60*70mm.</p>\n<p>Điện 5V sạc qua cáp USB 5V/1A-2A.</p>\n<p>Công xuất 5W.</p>\n<p>Bluetooth &nbsp;Version 5.0.</p>\n<p>Dung lượng pin lên đến 1200mAh.</p>\n<p>Thời gian sử dụng khoảng 6h.</p>\n<p>Hỗ trợ khe cắm thẻ nhớ MicroSD.</p>\n<p>Màu sắc: Nâu vân gỗ</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/loa-blutoth-v11.jpg?v=1618823622819\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/loa-blutoth-v12.jpg?v=1618823635747\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/loa-blutoth-v17.jpg?v=1618823658329\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/loa-blutoth-v15.jpg?v=1618823678833\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/loa-blutoth-v18.jpg?v=1618823685312\" /></strong></em></p>\n<iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/bROqkD9gPVg\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Loa Bluetooth', 'Loa Bluetooth phong cách cổ điển classic, Loa Bluetooth phong cách cổ điển classic FT-05 công suất 5W, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21357172/loa-bluetooth-phong-cach-co-dien-classic-ft-05-cong-suat-5w.jpg', '<p>Bạn có thể vừa nghe nhạc vừa dùng&nbsp;điện thoại khi đang kết nối bluetooth với loa. Ngoài ra, loa bluetooth FT-05 sử dụng công nghệ loa đơn diaphragm, lọc nhiễu tiên tiến, đem lại âm tha', '21357172', '44321121', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1197, 'ghe-xep-cau-ca-da-ngoai', 'Ghế xếp câu cá, dã ngoại', '<p><strong><em>Ghế xếp câu cá, dã ngoại</em></strong></p>\n<p>Có Thể Gấp Gọn và cho vào bao tiện lợi khi mang đi du lịch hay câu cá</p>\n<p>Vô cùng tiện lợi khi đi bất kể xa hay gần, ghế có thể xếp gọn gàng đặc biệt tiện lợi khi đi xa.</p>\n<p>Với thiết kế thích hợp cho cả người lớn và trẻ nho nhờ vào size phổ thông.</p>\n<p>Được thiết kế chắc chắn, với kiểu dáng phổ thông.</p>\n<p>Ghế gấp rất nhỏ gọn nhưng chịu lực cực tốt.</p>\n<p>Khung ghế bằng 8 ống thép rất chắc chắn. Chịu lực lên đến 120kg. Đi kèm bao đựng tiện lợi.</p>\n<p>Kích thước: 52*33 (52*33*33), 72*34 (72*43*43)</p>\n<p>Màu sắc:&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-9.jpg?v=1618798753067\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-11.jpg?v=1631850810447\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-10.jpg?v=1631850822381\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-9-bdb2b9d9-5bb0-4755-9666-fa4e8125cb3f.jpg?v=1639540776127\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-5.jpg?v=1618798766631\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-1-f224541b-fad5-4a1a-9eac-b94b7299ed61.jpg?v=1618798774901\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-4-48576811-9bd4-4436-8a67-00a976fa3c48.jpg?v=1618798783390\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-6-4f93a3e0-1a4d-49d7-adee-12280295fb12.jpg?v=1618798812505\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-7-4e515c6c-c41b-494a-aec7-e9e89cfc4f43.jpg?v=1618798820715\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-xep-cau-ca-8-67056029-6540-4e3f-b387-ad52084c6659.jpg?v=1618798828426\" /></p>', '', 'Ghế xếp câu cá', 'câu cá, dã ngoại, ghế câu cá, Ghế xếp câu cá, Volcano, volcano.vn', '1', 'Kích thước', '52x33CM', 'Màu sắc', 'Họa tiết xanh', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/21351011/ghe-xep-cau-ca-da-ngoai.jpg', '<p>Vô cùng tiện lợi khi đi bất kể xa hay gần, ghế có thể xếp gọn gàng đặc biệt tiện lợi khi đi xa.</p>\n<p>Với thiết kế thích hợp cho cả người lớn và trẻ nho nhờ vào size phổ thông.</p>\n<p>Đượ', '21351011', '51261718', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:50', '2024-05-29 06:11:50'),
(1198, 'phao-cau-don-phao-cau-dai-cau-tay', 'Phao câu đơn, phao câu đài câu tay', '<p><em><strong>Phao câu đơn, phao câu đài câu tay</strong></em></p>\n<p>Phao chuyên cho câu đài, chống sóng tốt.</p>\n<p>Thiết kế tỷ mỉ đẹp mắt, vật liệu cap cấp chống thấm, ngấn phao màu phản quang dễ nhìn.</p>\n<p>Hỗ trợ câu đêm, dùng pin CR525.</p>\n<p>Phân loại làm 4 kích thước: Mã E-005,&nbsp;Mã E-007,&nbsp;Mã E-005,&nbsp;Mã E-009,&nbsp;Mã E-011 có ghi chú thông số trên hình ảnh mô tả</p>\n<p>Lưu ý: Phao chưa bao gồm pin.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v2.jpg?v=1618655079921\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v4.jpg?v=1618655080819\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v5.jpg?v=1618655081505\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v6.jpg?v=1618655082175\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v9.jpg?v=1618655084235\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v111.jpg?v=1618655086338\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-v10.jpg?v=1618655085245\" /></p>', '', 'Phao câu', 'câu cá, phao câu, phao câu cá, phao câu đài câu tay, Phao câu đơn, phao câu tay, phao câu tày, Volcano, volcano.vn', '1', 'Mã', 'E-005', '', '', '', '', '', '', '', 'deny', '', '96000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21344501/phao-cau-don-phao-cau-dai-cau-tay.jpg', '<p>Phao chuyên cho câu đài, ch