(1199, 'moi-cau-ca-chep-so-4', 'Mồi câu cá chép số 4', '<p><strong><em>Mồi câu cá chép số 4</em></strong></p>\n<p>Mồi câu chuyên câu cá chép được nhiều cần thủ đánh giá tích cực về độ nhạy bén và thu hút cá cực tốt khả năng loại bỏ cá con tốt, lan mùi hương nhanh xa và xâu xuống đáy.</p>\n<p>Mồi được&nbsp;làm từ nhiều nguyên liệu đặc biệt như giun đỏ khô, thịt tôm tươi, khoai lang và các chất hấp dẫn&nbsp;cá&nbsp;chép khác tất cả được say tạo thành cám mịn nhẹ.</p>\n<p>Sử dụng đơn giản có thể dùng riêng hoặc trộn với mồi truyền thống cũng rất hiệu quả.</p>\n<p>Trọng lượng: 100G</p>\n<p>Tỉ lệ trộn với nước 1:1 ngâm khoảng 5 đến 8 phút sau đó nhào như mồi bình thường.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-chep-v3.jpg?v=1618648056572\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-chep-v4.jpg?v=1618648062400\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-chep-v5.jpg?v=1618648068867\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-chep-v7.jpg?v=1618648077762\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-chep-v8.jpg?v=1618648085850\" /></p>', '', '', 'Mồi câu cá chép số 4, mồi câu chép, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21342428/moi-cau-ca-chep-so-4.jpg', '<p>Mồi câu chuyên câu cá chép được nhiều cần thủ đánh giá tích cực về độ nhạy bén và thu hút cá cực tốt khả năng loại bỏ cá con tốt, lan mùi hương nhanh xa và xâu xuống đáy.</p>\n<p>Mồi được&n', '21342428', '44245238', 