(1200, 'son-sap-novo-vo-vang-small-gold-bars-strip-lipstick-ngb6', 'Son sáp NOVO vỏ Vàng Small Gold Bars Strip Lipstick', '<p><em><strong>Son sáp NOVO vỏ Vàng Small Gold Bars Strip Lipstick</strong></em></p>\n<p>Son sáp NOVO vỏ Vàng Small Gold Bars Strip Lipstick&nbsp;- Có làm cho các nàng mê đắm?</p>\n<p>B58: Màu son bình dân trong set son Novo là màu đỏ hồng khá xinh, dễ sử dụng, không cần makeup vẫn có thể đánh màu son này, và hơn nữa tông son này còn không kén da và kén men răng nha.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-3.jpg?v=1618642838468\" /></p>\n<p>21: Đây là tông màu đỏ thuần đã quá quen thuộc rồi, cũng phù hợp mọi tông da, trắng răng, các bạn nào mà là tín đồ của son đỏ thì kiểu gì cũng sẽ có màu đỏ như này mà đúng không. Với tông mày này mình thích đánh lòng môi hàng ngày thôi để không bị tươi quá.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-5.jpg?v=1618642858231\" /></p>\n<p>196: Tiếp theo 196 là tông màu đỏ cam đẹp, trendy, da trắng thì không cần makeup, còn da ngăm thì nên makeup khi sd, nhược điểm duy nhất của màu son satin này là làm xỉn màu răng.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-2.jpg?v=1618642874906\" /></p>\n<p>- 200: Tông màu 200 này là nâu đỏ, tông màu mình thích nhất trong cả 6,đánh lòng môi nhìn sẽ rất xinh luôn, phù hợp cả style Hàn Quốc nữa, đánh full môi thì sẽ hợp vơi style makeup Tây. Nói chung tông màu này không có khuyết điểm gì đối với mình.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-6.jpg?v=1618642889392\" /></p>\n<p>316: Là tông màu đỏ chili khá quen thuộc rồi, ở các bảng màu son Trung mọi người sẽ dễ dàng tìm ra những tông màu cam gạch, đỏ gạch. Tông màu này, dễ sử dụng hơn màu đỏ cam 1 chút.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-4.jpg?v=1618642906566\" /></p>\n<p>420: Cuối cùng 420 là màu hồng đất cũng rất xinh, hợp mọi tông da và nhiều kiểu makeup khác nhau, cá nhân mình thấy màu này sử dụng hàng này rất hợp lí, nhẹ nhàng mà rất xinh.</p>\n<p><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-thoi-1.jpg?v=1618642918445\" /></p>', '', 'Son sáp NOVO', 'SON NOVO, Son sáp NOVO, Son sáp NOVO vỏ Vàng Small Gold Bars Strip Lipstick NGB6, Volcano, volcano.vn', '1', 'Màu sắc', 'B58', '', '', '', '', '', '', '', 'deny', '', '75000', '', '1', '', '', NULL, '', '', '', '100', 'kg', 'images/21341776/son-sap-novo-vo-vang-small-gold-bars-strip-lipstick-ngb6.jpg', '<p>Không làm khô môi, thỏi son Novo Velvet Lipstick với chất son lì nhưng nhờ các thành phần được chiết xuất từ bơ đậu mỡ, thành phần dưỡng ẩm giúp đôi môi bạn gái mềm mịn, tránh bị khô. Đồng', '21341776', '44239106', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1201, 'son-kem-li-duo-ng-a-m-kha-ng-nuo-c-novo', 'Son kem lì Novo Big Ultra HD Matte Lip bền màu chống trôi', '<p><em><strong>Son kem lì Novo Big Ultra HD Matte Lip bền màu chống trôi</strong></em></p>\n<p>Son môi tinh tế và mịn màng, dễ thoa và bám tốt trên môi.</p>\n<p>Son để lại một lớp lì trên môi, và trang điểm môi tự nhiên hơn.</p>\n<p>Công thức dưỡng ẩm và ngăn ngừa mất độ ẩm.</p>\n<p>Chông trôi, chống thấm, chống dính giúp lớp trang điểm môi không bị phai suốt cả ngày.</p>\n<p>Sản phẩm rất phù hợp làm quà tặng cho gia đình, bạn bè, đồng nghiệp.</p>\n<p>Xuất xứ: Nội địa Trung&nbsp;</p>\n<p>Thương hiệu: Novo</p>\n<p>Dung tích: 8g</p>\n<p>#novo #sonkem #lipstick #Sonkemlìdưỡngẩm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v9.jpg?v=1618630328541\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v1.jpg?v=1618630351721\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v2.jpg?v=1618630352682\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v3.jpg?v=1618630353399\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v4.jpg?v=1618630354065\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v5.jpg?v=1618630354752\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v6.jpg?v=1618630355435\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v7.jpg?v=1618630356303\" /><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-son-moi-v8.jpg?v=1618630356984\" /></strong></em></p>', '', 'Son kem lì', 'son kem, sơn kem lì, Son kem lì dưỡng ẩm kháng nước NOVO, son kem novo, son nước, Volcano, volcano.vn', '1', 'Màu sắc', '1', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21340008/son-kem-li-duo-ng-a-m-kha-ng-nuo-c-novo.jpg', '<p>Son môi tinh tế và mịn màng, dễ thoa và bám tốt trên môi.</p>\n<p>Son để lại một lớp lì trên môi, và trang điểm môi tự nhiên hơn.</p>\n<p>Công thức dưỡng ẩm và ngăn ngừa mất độ ẩm.</p>\n<p>Ch', '21340008', '44233697', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1202, 'pin-phao-cau-ca-cr-425-lithium-3v', 'Pin phao câu cá CR425 Lithium 3V (vỉ 5 pin)', '<p><em><strong>Pin phao câu cá CR425 Lithium 3V (vỉ 5 pin)</strong></em></p>\n<p>Pin Phao câu cá, Pin điện tử CR425 là dòng pin chuyên được sử dụng phao câu cá, giúp các bạn có thể thấy phao câu vào ban đêm.</p>\n<p>Pin chất lượng cao duy trì độ&nbsp; sáng của phao đèn trong thời gian dài hơn.</p>\n<p>Pin CR-425 có kích thước đường kính 4mm, dài 25mm.</p>\n<p>Giá sản phẩm: Giá vỉ 05 pin</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/pin-cr425-v2.jpg?v=1618645059102\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/pin-cr425-v8.jpg?v=1618645068961\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/pin-cr425-v6.jpg?v=1618645086601\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/pin-cr425-v7.jpg?v=1618645098180\" /></p>', '', 'Pin phao câu cá', 'câu cá, pin phao câu cá, Pin phao câu cá CR-425 Lithium 3V (vỉ 5 pin), Pin phao câu cá CR425 Lithium 3V (vỉ 5 pin), Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21339465/pin-phao-cau-ca-cr-425-lithium-3v.jpg', '<p>Pin Phao câu cá, Pin điện tử CR425 là dòng pin chuyên được sử dụng phao câu cá, giúp các bạn có thể thấy phao câu vào ban đêm.</p>\n<p>Pin chất lượng cao duy trì độ&nbsp; sáng của phao đèn ', '21339465', '44232766', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1203, 'moi-cau-ca-ro-phi', 'Mồi câu cá rô phi 120G', '<p><em><strong>Mồi câu cá rô phi 120G</strong></em></p>\n<p>Mồi câu chuyên cho cá rô phi vô cùng hiệu quả.</p>\n<p>Mồi được chế biến Protein thực vật và động vật, axit amin, vitellin thơm, chất hấp dẫn cá.</p>\n<p>Cách dùng:</p>\n<p>Trộn với nước tỷ lệ 1:1</p>\n<p>&nbsp;Ngâm&nbsp;trong 5-8 phút</p>\n<p>&nbsp;Có thể dùng chung với mồi khác.</p>\n<p>Trọng lượng: 120G</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-me-1.jpg?v=1618473604850\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-me-2.jpg?v=1618473611685\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-me-4.jpg?v=1618473619291\" /></strong></em></p>', '', 'Mồi câu cá rô phi 120G', 'mồi câu cá, mồi câu cá rô, mồi cau rô phi, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21275433/moi-cau-ca-ro-phi.jpg', '<p>Mồi câu chuyên cho cá rô phi vô cùng hiệu quả.</p>\n<p>Mồi được chế biến Protein thực vật và động vật, axit amin, vitellin thơm, chất hấp dẫn cá.</p>\n<p>Cách dùng:</p>\n<p>Trộn với nước tỷ l', '21275433', '44131697', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1204, 'day-cap-mo-cua-cop-sau-xe-ban-tai-ford-ranger', 'Dây cáp mở cốp sau xe bán tải Ford Ranger', '<p><em><strong>Dây cáp mở cốp sau xe bán tải Ford Ranger</strong></em></p>\n<p>Dây cáp thay thế cáp nguyên bản trên xe</p>\n<p>Được làm từ những chất liệu cao cấp , độ bền cao, thiết kế chính xác tuyệt đối, đồng bộ với các phụ tùng của xe.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-1-8004f23d-71bb-4683-af84-4615ad909e0e.jpg?v=1618470626161\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-5-19bb3c71-e5f6-411c-b7ed-0b1ef8279423.jpg?v=1618470632829\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-6-e4e8e0bd-91a7-4aaa-b525-451e32818057.jpg?v=1618470639103\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-2.jpg?v=1618461974924\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-3.jpg?v=1618461983036\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-cua-xe-ranger-4.jpg?v=1618461989777\" /></p>\n<p>&nbsp;</p>', '', 'Dây cáp mở cốp sau xe bán tải Ford Ranger', 'dây cáp, Dây cáp đỡ cốp sau xe bán tải Ford Ranger, dây cáp mỏ thùng xe bán tải, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '220000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/21272202/day-cap-mo-cua-cop-sau-xe-ban-tai-ford-ranger.jpg', '<p>Dây cáp thay thế cáp nguyên bản trên xe</p>\n<p>Được làm từ những chất liệu cao cấp , độ bền cao, thiết kế chính xác tuyệt đối, đồng bộ với các phụ tùng của xe.</p>', '21272202', '44127091', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1205, 'luoi-lot-ghe-tua-lung-hat-gia-go-mat-xa', 'Lưới lót ghế tựa lưng hạt giả gỗ mát xa', '<p><em><strong>Lưới lót ghế tựa lưng hạt giả gỗ mát xa</strong></em></p>\n<p>Lót ghế ô tô, ghế văn phòng&nbsp;có tựa lưng giúp các tài xế lái xe thoải mái hơn, giảm thiểu các bệnh về xương khớp và cột sống.</p>\n<p>Cấu tạo từ các&nbsp;hạt nhựa giả gỗ&nbsp;an toàn cho sức khỏe.</p>\n<p>Phù hợp với mọi loại ghế.</p>\n<p>Thiết kế sang trọng, màu sắc tinh tế và nổi bật.</p>\n<p>Giúp thoáng khí, tránh mồ hôi lưng thấm vào bao ghế gây ẩm mốc (nhất là khi mùa hè)</p>\n<p>Giúp lưu thông máu, cơ thể thoải mái dù phải ngồi trên xe nhiều giờ liên tục</p>\n<p>Kích thước: Lót ghế Dài 42cm, Rộng 48cm, Kích thước tấm tựa lưng cao 58cm, Rộng 48cm</p>\n<p>Màu sắc: Nâu, đen</p>\n<p>Giá sản phẩm:&nbsp;&nbsp;01 chiếc.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v3.jpg?v=1618457273330\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v2.jpg?v=1618457283112\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v4.jpg?v=1618457291198\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v5.jpg?v=1618457298819\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v7.jpg?v=1618457307892\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tua-lung-gia-hat-go-v9.jpg?v=1618457314606\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" ori