(1207, 'bat-lua-dien-cam-ung-van-tay-sgs', 'Bật lửa điện cảm ứng vân tay SGS', '<p><em><strong>Bật lửa điện cảm ứng vân tay SGS</strong></em></p>\n<p>Không dùng ga - không dùng xăng _ Bạn chỉ cần cắm bật lửa vào cổng USB máy tính để sạc lại sau&nbsp;thời gian sử dụng.<br />\nSản phẩm có thiết kế sang trọng : Nhỏ - Đẹp - Sang ngay từ cái nhìn đầu tiên của bạn<br />\nHệ thống đánh lửa cảm ứng vân tay xịn sò, độc đáo, không ngại gió...<br />\nChế độ sạc pin thông minh - Có đèn Led báo sạc,và tự ngắt sạc khi pin đầy<br />\nThời gian sạc đầy Pin ~ 30 phút</p>\n<p>Kích thước: 7.5*2.1cm</p>\n<p>Màu sắc: Đen, đỏ, xab dương, xanh lá.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v9-34261171-09aa-451c-8b22-0f4ad5a1de73.jpg?v=1618203374211\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v6.jpg?v=1618203382518\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v5.jpg?v=1618203388498\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v4.jpg?v=1618203394804\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v8.jpg?v=1618203404583\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-2.jpg?v=1618203416554\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"600\" original-width=\"600\" src=\"//bizweb.dktcdn.net/100/200/904/files/anh-bat-lua-dien-moi-v3.jpg?v=1618203422795\" /></strong></em></p>', '', 'Bật lửa điện', 'bật cảm úng vân tay, bật lửa, Bật lửa điện, bật lửa điện cảm ưng vần tay, Bật lửa điện cảm ứng vân tay SGS, freeship, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/21240324/bat-lua-dien-cam-ung-van-tay-sgs.jpg', '<p>Không dùng ga - không dùng xăng _ Bạn chỉ cần cắm bật lửa vào cổng USB máy tính để sạc lại sau&nbsp;thời gian sử dụng.<br />\nSản phẩm có thiết kế sang trọng : Nhỏ - Đẹp - Sang ngay từ cái ', '21240324', '43972414', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:51', '2024-05-29 06:11:51'),
(1208, 'mat-duong-mat-na-lap-man-hinh-dvd-android-va-bang-dieu-khien-cho-xe-misubishi-xpander-2019-2017', 'Mặt dưỡng, mặt nạ lắp màn hình DVD Android và bảng điều khiển Cho Xe Misubishi XPANDER 2019-2017', '<p><strong><em>Mặt dưỡng, mặt nạ lắp màn hình DVD Android Cho Xe&nbsp;Misubishi XPANDER&nbsp;2019-2017</em></strong></p>\n<p>Mặt dưỡng lắp màn hình DVD ô tô&nbsp;cũng là một trong số thiết bị nội thất được đánh giá cao về tính ứng dụng, trở thành sản phẩm không thể thiếu của những người yêu thích các thiết bị, phụ kiện cho xe ô tô.</p>\n<p>Mặt dưỡng&nbsp;là&nbsp;khung bao bọc xung quanh&nbsp;đầu DVD ô tô&nbsp;giúp tăng thêm tính thẩm mỹ của khu vực lắp đầu DVD.</p>\n<p>Sử&nbsp;dụng dùng để lắp đặt&nbsp;thay thế đầu đọc nguyên bản theo xe.</p>\n<p>Giúp bạn tiết kiệm chi phí ở mứ thấp nhất.</p>\n<p>Chất liệu: Sử dụng chất liệu nhựa ABS cao cấp. Đảm bảo độ chắc chắn và bền đẹp cùng với thời gian.</p>\n<p>Sản phẩm dành riêng cho xe&nbsp;<strong><em>Misubishi XPANDER&nbsp;2019-2017&nbsp;màn hình DVD Android 9inch&nbsp;</em></strong>.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-xe-o-to-xpander-3.jpg?v=1618026256775\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-xe-o-to-xpander-4.jpg?v=1618026257630\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-xe-o-to-xpander-2.jpg?v=1618026272217\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-xe-o-to-xpander-1.jpg?v=1618026281496\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mat-duong-xe-o-to-xpander-5.jpg?v=1618026288335\" /></p>', '', 'Mặt dưỡngmàn hình DVD', 'khung nàm hình ô tô, Mặt dưỡng, mặt dưỡng ô tô, mặt nạ lắp màn hình DVD, mặt nạ lắp màn hình DVD Android và bảng điều khiển Cho Xe Misubishi XPANDER 2019-2017, ô tô, phụ  kiện ô tô, Volcano, ', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21226086/mat-duong-mat-na-lap-man-hinh-dvd-android-va-bang-dieu-khien-cho-xe-misubishi-xpander-2019-2017.jpg', '<p>Mặt dưỡng&nbsp;là&nbsp;khung bao bọc xung quanh&nbsp;đầu DVD ô tô&nbsp;giúp tăng thêm tính thẩm mỹ của khu vực lắp đầu DVD.</p>\n<p>Sử&nbsp;dụng dùng để lắp đặt&nbsp;thay thế đầu đọc nguyên', '21226086', '43939399', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:52', '2024-05-29 06:11:52'),
(1209, 'bo-ghe-cau-ca-cao-cap-kem-phu-kien', 'Bộ ghế câu cá cao cấp kèm phụ kiện', '<p><em><strong>Bộ ghế câu cá cao cấp kèm phụ kiện</strong></em></p>\n<p>Trong câu cá thì bộ ghế câu là phụ kiện không thể thiếu đặc biệt câu đơn bạn phải ngồi hàng giờ đồng hồ...Ghế dùng để ngồi có phần tựa lưng tiện dụng.</p>\n<p>Phụ kiện kèm theo đầy đủ gồm: 02 pát gác cần, 01 giá để mồi, 02 pát gắn ô, 01 chống chần 2.1m, 02 pát để gác chân, 01 pát gắn đèn chân ren 6mm, 01 lồng đựng cá 5 tầng 30CM&nbsp;cao cấp 1 balo đựng cao cấp.</p>\n<p>Bộ ghế câu tiện sử dụng được xếp gọn gàng bỏ vào túi đồ một cách đơn giản nhất.</p>\n<p>Được làm bằng vật liệu nhôm cao cấp sơn màu đen, nhẹ và khung rất chắc chắn đảm bảo khỏe cho người&nbsp;80-120kg.&nbsp;</p>\n<p>&nbsp;Kích thước: 58*36*68cm, chân ghế có thể điều chỉnh kéo dài thêm 12cm, kích thước thu gọn 36*62*18cm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v13.jpg?v=1617964082201\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v14.jpg?v=1617964093232\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v15.jpg?v=1617964105148\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v157.jpg?v=1617964113505\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v3.jpg?v=1617964131969\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v10.jpg?v=1617964138129\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v12.jpg?v=1617964146379\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-cau-ca-v5.jpg?v=1617964152269\" /></strong></em></p>', '', 'Ghế câu cá', 'Bộ ghế câu cá cao cấp kèm phụ kiện, ghế câu, ghế câu cá, ghế câu đơn, ghế đi câu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '890000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/21221188/bo-ghe-cau-ca-cao-cap-kem-phu-kien.jpg', '<p>Trong câu cá thì bộ ghế câu là phụ kiện không thể thiếu đặc biệt câu đơn bạn phải ngồi hàng giờ đồng hồ...Ghế dùng để ngồi có phần tựa lưng tiện dụng.</p>\n<p>Phụ kiện kèm theo đầy đủ gồm: ', '21221188', '43924390', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:52', '2024-05-29 06:11:52'),
(1210, 'bo-boc-ghe-da-theu-vuong-mien-tang-kem-goi-tua-va-boc-vo-lang', 'Bộ bọc ghế da thêu Vương Miện tặng kèm gối tựa và bọc vô lăng', '<p><em><strong>Bộ bọc ghế da thêu Vương Miện tặng kèm gối tựa và bọc vô lăng</strong></em></p>\n<p>Bộ bọc ghế, áo bao gồm bọc 5 chỗ cho các dòng xe du lịch hạng B, C, D như mazda, honda, toyota, nissan, KIA, Mercedes, Lexus....</p>\n<p>Với chất liệu làm từ da mềm cao cấp Split (phần xơ của phần da đã được tách ra để làm da Top grain) được tráng một lớp Polyurethane và dập nổi trên bề mặt. Có khả năng bụi, chống thấm nước&nbsp;có độ bền cực cao.</p>\n<p>Da cực mềm, chống nổ không nhăn.</p>\n<p>Thêu họa tiết vương miện đẳng cấp.</p>\n<p>Lắp đặt đơn giản tại nhà không cần đến gara.</p>\n<p>Thiết kế cực kỳ Sang Chảnh giúp tôn lên vẻ sang trọng và đẳng cấp của xe!</p>\n<p>Bộ sản phẩm chia làm 2 phân loại:&nbsp;Có kèm gối tựa và bọc vô lăng, bộ không kèm gối tựa!</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-theu-vuong-mien-v8.jpg?v=1617875729858\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-theu-vuong-mien-v7.jpg?v=1617875741146\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-theu-vuong-mien-v4.jpg?v=1617875751925\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-theu-vuong-mien-v3.jpg?v=1617875759823\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-theu-vuong-mien-v10.jpg?v=1617875785682\" /></strong></em></p>\n<p><em><strong><img data-thu