(1211, 'moi-cau-ca-diec-ca-chep-tram-co-300g', 'Mồi câu cá diếc, cá chép, trắm cỏ 300G', '<p><em><strong>Mồi câu cá diếc, cá chép, trắm cỏ 300G</strong></em></p>\n<p>Mồi câu chuyên cho các loại cá diếc, cá chép, trắm cỏ rất hiệu quả.</p>\n<p>Mồi được chế biến Protein thực vật và động vật, axit amin, vitellin thơm, chất hấp dẫn cá.</p>\n<p>Cách dùng:</p>\n<p>Trộn với nước tỷ lệ 1:1</p>\n<p>&nbsp;Ngâm&nbsp;trong 5-8 phút</p>\n<p>&nbsp;Có thể dùng chung với mồi khác.</p>\n<p>Trọng lượng: 300G</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-6.jpg?v=1617857682611\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"333\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-1.jpg?v=1617857692462\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"333\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-2.jpg?v=1617857698909\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-v4.jpg?v=1617857705958\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"333\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-4.jpg?v=1617857713505\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"333\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-diec-ca-chep-tram-co-5.jpg?v=1617857721369\" /></strong></em></p>', '', 'Mồi câu cá', 'cá chép, mồi câu, mồi câu cá, mồi câu cá chép, Mồi câu cá diếc, trắm cỏ 300G, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21202950/moi-cau-ca-diec-ca-chep-tram-co-300g.jpg', '<p>Mồi câu chuyên cho các loại cá diếc, cá chép, trắm cỏ rất hiệu quả.</p>\n<p>Mồi được chế biến Protein thực vật và động vật, axit amin, vitellin thơm, chất hấp dẫn cá.</p>\n<p>Cách dùng:</p>\n', '21202950', '43850782', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:52', '2024-05-29 06:11:52'),
(1212, 'bot-phu-gia-moi-cau-ca-nuoc-ngot', 'Bôt phụ gia mồi câu cá nước ngọt', '<p><strong>Bôt phụ gia mồi câu cá nước ngọt</strong></p>\n<p>Sản phẩm&nbsp;dạng bột bông tuyết&nbsp;chuyên dùng làm phụ gia cho mòi câu truyền thống,&nbsp;nguyên liệu chính của nó được chiết xuất &nbsp;từ&nbsp;khoai tây&nbsp;cộng thêm một lượng axit amin và tinh chất protein động thực vật thích hợp, từ đó có thể nhanh chóng thu hút cá.</p>\n<p>Phù hợp cho câu hầu hết tất cả các lạo cá nước ngọt: sông, suối,&nbsp;ao, hồ...</p>\n<p>Mồi sử dụng trộn trực với các lại mồi khác</p>\n<p>Trọng lượng: 100g/gói</p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-v3.jpg?v=1617853802931\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-v4.jpg?v=1617853810959\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-v5.jpg?v=1617853818523\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-1.jpg?v=1617853824868\" /></strong></p>\n<p><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-2.jpg?v=1617853831024\" /></strong></p>', '', 'Bôt phụ gia mồi câu', 'Bôt phụ gia mồi câu, mồi câu, phụ gia câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21201272/bot-phu-gia-moi-cau-ca-nuoc-ngot.jpg', '<p>Sản phẩm&nbsp;dạng bột bông tuyết&nbsp;chuyên dùng làm phụ gia cho mòi câu truyền thống,&nbsp;nguyên liệu chính của nó được chiết xuất &nbsp;từ&nbsp;khoai tây&nbsp;cộng thêm một lượng axit', '21201272', '4