(1214, 'chan-cam-chong-can-gac-can-cau-ca', 'Chân cắm chống cần, gác cần câu cá', '<p><em><strong>Chân cắm chống cần, gác cần câu cá</strong></em></p>\n<p>Mục đích dễ dàng di chuyển mọi lúc Chất liệu INOX rất chắc chắn.&nbsp;</p>\n<p>Là sản phẩm đa năng hoàn hảo dùng cho cần câu và những loại gác cần thùng hay ghế chưa có chân cắm.</p>\n<p>Chất liệu: chân thép và ống inox bền bỉ</p>\n<p>Kích thước thu gọn 23.3.5*3CM</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-1.jpg?v=1617785861266\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-2.jpg?v=1617785862505\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-3.jpg?v=1617785863297\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-4.jpg?v=1617785864280\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-v4.jpg?v=1617785865564\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-do-gac-can-cau-5.jpg?v=1617786381483\" /></strong></em></p>', '', 'Chân cắm chống cần, gác cần câu cá', 'Chân cắm chống cần, gác cần câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '115000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21194696/chan-cam-chong-can-gac-can-cau-ca.jpg', '<p>Mục đích dễ dàng di chuyển mọi lúc Chất liệu INOX rất chắc chắn.&nbsp;</p>\n<p>Là sản phẩm đa năng hoàn hảo dùng cho cần câu và những loại gác cần thùng hay ghế chưa có chân cắm.</p>\n<p>Chấ', '21194696', '43817695', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:54', '2024-05-29 06:11:54'),
(1215, 'day-cuoc-cau-ca-sieu-ben-super-strong-50m', 'Dây cước câu cá siêu bền Super Strong 50M', '<p><em><strong>Dây cước câu cá siêu bền Super Strong 50M</strong></em></p>\n<p>Dây cước câu&nbsp;100% nylon, siêu bền, chống mài mòn.</p>\n<p>Dây&nbsp;rất mềm, dễ dàng kết nối với móc câu cá, tạo thành mối liên kết bền vững.</p>\n<p>Dây cước câu cá này luôn giữ vững được độ mạnh mẽ và bền vững cho toàn bộ sản phẩm, mang đến cảm giác cao và rõ rệt khiến cần thủ dễ dàng cảm nhận được khi cá cắn câu.</p>\n<p>Thông số dây: 2.0 (0.235mm), cuộn dài 50m&nbsp;tải cá từ 3 đến 5kg</p>\n<p>Màu sắc: Vàng, Trắng</p>\n<p>#cướccâucá #cuoccauca #dâycâucá #daycauca #cướccâucádaiwa #cuoccaucadaiwa #dâycâucádaiwa #daycaucadaiwa #daiwajustron</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v4.jpg?v=1617779925077\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v2.jpg?v=1617779934810\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v7.jpg?v=1617779943809\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v8.jpg?v=1617779951765\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v9.jpg?v=1617779958485\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-50m-v10.jpg?v=1617779970599\" /></strong></em></p>', '', 'Dây cước câu cá', 'câu cá, dây câu nhật, dây cước câu, Dây cước câu cá, Volcano, volcano.vn', '1', 'Màu', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/21193546/day-cuoc-cau-ca-sieu-ben-super-strong-50m.jpg', '<p>Dây cước câu&nbsp;100% nylon, siêu bền, chống mài mòn</p>\n<p>Dây&nbsp;rất mềm, dễ dàng kết nối với móc câu cá, tạo thành mối liên kết bền vững.</p>\n<p>Dây cước câu cá này luôn giữ vững đượ', '21193546', '43815667', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:54', '2024-05-29 06:11:54'),
(1216, 'gac-can-cau-carbon-gan-thung-gan-ghe-cau', 'Gác cần câu carbon gắn thùng, gắn ghế câu', '<p><em><strong><span style=\"font-size:16px;\">Gác cần câu carbon gắn thùng, gắn ghế câu&nbsp;</span></strong></em></p>\n<p><span style=\"font-size:16px;\">Gác cần câu carbon</span> chuyên&nbsp;<span style=\"font-size:16px;\">gắn thùng, gắn ghế câu</span> cho câu đơn, câu đài rất tiện dụng lại nhỏ ngọn.</p>\n<p>Chống cần làm từ chất liệu Carbon cao cấp</p>\n<p>Đầu đỡ cần xoay 380 độ.</p>\n<p>Kích thươc chia làm 2 phân loại: 2.1M và 2.4M:</p>\n<p>&nbsp;2.1M: Thu gọn 48CM, gốc 18MM, ngọn 8.2MM, nặng 236g</p>\n<p>&nbsp;2.4M: Thu gọn 50CM, gốc 19.8MM, ngọn 8.2MM, nặng 236g</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-3.jpg?v=1617768568894\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-4.jpg?v=1617768569631\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-5.jpg?v=1617768582790\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-6.jpg?v=1617768589160\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-1.jpg?v=1617768595813\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-ca-2-1m-2.jpg?v=1617768602368\" /></strong></em></p>', '', 'Gác cần câu carbon  ', 'Gác cần câu carbon gắn thùng, gắn ghế câu, Volcano, volcano.vn', '1', 'Kích thước', '2.1M', '', '', '', '', '', '', '', 'deny', '', '320000', ''