(1218, 'pin-sac-du-phong-nang-luong-mat-troi-sieu-mong-10000mah', 'Pin sạc dự phòng năng lượng mặt trời siêu mỏng 10000mAh', '<p><em><strong>Pin sạc dự phòng năng lượng mặt trời siêu mỏng 10000mAh</strong></em></p>\n<p>Công suất thiết kế 10.000 mAh, có thể nạp năng lượng dưới ánh sáng mặt trời.</p>\n<p>Với 2 cổng sạc USB, tương thích với mọi loại Smartphone.</p>\n<p>Thiết kế nhỏ và tính di động cao dễ sử dụng, Đèn báo chỉ số trong quá trình sạc xả thuận tiện dễ sử dụng.</p>\n<p>Tích hợp 2 cổng sạc trực tiếp qua Typec</p>\n<p>Thiết kế Build-in Pin Lithium Polymer chống nổ, trọng lượng nhẹ, nhỏ gọn và đáng tin cậy, tuổi thọ cao tới hơn 1.000 lần sạc.</p>\n<p>Input: 5V - 1.0A</p>\n<p>Output: 5V-2.1A</p>\n<p>Kích thước: 155*105*8.6MM</p>\n<p>Màu sắc: Trắng.</p>\n<p>#sacduphong #cucsacduphong #pinsacduphong #pinduphong #pinsac #sacduphongkhongday #sacduphongloithep #sacduphonggiare #sacduphong40000mah #sackhongday #sacdienthoai #duphong #sacduphongcaocap #sacduphongthongminh #sacduphongchinhhang #sacduphongmini #sacnhanhvonhom #Pinsạcdựphòngnăng lượngmặttrời40000mAh</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-du-phong-nang-luong-mat-troi-v3.jpg?v=1617758609216\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-du-phong-nang-luong-mat-troi-v5.jpg?v=1617758637036\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-du-phong-nang-luong-mat-troi-v7.jpg?v=1617758644005\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-du-phong-nang-luong-mat-troi-v9.jpg?v=1617758650110\" /></p>', '', 'Pin sạc dự phòng', 'Pin sạc dự phòng năng lượng mặt trời, Pin sạc dự phòng năng lượng mặt trời siêu mỏng 10000mAh, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '450000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/21180532/pin-sac-du-phong-nang-luong-mat-troi-sieu-mong-10000mah.jpg', '<p>Công suất thiết kế 10.000 mAh, có thể nạp năng lượng dưới ánh sáng mặt trời.</p>\n<p>Với 2 cổng sạc USB, tương thích với mọi loại Smartphone.</p>\n<p>Thiết kế nhỏ và tính di động cao dễ sử d', '21180532', '43777014', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:56', '2024-05-29 06:11:56'),
(1219, 'khung-man-hinh-android-va-bang-dieu-khien-cho-xe-ford-ranger-2011-205', 'Mặt dưỡng, mặt nạ lắp màn hình DVD Android và bảng điều khiển Cho Xe Ford Ranger 2011-2015', '<p><em><strong>Mặt dưỡng, mặt nạ lắp màn hình DVD Android và bảng điều khiển Cho Xe Ford Ranger 2011-205</strong></em></p>\n<p>Mặt dưỡng lắp màn hình DVD ô tô&nbsp;cũng là một trong số thiết bị nội thất được đánh giá cao về tính ứng dụng, trở thành sản phẩm không thể thiếu của những người yêu thích các thiết bị, phụ kiện cho xe ô tô.</p>\n<p>Mặt dưỡng&nbsp;là&nbsp;khung bao bọc xung quanh&nbsp;đầu DVD ô tô&nbsp;giúp tăng thêm tính thẩm mỹ của khu vực lắp đầu DVD.</p>\n<p>Đồng thời, gia tăng tuổi thọ đáng kể cho màn hình.</p>\n<p>Sử&nbsp;dụng dùng để lắp đặt&nbsp;thay thế đầu đọc nguyên bản theo xe.</p>\n<p>Chất liệu: Sử dụng chất liệu nhựa ABS cao cấp. Đảm bảo độ chắc chắn và bền đẹp cùng với thời gian.</p>\n<p>Bộ sản phẩm gồm khung mặt nạ, 2 nút bấm cảnh báo và khóa kính&nbsp;+ cáp kết nối.</p>\n<p>Sản phẩm dành riêng cho xe&nbsp;2011-2015 có màn DVD 9\".</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-man-hinh-o-to-2.jpg?v=1617696645154\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-man-hinh-o-to-4.jpg?v=1617696655882\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-man-hinh-o-to-1.jpg?v=1617696663557\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-man-hinh-o-to-3.jpg?v=1617696670399\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khung-man-hi