(1223, 'sac-binh-ac-quy-o-to-xe-may-12-24v', 'Sạc bình ắc quy ô tô, xe máy 12 - 24V AJ-618E', '<p><strong><em>Sạc bình ắc quy<span style=\"font-size:14px;\"> ô tô, xe máy 12 - 24V AJ-618E</span></em></strong></p>\n<p><span style=\"font-size:14px;\">Bộ sản phẩm chuyên dụng để sạc các loại bình ắc quy khô cho ô tô xe máy xe điện. Bạn cũng có thể sạc cho các loại bình từ 1.2A&nbsp;đến 200A 12V 24V các loại.</span></p>\n<p><span style=\"font-size:14px;\">Sạc bình ắc quy này là loại tự&nbsp;động ngắt thông minh khi bình&nbsp;đầy rất tốt.</span></p>\n<p><span style=\"font-size:14px;\">Điện thế vào: 220V -240V ~ 50 / 60Hz<br />\nĐện thế sạc: 12V – 24V<br />\nSạc&nbsp;ắc&nbsp;quy: 1.2AH – 200AH<br />\nCông suất: 220W.<br />\nCó chế độ chọn thủ công hoặc tự&nbsp;động ngắt sạc&nbsp;đầy. Tự&nbsp;động bảo vệ khi sai cực.</span></p>\n<p><span style=\"font-size:14px;\">Có màn hình led báo điện áp là % Pin khi sạc<br />\nKích thước: 180 * 145 * 70mm<br />\nChiều dài dây nguồn: 100CM<br />\nTrọng lượng: 800g</span></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-2.jpg?v=1617259555701\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-v2.jpg?v=1617259562013\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-1.jpg?v=1617259574241\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-5.jpg?v=1617259594741\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-4.jpg?v=1617259604548\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-ac-quy-6.jpg?v=1617259612297\" /></strong></em></p>', '', 'Sạc bình ắc quy', 'ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '375000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/21118235/sac-binh-ac-quy-o-to-xe-may-12-24v.jpg', '<p><span style=\"font-size:14px;\">Bộ sản phẩm chuyên dụng để sạc các loại bình ắc quy khô cho ô tô xe máy xe điện. Bạn cũng có thể sạc cho các loại bình từ 1.2A&nbsp;đến 200A 12V 24V các loại.', '21118235', '43619122', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:56', '2024-05-29 06:11:56'),
(1224, 'lot-cop-da-cach-nhiet-cho-honda-air-blade-2020-2021', 'Lót cốp da cách nhiệt, chống sốc cho Honda Air Blade', '<h1><em><strong><span style=\"font-size:14px;\">Lót cốp da cách nhiệt, chống sốc cho Honda Air Blade</span></strong></em></h1>\n<p>Lót cốp da cách nhiệt cho xe Honda Air Blade&nbsp;với mặt trong chất liệu da 5D được may rất chắc chắn, mặt ngoài được bọc 1 lớp nỉ cách nhiệt rất hiệu quả.<br />\nLót cốp da cách nhiệt được may thêm 1 túi da nhỏ để tiện lợi khi bỏ giấy tờ xe, điện thoại, chìa khoá, sổ nhỏ...<br />\nLót cốp da cách nhiệt là sản phẩm rất cần thiết cho xe tay ga với 3 tính năng chính:<br />\n- Cách nhiệt: Chống nóng cho toàn bộ đồ vật bên trong cốp, giữ độ bền cho đồ vật khỏi hư hại khi nhiệt độ tăng cao.<br />\n- Chống va đập: Được làm từ chất liệu da 5D rất mềm, dày giúp để đồ điện tử trong xe khỏi va dập khi di chuyển.<br />\n- Dễ dàng vệ sinh: Khi lót cốp dơ chỉ cần lấy ra dùng khăn ướt nhẹ lau sơ rồi gắn lại là sạch sẽ, thơm tho.<br />\nLót cốp da cách nhiệt gắn vừa khít cho xe Honda Air Blade 2013-2019,&nbsp;Honda Air Blade&nbsp;2020 - 2021</p>\n<p>#Lótcốpdacáchnhiệt&nbsp;#Lótcốpdachốngsốc #lótcốpxemáy #lótcốpxeAB&nbsp;#lótcốpxeAB2020&nbsp;#lótcốpxeAB2021</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-cach-nhiet-xe-ab-2020-v1.jpg?v=1617091853565\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-cach-nhiet-xe-ab-2020-v2.jpg?v=1617091861322\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-cach-nhiet-xe-ab-2020-v3.jpg?v=1617091873472\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-cach-nhiet-xe-ab-2020-v6.jpg?v=1617091884411\" /></p>\n<p><img data-thumb=\"original\" original-hei