(1228, 'ty-ham-thuy-luc-mo-cop-xe-ban-tai-ranger-triton-vigo', 'Ty Hãm Thủy Lực Mở Cốp Xe Bán Tải Ranger 2009-2019', '<p><em><strong>Ty Hãm Thủy Lực Mở Cốp Xe Bán Tải Ranger 2009-2019</strong></em></p>\n<p>Như mọi người đã biết, cốp sau của các dòng xe bán tải khi mở ra khá nặng, vì thế mà ty hãm mở nắp thùng xe bán tải ra đời, giúp việc mở cốp trở nên nhẹ nhàng, dễ dàng mà không hề mất sức.&nbsp;</p>\n<p>Ty thủy lực hãm cốp sau dành cho xe bán tải giúp bạn đóng mở cốp dễ dàng và thuận tiện hơn.<br />\nĐỡ nguy hiểm khi có người già và trẻ nhỏ.</p>\n<p>Chất liệu: Phần ngoài sắt sơn đen,&nbsp;thanh trong Inox cao cấp</p>\n<p>Sản phẩm dành riêng cho từng dòng xe:&nbsp;Ford&nbsp;Ranger T5 T6 2009-2019.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ty-thuy-luc-ham-cop-sau-xe-ban-tai-1-db22f42c-20c8-4acf-830c-87af8da7b12d.jpg?v=1711008359387\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ty-thuy-luc-ham-cop-sau-xe-ban-tai-2-e43f3b54-528f-401a-9be0-d74a2e5b8779.jpg?v=1711008365194\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ty-thuy-luc-ham-cop-sau-xe-ban-tai-3-7113ebf4-6d52-480f-8372-c6aeeb59e008.jpg?v=1711008373655\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ty-thuy-luc-ham-cop-sau-xe-ban-tai-5.jpg?v=1711008379063\" /></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ty-thuy-luc-ham-cop-sau-xe-ban-tai-v1.jpg?v=1616642771552\" /></strong></em></p>', '', 'Ty Hãm Thủy Lực Mở Cốp Xe Bán Tải', 'ô tô, phụ  kiện ô tô, Triton, ty cốp sau xe bán tải, ty hãm cốp sau, Ty Hãm Thủy Lực Mở Cốp Xe Bán Tải, Ty Hãm Thủy Lực Mở Cốp Xe Bán Tải Ranger, Ty mở cốp chậm, Vigo, Volcano, volcano.vn', '1', 'Phân loại', 'Bên trái', '', '', '', '', '', '', '', 'deny', '', '230000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/21050516/ty-ham-thuy-luc-mo-cop-xe-ban-tai-ranger-triton-vigo.jpg', '<p>Như mọi người đã biết, cốp sau của các dòng xe bán tải khi mở ra khá nặng, vì thế mà ty hãm mở nắp thùng xe bán tải ra đời, giúp việc mở cốp trở nên nhẹ nhàng, dễ dàng mà không hề mất sức.', '21050516', '43399381', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:57', '2024-05-29 06:11:57'),
(1229, 'lot-cop-da-cach-nhiet-cho-honda-vision', 'Lót cốp da cách nhiệt cho Honda Vision', '<p><em><strong>Lót cốp da cách nhiệt cho Honda Vision</strong></em></p>\n<p>Lót cốp da cách nhiệt cho xe Honda Vision, với mặt trong chất liệu da 5D được may rất chắc chắn, mặt ngoài được bọc 1 lớp nỉ cách nhiệt rất hiệu quả.<br />\nLót cốp da cách nhiệt được may thêm 1 túi da nhỏ để tiện lợi khi bỏ giấy tờ xe, điện thoại, chìa khoá, sổ nhỏ...</p>\n<ul>\n<li>Cách nhiệt: Chống nóng cho toàn bộ đồ vật bên trong cốp, giữ độ bền cho đồ vật khỏi hư hại khi nhiệt độ tăng cao.</li>\n<li>Chống va đập: Được làm từ chất liệu da 5D rất mềm, dày giúp để đồ điện tử trong xe khỏi va dập khi di chuyển.</li>\n<li>Dễ dàng vệ sinh: Khi lót cốp dơ chỉ cần lấy ra dùng khăn ướt nhẹ lau sơ rồi gắn lại là sạch sẽ, thơm tho.</li></ul>\n<p>Phân làm 2 loại: đời 2009-2020, đời 2021.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v1.jpg?v=1616557760637\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v8.jpg?v=1616557773093\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v3.jpg?v=1616557781383\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v2.jpg?v=1616557788150\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v4.jpg?v=1616557804770\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v7.jpg?v=1616557811601\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-xe-vision-v10.jpg?v=1616557824564\" /></p>', '', 'Lót cốp da cách nhiệt cho Honda Vision', 'Lót cốp da cách nhiệt cho Honda Vision, lót cốp xe máy, lót cốp xe máy vision, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen chỉ đỏ', 'Đời xe', '2009-2020', '', '', '', '', '', 'deny', '', '280000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/21039258/lot-cop-da-cach-nhiet-cho-honda-vision.jpg', '<ul>\n<li>Cách nhiệt: Chống nóng cho toàn bộ đồ vật bên trong cốp, giữ độ bền cho đồ vật khỏi hư hại khi nhiệt độ tăng cao.</li>\n<li>Chống va đập: Được làm từ chất liệu da 5D rất mềm, dày giúp', '21039258', '43288782', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:57', '2024-05-29 06:11:57'),
(1230, 'sap-thom-vong-xoay-vo-cuc-nang-luong-mat-troi', 'Sáp thơm vòng xoay vô cực năng lượng mặt trời', '<p><em><strong>Sáp thơm vòng xoay vô cực năng lượng mặt trời</strong></em></p>\n<p>Không chỉ là hộp sáp thơm giúp không khí trong xe luôn thơm mát mà đây còn là vật trang trí vô cùng tinh tế cho nội thất của chiếc ô tô yêu quý của bạn.</p>\n<p>Được chế tạo từ hợp kim kẽm cùng lớp mạ và sơn cao cấp, hộp sáp thơm này sẽ nổi bật trên taplo xe của bạn.</p>\n<p>Mùi thơm của sáp thơm sẽ&nbsp;được khuếch tán đều trong xe nhờ chuyển động quay bằng năng lượng mặt trời.</p>\n<p>Nắng càng gắt cánh quạt quay càng nhanh sẽ làm không gian trong xe thêm phần lý thú, thu hút ánh nhìn của mọi người trong lẫn ngoài xe.</p>\n<p>Với thiết kế gồm 2 vòng xoay&nbsp;liên tục quay khi có năng lượng mặt trời.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/con-xoay-vo-cuc-gan-taplo-o-to-v1.jpg?v=1616488253675\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/con-xoay-vo-cuc-gan-taplo-o-to-v3.jpg?v=1616488260665\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/con-xoay-vo-cuc-gan-taplo-o-to-v4.jpg?v=1616488277243\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/con-xoay-vo-cuc-gan-taplo-o-to-v5.jpg?v=1616488267899\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/con-xoay-vo-cuc-gan-taplo-o-to-v2.jpg?v=1616488289813\" /></p>\n<p>&nbsp;</p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/g_JyK1g4fbM\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', '', '', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '140000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/21032216/sap-thom-vong-xoay-vo-cuc-nang-luong-mat-troi.jpg', '<p>Không chỉ là hộp sáp thơm giúp không khí trong xe luôn thơm mát mà đây còn là vật trang trí vô cùng tinh tế cho nội thất của chiếc ô tô yêu quý của bạn.</p>\n<p>Được chế tạo từ hợp kim kẽm ', '21032216', '43276584', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:57', '2024-05-29 06:11:57'),
(1231, 'hop-dung-khan-giay-da-dinh-da-thien-nga-cao-cap', 'Hộp đựng khăn giấy da đính đá cao cấp', '<p><em><strong>Hộp đựng khăn giấy da đính đá cao cấp</strong></em></p>\n<p>Hộp giấy da chuyên dụng để trên xe ô tô, xe hơi,&nbsp;để bàn trag trí.</p>\n<p>Hộp giấy vừa tiện lợi vừa sang chảnh</p>\n<p>Chất liệu: Da đính đa trên bề mặt sang chảnh.</p>\n<p>Kích thước: 24*13*5.5CM.</p>\n<p>Phân loại: loại đính&nbsp;thiên nga đôi,&nbsp; đính&nbsp;thiên nga đơn, đính logo vương miện và loại đính đá hình Ong vàng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-giay-dinh-da-thien-nga-3.jpg?v=1616475366889\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-giay-dinh-da-thien-nga-5.jpg?v=1616484131243\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-giay-dinh-da-thien-nga-1.jpg?v=1616475375352\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-giay-dinh-da-thien-nga-4.jpg?v=1616475698779\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-khan-giay-dinh-da-ong-van-1.jpg?v=1622280217579\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-khan-giay-dinh-da-ong-vang-v18.jpg?v=1622425266865\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-khan-giay-dinh-da-ong-vang-v19.jpg?v=1622425267734\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/ZydX0pKUv-w\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Hộp đựng khăn giấy da đính đá thiên nga cao cấp', 'Hộp đựng khăn giấy da đính đá thiên nga cao cấp, Hộp đựng khăn giấy  ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Thiên nga đôi', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/21029625/hop-dung-khan-giay-da-dinh-da-thien-nga-cao-cap.jpg', '<p>Hộp giấy da chuyên dụng để trên xe ô tô, xe hơi,&nbsp;để bàn trag trí.</p>\n<p>Hộp giấy vừa tiện lợi vừa sang chảnh</p>\n<p>Chất liệu: Da đính đa trên bề mặt sang chảnh.</p>\n<p>Kích thước: 2', '21029625', '43261915', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:57', '2024-05-29 06:11:57'),
(1232, 'boc-ghe-xe-o-to-cao-cap-bg11', 'Bọc ghế xe ô tô cao cấp BG11', '<p><em><strong>Bọc ghế xe ô tô cao cấp BG11</strong></em></p>\n<p>Bộ bọc ghế, áo ghế xe hơi cao cấp với chất liệu da PU&nbsp; kết hợp vải sợi đan viền chỉ may màu đỏ&nbsp;nổi bật.</p>\n<p>Chất liệu PU chống nổ, chống&nbsp;mùi dễ dàng vệ sinh.</p>\n<p>Phù hợp lắp đặt cho xe ô tô 5 chỗ (tựa đầu ghế trước kéo lên được)&nbsp;</p>\n<p>Lắp đặt đơn giản tại nhà với đầy đủ phụ kiện kèm theo.</p>\n<p>Phân loại sản phẩm: Bộ 2 ghế trước có kèm gối tựa, Bộ bọc ghế đủ cho xe 5 chỗ và không có kèm gối tựa, bộ bọc nghế cho xe 7 chỗ 2 ghế rời và 3 ghế liền giá 1.900.000đ</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-7-cho-v3.jpg?v=1616398666836\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-7-cho-v5.jpg?v=1616398674441\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-7-cho-v8.jpg?v=1616398691565\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-7-cho-v9.jpg?v=1616398700153\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-o-to-7-cho-v7.jpg?v=1616398710890\" /></strong></em></p>', '', 'Bọc ghế xe ô tô cao cấp', 'áo ghế ô tô, áo ghế xe hơi, áo ghế xe ô tô, bọc ghế xe ô tô, Bọc ghế xe ô tô cao cấp BG11, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Bộ 02 ghế trước có gối', '', '', '', '', '', '', '', 'deny', '', '700000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/21001587/boc-ghe-xe-o-to-cao-cap-bg11.jpg', '<p>Bộ bọc ghế, áo ghế xe hơi cao cấp với chất liệu da PU&nbsp; kết hợp vải sợi đan viền chỉ may màu đỏ&nbsp;nổi bật.</p>\n<p>Chất liệu PU chống nổ, chống&nbsp;mùi dễ dàng vệ sinh.</p>\n<p>Phù h', '21001587', '43208696', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:57', '2024-05-29 06:11:57'),
(1233, 'bang-so-dien-thoai-dinh-da-thien-nga-gan-kinh-lai-xe-o-to', 'Bảng số điện thoại đính đá thiên nga gắn kính lái xe ô tô', '<p><em><strong>Bảng số điện thoại đính đá thiên nga gắn kính lái xe ô tô</strong></em></p>\n<p>Hãy cho mọi người thấy bạn là một lái xe văn minh khi đỗ xe ô tô nơi công cộng với bảng gắn số điện thoại trên taplo ô tô&nbsp;đính đá!</p>\n<p>Việc gắn&nbsp;biển số điện thoại trên xe để người khác liên lạc với bạn, tránh gây chuyện phiền phức cho cả hai bên.</p>\n<p>Thiết kế&nbsp;từ nhựa ABS đính đá toàn bộ bề mặt gắn phía trên 1 cặp thiên nga&nbsp;rất đẹp mắt và thời trang.</p>\n<p>Mặt sau được cố định bằng chân hút chân không trên kính lái.</p>\n<p>Số điện thoại có phản quang, có 5 dãy số từ 0-9 để dán ghép số lên sản phẩm.</p>\n<p>Kích thước: 12*5.8*0.3CM.</p>\n<p>Phân loại: Thiên nga bay cánh xòe, thiên nga bơi.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-gan-so-dien-thoai-dan-kinh-thien-nga-4.jpg?v=1616223223973\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dam-so-dt-dinh-da-3.jpg?v=1629165662822\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-gan-so-dien-thoai-dan-kinh-thien-nga-2.jpg?v=1616223236027\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-gan-so-dien-thoai-dan-kinh-thien-nga-3.jpg?v=1616223247446\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-dam-so-dt-dinh-da-1.jpg?v=1629165685761\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\"