(1234, 'vo-boc-vo-lang-dinh-da-vuong-mien', 'Vỏ bọc vô lăng da đính đá vương miện', '<p><strong><em>Vỏ bọc vô lăng da đính đá vương miện</em></strong></p>\n<p>Sản phẩm bọc vô lăng cao cấp với nhiều kiểu dáng, mẫu mã đẹp</p>\n<p>&nbsp;Size 38 vừa hầu hết các dòng xe thương mại 5- 7 chỗ</p>\n<p>Chất liệu da Pu mềm&nbsp;cao cấp không mùi&nbsp;</p>\n<p>Chắc chắn, lái đầm tay, dùng nhiều năm cũng không bị hỏng</p>\n<p>Đính đá hạt nổi bật, một logo vương miện đính ở vị&nbsp;trí đỉnh vô lăng tạo điểm nhấn sang trọng trong xe.</p>\n<p>Chia làm 2 mẫu: B1 (đính đá gắn logo vương miện),&nbsp;B2 (đính đinh gắn logo vương miện)</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-vuong-mien-v3.jpg?v=1616140836124\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-vuong-mien-v1.jpg?v=1619664202350\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-vuong-mien-v1.jpg?v=1616140843006\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-vuong-mien-v4.jpg?v=1616140874309\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-vuong-mien-v3.jpg?v=1619664223753\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-vuong-mien-v5.jpg?v=1619665651516\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-vuong-mien-v4-249b16d1-e017-4835-bf9e-127a7294fc1f.jpg?v=1619665660518\" /></em></strong></p>', '', 'Vỏ bọc vô lăng da đính đá vương miện', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Mẫu', 'B1', '', '', '', '', '', '', '', 'deny', '', '198000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/20973742/vo-boc-vo-lang-dinh-da-vuong-mien.jpg', '<p>Sản phẩm bọc vô lăng cao cấp với nhiều kiểu dáng, mẫu mã đẹp</p>\n<p>&nbsp;Size 38 vừa hầu hết các dòng xe thương mại 5- 7 chỗ</p>\n<p>Chất liệu da Pu mềm&nbsp;cao cấp không mùi&nbsp;</p>\n<p', '20973742', '43135212', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:58', '2024-05-29 06:11:58'),
(1235, 'day-treo-guong-nuoc-hoa-thien-nga-tang-kem-tinh-dau', 'Dây treo nước hoa thiên nga tặng kèm tinh dầu', '<p><em><strong>Dây treo nước hoa thiên nga tặng kèm tinh dầu</strong></em></p>\n<p>Sét Nước hoa thiên nga đính đá với vẻ đẹp chuẩn mực nghệ thuật trang trí.</p>\n<p>Tạo điểm nhấn ấn tượng, nổi bật xế yêu của bạn.</p>\n<p>Thiết kế tinh tế, bắt mắt và hiện đại chống say xe, khử mùi hôi khó chịu trong xế hộp</p>\n<p>Đính đá cao cấp tinh xảo chinh phục mọi ánh nhìn.</p>\n<p>Hương thơm 100% tự nhiên giúp bạn thư giãn, xả stress và tận hưởng bầu không khí mát lành.</p>\n<p>Thể hiện guu thẩm mỹ đỉnh cao và phong cách quý phái, sang trọng của chủ nhân xế yêu.</p>\n<p>Tặng kèm tinh dầu thơm cao cấp.</p>\n<p>Kích thước: 4.5*3.5*1.2CM, chiều dài dây 23CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-6.jpg?v=1616137675312\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-1.jpg?v=1616129171065\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-2.jpg?v=1616129182564\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-3-436a270f-3fd3-43a6-b153-daae5c26aab7.jpg?v=1616129306713\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-4.jpg?v=1616129195816\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-truyen-nuoc-hoa-thien-nga-5.jpg?v=1616129203477\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jvqj-17eMEo\" width=\"100%\"></iframe></p>', '', 'Dây treo', 'dây teo gương xe, Dây treo gương nước hoa thiên nga tặng kèm tinh dầu, nước hoa treo gương xe ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20971646/day-treo-guong-nuoc-hoa-thien-nga-tang-kem-tinh-dau.jpg', '<p>Set Nước hoa thiên nga đính đá với vẻ đẹp chuẩn mực nghệ thuật trang trí.</p>\n<p>Tạo điểm nhấn ấn tượng, nổi bật xế yêu của bạn.</p>\n<p>Thiết kế tinh tế, bắt mắt và hiện đại chống say xe, ', '20971646', '43100038', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:58', '2024-05-29 06:11:58'),
(1236, 'lot-cop-da-cach-nhiet-cho-honda-lead-125-2016-2021', 'Lót cốp da cách nhiệt cho Honda Lead 125 (2016-2021)', '<p><em><strong>Lót cốp da cách nhiệt cho Honda Lead 125 (2016-2021)</strong></em></p>\n<p>Lót cốp da cách nhiệt cho xe Honda Lead 125, với mặt trong chất liệu da 5D được may rất chắc chắn, mặt ngoài được bọc 1 lớp nỉ cách nhiệt rất hiệu quả.<br />\nLót cốp da cách nhiệt được may thêm 1 túi da nhỏ để tiện lợi khi bỏ giấy tờ xe, điện thoại, chìa khoá, sổ nhỏ...</p>\n<ul>\n<li>Cách nhiệt: Chống nóng cho toàn bộ đồ vật bên trong cốp, giữ độ bền cho đồ vật khỏi hư hại khi nhiệt độ tăng cao.</li>\n<li>Chống va đập: Được làm từ chất liệu da 5D rất mềm, dày giúp để đồ điện tử trong xe khỏi va dập khi di chuyển.</li>\n<li>Dễ dàng vệ sinh: Khi lót cốp dơ chỉ cần lấy ra dùng khăn ướt nhẹ lau sơ rồi gắn lại là sạch sẽ, thơm tho.</li></ul>\n<p>Lót cốp da cách nhiệt gắn vừa khít cho xe Honda Lead 125&nbsp;(2016-2021)</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-dahonda-airblade-03.jpg?v=1616051878715\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-dahonda-airblade-04.jpg?v=1616051871384\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-dahonda-airblade-1.jpg?v=1616035413891\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-dahonda-airblade-2.jpg?v=1616035414806\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-cop-dahonda-airblade-3.jpg?v=1616049456522\" /></strong></em></p>', '', 'Lót cốp da cách nhiệt cho Honda Lead', 'Lót cốp da cách nhiệt, Lót cốp da cách nhiệt cho Honda Lead 125, Lót cốp da cách nhiệt cho Honda Lead 125 (2016-2021), phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen đỏ', '', '', '', '', '', '', '', 'deny', '', '338000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/20959642/lot-cop-da-cach-nhiet-cho-honda-lead-125-2016-2021.jpg', '<ul>\n<li>Cách nhiệt: Chống nóng cho toàn bộ đồ vật bên trong cốp, giữ độ bền cho đồ vật khỏi hư hại khi nhiệt độ tăng cao.</li>\n<li>Chống va đập: Được làm từ chất liệu da 5D rất mềm, dày giúp', '20959642', '43040939', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:11:58', '2024-05-29 06:11:58'),
(1237, 'boc-can-so-xe-o-to-dinh-da-vuong-mien', 'Bọc cần số xe ô tô đính đá vương miện', '<p><em><strong>Bọc cần số xe ô tô đính đá vương miện</strong></em></p>\n<p>Dùng được cho hầu hết các dòng xe trên thị trường có cần số và phanh tay cơ vật lý.</p>\n<p>Chất liệu da PU cao cấp đính đá và logo vương miện đẹp nổi bật.</p>\n<p>Kích thước 13.5*10CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-can-so-da-vuong-mien-2.jpg?v=1615969324297\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-can-so-da-vuong-mien-1.jpg?v=1615969333220\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-can-so-da-vuong-mien-3.jpg?v=1616050081758\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-can-so-da-vuong-mien-4.jpg?v=1616050088415\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/kFzqvO6ZQSE\" width=\"100%\"></iframe></p>', '', 'Bọc cần số xe ô tô', 'Bọc cần số vương miện, Bọc cần số xe ô tô đính đá vương miện, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '95000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20952818/boc-can-so-xe-o-to-dinh-da-vuong-mien.jpg', '<p>Dùng được cho hầu hết các dòng xe trên thị trường có cần số và phanh tay cơ vật lý.</p>\n<p>Chất liệu da PU cao cấp đính đá và logo vương miện đẹp nổi bật.</p>\n<p>Kích thước 13.5*10CM.</p>', '20952818', '43023648', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, N