(1242, 'tinh-dau-treo-xe-day-chuyen-treo-guong-xe-hoi', 'Tinh dầu nước hoa Perfume dây chuyền treo gương xe ô tô', '<p><em><strong>Tinh dầu nước hoa Perfume dây chuyền treo gương xe ô tô</strong></em></p>\n<p>Mang hương thơm dễ chịu, làm cho không gian thoáng mát sạch sẽ.</p>\n<p>Giúp người ngồi trên xe luôn có cảm giác thoải mái, thư giãn.</p>\n<p>Tinh dầu trong treo gương tốt cho sức khỏe và giúp người ngồi trong xe thoải mái.</p>\n<p>Mang tính thẩm mỹ cao, có thể dùng trang trí để tăng thêm sự sang trọng cho xe.</p>\n<p>Sản phẩm có&nbsp;mùi hương nước hoa&nbsp;Perfume hương hoa hồng mùi thơm dịu, mát hương biển</p>\n<p>Khi mua sản phẩm của , các bạn sẽ được tặng kèm theo 1 lọ tinh dầu và 2 bông nén.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v1.jpg?v=1615609329544\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v671-764b02e0-02d5-46ad-8b19-98b87eb8ffc4.jpg?v=1615609746675\" /><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v4.jpg?v=1615609330271\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v5.jpg?v=1615609330958\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v67.jpg?v=1615609331643\" /></p>\n<ul>\n<li>\n<h1><b>Hướng dẫn sử dụng</b></h1></li>\n<li>Bước 1 : Mở nắp nhẹ nhàng mặt trong sản phẩm.</li>\n<li>Bước 2 : Nhỏ 3-4 giọt tinh dầu vào bên trong sản phẩm (Khi mua sản phẩm của , các bạn sẽ được tặng kèm theo 1 lọ tinh dầu )</li>\n<li>Bước 3 : Đóng nắp lại và treo lên gương ô tô.</li>\n<li><img data-thumb=\"original\" original-height=\"266\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lo-treo-nuoc-hoa-o-to-v670.jpg?v=1615609761471\" /></li></ul>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/nOsTcjmnHiI\" width=\"100%\"></iframe></p>', '', 'Tinh dầu nước hoa treo xe', 'nước hoa ô tô, nước hoa treo gương, ô tô, phụ  kiện ô tô, Tinh dầu treo xe dây chuyền treo gương xe hơi, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '180000', '', '', '', '', NULL, '', '', '', '', 'kg', 'images/20918165/tinh-dau-treo-xe-day-chuyen-treo-guong-xe-hoi.jpg', '<p>Mang hương thơm dễ chịu, làm cho không gian thoáng mát sạch sẽ.</p>\n<p>Giúp người ngồi trên xe luôn có cảm giác thoải mái, thư giãn.</p>\n<p>Tinh dầu trong treo gương tốt cho sức khỏe và gi', '20918165', '42909622', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:00', '2024-05-29 06:12:00'),
(1243, 'combo-goi-tua-va-boc-vo-lang-vuong-mien', 'Combo gối tựa và Bọc vô lăng vương miện', '<p><em><strong>Combo gối tựa và Bọc vô lăng vương miện</strong></em></p>\n<p>Với tông màu thật tinh tế với sự pha trộn một chút màu đen và trắng mát mẻ. Nó mang lại cảm giác yên tĩnh và thường có thể gợi lên một cảm giác hoài niệm về quá khứ.</p>\n<p>Chất liệu da mềm cao cấp, đính đá và logo vương&nbsp;miện.</p>\n<p>Bộ sản phẩm gồm: 2 gối tựa đầu 19*28*10cm&nbsp;, 2 gối lưng 37*37*14cm, 1 bọc vô lăng 38cm.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v13.jpg?v=1615534946999\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v10.jpg?v=1615534953472\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v11.jpg?v=1615534963808\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v3.jpg?v=1615534974091\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v16.jpg?v=1615534984967\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/cambo-goi-tua-va-boc-vo-lang-vuong-vien-v18.jpg?v=1615535035616\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Gối tựa ô tô', 'bọc vô lăng, bọc vô lăng xe hơi, Combo gối tựa và Bọc vô lăng vương miện, gối tựa đầu, gối tựa lưng ô tô, gối tựa ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Bọc vô lăng', '', '', '', '', '', '', '', 'deny', '', '220000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/20913070/combo-goi-tua-va-boc-vo-lang-vuong-mien.jpg', '<p>Với tông màu thật tinh tế với sự pha trộn một chút màu đen và trắng mát mẻ. Nó mang lại cảm giác yên tĩnh và thường có thể gợi lên một cảm giác hoài niệm về quá khứ.</p>\n<p>Chất liệu da mề', '20913070', '42864312', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:00', '2024-05-29 06:12:00'),
(1244, 'tinh-dau-nuoc-hoa-o-to-nuoc-hoa-noi-that-cao-cap-wiachnn-120ml', 'Tinh dầu nước hoa ô tô, nước hoa nội thất cao cấp WIACHNN - 120ml', '<p><em><strong>Tinh dầu nước hoa ô tô, nước hoa nội thất cao cấp WIACHNN - 120ml</strong></em></p>\n<p>Tinh dầu nước hoa giúp&nbsp;làm sạch không khí, khử mùi tuyệt đối với hương thơm tự nhiên đạce biệt không gây hại sức khỏe.</p>\n<p>Mùi hương từ lọ tinh dầu tỏa ra trên xe, giúp khử mùi ẩm mốc mùi thuốc lá, các mùi khó chịu trên xe.</p>\n<p>Sản phẩm chia theo nhiều&nbsp;Hương nước hoa khác nhau:&nbsp;&nbsp;FREASIA,&nbsp;MEET BY CHANCE, COLOGNE, WHITE TEA, PEACHES, BLUBELLS, OSMANTHUS FRAGRANS.</p>\n<p>Kích thước: 7.6*6.8CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-2.jpg?v=1615434918420\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-4.jpg?v=1615434926896\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-1.jpg?v=1615434934324\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-7.jpg?v=1615452593447\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-1-90b5bbe1-c66c-49af-8b12-366caf21ac52.jpg?v=1615452600204\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-8.jpg?v=1615452611456\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-o-t-to-6.jpg?v=1615452620612\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/dl5553bYvbo\" width=\"100%\"></iframe></p>', '', 'inh dầu nước hoa ô tô', 'nước hoa nội thất cao cấp WIACHNN - 120ml, nước hoa ô tô, ô tô, Tinh dầu nước hoa, Tinh dầu nước hoa ô tô, tinh dầu ô tô, Volcano, volcano.vn', '1', 'Hương', 'FREASIA', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/20887522/tinh-dau-nuoc-hoa-o-to-nuoc-hoa-noi-that-cao-cap-wiachnn-120ml.jpg', '<p>Tinh dầu nước hoa giúp&nbsp;làm sạch không khí, khử mùi tuyệt đối với hương thơm tự nhiên đạce biệt không gây hại sức khỏe.</p>\n<p>Mùi hương từ lọ tinh dầu tỏa ra trên xe, giúp khử mùi ẩm ', '20887522', '42801027', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:00', '2024-05-29 06:12:00'),
(1245, 'thung-dung-do-gan-duoi-xe-may-td28l', 'Thùng đựng đồ gắn đuôi xe máy TD28L - Khắc Laser theo yêu cầu', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy TD28L - Khắc Laser theo yêu cầu</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích lớn 28L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.</p>\n<p>Kích thước sản phẩm: 41*40*28cm.</p>\n<p><span style=\"font-size:14px;\"><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></span></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-1.jpg?v=1615431666905\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-3.jpg?v=1615431667348\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-5.jpg?v=1615431668026\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-1.jpg?v=1617099324948\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-2.jpg?v=1615431695516\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-v1-a8b28ab9-8ac1-41a3-8c66-af4f8890ad83.jpg?v=1615431696283\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-v7-c347e676-59ae-4def-819d-b9bd0ee7387d.jpg?v=1615431697009\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-v7.jpg?v=1615428591773\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-v1.jpg?v=1615428605061\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-7.jpg?v=1615515901955\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-8.jpg?v=1615515908693\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-444.jpg?v=1616474680974\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Thùng đựng đồ gắn đuôi xe máy TD28L', 'cốp xe máy, ô tô, phụ kiện xe máy, thùng đồ xe máy, Thùng đựng đồ gắn đuôi xe máy TD28L, Volcano, volcano.vn, xe máy', '1', 'Kích thước', 'Màu đỏ', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/20886215/thung-dung-do-gan-duoi-xe-may-td28l.jpg', '<p>Dung tích lớn 28L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng', '20886215', '42858928', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:00', '2024-05-29 06:12:00'),
(1246, 'bo-boc-ghe-da-vuong-mien', 'Bộ bọc ghế da đính đá Thiên Nga, Vương Miện', '<p><em><strong>Bộ bọc ghế da đính đá Thiên Nga, Vương Miện</strong></em></p>\n<p>Bộ bọc ghế, áo bao gồm bọc 5 chỗ cho các dòng xe du lịch hạng B, C, D như mazda, honda, toyota, nissan, KIA, Mercedes, Lexus....</p>\n<p>Với chất liệu làm từ da mềm cao cấp Split (phần xơ của phần da đã được tách ra để làm da Top grain) được tráng một lớp Polyurethane và dập nổi trên bề mặt . Có khả năng bụi, chống thấm nước&nbsp;có độ bền cực cao.</p>\n<p>Da cực mềm, chống nổ không nhăn.</p>\n<p>Lắp đặt đơn giản tại nhà không cần đến gara.</p>\n<p>Thiết kế cực kỳ Sang Chảnh giúp tôn lên vẻ sang trọng và đẳng cấp của xe.</p>\n<p>Bộ sản phẩm chia làm 2 phân loại:&nbsp;Có kèm gối tựa và bọc vô lăng, bộ không kèm gối tựa.</p>\n<p>Phân loại: Logo Thiên Nga, logo Vương Miện.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-8.jpg?v=1615777269845\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-6.jpg?v=1615777276855\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-thien-nga-1.jpg?v=1630987300573\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-thien-nga-4.jpg?v=1632816019526\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-thien-nga-5.jpg?v=1632816026203\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-7.jpg?v=1615777284208\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-3.jpg?v=1615350026334\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-2.jpg?v=1615350033737\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-thien-nga-2.jpg?v=1630987323206\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-1.jpg?v=1615350042317\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-thien-nga-3.jpg?v=1630987556369\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-boc-ghe-vuong-mien-5.jpg?v=1615350053713\" /></p>\n<p>&nbsp;</p>', '', 'Bộ bọc ghế da Vương Miện', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Logo', 'Thiên Nga', 'Loại', 'Không gối', '', '', '', '', '', 'deny', '', '2500000', '', '1', '', '', NULL, '', '', '', '8', 'kg', 'images/20879336/bo-boc-ghe-da-vuong-mien.jpg', '<p>NVới chất liệu làm từ da mềm cao cấp Split (phần xơ của phần da đã được tách ra để làm da Top grain) được tráng một lớp Polyurethane và dập nổi trên bề mặt . Có khả năng bụi, chống thấm nư', '20879336', '50897020', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:00', '2024-05-29 06:12:00'),
(1247, 'robot-sap-thom-kep-cua-gio-dieu-hoa-o-to', 'Robot sáp thơm kẹp cửa gió điều hòa ô tô (tặng kèm sắp thơm)', '<p><span style=\"font-size:16px;\"><em><strong>Robot sáp thơm kẹp cửa gió điều hòa ô tô (tặng kèm sắp thơm)</strong></em></span></p>\n<p><span style=\"font-size:16px;\">Robot gắn</span>&nbsp;ở ô cửa gió hoặc gắn trên taplo xe như một món phụ kiện trang trí.</p>\n<p>Sáp thơm dạng nén sẽ&nbsp;được chứa bên trong robot tạo mùi hương dễ chịu, khử mùi hôi, khó chịu trong xe.</p>\n<p>Robot thiết kế đẹp có 2 râu lắc lư dễ thương sinh động, thân có in icon cảm xúc yêu thương, vui vẻ, ngượng ngùng.</p>\n<p>Chất liệu nhựa và kim loại</p>\n<p>Kích thước 29*60mm.</p>\n<p>Sản phẩm có tặng kèm 03 viên sáp thơm, sản phẩm được giao ngẫu nhiên hình icon cảm xúc!</p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-1.jpg?v=1615280626292\" /></strong></em></span></p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-2.jpg?v=1615280627165\" /></strong></em></span></p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-3.jpg?v=1615280628088\" /></strong></em></span></p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-4.jpg?v=1615280628959\" /></strong></em></span></p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-8.jpg?v=1615283387009\" /></strong></em></span></p>\n<p><span style=\"font-size:16px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-kep-cua-gio-dieu-hoa-7.jpg?v=1615283397015\" /></strong></em></span></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/v-8Hp7rMYuU\" width=\"100%\"></iframe></p>', '', 'Robot sáp thơm kẹp cửa gió', 'ô tô, phụ  kiện ô tô, Robot sáp thơm kẹp cửa gió điều hòa ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20874450/robot-sap-thom-kep-cua-gio-dieu-hoa-o-to.jpg', '<p><span style=\"font-size:16px;\">Robot gắn</span>&nbsp;ở ô cửa gió hoặc gắn trên taplo xe như một món phụ kiện trang trí.</p>\n<p>Sáp thơm dạng nén sẽ&nbsp;được chứa bên trong robot tạo mùi hư', '20874450', '42755071', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:01', '2024-05-29 06:12:01'),
(1248, 'o-che-nang-kinh-lai-xe-o-to-cao-cap', 'Ô Che Nắng Kính Lái Xe Ô Tô Cao Cấp', '<p><em><strong>Ô Che Nắng Kính Lái Xe Ô Tô Cao Cấp</strong></em></p>\n<p>Thiết kế cấu trúc võng xuống và lớp phủ bạc titan tạo nên hiệu ứng phản xạ lại tia tử ngoại và nhiệt.</p>\n<p>Giữ cho nội thất và máy móc xe không bị tổn hại bởi nhiệt, điều hoà nhiệt độ xe ở mức an toàn cho sức khỏe.</p>\n<p>Chỉ cần tháo ô ra khỏi bao và kéo mở là đã xong. Loại bỏ sự rắc rối của các loại tấm cách nhiệt truyền thống.</p>\n<p>Cơ chế gấp gọn để bạn có thể lưu trữ trong các hộc, tủ của xe.</p>\n<p>Cán ô và 10 thanh nan làm từ thép sơn tĩnh điện, chống đỡ mạnh mẽ.</p>\n<p>Cỡ to (XL): 145 x 79CM Dành cho xe SUV, MPV, SEDAN cỡ lớn..</p>\n<p>Cỡ vừa (L): 138&nbsp; x 77CM&nbsp;Dành cho xe SUV, MPV</p>\n<p>Cỡ nhỏ (M): 136 x 74CM -&nbsp; Dành cho xe nhỏ i10, Morning, Wigo, Fadil ...</p>\n<p>Màu sắc: đen và bạc. Chất liệu: vải cách nhiệt phủ bạc titan, thép sơn tĩnh điện</p>\n<p>Dòng xe tương thích: xe con (4 chỗ, 5 chỗ), xe bán tải, SUV, Sedan, MPV,....</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-1.jpg?v=1615275623332\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-2.jpg?v=1615275624009\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-3.jpg?v=1615275624656\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-4.jpg?v=1615275625349\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-5.jpg?v=1615275626257\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-6.jpg?v=1615275627139\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-7.jpg?v=1615275628022\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-8.jpg?v=1615275628745\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-9.jpg?v=1615277304677\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-chan-nang-o-to-10.jpg?v=1615277311398\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/_AgxHsIRU4s\" width=\"100%\"></iframe></p>', '', 'Ô Che Nắng Kính Lái Xe Ô Tô Cao Cấp', 'che nắng kính lái, che nắng ô tô, Ô Che Nắng Kính Lái Xe Ô Tô Cao Cấp, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích thước', 'M', '', '', '', '', '', '', '', 'deny', '', '168000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/20872958/o-che-nang-kinh-lai-xe-o-to-cao-cap.jpg', '<p>Cán ô và 10 thanh nan làm từ thép sơn tĩnh điện, chống đỡ mạnh mẽ.</p>\n<p>Cỡ to (XL): 145 x 79CM Dành cho xe SUV, MPV, SEDAN cỡ lớn..</p>\n<p>Cỡ vừa (L): 138&nbsp; x 77CM&nbsp;Dành cho xe S', '20872958', '42752538', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:01', '2024-05-29 06:12:01');
