(1249, 'thung-dung-do-gan-duoi-xe-may-td26l', 'Thùng đựng đồ gắn đuôi xe máy TD26L - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy TD26L - Khắc Laser Theo Yêu Cầu</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn chông thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>Dung tích lớn 26L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, thùng lắp được trên mọi loại xe có baga dạng như đế thùng trên hình ảnh</p>\n<p>Thiết kế kiểu dáng đẹp bắt măt, nổi bật với màu đen phối đỏ, có phần tựa lưng nhúng carbon chống xước.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, thiết kế&nbsp;đèn hậu&nbsp;giả&nbsp;màu đỏ phản quang đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm ốc lắp, CHƯA CÓ BAGA KÈM&nbsp;THEO.<br />\nKích thước sản phẩm: 38*38*29cm, kích trong 30*30*23cm</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-duoi-xe-1.jpg?v=1615178450970\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-duoi-xe-7.jpg?v=1615178457622\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-duoi-xe-8.jpg?v=1615179076130\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-duoi-xe-5.jpg?v=1615178466055\" /></strong></em></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-5-9fd0fca3-c1b6-4b64-b4d4-ae1ff5171da8.jpg?v=1566358309323\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-8.jpg?v=1566355008551\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-xe-may-do-444-7cd0bc85-4c9d-40f0-a4dd-5785c0453fa8.jpg?v=1616474731767\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-duoi-xe-9.jpg?v=1615190058655\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Thùng đựng đồ xe máy', 'phụ kiện xe máy, Thùng đựng đồ gắn đuôi xe máy TD26L, thung dung do xe may, thùng đựng đồ xe máy, thùng xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/20860746/thung-dung-do-gan-duoi-xe-may-td26l.jpg', '<p>Dung tích lớn 26L chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, Thùng', '20860746', '42725960', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:01', '2024-05-29 06:12:01'),
(1250, 'tau-cham-thuoc-tren-o-to-xe-tai-24v', 'Tẩu châm thuốc trên ô tô - xe tải 24V', '<p><em><strong>Tẩu châm thuốc trên ô tô - xe tải&nbsp;24V</strong></em></p>\n<p>Với những tài xế hút thuốc, chiếc tẩu châm thuốc thực sự là một sản phẩm tiện ích thường xuyên sử dụng. Khi cần châm thuốc, chỉ cần ấn đầu tẩu vào trong cổng tẩu, đợi vài giây cho cuộn dây trong tẩu châm thuốc nóng đỏ đủ độ, tẩu sẽ tự động bật ra. Khi đó có thể sử dụng tẩu châm thuốc ngay lập tức.<br />\nKích thước tẩu châm thuốc trên ô tô như tẩu zin trên xe ô tô.<br />\nĐầu tẩu châm thuốc được đốt nóng bằng nguồn điện&nbsp;24V.<br />\nTẩu châm thuốc trên ô tô tự động ngắt điện khi đủ độ nóng.<br />\nĐiện áp:&nbsp;24V</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-6.jpg?v=1614844812020\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-7.jpg?v=1614844812935\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-2-80122a24-b347-4a87-8f9f-a0d7b77f38c8.jpg?v=1614847112051\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-1.jpg?v=1614845449711\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-4.jpg?v=1614845450401\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-5.jpg?v=1614845451277\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tau-cham-thuoc-cu-r-3.jpg?v=1614845468362\" /></strong></em></p>', '', 'Tẩu châm thuốc trên ô tô 24V', 'châm thuốc xe tải, ô tô, phụ  kiện ô tô, tẩu châm thuốc, tẩu châm thuốc 24V, Tẩu châm thuốc trên ô tô - xe tải 24V, tẩu thuốc xe tải, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20808252/tau-cham-thuoc-tren-o-to-xe-tai-24v.jpg', '<p>Với những tài xế hút thuốc, chiếc tẩu châm thuốc thực sự là một sản phẩm tiện ích thường xuyên sử dụng. Khi cần châm thuốc, chỉ cần ấn đầu tẩu vào trong cổng tẩu, đợi vài giây cho cuộn dây', '20808252', '42590456', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:01', '2024-05-29 06:12:01'),
(1251, 'dau-tau-nguon-dien-o-to-12-24v-8a', 'Đầu tẩu nguồn điện ô tô 12/24V-8A', '<p><em><strong>Đầu tẩu nguồn điện ô tô 12/24V-8A</strong></em></p>\n<p>Trên&nbsp; ô tô có nhiều thiết bị dùng điện 12V,-24V&nbsp;mà bạn lại không thể đấu hay cắt nối dây thì việc gắn ngay một đầu cắm chân tẩu là một giải pháp tiện dụng và đơn giản nhất.</p>\n<p>Sử dụng làm đầu cắm cho mọi đồ dùng, thiết bị điện 12V-24V có nhu cầu sử dụng trên ô tô như quạt, tủ lạnh, bình đun nước,...</p>\n<p>Chất liệu nhựa ABS siêu bền bỉ,&nbsp;trong có cầu chì bảo bệ thiết bị, đồ dùng điện, đấu dây đơn giản với với 2 cực âm dương.</p>\n<p>Kích thước: 7.8*2.5cm, phù hợp chân tẩu 2.1cm</p>\n<p>Điện áp: 12V - 24V</p>\n<p>Cầu chì 8A, công suất 90W</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-1-6128c198-ceed-4d16-8dfd-2462d367a042.jpg?v=1614756349253\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-2-06d45d3d-4a24-41ac-b316-63534ac41e8a.jpg?v=1614756350363\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-3-29673ca6-3a20-4e1c-a061-6c3d5193e9e5.jpg?v=1614756351100\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-4-b86e0211-09a2-4296-8902-ed3aeca645ff.jpg?v=1614756352005\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-5-d23afd8e-fcc9-480c-8572-b3d99870f936.jpg?v=1614756353028\" /></p>', '', 'Đầu tẩu nguồn điện ô tô', 'đầu tẩu nguồn điện ô tô, Đầu tẩu nguồn điện ô tô 12/24V-8A, đầu tẩu ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20795814/dau-tau-nguon-dien-o-to-12-24v-8a.jpg', '<p>Sử dụng làm đầu cắm cho mọi đồ dùng, thiết bị điện 12V-24V có nhu cầu sử dụng trên ô tô như quạt, tủ lạnh, bình đun nước,...</p>\n<p>Chất liệu nhựa ABS siêu bền bỉ, bên trong có cầu chì bảo', '20795814', '42521168', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:01', '2024-05-29 06:12:01'),
(1252, 'hop-ty-tay-xe-o-to-toyota-vios-2014-2017-h390', 'Hộp tỳ tay xe ô tô Toyota Vios 2014-2017 H390', '<p><em><strong>Hộp tỳ tay xe ô tô Toyota Vios 2014-2017 H390</strong></em></p>\n<p>Hộp tỳ tay là chi tiết nằm giữa 2 ghế trước của xe hơi&nbsp;&nbsp;là 1 chi tiết nhỏ nhưng lại hết sức quan trọng mà nhiều hãng xe đã cắt bỏ khi sản xuất.</p>\n<p>&nbsp;Hộp tỳ tay thiết kế riêng cho xe&nbsp;ô tô Toyota Vios 2014-2017 giup bạn&nbsp;có thể bỏ ví, điện thoại vào trong hộp tỳ tay để ko bị vướng khi ngồi, ngoài ra son phấn, mỹ phẩm của chị em, USB nghe nhạc, chìa khóa, thẻ vé xe, kính...phía sau là khay để nước và thuốc lá.</p>\n<p>&nbsp;Thiết kế&nbsp;từ khung nhựa ABS bền bỉ bên ngoàn là bọc lớp da PU dày êm chắc chắn đến từng chi tiết chỉ may, phần tỳ tay có thể kéo về phía trước thêm 5CM</p>\n<p>Kích thước: cao 29cm, dài 33, rộng 15cm, phần đế cao 14cm, rộng 13cm</p>\n<p><em>&nbsp;Lắp đặt đơn giản với đế vừa bằng hốc để đồ cũ trên xe chỉ cần cho vào và ấn mạnh là sẽ giữ hộp tỳ tay chắc chắn.</em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-vios-2014-2017-h390-1.jpg?v=1614229164443\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-vios-2014-2017-h390-2.jpg?v=1614229165318\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-vios-2014-2017-h390-3.jpg?v=1614229165976\" /></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-toyota-2002-2008-v1.jpg?v=1565240667091\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-toyota-2002-2008-v2.jpg?v=1565240677949\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-xe-o-to-toyota-2002-2008-v3.jpg?v=1565240687152\" /></strong></em></p>', '', 'Hộp tỳ tay xe ô tô', 'Hộp tỳ tay xe ô tô Toyota Vios 2014-2017 H390, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/20719471/hop-ty-tay-xe-o-to-toyota-vios-2014-2017-h390.jpg', '<p>Hộp tỳ tay thiết kế riêng cho xe&nbsp;ô tô Toyota Vios 2014-2017 giup bạn&nbsp;có thể bỏ ví, điện thoại vào trong hộp tỳ tay để ko bị vướng khi ngồi, ngoài ra son phấn, mỹ phẩm của chị em,', '20719471', '42327701', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:02', '2024-05-29 06:12:02'),
(1253, 'tem-logo-chu-noi-626-dan-duoi-xe-mazda', 'Tem logo chữ nổi 626 dán đuôi xe Mazda', '<p><em><strong>Tem logo chữ nổi 626 dán đuôi xe Mazda</strong></em></p>\n<p>Tem chữ nổi chữ 626 làm từ chất liệu nhựa ABS mạ nước&nbsp;bạc bóng đẹp mắt.</p>\n<p>Vị trí dán đuôi xe ô tô hãng Mazda 626</p>\n<p>Có keo dán 3M sẵn mặt dưới sản phẩm tách dán đơn giản dễ dàng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-noi-dan-xe-262-1.jpg?v=1614153327434\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-noi-dan-xe-262-2.jpg?v=1614153327884\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-noi-dan-xe-262-3.jpg?v=1614153328759\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-noi-dan-xe-262-4.jpg?v=1614153329578\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-noi-dan-xe-262-5.jpg?v=1614153330242\" /></p>', '', 'Tem logo chữ nổi 626', 'logo 626, ô tô, phụ  kiện ô tô, tem logo 626, Tem logo chữ nổi 626 dán đuôi xe Mazda, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20707881/tem-logo-chu-noi-626-dan-duoi-xe-mazda.jpg', '<p>Tem chữ nổi chữ 626 làm từ chất liệu nhựa ABS mạ nước&nbsp;bạc bóng đẹp mắt.</p>\n<p>Vị trí dán đuôi xe ô tô hãng Mazda 626</p>\n<p>Có keo dán 3M sẵn mặt dưới sản phẩm tách dán đơn giản dễ d', '20707881', '42303697', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:02', '2024-05-29 06:12:02'),
(1254, 'bat-lua-ga-ong-gia-cam-sung', 'Bật lửa ga Ông già cầm súng', '<p><em><strong>Bật lửa ga Ông già cầm súng</strong></em></p>\n<p>Bật ga với thiết kế độc đáo sử để trang trí để bàn cực kỳ lạ.</p>\n<p>Chất liệu kim loại mạ vàng màu vàng nổi bật, chống gỉ sét.</p>\n<p>Sử dụng lên lửa cực ngầu.</p>\n<p>Kích thước: 6.5*3.5*7cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ong-gia-cam-sung-v6.jpg?v=1614068665695\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ong-gia-cam-sung-v4.jpg?v=1614068672715\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ong-gia-cam-sung-v3.jpg?v=1614068679787\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ong-gia-cam-sung-v7.jpg?v=1614068686241\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ong-gia-cam-sung-v9.jpg?v=1614068687313\" /></strong></em></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/UbkgBDt_puw\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Bật lửa', 'bật lửa ga, Bật lửa ga Ông già cầm súng, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '105000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20697181/bat-lua-ga-ong-gia-cam-sung.jpg', '<p>Bật ga với thiết kế độc đáo sử để trang trí để bàn cực kỳ lạ.</p>\n<p>Chất liệu kim loại mạ vàng màu vàng nổi bật, chống gỉ sét.</p>\n<p>Sử dụng lên lửa cực ngầu.</p>\n<p>Kích thước: 6.5*3.5*', '20697181', '42055360', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:02', '2024-05-29 06:12:02'),
