(1256, 'tem-logo-chu-noi-i-vtec-dan-duoi-xe-honda-city', 'Tem Logo chữ nổi I Vtec dán đuôi xe', '<p><strong><em>Tem Logo chữ nổi i -Vtec dán đuôi xe</em></strong></p>\n<p>Chất liệu nhựa ABS mạ nước bạc&nbsp;bóng đẹp như logo hãng, được dán bằng keo dán 3M chắc chắn.</p>\n<p>Vị trí dán đuôi xe, tem dán lên xe bằng băng keo 3m sẵn ở mặt sau.</p>\n<p>&nbsp;Kích thước: 11.6*1.5*0.5cm.</p>\n<p>&nbsp;Lưu ý: Làm sạch khô vị trí dán để đảm bảo độ kết dính của keo, tránh rửa,&nbsp;nước trong 24h.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-i-vtec-3.jpg?v=1613803646210\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-i-vtec-4.jpg?v=1613803647048\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-i-vtec-2.jpg?v=1613803655118\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-i-vtec-1.jpg?v=1613803661576\" /></p>', '', 'Tem Logo chữ nổi i Vtec', 'Logo chữ nổi i Vtec, ô tô, phụ  kiện ô tô, Tem Logo chữ nổi i Vtec dán đuôi xe Honda City, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '89000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20667553/tem-logo-chu-noi-i-vtec-dan-duoi-xe-honda-city.jpg', '<p>Chất liệu nhựa ABS mạ nước bạc&nbsp;bóng, được dán bằng keo dán 3M chắc chắn.</p>\n<p>Vị trí dán đuôi xe.</p>\n<p>&nbsp;Kích thước: 11.6*1.5*0.5cm.</p>\n<p>&nbsp;Lưu ý: Làm sạch khô vị trí dá', '20667553', '41919489', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:03', '2024-05-29 06:12:03'),
(1257, 'day-nguon-dau-tau-ra-dau-dc-5-5x2-1-2-5-cho-o-to-12v', 'Dây Nguồn đầu tẩu Ra Đầu DC 5.5X2.1 / 2.5 trên ô tô', '<p><span style=\"font-size:16px;\"><strong><em>Dây Nguồn đầu tẩu Ra Đầu DC 5.5X2.1 / 2.5 trên&nbsp;ô tô</em></strong></span></p>\n<p><span style=\"font-size:14px;\">Dây nguồn dùng để sạc các loại máy nghe nhạc, cd dvd player, loa nghe nhạc thẻ nhớ, usb, đài, radio…..</span></p>\n<ul>\n<li><span style=\"font-size:14px;\">Dây Nguồn đầu tẩu&nbsp;sang DC 5.5×2.1</span></li>\n<li><span style=\"font-size:14px;\">Dây xoắn lò xo kéo thẳng 1.2M</span></li>\n<li><span style=\"font-size:14px;\">Có cầu chì 3A bảo bảo vệ thiết bị</span></li>\n<li><span style=\"font-size:14px;\">Dòng tối đa: 3A</span></li>\n<li><span style=\"font-size:14px;\">Chức năng: Cấp&nbsp;nguồn cho các thiết bị khác thông qua&nbsp;Nguồn đầu tẩu trên ô tô</span></li>\n<li><span style=\"font-size: 14px;\">Điện áp sử dụng từ 9-12V</span></li></ul>\n<p><span style=\"font-size:14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-dc5-5-2.jpg?v=1613721808606\" /></span></p>\n<p><span style=\"font-size:14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-dc5-5-1.jpg?v=1613721824613\" /></span></p>\n<p><span style=\"font-size:14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-dc5-5-3.jpg?v=1613721825284\" /></span></p>\n<p><span style=\"font-size:14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-sac-dc5-5-4.jpg?v=1613722178977\" />&nbsp;</span></p>', '', 'Đầu DC 5.5X2.1 / 2.5', 'Đầu DC 5.5X2.1 / 2.5, Dây Nguồn đầu tẩu Ra Đầu DC 5.5X2.1 / 2.5 cho ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '35000'