(1264, 'day-nguon-dc-12v-cap-nguon-cho-camera-giam-sat-o-to', 'Dây nguồn DC 12V lõi đồng cho camera giám sát', '<h1><em><strong>Dây nguồn DC 12V lõi đồng cho camera giám sát</strong></em></h1>\n<p>Kích thước jack DC : 5.5*2.1(mm)</p>\n<p>Chiều dài dây : 25(cm) Lõi dây : 0.3mm</p>\n<p>Công xuất tải tối đa : &lt;45W</p>\n<p>Điện áp tải cho phép(DC) : 1-24V</p>\n<p>Nhiệt độ cho phép : &lt;60 độ C</p>\n<p>Chất liệu vỏ : PVC,&nbsp;Lõi đồng cao cấp</p>\n<p>Ứng dụng dây: thay thế đầu dây cấp nguồn cho camera.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-nguon-camera-man-hinh-cho-o-to-dc-12v-3.jpg?v=1612067256886\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-nguon-camera-man-hinh-cho-o-to-dc-12v-1.jpg?v=1612067266793\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-nguon-camera-man-hinh-cho-o-to-dc-12v-2.jpg?v=1612067267449\" /></strong></em></p>', '', 'Dây nguồn DC 12V', 'Dây nguồn DC 12V, Dây nguồn DC 12V cấp nguồn cho camera giám sát, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '12000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20578348/day-nguon-dc-12v-cap-nguon-cho-camera-giam-sat-o-to.jpg', '<p>Kích thước jack DC : 5.5*2.1(mm)</p>\n<p>Chiều dài dây : 25(cm) Lõi dây : 0.3mm</p>\n<p>Công xuất tải tối đa : &lt;45W</p>\n<p>Điện áp tải cho phép(DC) : 1-24V</p>\n<p>Nhiệt độ cho phép : &lt;', '20578348', '41490977', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04'),
(1265, 'keo-mau-che-vet-xuoc-khuyet-diem-do-go-noi-that', 'Keo màu che vết xước, khuyết điểm đồ gỗ nội thất', '<p><em><strong>Keo màu che vết xước, khuyết điểm đồ gỗ nội thất</strong></em></p>\n<p>Keo che xước sơn đồ gỗ, sàn gỗ, che vết nứt, vết xước trên đồ gỗ phủ màu gỗ Che đi các vết xước, vết trầy, lỗ hổng, khoảng trống trên bề mặt gỗ</p>\n<p>Dễ sử dụng, hiệu quả nhanh chóng Nhiều màu sắc có sẵn để lựa chọn, tùy theo nhu cầu sử dụng.</p>\n<p>Thời gian khô: Se bề mặt trong vòng 2h -keo chết hoàn toàn sau 24h</p>\n<p>Sau khi keo khô sẽ liên kết vào bề mặt khuyết điểm chắn,không bị bong như 1 số dòng bột bả trên thị trường, hạn chế được tối đa việc co ngót.</p>\n<p>Trọng lượng: 20g.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-5.jpg?v=1612064391291\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-7.jpg?v=1612064391751\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-6.jpg?v=1612064404258\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-1.jpg?v=1612064414561\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-2.jpg?v=1612064415473\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/son-che-khuyet-diem-vet-xuoc-do-go-noi-that-3.jpg?v=1612064416139\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100