(1266, 'cau-chi-xe-o-to-agu-60a', 'Cầu chì xe ô tô AGU 60A', '<p><em><strong>Cầu chì xe ô tô AGU 60A</strong></em></p>\n<p>Cầu chì là một thiết bị bảo vệ mạch điện khỏi bị hư hỏng hoặc phát tia lửa khi mạch hoặc quá tải.</p>\n<p>Chuyên dụng thay thế cho cầu chì trên xe hơi 60A</p>\n<p>Kích thước 38*10MM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cau-chi-xe-o-to-60a.jpg?v=1611998164762\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cau-chi-xe-o-to-60a-5-cc111974-1fc0-42c8-a798-7153fb5381fa.jpg?v=1611998768451\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cau-chi-xe-o-to-60a-2.jpg?v=1611998459059\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cau-chi-xe-o-to-60a-3.jpg?v=1611998459908\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cau-chi-xe-o-to-60a-4.jpg?v=1611998460732\" /></strong></em></p>', '', 'Cầu chì xe hơi', 'cầu chì, cầu chì ô tô, cầu chì ô tô 60A, cầu chì xe hơi 60A, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20575559/cau-chi-xe-o-to-agu-60a.jpg', '<p>Cầu chì là một thiết bị bảo vệ mạch điện khỏi bị hư hỏng hoặc phát tia lửa khi mạch hoặc quá tải.</p>\n<p>Chuyên dụng thay thế cho cầu chì trên xe hơi 60A</p>\n<p>Kích thước 38*10MM</p>', '20575559', '41484429', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04'),
(1267, 'jack-cam-nguon-dien-dau-tau-o-to-12v-24v', 'Jack cắm nguồn điện đầu tẩu ô tô 12V/24V', '<h1><em><strong>Jack cắm nguồn điện đầu tẩu ô tô 12V/24V</strong></em></h1>\n<p>Nguồn điện: 12V 24V DC<br />\nCông suất: 36W<br />\nCó cầu chì 3A chống cháy nổ<br />\nKiểu: kết&nbsp;nối nhanh.<br />\nNguồn cấm vào ổ cắm chân tẩu nguồn xe ô tô.<br />\nKhông kèm dây nguồn, tháo ráp tự nối dây nguồn đơn giản.<br />\nChiều dài: 70mm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-chan-tau-12-24v-1.jpg?v=1611995505441\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-chan-tau-12-24v-2.jpg?v=1611995805656\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-chan-tau-12-24v-3.jpg?v=1611995806105\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-chan-tau-12-24v-4.jpg?v=1611995806545\" /></p>', '', 'Jack cắm nguồn điện đầu tẩu', 'Jack cắm nguồn điện đầu tẩu, Jack cắm nguồn điện đầu tẩu ô tô 12V/24V, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '35000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/20575302/jack-cam-nguon-dien-dau-tau-o-to-12v-24v.jpg', '<p>Nguồn điện: 12V 24V DC<br />\nCông suất: 36W<br />\nCó cầu chì 3A chống cháy nổ<br />\nKiểu: kết&nbsp;nối nhanh.<br />\nNguồn cấm vào ổ cắm chân tẩu nguồn xe ô tô.<br />\nKhông kèm dây nguồn, t', '20575302', '41483685', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04'),
