(1269, 'lop-xe-moto-khong-xam-off-road-100-90-17', 'Lốp Xe Moto Không Xăm Off-Road 100/90-17', '<p><em><strong>Lốp Xe Moto Không Xăm Off-Road 100/90-17</strong></em></p>\n<p>&nbsp;Lốp xe máy chất liệu là các sợi cao su siêu bền bỉ, đáp ứng được nhiều điều kiện thời tiết từ nắng, mưa đến lạnh…&nbsp;Các đường rãnh khá sâu, nhiều và kết thành mạng nhện đẹp mắt, chống mòn chóng trơn cực tốt.</p>\n<p>&nbsp;Kích thước&nbsp;100/90-17&nbsp;phù hợp với các dòng xe cao, phân khối lớn có vành với đường kính 17icnh.</p>\n<p>Để xác đinh đúng với xe bạn nên xem kĩ thông số lốp:</p>\n<p>100:&nbsp;Là bề rộng của lốp, tính bằng mm.<br />\n90:&nbsp;Là % chiều cao của lốp so với bề rộng của lốp. Như vậy ở đây chiều cao của lốp là: 100%*90 = 90 mm<br />\n17: Là đường kính danh nghĩa của vành và được tính bằng đơn vị inchs.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-khong-xam-100-90-17-4.jpg?v=1611890869491\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-khong-xam-100-90-17-2.jpg?v=1611890881425\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-khong-xam-100-90-17-3.jpg?v=1611890882294\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-khong-xam-100-90-17-1.jpg?v=1611890891419\" /></strong></em></p>', '', 'Lốp không xăm', 'lốp không xăm, lốp xe không xăm, Lốp Xe Moto Không Xăm Off-Road 100/90-17, ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/20561893/lop-xe-moto-khong-xam-off-road-100-90-17.jpg', '<p>&nbsp;Lốp xe máy chất liệu là các sợi cao su siêu bền bỉ, đáp ứng được nhiều điều kiện thời tiết từ nắng, mưa đến lạnh…&nbsp;Các đường rãnh khá sâu, nhiều và kết thành mạng nhện đẹp mắt, c', '20561893', '41442833', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04');
