(1270, 'day-dan-co-san-cau-chi-10a', 'Dây dẫn điện có sẵn cầu chì 10A cho ô tô xe máy', '<p><em><strong>Dây dẫn điện&nbsp;có sẵn cầu chì 10A cho ô tô xe máy</strong></em></p>\n<p>Dây dẫn điện chuyên dụng cho ô tô xe máy có dòng điện tối đa 10A</p>\n<p>Lõi đồng 32 sợi tổng chiều dài 30CM.</p>\n<p>Cầu chì 10A giúp đảm bảo cho các phụ kiện vật dụng dùng điện trên xe an toàn chống cháy, chập tốt hơn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-dan-co-cau-san-cau-chi-cho-o-to-xe-may-1.jpg?v=1611723708231\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-dan-co-cau-san-cau-chi-cho-o-to-xe-may-2.jpg?v=1611723708895\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-dan-co-cau-san-cau-chi-cho-o-to-xe-may-3.jpg?v=1611723709318\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-dan-co-cau-san-cau-chi-cho-o-to-xe-may-6.jpg?v=1611723709957\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Dây dẫn điện ô tô xe máy', 'dây dẫn có sẵn cầu chì, Dây dẫn điện có sẵn cầu chì 10A cho ô tô xe máy, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.1', 'kg', 'images/20546026/day-dan-co-san-cau-chi-10a.jpg', '<p>Dây dẫn điện chuyên dụng cho ô tô xe máy có dòng điện tối đa 10A</p>\n<p>Lõi đồng 32 sợi tổng chiều dài 30CM.</p>\n<p>Cầu chì 10A giúp đảm bảo cho các phụ kiện vật dụng dùng điện trên xe an ', '20546026', '41406025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04'),
(1271, 'cong-tac-gat-3-chan-15-20a', 'Công tắc gạt 3 chân ON-OFF-ON 15-20A', '<p><em><strong>Công tắc gạt 3 chân 15-20A</strong></em></p>\n<p>Điện áp: AC 225V - 20A, AC 250V - 20A, có thể sử dụng cho ô tô xe máy điện áp AC 12, 24V - 20A</p>\n<p>Số chân công tắc: 3 chân</p>\n<p>Kích thước: 3.2×15.5mm</p>\n<p>Ứng dụng: dùng để đảo chiều động cơ motor, đảo mạch điện bóng đèn…</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-3-cuc-125-200v-4.jpg?v=1611719239566\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-3-cuc-125-200v-1.jpg?v=1611719252830\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-3-cuc-125-200v-2.jpg?v=1611719253503\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-3-cuc-125-200v-3.jpg?v=1611719254357\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-3-cuc-125-200v-5.jpg?v=1611719624890\" /></strong></em></p>', '', 'Công tắc gạt 3 chân 15-20A', 'công tắc 3 chân, Công tắc gạt 3 chân 15-20A, CÔNG TẮC ON OFF, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20545100/cong-tac-gat-3-chan-15-20a.jpg', '<p>Điện áp: AC 225V - 20A, AC 250V - 20A, có thể sử dụng cho ô tô xe máy điện áp AC 12, 24V - 20A</p>\n<p>Số chân công tắc: 3 chân</p>\n<p>Kích thước: 3.2×15.5mm</p>\n<p>Ứng dụng: dùng để đảo ch', '20545100', '41404261', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:04', '2024-05-29 06:12:04'),
(1272, 'num-tay-cam-cua-tu-ngan-keo', 'Núm tay cầm cửa tủ, ngăn kéo', '<p><em><strong>Núm tay cầm cửa tủ, ngăn kéo</strong></em></p>\n<p>Núm kéo cửa tủ bằng nhôm được&nbsp;thiết kế gọn nhẹ, được gia công kỹ thuật cao nên cho cảm giác cầm nắm vô cùng thoải mái.</p>\n<p>Sản phẩm đã bao gồm vít vặn đi kèm.</p>\n<p>Chia làm 2 loại núm tròn và núm T</p>\n<p>Kích thước: Núm tròn nhỏ 19 (19.9*22.8MM);&nbsp;Núm tròn to 24 (24.7*25.5MM) Núm T (50*20MM)</p>\n<p>Màu sắc: Vàng, đen.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-1-a248dfc6-4377-4166-be0c-090c1a28b317.jpg?v=1611656272795\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-2-b5a568b5-6a7a-4332-8cf2-98c6293e3bc6.jpg?v=1611656273727\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-3.jpg?v=1611656274188\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-4-5ff4fc3f-4e42-427f-afab-95c227820b54.jpg?v=1611656275119\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-vv-1.jpg?v=1611713197329\" /></strong></em></p>', '', 'Núm tay cầm cửa tủ, ngăn kéo', 'ngăn kéo, núm cầm ngăn kéo, núm của tủ, núm ngăn kéo, Núm tay cầm cửa tủ, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Kích thước', 'Núm tròn 19', '', '', '', '', '', 'deny', '', '18000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/20540071/num-tay-cam-cua-tu-ngan-keo.jpg', '<p>Núm kéo cửa tủ bằng nhôm được&nbsp;thiết kế gọn nhẹ, được gia công kỹ thuật cao nên cho cảm giác cầm nắm vô cùng thoải mái.</p>\n<p>Sản phẩm đã bao gồm vít vặn đi kèm.</p>\n<p>Chia làm ', '20540071', '41362521', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1273, 'tay-cam-con-lan-son-tuong', 'Tay cầm con lăn sơn', '<h1><strong><em>Tay cầm con lăn sơn</em></strong></h1>\n<p>Tay cầm con lăn tiện dụng sử dụng chung cho nhiều loại con lăn, bông lăn sơn&nbsp;khác nhau.</p>\n<p>Chất liệu: tay cầm nhựa phần cán thép không gỉ.</p>\n<p>Kích thước:&nbsp; 2 inch (dài 36cm, tay cầm 3.2, đường lính lỗ tay cầm 2.7cm, đường kính cán 5mm);&nbsp; 4 inch (dài 40cm, tay cầm 3, đường lính lỗ tay cầm 2.4cm, đường kính cán 5mm).</p>\n<p>Tay cầm chưa có&nbsp;bông lăn.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-lan-son-1.jpg?v=1611650796490\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-lan-son-2.jpg?v=1611650797134\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-lan-son-3.jpg?v=1611650797778\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-lan-son-4.jpg?v=1611650798437\" /></p>\n<p>&nbsp;</p>', '', 'Tay cầm con lăn sơn', 'cán lăn sơn, Tay cầm con lăn sơn, tay cầm lăn sơn, tay lăn sơn, Volcano, volcano.vn', '1', 'Kích thước', '2 inch', '', '', '', '', '', '', '', 'deny', '', '25000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20537458/tay-cam-con-lan-son-tuong.jpg', '<p>Tay cầm con lăn tiện dụng sử dụng chung cho nhiều loại con lăn, bông lăn sơn&nbsp;khác nhau.</p>\n<p>Chất liệu: tay cầm nhựa phần cán thép không gỉ.</p>\n<p>Kích thước:&nbsp; 2 inch (dài 36c', '20537458', '41349521', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1274, 'jack-cam-nguon-dien-dau-tau-o-to-12v-24v-15a-128w', 'Jack cắm nguồn điện đầu tẩu ô tô 12V/24V/15A-128W', '<h1><span style=\"font-size:14px;\"><em><strong>Jack cắm nguồn điện đầu tẩu ô tô 12V/24V/15A-128W</strong></em></span></h1>\n<p>Nguồn điện: 12V 24V DC<br />\nChịu tải: 180W<br />\nCó cầu chì chống cháy nổ<br />\nKiểu: kết&nbsp;nối nhanh.<br />\nNguồn cấm vào ổ cắm chân tẩu nguồn xe ô tô.<br />\nKhông kèm dây nguồn, tháo ráp tự nối dây nguồn đơn giản.<br />\nChiều dài: 84mm.</p>\n<p><span style=\"font-size:14px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-nguon-dien-dau-tau-o-to-12-24v-8a-1.jpg?v=1611629889810\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-nguon-dien-dau-tau-o-to-12-24v-8a-2.jpg?v=1611629890246\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/jack-cam-nguon-dien-dau-tau-o-to-12-24v-8a-3.jpg?v=1611629890673\" /></strong></em></span></p>\n<p>&nbsp;</p>', '', 'Jack cắ nguồn điện đầu tẩu ô tô', 'Jack cấm nguồn điện đầu tẩu ô tô, Jack cấm nguồn điện đầu tẩu ô tô  12v/24V/15A-128W, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20534020/jack-cam-nguon-dien-dau-tau-o-to-12v-24v-15a-128w.jpg', '<p>Nguồn điện: 12V 24V DC<br />\nChịu tải: 180W<br />\nCó cầu chì chống cháy nổ<br />\nKiểu: kết&nbsp;nối nhanh.<br />\nNguồn cấm vào ổ cắm chân tẩu nguồn xe ô tô.<br />\nKhông kèm dây nguồn, tháo', '20534020', '41340389', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1275, 'tay-nam-num-cua-ngan-keo-canh-cua-cao-cap', 'Tay Nắm Cửa tủ, Ngăn Kéo, Cánh Cửa 2 chân cao cấp', '<p><strong><em>Tay Nắm Cửa tủ, Ngăn Kéo, Cánh Cửa 2 chân cao cấp</em></strong></p>\n<p>Tay Nắm Núm Cửa tủ, Ngăn Kéo, Cánh Cửa cao cấp chất liệu hợp kim nhôm cao cấp mạ màu đen và màu vàng Gold sang trọng.</p>\n<p>Chia làm nhiều loại và nhiều kích thước khác nhau với 2 màu đen và vàng.</p>\n<p>Chia làm nhiều size theo chiều dài khác nhau.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-7.jpg?v=1611549507402\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-8.jpg?v=1611549514734\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-9.jpg?v=1611549521908\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/num-mo-cua-tu-ngan-keo-10.jpg?v=1611549529408\" /></em></strong></p>', '', '', '', '1', 'Màu sắc', 'Vàng', 'Mã', '128', '', '', '', '', '', 'deny', '', '55000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/20522597/tay-nam-num-cua-ngan-keo-canh-cua-cao-cap.jpg', '<p>Tay Nắm Núm Cửa tủ, Ngăn Kéo, Cánh Cửa cao cấp chất liệu hợp kim nhôm cao cấp mạ màu đen và màu vàng Gold sang trọng.</p>\n<p>Chia làm nhiều loại và nhiều kích thước khác nhau với 2 màu đen', '20522597', '41275359', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1276, 'o-cam-nguon-3-lo-cam-250v-10a', 'Ổ cắm nguồn 3 lỗ cắm 250V-10A', '<p><em><strong>Ổ cắm nguồn 3 lỗ cắm 250V-10A</strong></em></p>\n<p>Ổ cắm nguồn điện tự 3 lỗ cắm sử dụng được&nbsp;cho nhiều loại thiết bị,&nbsp;máy tính...</p>\n<p>Thiết kế 3 chân chắm an toàn chịu nhiệt cách điện chống cháy nổ tốt.</p>\n<p>Chia làm 2 loại: chân gài và laoij có tai bắt vít khi lắp đặt thay thế.</p>\n<p>Kích thước: loại có tai 4.9*2.8*3CM, loại chân gài 3*2.7*3CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-nguon-3-lo-1.jpg?v=1611541728641\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-nguon-3-lo-6.jpg?v=1611541906455\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-nguon-3-lo-3.jpg?v=1611541738557\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-nguon-3-lo-4.jpg?v=1611541744823\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-nguon-3-lo-7.jpg?v=1611543069493\" /></strong></em></p>', '', 'Ổ cắm nguồn', 'ổ cắm 3 chân, Ổ cắm nguồn 3 lỗ cắm 250V, Ổ cắm nguồn 3 lỗ cắm 250V-10A, Volcano, volcano.vn', '1', 'Loại', 'Chân gài', '', '', '', '', '', '', '', 'deny', '', '12000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20520295/o-cam-nguon-3-lo-cam-250v-10a.jpg', '<p>Ổ cắm nguồn điện tự 3 lỗ cắm sử dụng được&nbsp;cho nhiều loại thiết bị,&nbsp;máy tính...</p>\n<p>Thiết kế 3 chân chắm an toàn chịu nhiệt cách điện chống cháy nổ tốt.</p>\n<p>Chia làm 2 loại:', '20520295', '41265097', NULL, NULL, NULL, NULL, NULL, NULL, NU