(1277, 'dau-cam-chan-tau-xe-o-to-12v10a', 'Đầu cắm chân tẩu xe ô tô 12V10A', '<p><em><strong>Đầu cắm chân tẩu xe ô tô 12V10A</strong></em></p>\n<p>Đầu cắm chân tẩu tô phù hợp sử dụng cho mọi dòng&nbsp;xe ô tô điện 12V</p>\n<p>Có công tắc ấn bất tắt tiện dụng, phù hợp làm dây nguồn cho nhiều thiết bị điện hoặc đây nguồn đèn trợ sáng, đèn led trang trí,...</p>\n<p>Đầu cắm có cầu chì sử dụng ăn toàn cho mọi thiết bị.</p>\n<p>Vỏ nhựa ABS cao cấp an toàn cho người dùng.</p>\n<p>Kích thước: 9*3.5cm, đường kính đầu cắm 2.2cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-1.jpg?v=1611286811307\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-2.jpg?v=1611286811744\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-3.jpg?v=1611286812376\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-4.jpg?v=1611286813062\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-cam-chan-tau-o-to-5.jpg?v=1611286813892\" /></strong></em></p>', '', 'Đầu cắm chân tẩu xe ô tô', 'đầu cắm, Đầu cắm chân tẩu xe ô tô 12V10A, đầu cắm tẩu 12V, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/20503829/dau-cam-chan-tau-xe-o-to-12v10a.jpg', '<p><em><strong>Đầu cắm chân tẩu </strong></em>tô phù hợp sử dụng cho mọi dòng&nbsp;xe ô tô điện 12V</p>\n<p>Có công tắc ấn bất tắt tiện dụng, phù hợp làm dây nguồn cho nhiều thiết bị điện hoặc', '20503829', '41215797', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1278, 'o-cam-chan-tau-o-to-xe-may-12v-120w-chua-co-day-dan', 'Ổ Cắm Chân Tẩu Ô Tô Xe Máy 12V-120W (chưa có dây dẫn)', '<p><em><strong>Ổ Cắm Chân Tẩu Ô Tô Xe Máy 12V-120W (chưa có dây dẫn)</strong></em></p>\n<p>Ổ cắm nguồn chân tẩu (ổ cái) sử dụng được cho cả ô tô và xe máy điện 12V, công&nbsp;suất làm việc đến 120W phù hợp sử dụng hầu hết tất cả các thiết bị điện trên ô tô và xe máy như máy đánh bóng, mấy hút bụi, quạt, tủ lạnh,...</p>\n<p>Chất liệu kim loại kết hợp nắp và vỏ nhựa chống thấm nước.</p>\n<p>Lắp đặt đơn giản đấu trực tiếp 2 cực của điện bình ắc quy tương ứng chân màu vàng đồng là cực dương (+), chân trắng bạc là cực âm (-).</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-12v-1.jpg?v=1611217239059\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-12v-2.jpg?v=1611217247243\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-12v-3.jpg?v=1611217254700\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dau-tau-12v-4.jpg?v=1611217263133\" /></strong></em></p>', '', '', '', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '69000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20497225/o-cam-chan-tau-o-to-xe-may-12v-120w-chua-co-day-dan.jpg', '<p>Ổ cắm nguồn chân tẩu (ổ cái) sử dụng được cho cả ô tô và xe máy điện 12V, công&nbsp;suất làm việc đến 120W phù hợp sử dụng hầu hết tất cả các thiết bị điện trên ô tô và xe máy như máy đánh', '20497225', '41200258', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1279, 'tay-nam-num-cua-ngan-keo-canh-cua-su-ran-vintage', 'Tay nắm núm cửa, ngăn kéo, cánh cửa sứ rạn Vintage', '<p><em><strong>Tay nắm núm cửa, ngăn kéo, cánh cửa sứ rạn Vintage</strong></em></p>\n<p>Bộ sưu tập&nbsp;tay nắm tủ&nbsp;với loại gốm sứ rạn&nbsp;được thiết kế tối giản theo phong cách cổ điển Châu Âu. Sản phẩm gồm phần gốm sứ cao cấp được sản xuất theo công nghệ nung tiên tiến mang đến chất lượng gốm cao không tì vết và phần chân đế là hợp kim kẽm chắc chắn.</p>\n<p>Phụ kiện phù hợp với các công trình nội thất cao cấp có thiết kế theo phong cách tân cổ điển và cổ điển, mang đến sự tinh tế và nổi bật của công trình</p>\n<ul>\n<li>\n<p>Chất liệu dày, ổn định và bền, gốm nung ở nhiệt độ cao.</p></li>\n<li>\n<p>Cầm chắc tay, cảm thấy thoải mái do thiết kế kích thước tay nắm hợp lý.</p></li>\n<li>\n<p>Thiết kế theo phong cách cổ điển Châu Âu.</p></li>\n<li>\n<p>Gốm sứ rạn đẹp&nbsp;không chứa tạp chất do sử dụng vật liệu tốt với công đoạn nung gốm nhiệt độ cao.</p></li>\n<li>\n<p>Sử dụng vật liệu hợp kim kẽm, cứng và chống ăn mòn.</p></li></ul>\n<p>Sản phẩm được bán theo nhiều phân loại khác nhau với giá khác nhau.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-2.jpg?v=1611204938169\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-6.jpg?v=1611204950603\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-7.jpg?v=1611204959542\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-9.jpg?v=1611204970959\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-1.jpg?v=1611204988479\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-3.jpg?v=1611205005116\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-4.jpg?v=1611205012558\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-10.jpg?v=1611205024003\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-mo-cua-ngan-keo-cua-nha-bang-su-phong-cach-co-dien-11.jpg?v=1611205031200\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Tay nắm núm cửa, ngăn kéo, cánh cửa sứ rạn', 'cánh cửa sứ rạn Vintage, ngăn kéo, tay nắm cánh cửa tủ, tay nắm cửa ngăn kéo, Tay nắm núm cửa, Volcano, volcano.vn', '1', 'Phân loại', 'TN6041', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/20494231/tay-nam-num-cua-ngan-keo-canh-cua-su-ran-vintage.jpg', '<ul>\n<li>\n<p>Chất liệu dày, ổn định và bền, gốm nung ở nhiệt độ cao.</p></li>\n<li>\n<p>Cầm chắc tay, cảm thấy thoải mái do thiết kế kích thước tay nắm hợp lý.</p></li>\n<li>\n<p>Thiết kế theo ph', '20494231', '41180084', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:05', '2024-05-29 06:12:05'),
(1280, 'banh-xe-tro-luc-day-xe-may-bi-thung-xam-lop', 'Bánh xe trợ lực đẩy xe máy thủng xăm, thủng lốp, hết hơi', '<p><em><strong>Bánh xe trợ lực đẩy xe máy thủng xăm, thủng lốp, hết hơi</strong></em></p>\n<p>Khi đi xe máy thì trường hợp bị thủng xăm, lốp hết hơi là điều không thể tránh khỏi và bạn sẽ phải dắt bộ với trọng lượng của xe là rất nặng! Vậy với sản phẩm&nbsp;Bánh xe trợ lực đẩy xe máy bị thủng xăm, lốp&nbsp;sẽ giúp bạn đẩy xe một cách nhẹ nhành.</p>\n<p>Chất liệu kim loại và trang bị 5 bánh xe nhựa đúc chịu lực&nbsp;tốt.</p>\n<p>Bàn tiếp xúc với lốp xe linh hoạt có thể sử dụng cho mọi loại xe.</p>\n<p>Thiết kế nhỏ gọn có thể gấp gọn lại để trong cốp xe.</p>\n<p>Kích thước: 30*15*9CM, vị trí tiếp xúc 10CM.</p>\n<p>Màu sắc phân loại theo bánh xe:&nbsp;&nbsp;Đen, Xanh, Hồng, Trắng, Tím.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-1.jpg?v=1609735882699\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-2.jpg?v=1609735892430\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-3.jpg?v=1609735914439\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-5.jpg?v=1609735915399\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-6.jpg?v=1609742827971\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-decal-xe-hoda-7.jpg?v=1609742828862\" /></strong></em>