(1282, 'gia-do-da-nang-gan-guong-chieu-hau', 'Giá Đỡ Đa Năng Gắn Chân Gương Xe Máy GDCC', '<h1><em><strong>Giá Đỡ Đa Năng Gắn Chân Gương Xe Máy GDCC</strong></em></h1>\n<p>Thanh đỡ&nbsp;gắn trực tiếp lên 2 chân gương xe máy tạo thành giá đỡ đa năng.</p>\n<p>Giá đỡ với chân ren 6mm phù hợp nhiều loại&nbsp;phụ kiện như: kẹp điện thoại, kẹp đèn trợ&nbsp;sáng...</p>\n<p>Chất liệu hợp kim nhôm cao cấp, chống gỉ.</p>\n<p>Bộ sản phẩm có kèm phụ kiện lắp đặt đơn giản.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-2.jpg?v=1607397357318\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-4.jpg?v=1607397364740\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-9.jpg?v=1609821011468\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-8.jpg?v=1609821018481\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-3.jpg?v=1607397371898\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-1.jpg?v=1607397139022\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-5.jpg?v=1607397506083\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-don-ghi-dong-7.jpg?v=1607397527555\" /></p>', '', 'giá đỡ đa năng xe máy', 'giá đỡ đa năng, Giá Đỡ Đa Năng Gắn Gương Chiếu Hậu GDCC, giá đỡ xe máy, ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '210000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/19977259/gia-do-da-nang-gan-guong-chieu-hau.jpg', '<p>Thanh đỡ&nbsp;gắn trực tiếp lên 2 chân gương xe máy tạo thành giá đỡ đa năng.</p>\n<p>Giá đỡ với chân ren 6mm phù hợp nhiều loại&nbsp;phụ kiện như: kẹp điện thoại, kẹp đèn trợ&nbsp;sáng...<', '19977259', '39275519', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:06', '2024-05-29 06:12:06'),
(1283, 'bang-so-dien-thoai-kiem-gia-dien-thoai-da-nang-de-taplo-o-to', 'Bảng số điện thoại kiêm giá điện thoại đa năng để taplo ô tô', '<p><span style=\"font-size:14px;\"><em><strong>Bảng số điện thoại kiêm giá điện thoại đa năng để taplo ô tô</strong></em></span></p>\n<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần!</p>\n<p>&nbsp;Thay vì những tờ danh thiếp hay những mẩu giấy nhỏ bé khó nhìn ghi lại số điện thoại để trong xe thì&nbsp;Bảng số điện thoại&nbsp;sẽ là&nbsp;giải pháp cho bạn loại bỏ tất cả nhũng vẫn đó.</p>\n<p>Bảng số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giản tiện dụng. Đặc biệt sản phẩm tích hợp dạng giá đỡ điện thoại tiện ích cho bạn đặt điện thoại lên và tích hợp luôn một ống đựng sáp thơm (tặng kèm 1 thỏi sáp thơm khi mua sản phẩm)</p>\n<p>Sử dụng&nbsp;đơn giản với 11 dãy số từ 0 đến 9 và có thể thay đổi số điện thoại dễ dàng.</p>\n<p>Chất liệu kim loại có gắn thêm đầu thoát hiểm khi cần thiết.</p>\n<p>Kích thước: nhỏ gọn 13.2*5.7*3cm</p>\n<p><span style=\"font-size:14px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-so-dien-thoai-o-to-da-nang-1.jpg?v=1606274914187\" /></strong></em></span></p>\n<p><span style=\"font-size:14px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-so-dien-thoai-o-to-da-nang-2.jpg?v=1606274920383\" /></strong></em></span></p>\n<p><span style=\"font-size:14px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-so-dien-thoai-o-to-da-nang-3.jpg?v=1606274927366\" /></strong></em></span></p>\n<p><span style=\"font-size:14px;\"><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bang-so-dien-thoai-o-to-da-nang-4.jpg?v=1606274933601\" /></strong></em></span></p>', '', 'Bảng số điện thoại ô tô', 'bản số điện thoại, Bảng số điện thoại kiêm giá điện thoại đa năng, giá đỡ điện thoại, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/19852087/bang-so-dien-thoai-kiem-gia-dien-thoai-da-nang-de-taplo-o-to.jpg', '<p>Bảng số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giản tiện dụng. Đặc biệt sản phẩm tích hợp dạng giá đỡ điện thoại tiện ích cho bạn đặt điện thoại lên và tích hợp luôn một ống đựn', '19852087', '38674381', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:06', '2024-05-29 06:12:06'),
(1284, 'phao-cau-ca-dien-tu-co-den', 'Phao câu cá điện tử có đèn', '<p><em><strong>Phao câu cá điện tử có đèn</strong></em></p>\n<p>Phao câu điện tử thiết kế kểu dáng đẹp, câu có độ nhạy rất cao.</p>\n<p>Phù hợp&nbsp;cho cả&nbsp;câu ngày và câu đêm.</p>\n<p>Cao tặng kèm 01 pin điện tử CR-425</p>\n<p>Chia làm 3 loại có độ dài và trọng lượng khác nhau: J-02(dài 17cm, nặng 1.13g, tải chì 1.4g); J-03 (dài 18.2cm, nặng 1.21g, tải chì 2.1g);J-4 (dài 19.2cm, nặng 1.23g, tải chì 2.3g); J-05 (dài 19.2cm, nặng 1.225g, tải chì 2.30g).</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-co-den-1.jpg?v=1605934420539\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-co-den-2.jpg?v=1605934427449\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-co-den-4.jpg?v=1605943055169\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-co-den-5.jpg?v=1605943062762\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phao-cau-don-co-den-3.jpg?v=1605934433746\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Phao câu cá', 'câu cá, phao câu cá, phao câu cá có đèn, phao câu có đèn, Volcano, volcano.vn', '1', 'Kích thước', 'J-02', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/19814736/phao-cau-ca-dien-tu-co-den.jpg', '<p>Phao câu điện tử thiết kế kểu dáng đẹp, câu có độ nhạy rất cao.</p>\n<p>Phù hợp&nbsp;cho cả&nbsp;câu ngày và câu đêm.</p>\n<p>Cao tặng kèm 01 pin điện tử CR-425</p>\n<p>Chia làm 3 loại có độ ', '19814736', '38509268', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:06', '2024-05-29 06:12:06'),
(1285, 'op-chup-mam-lazang-xe-o-to-cm02', 'Ốp chụp mâm (Lazang ) xe ô tô CM02 - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Ốp chụp mâm (Lazang ) xe ô tô CM02&nbsp;</strong></em><strong><em>- Khắc Laser Theo Yêu Cầu</em></strong></p>\n<p>Sau quá trình sử dụng ốp lazang của xe không tránh được&nbsp; tình trạng chày xước sỉn màu mất thẩm mỹ...</p>\n<p>Bộ 4 ốp&nbsp;chụp mâm (Lazang ) xe ô tô Ford Transit 16 inch với thiết kế theo mẫu nguyên bản.</p>\n<p>Với vật liệu nhựa PP chắc chắn, bền màu với thời gian.</p>\n<p>Chuyên dụng cho&nbsp;Xe&nbsp;có thông số&nbsp;lốp R15</p>\n<p>Lắp đặt đơn giản với lẫy gài chắc chắn.</p>\n<p>Kích thước:&nbsp;15 inch (ứng thông số lốp R15)</p>\n<p>Cách chọn đúng kính thước: Trên lốp ký hiệu R15 tương đương chọn sản phẩm15&nbsp;inch.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chup-mam-xe-o-to-5-oc-3.jpg?v=1605863346679\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chup-mam-xe-o-to-5-oc-1.jpg?v=1605863354095\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chup-mam-xe-o-to-5-oc-2.jpg?v=1605863360136\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/op-chup-mam-xe-ford-4-b73dff9a-ba12-4859-9b0b-14e50e50298a.jpg?v=1605599362266\" /></p>', '', 'chụp mâm xe', 'ô tô, Ốp chụp mâm, Ốp chụp mâm (Lazang ) xe ô tô CM02, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '750000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/19797068/op-chup-mam-lazang-xe-o-to-cm02.jpg',