(1286, 'hop-dung-moi-va-phu-kien-lure-2-tang-nhieu-ngan', 'Hộp đựng mồi và phụ kiện lure 2 tầng nhiều ngăn', '<h1><span style=\"font-size:16px;\"><em><strong>Hộp đựng mồi và phụ kiện lure 2 tầng nhiều ngăn</strong></em></span></h1>\n<p><span style=\"font-size:16px;\">Chất liệu nhựa nhựa đẻo trong xuốt bền bỉ, in logo Fishing Clup đẹp mắt.</span></p>\n<p><span style=\"font-size:16px;\">Hộp có 13 ngăn lơn nhỏ khác nhau có dây đeo và móc tiện dụng.</span></p>\n<p><span style=\"font-size: 16px;\">Kích thước hộp: 18*10*4.5CM, kích thước ngăn: 5 ngăn 9.5*3.2*2cm, 4 ngăn 12*2.2*2CM, 4 ngăn5.3*2.2*2CM.</span></p>\n<p><span style=\"font-size: 16px;\">Màu sắc: Xanh dương, Xanh rêu quân đội, vàng, xanh lá</span></p>\n<p><span style=\"font-size: 16px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-moi-cau-lure-4-7462a242-4511-4cfb-9de0-dfeb02e5fd26.jpg?v=1605672013426\" /></span></p>\n<p><span style=\"font-size: 16px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dugn-do-cau-3.jpg?v=1629102645563\" /></span></p>\n<p><span style=\"font-size: 16px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dugn-do-cau-4.jpg?v=1629102653912\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dugn-do-cau-1.jpg?v=1629102660595\" /></span></p>\n<p><span style=\"font-size: 16px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-moi-cau-lure-5-d8d7fecf-f4a1-47d6-8e59-25cea1f97697.jpg?v=1605672020725\" /></span></p>\n<p><span style=\"font-size: 16px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-dung-moi-cau-lure-6-be5f1b4d-c6c