(1288, 'cay-vao-day-may-cau-dang-chan-kep', 'Cây vào dây máy câu chân kẹp', '<h1><em><strong>Cây vào dây máy câu chân kẹp</strong></em></h1>\n<p>Dụng cụ chuyên dụng vào dây máy câu cá chống rối dây tuyệt đối.</p>\n<p>Chân kẹp chắc chắn,&nbsp;tiện dụng.</p>\n<p>Chất liệu kim loại thép không gỉ.</p>\n<p>Sử dụng đơn giản ốc chốt linh hoạt, tháo rời cất gọn sau khi sử dụng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-vao-day-may-cau-chan-kep-4.jpg?v=1605149310201\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-vao-day-may-cau-chan-kep-5.jpg?v=1605149427993\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-vao-day-may-cau-chan-kep-3.jpg?v=1605149337260\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-vao-day-may-cau-chan-kep-2.jpg?v=1605149316825\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cay-vao-day-may-cau-chan-kep-1.jpg?v=1605149323728\" /></strong></em></p><iframe width=\"100%\" height=\"557\" src=\"https://www.youtube.com/embed/rNtAtu0xXnY\" title=\"Cây vào dây máy câu chân kẹp\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>', '', 'Cây vào dây máy câu', 'câu cá, Cây vào dây máy câu dạng chân kẹp, dụng cụ vào dây máy câu, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '135000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/19695923/cay-vao-day-may-cau-dang-chan-kep.jpg', '<p>Dụng cụ chuyên dụng vào dây máy câu cá chống rối dây tuyệt đối.</p>\n<p>Chân kẹp chắc chắn,&nbsp;tiện dụng.</p>\n<p>Chất liệu kim loại thép không gỉ.</p>\n<p>Sử dụng đơn giản ốc chốt linh hoạ', '19695923', '38115965', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:06', '2024-05-29 06:12:06'),
(1289, 'thung-dung-do-gan-duoi-xe-may-zhc-47l', 'Thùng đựng đồ gắn đuôi xe máy ZHC- 47L - Khắc Laser Theo Yêu Cầu', '<h1><em><strong>Thùng đựng đồ gắn đuôi xe máy ZHC- 47L - Khắc Laser Theo Yêu Cầu</strong></em></h1>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn không thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>&nbsp;Có thể đựng được nón bảo hiểm và phụ kiện&nbsp;rất tiện dụng cho những cuộc đi chơi, đi phượt.</p>\n<p>&nbsp;Dung tích đến 47 Lít&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, không sợ mưa làm ướt đồ.Thùng lắp được đa&nbsp;trên mọi loại xe có phần đuôi kiểu giá rộng.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, dán viền phản quang&nbsp;đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm đế,&nbsp;thanh ngang, ốc lắp&nbsp;đặt đơn giản lên khung đuôi xe.</p>\n<p>Kích thước ngoài&nbsp;&nbsp;57*42*29CM.</p>\n<p>Màu sắc: Đen.</p>\n<p>Lắp đặt cho các dòng xe có phần đuôi sau dài và bằng, các xe không có đuôi bằng và dài cần chế hoặc lắp thêm gá để lắp đặt.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-6.jpg?v=1604996957399\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-7.jpg?v=1604996964907\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-1.jpg?v=1604996694666\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-2.jpg?v=1604996703758\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-3.jpg?v=1604996712522\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-4.jpg?v=1604996725817\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-47-lit-5.jpg?v=1604996733895\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/jXXVKMhlauE\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Thùng đựng đồ', 'phụ kiện xe máy, thừng đựng đồ 47 lit, Thùng đựng đồ gắn đuôi xe máy ZHC- 47L, thùng đựng đồ xe máy, thùng gắn đuôi xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '1200000', '', '1', '', '', NULL, '', '', '', '10', 'kg', 'images/19684549/thung-dung-do-gan-duoi-xe-may-zhc-47l.jpg', '<p>Dung tích đến 47 Lít&nbsp;chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toà', '19684549', '38073591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1290, 'cun-yeu-de-taplo-than-tre-hoat-tinh-khu-mui-noi-that-o-to', 'Chó mèo cảnh để taplo than tre hoạt tính khử mùi nội thất ô tô', '<p><em><strong>Chó mèo cảnh để taplo than tre hoạt tính khử mùi nội thất ô tô</strong></em></p>\n<p><b><i></i></b>Chó&nbsp;cảnh để taplo ô tô&nbsp;gây sự ấn tượng, chú ý mạnh. Hơn thế nữa nó còn là sản phẩm khủ mùi trong nội thất xe với 200 viên than tre hoạt tính bên trong.</p>\n<p>Kích thước nhỏ ngọn mô phỏng hình&nbsp;chó, mèo&nbsp;cực kỳ gống chó thật đang say xưa ngủ.</p>\n<p>Kích thước: 16*15CM.</p>\n<p>Màu sắc: Trắng, vàng, vàng nhạt, vàng cam, mèo vàng, mèo đen trắng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bot-than-tre-khu-mui-de-taplo-1.jpg?v=1604893388261\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bot-than-tre-khu-mui-de-taplo-2.jpg?v=1604893394941\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-tapto-o-to-6.jpg?v=1629791855681\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-tapto-o-to-5.jpg?v=1629791862392\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-tapto-o-to-2.jpg?v=1629791871551\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-tapto-o-to-3.jpg?v=1629792109038\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cho-canh-de-tapto-o-to-1.jpg?v=1629791878634\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bot-than-tre-khu-mui-de-taplo-3.jpg?v=1604893401571\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bot-than-tre-khu-mui-de-taplo-4.jpg?v=1604893411040\" /></strong></em></p>', '', 'Chó để taplo', 'chó để taplo ô tô, chó trang trí ô tô, khủ mùi ô tô, ô tô, phụ  kiện ô tô, than tre hoạt tính khủ mùi ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Chó trắng', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/19671417/cun-yeu-de-taplo-than-tre-hoat-tinh-khu-mui-noi-that-o-to.jpg', '<p>Chó&nbsp;cảnh để taplo ô tô&nbsp;gây sự ấn tượng, chú ý mạnh. Hơn thế nữa nó còn là sản phẩm khủ mùi trong nội thất xe với các viên than tre hoạt tính bên trong.</p>\n<p>Kích thước nhỏ ngọn', '19671417', '37993769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1291, 'tu-ke-go-de-giay-nhieu-ngan-nho-gon-de-dang-thao-lap-tiet-kiem-dien-tich', 'Tủ, Kệ Gỗ Để Giày Nhiều Ngăn Nhỏ Gọn, Dễ Dàng Tháo Lắp, Tiết Kiệm Diện Tích', '<h1><span style=\"font-size:14px;\"><em><strong>Tủ, Kệ Gỗ Để Giày Nhiều Ngăn Nhỏ Gọn, Dễ Dàng Tháo Lắp, Tiết Kiệm Diện Tích</strong></em></span></h1>\n<p><span style=\"font-size:14px;\">Nhu cầu mua sắm giày dép ngày càng nhiều, việc sở hữu ngay cho mình một chiếc&nbsp;kệ để giày bằng gỗ&nbsp;để&nbsp;bảo quản những đôi giày của bạn&nbsp;tốt nhất cũng như giúp cho ngôi nhà trở nên ngăn nắp hơn&nbsp;là điều cần cần thiết.</span></p>\n<p><span style=\"font-size:14px;\">Không phải gỗ tự nhiên nhưng&nbsp;vẫn có vân trang trí như gỗ tự nhiên đó là ưu điểm lớn nhất mà chất liệu melamine dành cho mẫu tủ để giày cao cấp này.</span></p>\n<p><span style=\"font-size: 14px;\">Phân loại theo 2 kích thước khác nhau: Tủ 2 cánh cửa 60 x 30 x 90CM, tủ 3 cánh cửa 90 x 30 x 90CM.</span></p>\n<p><span style=\"font-size: 14px;\">Tủ được tách riêng các bộ phận khác nhau chưa lắp ghép, có đủ phụ kiện kèm theo thể lắp ghép lại hoàn chỉnh.</span></p>\n<p><span style=\"font-size: 14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-go-de-giay-co-ngan-keo-5.jpg?v=1602233752062\" /></span></p>\n<p><span style=\"font-size: 14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-go-de-giay-co-ngan-keo-6.jpg?v=1602234137310\" /></span></p>\n<p><span style=\"font-size: 14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-go-de-giay-co-ngan-keo-3-e233e427-0fff-4b31-9c8a-ac11eb3a97b8.jpg?v=1602234149545\" /></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size: 14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-go-de-giay-co-ngan-keo-4.jpg?v=1602233577728\" /></span></p>\n<p><span style=\"font-size: 14px;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-go-de-giay-co-ngan-keo-2.jpg?v=1602233566906\" /></span></p>', '', 'Tủ đẻ giày', 'kệ gỗ gể giày, tủ để giày, tủ giày, tủ gỗ đẻ giày, Volcano, volcano.vn', '1', 'Kích thước', '60 x 30 x 90CM', '', '', '', '', '', '', '', 'deny', '', '1450000', '', '1', '', '', NULL, '', '', '', '8', 'kg', 'images/19372808/tu-ke-go-de-giay-nhieu-ngan-nho-gon-de-dang-thao-lap-tiet-kiem-dien-tich.jpg', '<p><span style=\"font-size:14px;\">Nhu cầu mua sắm giày dép ngày càng nhiều, việc sở hữu ngay cho mình một chiếc&nbsp;kệ để giày bằng gỗ&nbsp;để&nbsp;bảo quản những đôi giày của bạn&nbsp;tốt nh', '19372808', '36994605', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1292, 'moc-khoa-day-cap-lolo-o-to-cac-hang', 'Móc khóa dây cáp lolo ô tô các hãng', '<h1><strong><em>Móc khóa dây cáp lolo ô tô các hãng</em></strong></h1>\n<p>Móc khóa logo ô tô theo các hãng xe khác nhau.</p>\n<p>Thiết kế đẹp mắt đơn giản với dây cáp chắc chắn, bền bỉ.</p>\n<p>Chất liệu kim loại và dây cáp.</p>\n<p>Kích thước dài 3.2*1.5*1CM.</p>\n<p>Logo các hãng xe: Toyota, KIA, Honda, Hyundai, Ford,&nbsp;Chevrolet, Mazda, Nissan.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-7.jpg?v=1597024783245\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-8.jpg?v=1597024793803\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-120.jpg?v=1597024805058\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-9.jpg?v=1597024814049\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-6-6c77f9bf-abce-4d59-b490-16e1761864cd.jpg?v=1597024821493\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-121.jpg?v=1597024830602\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-3-21659b68-8077-4fde-9acb-4fb7510b3601.jpg?v=1597024445386\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-4-6c2f1fe1-2c4b-417c-8d3a-dbda11fb1bfb.jpg?v=1597024453497\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-5-c5e56e52-a67f-4b05-bb5a-22c7177f4206.jpg?v=1597024462337\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-1-4e41f469-35d0-4a00-964d-1d1b3386f832.jpg?v=1597024870700\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-o-to-cac-hang-2-d8113a54-b858-4a29-9842-d3c495ccf104.jpg?v=1597024879250\" /></p>', '', 'móc khóa', 'móc khóa, móc khóa ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Hãng', 'Ford', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/18815131/moc-khoa-day-cap-lolo-o-to-cac-hang.jpg', '<p>Móc khóa logo ô tô theo các hãng xe khác nhau.</p>\n<p>Thiết kế đẹp mắt đơn giản với dây cáp chắc chắn, bền bỉ.</p>\n<p>Chất liệu kim loại và dây cáp.</p>\n<p>Kích thước dài 3.2*1.5*1CM.</p>\n', '18815131', '35176156', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1293, 'logo-xe-gan-dau-xe-tai-dongfeng', 'Logo xe gắn đầu xe tải Dongfeng', '<p><strong><em>Logo xe gắn đầu xe tải Dongfeng</em></strong></p>\n<p>Chất liệu nhựa ABS mạ crom sáng bóng nổi bật.</p>\n<p>Lắp đặt&nbsp;thay thế đơn giản với chân keo dán và chân ốc.</p>\n<p>Kích thước chia làm 2 phân loại:&nbsp;đường kính 13.5cm, dày 1.7cm, đường kính 18.5cm, dày 1.7cm, khoảng cách 2 chân ốc 7cm.</p>\n<p>Lưu ý: Khách hàng vui lòng đo đúng kích thước logo trên xe trước khi đặt hàng!</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-4.jpg?v=1595574496930\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-2.jpg?v=1595574502959\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-5-939c8051-2025-4ea8-9279-c1814a86d690.jpg?v=1609902094633\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-1.jpg?v=1595574520674\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-v11.jpg?v=1609902111882\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-5.jpg?v=1595574527307\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-xe-tai-dongfeng-6.jpg?v=1595574533702\" /></em></strong></p>', '', '', 'logo xe tải, logo xe tải dongfeng, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích thước', '13.5cm', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/18682535/logo-xe-gan-dau-xe-tai-dongfeng.jpg', '<p>Chất liệu nhựa ABS mạ crom sáng bóng nổi bật.</p>\n<p>Lắp đặt&nbsp;thay thế đơn giản với chân keo dán và chân ốc.</p>\n<p>Kích thước chia làm 2 phân loại:&nbsp;đường kính 13.5cm, dày 1.7cm, ', '18682535', '34550777', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1294, 've-che-chua-xe-tai-jac', 'Vè che mưa xe tải JAC', '<p><em><strong>Vè che mưa xe tải JAC</strong></em></p>\n<p>Vè che mưa&nbsp;phụ kiện rất cần thiết đối với ô tô, không những làm đẹp cho chiếc xe biến chiếc xe trở nên sang trọng mà còn giúp bạn có thể mở hé cửa kính trong khi trời mưa để lưu thông không khí mà không để nước mưa bắn vào trong xe.</p>\n<p>Vè che mưa xe tải JAC được thiết kế đặc biệt làm riêng cho xe lặt chuẩn&nbsp;Fom cho xe có kích thươc như hình ảnh.</p>\n<p>Sản phẩm làm từ chất liệu Acrylic dẻo&nbsp;cao cấp&nbsp;bền bỉ, màu sơn sáng bóng đẹp,&nbsp;có tính đàn hồi, chịu được nhiệt độ cao&nbsp;là một trong những phụ kiện không thể thiếu của dòng&nbsp;xe bán tải JAC</p>\n<p>Lắp dán đơn giản với kéo dán sẵn trên viền của sản phẩm.</p>\n<p>Kích thước: dài 80cm.</p>\n<p>Màu sắc&nbsp;sơn&nbsp;đen bóng chống mài chống phai màu tốt, bền bỉ với thời gian.</p>\n<p>Lưu ý:kiểm tra kỹ kích thước xe trước khi đặt hàng.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-tai-jac-v5.jpg?v=1595468263002\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-tai-jac-v9.jpg?v=1595469075978\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-tai-jac-v10.jpg?v=1595469610256\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-tai-jac-v12.jpg?v=1627371891823\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-tai-jac-v11.jpg?v=1595470871207\" /></p>', '', 'Vè che mưa xe tải', 'ô tô, phụ  kiện ô tô, vè che mưa xe tải, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/18661499/ve-che-chua-xe-tai-jac.jpg', '<p>Vè che mưa xe tải JAC được thiết kế đặc biệt làm riêng cho xe lặt chuẩn&nbsp;Fom theo xe.</p>\n<p>Sản phẩm làm từ chất liệu Acrylic dẻo&nbsp;cao cấp&nbsp;bền bỉ, màu sơn sáng bóng đẹp,&nbsp', '18661499', '34517593', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:07', '2024-05-29 06:12:07'),
(1295, 'logo-chu-jac-gan-dau-xe-tai-jac', 'Logo chữ JAC gắn đầu xe tải JAC', '<p><em><strong>Logo chữ JAC gắn đầu xe tải JAC</strong></em></p>\n<p>Logo dán chữ JAC có kích thước tiêu chuẩn đúng với logo zin trên đầu xe.</p>\n<p>Chất liệu nhụa ABS mạ crom bóng sáng.</p>\n<p>Lắp đặt thay thế đơn giản.</p>\n<p>Kích thước&nbsp; chia làm 2 phân loại: Size to và size nhỏ</p>\n<p>Kích thươc: Kích thước Size to chữ cao 11.5CM, Size nhỏ chữ cao 9.8CM</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-2.jpg?v=1595314157780\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-v7.jpg?v=1619407056775\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-1.jpg?v=1595314173572\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-5.jpg?v=1595315258529\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-3.jpg?v=1595315409232\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-6.jpg?v=1619407076375\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-chu-noi-jac-4.jpg?v=1595315398448\" /></strong></em></p>', '', 'Logo JAC', 'Logo chữ JAC gắn đầu xe tải JAC, logo dán đầu xe tải, logo jac, Volcano, volcano.vn', '1', 'Kích thước', 'Size nhỏ', '', '', '', 