(1296, 'tay-mo-cua-trong-xe-tai', 'Tay nắm mở cửa trong xe tải', '<h1><em><strong>Tay nắm mở cửa trong xe tải</strong></em></h1>\n<p>Tay nắm mở cửa trong sử dụng lắp đặt thay thế cho tay nắm cũ phù hợp cho xe tải JAC&nbsp;</p>\n<p>Chất liệu hợp kim nhôm&nbsp;bền bỉ chống gãy</p>\n<p>Lắp đặt: Có thể tự lắp đặt thay thế tại nhà đơn giản.</p>\n<p>Kích thước: 12*7.5CM, khoang cách 2 con ốc 6CM, kích thước phần tay nắm 10.5CM.</p>\n<p>Giá sản phẩm: 01 tay nắm bên trái hoặc phải</p>\n<p><strong><em>Lưu ý: tham khảo kích thước tay nắm cũ trên xe trước khi đặt hàng.</em></strong></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d5.jpg?v=1619251271628\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d1.jpg?v=1619251280675\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d2.jpg?v=1619251281590\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d4.jpg?v=1619251283135\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d3.jpg?v=1619251282471\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d6.jpg?v=1619251310050\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-mo-cua-xe-tai-d7.jpg?v=1619251316678\" /></p>', '', 'Tay mở cửa trong xe tải', 'ô tô, tay nắm mở cửa trong xe, Tay nắm mở cửa trong xe tải, tay nắm trong, Volcano, volcano.vn', '1', 'Phân loại', 'Tay trái', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/18624466/tay-mo-cua-trong-xe-tai.jpg', '<p>Tay nắm mở cửa trong sử dụng lắp đặt thay thế cho tay nắm cũ phù hợp cho xe tải JAC&nbsp;</p>\n<p>Chất liệu hợp kim nhôm&nbsp;bền bỉ chống gãy</p>\n<p>Lắp đặt: Có thể tự lắp đặt thay thế tại', '18624466', '34419245', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:09', '2024-05-29 06:12:09'),
(1297, 'chup-chong-bui-can-so-xe-tai-howo', 'Chụp chống bụi cần số xe tải HOWO', '<h1><em><strong>Chụp chống bụi cần số xe tải HOWO</strong></em></h1>\n<p>Chụp chống bụi cần số xe tải làm từ chất liệu cao su dẻo tạo thành nhiều tầng có độ đàn hồi cao.</p>\n<p>Phù hợp lắp đặt xe tải Howo và các dòng xe tải có cùng kích thước.&nbsp;</p>\n<p>Kích thước: 16*18*12CM, đường kính thân cần số 12MM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-4.jpg?v=1594961167859\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-5.jpg?v=1604473325823\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-3.jpg?v=1594961174480\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-1.jpg?v=1594961183079\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-2.jpg?v=1594961189207\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-6.jpg?v=1604472880132\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-can-so-xe-tai-7.jpg?v=1604472893868\" /></p>\n<p>&nbsp;</p>', '', 'Chụp chống bụi cần số xe tải', 'CHỤP BỤI CẦN SỐ, chụp cần số cao su, Chụp chống bụi cần số xe tải HOWO, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/18616997/chup-chong-bui-can-so-xe-tai-howo.jpg', '<p>Chụp chống bụi cần số xe tải làm từ chất liệu cao su dẻo tạo thành nhiều tầng có độ đàn hồi cao.</p>\n<p>Phù hợp lắp đặt xe tải Howo và các dòng xe tải có cùng kích thước.&nbsp;</p>\n<p>Kích', '18616997', '34319829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:09', '2024-05-29 06:12:09'),
(1298, 'tay-quay-kim-loai-deu-chinh-kinh-cua-xe-tai-jac', 'Tay quay kim loại điều chỉnh kính cửa xe tải JAC', '<p><em><strong>Tay quay kim loại điều chỉnh kính cửa xe tải JAC</strong></em></p>\n<p>Tay quay điều chỉnh nâng, hạ kính cánh cửa cho xe tải JAC</p>\n<p>Lắp đặt thay thế tay quay cũ đơn giản.</p>\n<p>Chất liệu kim loại sử dụng bền bỉ.</p>\n<p>Kích thước: 18*5CM, chân đường kính 12MM.</p>\n<p>Giá sản phâm là giá 01 tay quay kính.</p>\n<p><b style=\"font-style: italic;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-kinh-xe-tai-2.jpg?v=1594278270406\" /></b></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-kinh-xe-tai-1.jpg?v=1594278277065\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-kinh-xe-tai-3.jpg?v=1594280057680\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-quay-kinh-xe-tai-4.jpg?v=1594280519438\" /></strong></em></p>', '', 'Tay quay kim loại đều chình kính cửa', 'ô tô, phụ  kiện ô tô, Tay quay kim loại đều chình kính cửa, Tay quay kim loại đều chình kính cửa xe tải JAC, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/18537718/tay-quay-kim-loai-deu-chinh-kinh-cua-xe-tai-jac.jpg', '<p>Tay quay điều chỉnh nâng, hạ kính cánh cửa cho xe tải JAC</p>\n<p>Lắp đặt thay thế tay quay cũ đơn giản.</p>\n<p>Chất liệu kim loại sử dụng bền bỉ.</p>\n<p>Kích thước: 18*5CM, chân đường kính', '18537718', '34120269', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:09', 