(1299, 'nuoc-gat-kinh-o-to-kb-357', 'Nước gạt kính ô tô KB-357', '<h1><strong><em>Nước gạt kính ô tô KB-357</em></strong></h1>\n<p>Khả năng làm sạch vượt trội: tất cả các vết bẩn cứng đầu nhất trên mặt kính đều được làm sạch 1 cách nhanh chóng, mặt kính trở nên sáng loáng, giúp tầm nhìn của lái xe không bị hạn chế.</p>\n<p>Tỷ lệ pha: lọ 45mml pha với 4.5 lít nước.</p>\n<p>Dung tích: 45mml&nbsp;</p>\n<p>Hạn chế khúc xạ ánh sáng</p>\n<p>Chống hình thành nấm mốc, tăng tuổi thọ cần gạt nước.</p>\n<p>Thân thiện với môi trường, an toàn cho xe và lái xe.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gat-mua-xe-o-to-4.jpg?v=1591587562139\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gat-mua-xe-o-to-v2.jpg?v=1591587571243\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gat-mua-xe-o-to-3.jpg?v=1591587455068\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gat-mua-xe-o-to-1.jpg?v=1591587462994\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gat-mua-xe-o-to-2.jpg?v=1591587470592\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/x7op-lGh9vQ\" width=\"100%\"></iframe></p>', '', 'Nước gạt kính ô tô', 'nước gạt kính, nước gặt kính ô tô, Nước gạt kính ô tô KB-357, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', 