(1310, 'den-ngu-cao-cap-yh-101', 'Đèn ngủ USB cao cấp YH-101', '<p><em><strong>Đèn ngủ USB&nbsp;cao cấp YH-101</strong></em></p>\n<p>Đèn ngủ thiết kế hiện đại phong cách, vừa&nbsp;làm đèn ngủ lại là một món đồ trang trí đẹp mắt.</p>\n<p>Sử dụng pin tích điện được sạc qua cổng USB, công suất 2W tiết kiêm điện.</p>\n<p>Chất liệu nhựa và đèn led.</p>\n<p>Màu vỏ đèn màu trắng.</p>\n<p>Ánh sáng đèn: màu vàng, màu trắng.</p>\n<p>Có công tắc bặt tắt khi sử dụng.</p>\n<p>Kích thước: 17.5*11.5CM (đường kính đế 8cm, đường kính phần&nbsp;đèn 12cm và 9cm)</p>\n<p><br />\n<em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-ngu-1.jpg?v=1589279585272\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-ngu-4.jpg?v=1589279597215\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-ngu-2.jpg?v=1589279604943\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-ngu-3.jpg?v=1589279613865\" /></strong></em></p>', '', 'Đèn ngủ', 'đèn ngủ, đèn ngủ cao cấp, đèn ngủ đẹp, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '168000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/17920452/den-ngu-cao-cap-yh-101.jpg', '<p>Đèn ngủ thiết kế hiện đại phong cách, vừa&nbsp;làm đèn ngủ lại là một món đồ trang trí đẹp mắt.</p>\n<p>Sử dụng pin tích điện được sạc qua cổng USB, công suất 2W tiết kiêm điện.</p>\n<p>Chất', '17920452', '32714452', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:12', '2024-05-29 06:12:12'),
(1311, 'chong-can-cau-don-cau-dai-da-nang-gac-6-can', 'Chống cần câu đơn, câu đài đa năng gác 6 cần', '<h1><em><strong>Chống cần câu đơn, câu đài đa năng gác 6 cần</strong></em></h1>\n<p>Chống cần câu cá đa năng sử dụng gác đồng thời 6 cần câu đơn.</p>\n<p>Chất liệu hợp kim nhôm cao cấp chịu lực tốt bền bỉ với thời gian.</p>\n<p>Phần gác cần làm từ nhựa ABS.</p>\n<p>Chiều dài 1.7M có tùy chỉnh sử dụng cho cần có kích thước khác nhau.</p>\n<p>Kích thước thu gọn:80CM.</p>\n<p>Phân loại: 6-6 (gác đủ 6 cần), 4-6( gác 6 cần, 2 cần đầu tiếp đất).</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-4-6-2.jpg?v=1630375469195\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-7.jpg?v=1589184812826\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-8.jpg?v=1589184821537\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chong-can-cau-4-6-1.jpg?v=1630375483003\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-5.jpg?v=1589184841282\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-1.jpg?v=1589184864443\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-2.jpg?v=1589184871563\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-3.jpg?v=1589184879939\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chong-can-cau-ca-6-can-4.jpg?v=1589184889286\" /></p>', '', 'Chống cần câu đơn', 'câu cá, chống cần câu cá, chống cần câu đơn, Volcano, volcano.vn', '1', 'Loại', '6-6', '', '', '', '', '', '', '', 'deny', '', '220000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/17901937/chong-can-cau-don-cau-dai-da-nang-gac-6-can.jpg', '<p>Chống cần câu cá đa năng sử dụng gác đồng thời 6 cần câu đơn.</p>\n<p>Chất liệu hợp kim nhôm cao cấp chịu lực tốt bền bỉ với thời gian.</p>\n<p>Phần gác cần làm từ nhựa ABS.</p>\n<p>Chiều dài', '17901937', '32686242', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1312, 'op-chia-khoa-xe-o-to-honda-khoa-gap', 'Vỏ chìa khoá xe ô tô Honda 3 nút dạng khóa gấp - Khắc Laser MIỄN PHÍ Theo Yêu Cầu', '<h1><em><strong>Vỏ chìa khoá xe ô tô Honda 3 nút dạng khóa gấp&nbsp;- Khắc Laser MIỄN PHÍ Theo Yêu Cầu</strong></em></h1>\n<p>Vỏ&nbsp;chìa khoá Honda được làm từ chất liệu nhựa cao cấp rất cứng cáp, tránh va đập, hư hỏng do làm rơi.</p>\n<p>Ốp chìa khoá màu đen sần&nbsp;sẽ đem lại sự nổi bật.</p>\n<p>Lắp đặt thay thế đơn giản.&nbsp;</p>\n<p>Sử dụng thay thế cho vỏ chìa khóa cho xe ô tô Honda 3 nút.</p>\n<p>Dịch vụ Khắc tên và số điện thoại theo yêu cầu Miến Phí lên ốp vỏ chìa khóa. Xóa tan nỗi lo để quên hay đánh rơi chìa khóa, đã có tên à số điện thoại của bạn trên sản phẩm!</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hd-3-nut-4.jpg?v=1628236691308\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chia-khoa-xe-o-to-honda-4.jpg?v=1588732664560\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chia-khoa-xe-o-to-honda-1.jpg?v=1588732675469\" /></strong></em><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chia-khoa-xe-o-to-honda-2.jpg?v=1588732685981\" /></strong></em></p>', '', 'ốp chìa khóa ô tô', 'ô tô, ốp chìa khóa ô tô, ốp chìa khóa ô tô honda, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '145000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/17851241/op-chia-khoa-xe-o-to-honda-khoa-gap.jpg', '<p>Ốp chìa khoá Honda được làm từ chất liệu nhựa cao cấp rất cứng cáp, tránh va đập, hư hỏng do làm rơi.</p>\n<p>Ốp chìa khoá màu đen sần&nbsp;sẽ đem lại sự nổi bật. Mặt sau có gắn logo Honda.', '17851241', '32569526', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1313, 'noi-com-dien-mini-su-dung-tren-xe-o-to-xe-tai-12-24v', 'Nồi cơm điện mini sử dụng trên xe tải 24V', '<h1><strong><em>Nồi cơm điện mini sử dụng trên xe tải 24V</em></strong></h1>\n<p>Nồi cơm điện mini chuyên dụng cho các bác tài xe tải xe&nbsp;container chạy đường dài.</p>\n<p>Với thiết kế mini nhỏ gọn nhưng tích hợp đầy đủ các tính năng công năng sử dụng của một mồi cơm điện gia đình hàng ngày.</p>\n<p>Sử dụng điện áp 24V</p>\n<p>Công xuất 120W</p>\n<p>Kích thước: Nồi 1.6L 25*16CM, nồi 3L 23*24CM</p>\n<p>Dung tích chia làm 2 loại&nbsp;&nbsp;1.6L và 3L</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-xe-tai-24v-rmier-3.jpg?v=1617335413978\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-xe-tai-24v-rmier-4.jpg?v=1617335604987\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-xe-tai-24v-rmier-2.jpg?v=1617335611899\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-da-nang-v1.jpg?v=1588480361579\" /></em></strong></p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-da-nang-v3.jpg?v=1588480369237\" /></em></strong></p>\n<p>&nbsp;</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-xe-tai-24v-rmier-6.jpg?v=1617336412830\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-xe-tai-24v-rmier-5-ed911038-e245-4599-84fa-b57eb6c2c4bc.jpg?v=1617337168757\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/noi-com-dien-da-nang-v2.jpg?v=1588480377962\" /></em></strong></p>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/NRa-8jV06oU\" width=\"100%\"></iframe></p>', '', 'Nồi cơm điện xe tải', 'Nồi cơm điện mini sử dụng trên xe tải 24V, nồi cơm điện trên ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', '1.6L', '', '', '', '', '', '', '', 'deny', '', '990000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/17822668/noi-com-dien-mini-su-dung-tren-xe-o-to-xe-tai-12-24v.jpg', '<p>Nồi cơm điện mini chuyên dụng cho các bác tài xe tải xe&nbsp;container chạy đường dài.</p>\n<p>Với thiết kế mini nhỏ gọn nhưng tích hợp đầy đủ các tính năng công năng sử dụng của một mồi cơ', '17822668', '32508180', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1314, 'mat-na-harlay-cho-mu-bao-hiem-3-4-co-kinh-cao-cap', 'Mặt nạ Harlay cho mũ bảo hiểm 3/4 có kính cao cấp', '<h1><strong><em>Mặt nạ Harlay cho mũ bảo hiểm 3/4 có kính cao cấp</em></strong></h1>\n<p>&nbsp;</p>\n<p>Mặt nạ phượt Harlay cho mũ bảo hiểm&nbsp;được thiết kế góc cạnh mạnh mẽ có thêm kính cá tính, nổi bật.</p>\n<p>Kính tránh tia UV và chống chói khi đi ban ngày, à một trong những món đồ bảo hộ moto không thể thiếu khi đi xa đi du lịch đi phượt.</p>\n<p>Quanh kính có lớp xốp dày 2cm giúp bảo vệ mắt tạo cảm giác thoải mái khi đeo trong thời gian dài, an toàn cho mắt.</p>\n<p>Phần thông gió trước mũi được thiết kế bằng 1 lớp lưới&nbsp;kim loại và 1 lớp đệm&nbsp;lưới giúp lọc bụi.</p>\n<p>Lớp nhựa của mặt nạ được sản xuất bằng nhựa dẻo, không bị gãy vỡ khi có lực tác động lên, tạo độ an toàn cao.</p>\n<p>Dây mặt nạ làm băng thun co giãn có thể điều chỉnh thích hợp với tất cả các loại mũ.</p>\n<p>Phần kính có thể tách rời và thay đổi các loại kính khác nhau, tùy vào sở thích của bạn.</p>\n<p>Mặt nạ có thể kết hợp với nhiều loại&nbsp;mũ bảo hiểm 3/4&nbsp;khác nhau như:&nbsp;mũ bảo&nbsp;hiểm 3/4 Dammtrax,&nbsp;mũ bảo hiểm 3/4 Andes,...</p>\n<p>Bộ bao gồm: kính + mặt nạ&nbsp;</p>\n<p>Phân loại theo màu sắc kính: màu đen, trắng trong suốt, vàng.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-2.jpg?v=1587870867430\" /><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-3-24cb0f4a-718b-4de7-a492-8a6b0137d72e.jpg?v=1587870884404\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-4.jpg?v=1587870905757\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-7.jpg?v=1587870930644\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-8.jpg?v=1587870968285\" /></em></strong></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-6.jpg?v=1587871052475\" /></p>', '', 'Mặt nạ mũ bảo hiểm', 'kính mũ bảo hiểm, mặt nạ cho mũ 3/4, mặt nạ mũ, mặt nạ mũ bảo hiểm, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/17745061/mat-na-harlay-cho-mu-bao-hiem-3-4-co-kinh-cao-cap.jpg', '<p>Mặt nạ phượt Harlay cho mũ bảo hiểm&nbsp;được thiết kế góc cạnh mạnh mẽ có thêm kính cá tính, nổi bật.</p>\n<p>Kính tránh tia UV và chống chói khi đi ban ngày, à một trong những món đồ bảo ', '17745061', '32350048', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1315, 'bo-am-tra-dien-tu-dong-cao-cap-at03', 'Bộ ấm trà điện tự động cao cấp AT03', '<h1><strong><em>Bộ ấm trà điện tự động cao cấp AT03</em></strong></h1>\n<p>Bộ ấm trà điện đa năng thông minh tự động bơm nước.</p>\n<p>Bộ bếp trà điện cảm ứng&nbsp;là bộ sản phẩm thiết thực phục vụ và đáp ứng sở thích uống, thưởng trà.</p>\n<p>Với cấu tạo bộ bếp gồm:&nbsp;Vòi cấp nước, 02 bếp đun&nbsp;ấm và nồi, 01 nồi điện 1.2 lít 1350W, 01 ấm điện 1.2 lít 1350W.</p>\n<p>Sử dụng đơn giản mọi thao tác từ bơm nước, đun sôi và hẹn giờ tùy chỉnh lượng nước và nhiết độ điều được thực hiện trên bếp cảm ứng. Đặc biệt vòi cấp nước tự động xoay cấp nước tùy chỉnh.</p>\n<p>Chức năng: Ấm sử dụng đun sôi nước, nồi có sử dụng đun nước để tráng rửa&nbsp;chén ngay trên bèn hoặc nấu mì...</p>\n<p>Chất liệu Inox 304 dày kết hợp tay cầm và châhế độ lựa chọn theo nhu cầu sử dụng.n đế là&nbsp;nhựa cứng, bếp từ mặt kính cao cấp có 5 phím chức năng điều khiển.</p>\n<p>Nguồn điện 220V-50Hz</p>\n<p>Kích thước: Bếp 23*37*25CM.</p>\n<p>Màu sắc: đen, vàng.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-1.jpg?v=1588654273154\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-8.jpg?v=1588654280670\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-2.jpg?v=1588654289285\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-3.jpg?v=1588654299263\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-5.jpg?v=1588654317410\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-am-tra-dien-mau-vang-7.jpg?v=1588654327888\" /></p>\n<p>&nbsp;</p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/bo-bep-tra-dien-cao-cap-3-6993c051-0d0f-45a0-8821-2a52cbf9f52d.jpg?v=1562118738718\" /></p>\n<p>&nbsp;</p>', '', 'Ấm trà điện', 'ấm điện, ấm trà điện, bếp điện, phụ kiện thưởng trà, thưởng trà, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '1400000', '', '1', '', '', NULL, '', '', '', '6', 'kg', 'images/17744319/bo-am-tra-dien-tu-dong-cao-cap-at03.jpg', '<p>Bộ bếp trà điện cảm ứng&nbsp;là bộ sản phẩm thiết thực phục vụ và đáp ứng sở thích uống, thưởng trà.</p>\n<p>Sử dụng đơn giản mọi thao tác từ bơm nước, đun sôi và hẹn giờ tùy chỉnh lượng nư', '17744319', '32348896', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1316, 'may-cau-ngang-mini-leo-bld', 'Máy câu ngang mini LEO-BLD', '<h1><em><strong>Máy câu ngang mini LEO-BLD</strong></em></h1>\n<p>Máy câu ngang cơ nhỏ chuyên dụng cho các cần câu mini, cần bút...</p>\n<p>Chất liệu hợp kim chắc chắn, bền bỉ màu xám kim loại dẹp mắt.</p>\n<p>Thông số chia 2 loại BLD50 và BLD60:</p>\n<ul>\n<li>BLD50: tỉ lệ chuyển động&nbsp; 2 1:1, đường kính 49,5mm, dây&nbsp;0,20mm / 100M, trọng lượng 50g. Máy tay phải.</li>\n<li>BLD60: tỉ lệ chuyển động&nbsp; 2 1:1, đường kính 59mm, dây&nbsp;0,25mm / 100M, trọng lượng 50g. Máy tay phải.</li></ul>\n<p>Lưu ý sử dụng có cần gạt ly hợp phía sau.</p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-9.jpg?v=1587523546068\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-10.jpg?v=1587523554407\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-8.jpg?v=1587523568023\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-8-bfaaa521-cbf4-49f3-b44b-111c4f4a9770.jpg?v=1587523568827\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-7.jpg?v=1587523576190\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-11.jpg?v=1587523585150\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-cau-ca-12.jpg?v=1587523592839\" /></p>', '', 'máy câu cá', 'câu cá, máy câu cá, máy câu mini, máy câu ngang, máy ngang, máy ngang tay phải, máy tay phải, ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'BLD50', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/17707844/may-cau-ngang-mini-leo-bld.jpg', '<p>Máy câu ngang cơ nhỏ chuyên dụng cho các cần câu mini, cần bút...</p>\n<p>Chất liệu hợp kim chắc chắn, bền bỉ màu xám kim loại dẹp mắt.</p>\n<p>Thông số chia 2 loại BLD50 và BLD60:</p>\n<ul>\n', '17707844', '32247857', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1317, 'dem-nam-ghe-sau-xe-o-to', 'Đệm nằm ghế sau xe ô tô', '<h1><span style=\"font-size:18px;\"><em><strong>Đệm nằm ghế sau xe ô tô</strong></em></span></h1>\n<p>Không chỉ mang đến giấc ngủ thật ngon, thật sâu mà bé yêu còn có thể nằm chơi, thư giãn trên xe như: đọc sách, nghe nhạc, chơi trò chơi...Nếu có 2 hoặc 3 bé cùng đi trên xe thì các bé cũng có thể nô đùa rất thỏa thích.</p>\n<p>Dễ sử dụng, dế lắp đặt dễ dàng cất gọn.</p>\n<p>Chất liệu da PU chống thấm nước, mút xốp trong đệm và khung Inox nhẹ</p>\n<p>Dùng được cho mọi loại xe 5 chỗ 7 chỗ&nbsp;</p>\n<p>Kích thước:140 x 84CM</p>\n<p>Bộ sản phẩm gồm 2 dải đệm dây thắt&nbsp;an toàn, phụ kiện lắp đặt và 1 túi đựng kèm theo.&nbsp;&nbsp;</p>\n<p><em><strong>Chân đệm làm từ&nbsp; ống inox nhẹ, dày dặn, chắc chắn có thể thay đổi kích thước cho phù hợp với ghế sau cao thấp của từng dòng xe.</strong></em><span style=\"font-size:18px;\"><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-sau-xe-o-to-1.jpg?v=1587112853586\" /></strong></em></span></p>\n<p><span style=\"font-size:18px;\"><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-sau-xe-o-to-2.jpg?v=1587112865153\" /></strong></em></span></p>\n<p>&nbsp;</p>\n<p><strong><em>Dễ&nbsp; dàng vệ sinh với bề làm từ chất liệu mặt da PU cao cấp chống thấm nước, chống nổ...</em></strong></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size:18px;\"><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/8dd4a30af75f0d01544e.jpg?v=1587112874306\" /></strong></em></span></p>\n<p>&nbsp;</p>\n<p><strong><em>Sản phẩm khi gấp gọn lại có kích thước rất nhỏ bỏ túi được tặng kèmcó thể để xe và mang đi mọi nơi mà không tốn diện tích.</em></strong></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size:18px;\"><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/dem-sau-xe-o-to-4.jpg?v=1587112889854\" /></strong></em></span></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/cobss6R7FI4\" width=\"100%\"></iframe></p>\n<p>&nbsp;</p>', '', 'Đệm ghế sau xe ô tô', 'đệm ghế sau xe, đệm ghế sau xe ô tô, đệm nằm sau xe ô tô, đệm sau xe ô ôt, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '1350000', '', '1', '', '', NULL, '', '', '', '10', 'kg', 'images/17663629/dem-nam-ghe-sau-xe-o-to.jpg', '<p>Không chỉ mang đến giấc ngủ thật ngon, thật sâu mà bé yêu còn có thể nằm chơi, thư giãn trên xe như: đọc sách, nghe nhạc, chơi trò chơi...Nếu có 2 hoặc 3 bé cùng đi trên xe thì các bé cũng', '17663629', '32139612', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:13', '2024-05-29 06:12:13'),
(1318, 'boc-ghe-ao-ghe-vo-boc-ghe-xe-o-to-cao-cap-bg08', 'Bọc ghế, áo ghế, vỏ bọc ghế xe ô tô cao cấp BG08', '<p><em><strong>Bọc ghế, áo ghế, vỏ bọc ghế xe ô tô cao cấp BG08</strong></em></p>\n<p>✅Bộ bọc ghế ô tô cao cấp lắp đặt cho xe 5 chỗ có phần tựa đầu ghế trước (có thể kéo được)</p>\n<p>✅Chất liệu&nbsp;da PU cao cấp chống nổ, không mùi, không ẩm mốc</p>\n<p>✅Lắp đặt đơn giản, tự lắp tại nhà với đầy đủ phụ kiện.</p>\n<p>✅Bộ sản phẩm gồm bọc ghế đầy đủ và full phụ kiện lắp đặt</p>\n<p>💥Shop đảm bảo về chất lượng sản phẩm, đặt hàng nhận hàng quý khách được kiểm tra hàng trước khi thanh toán.&nbsp;</p>\n<p>💥Mọi thắc mắc khách hàng có thêt nhắn tin trực tiếp cho shop, liên hệ số điện thoại 0868.533.299</p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-o-to-bg-08-v121.jpg?v=1586925293492\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-o-to-bg-08-v7.jpg?v=1586924983385\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-o-to-bg-08-v122.jpg?v=1586925318532\" /></p>\n<p><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-o-to-bg-08-v123.jpg?v=1586925348812\" /></p>', '', 'Bọc ghế ô tô', 'áo ghế da, áo ghế ô tô, áo ghế xe hơi, bọc ghế da, bọc ghế ô tô, ô tô, phụ  kiện ô tô, vỏ bọc ghế ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '1800000', '', '1', '', '', NULL, '', '', '', '10', 'kg', 'images/17638074/boc-ghe-ao-ghe-vo-boc-ghe-xe-o-to-cao-cap-bg08.jpg', '<p>Bộ bọc ghế ô tô cao cấp lắp đặt cho xe 5 chỗ có phần tựa đầu ghế trước (có thể kéo được)</p>\n<p>Chất liệu&nbsp;da PU cao cấp chống nổ, không mùi, không ẩm mốc</p>\n<p>Lắp đặt đơn giản, tự l', '17638074', '32076909', NULL, NULL, NULL