(1319, 'op-po-e-trong-suot-xe-may-honda-sh-150i-125i-2013-2019-op-loc-gio-chup-po-e-chinh-hang-zhipat', 'Ốp pô E trong suốt xe máy Honda SH 150i/125i 2013-2019 ( ốp lọc gió, chụp pô E ) chính hãng ZHIPAT tặng kèm Vỏ Bọc Chìa Khóa Smartkey', '<h2 data-spm-anchor-id=\"a2o4n.pdp.product_detail.i0.2e5e5b6dZmPaV8\"><em><strong>Ốp pô E trong suốt xe máy Honda SH 150i/125i 2013-2019 ( ốp lọc gió, chụp pô E ) chính hãng ZHIPAT tặng kèm Vỏ Bọc Chìa Khóa Smartkey</strong></em></h2>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i0.2e5e5b6dZmPaV8\">Ốp bầu lọc gió chính hãng được thiết kế và&nbsp;sản xuất có độ dày cao,&nbsp;cực kỳ nhẹ.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i0.2e5e5b6dZmPaV8\">Từng khớp kết nối chuẩn xác đến từng&nbsp;chi tiết nhỏ nhất, chính vì vậy khách hàng lắp đặt nhanh chóng trong vài thao tác và&nbsp;không cần độ hoặc chế như các loại ốp thông thường.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i1.2e5e5b6dZmPaV8\">Chất liệu nhựa PC kỹ thuật, mang đến&nbsp;<strong>độ bền trong suốt thời gian sử dụng</strong>, chịu nhiệt cao, đồng thời tăng khả năng chống va đập cao, không mùi, không gây hại cho sức khỏe con người.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\">Sản phẩm có lớp chống tia UV, làm giảm những tác hại của ánh nắng mặt trời &amp; không bị ố vàng sau thời gian sử đụng đồng thời nổi bật phần lọc gió bên trong.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\">Sử dụng cho dòng xe Honda SH 2013 - 2018 ( bao gồm 125i/150i)</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\">Màu sắc: mày trắng trong suốt, màu đen khói.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\">Bộ&nbsp;sản phẩm được tặng kèm 01&nbsp;Vỏ bọc silicone remote Smartkey giúp&nbsp;bảo vệ remote khỏi bị trầy xước, va đập, ôm gọn vào remote.</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-1.jpg?v=1582087729101\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-2.jpg?v=1582087737611\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-4.jpg?v=1582087751264\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-5.jpg?v=1582087758755\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-3.jpg?v=1582087768358\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-bau-loc-gio-sh-y-v1.jpg?v=1582087776215\" /></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.2e5e5b6dZmPaV8\">&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/1LC2xjTuR8o\" width=\"100%\"></iframe></p>', '', 'Ốp pô E SH', 'chụp pô E ) chính hãng ZHIPAT, ốp lọc gió xe sh, Ốp pô E trong suốt xe máy Honda SH 150i/125i 2013-2019 ( ốp lọc gió, ỐP PÔ E XE SH, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen khói (full)', '', '', '', '', '', '', '', 'deny', '', '420000', '', '1', '', '', NULL, '', '', '', '2.5', 'kg', 'images/16946722/op-po-e-trong-