(1320, 'bo-02-guong-chieu-hau-xe-may', 'Bộ 02 gương chiếu hậu xe máy QC-B026', '<h2><em><strong>Bộ 02 gương chiếu hậu xe máy QC-B026</strong></em></h2>\n<p><em><strong>&nbsp;</strong></em>Gương chiếu hậu xe máy với thiết kế&nbsp;kiểu dáng thời trang đẹp trẻ trung thay thế cho bộ gương truyền thống.</p>\n<p>Mặt gương sáng trong giúp người điều khiển xe quan xát rõ phía sau lái xe an toàn hơn.&nbsp;</p>\n<p>Chấy liệu: tay gương thép không gỉ sáng bóng, lưng gương làm từ nhựa ABS, gương thủy tinh.</p>\n<p>Bộ 2 gương&nbsp;có kèm theo là 02 chân chuyển đổi nên sẽ hỗ trợ lắp đặt&nbsp;với tất cả các dòng xe.</p>\n<p>Kích thước:&nbsp; phần tay gương 20cm, chân gương 8mm, ốc chuyển từ 8 lên chân 10mm</p>\n<p>Màu sắc: đen trắng.</p>\n<p>#guong #kinhchieuhau #guongxemay #guongchieuhauxemay</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-1.jpg?v=1577349265037\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-2.jpg?v=1577349274031\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-3.jpg?v=1577349281230\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-4.jpg?v=1577349288664\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-2-74f49739-4605-4eab-aa02-a56a354e6c39.jpg?v=1617186299700\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-3-c387e077-f1b3-45b6-b4f2-6bc03d8a2ce5.jpg?v=1617186310067\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-xe-may-1-895e6b53-ea35-4f63-a99e-33c0b978e02d.jpg?v=1617186319490\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'gương xe máy', 'ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.8', 'kg', 'images/16601854/bo-02-guong-chieu-hau-xe-may.jpg', '<p>Gương chiếu hậu xe máy với thiết kế&nbsp;kiểu dáng thời trang đẹp trẻ trung thay thế cho bộ gương truyền thống.</p>\n<p>Mặt gương sáng trong giúp người điều khiển xe quan xát rõ phía sau lá', '16601854', '29823587', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14'),
(1321, 'gang-tay-xe-may-mua-dong-co-cam-ung-dien-thoai-zp02', 'Găng tay xe máy mùa đông có cảm ứng điện thoại ZP02', '<h2><strong><em>Găng tay xe máy mùa đông có cảm ứng điện thoại ZP02</em></strong></h2>\n<p>Găng tay &nbsp;dùng đi mùa đông, đi nước ngoài, đi chơi, đi phượt...</p>\n<p>Chất Liệu : Len cao cấp,&nbsp;bên ngoài là lớp da lộn chống gió cực tốt, chống được mưa nhỏ.</p>\n<p>Thiết kệt bàn tay là các hạt nổi chống trơn, giúp bạn lái xe chắc chắn, an toàn.</p>\n<p>Ngón cái và ngón trỏ có tích hợp&nbsp;phần da thật để sử dụng cảm ứng với màn&nbsp;hình điện thoại cực nhạy và chính xác.</p>\n<p>Kích Thước: Vừa cho nhiều size tay.</p>\n<p>Màu sắc: Nâu, đen</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-5.jpg?v=1576893782496\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-3.jpg?v=1576893788929\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-4.jpg?v=1576893796778\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-9.jpg?v=1576894721309\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-11.jpg?v=1576895571387\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-6.jpg?v=1576893802997\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-7.jpg?v=1576893809050\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gang-tay-mua-dong-di-xe-may-10.jpg?v=1576895561145\" /></em></strong></p>', '', '', '', '1', 'Màu sắc', 'Nâu', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/16566183/gang-tay-xe-may-mua-dong-co-cam-ung-dien-thoai-zp02.jpg', '<p>Găng tay &nbsp;dùng đi mùa đông, đi nước ngoài, đi chơi, đi phượt...</p>\n\n<p>Chất Liệu : Len cao cấp,&nbsp;bên ngoài là lớp da lộn chống gió cực tốt, chống được mưa nhỏ.</p>\n\n<p>Thiết kệt ', '16566183', '29724634', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14'),
(1322, 'mu-long-mua-dong-sieu-am-co-kinh-mat', 'Mũ lông mùa đông siêu ấm có kính mắt', '<h2><em><strong>Mũ lông mùa đông siêu ấm có kính mắt</strong></em></h2>\n<p>Mũ lông mùa đông sẽ là món quà trong mùa đông tuyệt vời dành cho gia đình, bạn bè, bạn, đồng nghiệp của bạn thể hiện sự quan tâm và tăng cường mối thân tình của bạn.</p>\n<p>Giữ ấm hoàn hảo cho các hoạt động ngoài trời khi lạnh của những ngày đông như trượt tuyết, cắm trại, trượt băng vv.</p>\n<p>Chất lượng tốt: Sử dụng chất liệu lông nhung mềm mại, sẽ khiến bạn cảm thấy thoải mái và trông bạn thật đặc biệt giữa đám đông, bên ngoài là lớp vải chống thấm nước.</p>\n<p>Sản phẩm tích hợp 1 kính râm cho bạn có thể đội full mặt.</p>\n<p>Phong cách cổ điển: Thời trang với phong cách Cossack Nga cổ điển bắt mắt.</p>\n<p>Thích hợp cho cả nam và nữ&nbsp;dễ dàng phối đồ và phủ hợp với mọi phong cách phục trang, giúp bạn trông thật đáng yêu trong thời tiết lạnh.</p>\n<p>Kích thước: 30*25*15CM</p>\n<p>Trọng lượng: 190G</p>\n<p>Màu sắc: Đen, đỏ.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-2.jpg?v=1576827423539\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-5.jpg?v=1576827446265\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-v5.jpg?v=1576827495216\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-7.jpg?v=1576828531986\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-8.jpg?v=1576828542453\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-long-mua-dong-co-kinh-4.jpg?v=1576827481522\" /></p>\n<p>&nbsp;</p>', '', 'Mũ lông', 'mũ ấm mùa dông, mũ lông, ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '280000', '', '1', '', '', NULL, '', '', '', '1.2', 'kg', 'images/16562127/mu-long-mua-dong-sieu-am-co-kinh-mat.jpg', '<p>Chất lượng tốt: Sử dụng chất liệu lông nhung mềm mại, sẽ khiến bạn cảm thấy thoải mái và trông bạn thật đặc biệt giữa đám đông, bên ngoài là lớp vải chống thấm nước.</p>\n\n<p>Sản phẩm tích ', '16562127', '29708808', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14');
