(1323, 'mu-long-mua-dong-sieu-am-m9539', 'Mũ lông mùa đông siêu ấm M9539', '<h2><em><strong>Mũ lông mùa đông siêu ấm M9539</strong></em></h2>\n<p>Mũ lông mùa đông sẽ là món quà trong mùa đông tuyệt vời dành cho gia đình, bạn bè, bạn, đồng nghiệp của bạn thể hiện sự quan tâm và tăng cường mối thân tình của bạn.</p>\n<p>Giữ ấm hoàn hảo cho các hoạt động ngoài trời khi lạnh của những ngày đông như trượt tuyết, cắm trại, trượt băng vv.</p>\n<p>Chất lượng tốt: Sử dụng chất liệu lông nhung mềm mại, sẽ khiến bạn cảm thấy thoải mái và trông bạn thật đặc biệt giữa đám đông, bên ngoài là lớp vải chống thấm nước.</p>\n<p>Phong cách cổ điển: Thời trang với phong cách Cossack Nga cổ điển bắt mắt.</p>\n<p>Thích hợp cho cả nam và nữ&nbsp;dễ dàng phối đồ và phủ hợp với mọi phong cách phục trang, giúp bạn trông thật đáng yêu trong thời tiết lạnh.</p>\n<p>Kích thước: 30*25*15CM</p>\n<p>Trọng lượng: 190G</p>\n<p>Màu sắc: Đen, đỏ.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-4.jpg?v=1576465944754\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-5.jpg?v=1576465953594\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-6.jpg?v=1576465961694\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-3.jpg?v=1576465001672\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-2.jpg?v=1576465009322\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-doi-mua-dong-1.jpg?v=1576465017430\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Mũ lông', 'mũ ấm mùa động, mũ lông, mũ mùa đông, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/16527044/mu-long-mua-dong-sieu-am-m9539.jpg', '<p>Mũ lông mùa đông sẽ là món quà trong mùa đông tuyệt vời dành cho gia đình, bạn bè, bạn, đồng nghiệp của bạn thể hiện sự quan tâm và tăng cường mối thân tình của bạn.</p>\n\n<p>Giữ ấm hoàn hả', '16527044', '29614158', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14'),
(1324, 'bo-op-hom-cua-tay-nam-cua-cho-xe-o-to-mitsubishi-xpander-2016', 'Bộ Ốp hõm cửa, tay nắm cửa cho xe ô tô mitsubishi xpander 2016', '<h2><strong><em>Bộ Ốp hõm cửa, tay nắm cửa cho xe ô tô Mitsubishi Xpander 2016</em></strong></h2>\n<p>Tay nắm&nbsp;mở cửa và phần hõm bên trong&nbsp;thường rất dễ bị trầy xước, những xước dăm nhỏ do móng tay, nhẫn làm mất đi vẻ sáng bóng sơn xe của bạn vậy? Hãy để bộ&nbsp;Bộ 4 ốp tay nắm và hõm cửa dành riêng cho Mitsubishi Xpander đời 2016 giải quyết hết mọi vấn đề trên!</p>\n<p>Sản phẩm làm&nbsp;nhựa ABS mạ CROM sáng bóng (tráng gương) sang trọng không bong tróc hay xỉn màu.</p>\n<p>Chống trầy xước cực tốt ,trang trí tạo điểm nhấn cho xe của bạn.</p>\n<p>Bộ sản phẩm bao gồm 4 ốp tay nắm và 4 ốp hõm&nbsp;cửa cao cấp, bền đẹp và hiệu quả cho xe ô tô của bạn.</p>\n<p>Giá sản phẩm chia làm 3 phân khúc giá:&nbsp;4 ốp tay nắm giá 390.000đ,&nbsp;4 ốp hõm cửa giá 430.000đ,&nbsp;Bộ 4&nbsp;Ốp hõm cửa và tay nắm cửa giá 790.000đ.</p>\n<p>Thiết kế riêng cho&nbsp;Mitsubishi Xpander đời 2016&nbsp;&nbsp;nên khi lắp đặt đơn giản và vừa khí đến từng milimet.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-tay-nam-hom-cua-xe-xpander-1.jpg?v=1575864581451\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-tay-nam-hom-cua-xe-xpander-2.jpg?v=1575864593099\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-tay-nam-hom-cua-xe-xpander-4.jpg?v=1575864775782\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-tay-nam-hom-cua-xe-xpander-3.jpg?v=1575864608271\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-tay-nam-hom-cua-xe-xpander-5.jpg?v=1575865090042\" /></em></strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Bộ Ốp hõm cửa, tay nắm cửa cho xe ô tô', 'Bộ Ốp hõm cửa, Bộ Ốp tay nắm cửa, ô tô, phụ  kiện ô tô, tay nắm cửa cho xe ô tô, tay nắm cửa cho xe ô tô mitsubishi xpander 2016, Volcano, volcano.vn', '1', 'Phân loại', 'Bộ tay nắm', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/16476412/bo-op-hom-cua-tay-nam-cua-cho-xe-o-to-mitsubishi-xpander-2016.jpg', '<p>Sản phẩm làm&nbsp;nhựa ABS mạ CROM sáng bóng (tráng gương) sang trọng không bong tróc hay xỉn màu.</p>\n\n<p>Chống trầy xước cực tốt ,trang trí tạo điểm nhấn cho xe của bạn.</p>\n\n<p>Bộ sản p', '16476412', '29434699', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14'),
(1325, 'may-hut-bui-kiem-bom-lop-o-to-cao-cap-jyb-x005', 'Máy hút bụi kiêm bơm lốp ô tô cao cấp JYB-X005', '<h2><em><strong>Máy hút bụi kiêm bơm lốp ô tô cao cấp JYB-X005</strong></em></h2>\n<p>&nbsp;Máy hút bụi và bơm lốp ô tô&nbsp;là sản phẩm hiện đại với hai chức năng trong một sản phẩm, vừa hút bụi vừa bơm lốp ô tô khi cần, mang đến tiện ích thiết thực cho người sử dụng.</p>\n<p>Hút sạch bụi bẩn trên xe tại mọi vị trí, giữ cho xe của bạn luôn được đảm bảo vệ sinh.</p>\n<p>Có 2 mức to nhỏ&nbsp;tùy chỉnh để sử dụng hút bụi.</p>\n<p>Thiết kế tích hợp đầu bơm và vòi bơm, máy có chức năng bơm lốp ô tô.</p>\n<p>Đồng hồ đo áp led có phím tăng giảm để điều chỉnh áp xuất cần bơm.</p>\n<p>Có đèn led để sử dụng hút bụi trong các kẽ nhỏ bên trong nội thất ô tô.</p>\n<p>Điện áp: 12V.</p>\n<p>Công suất: 130W.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-5.jpg?v=1575602927905\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-10.jpg?v=1575603873989\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-9.jpg?v=1575603700319\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-8.jpg?v=1575602956842\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-1.jpg?v=1575602968525\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-2.jpg?v=1575602975736\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-3.jpg?v=1575602984381\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-6.jpg?v=1575603002961\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/may-hut-bui-kiem-bom-lop-o-to-7.jpg?v=1575603011594\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/Ep-X4UE-XBo\" title=\"YouTube video player\" width=\"750\"></iframe></p>', '', 'Máy hút bụi xe ô tô', 'bơm lốp ô tô, máy bơm lốp ô tô, máy hút bụi, máy hút bụi kiêm bơm lốp ô tô, máy hút bụi ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '580000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/16449237/may-hut-bui-kiem-bom-lop-o-to-cao-cap-jyb-x005.jpg', '<p>&nbsp;Máy hút bụi và bơm lốp ô tô&nbsp;là sản phẩm hiện đại với hai chức năng trong một sản phẩm, vừa hút bụi vừa bơm lốp ô tô khi cần, mang đến tiện ích thiết thực cho người sử dụng.</p>\n', '16449237', '29344238', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:14', '2024-05-29 06:12:14'),
(1326, 'may-suc-tao-oxy-usb-lh', 'Máy sục tạo Oxy USB LH', '<p><em><strong>Máy sục tạo Oxy USB LH</strong></em></p>\n<p>Máy tạo Oxy USB&nbsp; là loại máy sục tạo khí oxy cho hồ cá, hồ thuỷ sinh, hòn non bộ, thùng câu cá, thùng cá đi câu...&nbsp;rất tiện dụng nhỏ gọn chạy bằng nguồn&nbsp;điện USB nguồn sạc điện thoại, có thể mang theo đi câu bằng cách sử dụng nguồn điện pin sự phòng.</p>\n<p>Chất liệu nhựa sản phẩm làm từ nhựa chắc chắn chống nước tốt.</p>\n<p>Máy chia làm 2 loại&nbsp;LH-205&nbsp;có 1 đầu sục,&nbsp;LH-206 có 2 đầu sục.</p>\n<p>Kích thước:&nbsp;LH-205&nbsp;9*6*5CM,&nbsp;LH-206 11*6.5*4CM, ống và đầu sục tặng kèm dài 100CM, dây nguồn dài 60CM.<em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/suc-oxy-mini-usb-1.jpg?v=1574220370850\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/suc-oxy-mini-usb-4.jpg?v=1574221530341\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/suc-oxy-mini-usb-3.jpg?v=1574220380831\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/suc-oxy-mini-usb-2.jpg?v=1574220388442\" /></strong></em></p><iframe width=\"100%\" height=\"380\" src=\"https://www.youtube.com/embed/oDfrZUQhRCo\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Máy sục tạo Oxy', '', '1', 'Phân loại', 'LH-205', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/16313780/may-suc-tao-oxy-usb-lh.jpg', '<p>Chất liệu nhựa sản phẩm làm từ nhựa chắc chắn chống nước tốt.</p>\n\n<p>Máy chia làm 2 loại&nbsp;LH-205&nbsp;có 1 đầu sục,&nbsp;LH-206 có 2 đầu sục.</p>\n\n<p>Kích thước:&nbsp;LH-205&nbsp;9*6*', '16313780', '28971822', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1327, 'diem-xang-moc-khoa-jobon-zb-180', 'Diêm xăng móc khóa Jobon ZB-180', '<p><span style=\"font-size:16px;\"><em><strong>Diêm xăng móc khóa Jobon ZB-180</strong></em></span></p>\n<p>Mẫu diêm xăng móc khóa đẹp, độc, lạ, chất với phong cách khác biệt tạo cho bạn sự nam tính bụi bặm đến khó cưỡng. Với nhiều kiểu dáng&nbsp;cùng nhiều chất liệu bền và tốt với thời gian.</p>\n<p>Tiện dụng, mang theo gọn gàng, đánh lửa dễ dàng.</p>\n<p>Kích thước nhỏ gọn: 7.5*1.8CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v12.jpg?v=1573790712961\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v11.jpg?v=1573790722175\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v1.jpg?v=1573790735334\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v2.jpg?v=1573790749255\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v9.jpg?v=1573790756483\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v10.jpg?v=1573790763073\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v7.jpg?v=1573790771451\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/diem-xang-jobon-v8.jpg?v=1573790778910\" /></strong></em></p>', '', 'Diêm xăng', 'bat lua, bật lửa, Diêm xăng móc khóa Jobon ZB-180, freeship, hộp quẹt, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng đồng', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/16282318/diem-xang-moc-khoa-jobon-zb-180.jpg', '<p>Mẫu diêm xăng móc khóa đẹp, độc, lạ, chất với phong cách khác biệt tạo cho bạn sự nam tính bụi bặm đến khó cưỡng. Với nhiều kiểu dáng&nbsp;cùng nhiều chất liệu bền và tốt với thời gian.</p', '16282318', '28899341', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1328, 'bo-do-tang-xich-xe-tu-dong-cnc', 'Bộ đỡ tăng xích xe tự động CNC', '<p><em><strong>Bộ đỡ tăng xích xe tự động CNC</strong></em></p>\n<p>&nbsp;Tăng xích&nbsp;tự động (tăng sên tự động)&nbsp;cho xe là giải&nbsp;khắc phục vấn đề tuột dây xích một cách bất ngờ hay bị dãn dây sên gây ra cảm giác khó chịu cho mỗi chuyến đi của bạn.</p>\n<p dir=\"ltr\">&nbsp;Bộ tăng xích&nbsp;tự động thay thế cho việc tăng xích&nbsp;thủ công và là món đồ chơi chần thiết có các dòng xe phân phối lớn như&nbsp;winner,&nbsp;exciter...</p>\n<p>Giúp nhông xích bền hơn,&nbsp;không phải ra tiệm căng lại xích mỗi lần khi xích bị trùng, đảm bảo tuổi thọ lâu dài cho sên đĩa.</p>\n<p dir=\"ltr\">&nbsp;Thiết kế lắp đặt đơn giản với ốc vít sẵn, chất liệu kim loại chắc chắn, phần bánh đỡ xích làm từ nhựa chịu mòn và chịu nhiệt.</p>\n<p dir=\"ltr\">&nbsp;Kích thước: 15*12.5*7.5cm, phần đỡ xích 2.7cm đường kính 5.2cm, phần bắt chân với khung xe rộng 4CM, độ dày tùy chỉnh đến 4CM</p>\n<p>&nbsp;Màu sắc:&nbsp; đen</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-do-nang-xich-tu-dong-1.jpg?v=1573718570178\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-do-nang-xich-tu-dong-2.jpg?v=1573718588701\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-do-nang-xich-tu-dong-3.jpg?v=1573718599643\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-do-nang-xich-tu-dong-5.jpg?v=1573718611366\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-do-nang-xich-tu-dong-v5.jpg?v=1573717594411\" /></p>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/9DakQN2ulYk\" width=\"100%\"></iframe></p>', '', 'Bộ đỡ tăng xích xe tự động', 'Bộ đỡ tăng xích xe tự động, Bộ đỡ tăng xích xe tự động CNC, ô tô, phụ kiện xe máy, tăng sên tự động, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '235000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/16273409/bo-do-tang-xich-xe-tu-dong-cnc.jpg', '<p>Giúp nhông xích bền hơn,&nbsp;không phải ra tiệm căng lại xích mỗi lần khi xích bị trùng, đảm bảo tuổi thọ lâu dài cho sên đĩa.</p>\n<p dir=\"ltr\">&nbsp;Thiết kế lắp đặt đơn giản với ốc vít ', '16273409', '28874877', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1329, 'decal-carbon-dan-trang-tri-den-phanh-kinh-sau-xe-o-to-for-focus', 'Decal Carbon Dán Trang Trí Đèn Phanh Kính Sau Xe Ô Tô Ford Focus', '<p><span style=\"font-size:14px;\"><em><strong>Decal Carbon Dán Trang Trí Đèn Phanh Kính Sau Xe Ô Tô Ford Focus</strong></em></span></p>\n<p>Decal có cắt sẵn phần logo và chỉ che phần bên cạnh giúp cho khi đen sáng sẽ nổi bật hơn rất nhiều trên phần nền Carbon 3D.</p>\n<p>Chất liệu: decal carbon.</p>\n<p>Sử dụng: dán nguyên tấm lên đèn báo phanh sau ở trên kính sau xe Ford&nbsp;Focus Hatchback 2012-2017 và xe&nbsp;Ford Focus Sedan&nbsp;2012-2017.</p>\n<p>Phân loại cho 2 dòng xe Ford Focus khác nhau:&nbsp; Ford Focus Hatchback 2005-2013,&nbsp;Ford Focus Sedan&nbsp;2012-2017.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-logo-focus-1.jpg?v=1572593291285\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-logo-focus-2.jpg?v=1572593299095\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-logo-focus-3.jpg?v=1572593306734\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-logo-focus-4.jpg?v=1572593313840\" /></p>', '', 'Decal carbon', 'Decal Carbon, Decal Carbon Dán Trang Trí Đèn Phanh Kính Sau Xe Ô Tô For Focus, For Focus Hatchback 2012-2017, For Focus Sedan 2012-2017, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Hatchback 2005-2013', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/16183927/decal-carbon-dan-trang-tri-den-phanh-kinh-sau-xe-o-to-for-focus.jpg', '<p>Decal có cắt sẵn phần logo và chỉ che phần bên cạnh giúp cho khi đen sáng sẽ nổi bật hơn rất nhiều trên phần nền Carbon 3D.</p>\n\n<p>Chất liệu: decal carbon.</p>\n\n<p>Sử dụng: dán nguyên tấm', '16183927', '28594490', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1330, 'bat-lua-ga-hinh-mo-let', 'Bật lửa ga hình cờ lê', '<p><em><strong>Bật lửa ga hình cờ lê</strong></em></p>\n<p>Bật lửa ga hình&nbsp;mỏ lết&nbsp;là món phụ kiện độc, đẹp và lạ thiết kế độc đáo chất liệu bền bỉ chống gỉ sét,&nbsp;thích hợp trưng bày hay làm quà tặng</p>\n<p>Sử dụng ga,&nbsp;lên lửa mạnh. Chất liệu vỏ ngoài là inox chắc chắn chống gỉ sét.</p>\n<p>Kích thước sản phẩm: 9.3*1CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ga-hinh-co-le-1.jpg?v=1569642984615\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ga-hinh-co-le-2.jpg?v=1569642996648\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ga-hinh-co-le-3.jpg?v=1569643006411\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-ga-hinh-co-le-4.jpg?v=1569643015399\" /></strong></em></p>', '', 'Bật lửa ga', 'bật lửa độc, Bật lửa ga hinh mỏ lết, bật lửa trang trí, freeship, hộp quẹt, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/15902089/bat-lua-ga-hinh-mo-let.jpg', '<p>Bật lửa ga hình&nbsp;mỏ lết&nbsp;là món phụ kiện độc, đẹp và lạ thiết kế độc đáo chất liệu bền bỉ chống gỉ sét,&nbsp;thích hợp trưng bày hay làm quà tặng</p>\n<p>Sử dụng ga,&nbsp;lên lửa mạ', '15902089', '27907836', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1331, 'long-bat-quai-bay-ca-tom-cua-khung-vuong', 'Lồng bát quái bẫy cá, tôm, cua khung vuông', '<p><em><strong>Lồng bát quái bẫy cá, tôm, cua khung vuông</strong></em></p>\n<p>Lồng&nbsp;bát quái hay rọ bát quái hay miền tây hay gọi là lú tôm cá, lợp tôm cá&nbsp;là sản phẩm chuyên dụng đánh bắt tôm cá, lươn, cua, chạch rất hiệu quả. Đặc biệt ở khu vực miền tây, người dân ở đây sử dụng lưới bát quáI để bắt các loại tôm lớn khai thác, còn các con tôm nhỏ để lại nuôi tăng năng suất.&nbsp;<br />\nLồng&nbsp;bát quái&nbsp;được đan bằng&nbsp;sợi cước nhỏ, được ghép đôi, ghép 3 lại với nhau, tăng độ bền bỉ cho lưới.<br />\nCác sợi cước được đan bắt chéo nhau tạo thành mắt lưới 4-5MM.<br />\nLồng bát quái dài được đan vào các khung sắt hình vuông goặc hình chữ nhât, để làm giá đỡ, và khung sắt có tác dụng mở rộng đường kính vòng lưới giúp tôm, cá vào dễ dàng hơn.</p>\n<p>Phân loại và kích thước:</p>\n<p>&nbsp;Loại 8 cửa: rộng 60CM cao 22CM khung sắt 30*21CM cửa 14*10CM.</p>\n<p>Loại 12 cửa&nbsp;2 tầng: rộng 70CM cao 36CM khung sắt &nbsp;36*33CM cửa 18*10CM.</p>\n<p>Loại 16 cửa&nbsp;2 tầng: rộng 80CM cao 36CM khung sắt&nbsp;40*36CM cửa 16*10CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-10.jpg?v=1569051789810\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-12.jpg?v=1569051823899\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-15.jpg?v=1569052014682\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-14.jpg?v=1569052025157\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-18.jpg?v=1569052957104\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-4.jpg?v=1569050066274\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-16.jpg?v=1569052186939\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/long-bat-quai-bay-tom-cua-ca-5.jpg?v=1569050046467\" /></strong></em><br />\n&nbsp;</p>', '', 'Lồng bát quái', 'cua khung vuông, Lồng bát quái bẫy cá, lưới bát quái, rọ bát quái, tôm, Volcano, volcano.vn', '1', 'Phân loại', '6 Cửa', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/15846203/long-bat-quai-bay-ca-tom-cua-khung-vuong.jpg', '<p>Lồng&nbsp;bát quái hay rọ bát quái hay miền tây hay gọi là lú tôm cá, lợp tôm cá&nbsp;là sản phẩm chuyên dụng đánh bắt tôm cá, lươn, cua, chạch rất hiệu quả. Đặc biệt ở khu vực miền tây, n', '15846203', '27748787', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1332, 'ghe-gan-xe-dap-xe-dap-dien-cho-tre-em-ngoi-co-tua-lung', 'Ghế gắn xe đạp, xe đạp điện cho trẻ em ngồi có tựa', '<p><em><strong>Ghế gắn xe đạp, xe đạp điện cho trẻ em ngồi có tựa</strong></em></p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i3.1f175d6dlmcYTq\">Ghế gắn trên xe đạp, xe điện có bảo vệ hai bên, có để chân, tay nắm</p>\n<p data-spm-anchor-id=\"a2o4n.pdp.product_detail.i2.1f175d6dlmcYTq\">Sản phẩm ghế gắn trên xe cho trẻ em ngồi, sản phẩm thích hợp cho nhiều loại xe đạp, xe điện.</p>\n<p>Thông dụng dễ sử dụng, chắc chắn, làm bằng chất liệu tốt an toàn tuyệt đối cho trẻ em.</p>\n<p>Chất liệu khung kim loại phần đệm ngồi lamg từ da PU bên trong lót mút êm đàn hồi.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-13.jpg?v=1568967102681\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-12.jpg?v=1568967110110\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/3-14bc3d2c-f37b-45f2-8cc8-73394f75a59e.jpg?v=1624519574923\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-3.jpg?v=1568967121189\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-5.jpg?v=1568967134010\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-8.jpg?v=1568967140065\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ghe-ngoi-truoc-xe-dap-cho-be-2.jpg?v=1568967148445\" /></p>\n<p