(1333, 'bo-kich-no-o-to-kiem-bom-hoi-va-sac-du-phong-high-power-jx35-22000mah', 'Bộ kích nổ ô tô kiêm bơm hơi và sạc dự phòng High Power JX35-22000mAh', '<p><em><strong>Bộ kích nổ ô tô kiêm bơm hơi và sạc dự phòng High Power JX35-22000mAh</strong></em></p>\n<p>Bộ&nbsp;kích nổ&nbsp;ô tô kiêm sạc pin dự&nbsp;phòng là giải pháp hỗ&nbsp;trợ&nbsp;cho bạn trong những trường hợp xe ô tô chết máy, điện thoại, laptop hết pin khi đang đi trên đường.&nbsp;Bạn sẽ&nbsp;làm gì khi chiếc xe của bạn đột nhiên hết bình không thể&nbsp;khởi động?</p>\n<p>Giờ&nbsp;đây không còn những mối phiền tâm như&nbsp;vậy bạn hoàn toàn có thể&nbsp;tự&nbsp;mình khởi động chiếc xe với&nbsp;Bộ kích nổ ô tô kiêm bơm hơi và sạc dự phòng High Power JX35-22000mAh.</p>\n<p>Kích nổ&nbsp;ô tô trong những trường hợp khẩn cấp:&nbsp;Ắc quy không lưu trữ&nbsp;được điện hoặc hết điện.</p>\n<p>Bơm lốp xe lên đến 7kg hỗ trợ trong trường hợp xuống hơi hay phải vá lốp.</p>\n<p>Sạc dự&nbsp;phòng 22000mAh: 2 cổng USB 5V. 2.1A cho các thiết bị&nbsp;di động: smartphone, tablet…</p>\n<p>Đầu ra 12V&nbsp;cùng bộ&nbsp;chuyển đổi cho máy&nbsp;ảnh, laptop…</p>\n<p>Đèn LED siêu sáng giúp dễ&nbsp;dàng sử&nbsp;dụng trong đêm, mất điện. Phát tín hiệu S.O.S trong những trường hợp khẩn cấp.</p>\n<p>Kích thước: 22*16*5.5CM, hộp đựng 33*26*8CM</p>\n<p>Pin hỗ trợ sạc điện nguồn trên xe 12V và nguồn điện 220V.</p>\n<p>Bộ sản phẩm đầy đủ: 01 hộp đựng, 01 bộ kích, 01 dây kẹp 2 đầu ác quy, 01 cáp sạc đa năng 4 đầu khác nhau, 01 sạc 15V, 01 sạc chân tẩu 12V, 01 dây bơm và 3 đầu van có bơm xe đạp, bóng.</p>\n<p>Chia làm 2 loại:&nbsp;Jack kết nối thường và&nbsp;Jack kết nối thông minh có đèn led báo tín hiệu kết nối của 2 dây âm dương.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-5.jpg?v=1568705326411\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-3-f97e1d54-70e2-417b-8d46-684c231f4d47.jpg?v=1568705374471\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-4.jpg?v=1568705381972\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-1.jpg?v=1568705392909\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-2.jpg?v=1568705401008\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-6-df3f3dc3-3358-4711-897c-03a7576e9aa5.jpg?v=1568705413489\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-7.jpg?v=1568705420063\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-kich-no-xe-kiem-bom-xe-o-to-v9.jpg?v=1568705433837\" /></p>\n<p>&nbsp;</p>', '', 'Bộ kích nổ ô tô', 'Bộ kích nổ ô tô, Bộ kích nổ ô tô kiêm bơm hơi và sạc dự phòng High Power JX35-22000mAh, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Jack kết nối thường', '', '', '', '', '', '', '', 'deny', '', '1900000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/15774799/bo-kich-no-o-to-kiem-bom-hoi-va-sac-du-phong-high-power-jx35-22000mah.jpg', '<p>Kích nổ&nbsp;ô tô trong những trường hợp khẩn cấp:&nbsp;Ắc quy không lưu trữ&nbsp;được điện hoặc hết điện.</p>\n\n<p>Bơm lốp xe lên đến 7kg hỗ trợ trong trường hợp xuống hơi hay phải vá lốp.', '15774799', '27545527', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:16', '2024-05-29 06:12:16'),
(1334, 'tui-vai-vuong-dung-do-treo-hong-xe-may', 'Túi vải vuông đựng đồ treo hông xe máy TH01', '<p><em><strong>Túi vải vuông đựng đồ treo hông xe máy TH01</strong></em></p>\n<p>Túi đựng đồ treo hông xe máy để 2 bên yên sau xe rất tiện dụng để chứa đồ cho những chuyến đi phượt, đi tour xa, cho shiper giao hàng, các nhà vận chuyển chuyển phát...Sản phẩm chất liệu bền bỉ, kiểu dáng đẹp và&nbsp;sang trọng.&nbsp;</p>\n<p>Sử dụng hầu hết&nbsp;các mẫu xe máy&nbsp;hiện nay đều sử dụng được, người ngồi sau vẫn&nbsp;vô tư.</p>\n<p>Thể tích lớn có thể thừa&nbsp;sức đựng đồ, có phản quang cảnh váo an toàn.</p>\n<p>Chất liệu vải: Canvas (hay còn được gọi là vải bố) bền bỉ, bên ngoài có dán phản quang vừa có tác dụng cảnh báo vừa trang trí đẹp mắt.</p>\n<p>Tùi phù hơp&nbsp;cho những chuyến đi phượt, đi tour xa, các shiper chuyên chuyển phát, giao hàng sẽ là một sản phẩm rất tiện dụng.</p>\n<p>Phân loại làm 2 kích thước túi khác nhau:&nbsp;</p>\n<p>Kích thước túi mỗi bên túi : mỗi túi 20*33*44CM khoảng cách yên xe 28CM (29 lít)</p>\n<p>Kích thước mỗi túi bên 32*41*52CM&nbsp;khoảng cách yên xe 30CM (68 lít)</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-1.jpg?v=1568532311768\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-5-4abba58f-1e40-4597-ad13-fa50b0c3d636.jpg?v=1568532362429\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-3.jpg?v=1568532321061\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-4.jpg?v=1568532328946\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-v14.jpg?v=1616464271578\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-treo-hong-xe-may-6.jpg?v=1616464279915\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Túi đựng đồ xe máy', 'ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Kích thước', '29 lít', '', '', '', '', '', '', '', 'deny', '', '360000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/15762573/tui-vai-vuong-dung-do-treo-hong-xe-may.jpg', '<p>Túi đựng đồ treo hông xe máy để 2 bên yên sau xe rất tiện dụng để chứa đồ cho những chuyến đi phượt, đi tour xa, cho shiper giao hàng, các nhà vận chuyển chuyển phát...Sản phẩm chất liệu b', '15762573', '27508256', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:17', '2024-05-29 06:12:17'),
(1335, 'ke-treo-treo-tuong-de-dau-thu-de-do-trang-tri', 'Kệ treo treo tường để đầu thu, để đồ trang trí', '<p><em><strong>Kệ treo treo tường để đầu thu, để đồ trang trí</strong></em></p>\n<p>Kệ đầu thu DVD, Kệ đầu thu kỹ thuật số, Kệ treo tivi box,&nbsp;Kệ treo tường trang trí phòng khách, vốn là nhưng sản phẩm không thể thiếu trong mỗi gia đình hiện nay.</p>\n<p>Chất liệu gỗ ép sơn màu trắng (bảng gỗ)&nbsp;Chống nước, chống mối mọt. Dẻo dai, nhẹ nhưng không kém phần chắc chắn. Bền đẹp, không bị cong vênh mục nát theo thời gian. Dễ dàng vệ sinh, nếu vết bẩn bám chắc chỉ cần dùng kem tẩy chấm lên rồi dùng khăn ướt lau qua là sạch bóng.</p>\n<p>Sản phâm gồm nhiều chi tiết ghép lại đơn giản, độ dày mỗi chi tiết 1CM</p>\n<p>Dễ dàng lắp đặt, có thể để trên tủ hoặc treo trên tường với móc hít hoặc móc đinh&nbsp;kèm theo.</p>\n<p>Kích thước: sản phẩm gồm 4 phân loại giá khác nhau: 30*20*12.5CM, 50*20*13CM, 60* 20*14, 80*20*14CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-1.jpg?v=1568171821234\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-2.jpg?v=1568171831919\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-3.jpg?v=1568171839794\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-4.jpg?v=1568171847478\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-5.jpg?v=1568171858826\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-7.jpg?v=1568171867906\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-8.jpg?v=1568171880984\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"500\" original-width=\"937\" src=\"//bizweb.dktcdn.net/100/200/904/files/ke-do-do-treo-tuong-9.jpg?v=1568171890370\" /></strong></em></p>', '', 'Kệ treo treo tường để đầu thu, để đồ trang trí', 'để đồ trang trí, Kệ treo treo tường, Kệ treo treo tường để đầu thu, kệ treo tường, Volcano, volcano.vn', '1', 'Kích thước', '30CM', '', '', '', '', '', '', '', 'deny', '', '230000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/15726152/ke-treo-treo-tuong-de-dau-thu-de-do-trang-tri.jpg', '<p>Kệ đầu thu DVD, Kệ đầu thu kỹ thuật số, Kệ treo tivi box,&nbsp;Kệ treo tường trang trí phòng khách, vốn là nhưng sản phẩm không thể thiếu trong mỗi gia đình hiện nay.</p>\n\n<p>Chất liệu nhự', '15726152', '27414888', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:17', '2024-05-29 06:12:17'),
(1336, 'hop-ty-tay-xe-o-to-mazda-2', 'Hộp tỳ tay xe ô tô Mazda 2', '<p><strong><em>Hộp tỳ tay xe ô tô Mazda 2</em></strong></p>\n<p>Hộp tỳ tay là chi tiết nằm giữa 2 ghế trước của xe hơi&nbsp;&nbsp;là 1 chi tiết nhỏ nhưng lại hết sức quan trọng mà nhiều hãng xe đã cắt bỏ khi sản xuất.</p>\n<p>&nbsp;Hộp tỳ tay thiết kế riêng cho xe&nbsp;ô tô&nbsp;Mazda 2&nbsp;làm&nbsp;từ khung nhựa ABS bền bỉ bên ngoài&nbsp;là bọc lớp da PU dày êm chắc chắn đến từng chi tiết chỉ may, hộp đựng đồ rộng có thể bỏ ví, điện thoại vào trong hộp tỳ tay để ko bị vướng khi ngồi, ngoài ra son phấn, mỹ phẩm của chị em, USB nghe nhạc, chìa khóa, thẻ vé xe, kính, phía sau là khay để nước và thuốc lá.</p>\n<p>Kích thước: cao 27.7cm, dài 34, rộng 15cm, phần đế cao 13cm, rộng 15cm, dài 18, phần tỳ kéo dài ra phía trước đến 38cm.</p>\n<p>Phân loại: Loại có cổng sạc USB viền chỉ màu đen (7 cổng USB),&nbsp;Loại có không có cổng sạc USB viền chỉ màu đỏ.</p>\n<p>&nbsp;Lắp đặt đơn giản với đế vừa bằng hốc để đồ cũ trên xe chỉ cần cho vào và ấn mạnh là sẽ giữ hộp tỳ tay chắc chắn không phải vít ốc thay thay đổi bất kỳ chi tiết nào trên xe.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-3.jpg?v=1567759851351\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-9.jpg?v=1567759886381\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-6.jpg?v=1567759897534\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-5.jpg?v=1567759909587\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-4.jpg?v=1567759918919\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-7.jpg?v=1567759932073\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-8.jpg?v=1567759941854\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-1.jpg?v=1567759955714\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-mazda-2-2.jpg?v=1567759963995\" /></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/hop-ty-tay-kia-picanto-2.jpg?v=1547189157235\" /></p>\n<p>&nbsp;</p>', '', 'Hộp tỳ tay ô tô', 'Hộp tỳ tay, hộp tỳ tay mazda 2, Hộp tỳ tay xe ô tô Mazda 2, ô tô, phụ  kiện ô tô, tỳ tay ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Không có cổng USB', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/15697314/hop-ty-tay-xe-o-to-mazda-2.jpg', '<p>Hộp tỳ tay thiết kế riêng cho xe&nbsp;ô tô&nbsp;Mazda 2&nbsp;làm&nbsp;từ khung nhựa ABS bền bỉ bên ngoài&nbsp;là bọc lớp da PU dày êm chắc chắn đến từng chi tiết chỉ may, hộp đựng đồ rộng ', '15697314', '27348427', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:17', '2024-05-29 06:12:17'),
(1337, 'bo-02-bao-ve-tay-lai-xe-may', 'Bộ 02 bảo vệ tay lái xe máy N1N - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Bộ 02 bảo vệ tay lái xe máy N1N - Khắc Laser Theo Yêu Cầu</strong></em></p>\n<p>Bộ 02 bảo vệ tay lái xe máy&nbsp;giúp trang trí xe bạn thêm phần đậm chất thể thao, thời trang, cực ngầu.</p>\n<p>Giúp bảo vệ chống nắng, chống gió, chống bụi cho tay khi lái xe,</p>\n<p>Giúp bảo vệ tay lái khi ngã xe tránh xây xát.</p>\n<p>Có đầy đủ phụ kiện lắp đặt kèm theo sản phẩm cho các bạn tiện lắp đặt hoàn chỉnh.</p>\n<p>Lắp trực&nbsp;tiếp lên 2 chân gương 2 bên.</p>\n<p>Chất liệu nhựa.</p>\n<p>Màu sắc: màu đen trong chống nắng cực tốt.</p>\n<p>Kích thước: 21*18.5*8CM kích thước chi tiết trên hình ảnh mô tả.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-11.jpg?v=1567157093709\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-13.jpg?v=1567157102665\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-10.jpg?v=1567157111225\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-1-93aa78ed-ff8f-4e2c-ad99-65abb9327f1f.jpg?v=1567155823888\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-7.jpg?v=1567155841875\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-8.jpg?v=1567155863678\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-9.jpg?v=1567155878191\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-3-0263c9e5-634b-45c1-8e92-9746f08cd156.jpg?v=1567155894800\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-6.jpg?v=1567155904308\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-4-cc482c25-a7b0-481e-88da-f5959ba1eeeb.jpg?v=1567155912502\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bao-ve-tay-lai-xe-may-5.jpg?v=1567155926023\" /></strong></em></p>', '', 'Bộ 02 bảo vệ tay lái xe máy', 'bảo vệ tay lái, bảo vệ tay lái ô tô, ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '198000', '', '1', '', '', NULL, '', '', '', '1.5', 'kg', 'images/15644551/bo-02-bao-ve-tay-lai-xe-may.jpg', '<p>Giúp bảo vệ tay lái khi ngã xe tránh xây xát.</p>\n<p>Có đầy đủ phụ kiện lắp đặt kèm theo sản phẩm cho các bạn tiện lắp đặt hoàn chỉnh.</p>\n<p>Lắp trực&nbsp;tiếp lên 2 chân gương 2 bên.</p>', '15644551', '27224402', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:17', '2024-