(1341, 'combo-day-va-sung-xit-hoi-cho-may-nen-khi-k-601', 'Combo dây và súng xịt hơi cho máy nén khí K-601', '<p><em><strong>Combo dây và súng xịt hơi cho máy nén khí K-601</strong></em></p>\n<p>Bộ dây và súng cịt hơi chuyên dụng cho máy nén khí với đầy đủ phụ kiện.</p>\n<p>Dây dẫn dài&nbsp;9M, súng xịt cao áp, khớp nối từ máy và khớp nối&nbsp;dây với súng, đầu vòi dài, băng tan.</p>\n<p>Chất liệu ống cao cấp chịu áp lực cao.</p>\n<p>Phân loại: Bộ đầu vòi nối thẳng, bộ đầu vòi nối khớp nhựa chữ T</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-1.jpg?v=1564735251372\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-6.jpg?v=1564969582650\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-2.jpg?v=1564735263114\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-3.jpg?v=1564735274440\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-4.jpg?v=1564735282310\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-5-56514a2d-0141-42ad-a4e6-44988336efe2.jpg?v=1564969746646\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-voi-xit-rua-xe-7.jpg?v=1564988875516\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'dây và súng 