(1342, 'den-led-dan-duoi-dan-xe-o-to-tai-12-24v-led5', 'Đèn led dán đuôi dán xe ô tô tải 12-24V LED5', '<p><em><strong>Đèn led dán&nbsp;đuôi dán&nbsp;xe ô tô tải 12-24V LED5</strong></em></p>\n<p>Đèn chuyên dụng cho xe ô tô, tải xe, container sử dụng điện 12V, 24V.</p>\n<p>Chế độ ánh sáng một màu với 6 bóng&nbsp;led.</p>\n<p>Chất liệu vỏ nhựa màu chống thấm nước, lắp đặt đơn giản.</p>\n<p>Điện áp: 12V, 24V.</p>\n<p>Công Suất: 0.72W, 6MSD</p>\n<p>Kích thước: 9.5*2*1CM.</p>\n<p>Màu sắc: Vàng, đỏ.</p>\n<p>Giá&nbsp;sản phẩm là giá 01 đèn.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-8.jpg?v=1575874233181\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-dan-duoi-dan-suon-xe-o-to-xe-tai-12-24v-8.jpg?v=1563780633165\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-dan-duoi-dan-suon-xe-o-to-xe-tai-12-24v-7.jpg?v=1563780639913\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-dan-duoi-dan-suon-xe-o-to-xe-tai-12-24v-1.jpg?v=1563780645873\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-dan-duoi-dan-suon-xe-o-to-xe-tai-12-24v-4.jpg?v=1563780651979\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-5.jpg?v=1575874281192\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-6.jpg?v=1575874289228\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-7.jpg?v=1575874297508\