(1343, 'den-led-gan-duoi-gan-suon-o-to-xe-tai-12-24v-led1', 'Đèn led gắn đuôi gắn sườn ô tô, xe tải LED1', '<p><em><strong>Đèn led gắn đuôi gắn sườn ô tô, xe tải LED1</strong></em></p>\n<p>Đèn chuyên dụng cho xe ô tô, tải xe container sử dụng điện 12V, 24V&nbsp;thiết kế dạng thanh dài khá mỏng sử dụng lắp nhiều vị trí như đuôi, sườn, đầu xe.</p>\n<p>Chế độ ánh sáng có 2 chế độ là bóng ngoài viền, và chế độ bóng giữa đèn.</p>\n<p>Chất liệu vỏ nhựa màu chống thấm nước, có 2 lỗ để bắt ốc khi lắp đặt.</p>\n<p><b style=\"font-style: italic;\">Kích thước: 11.8*4.4*7.5cm</b></p>\n<p><b style=\"font-style: italic;\">Màu sắc: Đỏ, trắng, vàng.</b></p>\n<p>Phân loại: 12V, 24V.</p>\n<p><b style=\"font-style: italic;\">Lưu ý giá phẩm phẩm là giá 01 đèn.</b></p>\n<p><b style=\"font-style: italic;\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suon-xe-tai-7.jpg?v=1563523550021\" /></b></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suon-xe-tai-5.jpg?v=1563523557931\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suon-xe-tai-8.jpg?v=1563523565711\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suon-xe-tai-4.jpg?v=1563523575181\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suon-xe-tai-1.jpg?v=1563523584552\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-duoi-gan-suo