(1344, 'bo-can-cau-carbon-spiral-8m-va-may-cau-jx3000', 'Bộ Cần câu Carbon Spiral 8M và máy câu JX3000', '<p><em><strong>Bộ Cần câu Carbon Spiral 8M và máy câu JX3000</strong></em></p>\n<p>Bộ cần câu máy đứng 8.0M làm từ chất liệu carbon siêu bền bỉ, cần thẳng chịu lực tốt.</p>\n<p>Cần câu dài 8M thu gọn 110CM, 9 khúc, trọng lượng 487G, đọt 1.8MM , gốc 25.5MM, chịu lực 3kg.</p>\n<p>Máy câu đứng&nbsp;JX3000 5.5:1 tay quay gỗ, màu vàng đen, chất liệu nhựa và kim loại.</p>\n<p>Bộ sản phẩm tặng kèm 01 cuộn dây câu Yu Da Shi 3.0 100M, thẻo câu, phao câu, chuống báo cá và chì câu.&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-3.jpg?v=1563273716149\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-5.jpg?v=1563273724127\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-4.jpg?v=1563273733406\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-6.jpg?v=1563273741837\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-2.jpg?v=1563273751072\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-regalia-8m-1.jpg?v=1563273759512\" /></strong></em></p>', '', 'Cần câu', 'Bộ Cần câu Carbon Spiral 8M và máy câu JX3000, CẦN CÂU, CẦN CÂU 8M, cần câu cá, CẦN CÂU CARBON, cần câu carbon 8m, máy câu, máy câu 3000\\, ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '1450000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/15077279/bo-can-cau-carbon-spiral-8m-va-may-cau-jx3000.jpg', '<p>Bộ cần câu máy đứng 8.0M làm từ chất liệu carbon siêu bền bỉ, cần thẳng chịu lực tốt.</p>\n\n<p>Cần câu dài 8M thu gọn 110CM, 9 khúc, trọng lượng 487G, đọt 1.8MM , gốc 25.5MM, chịu lực 3kg.<', '15077279', '25973940', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:18', '2024-05-29 06:12:18'),
(1345, 'tham-lot-cop-da-cho-ford-focus-sedan', 'Thảm lót cốp da cho xe ô tô Ford Focus 2012-2018', '<p><em><strong>Thảm lót cốp da cho xe ô tô Ford Focus 2012-2018</strong></em></p>\n<p>Thảm lót cốp sau da cao cấp&nbsp;với khả năng đặc biệt: chống xước: chất liệu da PU cao cấp, để đồ đạc thoải mái không lo cào xước làm rách thảm</p>\n<p>Chống nước: mỗi khi chở đồ đông lạnh, hải sản,…thay vì lo lắng nước bẩn ngấm vào sàn cốp bạn chỉ cần dùng khăn khô lau 1 lần là xong.</p>\n<p>Chống trơ trượt&nbsp;cho đồ đạc trong cốp khi chạy với vận tốc nhanh, đi qua đường sóc.. Thảm đen chỉ đen&nbsp;nhìn vừa sang&nbsp;lại vô cùng sạch sẽ.</p>\n<p>100% ôm sát khít theo cốp xe,&nbsp;Dày dặn, siêu bền bỉ, chống nước chống xước và cực kỳ sang trọng&nbsp;Vệ sinh cực kỳ đơn giản!</p>\n<p>Chia làm 2 loại cho xe&nbsp;<em><strong>Ford Focus 2012-2018,&nbsp;Ford 2012-2018 hatchback.</strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-da-lot-cop-2.jpg?v=1563002749280\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-da-lot-cop-3.jpg?v=1563002770109\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-da-lot-cop-5.jpg?v=1564038768681\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-da-lot-cop-1.jpg?v=1563002779624\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-da-lot-cop-4.jpg?v=1564038617004\" /></strong></em></p>', '', 'Thảm lót cốp', 'lót cốp xe ô tô, ô tô, phụ  kiện ô tô, Tham lót cop, Thảm lót cốp da cho Ford Focus Sedan, Volcano, volcano.vn', '1', 'Phân loại', 'Ford 2012-2018 hatchback', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/15053646/tham-lot-cop-da-cho-ford-focus-sedan.jpg', '<p>Thảm lót cốp sau da cao cấp&nbsp;với khả năng đặc biệt: chống xước: chất liệu da PU cao cấp, để đồ đạc thoải mái không lo cào xước làm rách thảm</p>\n\n<p>Chống nước: mỗi khi chở đồ đông lạn', '15053646', '25908932', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:19', '2024-05-29 06:12:19'),
(1346, 'bo-04-chan-bun-cho-xe-honda-city-2015', 'Bộ 04 chắn bùn cho xe ô tô Honda City', '<p><em><strong>Bộ 04 chắn bùn cho xe ô tô Honda City</strong></em></p>\n<p>Với thời tiết ở Việt Nam mưa khá nhiều khi đi xe ô tô&nbsp;chạy gây văng nước, bùn, cát sỏi...&nbsp;ra sau, làm ảnh hưởng đến những xe chạy sau và cũng làm bẩn các bộ phận khác của xe. Với&nbsp;04 chắn bùn cho xe ô tô Honda City&nbsp;sẽ giúp bạn loại bỏ hoàn toàn những vẫn đề trên, ngoài chắn bùn bộ sản phẩm còn giúp&nbsp;hạn chế trầy, tróc lớp sơn bảo vệ xe do đất đá bắn lên gây ra.&nbsp;</p>\n<p>Sản phẩm làm từ&nbsp;chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Honda City.</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm cho chiếc xe của bạn&nbsp;trông cá tính, mạnh mẽ hơn nhiều.</p>\n<p>Phân loại: chia làm 2 loại áp dụng cho xe&nbsp;Honda City trước năm 2015 và&nbsp;Honda City từ 2015 đến nay.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-cho-xe-honda-cyty-1.jpg?v=1562658637776\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-cho-xe-honda-cyty-2.jpg?v=1562658647155\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-cho-xe-honda-cyty-3.jpg?v=1562658655746\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-6.jpg?v=1564977597020\" /></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-xe-o-to-vios-5.jpg?v=1546068107840\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"https://bizweb.