(1347, 'tham-chong-nong-taplo-da-cho-xe-o-to-honda-crv', 'Thảm Chống Nóng Taplo Da Cho Xe Ô Tô Honda CRV', '<p><em><strong>Thảm Chống Nóng Taplo Da Cho Xe Ô Tô Honda CRV</strong></em></p>\n<p>Taplo có vai trò vô cùng quan trọng với ô tô, nó vừa là bộ mặt của chiếc xe vừa là phần linh kiện nội thất tiếp xúc trực tiếp với ánh sáng mặt trời chiếu qua kính của lái xe. Bởi vậy, để đảm bảo cho taplo không bị bạc màu, nứt nẻ, trầy xước khi cọ sát với các đồ vật trên xe cũng như đảm bảo cho việc lái xe được an toàn, thì việc che chắn và&nbsp;bảo vệ bộ phận taplo xe ô tô là việc vô cùng cần thiết.</p>\n<p>&nbsp;Thảm chống nóng taplo Honda CRV&nbsp;&nbsp;được thiết kế trên dây chuyền hiện đại. Sản phẩm được cắt định hình hoàn toàn tự động trên công nghệ 3D, đảm bảo chuẩn xác từng mm với&nbsp;phom taplo và khớp từng model xe, đời xe. Sản phẩm được thiết kế hết sức chi tiết dựa trên thiết kế taplo của nhà sản xuất, đảm bảo trùng khớp hoàn toàn tất cả khe thông gió, bộ phận cảm biến nguyên bản của xe.</p>\n<p>Chất liệu da PU cao cấp bề mặt vân carbon 3D đẹp mắt, mặt bên dưới là các hạt nhựa nhỏ được phun đều chống trơn trượt&nbsp;tuyệt đối, không xê&nbsp;dịch thảm khi xe di chuyển.</p>\n<p>Thảm dễ dàng lau chùi vệ sịnh sạch sẽ.</p>\n<p>Sản phẩm tương thích cho xe: Honda CRV 2012-2016,&nbsp;Honda CRV 2017.</p>\n<p>&nbsp;Sản phẩm có phom chia theo đời xe quý&nbsp;khách vui lòng chọn đúng mẫu chuẩn đời xe!</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-chong-nong-crv-1.jpg?v=1562639725126\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-chong-nong-crv-4.jpg?v=1562642023146\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-chong-nong-crv-2.jpg?v=1562639733676\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-chong-nong-crv-3.jpg?v=1562639742223\" /></p>', '', 'Thảm Chống Nóng Taplo', 'chống nóng taplo, ô tô, phụ  kiện ô tô, Thảm Chống Nóng Taplo Da Cho Xe Ô Tô Honda CRV, thảm táp lô ô tô, tham taplo, Volcano, volcano.vn', '1', 'Đời xe', '2012-2016', '', '', '', '', '', '', '', 'deny', '', '390000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/15009936/tham-chong-nong-taplo-da-cho-xe-o-to-honda-crv.jpg', '<p>Sản phẩm được thiết kế hết sức chi tiết dựa trên thiết kế taplo của nhà sản xuất, đảm bảo trùng khớp hoàn toàn tất cả khe thông gió, bộ phận cảm biến nguyên bản của xe.</p>\n\n<p>Chất liệu d', '15009936', '25812270', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:19', '2024-05-29 06:12:19'),
(1348, 'luoi-lot-ghe-tua-lung-dan-hat-go-cao-cap-tren-xe-o-to', 'Lưới lót ghế tựa lưng đan hạt gỗ cao cấp trên xe ô tô L2750', '<p><strong><em>Lưới lót ghế tựa lưng đan hạt gỗ cao cấp trên xe ô tô L2750</em></strong></p>\n<p>Lót ghế lưới hạt gỗ là một trong những món&nbsp;đồ&nbsp;được tìm mua khá nhiều vì những tính&nbsp;ăn&nbsp;ưu việt mà nó&nbsp;đem lại cho các bác tài mỗi khi ngồi trên xe.</p>\n<p>Với tác dụng&nbsp;mát xa lưng, mông, tạo cảm giác thoải mái khi ngồi lái xe.</p>\n<p>Hút mồ hôi, chống ê mỏi lưng, tạo cảm giác thoáng mát khi ngồi,&nbsp;chống mỏi mệt khi lái xe đường dài.</p>\n<p>Thoáng mát,&nbsp;lót ghế ô tô lưới hạt gỗ&nbsp;không gây tình trạng nóng bức cho lái xe khi ngồi ghế da.</p>\n<p>Với những nổi bật của&nbsp;sản phẩm sử dụng phù hợp được cho mùa đông thì ấm, mùa hè thì lại mát, không bị đổ mồ hôi do thời tiết.</p>\n<p>Kích thước: 48*98*20CM.</p>\n<p>Giá sản phẩm là giá 01 ghế.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tren-xe-o-to-4.jpg?v=1562399866892\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tren-xe-o-to-3.jpg?v=1562399878614\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-lot-ghe-tren-xe-o-to-2.jpg?v=1562399896733\" /></p>\n<p>&nbsp;</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/D_CbTrWe2N8\" width=\"100%\"></iframe></p>', '', 'Lưới lót ghế tựa lưng đan hạt gỗ cao cấp', 'lót ghế đan hạt gỗ ô tô, lót ghế ô tô, lưới lót ghế ô tô, Lưới lót ghế tựa lưng đan hạt gỗ cao cấp trên xe ô tô, lưới tựa lưng ghế ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '310000', '', '1', '', '', NULL, '', '', '', '6', 'kg', 'images/14991885/luoi-lot-ghe-tua-lung-dan-hat-go-cao-cap-tren-xe-o-to.jpg', '<p>Lót ghế lưới hạt gỗ là một trong những món&nbsp;đồ&nbsp;được tìm mua khá nhiều vì những tính&nbsp;ăn&nbsp;ưu việt mà nó&nbsp;đem lại cho các bác tài mỗi khi ngồi trên xe.</p>\n<p>Với tác dụ', '14991885', '25770364', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:19', '2024-05-29 06:12:19'),
(1349, 'moi-cau-ca-chep-yuweidao-200g', 'Mồi câu cá chép YUWEIDAO 200G', '<p><em><strong>Mồi câu cá chép YUWEIDAO 200G</strong></em></p>\n<p>Mồi câu cá chép được tổng hộp từ nhiều loại hương vị được say trộng tạo thành đạng bột nhỏ.</p>\n<p>Dễ dàng sử dụng riêng hoặc pha trộn với các loại mồi chuyên nhiều cá khác nhau, mồi có tính loại bỏ các loại các tạp cá bé phá ổ được các cần thủ chuyên nghiệp Trung Quốc sử dụng rộng rãi.</p>\n<p>Phân loại theo hương vị của mồi: màu vàng hưỡng sữa, màu xanh dương&nbsp;hương trái cây, màu tím hương khoai tây, màu đỏ hương quả ngọt, màu xanh dương hương xạ hương.</p>\n<p>Trọng lượng mỗi gói 200G, tỉ lệ trọn với nước 1:1</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-3.jpg?v=1562207947121\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-4.jpg?v=1562207957233\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-6.jpg?v=1562207968863\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-7.jpg?v=1562210673233\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-2.jpg?v=1562207981930\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-yuweridao-1.jpg?v=1562207991338\" /></strong></em></p>', '', 'Mồi câu', 'câu cá, mồi câu, mồi câu cá, mồi câu cá chép, mồi câu chép, mồi câu đơn, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/14975407/moi-cau-ca-chep-yuweidao-200g.jpg', '<p>Dễ dàng sử dụng riêng hoặc pha trộn với các loại mồi chuyên nhiều cá khác nhau, mồi có tính loại bỏ các loại các tạp cá bé phá ổ được các cần thủ chuyên nghiệp Trung Quốc sử dụng rộng rãi.', '14975407', '25700730', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:20', '2024-05-29 06:12:20'),
(1350, 'tham-lot-san-o-to-3-manh-pvc-cao-cap', 'Thảm lót sàn ô tô nhựa PVC đúc cao cấp', '<p><strong><em>Thảm lót sàn ô tô nhựa PVC đúc cao cấp</em></strong></p>\n<p><span style=\"font-size:14px;\">Sử dụng chất liệu nhựa PVC cao cấp chống mài mòn, không mùi và thân thiện với người sử dụng.</span></p>\n<h3><span style=\"font-size:14px;\">Đảm bảo tiêu chuẩn khắt khe nhất về chất liệu, thiết kế, nhằm đáp ứng nhu cầu đa dạng của thị trường.</span></h3>\n<h3><span style=\"font-size:14px;\">Thảm Lót Sàn Ô Tô PVC Đúc&nbsp;với công nghệ định dạng bằng khuôn mẫu chính xác.</span></h3>\n<h3><span style=\"font-size:14px;\">Giúp giữ lại bụi và nước, tránh bị rơi ra sàn xe,&nbsp;chống thấm nước dễ vệ sinh, không bị rạn nứt, dẻo dai bền đẹp, không bị biến dạng do thời tiết, không bị biến dạng do cuộn gấp.</span></h3>\n<h3><span style=\"font-size:14px;\">Độ bền sử dụng lên đến trên 3 năm, không trầy xước, không bạc màu.</span></h3>\n<h3><span style=\"font-size:14px;\">Bộ lót sàn xe ô tô – sự đầu tư hợp lý để bảo vệ chiếc xe và đem lại an toàn cho gia đình bạn.</span></h3>\n<p><span style=\"font-size:14px;\">Mặt dưới là các gai nhựa chống trơn, chống xê&nbsp;dịch.</span></p>\n<p>Chia làm 2 phân loại: 3 mảnh và 4 mảnh&nbsp;</p>\n<p><span style=\"font-size: 14px;\">Để đảm bảo lắp vừa xe khách hàng vui lòng xem lại kích thước để lắp đặt phù hợp cho xe nhất.</span></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-san-o-to-2.jpg?v=1561535508372\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-san-pvc-v5.jpg?v=1619254921916\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-san-pvc-v9.jpg?v=1619255195618\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-san-o-to-5.jpg?v=1561535541750\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-san-pvc-v6.jpg?v=1619255028746\" /></p>', '', 'Thảm lót sàn ô tô', 'ô tô, phụ  kiện ô tô, thảm lót sàn, Thảm lót sàn ô tô  3 mảnh PVC đúc cao cấp, thảm nhựa dẻo lót sàn, Thảm trải sàn ô tô, Volcano, volcano.vn', '1', 'Phân loại', '3 Mảnh', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/14917209/tham-lot-san-o-to-3-manh-pvc-cao-cap.jpg', '<h3><span style=\"font-size:14px;\">Giúp giữ lại bụi và nước, tránh bị rơi ra sàn xe,&nbsp;<b><i>c</i></b>hống thấm nước dễ vệ sinh, không bị rạn nứt, dẻo dai bền đẹp, không bị biến dạng do thờ', '14917209', '25578334', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:20', '2024-05-29 06:12:20'),
(1351, 'am-dun-nuoc-tren-o-to-24v-250w-sm-408', 'Ấm đun nước 1000ml trên xe ô tô 12/24V-250W SM-408', '<p><em><strong>Ấm đun nước 1000ml trên xe ô tô 12/24V-250W SM-408</strong></em></p>\n<p>Bạn hoàn toàn&nbsp;có thể đun nước sôi, pha mì, luộc trứng, pha cà phê, pha sữa cho trẻ… ngay trên xe xe ô tô một cách tiện lợi và an toàn với&nbsp;Ấm đun nước 1000ml.&nbsp;Sản phẩm sử dụng điện&nbsp; 12V,&nbsp;24V rất phổ thông trên&nbsp;xe tải rất cần thiết cho các Bác Tài chạy đường dài, có cầu chì bảo vệ ở đầu tẩu, cực kì an toàn.</p>\n<p>Chất liệu nhựa và inox 304 siêu bền bỉ và đặc biệt an toàn cho người dùng, nhựa chống nóng chống chảy, chống ra mùi nhưa nước sôi 100 độ.</p>\n<p>Sử dụng đơn giản ấm tự động nhảy công tắc khi nước sôi 100 độ .</p>\n<p>Dung tích đến 1000ml nước.</p>\n<p>Kích thước: 135*185*150mm.</p>\n<p>Điện áp, 12V, 24V</p>\n<p>Công xuất 250W</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-dung-nuoc-tren-o-to-1000ml-3.jpg?v=1561023199195\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-dung-nuoc-tren-o-to-1000ml-4.jpg?v=1561023206895\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-dung-nuoc-tren-o-to-1000ml-5.jpg?v=1561023214070\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-dung-nuoc-tren-o-to-1000ml-2.jpg?v=1561023226643\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-dung-nuoc-tren-o-to-1000ml-6.jpg?v=1561023232879\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" origina