(1352, 'o-cam-chan-tau-o-to-xe-may-12v-120w', 'Ổ cắm chân tẩu ô tô xe máy 12V-120W', '<p><em><strong>Ổ cắm chân tẩu ô tô xe máy 12V-120W</strong></em></p>\n<p>Ổ cắm nguồn chân tẩu (ổ cái) sử dụng được cho cả ô tô và xe máy điện 12V, công&nbsp;suất làm việc đến 120W&nbsp; phù hợp sử dụng hầu hết tất cả các thiết bị điện trên ô tô và xe máy như máy đánh bóng, mấy hút bụi, quạt, tủ lạnh,...</p>\n<p>Chất liệu kim loại kết hợp nắp và vỏ nhựa chống thấm nước.Dây dẫn dài có cầu chì bảo vệ thiết bị.</p>\n<p>Lắp đặt đơn giản đấu trực tiếp 2 cực của điện bình ắc quy tương ứng chân màu vàng đồng là cực dương dây đỏ, chân trắng bạc là cực âm dây đen.</p>\n<p>Điệp áp: 12V</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-3.jpg?v=1560934285805\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-6.jpg?v=1560935061467\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-8.jpg?v=1560936417341\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-5.jpg?v=1560935075021\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-7.jpg?v=1560935089869\" /></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-4.jpg?v=1560934291614\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-1.jpg?v=1560934298457\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/o-cam-chan-tau-cho-o-to-xe-may-12v-120w-2.jpg?v=1560934304630\" /></strong></em></p>', '', 'Ổ cắm chân tẩu', 'Chân tẩu ô tô, nguồn chân tẩu ô tô, ổ cắm chân tẩu ô tô, Ổ cắm chân tẩu ô tô xe máy 12V-120W, ô tô, phụ  kiện ô tô, phụ kiện xe máy, tẩu xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '96000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/14839102/o-cam-chan-tau-o-to-xe-may-12v-120w.jpg', '<p>Ổ cắm nguồn chân tẩu (ổ cái) sử dụng được cho cả ô tô và xe máy điện 12V, công&nbsp;suất làm việc đến 120W&nbsp; phù hợp sử dụng hầu hết tất cả các thiết bị điện trên ô tô và xe máy như má', '14839102', '25383938', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:20', '2024-05-29 06:12:20'),
(1353, 'moi-nhai-nhay-cau-lure-ca-loc-nhua-abs-co-bi-trong', 'Mồi nhái nhảy câu lure cá lóc nhựa ABS có bi trong', '<p><em><strong>Mồi nhái nhảy câu lure cá lóc nhựa ABS có bi trong</strong></em></p>\n<p>Mồi nhái nhảy&nbsp;được nhiều cần thủ ưa chuộng vì body chuẩn thon gọn, Action rung lắc rất tốt, thu hút cá lóc chú ý tới. Đánh ở địa hình cỏ và bèo tàn rất là tốt chống mắc chống vướng.</p>\n<p>Sử dụng để câu cá lóc rất hiệu quả, ở các địa hình cỏ và bèo thiên nhiên, khi cần thủ sử dụng nhái nhảy nhờ có bi trong&nbsp;sẽ tạo ra tiếng khi động di chuyển trên mặt nước thu hút cá cực tốt.</p>\n<p>Chất liệu nhựa ABS có&nbsp;độ bền cao chắc chắn, phần lưỡi sử dụng&nbsp;lưỡi đôi chống vướng tốt.</p>\n<p>Kích thước: thân 5.5cm, cả phần đuôi 9cm, trọng lượng 9G</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-nhay-cau-lure-3.jpg?v=1560419572662\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-nhay-cau-lure-4.jpg?v=1560419580064\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-nhay-cau-lure-2.jpg?v=1560419595059\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-nhay-cau-lure-1.jpg?v=1560419602566\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Mồi giả', 'mồi câu cá lóc, mồi nhái nhảy, Mồi nhái nhảy câu lure cá lóc nhựa ABS có bi trong, nhái nhảy], Volcano, volcano.vn', '1', 'Màu sắc', 'Hồng', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/14799608/moi-nhai-nhay-cau-lure-ca-loc-nhua-abs-co-bi-trong.jpg', '<p>Mồi nhái nhảy&nbsp;được nhiều cần thủ ưa chuộng vì body chuẩn thon gọn, Action rung lắc rất tốt, thu hút cá lóc chú ý tới. Đánh ở địa hình cỏ và bèo tàn rất là tốt chống mắc chống vướng.</', '14799608', '25297834', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:21', '2024-05-29 06:12:21');
