(1354, 'thung-dung-do-gan-duoi-xe-may-gsb', 'Thùng đựng đồ gắn đuôi xe máy GSB', '<p><em><strong>Thùng đựng đồ gắn đuôi xe máy GSB&nbsp;</strong></em></p>\n<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn không thiết kế cốp xe, hay dòng cốp nhỏ.</p>\n<p>&nbsp;Có thể đựng được nón bảo hiểm và phụ kiện&nbsp;rất tiện dụng cho những cuộc đi chơi, đi phượt.</p>\n<p>&nbsp;Dung tích lớn chứa&nbsp;được nhiểu đồ như, nón bảo hiểm,&nbsp;giày, balo, túi xách, áo mưa, quần áo...với&nbsp;khóa an toàn không lo cướp giật.</p>\n<p>Thùng chống nước hoàn toàn, không sợ mưa làm ướt đồ.Thùng lắp được đa&nbsp;trên mọi loại xe có phần đuôi kiểu giá rộng.</p>\n<p>Thao tác đóng mở thùng cũng như tháo thùng ra khỏi xe khi không cần dùng tới chỉ trong vòng 1 nốt nhạc.&nbsp;</p>\n<p>Chất liệu nhựa ABS siêu bền, dán viền phản quang&nbsp;đẹp mắt.</p>\n<p>Bộ sản phẩm có kèm đế,&nbsp;thanh ngang, ốc lắp&nbsp;đặt đơn giản lên khung đuôi xe.</p>\n<p>Màu sắc: Đen.</p>\n<p>Kích thước: 26*34*26CM</p>\n<p>Lắp đặt cho các dòng xe có phần đuôi sau dài và bằng, các xe không có đuôi bằng và dài cần chế hoặc lắp thêm gá để lắp đặt.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-3.jpg?v=1560401654860\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-1.jpg?v=1560401661004\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-2.jpg?v=1560401677800\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-4.jpg?v=1560401683966\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-8.jpg?v=1566355008551\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-7.jpg?v=1566355021049\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-do-gsb1.jpg?v=1615776770479\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/thung-dung-dog-gan-duoi-xe-may-gsb-9.jpg?v=1566355215192\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Thùng đựng đồ xe máy', 'phụ kiện xe máy, thùng đựng đồ, thùng đựng đồ xe máy, thùng đựng đù gắn đuôi xe máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '8', 'kg', 'images/14795495/thung-dung-do-gan-duoi-xe-may-gsb.jpg', '<p>Thùng đựng đồ xe máy người bạn đồng hành không thể thiếu cho những cuộc hành trình dài, một mình hoặc với bạn đồng hành đặc biệt những dòng xe phân khối lớn không thiết kế cốp xe, hay dòng', '14795495', '25290436', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:21', '2024-05-29 06:12:21'),
(1355, 'decal-3d-dan-trang-tri-kinh-mu-bao-hiem', 'Decal 3D dán trang trí kính mũ bảo hiểm', '<p><em><strong>Decal 3D dán trang trí kính mũ bảo hiểm</strong></em></p>\n<p>Mũ bảo hiểm luôn là món phụ kiện không được thiếu môi khi điều khiển xe khi tam gia giao thông! Hãy làm mới chiếc mũ bảo hiểm của mình thật phong cách với decal 3D dán trang trí kính.</p>\n<p>Decal dán dạng lưới mắt tròn không ảnh hưởng đến tầm quan xát sau khi dán lên kính, hình 3D đẹp mắt với 2 mẫu đầu lâu KT01 và mẫu đôi mắt KT05.</p>\n<p>Kích thước: 35.5*13cm, phù hợp dán nhiều loại mũ bảo hiểm.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-6.jpg?v=1560239698271\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-8.jpg?v=1560239706924\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-2.jpg?v=1560239713854\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-4.jpg?v=1560239721019\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-3.jpg?v=1560239727902\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dau-lau-dan-kinh-mu-bao-hiem-1.jpg?v=1560239765124\" /></strong></em></p>', '', 'Decal 3d dán xe', 'decal 3d, Decal 3D dán trang trí kính mũ bảo hiểm, decal dán kính mũ bảo hiểm, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Loại', 'KT01', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/14781463/decal-3d-dan-trang-tri-kinh-mu-bao-hiem.jpg', '<p>Mũ bảo hiểm luôn là món phụ kiện không được thiếu môi khi điều khiển xe khi tam gia giao thông! Hãy làm mới chiếc mũ bảo hiểm của mình thật phong cách với decal 3D dán trang trí kính.</p>\n', '14781463', '25261306', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:21', '2024-05-29 06:12:21'),
(1356, 'moi-mem-dau-boc-chi-cau-lure', 'Mồi mềm đầu bọc chì câu lure', '<p><em><strong>Mồi mềm đầu bọc chì câu lure</strong></em></p>\n<p>Mồi mềm giả chuyên lure nhiều loại săn mồi như các lóc, chẽm...cới body chuẩn action đẹp thu thút cá cực tốt.</p>\n<p>Phần đầu gắn&nbsp;lưới&nbsp;câu được bọc chì, lưỡi câu làm từ thép&nbsp;không gỉ.</p>\n<p>Chất liệu nhựa dẻo PVC</p>\n<p>Phân loại kích:&nbsp;10.5CM-15.5G và&nbsp;13CM-26G</p>\n<p>Màu sắc: vàng, trắng bên trong có các hạt kim ánh tạo lên hiệu úng màu sắc trong nước.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-mem-boc-dau-cau-lure-3.jpg?v=1559187637429\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-mem-boc-dau-cau-lure-1.jpg?v=1559187644193\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-mem-boc-dau-cau-lure-2.jpg?v=1559187652816\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-mem-boc-dau-cau-lure-4.jpg?v=1559188126462\" /></strong></em></p>', '', 'Mồi mềm', 'mồi câu cá, mồi câu luer, mồi mềm, mồi mềm câu cá, Volcano, volcano.vn', '1', 'Kích thước', '10.5CM-15.5G', 'Màu sắc', 'Vàng', '', '', '', '', '', 'deny', '', '40000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/14667130/moi-mem-dau-boc-chi-cau-lure.jpg', '<p>Mồi mềm giả chuyên lure nhiều loại săn mồi như các lóc, chẽm...cới body chuẩn action đẹp thu thút cá cực tốt.</p>\n<p>Phần đầu gắn&nbsp;lưới&nbsp;câu được bọc chì, lưỡi câu làm từ thép&nbsp', '14667130', '25030916', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:21', '2024-