(1358, 'lip-xe-dap-8-tang-bang-rang-24-cap-do', 'Líp Xe Đạp 8 Tầng Báng Răng 24 cấp độ', '<p><em><strong>Líp Xe Đạp 8 Tầng Báng Răng 24 cấp độ</strong></em></p>\n<p>Líp xe đạp 8 tằng chuyên thay thế lắp đặt cho các loại xe đạp thể thao, xe địa hình.</p>\n<p>Làm từ chất théo cao cấp không gỉ sét, chia làm 8 cấp tầng với số răng khác nhau 24 cấp độ, số bánh răng: 13/14/15/17/19/21/24/28</p>\n<p>Lắp đặt thay thế đơn giản.</p>\n<p>Kích thước: 11.5*4CM, chân ren 35MM, đường kính trục 25MM.</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v6-09f629fa-d726-45aa-9b1e-de84498b3a90.jpg?v=1619240585119\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v8.jpg?v=1619247291910\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v9-34eaa0c6-32b7-41f7-a86d-781c448101f8.jpg?v=1619247395315\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v10.jpg?v=1619247404723\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v4.jpg?v=1619246276780\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v3.jpg?v=1619246265960\" /></p>\n<p><img data-thumb=\"original\" original-height=\"720\" original-width=\"720\" src=\"//bizweb.dktcdn.net/100/200/904/files/lip-xe-dap-7-tang-v5.jpg?v=1619246297347\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Líp xe đạp', 'líp xe 8 tầng, líp xe cao cấp, lip xe đạp, líp xe đạp 8 tâng, phụ tùng xe đạp, Volcano,