(1362, 'phanh-dia-xe-dap-bolids-bb2', 'Phanh Đĩa Xe Đạp BOLIDS F-160/R140/8', '<p><em><strong>Phanh Đĩa Xe Đạp BOLIDS F-160/R140/8</strong></em></p>\n<p>Sản phẩm chuyên sử dụng thay thế cho phanh xe cũ, thay thế được cho tất cả dòng xe đạp thể thẩ thao có sử dụng phanh đĩa cơ.</p>\n<p>Có thể thay thế cụm phanh trước hoặc sau. Thay thế đơn giản nhanh gọn.</p>\n<p>Chất liệu kim loại chắc chắn phủ sơn đen chống han gỉ.</p>\n<p>Bộ sản phẩm gồm 01 cụm phanh.</p>\n<p>Thông số:&nbsp;F-160/R140/8</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/phanh-dia-ze-dap-bolids-v9.jpg?v=1622880073961\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-dia-dia-xe-dap-2.jpg?v=1557820080134\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-dia-dia-xe-dap-5.jpg?v=1557820092596\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-dia-dia-xe-dap-6.jpg?v=1557820100630\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-dia-dia-xe-dap-3.jpg?v=1557820109447\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cum-phanh-dia-dia-xe-dap-4.jpg?v=1557820116060\" /></strong></em></p>', '', 'Phanh đĩa xe đạp', 'phanh đĩa ce đạp, phanh xe đạp, phụ tùng xe đạp, Volcano, volcano.vn, XE ĐẠP', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/14506908/phanh-dia-xe-d