(1363, 'tui-deo-cheo-the-thao-du-lich-ca-tinh', 'Túi đeo chéo thể thao du lịch cá tính', '<p><strong><em>Túi đeo chéo thể thao du lịch cá tính&nbsp;</em></strong></p>\n<p>Túi đeo chéo với chất liệu vải bố lót dù và mút mềm mại chống thấm nước.</p>\n<p>Chuyền dùng&nbsp;đi chơi,&nbsp;đi làm, du lịch, dã ngoại, ...thích hợp cho cả Nam và Nữ.</p>\n<p>Kích thước không quá lớn nhưng vừa đủ để bạn chứa tất cả những vật dụng cần thiết tiện lợi khi đi du lịch, chơi thể thao, đi học, đi làm… Những ngăn nhỏ giúp bạn thỏa mái để những vật nhỏ như chìa khóa, cart, thẻ ATM…Thiết kế thêm 01 túi bên cạnh chuyện dụng đựng chai nước, ô dù.</p>\n<p>Từng chi tiết trên túi được trau chuốt tỉ mỉ, từ đường chỉ đều tay, chắc chắn, đến các khóa kéo kim loại. Để giúp luôn tự tin thoải mái mang theo bên mình mà không phải lo ngại việc bung đứt.</p>\n<p>Kích thước túi: 27*18*7CM.</p>\n<p>Màu sắc: Đỏ, xanh, ghi đen.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-8.jpg?v=1557386414831\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-2.jpg?v=1557386424307\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-3.jpg?v=1557386431870\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-4.jpg?v=1557386438978\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-6.jpg?v=1557386447687\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-7.jpg?v=1557386453925\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-9.jp