(1364, 'tui-deo-cheo-nam-cao-cap-co-cong-sac-usb-junlettu', 'Túi đeo chéo Nam cao cấp có cổng sạc USB Junlettu', '<p><em><strong>Túi đeo chéo Nam cao cấp có cổng sạc USB Junlettu</strong></em></p>\n<p>Thiết kế trẻ trung năng&nbsp;động.</p>\n<p>Thể tích túi rộng, có thể&nbsp;để&nbsp;được máy tính bảng, ví , điện thoại...</p>\n<p>Được tích hợp cổng sạc USB ngoài&nbsp;thuận tiện cho việc sạc&nbsp;điện thoại</p>\n<p>Được thiết kế 4 ngăn&nbsp;để&nbsp;đồ tiện lợi chống thấm nước.</p>\n<p>Dây kéo kim loại chắc chắn. Chất liệu vải Oxford cao cấp với lớp vải thoát hơi nhanh chóng.</p>\n<p>Màu sắc: Xanh than, ghi, đen.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-3.jpg?v=1557368378980\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-v19.jpg?v=1557369405945\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-6.jpg?v=1557368694427\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-7.jpg?v=1557368701934\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-5.jpg?v=1557368712459\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-2.jpg?v=1557368720038\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-1.jpg?v=1557368726137\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tui-deo-cheo-junletu-8.jpg?v=1557368734023\" /></p><iframe width=\"100%\" h