(1366, 'quat-chan-kep-xoay-360-chuyen-dung-cho-o-to', 'Quạt chân kẹp xoay 360 chuyên dụng cho ô tô', '<p><em><strong>Quạt chân kẹp xoay 360 chuyên dụng cho ô tô&nbsp;</strong></em></p>\n<p>Tất cả các tài xế xe tải , xe khách, xe buýt, tắc xi, xe công ten nơ, xe téc, xe cần cẩu, xe xúc ủi, xe lu, ... đều phải làm việc trong môi trường nóng bức, vì hơi nóng của động cơ tỏa ra, nhất là về mùa hè nóng nực, trong thời gian dài làm ảnh hưởng rất nhiều đến sức khỏe.</p>\n<p>Quạt chân kẹp xoay 360 có kẹp an toàn, tiện lợi, thiết kế nhỏ gọn, có thể mang theo bất ở bất cứ đâu.<br />\nĐường kính lồng quạt 27.5CM, Có thể điều chỉnh hướng quạt 360 độ.<br />\nSử dụng tiện lợi bằng tẩu&nbsp;điện 12V, 24V&nbsp;cắm trên ô tô.<br />\nMàu sắc : Đen chất liệu hợp kim có phủ lớp tĩnh điện<br />\nQuạt chia làm 2 loại: 12V và&nbsp;&nbsp;24V thích hợp cho xe tải, tắc xi.cẩu, xe khách, xe công ten nơ, xe téc, xe buýt, xe lu v.v..</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-kep-o-to-1.jpg?v=1556767630788\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-chan-kep-2-4d340eb6-417b-4c04-bbbd-fa97d9afc1a3.jpg?v=1644372338313\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-kep-o-to-4.jpg?v=1556767641970\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-kep-o-to-2.jpg?v=1556767650845\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-kep-o-to-5.jpg?v=1556767658495\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/quat-kep-o-to-v4.jpg?v=1556767664814\" /></p>', '', 'Quạt chân kẹp ô tô', 'ô tô, phụ  kiện ô tô, Quạt chân kẹp xoay 360 chuyên dụng cho ô tô, quạt kẹp ô tô, quạt kẹp trên ô tô, quạt ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Điện áp', '12V', '', '', '', '', '0', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/14408086/quat-chan-kep-xoay-360-chuyen-dung-cho-o-to.jpg', '<p>Quạt chân kẹp xoay 360 có kẹp an toàn, tiện lợi, thiết kế nhỏ gọn, có thể mang theo bất ở bất cứ đâu.<br />\nĐường kính lồng quạt 27.5CM, Có thể điều chỉnh hướng quạt 360 độ.<br />\nSử dụng ', '14408086', '24493848', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:22', '2024-05-29 06:12:22'),
(1367, 'tham-lot-ghe-truoc-o-to-cao-cap', 'Thảm lót ghế ô tô cao cấp', '<p><em><strong>Thảm lót ghế ô tô cao cấp</strong></em></p>\n<p>Khi ngồi trên ô tô, đặc biệt là người lái xe rất hay bị nóng&nbsp;kể cả đã bật điều hòa, chính vì vậy mọi người thường hay dùng tấm lót ngế sợi đan cao cấp thoáng mát, chống trơn trượt.</p>\n<p>Thảm lót ghế ô tô bắt chất liệu sợi lụa đan 3 chiều, viền xung quanh là da PU cao cấp&nbsp;Sẽ tạo cảm giác thoải mái, dễ chịu nhất cho bạn khi ngồi trên ô tô.</p>\n<p>Sản phẩm cực kỳ hữu ích đối với các tài xế phải thường xuyên di chuyển trên một quãng đường dài. Thêm vào đó việc phối hợp màu sắc của bộ lót ghế ô tô&nbsp;tạo nên sự sang trọng cho nội thất cho xe hơi của bạn.</p>\n<p>Bề mặt bên dưới chống trơn, bám bề mặt tốt giúp thảm không bị xê dịch khi ngồi. Phía trước có thêm 1 túi nhỏ đựng đồ tiện dụng.</p>\n<p>Kích thước: Ghế trước 48*49CM. dải ghế sau: 134*50CM.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-1.jpg?v=1556435119935\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-2.jpg?v=1556435146109\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-3.jpg?v=1556435153658\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-4.jpg?v=1556435231156\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-ghe-1-1c2218ea-0d29-4967-8639-ba4ce863527c.jpg?v=1692607373282\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-ghe-2-0667a701-0e91-4342-95f5-465058450827.jpg?v=1692607374634\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-ghe-v11-7fac5f7a-0cf8-4cd1-9b49-eba7a893def6.jpg?v=1692607376030\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lot-ghe-v12-9fbd1848-c19b-4359-8897-d11743124390.jpg?v=1692607377414\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-6.jpg?v=1556435241573\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-ghe-truoc-o-to-7.jpg?v=1556435248490\" /></p>', '', 'Thảm lót xe ô tô', 'ô tô, phụ  kiện ô tô, tấm lót ghế ô tô, thảm lót ghế ô tô, thảm lót ghế trước, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Nâu', 'Loại', '01 ghế trước', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/14392968/tham-lot-ghe-truoc-o-to-cao-cap.jpg', '<p>Sản phẩm cực kỳ hữu ích đối với các tài xế phải thường xuyên di chuyển trên một quãng đường dài. Thêm vào đó việc phối hợp màu sắc của bộ lót ghế ô tô&nbsp;tạo nên sự sang trọng cho nội th', '14392968', '83075475', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:23', '2024-05-29 06:12:23'),
(1368, 'luoi-lam-gian-leo-cho-dua-leo-dua-chuot', 'Lưới làm giàn leo cho cây trồng thân leo (dưa leo, bầu bí, mướp, khổ qua...)', '<p><em><strong>Lưới làm giàn leo cho </strong></em><b>cây trồng thân leo (</b><em><strong>dưa leo,&nbsp;</strong></em><b>bầu bí, mướp, khổ qua...)</b></p>\n<p>Đối với những cây trồng thân leo họ bầu bí, mướp, dưa leo, khổ qua, hoa thiên lý... thì vào giai đoạn cây phát triển các tua nhánh cũng là lúc chúng ta cần tiến hành làm giàn cho cây leo. Dù trồng ở ruộng hay trồng tại nhà, trên sân thượng thì vẫn có thể làm được những giàn leo cố định và chắc chắn để cây leo thuận tiện và cũng làm mục đích giúp cây cho năng suất cao.</p>\n<p>Cách sử dụng:</p>\n<p>Cố định các cọc tre xuống đất tạo khung sườn cho của giàn như hình chữ A và Liên kết khung sườn giàn lại với nhau.</p>\n<p>Dùng&nbsp;tấm lưới vắt lên xà ngang bên trên khung sườn của giàn, kéo căng và trải lưới giàn đều nhau, sau đó cố định lưới bằng cách dùng dây cước buộc vào khung sườn của giàn.</p>\n<p>Phân loại lưới: lưới kết 3 sợi cao 2m dài 100m,&nbsp;lưới kết 6 sợi cao 2m dài 100m.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-7.jpg?v=1556264558047\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-11jpg.jpg?v=1556264567545\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-4.jpg?v=1556264574303\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-6.jpg?v=1556264583339\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-11jpg-0a2640e0-7c31-497f-8012-85e267af4fd3.jpg?v=1556264596237\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-2.jpg?v=1556265283026\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-trong-cay-leo-1.jpg?v=1556265290210\" /></p>', '', 'Lưới làm giàn leo', 'bầu bí, khổ qua...), lưới làm giàn, lưới làm giàn leo, Lưới làm giàn leo cho cây trồng thân leo (dưa leo, lưới trồng cây, mướp, Volcano, volcano.vn', '1', 'Phân loại', '3 sợi cao 2m dài 100m', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '0.4', 'kg', 'images/14382295/luoi-lam-gian-leo-cho-dua-leo-dua-chuot.jpg', '<p>.Đối với những cây trồng thân leo họ bầu bí, mướp, dưa leo, khổ qua, hoa thiên lý... thì vào giai đoạn cây phát triển các tua nhánh cũng là lúc chúng ta cần tiến hành làm giàn cho cây leo.', '14382295', '24444080', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:24', '2024-05-29 06:12:24'),
(1369, 'bo-04-chan-bun-xe-o-to-toyota-innova-2009-2015', 'Bộ 04 Chắn bùn xe ô tô Toyota Innova', '<p><em><strong>Bộ 04 chắn bùn xe ô tô Toyota Innova</strong></em></p>\n<p>Với thời tiết ở Việt Nam mưa khá nhiều khi đi xe ô to&nbsp;chạy gây văng nước, bùn, cát sỏi...&nbsp;ra sau, làm ảnh hưởng đến những xe chạy sau và cũng làm bẩn các bộ phận khác của xe.&nbsp;</p>\n<p>Sản phẩm làm bằng chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Toyota Innova 2009-2015,&nbsp;Toyota Innova 2016-2019.</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm cho chiếc xe của bạn&nbsp;trông cá tính, mạnh mẽ hơn nhiều.</p>\n<p>Lưu ý: Khách hàng lựa chọn đúng đời vì mỗi đời xe có mẫu khác nhau.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-2.jpg?v=1554793023569\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-3.jpg?v=1554793030779\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-inova-3.jpg?v=1670054523703\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-1.jpg?v=1554793037477\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-4.jpg?v=1554793044016\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bung-o-to-innova-5.jpg?v=1554793051585\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-xe-o-to-vios-4-113c7ff1-ce13-46ed-88e1-b7a33a05542e.jpg?v=1554793102953\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-xe-o-to-vios-5-7ae9bc43-c637-410f-8d87-4e57e9fc28c1.jpg?v=1554793110894\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-xe-o-to-vios-v1-575e81af-3ee9-4f26-abc7-76797e1c6ff2.jpg?v=1554793117745\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-04-chan-bun-xe-o-to-vios-v2-3a400525-0ab7-40ba-9d4b-3c29328ade08.jpg?v=1554793124980\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-inova-1.jpg?v=1670054537531\" /></p>', '', 'Chắn bùn xe ô rô', 'Bộ 04 Chắn bùn xe ô tô Toyota Innova, Bộ 04 Chắn bùn xe ô tô Toyota Innova 2009-2015, bộ chắn bùn inova, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Đời xe', '2009-2015', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/14237207/bo-04-chan-bun-xe-o-to-toyota-innova-2009-2015.jpg', '<p>Sản phẩm làm bằng chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Toyota Innova 2009-2015,&nbsp;Toyota Innova 2016-2019.</p>\n<p>Tự lắp đặt đơn giản nha', '14237207', '24092119', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:24', '2024-05-29 06:12:24');
