(1370, 'duoi-gio-canh-luot-gio-xe-o-to-mazda-3-2014-2018', 'Đuôi gió - cánh lướt gió xe ô tô Mazda 3 2014-2018', '<p><strong><em>Đuôi gió - cánh lướt gió xe ô tô Mazda 3 2014-2018</em></strong></p>\n<p>Đuôi gió&nbsp;xe ô tô&nbsp;là một trong những phụ kiện được giới chơi xe vô cùng ưa chuộng. Ngoài chức năng trang trí, sản phẩm còn mang đến nhiều công dụng khác nhau cho người sử dụng: điều hướng gió, giúp xe bám đường hơn, tiết kiệm nhiên liệu...góp phần tăng tính thẩm mỹ, tạo điểm nhấn nổi bật ở phần sau xe.</p>\n<p dir=\"ltr\">Sản phẩm được làm từ chất liệu nhựa ABS cao cấp, độ bền cao, màu đen bóng nổi bật&nbsp;không bị han gỉ hay rạn nứt trong thời gian sử dụng.</p>\n<p dir=\"ltr\">Đuôi gió - cánh&nbsp;gió được thiết kế riếng&nbsp;theo xe&nbsp;<strong><em>Mazda 3 2014-2018</em></strong>&nbsp;ôm vừa khít và hài hòa với mọi chi tiết của xe.</p>\n<p dir=\"ltr\">Giúp xe di chuyển nhanh và ổn định hơn trên mọi cung đường.</p>\n<p dir=\"ltr\">Tăng khả năng bám đường, tiết kiệm nhiên liệu hiệu quả.</p>\n<p dir=\"ltr\">&nbsp;Lắp đặt đơn giản, nhanh chóng, không tốn nhiều thời gian, sản phẩm được&nbsp;tặng kèm băng dính 3M.</p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-3.jpg?v=1562839664597\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-2.jpg?v=1562839678045\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-1.jpg?v=1562839695215\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-4.jpg?v=1562839707849\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-v3.jpg?v=1562839720580\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-5.jpg?v=1562839825006\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-o-to-mazda-3-2.jpg?v=1553936763046\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-o-to-mazda-3-1.jpg?v=1553936768912\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-gio-mazda-3-7.jpg?v=1562839907955\" /></p>', '', 'Đuôi gió ô tô', 'cánh gió ô tô, Đuôi gió - cánh lướt gió xe ô tô Mazda 3, đuôi gió ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '520000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/14163077/duoi-gio-canh-luot-gio-xe-o-to-mazda-3-2014-2018.jpg', '<p dir=\"ltr\">Sản phẩm được làm từ chất liệu nhựa ABS cao cấp, độ bền cao, màu đen bóng nổi bật&nbsp;không bị han gỉ hay rạn nứt trong thời gian sử dụng.</p>\n\n<p dir=\"ltr\">Đuôi gió - cánh&nbsp', '14163077', '23922003', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:24', '2024-05-29 06:12:24'),
(1371, 'duoi-gio-canh-gio-xe-o-to-chevrolet-cruze-2017-2019', 'Đuôi gió-cánh lướt gió xe ô tô Chevrolet Cruze 2017-2019 (chiều chài 110.5cm)', '<p><em><strong>Đuôi gió-cánh lướt gió xe ô tô Chevrolet Cruze 2017-2019 (chiều chài 110.5cm)</strong></em></p>\n<p>Đuôi gió&nbsp;xe ô tô&nbsp;là một trong những phụ kiện được giới chơi xe vô cùng ưa chuộng. Ngoài chức năng trang trí, sản phẩm còn mang đến nhiều công dụng khác nhau cho người sử dụng: điều hướng gió, giúp xe bám đường hơn, tiết kiệm nhiên liệu...góp phần tăng tính thẩm mỹ, tạo điểm nhấn nổi bật ở phần sau xe.</p>\n<p dir=\"ltr\">Sản phẩm được làm từ chất liệu nhựa cao cấp, độ bền cao, không bị han gỉ hay rạn nứt trong thời gian sử dụng.</p>\n<p dir=\"ltr\">Đuôi gió - cánh&nbsp;gió được thiết kế riếng&nbsp;theo xe Chevrolet Cruze 2017-2019 có chiều dài 110.5cm&nbsp;ôm vừa khít và hài hòa với mọi chi tiết của xe.</p>\n<p dir=\"ltr\">Giúp xe di chuyển nhanh và ổn định hơn trên mọi cung đường.</p>\n<p dir=\"ltr\">Tăng khả năng bám đường, tiết kiệm nhiên liệu hiệu quả.</p>\n<p dir=\"ltr\">&nbsp;Lắp đặt đơn giản, nhanh chóng, không tốn nhiều thời gian, sản phẩm được&nbsp;tặng kèm băng dính 3M.</p>\n<p dir=\"ltr\">Lưu ý: đo chiều dài đuôi xe trước lên đơn hàng!</p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-1.jpg?v=1553767640991\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-5.jpg?v=1553767651385\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-2.jpg?v=1553767658127\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-3.jpg?v=1553767664957\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-1.jpg?v=1557308602537\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-2.jpg?v=1557308609369\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-3.jpg?v=1557308617828\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-6.jpg?v=1557308632678\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-5.jpg?v=1557308643307\" /></p>\n<p dir=\"ltr\"><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/duoi-xe-o-to-cheverlet-clure-trang-7.jpg?v=1614851951500\" /></p>', '', 'Đuôi gió ô tô', 'cánh gió ô tô, đuôi gió ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '520000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/14101120/duoi-gio-canh-gio-xe-o-to-chevrolet-cruze-2017-2019.jpg', '<p><em><strong>Đuôi gió&nbsp;xe ô tô</strong></em>&nbsp;là một trong những phụ kiện được giới chơi xe vô cùng ưa chuộng. Ngoài chức năng trang trí, sản phẩm còn mang đến nhiều công dụng khác ', '14101120', '23853563', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:24', '2024-05-29 06:12:24'),
(1372, 've-che-mua-cho-xe-o-to-hyundai-grand-i10', 'Vè che mưa cho xe ô tô Hyundai Grand i10', '<p><em><strong>Vè che mưa cho xe ô tô Hyundai Grand i10</strong></em></p>\n<p>Vè che mưa&nbsp;phụ kiện rất cần thiết đối với ô tô, không những làm đẹp cho chiếc xe biến chiếc xe trở nên sang trọng mà còn giúp bạn có thể mở hé cửa kính trong khi trời mưa để lưu thông không khí mà không để nước mưa bắn vào trong xe.</p>\n<p>Không chỉ giúp bảo vệ khung viền kính cho chiếc xe mà&nbsp;Vè che mưa&nbsp;Hyundai Grand i10&nbsp;còn tạo được điểm nhấn cho chiếc xe nhờ màu sơn đen bóng và in logo i10&nbsp;rất&nbsp;nổi bật.</p>\n<p>Sản phẩm làm từ chất liệu Acrylic cao cấp&nbsp;bền bỉ, màu sơn sáng bóng đẹp,&nbsp;có tính đàn hồi, chịu được nhiệt độ cao&nbsp;là một trong những phụ kiện không thể thiếu của&nbsp;Hyundai Grand i10.</p>\n<p>Chiều dài cửa trước 97.5cm.</p>\n<p>Bộ sản phẩm gồm bộ 04 vè cho đủ 4 cánh cửa xe.</p>\n<p>Lưu ý: Vui lòng đo chiều dài cửa xe trước khi đặt hàng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-3.jpg?v=1553677259223\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-2.jpg?v=1553677267293\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-1.jpg?v=1553677276532\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-8.jpg?v=1553677565198\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-5.jpg?v=1553677572966\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-cho-xe-o-to-i10-6.jpg?v=1553677581003\" /></p>', '', 'Vè che mưa cho xe ô tô', 'Hyundai Grand i10, ô tô, phụ  kiện ô tô, vè che mưa, Vè che mưa cho xe ô tô, Vè che mưa cho xe ô tô Hyundai Grand i10, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '4', 'kg', 'images/14090070/ve-che-mua-cho-xe-o-to-hyundai-grand-i10.jpg', '<p>Không chỉ giúp bảo vệ khung viền kính cho chiếc xe mà&nbsp;Vè che mưa&nbsp;Hyundai Grand i10&nbsp;còn tạo được điểm nhấn cho chiếc xe nhờ màu sơn đen bóng và in logo i10&nbsp;rất&nbsp;nổi ', '14090070', '23823832', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:24', '2024-05-29 06:12:24'),
(1373, 've-che-mua-cho-xe-o-to-toyota-vios', 'Vè che mưa cho xe ô tô Toyota Vios', '<p><em><strong>Vè che mưa cho xe ô tô Toyota Vios</strong></em></p>\n<p>Vè che mưa&nbsp;phụ kiện rất cần thiết đối với ô tô, không những làm đẹp cho chiếc xe biến chiếc xe trở nên sang trọng mà còn giúp bạn có thể mở hé cửa kính trong khi trời mưa để lưu thông không khí mà không để nước mưa bắn vào trong xe.</p>\n<p>Vè che mưa toyota vios được thiết kế đặc biệt làm riêng cho xe Vios có đủ cho các đời xe từ 2003 đến 2017.</p>\n<p>Sản phẩm làm từ chất liệu Acrylic cao cấp&nbsp;bền bỉ, màu sơn sáng bóng đẹp,&nbsp;có tính đàn hồi, chịu được nhiệt độ cao&nbsp;là một trong những phụ kiện không thể thiếu của toyota vios.</p>\n<p>Đặc biệt 2 về cửa trước có logo Vios nổi bật, màu sơn đen bóng chống mài chống phai màu tốt.</p>\n<p>Sản phẩm chia theo các đời xe khác nhau quý khách vui lòng lựa chọn đúng sản phẩm.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-203-207-1.jpg?v=1552539119968\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-203-207-3.jpg?v=1552539129596\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-203-207-2.jpg?v=1552539136689\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-203-207-4.jpg?v=1552539142701\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-208-2013-1.jpg?v=1552539153587\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-208-2013-2.jpg?v=1552539161011\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-1.jpg?v=1552539169665\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-2.jpg?v=1552539179770\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-4.jpg?v=1552539189361\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-3.jpg?v=1552539197456\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-5.jpg?v=1552539206671\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ve-che-mua-xe-vios-2014-2017-6.jpg?v=1552539216231\" /></strong></em></p>', '', 'Vè che mưa ô tô', 'ô tô, phụ  kiện ô tô, vè che mưa, Vè che mưa cho xe ô tô Toyota Vios, vè che mưa toyota, vè che mưa vios, Volcano, volcano.vn', '1', 'Phân loại', '2003-2007', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '2', 'kg', 'images/13948031/ve-che-mua-cho-xe-o-to-toyota-vios.jpg', '<p>Vè che mưa toyota vios được thiết kế đặc biệt làm riêng cho xe Vios có đủ cho các đời xe từ 2003 đến 2017.</p>\n\n<p>Sản phẩm làm từ chất liệu Acrylic cao cấp&nbsp;bền bỉ, màu sơn sáng bóng ', '13948031', '23536611', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:25', '2024-05-29 06:12:25'),
(1374, 'bo-04-chan-bun-cho-xe-o-to-toyota-corolla', 'Bộ 04 chắn bùn cho xe ô tô Toyota Corolla', '<p><strong><em>Bộ 04 chắn bùn cho xe ô tô Toyota Corolla</em></strong></p>\n<p>Với thời tiết ở Việt Nam mưa khá nhiều khi đi xe ô to&nbsp;chạy gây văng nước, bùn, cát sỏi...&nbsp;ra sau, làm ảnh hưởng đến những xe chạy sau và cũng làm bẩn các bộ phận khác của xe. Với&nbsp;04 chắn bùn cho xe ô tô&nbsp;Toyota Corolla&nbsp;sẽ giúp bạn loại bỏ hoàn toàn những vẫn đề trên, ngoài chắn bùn bộ sản phẩm còn giúp&nbsp;hạn chế trầy, tróc lớp sơn bảo vệ xe do đất đá bắn lên gây ra.&nbsp;</p>\n<p>Sản phẩm làm bằng chất liệu nhựa dẻo cao cấp với độ bền cao theo thời gian, thiết kế riêng cho xe&nbsp;Toyota Corolla đời từ&nbsp;2003-206, 2008-2013,&nbsp;&nbsp;2014-2017 và 2019</p>\n<p>Tự lắp đặt đơn giản nhanh chóng, bộ&nbsp;chắn bùn còn làm cho chiếc xe của bạn&nbsp;trông cá tính, mạnh mẽ hơn nhiều.</p>\n<p>Lưu ý: Khách hàng lựa chọn đúng đời vì mỗi đời xe có mẫu khác nhau.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-toyota-corolla-2003-2006-1.jpg?v=1552107375124\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-toyota-corolla-2008-2013-1.jpg?v=1552107384569\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-toyota-corolla-2008-2013-3.jpg?v=1552107453208\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-toyota-corolla-20014-2017-1.jpg?v=1552107396587\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-xe-toyota-corolla-20014-2017-6.jpg?v=1696836447275\" /><img data-thumb=\"original\" origi