&nbsp;2014-2017 và 2019-2023</p>', '13901882', '23434861', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:25', '2024-05-29 06:12:25'),
(1375, 'giay-the-thao-nu-2yd-6', 'Giày thể thao nữ 2YD-6', '<p><em><strong>Giày thể thao nữ 2YD-6</strong></em></p>\n<p>Giày thể thao nữ mang phong cách&nbsp;trẻ trung, hiện đại và sành điệu cho các bạn gái.</p>\n<p>Chất liệu vải lưới cao cấp&nbsp;thoáng khí, đế cao su mềm dẻo êm chân</p>\n<p>Giày cổ thấp đế cao su cao chống trơn trượt tốt.</p>\n<p>Giày thời trang trẻ trung năng động phù cho đeo đi học, đi làm, đi chơi...</p>\n<p>Màu sắc: đen, đỏ,</p>\n<p>Size: 36, 37, 38,39.</p>\n<p>Bảo hành: 7 ngày với lỗi từ nhà sản xuất, một đổi một nếu sai màu, sai số</p>\n<p>Hotline: 0868 533 299</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-1.jpg?v=1551753141671\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-2.jpg?v=1551753149887\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-3.jpg?v=1551753156503\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-4.jpg?v=1551753162832\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-5.jpg?v=1551753171297\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-2dy-6-6.jpg?v=1551753178657\" /></p>', '', 'Giày nữ', 'GIÀY NỮ, giày thể thao, Giày thể thao nữ, Giày thể thao nữ 2YD-6, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Size', '36', '', '', '', '', '', 'deny', '', '168000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/13872030/giay-the-thao-nu-2yd-6.jpg', '<p>Giày thể thao nữ mang phong cách&nbsp;trẻ trung, hiện đại và sành điệu cho các bạn gái.</p>\n\n<p>Chất liệu vải lưới cao cấp&nbsp;thoáng khí, đế cao su mềm dẻo êm chân</p>\n\n<p>Giày cổ thấp đ', '13872030', '23368382', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:25', '2024-05-29 06:12:25'),
(1376, 'tham-lot-cop-xe-o-to-toyoyta-levin', 'Thảm lót cốp xe ô tô Toyoyta Levin', '<p><em><strong>Thảm lót cốp xe ô tô Toyoyta Levin</strong></em></p>\n<p>Lót cốp của nhiều dòng xe có đặc điểm chung là bằng nỉ nhưng thực tế cốp bằng nỉ hoàn toàn không phù hợp với môi trường và với cách sử dụng của người Việt Nam. Những đồ dùng cá nhân, các đồ dùng sửa xe và cả đồ ăn đều được chúng ta sử dụng để đưa vào cốp xe...Vì vậy mỗi khi lên là cốp xe rất bẩn, màu giầu mỡ, thức ăn chảy… làm xe sẽ tạo mùi hôi.</p>\n<p>Với thiết được định hình 3D theo đúng biên dạng với cốp xe và model xe Toyoyta Levin phiên bản của&nbsp;xe&nbsp;Toyota Corolla&nbsp;2017 tại thị Trung Quốc.</p>\n<p>Thảm lót cốp&nbsp;sau xe&nbsp; Toyoyta Levin cao cấp với tính năng không thấm nước, không bạc màu trong quá trình sử dụng được làm từ vật liệu nhựa xốp PE, bề mặt có logo chữ&nbsp;Levin nổi bật.</p>\n<p>Đặc biệt sản phẩm có mép viền cao 3D chống thấm và ngăn nước chảy ra khỏi thảm, bề mặt tạo các thành nhô cao giúp đồ đạc không bị xê dịch hay đổ khi để trông cốp.</p>\n<p>Thảm chống bám bẩn và chống nước dễ dàng vệ sinh, lau ướt nhanh khô. Sử dụng sản phẩm đặt lên lớp nỉ cốp xe giúp cho việc sử dụng và vệ sinh cốp nhanh gọn đơn giản hơn bao giờ hết.</p>\n<p>Sản phẩm dành riêng cho xe&nbsp;Toyoyta Levin phiên bản của&nbsp;xe&nbsp;Toyota Corolla&nbsp;2017</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-cop-toyota-levin-2.jpg?v=1551165636501\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-cop-toyota-levin-1.jpg?v=1551165647639\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-cop-toyota-levin-3.jpg?v=1551165665105\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-cop-elantra-5-460dfb1d-58eb-4dd3-adee-5a4f1008123f.jpg?v=1551165677839\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-lot-cop-elantra-4-8888f35b-38bb-4588-ba2e-d1ac362b35e9.jpg?v=1551165801011\" /></p>', '', 'Thảm lót cốp xe ô tô', 'ô tô, phụ  kiện ô tô, Thảm lót cốp xe ô tô, Thảm lót cốp xe ô tô Toyoyta Levin, Toyoyta Levin, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '320000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/13809237/tham-lot-cop-xe-o-to-toyoyta-levin.jpg', '<p>Với thiết được định hình 3D theo đúng biên dạng với cốp xe và model xe Toyoyta Levin phiên bản của&nbsp;xe&nbsp;Toyota Corolla&nbsp;2017 tại thị Trung Quốc.</p>\n<p>Thảm lót cốp&nbsp;sau xe', '13809237', '23200403', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:12:25', '2024-05-29 06:12:25'),
(1377, 'bang-dan-so-dien-tren-xe-o-to-bs05', 'Bảng dán số điện trên xe ô tô BS05', '<p><em><strong>Bảng dán số điện trên xe ô tô BS05</strong></em></p>\n<p>Hãy là người đỗ xe văn minh, lịch sự, hãy để lại số điện thoại&nbsp;trên xe để mọi người biết&nbsp; và gọi khi cần.</p>\n<p>&nbsp;Thay vì những tờ danh thiếp hay những mẩu giấy nhỏ bé khó nhìn ghi lại số điện thoại để trong xe thì&nbsp;Bảng dán số điện thoại&nbsp;sẽ là&nbsp;giải pháp cho bạn loại bỏ tất cả nhũng vẫn đó.</p>\n<p>Bảng dán số điện thoại cực kỳ hữu&nbsp;ích và sử dụng lại đơn giản tiện dụng gắn&nbsp;số đơn giản, có thể hiện hay ẩn số điện thoại khi không cần thiết bằng cách bấn xuống như công tắc on/off.</p>\n<p>Sử dụng&nbsp;đơn giản với 6 dãy số từ 0 đến 9 có phản quang với ánh đèn khi trời tối,&nbsp;và có thể thay đổi số điện thoại dễ dàng.</p>\n<p>Kích thước: nhỏ gọn 108*34*24MM</p>\n<p>Màu sắc: Đen, vàng, hồng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-11.jpg?v=1550818768842\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-10.jpg?v=1550818786353\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-6.jpg?v=1550818793626\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-7.jpg?v=1550818801118\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-9.jpg?v=1550818817826\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ban-dan-so-dien-thoai-bd051-2.jpg?v=1550818853118\" /></p>\n<