(1386, 'giay-sneaker-nam-long-vu-phong-cach-thoi-trang-han-quoc', 'Giày sneaker thể thao nam cổ thấp - lông vũ N68- tặng 01 lọ tẩy giày', '<h1><span style=\"font-size:14px;\"><strong><em>Giày sneaker thể thao nam cổ thấp - lông vũ N68- tặng 01 lọ tẩy giày</em></strong></span></h1>\n<p><span style=\"font-size:14px;\">Giày Sneaker Nam Lông Vũ với thiết kế thời trang năng động phong&nbsp;Thời Trang Hàn Quốc,</span>&nbsp;cổ giày&nbsp;thấp <span style=\"font-size:14px;\">đậm chất chất thể thao mạnh mẽ và nam tính.</span></p>\n<p><span style=\"font-size:14px;\">Chất liệu da PU trơn cao cấp siêu bền bỉ không bong chốc, thiết kế tỉ mỉ đến từng chi.</span></p>\n<p><span style=\"font-size: 14px;\">Phần đế chất liệu cao su chống mòn, chống trơn trượt.</span></p>\n<p><span style=\"font-size: 14px;\">Đủ size từ 39 đến size 43, màu sắc dễ phối màu vời nhiều màu sắc quần áo chắc chắn sẽ giúp bạn tạo nên một&nbsp;style thời trang mới mẻ cho bạn.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size:14px;\"><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nam-3.jpg?v=1546747404637\" /></em></strong></span></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nam-6.jpg?v=1546747702160\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nam-2.jpg?v=1546747709798\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nam-8.jpg?v=1546747729666\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nam-7.jpg?v=1546747737577\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcd