(1394, 'huyndai-cao-cap', 'Vỏ ốp Chìa Khóa Xe Ô Hyundai cao cấp', '<p><strong><em>Vỏ ốp Chìa Khóa Xe Ô Hyundai cao cấp&nbsp;</em></strong></p>\n<p>Sản phẩm tiện dụng không thể thiếu cho chiếc xe của bạn. Vỏ ốp được làm từ chất liệu nhựa cứng cao cấp với khả năng chịu va đập tốt thiết kế độc đáo tượng trưng cho sự quý phái và sang trọng với màu đen bóng logo Hyundai nổi bật.</p>\n<p>Ốp giống như một tấm áo giáp mới giúp bảo vệ chìa khóa khi nhỡ tay đánh rơi, chống trầy xước, không bị phai màu. Đạc biệt móc treo tiện dụng cho bạn móc chìa khóa vào đai quần, túi xách…</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-1.jpg?v=1544164738081\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-5.jpg?v=1544164746949\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-2.jpg?v=1544164754660\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-3.jpg?v=1544164763770\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-4.jpg?v=1544164770179\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-chia-khoa-logo-huyndai-6.jpg?v=1544164778365\" /></p>', '', 'Ốp chìa khóa', 'ô tô, Ốp chìa khóa Huyndai cao cấp, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '230000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/13326118/huyndai-cao-cap.jpg', '<p>Sản phẩm tiện dụng không thể thiếu cho chiếc xe của bạn. Vỏ ốp được làm từ chất liệu nhựa cứng cao cấp với khả năng chịu va đập tốt thiết kế độc đáo tượng trưng cho s', '13326118', '22083224', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:14:09', '2024-05-29 06:14:09'),
(1395, 'sac-xe-dap-xe-may-dien-48-60v-20ah', 'Sạc xe đạp, xe máy điện 48-20AH và 60V-20AH DONHN', '<p><em><strong>Sạc xe đạp, xe máy điện 48-20AH và 60V-20AH DONHN</strong></em></p>\n<p>Sạc xe đạp, xe máy điện 48-60V-20AH chân đặc dùng cho các xe điện sử dụng ác quy điện 40V hoặc 60V&nbsp;như:&nbsp;Nijia,sufat SF7,&nbsp;xmen, z3, vespa....các dòng xe có chân cắp sạc vuông.</p>\n<p>Sạc có tính năng chống cháy gấp 7 lần, phòng ngừa sự cố khi sạc, có quạt tản nhiệt làm mát khi sử dụng, tổng chiều dài sạc 120CM tiện dụng.</p>\n<p>Sạc có thiết kế rất nhỏ gọn để bạn dễ dàng mang theo</p>\n<p>Sản phẩm chia làm 2 loại 60V-20AH và 48V-20AH</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-xe-dien-60v-20ah-1.jpg?v=1543984164363\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-xe-dien-60v-20ah-2.jpg?v=1543984173546\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-xe-dien-60v-20ah-3.jpg?v=1543984182381\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-xe-dien-60v-20ah-7.jpg?v=1545186920764\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/sac-xe-dien-60v-20ah-6-e7b8cdbf-9d27-4e14-936e-3f99015f8dc0.jpg?v=1545187004832\" /></p>\n<p>&nbsp;</p>', '', 'Sạc xe điện', 'phụ  kiện ô tô, phụ kiện xe máy, SẠC XE ĐIỆN, sạc xe điện 48v, sạc xe điện 60V, Volcano, volcano.vn, xe máy', '1', 'Loại', '48V-20AH', '', '', '', '', '', '', '', 'deny', '', '190000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/13304461/sac-xe-dap-xe-may-dien-48-60v-20ah.jpg', '<p>Sạc xe đạp, xe máy điện 48-60V-20AH chân đặc dùng cho các xe điện sử dụng ác quy điện 40V hoặc 60V&nbsp;như:&nbsp;Nijia,sufat SF7,&nbsp;xmen, z3, vespa....</p>\n\n<p>Sạc có tính năng chống c', '13304461', '22044702', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:14:14', '2024-05-29 06:14:14'),
(1396, 'vien-tinh-the-oxy-du-ca-tao-o-cau-ca-40g', 'Viên Tinh Thể Oxy Dụ Cá, Tạo Ổ Câu Cá 40G', '<p><em><strong>Viên Tinh Thể Oxy Dụ Cá, Tạo Ổ Câu Cá 40G</strong></em></p>\n<p>Viên tinh thể Oxy thích hợp nước hồ thiếu o xy, nước lờ lờ nước hến, hồ xử lý tảo, nước mặt hồ kết váng, nước nhiều bùn...&nbsp;</p>\n<p>&nbsp;Phù hợp nhiều kiểu câu như câu đơn và câu đài chỉ cần quăng 3-5 viên vào vị trí câu , 1 tiếng bồi 1 lần,&nbsp;câu các tra, chùm nho, lance sau khi chuẩn bị như bình thường ta chỉ việc nhét 8-12 viên chia đều và găm vào cục mồi&nbsp;rồi thả ngay có thể chơi 4 tiếng đối với câu lục</p>\n<p>&nbsp;Một lọ có với 30 viên giúp sử dụng được lâu sau khi dùng không hết vặn chắt nắp để nơi khô thoáng.</p>\n<p>#Mồicâusiêunhạy&nbsp;#Mồicâucáchép #Mồicâucátrắm #Mồicâucátrôi #MồicâuLancer #Mồicâulục&nbsp; #Mồicâuđài&nbsp; #Thínhsiêunhạy #mồicâucá #mồicâucátra&nbsp; #mồicâucátrê #mồicâucámè #mồicâucárôphi #mồicâulure&nbsp; #mồicâulục&nbsp; #mồicâulăngxê&nbsp; #mồicâulục #mồicâulkhoa&nbsp; #mồicâusiêunhạy #viêntinhthểoxy</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-5.jpg?v=1543808900362\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-2.jpg?v=1543808914644\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-2-6c77938c-3625-4185-b43d-ac65c947b5ec.jpg?v=1543808922722\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-3-1185fcc4-e36f-43c7-b643-efb3099eb6b7.jpg?v=1543808965304\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-4.jpg?v=1543809023944\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-tinh-the-oxi-cau-ca-6.jpg?v=1543809042385\" /></p>', '', 'Viên Tinh Thể Oxy Dụ Cá, Tạo Ổ Câu Cá 40G', 'CÂU CÁ, mồi câu cá, Viên Tinh Thể Oxy Dụ Cá, Viên Tinh Thể Oxy tạo ổ câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '20000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/13287789/vien-tinh-the-oxy-du-ca-tao-o-cau-ca-40g.jpg', '<p>&nbsp;Phù hợp nhiều kiểu câu như câu đơn và câu đài chỉ cần quăng 3-5 viên vào vị trí câu , 1 tiếng bồi 1 lần,&nbsp;câu các tra, chùm nho , lance sau khi chuẩn bị như bình thường ta chỉ vi', '13287789', '22011897', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:14:26', '2024-05-29 06:14:26'),
(1397, 'kinh-chan-gio-xe-may-cg03', 'Kính chắn gió xe máy CG03', '<p><em><strong>Kính chắn gió xe máy CG03</strong></em></p>\n<p>&nbsp;Kính chắn gió ngoài chắn gió thì như một thiết bị bảo vệ khỏi các tác động nhỏ vô tình như các vật rắn gây tổn thương, các loại bụi, bẩn, nước, nóng, côn trùng…rất hay gặp khi tham gia giao thông rất phù hợp cho những trường hợp có&nbsp;trẻ nhỏ khi tham gia giao thông cùng người lớn.</p>\n<p>Kính chắn xe gắn máy, không những đáp ứng nhu cầu chính mà còn mang lại sự an toàn khi ngồi trước xe, với kiểu dáng tinh tế, nhẹ nhàng phù hợp với các kiểu xe gắn máy hiện hành, mang lại cảm giác thật sự thoải mái trong lúc điều khiển.</p>\n<p>Lắp đơn giản lên 2 tay gương xe với phụ kiện tay đỡ kính định hình và giữ chắc chắn kính, các lỗ bắt ốc được khoan sẵn,</p>\n<p>&nbsp;Kính làm từ chất liệu nhựa PC dẻo chống xước, chống bị vỡ vụn làm ảnh hưởng đến người&nbsp;sử dụng.</p>\n<p>Kích thước: cao 60cm, rộng 71*36 cm, dày 2mm, khoảng cách lỗ khoan lắp đặt 30cm và 32cm. Bộ sản phẩm gồm kính và đầy đủ phụ kiện lắp đặt.</p>\n<p>#kinhchangio #kính- chắn - gió #kínhchắngióxemáy #kinhchangioxemay #Kínhchắngióxemáy</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cao-cap-7.jpg?v=1543284153301\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cao-cap-8.jpg?v=1543284160098\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cao-cap-5.jpg?v=1543128375649\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cao-cap-3.jpg?v=1543128395987\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-xe-may-cao-cap-1-c1bbf7ee-24e7-4d6d-9097-c87f252165fc.jpg?v=1543128413245\" /></strong></em></p>\n<p><em><strong>Hướng dẫn lắp đặt:</strong></em></p>\n<ol>\n<li><em><strong>Tháo&nbsp;gương xe&nbsp;</strong></em></li>\n<li>Lắp 2 tai kim loại và lắp lại gương.</li>\n<li>Lắp 2 tay đỡ chữ L lên 2 bên tai kim loại vừa lắp bước (2)</li>\n<li>Uớm kính với 2 tay đỡ để tùy chỉnh cho phù hợp với 4 lỗ có sẵn trên kính</li>\n<li>Lắp 4 tai cao su lên 2 tay đỡ chữ L</li>\n<li>Vặn 4 ốc lại lưu ý phải&nbsp;lót long đen</li></ol>\n<p><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"552\" src=\"https://www.youtube.com/embed/cAs0pPN1kCA\" width=\"100%\"></iframe></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/1Q8IUeKfUeM\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'Kính chắn gió', 'chắn gió xe máy, kính chắn gió, kính chắn gió xe máy, phụ kiện xe máy, sản phẩm kiếng chắn xe gắn máy, Volcano, volcano.vn, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '350000', '', '1', '', '', NULL, '', '', '', '2.3', 'kg', 'images/13232912/kinh-chan-gio-xe-may-cg03.jpg', '<p>Lắp đơn giản lên 2 tay gương xe với phụ kiện tay đỡ kính định hình và giữ chắc chắn kính, các lỗ bắt ốc được khoan sẵn.</p>\n<p>&nbsp;Kính làm từ chất liệu nhựa PC dẻo chống xước, chống bị ', '13232912', '21906071', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:14:40', '2024-05-29 06:14:40'),
(1398, 'op-lung-go-2-manh-cho-dien-thoai-iphone-7-8-7plus-8plus', 'Ốp lưng gỗ 2 mảnh cho điện thoại Iphone 7, 8, 7plus, 8plus', '<p><strong><em>Ốp lưng gỗ 2 mảnh cho điện thoại Iphone 7, 8, 7plus, 8plus</em></strong></p>\n<p>Với phong cách hơi cổ, mang chiều hướng màu sắc bạn sẽ cảm nhận được sự đặc biệt và chiếc điện thoại của bạn sẽ trở nên trất&nbsp;hơn bao giờ hết.</p>\n<p>Thiết đơn giản từ nguyên liệu gần gũi trong thiết kế, đó chính là những điểm nổi bật của&nbsp;ốp lưng iphone 2 mảnh&nbsp;bằng gỗ&nbsp;vân gỗ đẹp mắt đủ màu sắc.</p>\n<p>Nguyên liệu 100% gỗ thật gồm 2 mảnh ghép lại đơn giản mà chắc chắn, vị trí các phim và camera sau, chân cắm sạc và loa&nbsp;được khoét chính xác tỉ mỉ.</p>\n<p>Bản đặc biệt rành riêng cho&nbsp;<strong><em>Iphone 7, 8, 7plus và&nbsp;8plus</em></strong></p>\n<p><strong><em>Lưu ý: Do làm từ chất liệu gỗ tự nhiên nên vân gỗ có thể có chi tiết nhỏ khác nhau</em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-5.jpg?v=1541643799914\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-3.jpg?v=1541643811275\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-11.jpg?v=1541665263309\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-9.jpg?v=1541665270790\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-10.jpg?v=1541665281704\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-8.jpg?v=1541665291653\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-1.jpg?v=1541643826763\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-7.jpg?v=1541643845745\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-4.jpg?v=1541643860018\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-dien-thoai-go-ip7-2.jpg?v=1541643834785\" /></em></strong></p>', '', 'Ốp lưng', 'ốp ip, ốp lưng, ốp lưng bằng gỗ, ốp lưng gỗ, ốp lưng ip, Volcano, volcano.vn', '1', 'Màu sắc', 'G01', 'Bản', 'Iphone 7 8', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/13112120/op-lung-go-2-manh-cho-dien-thoai-iphone-7-8-7plus-8plus.jpg', '<p>Thiết đơn giản từ nguyên liệu gần gũi trong thiết kế, đó chính là những điểm nổi bật của&nbsp;ốp lưng iphone 2 mảnh&nbsp;bằng gỗ&nbsp;vân gỗ đẹp mắt đủ màu sắc.</p>\n\n<p>Nguyên liệu 100% gỗ', '13112120', '21657591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:14:57', '2024-05-29 06:14:57'),
(1399, 'bo-04-op-tay-nam-cua-cho-xe-ford-ranger', 'Bộ 04 ốp tay nắm và hõm cửa cho xe FORD RANGER  2012-2016', '<p><em><strong>Bộ 04 ốp tay nắm và hõm cửa cho xe FORD RANGER &nbsp;2012-2016</strong></em></p>\n<p>Được thiết kế dành riêng cho xe FORD RANGER &nbsp;2012-2016 mang đến phong cách sang trọng và chống trầy xước&nbsp;cho tay nắm cửa&nbsp;xe</p>\n<p>Được làm từ chất liệu nhựa ABS kết hợp mạ crom&nbsp;sang trọng sáng bóng theo thời gian chống&nbsp;trầy xước tốt</p>\n<p>Bộ sản phẩm gồm: 4 chiếc ốp&nbsp;tay nắm và 4 hõm cửa có kích thước được thiết kế&nbsp;chính xác để ốp 4 tay nắm cửa&nbsp;xe&nbsp;FORD RANGER &nbsp;2012-2016.</p>\n<p>Lắp đơn giản có băng dính 3M sẵn mặt sau sản phẩm.</p>\n<p>Sản phẩm bán phân loại khách hàng vui lòng đặt đúng phân loại theo tên sản phẩm.<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-5.jpg?v=1540433267040\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-op-tay-nam-cua-xe-ranger-2016-2018-7.jpg?v=1543887502854\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-2.jpg?v=1540433273026\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-3.jpg?v=1540433279488\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-4.jpg?v=1540433286117\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-1.jpg?v=1540433292656\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tay-nam-cua-ranger-6.jpg?v=1540433461952\" /></p>', '', 'Tay nắm cử