(1401, 'bo-op-chan-ga-chan-phanh-chan-con-cho-o-to-so-san-va-so-tu-dong', 'Bộ ốp chân ga, chân phanh, chân côn cho ô tô số sàn và số tự động', '<p><em><strong>Bộ ốp chân ga, chân phanh, chân côn cho ô tô số sàn và số tự động</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>Bộ ốp chân ga, chân phanh, chân côn cho ô tô số sàn và số tự động được sản xuất từ chất liệu nhôm chống gỉ, chịu lực tốt,độc bền và tuổi thọ sử dụng cao<br />\nSản phẩm có tác dụng bảo vệ chân ga, chân phanh, chân côn&nbsp;nguyên bản của ô tô, Tăng diện tích tiếp xúc giữa bàn chân và bàn đạp, hỗ trợ điều khiển ô tô dễ dàng hơn, tốt hơn,&nbsp;mặt tiếp xúc bằng cao su,tăng ma sát giữa đế giày, dép.... và bàn đạp,khắc phục tình trạngđạp trượt, nhầm khi lái xe.<br />\n&nbsp;Bộ sản phẩm giành cho số sàn gồm : chan ga 140*62*8mm, chân phanh, chân côn&nbsp;75*69*8mm,&nbsp;2 màu trắng đen, trắng xanh.<br />\n&nbsp;Bộ sản phẩm giành cho xe số tự động gồm : bọc chân ga 140*62*8mm, chân phanh&nbsp;125*75*8mm.<br />\n&nbsp;Màu sắc phối hợp sang trọng, dễ dàng lắp đặt tại nhà.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-2.jpg?v=1540004693933\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chan-ga-chan-phanh-o-to-1.jpg?v=1558518453175\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-4-a897d2fb-43a7-467e-b6d7-885ea757eca3.jpg?v=1540005261610\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-7.jpg?v=1540005268204\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-3.jpg?v=1540004711641\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-chan-ga-chan-phanh-o-to-2.jpg?v=1558518527344\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-6.jpg?v=1540004723158\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-5.jpg?v=1540004741199\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-v2.jpg?v=1540004757843\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-chan-ga-chan-phanh-o-to-v3.jpg?v=1540004765150\" /></strong></em></p>', '', 'Bộ ốp chân ga, chân phanh, chân côn', 'Bộ ốp chân ga, Bộ ốp chân ga ô tô số sàn, chân côn cho ô tô số sàn và số tự động, chân phanh, ô tô, ốp chân ga chân phanh số tự dộng, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Xe số sàn trắng đen', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12952859/bo-op-chan-ga-chan-phanh-chan-con-cho-o-to-so-san-va-so-tu-dong.jpg', '<p>Sản phẩm có tác dụng bảo vệ chân ga, chân phanh, chân côn&nbsp;nguyên bản của ô tô, Tăng diện tích tiếp xúc giữa bàn chân và bàn đạp, hỗ trợ điều khiển ô tô dễ dàng hơn, tốt hơn,&nbsp;mặt ', '12952859', '21210589', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:15:32', '2024-05-29 06:15:32'),
(1402, 'moi-tron-cau-ca', 'Mồi trộn câu cá', '<p><em><strong>Mồi trộn câu cá</strong></em></p>\n<p>Mồi tổng hợp nhiều hương vị bột, cám, và hạt trộn sẵn tỉ lệ phù hợp nhất để sử dụng câu 4 loài cá khác nhau.</p>\n<p>&nbsp;Mỗi được trộn và đóng 400G/lọ chia làm 4 hương vị chuyên câu cá chép, cá trôi, trắm cỏ và cá rô phi. Bài mồi được hơn 6000 đánh giá tích cực từ các cần thủ nội địa Trung Quốc.</p>\n<p>Sử dụng :</p>\n<ul>\n<li>Mồi trộn sẵn chỉ cần ngâm với nước khoảng 8 đến 10 phút sử dụng như mồi câu bình thường</li>\n<li>Có thể thêm chất hấp dẫn cá</li></ul>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-1.jpg?v=1539826874770\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-2.jpg?v=1539826884654\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-3.jpg?v=1539826900477\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-4.jpg?v=1539826910124\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-5.jpg?v=1539827089351\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-tong-hop-cau-ca-6.jpg?v=1539827104520\" /></p>', '', 'mồi câu cá', 'mồi câu, mồi câu cá, mồi câu chép, mồi câu rô phi, mồi câu trắm cỏ, mồi câu trôi, Volcano, volcano.vn', '1', 'Phân loại', 'Cá rô phi', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12936794/moi-tron-cau-ca.jpg', '<p>Mồi tổng hợp nhiều hương vị bột, cám, và hạt trộn sẵn tỉ lệ phù hợp nhất để sử dụng câu 4 loài cá khác nhau.</p>\n\n<p>&nbsp;Mỗi được trộn và đóng 400G/lọ chia làm 4 hương vị chuyên câu cá c', '12936794', '21183830', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:15:39', '2024-05-29 06:15:39'),
(1403, 'moi-cau-ca-dang-vien-nho', 'Mồi câu cá dạng viên nhỏ', '<p><em><strong>Mồi câu cá dạng viên nhỏ</strong></em></p>\n<p>&nbsp;Mồi câu cá đang viên nhỏ được tổng hượp từ nhiều nguyên liệu khác nhau để được 3 loại mồi có hương vị khác nhau chuyên câu những loài cá khác nhau.</p>\n<p>Mồi chuyên dụng câu chép, mè, trắm cỏ được chiết xuất từ các loại trái cây và cỏ có vị ngọt . Lọ&nbsp;mồi có&nbsp;3 số cuối mã vạch 628</p>\n<p>Mồi chuyên các loài cá ăn&nbsp;thịt, và chất tanh&nbsp;như trắm đen, chép mồi&nbsp;được tổng hợp từ thịt tôm, cá&nbsp;và giun tạo lên mùi tanh hấp dẫn nhiều loài với hương vị giữ được lâu.&nbsp;Lọ&nbsp;mồi có&nbsp;3 số cuối mã vạch 611</p>\n<p>Mồi chuyên mè, trắm cỏ, cá hồi,.. với hương vị hấp dẫn axit chiết xuất từ các loại trái cây phù hợp câu hầu hết các loại cá nước ngọt.&nbsp;Lọ&nbsp;mồi có&nbsp;3 số cuối mã vạch 604</p>\n<p>Sản phẩm có khối lương 250G/lọ</p>\n<p>Cách sử dụng:&nbsp;</p>\n<ul>\n<li>Pha với nước tỉ lệ 1 : 0.8 ngâm 8 đến 10 phút dùng như mồi bình thường.</li>\n<li>Phù hợp cho câu cá nước ngọt, ao, hồ, sông.</li></ul>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-4.jpg?v=1539673986884\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-1.jpg?v=1539673993686\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-2.jpg?v=1539674000633\" /></strong></em><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-3.jpg?v=1539674009020\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-5.jpg?v=1539674015401\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-hat-cam-huong-vi-6.jpg?v=1539674022449\" /></strong></em></p>', '', 'Mồi câu', 'câu cá, mồi câu, mồi câu cá, mồi câu cá chép, mồi câu cá mè, mồi câu trắm, Volcano, volcano.vn', '1', 'Phân loại', 'Mã 628', '', '', '', '', '', '', '', 'deny', '', '55000', '', '1', '', '', NULL, '', '', '', '0.4', 'kg', 'images/12929648/moi-cau-ca-dang-vien-nho.jpg', '<p>Mồi câu cá đang viên nhỏ được tổng hượp từ nhiều nguyên liệu khác nhau để được 3 loại mồi có hương vị khác nhau chuyên câu những loài cá khác nhau.&nbsp;Sản phẩm có khối lương 250G/lọ.&nbs', '12929648', '21164904', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:15:41', '2024-05-29 06:15:41'),
(1404, 'chan-bun-sau-bon-chan-xe-exciter-150-winner-msx', 'Chắn bùn sau bốn chân xe  Exciter 150, Winner, MSx - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Chắn bùn sau bốn chân xe &nbsp;Exciter 150, Winner, MSx - Khắc Laser Theo Yêu Cầu</strong></em></p>\n<p>&nbsp;Với chất liệu nhựa ABS dẻo&nbsp;bền bỉ chịu được sự tác động của mồi trường cực tốt, kèm theo là bộ pass lắp đặt làm từ&nbsp;kim loại rất chắc chắn giúp cho các Biker sử dụng bảo vệ xế yêu được sạch sẽ, và trang trí Exciter 150,&nbsp;Winner, MSx đậm chất thể thao, cá tính.</p>\n<p>&nbsp;Khả năng che chắn khi đi trời mưa, tốc độ trên 50km/h đảm bảo che chắn trên 91%.<br />\n&nbsp;Chắn bùn sau Exciter 150 thuộc loại dài 4 chân&nbsp;gắn được cho nhiều xe khác phù hợp như Exciter 135, Fz150,&nbsp;Winner, MSx</p>\n<p>&nbsp;Kích thươc: 44 *18CM, 4 chân 14CM thêm chân pass 4CM có thể điều chỉnh</p>\n<p>&nbsp;Bộ sản phẩm đầu đủ: 02 chắn bùn 4 chân và bộ Pass kim loại kèm ốc chốt.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-9.jpg?v=1539664947946\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-10.jpg?v=1539664954989\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-11.jpg?v=1539665002487\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-7.jpg?v=1539664836208\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-8.jpg?v=1539664843102\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-5.jpg?v=1539664795427\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-2.jpg?v=1539664805109\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-2-a31eb88c-e1af-4def-993f-86f9c7d902e1.jpg?v=1539664815499\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-bun-sau-xe-may-4.jpg?v=1539664822845\" /></strong></em></p>', '', 'chắn bùn sau', 'chắn bùn, chắn bùn sao, chắn bùn sau, Chắn bùn sau bốn chân xe  Exciter 150, Chắn bùn sau bốn chân xe  Exciter 150, Chắn bùn sau bốn chân xe MSx, Chắn bùn sau bốn chân xe Winner, MSx, phụ kiệ', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/12927512/chan-bun-sau-bon-chan-xe-exciter-150-winner-msx.jpg', '<p>Với chất liệu nhựa ABS dẻo&nbsp;bền bỉ chịu được sự tác động của mồi trường cực tốt, kèm theo là bộ pass lắp đặt làm từ&nbsp;kim loại rất chắc chắn giúp cho các Biker sử dụng bảo vệ xế yêu', '12927512', '21161403', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:15:42', '2024-05-29 06:15:42'),
(1405, 'tem-logo-noi-eco-diesel-dan-trang-tri-xe', 'Tem logo nổi ECO DIESEL dán trang trí xe', '<p><em><strong>Tem logo nổi ECO DIESEL dán trang trí xe</strong></em></p>\n<p>&nbsp;Tem logo&nbsp;ECO DIESEL phù hợp dán trang trí cho các dòng xe Jeep, dán lên phần đuôi xe chắc chắn sẽ là một điểm nổi bật và ấn tượng cho xế yêu của bạn.</p>\n<p>&nbsp;Chất liệu nhựa ABS bến bỉ mạ lớp kẽm mỏn bóng đẹp mắt bền màu.</p>\n<p>&nbsp;Kích thước: 16*2.4*0.5CM với 2 màu chữ đỏ và màu&nbsp;xanh.</p>\n<p>Lưu ý: làm sạch vị trí nơi bạn đã lựa chọn dán lên, sau đó bóc keo dán lên và đảm bảo trong 48 tiếng không có sự ảnh hưởng của nước để hạn chế tối đa sự bong tróc keo khi mới dán.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-eco-diesel-1.jpg?v=1535966635032\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-eco-diesel-v1.jpg?v=1535966642554\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-eco-diesel-2.jpg?v=1535966650120\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-eco-diesel-4.jpg?v=1535966733916\" /></strong></em></p>', '', '', 'ô tô, phụ  kiện ô tô, Tem logo nổi ECO DIESEL, Tem logo nổi ECO DIESEL dán trang trí xe, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12553026/tem-logo-noi-eco-diesel-dan-trang-tri-xe.jpg', '<p>&nbsp;Tem logo&nbsp;ECO DIESEL phù hợp dán trang trí cho các dòng xe Jeep, dán lên phần đuôi xe chắc chắn sẽ là một điểm nổi bật và ấn tượng cho xế yêu của bạn.</p>\n\n<p>&nbsp;Chất liệu nhự', '12553026', '20362308', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:16:43', '2024-05-29 06:16:43'),
(1406, 'bo-02-gu-tay-lai-xe-may-gl80', 'Bộ 02 gù tay lái xe máy GL80', '<p><em><strong>Bộ 02 gù tay lái xe máy GL80</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>Gù tay lái giúp xe bạn nổi bật hơn, tạo điểm nhấn và hơn nữa gù tay lái xe máy giúp cho việc lưu thông trên đường an toàn hơn, khi vô tình té ngã thì gù tay lái cũng chính là cứu nhân của bạn.&nbsp;</p>\n<p>Gù tay lái xe máy được thiết kiết kín từ bên trong, chống lại hiện tượng vào nước mưa hay rửa xe trong quá trình sử dụng. Với kiểu dáng thiết kế thời trang màu sắc nổi bật, chất liệu hợp kim nhôm chắc chắn.</p>\n<p>Lắp đặt thay thay thế đơn gản, lắp được cho tất cả các loại xe</p>\n<p>&nbsp;Kích thước: 56*30mm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-3.jpg?v=1535445358123\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-5.jpg?v=1535445364850\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-6.jpg?v=1535445374443\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-2.jpg?v=1535445420862\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-8.jpg?v=1535445394331\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-7.jpg?v=1535445433924\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gu-gan-duoi-tay-nam-xe-may-4.jpg?