(1407, 'moi-thit-oc-sen-cau-ca', 'Mồi thịt ốc sên câu cá', '<p><em><strong>Mồi thịt ốc sên câu cá</strong></em></p>\n<p>&nbsp; Mồi câu được lấy nguyên liệu chính là thịt ốc sên sau đó đóng hộp ngâm với nước của hơn 20 loại hương vị và thảo dược để tạo lên mùi thu hút các loài cá to, cá ăn thịt như lóc, chắm đen...</p>\n<p>&nbsp;Chia làm 2 loại mồi nguyên con ốc to và thịt ốc thái nhỏ, thịt ốc vẫn luôn được ngâm trong nước của hơn 20 loại nguyên liệu khi sử dụng có kẹp gắp lấy ốc không dùng hết đậy nắp bảo quản nơi khô ráo.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-1.jpg?v=1535441835344\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-5.jpg?v=1535441849314\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-6.jpg?v=1535441855575\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-2.jpg?v=1535441864624\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-10.jpg?v=1535442087332\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-7.jpg?v=1535442098219\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-ca-oc-sen-8.jpg?v=1535442105661\" /></strong></em></p>\n<p><em><strong>&nbsp;</strong></em></p>', '', 'mồi câu cá', 'cau ca, câu cá, mồi câu, mồi ốc sên, Mồi thịt ốc sên câu cá, Volcano, volcano.vn', '1', 'Phân loại', 'Ốc to', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12507134/moi-thit-oc-sen-cau-ca.jpg', '<p><em><strong>&nbsp; Mồi câu được lấy nguyên liệu chính là thịt ốc sên sau đó đóng hộp ngâm với nước của hơn 20 loại hương vị và thảo dược để tạo lên mùi thu hút các loài cá to, cá ăn thịt n', '12507134', '20257784', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:16:51', '2024-05-29 06:16:51'),
(1408, 'boc-tay-ga-xe-may-cao-su', 'Bọc tay ga xe máy BT120', '<p><strong><em>Bọc tay ga xe máy BT120</em></strong></p>\n<p>&nbsp;Bọc tay ga xe máy với chất liệu cao su mềm và dày giúp bạn cầm nắm tay ga chắc chắn hơn, trên bề mặt thiết kết têm vân nổi trống trơn tuyệt đối 2 đầu được gắn chắc chắn kim loại chống trầy xước hay rách cao su.</p>\n<p>&nbsp;Lắp đặt thay thế bọc tay ga cũ đơn giản, kích thước: 14*5*3.5cm, đường kính trong lần lượt 2.2cm&nbsp;và 2.4cm.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-8-69fbfcd3-c96f-49d9-b2f9-9e50de382441.jpg?v=1535085939891\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-7-e933fcc8-73fc-47c3-aa32-b124adf5df49.jpg?v=1535085948368\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-1-48a3e065-4be4-4b8c-a9f5-ea1a69e4df0e.jpg?v=1535085743199\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-5-b045c922-99a9-4092-8e4a-04349c988890.jpg?v=1535085749822\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-2-8b1dd2d3-011d-4137-938c-58ae6c5ef0d9.jpg?v=1535085761846\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-4-1db6c81a-fa1f-48b9-91a6-9479397e048f.jpg?v=1535085772453\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-3.jpg?v=1535085780059\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-tay-ga-xe-may-6.jpg?v=1535085787197\" /></p>', '', 'Bọc tay ga xe máy', 'bọc tay ga, bọc tay ga xe ámy, ô tô, phụ kiện xe máy, tay ga xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12476986/boc-tay-ga-xe-may-cao-su.jpg', '<p>&nbsp;Bọc tay ga xe máy với chất liệu cao su mềm và dày giúp bạn cầm nắm tay ga chắc chắn hơn, trên bề mặt thiết kết têm vân nổi trống trơn tuyệt đối 2 đầu được gắn chắc chắn kim loại chốn', '12476986', '20186709', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:05', '2024-05-29 06:17:05'),
(1409, 'chan-chong-do-xe-may-cc02', 'Chân chống độ xe máy CC02', '<p><em><strong>Chân chống độ xe máy CC02</strong></em></p>\n<p>&nbsp;Chân chống độ chất liệu kim loại cực kỳ chắc chắn, với thiết kế đẹp được ghép lại từ nhiều chi tiết và các con ốc có thể điều chỉnh được chiều dài của&nbsp;chân chống một cách đơn giản.</p>\n<p>&nbsp;Kích thước điều chỉnh thừ 20cm lên đến 28cm nên có thể lắp cho tất cả các dòng xe, chất liệu kim loại chịu&nbsp;lực cao.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-do-xe-may-6.jpg?v=1535016550420\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-do-xe-may-3.jpg?v=1535016456995\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-do-xe-may-4.jpg?v=1535016562242\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-do-xe-may-5.jpg?v=1535016590638\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-do-xe-may-1.jpg?v=1535016037955\" /></strong></em></p>', '', 'Chân chống xe máy', '', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '230000', '', '1', '', '', NULL, '', '', '', '0.9', 'kg', 'images/12472298/chan-chong-do-xe-may-cc02.jpg', '<p>&nbsp;Chân chống độ chất liệu kim loại cực kỳ chắc chắn, với thiết kế đẹp được ghép lại từ nhiều chi tiết và các con ốc có thể điều chỉnh được chiều dài của&nbsp;chân chống một cách đơn gi', '12472298', '20173647', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:07', '2024-05-29 06:17:07'),
(1410, 'den-xi-nhan-xe-may-nhay-hinh-xuong-ca', 'Đèn xi nhan xe máy nháy hình xương cá', '<p><em><strong>Đèn xi nhan xe máy nháy hình xương cá</strong></em></p>\n<p>&nbsp;Đèn xi nhan xe máy thiết kế đẹp anh sáng leb rõ màu nhấp nháy hình 3 khúc xương cá đẹp và lạ mắt, vỏ nhựa ABS chống thấm nước, chân ren 10mm phù hợp với hầu hết các dòng xe xi nhan rời bên ngoài.</p>\n<p>&nbsp;Sử dụng điện áp 12V thay thế cho đèn xi nhan cũ trên xe, lắp đặt đơn giản với 2 dây âm và dương.</p>\n<p>Kích&nbsp; thước: 13*3cm, ánh sáng vàng và xanh dương</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-8.jpg?v=1535012303481\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-9.jpg?v=1535012313748\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-7.jpg?v=1535012319975\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-1.jpg?v=1535012326879\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-3.jpg?v=1535012336823\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-4.jpg?v=1535012344309\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-5.jpg?v=1535012351606\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-xi-nhan-mui-ten-6.jpg?v=1535012361874\" /></p>\n<p><iframe allow=\"autoplay; encrypted-media\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/fUzVhUcCn44\" width=\"100%\"></iframe></p>', '', 'đèn xi nhan', 'đèn xi nahn, đèn xi nhan xe máy, Đèn xi nhan xe máy nháy hình xương cá, phụ kiện xe máy, Volcano, volcano.vn, xe máy, xi nhan xe máy', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12470126/den-xi-nhan-xe-may-nhay-hinh-xuong-ca.jpg', '<p>&nbsp;Đèn xi nhan xe máy thiết kế đẹp anh sáng leb rõ màu nhấp nháy hình 3 khúc xương cá đẹp và lạ mắt, vỏ nhựa ABS chống thấm nước, chân ren 10mm phù hợp với hầu hết các dòng xe xi nhan r', '12470126', '20170667', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:10', '2024-05-29 06:17:10'),
(1411, 'kinh-dam-chong-nang-chong-tia-uv-di-xe-may-uv400', 'Kính chống nắng, chống tia UV đi xe máy UV400', '<p><em><strong>Kính chống nắng, chống tia UV đi xe máy UV400</strong></em></p>\n<p>&nbsp;Loại kính chống tia UV có có phần cao su đệm phía trong giúp người đeo được thoải mái và êm ái với Fom ôm khít mắt nên khi đi xe sẽ loại bỏ được hoàn toàn&nbsp;các yếu tô như nắng, gió và bụi bặm.</p>\n<p>Thiết kế thời trang, phong cách. Chất liệu khung kính làm từ nhựa PC, mắt kính không gây mỏi mắt, đau mắt khi đeo trong nhiều giờ liên tục.&nbsp;</p>\n<p>&nbsp;Kính có 3 loại màu: Màu đen kính dâm, màu vàng, và màu trắng. Kích thước 140*120*42MM<em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-1.jpg?v=1535000171573\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-3.jpg?v=1535000180520\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-2.jpg?v=1535000209949\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-4.jpg?v=1535000191977\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-5-5e4fba8c-5be0-4794-8f6e-61615a21fdb3.jpg?v=1535000264184\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-dam-xe-may-7.jpg?v=1535000233558\" /></strong></em></p>', '', 'Kính mắt', 'Kính dâm, Kính dâm chống nắng chống tia UV, kính dâm chống tia uv, KÍNH ĐI XE MÁY, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '75000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12468218/kinh-dam-chong-nang-chong-tia-uv-di-xe-may-uv400.jpg', '<p>Thiết kế thời trang, phong cách. Chất liệu khung kính làm từ nhựa PC, mắt kính không gây mỏi mắt, đau mắt khi đeo trong nhiều giờ liên tục.&nbsp;</p>\n\n<p>&nbsp;Kính có 3 loại màu: Màu đen ', '12468218', '20167389', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:12', '2024-05-29 06:17:12'),
(1412, 'boc-ghe-o-to-cao-cap-bg04', 'Bọc ghế ô tô cao cấp BG04', '<p><em><strong>Bọc ghế ô tô cao cấp BG04</strong></em></p>\n<p>&nbsp;Bộ bọc ghế ô tô cao cấp bền đẹp từ&nbsp;chất liệu&nbsp;da PU cao cấp chắc chắn đến từng chi tiết. Thiết kế 3D, dạng nhiều mảnh nên khi bọc lên ghế, mỗi mảnh ôm 1 phần ghế, làm cho phom ghế chuẩn như thiết kế sản xuất.</p>\n<p>Toàn bộ sản phẩm là&nbsp;màu đen tạo lên sự sang trọng cho không gian xe của bạn.</p>\n<p>Sản phẩm phù hợp với tất cả các loại xe 5 chỗ, ghế to dầy cũng như ghế nhỏ đều có thể bọc được. Dễ tháo lắp, dễ vệ sinh, dễ thay đổi. Kiểu dáng thời trang và sang trọng.</p>\n<p>&nbsp;Bộ sản phẩm đầy đủ: Bộ bọc ghế trước và sau với giá chỉ 1.500.000vnđ, một bộ có thêm&nbsp;2 gối tựa đầu và 2 gối tựa&nbsp;lưng giá chỉ&nbsp;1.800.000</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-09.jpg?v=1534924927104\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-1.jpg?v=1534924597155\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-4.jpg?v=1534924692819\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-3.jpg?v=1534924700263\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-2.jpg?v=1534924708711\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-5.jpg?v=1534924780788\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-ghe-xe-hoi-cao-cap-bg04-06.jpg?v=1534924788984\" /></p>', '', 'Bọc ghế', 'bọc ghế, bọc ghế da, Bọc ghế ô tô, Bọc ghế ô tô cao cấp BG04, bọc ghế xe hơi, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'Bộ không gối', '', '', '', '', '', '', '', 'deny', '', '1500000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/12463127/boc-ghe-o-to-cao-cap-bg04.jpg', '<p>Toàn bộ sản phẩm là&nbsp;màu đen tạo lên sự sang trọng cho không gian xe của bạn.</p>\n\n<p>Sản phẩm phù hợp với tất cả các loại xe 5 chỗ, ghế to dầy cũng như ghế nhỏ đều có thể bọc được. Dễ', '12463127', '20158984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:21', '2024-05-29 06:17:21'),
(1413, 'boc-vo-lang', 'Bọc vô lăng vải dệt kim cao cấp cho nữ', '<p><em><strong>Bọc vô lăng vải dệt kim cao cấp cho nữ</strong></em></p>\n<p>&nbsp;Bọc vô lăng làm từ chất liệu&nbsp;vải dệt&nbsp;kim cực kì sang trọng và đẹp mắt với xu hướng thiên nhiên bốn mùa thêu tên&nbsp;bề mặt thêm nối các họa&nbsp;tiết hoa lá cánh bướm đẹp mắt, phù hợp cho các lái xe nữ giới.</p>\n<p>Chất liệu cầm êm và chắc tay thấm mồ hôi tốt không trơn trượt khi lái xe.&nbsp;</p>\n<p>Đường kính 38cm phù hợp với hầu hết các dòng xe trên thị trường hiện nay ở Việt Nam&nbsp;</p>\n<p>Chia làm 3 loại với các họa tiết thêu khác nhau: trái&nbsp;cherry, cánh bướm, hình hoa.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-4.jpg?v=1534823096791\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-5.jpg?v=1534823107255\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-2.jpg?v=1534823114020\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-1.jpg?v=1534823121081\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-6.jpg?v=1534823353539\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-thien-nhien-7.jpg?v=1534823360838\" /></p>', '', 'Bọc vô lăng', 'ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'cherry', '', '', '', '', '', '', '', 'deny', '', '99000', '250000', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12453681/boc-vo-lang.jpg', '<p>&nbsp;</p>\n\n<p>Chất liệu cầm êm và chắc tay thấm mồ hôi tốt không trơn trượt khi lái xe.&nbsp;</p>\n\n<p>Đường kính 38cm phù hợp với hầu hết các dòng xe trên thị trường hiện nay ở Việt Nam&n', '12453681', '20142444', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:22', '2024-05-29 06:17:22'),
(1414, 'am-tra-dien-cao-cap-jinqi', 'Ấm trà điện cao cấp JINQI', '<p><strong><em>Ấm trà điện cao cấp JINQI</em></strong></p>\n<p>&nbsp;Bộ ấm trà điện&nbsp;cao cấp với vỏ ấm làm&nbsp;từ thủy tinh&nbsp;Thủy tinh borosilicate&nbsp;trong suốt, pha trà đặc biệt không còn tình trạng nước với bã chèn ngâm lẫn với nhau mà nước chèn sẽ được giỏ từng giọt xuống qua tấm chè.</p>\n<p>&nbsp;Ấm sử dụng đơn giản với núm công tắc có chế độ làm việc khác nhau: chế độ tự động ngắt điện khi đến nhiệt độ sôi nhất định và tự bật lên khi nhiệt độ giảm xuống; chế độ thủ công là bạn được tự tắt bật.</p>\n<p>Nguyên lý làm việc của mấm như ấm điện bình thường, nhưng pha trà bạn chỉ cần cho phần trà lên trên tấm lọc khi nhiệt độ sôi nước và hơi nước sẽ được đẩy lên tưới lên phần trà bên trên và rỏ giọt xuống hòa&nbsp;với phầm ngước sôi bên dưới.</p>\n<p>Sử dụng điện&nbsp;gia đình 220V, công suất 600W, vỏ và tay cầm cách điện an toàn cho người sử dụng, thể tích 1Lít</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-4.jpg?v=1534817381366\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-2-d9ec1c96-7470-46bb-9e88-7de50611fb34.jpg?v=1592819672381\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-3.jpg?v=1534817389986\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-1.jpg?v=1534817415102\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-2.jpg?v=1534817400546\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/am-tra-dien-1-980f27e5-6192-4948-9377-5d08cf6d8615.jpg?v=1592819473753\" /></p>', '', 'Ấm trà điện', 'ấm điện, ấm trà, Ấm trà điện, Ấm trà điện cao cấp JINQI, Volcano, volcano.vn', '1', 'Kích thước', 'Đen', '', '', '', '', '', '', '', 'deny', '', '590000', '', '1', '', '', NULL, '', '', '', '2.5', 'kg', 'images/12449646/am-tra-dien-cao-cap-jinqi.jpg', '<p>Nguyên lý làm việc của mấm như ấm điện bình thường, nhưng pha trà bạn chỉ cần cho phần trà lên trên tấm lọc khi nhiệt độ sôi nước và hơi nước sẽ được đẩy lên tưới lên phần trà bên trên và ', '12449646', '20135095', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:26', '2024-05-29 06:17:26'),
(1415, 'boc-vo-lang-tho-cam-phong-cach-dan-toc', 'Bọc vô lăng thổ cẩm phong cách dân tộc', '<p><strong><em>Bọc vô lăng thổ cẩm phong cách dân tộc</em></strong></p>\n<p>&nbsp; Vô lăng không quá to, quá dày so với miếng bọc bán sẵn với chất liệu từ sợi lanh đan êm ái mang lại cảm giác chắc chắn khi cầm vô lăng!<br />\n&nbsp;Các đường nết hoa văn tính thế thể hiện rõ được phong cách thổ cẩm dân tộc, chắc chắn sẽ là một điểm mới lạ cho xế yêu của bạn.</p>\n<p>Đường kính 38cm phù hợp lắp đặt với&nbsp;đa số vô lăng của&nbsp;các dòng xe hiện nay ở Việt Nam</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-tho-cam-phong-cach-dan-toc-1.jpg?v=1534735054734\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-tho-cam-phong-cach-dan-toc-2.jpg?v=1534735063756\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-tho-cam-phong-cach-dan-toc-5.jpg?v=1534735074412\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-tho-cam-phong-cach-dan-toc-3.jpg?v=1534735086782\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-tho-cam-phong-cach-dan-toc-6.jpg?v=1534735094608\" /></em></strong></p>', '', 'Bọc vô lăng', 'Bọc vô lăng, bọc vô lăng đẹp, Bọc vô lăng ô tô, bọc vô lăng phong cách, Bọc vô lăng thổ cẩm phông cách dân tộc, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Nâu đỏ', '', '', '', '', '', '', '', 'deny', '', '150000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12447373/boc-vo-lang-tho-cam-phong-cach-dan-toc.jpg', '<p>&nbsp; Vô lăng không quá to, quá dày so với miếng bọc bán sẵn với chất liệu từ sợi lanh đan êm ái mang lại cảm giác chắc chắn khi cầm vô lăng!<br />\n&nbsp;Các đường nết hoa văn tính thế th', '12447373', '20130189', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:30', '2024-05-29 06:17:30'),
(1416, 'bo-moi-cung-bi-trong-cau-lure-kem-hop-dung', 'Bộ mồi cứng bi trong câu lure kèm hộp đựng', '<p><em><strong>Bộ mồi cứng bi trong câu lure kèm hộp đựng</strong></em></p>\n<p>&nbsp;Là tập hợp những&nbsp;mồi giả chuyên lure thuộc&nbsp;thể loại viberation với kết cấu khuôn đẹp, sắc nét, mồi&nbsp; được trang bị mắt 3d, lưỡi 3 tiêu&nbsp;siêu chắc,...Vô cùng thích hợp để câu những con cá săn mồi như cá lóc, chẽm, tráp, mú ...</p>\n<p>&nbsp;Hộp đựng kèm&nbsp;theo thiện dụng với 5 ngăn, kích thước: 18*10*3cm,&nbsp;giúp bạn luôn phân riêng các mẫu mồi khác nhau sau khi sử dụng.</p>\n<p>&nbsp;Tất cả các mồi đều là mồi cứng có bi trong kích thước thừ 3 đến 8cm, trọng lượng 3 dến 10gram&nbsp;màu sắc thu hút cá.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-5.jpg?v=1534326772359\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-1.jpg?v=1534326781509\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-3.jpg?v=1534326794369\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-4.jpg?v=1534326803720\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-6.jpg?v=1534326845179\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hop-moi-vib-lure-7.jpg?v=1534326852918\" /></p>', '', 'Mồi lure', 'Bộ mồi cứng bi trong câu lure kèm hộp đựng, mồi giả, mồi giatr, mồi lure, Volcano, volcano.vn', '1', 'Phân loại', 'Bộ 5 mồi', '', '', '', '', '', '', '', 'deny', '', '138000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12413915/bo-moi-cung-bi-trong-cau-lure-kem-hop-dung.jpg', '<p>Hộp đựng kèm&nbsp;theo thiện dụng với 5 ngăn, kích thước: 18*10*3cm,&nbsp;giúp bạn luôn phân riêng các mẫu mồi khác nhau sau khi sử dụng.</p>\n\n<p>&nbsp;Tất cả các mồi đều là mồi cứng có bi', '12413915', '20064941', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:32', '2024-05-29 06:17:32'),
(1417, 'vai-chiu-nhiet-va-day-dan-nhiet-may-hut-chan-khong-10m-vai-5m-day-nhiet', 'Vải chịu nhiệt và dây dẫn nhiệt máy hút chân không (10M vải+5M dây nhiệt )', '<p><em><strong>Vải chịu nhiệt và dây dẫn nhiệt máy hút chân không (10M vải+5M dây nhiệt )</strong></em></p>\n<p>&nbsp;Sau khi dùng 1 thời gian thì đường hàn mép túi hút chân không có hiện tưởng bị cháy xém.Hiện tượng này báo hiệu dây hàn của máy hút chân không vẫn hàn được,còn vải nhiệt đã bị cháy,cần phải bóc ra và thay lớp vải nhiệt mới. Trường hợp 2 là dây hàn dẫn nhiệt bị đứt bạn cũng phải thay dây hàn mới cho máy hút chân không.</p>\n<p>&nbsp;Sản phẩm Vải chịu nhiệt và dây dẫn nhiệt máy hút chân không bao gồm 5M dây hàn (500*1CM&nbsp;) và cuộn 10M vải chịu nhiệt (1000*2.5cm) dễ dàng thay thế và lắp đặt.</p>\n<p>Sản phẩm có bán theo combo và bán lẻ dây và vải khách hàng vui lòng chọn đúng phân loại hàng hóa trước khi đặt hàng.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-chiu-nhiet-5.jpg?v=1533265959008\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-chiu-nhiet-2.jpg?v=1533265966327\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-chiu-nhiet-8.jpg?v=1533265978125\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-chiu-nhiet-1.jpg?v=1533265985180\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/vai-chiu-nhiet-4.jpg?v=1533265993398\" /></p>', '', 'Vải chịu nhiệt và dây dẫn nhiệt máy hút chân không', 'Volcano, volcano.vn', '1', 'phân loại', 'Vải chịu nhiệt 10M', '', '', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12320770/vai-chiu-nhiet-va-day-dan-nhiet-may-hut-chan-khong-10m-vai-5m-day-nhiet.jpg', '<p>Sau khi dùng 1 thời gian thì đường hàn mép túi hút chân không có hiện tưởng bị cháy xém.Hiện tượng này báo hiệu dây hàn của máy hút chân không vẫn hàn được,còn vải nhiệt đã bị cháy,cần phả', '12320770', '19861308', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:40', '2024-05-29 06:17:40'),
(1418, 'moi-lure-kim-loai', 'Mồi lure kim loại phiên bản người lớn', '<p><em><strong>Mồi lure kim loại phiên bản người lớn</strong></em></p>\n<p>&nbsp;Mồi câu chuyên lure thiết kế từ kim loại nặng từ 10 đến 25G kiểu hình đáng độc dáo mang tinh giải trí , nhưng cũng&nbsp;không kem phần hiệu quả với lưỡi 3 tiêu sắc bén chống gỉ, mồi mạ màu trắng bóng khi xuống nước chắc chắn sẽ rất nổi bật và thu hút nhiều loại cá.</p>\n<p>Kích thước mồi: 4.5cm-10g, 5,5cm-15g, 6,5cm-20G</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-ca-chim-2.jpg?v=1533091905823\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-ca-chim-3.jpg?v=1533091918055\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-ca-chim-1-d0c8bfd5-8b02-4049-a56c-3261f42e1cd2.jpg?v=1533092092436\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-ca-chim-5.jpg?v=1533092110714\" /></strong></em></p>', '', 'Mồi lure', 'mồi câu, mồi lure, mồi lure dẹp, mồi sắt, Volcano, volcano.vn', '1', 'Kích thước', '10G', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12297709/moi-lure-kim-loai.jpg', '<p>&nbsp;Mồi câu chuyên lure thiết kế từ kim loại nặng từ 10 đến 25G kiểu hình đáng độc dáo mang tinh giải trí , nhưng cũng&nbsp;không kem phần hiệu quả với lưỡi 3 tiêu sắc bén chống gỉ, mồi ', '12297709', '19818881', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:45', '2024-05-29 06:17:45');
