(1419, 'moi-lure-cung-bi-trong-4-8cm', 'Mồi lure cứng bi trong 4-8cm', '<p><em><strong>Mồi lure cứng bi trong 5.5cm</strong></em></p>\n<p>&nbsp;Câu lure đang dần dần phát triển tại Việt Nam nói chung và các vùng nói riêng,&nbsp;được các&nbsp;cần thủ&nbsp;chào đón 1 cách nhiệt tình và hào hứng...</p>\n<p>&nbsp;Ưu điểm câu lure mồi câu sử dụng được nhiều lần, câu được nhiều loại cá khác nhau, không sợ tay dính bẩn khi pha mồi, bóp mồi, phù hợp cả môi trường nước mặn và nước ngọt</p>\n<p><em><strong>Mồi lure cứng bi trong 5.5cm&nbsp;</strong></em>Phù hợp câu cá loại&nbsp;cá lóc, cá chiên, trê,mú, nhồng, chẽm, măng..(mồi câu phù hợp nước ngọt và nước mặn) hiệu quả</p>\n<p data-mce-style=\"font-size: 12px; text-align: center;\">Chất liệu : nhựa cứng ABS , action đẹp, lưỡi câu 3 tiêu sắc và bén. Sử dụng công nghệ Sơn PS đẹp như vẽ bằng tay gây kích thích khả năng săn mồi của cá</p>\n<p data-mce-style=\"font-size: 12px; text-align: center;\">Trọng lượng: Chiều dài: 5.5CM màu sắc nổi bật, bi trong nghe thanh thu hút cá&nbsp;</p>\n<p>Mỗi lần câu xong vui lòng ngâm lại bằng nước ngọt, tránh bị gỉ sét lưỡi câu.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-5.jpg?v=1532917986575\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-6.jpg?v=1532917999265\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-7.jpg?v=1532918005983\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-4.jpg?v=1532918014161\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-2.jpg?v=1532918021788\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lure-bi-trong-1.jpg?v=1532918029694\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Mồi giả', '', '1', 'Kiểu dáng', 'Cá gầy', 'Màu sắc', 'xanh lá', '', '', '', '', '', 'deny', '', '39000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/12277943/moi-lure-cung-bi-trong-4-8cm.jpg', '', '12277943', '19785045', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:48', '2024-05-29 06:17:48'),
(1420, 'giay-nu-got-thap-de-vuong', 'Giày nữ gót thấp đế vuống G558', '<p><em><strong>Giày nữ gót thấp đế vuống G558</strong></em></p>\n<p>&nbsp;Với mẫu thiết kế này, các bạn nữ dễ dàng phối hợp cùng nhiều phong cách quần áo hoặc đầm cho từng dịp khác nhau. Chất liệu da PU cao cấp, có thêm dây đeo ngang tạo lên sự chắc chắn khi đeo, gót làm từ nhựa cứng đế vuông thấp giúp bạn đeo chắn chắn với từng bước di chuyển với 2 màu&nbsp;nâu và kem cho các bạn nữ lựa chọn</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/got-thap-de-vuong-2.jpg?v=1532418289699\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/got-thap-de-vuong-v1.jpg?v=1532418296551\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/got-thap-de-vuong-v3.jpg?v=1532418307296\" /></strong></em></p>', '', 'Giày nữ', 'giày gits thấp, giày gót thấp, giầy gót vuông, Giày nữ, Volcano, volcano.vn', '1', 'Màu sắc', 'Trắng', 'Size', '35', '', '', '', '', '0', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '0', 'kg', 'images/12238060/giay-nu-got-thap-de-vuong.jpg', '<p>&nbsp;Với mẫu thiết kế này, các bạn nữ dễ dàng phối hợp cùng nhiều phong cách quần áo hoặc đầm cho từng dịp khác nhau. Chất liệu da PU cao cấp, có thêm dây đeo ngang tạo lên sự chắc chắn k', '12238060', '19714098', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:55', '2024-05-29 06:17:55'),
(1421, 'logo-bieu-tuong-cho-xe-jeep-renegade-trail-rated', 'Logo biểu tượng Rail Rated cho xe Jeep Cross Country', '<p><em><strong>Logo biểu tượng Rail Rated cho xe Jeep Cross Country</strong></em></p>\n<p>Logo kim loại&nbsp;Rail Rated biểu tượng riêng cho xe&nbsp;Jeep Cross Country thiết kế tinh tế và đẹp mắt từ chất liệu đến màu sắc ,</p>\n<p>Dán trang trí đơn giản lên vỏ xe với đường kính 6.3cm và dày 0,5cm.</p>\n<p>Lưu ý vệ sinh sạch và lau khô trước khi dán lên vỏ xe và không rửa xe trong 24h để đảm bảo&nbsp;được độ kết dính của keo<em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-6.jpg?v=1532330441824\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-7.jpg?v=1532330452053\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-1-e5e05b2c-9c35-4326-9ab3-27ff52ebf7a8.jpg?v=1532330275782\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-3-45ed300c-c185-442a-8aaf-d89c16ee6f64.jpg?v=1532330281864\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-2-b952fbcc-bd3e-4186-9f1f-8eba20b9d320.jpg?v=1532330288308\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-4.jpg?v=1532330295286\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-traol-rated-dan-xe-8.jpg?v=1532331154910\" /></strong></em></p>', '', 'Logo dán xe', 'Logo biểu tượng cho xe Jeep Renegade Trail Rated, logo dán ô tô, logo dán xe, logo ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '99000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12228070/logo-bieu-tuong-cho-xe-jeep-renegade-trail-rated.jpg', '<p>Logo kim loại&nbsp;Rail Rated biểu tượng riêng cho xe&nbsp;Jeep Cross Country thiết kế tinh tế và đẹp mắt từ chất liệu đến màu sắc,</p>\n\n<p>Dán trang trí đơn giản lên vỏ xe với đường kính ', '12228070', '19689878', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:56', '2024-05-29 06:17:56'),
(1422, 'lop-xe-may-khong-xam-110-90-17', 'Lốp sau xe moto không xăm off-road 110/90-17, 110/90-16', '<h1><em><strong>Lốp sau xe moto không xăm off-road 110/90 -17, 110/90 -16</strong></em></h1>\n<p>&nbsp; Lốp xe máy chất liệu là các sợi cao su siêu bền bỉ, đáp ứng được nhiều điều kiện thời tiết từ nắng, mưa đến lạnh…&nbsp;Các đường rãnh khá sâu, nhiều và kết thành mạng nhện đẹp mắt, chống mòn chóng trơn cực tốt.</p>\n<p>&nbsp;Kích thước&nbsp;110/90-17 và&nbsp;110/90-16&nbsp;phù hợp với các dòng xe cao, phân khối lớn có vành với đường kính 17Icnh.</p>\n<p>Để xác đinh đúng với xe bạn nên xem kĩ thông số lốp:</p>\n<p>110:&nbsp;Là bề rộng của lốp, tính bằng mm.<br />\n90:&nbsp;Là % chiều cao của lốp so với bề rộng của lốp. Như vậy ở đây chiều cao của lốp là: 100%*90 = 90 mm<br />\n17: Là đường kính danh nghĩa của vành và được tính bằng đơn vị inchs.</p>\n<p>Phân loại theo gai lốp LV1, LV2, LV3.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-6.jpg?v=1592967761267\" /><br />\n<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-2.jpg?v=1532318395094\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-1.jpg?v=1532318403925\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-4-85d3f37e-1672-47d0-bcd7-33a763d4bf1f.jpg?v=1592970246987\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-5.jpg?v=1532318422762\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/lop-xe-110-10-17-3.jpg?v=1532318429668\" /><br />\n&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Lốp xe máy', '', '1', 'Phân loại', 'VL1', 'Kích thước', '110/90-17', '', '', '', '', '', 'deny', '', '550000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/12226701/lop-xe-may-khong-xam-110-90-17.jpg', '<p>&nbsp;Kích thước&nbsp;110/90-17 và&nbsp;110/90-16&nbsp;phù hợp với các dòng xe cao, phân khối lớn có vành với đường kính 17Icnh. Để xác đinh đúng với xe bạn nên xem kĩ thông số lốp:</p>\n<p', '12226701', '21683489', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:17:57', '2024-05-29 06:17:57'),
(1423, 'ba-lo-dung-do-cau-va-phu-kien-leo-fishing-27746', 'Ba lô đựng đồ câu và phụ kiện Leo Fishing 27746', '<p><em><strong>Ba lô đựng đồ câu và phụ kiện Leo Fishing 27746</strong></em></p>\n<p>&nbsp;Ba lô đụng đồ câu vô cùng tiện lợi với chiều dài từ&nbsp;1M đến 1,5m phù hợp cho các cần đứng dài mà túi nhỏ không đựng được, kiểu dáng cao thời trang màu xanh và mà đen rất được ưa chuộng.</p>\n<p>&nbsp;Chất liệu vải bên trong là lớp nilon chống thấm nước, có dây đeo và dây xách tiện dụng, có 2 ngăn chính mỗi ngăn đều có 2 kháo chắc chắn, thêm một ngăn chuyên đựng cần ở ngoài cùng.</p>\n<p>&nbsp;Có 2 kích thước cho khách hàng lựa chọn: 1M và 1.5M</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-10.jpg?v=1532148512488\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-15.jpg?v=1532148521397\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-16.jpg?v=1532148529272\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-11.jpg?v=1532148536504\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-13.jpg?v=1532148544499\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-14.jpg?v=1532148551100\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dung-do-cau-va-phu-kien-leo-fishing-9.jpg?v=1532148558845\" /><img data-thumb=\"original\" original-height=\"