(1424, 'giay-the-thao-nu-f801', 'Giày thể thao nữ F801', '<p><strong><em><span style=\"font-size:14px;\">Giày thể thao nữ F801</span></em></strong></p>\n<p>Đôi giày cực đẹp và thanh lịch, màu đen trắng và màu trắng cực chất, phối cực hợp với quần kaki, jean hay thậm chí là quần thể thao mà vẫn giúp&nbsp;bạn cực nổi bật...&nbsp;Là đôi giày dẫn đầu trong việc đáp ứng nhanh chóng những trào lưu xu hướng thời trang mới nhất, luôn mang đến làn gió mới xu hướng thời trang năng động và cá tính. Lựa chọn đôi mẫu giày này sẽ&nbsp;&nbsp;là quyết định hoàn hảo giúp các&nbsp;cô gái&nbsp;càng tỏa sáng và nổi bật nhât.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f108-3.jpg?v=1531965366769\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f108-1.jpg?v=1531965376275\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f108-4.jpg?v=1531965389744\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f108-5.jpg?v=1531965399342\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f108-8.jpg?v=1531965407783\" /></p>', '', 'giày nữ', 'giày NỮ, giày thể thao nữ, giày thể thao nữ F801, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Size', '35', '', '', '', '', '0', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '1.2', 'kg', 'images/12197416/giay-the-thao-nu-f801.jpg', '<p>Đôi giày cực đẹp và thanh lịch, màu đen trắng và màu trắng cực chất, phối cực hợp với quần kaki, jean hay thậm chí là quần thể thao mà vẫn giúp&nbsp;bạn cực nổi bật...&nbsp;Là đôi giày dẫn', '12197416', '19639781', NULL, NULL, NULL