(1425, 'day-cau-ca-material-from-japan-100m', 'Dây câu cá Material From Japan 100M', '<p><strong><em>Dây câu cá Material From Japan 100M</em></strong>&nbsp;</p>\n<p>&nbsp;Dây câu cũng là một trong những dụng cụ câu quan trọng ngoài máy câu và cần câu đòi hỏi bất cứ người nào muốn đi câu cũng phải đầu tư sao cho chất lượng, thông số kỹ thuật phù hợp với máy và cần.&nbsp;</p>\n<p>Dây câu&nbsp;Dây câu cá Material From Japan có ghi rõ thông số là tải trọng của dây giúp bạn chọn lựa chọn size dây phù hợp nhất. Dây có&nbsp;màu xanh trong được rất nhiều cần thủ ưa chuộng, size từ 1.0 đến 1.8 tải từ 7.1 đến 19.1CM, đường kính dây từ 0.165 đến 0.5MM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-material-100m-3.jpg?v=1531890089139\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-material-100m-1.jpg?v=1531890097322\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-material-100m-4.jpg?v=1531890117119\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-material-100m-6.jpg?v=1531890154672\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/day-cau-ca-material-100m-5.jpg?v=1531890232865\" /></p>', '', 'Dây câu cá', 'câu cá, cước câu cá, day cuoc cau cá, day cước câu cá, Volcano, volcano.vn', '1', 'Side', '0.4', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/12191001/day-cau-ca-material-from-japan-100m.jpg', '<p>&nbsp;Dây câu cũng là một trong những dụng cụ câu quan trọng ngoài máy câu và cần câu đòi hỏi bất cứ người nào muốn đi câu cũng phải đầu tư sao cho chất lượng, thông số kỹ thuật phù hợp vớ', '121