(1426, 'giay-the-thao-nu-supeme-f18', 'Giày thể thao nữ Supeme F18', '<p><em><strong>Giày thể thao nữ Supeme F18</strong></em></p>\n<p>Với thiết kế độc đáo đẹp mắt mang phong cách năng động, trẻ trung dành cho các bạn nữ. Giày thể thao nữ Supeme chắc chắn sẽ là một sự lựa chọn tuyệt vời&nbsp;cho những bạn yêu thể thao vận động di chuyển nhiều.</p>\n<p>Chất liệu vải lanh đan dày siêu mát thấm mồ tốt.&nbsp;Phần đế giày với thiết kế thời trang tạo cảm giác&nbsp;thoải mái và độ êm tuyệt đối cho người đi.</p>\n<p>Màu sắc: đen-đỏ và đen-vàng</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f18-1.jpg?v=1531882308845\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f18-3.jpg?v=1531882322893\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f18-5.jpg?v=1531882341425\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-the-thao-nu-f18-7.jpg?v=1531882377085\" /></strong></em></p>', '', 'Giày nữ', 'Volcano, volcano.vn', '1', 'Màu sắc', 'Đen-vàng', 'Size', '35', '', '', '', '', '0', 'deny', '', '230000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12185647/giay-the-thao-nu-supeme-f18.jpg', '<p>&nbsp;</p>\n\n<p>Với thiết kế độc đáo đẹp mắt mang phong cách năng động, trẻ trung dành cho các bạn nữ. Giày thể thao nữ Supeme chắc chắn sẽ là một sự lựa chọn tuyệt vời&nbsp;cho những bạn y', '12185647', '19627911', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:15', '2024-05-29 06:18:15'),
(1427, 'dep-quai-hau-nu-sanh-dieu-d9802', 'Dép quai hậu nữ sành điệu D8902', '<p><em><strong>Dép quai hậu nữ sành điệu D8902</strong></em></p>\n<p>&nbsp;Với kiểu dáng thiết kế đẹp, phong cách&nbsp;phù hợp hơn với thẩm mỹ của nhiều bạn trẻ.&nbsp;</p>\n<p>Dép có cổ điển với quai dán&nbsp;không bao giờ lỗi mốt. Dây da PU bền bỉ, đường chỉ chắc chắn đến từng chi tiết</p>\n<p>Màu sắc đẹp với màu đen chủ đạo, dây dép là một lớp màu đen bóng chống thấm nước giúp bạn giữ được dép lâu và bền hơn, đế làm từ cap su dày cau 5cm tạo rãnh chống trơn trượt tuyệt đối</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dep-nu-8902-v10.jpg?v=1532422460035\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dep-nu-8902-v9-75d10c6c-c5e3-4c2a-ba91-d7ee65ec5f93.jpg?v=1532423130052\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dep-quai-1.jpg?v=1532424437459\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dep-quai-4.jpg?v=1532424886452\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dep-quai-2.jpg?v=1532424893863\" /></p>', '', 'Dép quai hậu nữ', 'dép cho nữ, dep dẹp, dep hot, dep nữ, Dép quai hậu nữ, Dép quai hậu nữ sành điệu, Dép quai hậu nữ sành điệu D9802, quai hậu nữ, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', 'Size', '35', '', '', '', '', '', 'deny', '', '180000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12180654/dep-quai-hau-nu-sanh-dieu-d9802.jpg', '<p>&nbsp;Với kiểu dáng thiết kế đẹp, phong cách&nbsp;phù hợp hơn với thẩm mỹ của nhiều bạn trẻ.</p>\n\n<p>Dép có cổ điển với quai dán&nbsp;không bao giờ lỗi mốt. Màu sắc đẹp với màu đen chủ đạo', '12180654', '19605934', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:16', '2024-05-29 06:18:16'),
(1428, 'giay-bet-luoi-dinh-da-cho-nu-g168-18', 'Giày bệt lưới đính đá cho nữ G168-18', '<p><em><strong>Giày bệt lưới đính đá cho nữ G168-18</strong></em></p>\n<p>Nếu như giày cao gót&nbsp;khiến bạn không được thoải mái khi di chuyển vậy thì đôi&nbsp;giày bệt sẽ giải quyết cho bạn vấn đề đó</p>\n<p>Với chất liệu PU nhân tạo&nbsp;cao cấp thoáng mát, phù hợp cho cả ngày hè và mùa đông&nbsp;thiết kế kiểu dáng đơn giản với phong cách&nbsp;trẻ trung và&nbsp;tinh tế với với những họa tiết trên giày được đính đá cục kì nổi bật bên trong là lớp lưới giúp cho giày thông hơi cục tốt, lót trong êm ái thoải mái.</p>\n<p>&nbsp;Phần đế làm cao su đặc&nbsp;dày và&nbsp;dẻo giúp đôi chân được thoải mái nhất khi di chuyển,&nbsp;phần gót cao 1,2cm chắc chắn sẽ cho bạn những bước di chuyển nhanh và tự tin nhất</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-bet-dinh-da1.jpg?v=1532165912076\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-bet-dinh-da3.jpg?v=1532165921451\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-bet-dinh-da2.jpg?v=1532165928386\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-bet-dinh-da4.jpg?v=1532165935910\" /></p>', '', 'giày bệt nữ', '', '1', 'Màu sắc', 'Trắng', 'Size', '35', '', '', '', '', '0', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12177727/giay-bet-luoi-dinh-da-cho-nu-g168-18.jpg', '<p>Với chất liệu PU nhân tạo&nbsp;cao cấp thoáng mát, phù hợp cho cả ngày hè và mùa đông&nbsp;thiết kế kiểu dáng đơn giản với phong cách&nbsp;trẻ trung và&nbsp;tinh tế với với những họa tiết ', '12177727', '19674317', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, N