(1430, 'tai-nghe-in-ear-cho-iphone-4-5-6-6s-6splus-6plus', 'Tai nghe In-Ear cho Iphone 4,5,6,6s,6splus,6plus', '<p><em><strong>Tai nghe In-Ear cho Iphone 4,5,6,6s,6splus,6plus</strong></em></p>\n<p>&nbsp;Dây tai nghe được làm bằng cao su cao cấp, chất dây mềm mịn. Chất lượng âm thanh nhiều bass, treble nghe sâu, 2 bên tai trái phải phân biệt rõ ràng.</p>\n<p>Được sản xuất bằng nhựa cao cấp, nhìn bóng và sáng, độ bền cao, có khả năng chống mồ hôi và nước.&nbsp; Điều khiển nhạc, video, chụp ảnh. Tính năng trả lời và kết thúc cuộc gọi bằng tai nghe.</p>\n<p>&nbsp;Tai nghe&nbsp;iPhone 6/6 Plus&nbsp;có bộ sản phầm gồm có tai nghe + hộp đựng</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-9.jpg?v=1530934964517\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-8.jpg?v=1530934971881\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-3.jpg?v=1530934988734\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-11.jpg?v=1530935003950\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-2.jpg?v=1530935012557\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-4.jpg?v=1530935022151\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-6.jpg?v=1530935030372\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-7.jpg?v=1530935037948\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nghe-cho-ip-1.jpg?v=1530935072318\" /></strong></em></p>', '', 'Tai nghe IPHONE', '5, 6, 6plus, 6s, 6splus, tai nghe, Tai nghe In-Ear cho Iphone, Tai nghe In-Ear cho Iphone 4, tai nghe iphone, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/12114583/tai-nghe-in-ear-cho-iphone-4-5-6-6s-6splus-6plus.jpg', '<p>Dây tai nghe được làm bằng cao su cao cấp, chất dây mềm mịn. Chất lượng âm thanh nhiều bass, treble nghe sâu, 2 bên tai trái phải phân biệt rõ ràng.</p>\n\n<p>Được sản xuất bằng nhựa cao cấp', '12114583', '19443677', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:29', '2024-05-29 06:18:29'),
(1431, 'den-led-san-vuon-nang-luong-mat-troi-hinh-kim-cuong', 'Đèn led sân vườn năng lượng mặt trời hình kim cương', '<p><em><strong>Đèn led sân vườn năng lượng mặt trời hình kim cương</strong></em></p>\n<p>&nbsp;Đèn led trang trí&nbsp;sân vườn năng lượng mặt trời được thiết kế kiểu dáng hình viên kim cương 3D đẹp mắt kết hợp với cảm biến cảm anh sáng, ban ngày đèn&nbsp;sẽ tích trữ năng lượng từ ánh sáng mặt trời để sạc cho pin, buổi tối khi&nbsp;đèn sẽ tự động bật lên để chiếu sáng tạo lên ánh sáng đẹp mắt.</p>\n<p>Sản phẩm dùng để trang trí cho không gian sân vườn, hành lang, thảm cỏ trong, lối đi trong ngôi nhà bạn, ban ngày tận dụng nguồn năng lượng xanh từ mặt trời, ban đêm có thể chiếu sáng và trang trí cho ngôi nhà bạn.</p>\n<p>Nguồn sạc: Pin năng lượng mặt trời 2V, 40mA</p>\n<p>Kích thước: 65*80*300mm, số led: 1 Led</p>\n<p>Chế độ hoạt động: tắt bật bằng công tắc</p>\n<p>Thời gian sạc: 4 giờ ( sạc đầy tự ngắt), thời gian chiếu sáng: 6-10 giờ.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-trang-tri-san-vuon-nhieu-mau-nang-luong-mat-troi-d2.jpg?v=1530866934758\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-trang-tri-san-vuon-nhieu-mau-nang-luong-mat-troi-d1.jpg?v=1530867086745\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-trang-tri-san-vuon-nhieu-mau-nang-luong-mat-troi-v1.jpg?v=1530866079453\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-trang-tri-san-vuon-nhieu-mau-nang-luong-mat-troi-v3.jpg?v=1530866088631\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-trang-tri-san-vuon-nhieu-mau-nang-luong-mat-troi-v2.jpg?v=1530866097427\" /></p>\n<p>Đèn cắm sân vườn năng lượng mặt trời kim cương phát&nbsp;ánh sáng trong phạm vi ~ 0.5mét – 1mét &nbsp;nên thường được thiết kế cắm mỗi cây cách nhau 1 mét trong sân vườn sẽ tạo cảnh đẹp, ánh sáng mờ ảo làm lung linh khu vườn nhà bạn.</p>', '', 'Đèn led sân vườn', 'đền led năng lượng mặt trời, đèn led sân vườn, đèn led trang trí sân vườn, Volcano, volcano.vn', '1', 'Màu sắc', 'Ánh sáng đổi màu', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12110130/den-led-san-vuon-nang-luong-mat-troi-hinh-kim-cuong.jpg', '<p>Sản phẩm dùng để trang trí cho không gian sân vườn, hành lang, thảm cỏ trong, lối đi trong ngôi nhà bạn, ban ngày tận dụng nguồn năng lượng xanh từ mặt trời, ban đêm có thể chiếu sáng và t', '12110130', '19434700', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:36', '2024-05-29 06:18:36'),
(1432, 'can-cau-frp-sieu-cung-hunts-man-2-1m', 'Cần câu FRP siêu cứng Hunts Man ', '<p><em><strong>Cần câu FRP siêu cứng Hunts Man&nbsp;</strong></em></p>\n<p>Cần câu siêu cứng Hunts Man&nbsp;làm thừ chất liệu FRP siêu bền, siêu cứng, phần lắp máy và tay cầm làm từ kim loại&nbsp;đẹp mắt. 4 Khoen chắc chắn&nbsp;</p>\n<p>&nbsp;Chiều dài 2.1m thu gọn 71cm, 5 khúc, ngọn 2.mm, gốc 18mm, nặng 240G. Cần 3.6M thu gọn&nbsp;71CM, 6 khúc, ngọn 2.0mm, gốc 25mm, nặng 454G.</p>\n<p>&nbsp;Màu sắc: đen phối vàng đẹp sang trọng.Thích hợp câu lăng xê, câu đơn, câu lục đầu&nbsp;cần, câu biển.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-hunts-man-1-dc38dedf-702e-4e6c-8c34-11458699f29f.jpg?v=1530845809897\" /><img data-thumb=\"original\" original-height=\"498\" original-width=\"749\" src=\"//bizweb.dktcdn.net/100/200/904/files/ca-n-ca-u-ca-frp-sie-u-be-n-hunts-man-2-7m-8.jpg?v=1530845720937\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-hunts-man-4.jpg?v=1530845730960\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-hunts-man-5.jpg?v=1530845737375\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-hunts-man-7.jpg?v=1530845749165\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/can-cau-hunts-man-2.jpg?v=1530845757067\" /></p>', '', 'Cần câu', 'CẦN CÂU, can cau ca, Cần câu FRP siêu cứng, Cần câu FRP siêu cứng Hunts Man 2.1M, can cau sieu cứng, cau ác, cau ca, câu cá, Volcano, volcano.vn', '1', 'Kích thước', '2.1M', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12107083/can-cau-frp-sieu-cung-hunts-man-2-1m.jpg', '<p>Cần câu 