(1433, 'chan-chong-xe-may', 'Chân chống xe máy', '<p><em><strong>Chân chống xe máy</strong></em></p>\n<p>&nbsp;Chân chống xe máy một bộ phận quan trọng mỗi&nbsp;khi bạn dừng xe, dựng xe lại...</p>\n<p>Với chiếc chân chống thiết kế hoàn toàn mới lạ đặc biệt bạn có thể tthay đổi được chiều cao của chân chông phù hợp với mọi loại xe từ xe Nam xe cao đến xe Nữ kiểu xe thấp hơn.</p>\n<p>&nbsp;Chất liệu kim loại chắc chắn chống gỉ sét, ren ốc vạn đơn giản ốc chốt chắc chắn, đế chống tạp thành hình bàn chân bám nền tốt.</p>\n<p>&nbsp;Kích thước: Max: 29cm. min: 25cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-may-3.jpg?v=1530758284506\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-may-4.jpg?v=1530758302969\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-may-6.jpg?v=1530758310345\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-may-1.jpg?v=1530755000582\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-chong-xe-may-2.jpg?v=1530755009704\" /></strong></em></p>', '', 'Chân chống xe máy', 'phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '99000', '150000', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12096915/chan-chong-xe-may.jpg', '<p>&nbsp;Chân chống xe máy một bộ phận quan trọng mỗi&nbsp;khi bạn dừng xe, dựng xe lại...</p>\n\n<p>Với chiếc chân chống thiết kế hoàn toàn mới lạ đặc biệt bạn có thể tthay đổi được chiều cao ', '12096915', '19410752', NULL, NULL, NULL, NULL, NULL, NULL, NULL, N