(1434, 'hat-ngo-mem-gia-moi-cau-ca', 'Hạt ngô mềm giả mồi câu cá (20 hạt)', '<p><em><strong>Hạt ngô mềm giả mồi câu cá (20 hạt)</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>Mồi câu mềm làm từ nhựa dẻo có kích thước bằng với kích thước gạt ngô thật, nhiều màu sắc nổi bật thu hút cá, dẻo và nhẹ mồi nổi trên mặt nước rất rẽ đánh lừa nhiều loại cá như chép, rô...</p>\n<p>&nbsp;Gắn lưới câu đơn giản chắc chắn khi cá cắn không bị tan bị rời ra khỏ lưỡi câu tránh trường hợp cá nuốt mồi ảnh hưởng đến cá bị câu xổng.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-6.jpg?v=1530601986479\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-7.jpg?v=1530602033969\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-1.jpg?v=1530602040362\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-2.jpg?v=1530602048941\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-3.jpg?v=1530602055680\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-5.jpg?v=1530602067079\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/hat-ngo-mem-gia-moi-cau-8.jpg?v=1530602119110\" />Mua sỉ ( buôn) vui lòng liên hệ 0868 403 299</strong></em></p>\n<p>&nbsp;</p>', '', 'Mồi câu', 'câu cá, hạt ngô mềm câu cá, mồi câu, mồi câu cá, mồi giả, mồi mềm, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng', '', '', '', '', '', '', '', 'deny', '', '10000', '', '1', '', '', NULL, '', '', '', '0.2', 'kg', 'images/12082936/hat-ngo-mem-gia-moi-cau-ca.jpg', '<p>Mồi câu mềm làm từ nhựa dẻo có kích thước bằng với kích thước gạt ngô thật, nhiều màu sắc nổi bật thu hút cá, dẻo và nhẹ mồi nổi trên mặt nước rất rẽ đánh lừa nhiều loại cá như chép, rô...', '12082936', '19381766', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:47', '2024-05-29 06:18:47'),
(1435, 'chan-xich-do-xe-may-cac-hang', 'Chắn xích độ xe máy các hãng', '<p><em><strong>Chắn xích độ xe máy các hãng</strong></em></p>\n<p>Xích xe chính là&nbsp; bộ phận quan trọng nhất giúp xe&nbsp; có thể chuyển động vậy bạn hãy lưu ý bảo vệ bộ phận<strong> n</strong>ày thật cẩn thận nhưng cũng đừng làm nó xấu đi vì những kiểu chắn xích truyền thống các bạn hãy thay ngay cho bộ phận xích xe của bạn bằng một bộ chắn xích cực chất dưới đây!</p>\n<p>Chắn xích khắc logo theo hãng rất ấn tượng mày sắc nổi bật chất liệu hợp kim nhôm &nbsp;chắc chắn sử dụng bền bỉ với thời gian.</p>\n<p>Phân loại theo 3 hãng xe YAMAHA, HONDA, SUZUKI với 3 màu chủ đaọ của các hãng là màu xanh dương, đỏ và màu trắng.</p>\n<p>Kích thước các hãng cũng khác nhau:&nbsp;&nbsp;</p>\n<p>HONDA:&nbsp;chiều cao khoảng 48,5 cm khoảng 6 cm gắn lỗ trung tâm khoảng cách khoảng 33 cm</p>\n<p>YAMAHA:&nbsp;chiều cao khoảng 54,5 cm khoảng 9 cm gắn lỗ trung tâm khoảng cách khoảng 33 cm</p>\n<p>&nbsp;SUZUKI:&nbsp;chiều cao khoảng 54,5 cm khoảng 9 cm gắn lỗ trung tâm khoảng cách khoảng 33 cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-7.jpg?v=1530439114630\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-3.jpg?v=1530439135523\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-5.jpg?v=1530439142882\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-6.jpg?v=1530439151512\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-1.jpg?v=1530439159720\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-2.jpg?v=1530439166307\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-4.jpg?v=1530439174795\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-1.jpg?v=1532407409187\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-3.jpg?v=1532407419544\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-2.jpg?v=1532407426969\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-5.jpg?v=1532407435222\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-4.jpg?v=1532407445667\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xich-do-7.jpg?v=1532407570167\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chan-xinh-xe-cac-hang-v2.jpg?v=1530438739210\" /></strong></em></p>\n<p><strong>Mua sỉ ( buôn) vui lòng liên hệ Hotline: 0868 403 299</strong></p>', '', 'Chắn xích độ xe máy', '', '1', 'Hãng', 'YAMAHA', 'Màu sắc', 'Đỏ', '', '', '', '', '', 'deny', '', '145000', '', '1', '', '', NULL, '', '', '', '1', 'kg', 'images/12070234/chan-xich-do-xe-may-cac-hang.jpg', '<p>Phân loại theo 3 hãng xe YAMAHA, HONDA, SUZUKI với 3 màu chủ đaọ của các hãng là màu xanh dương, đỏ và màu trắng.</p>\n\n<p>Kích thước các hãng cũng khác nhau:&nbsp;&nbsp;</p>\n\n<p>HONDA:&nbs', '12070234', '19356563', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, N