(1436, 'moc-treo-do-xe-may-ride-it', 'Móc treo đồ xe máy Ride it', '<p><em><strong>Móc treo đồ xe máy Ride it</strong></em></p>\n<p>&nbsp;Móc treo đồ xe máy với thiết kế từ kim loại chắc chắn, đẹp, gọn gàng.&nbsp;</p>\n<p>&nbsp;Lắp đặt đơn giản với kiểu quay lên sẽ giúp bạn treo được nhiều đồ mag không lo bị rơi hay bay ra khi bạn đi nhanh</p>\n<p>&nbsp;Kích thước: 5.2*1.8cm, chân ốc 6mm. Với 2 màu đỏ và cam cho bạn lựa chọn&nbsp;để lắp đặt phù hợp với màu xe để sản phẩm khổng để treo đồ mà còn là một món đồ trang trí cho xe của bạn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-rire-it-4.jpg?v=1530342119923\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-rire-it-3.jpg?v=1530342129494\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-rire-it-2.jpg?v=1530342052784\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-rire-it-1.jpg?v=1530342059013\" /></strong></em></p>', '', 'Móc treo đồ xe máy', 'móc treo đồ, Móc treo đồ xe máy, Móc treo đồ xe máy Ride it, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/12065226/moc-treo-do-xe-may-ride-it.jpg', '<p>Móc treo đồ xe máy với thiết kế từ kim loại chắc chắn, đẹp, gọn gàng.&nbsp;</p>\n\n<p>&nbsp;Lắp đặt đơn giản với kiểu quay lên sẽ giúp bạn treo được nhiều đồ mag không lo bị rơi hay bay ra k', '12065226', '19343220', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:53', '2024-05-29 06:18:53'),
(1437, 'boc-yen-xe-may', 'Bọc yên xe máy', '<p><em><strong>Bọc yên xe máy</strong></em></p>\n<p>&nbsp;Chiếc yên xe tuy là một bộ phận rất nhỏ của chiếc xe máy nhưng nó lại quyết định tính thẩm mỹ, đóng góp một phần không nhỏ vào việc tạo nên cuộc hành trình êm ái của bạn!</p>\n<p>Bộ bọc yên xe với chất liệu da PU phối màu đẹp thiết kế kiểu dáng thời trang và nổi bật, vị trí ngồi chia thành 2 phần cho người ngồi lái xe và người ngồi sau,&nbsp;tạo những bậc rãnh nổi chống trơn trượt khi ngồi lên yên xe.</p>\n<p>Kích thước phù hợp với đa số các dòng xe trên thị trường, 3 màu sắc: đen đỏ, đen trắng, đen-xanh dương.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-8.jpg?v=1530325513416\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-4.jpg?v=1530325525447\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-6.jpg?v=1530325534138\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-5.jpg?v=1530325542243\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-2.jpg?v=1530325550237\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-7.jpg?v=1530325566605\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-1.jpg?v=1530325574324\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-9.jpg?v=1530325672859\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-yen-xe-may-10.jpg?v=1530326696441\" /></strong></em></p>', '', 'Bọc yên xe máy', 'bọc yên, BỌC YÊN XE, Bọc yên xe máy, bọc yên xe máy đẹp, phụ kiện xe máy, Volcano, volcano.vn, xe máy, YÊN XE MÁY', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '130000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/12061609/boc-yen-xe-may.jpg', '<p>Bộ bọc yên xe với chất liệu da PU phối màu đẹp thiết kế kiểu dáng thời trang và nổi bật, vị trí ngồi chia thành 2 phần cho người ngồi lái xe và người ngồi sau,&nbsp;tạo những bậc rãnh nổi ', '12061609', '19336433', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:18:59', '2024-05-29 06:18:59');
