(1440, 'op-lung-trong-suot-vien-mau-iphone-6-6s-7-8-6splus-6plus-7plus-8plus-x', 'Ốp lưng trong suốt viền màu Iphone 6,6s,7,8,6splus,6plus,7plus,8plus,X', '<p><em><strong>Ốp lưng trong suốt viền màu Iphone 6,6s,7,8,6splus,6plus,7plus,8plus,X</strong></em></p>\n<p>&nbsp;Đây là dòng ốp lưng dẻo&nbsp;trong suốt&nbsp;giúp người dùng có thể nhìn thấy màu sắc mặt lưng.</p>\n<p>Phần viền hai đầu ốp được phủ màu&nbsp;công nghệ tiên tiến không bay màu, cực kỳ sang trọng.</p>\n<p>Ốp lưng được thiết kế ôm sát vào máy,&nbsp;giúp giữ độ mỏng và tính thời trang của iPhone</p>\n<p>Chất liệu nhựa dẻo TPU mỏng 0.6mm giúp bạn dễ dàng tháo lắp.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-5-63f4552a-0cf5-406d-9a3f-ea1d20fc79b3.jpg?v=1529570451967\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-13.jpg?v=1529570414544\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-3.jpg?v=1529548379399\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-9-e08f0334-4b82-42b8-b324-3da792e6af38.jpg?v=1529548549592\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-11-605a7efd-d5c9-44db-acbf-8c2737c5d9bf.jpg?v=1529548556868\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-7-591bb535-e04c-4ebf-bb05-46ef412304f3.jpg?v=1529548565743\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-8-a6a132af-163f-4c47-a6c3-d102ac3af315.jpg?v=1529548573917\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-lung-trong-suot-10.jpg?v=1529548581494\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', 'Ốp lưng IP', 'Ốp lưng trong suốt viền màu Iphone, Ốp lưng trong suốt viền màu Iphone 6, Ốp lưng trong suốt viền màu Iphone 6 plus, Ốp lưng trong suốt viền màu Iphone 7, Ốp lưng trong suốt viền màu Iphone 7', '1', 'Màu sắc', 'Đỏ', 'Bản', 'Iphone 6. 6s', '', '', '', '', '0', 'deny', '', '29000', '80000', '1', '', '', NULL, '', 'Ốp lưng trong suốt viền màu Iphone 6,6s,7,8,6splus,6plus,7plus,8plus', '', '0.3', 'kg', 'images/11966886/op-lung-trong-suot-vien-mau-iphone-6-6s-7-8-6splus-6plus-7plus-8plus-x.jpg', '<p>&nbsp;Đây là dòng ốp lưng dẻo&nbsp;trong suốt&nbsp;giúp người dùng có thể nhìn thấy màu sắc mặt lưng.</p>\n\n<p>Phần viền hai đầu ốp được phủ màu&nbsp;công nghệ tiên tiến không bay màu, cực ', '11966886', '19143724', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:09', '2024-05-29 06:19:09'),
(1441, 'bo-can-cau-jangbo-2-1m-va-may-gf-4000-tang-kem-tui-dung-90cm-va-day-cau-4-5', 'Bộ cần câu Jangbo 2.1M và máy GF 4000 (tặng kèm túi đựng 90CM, dây câu 4.5)', '<p><em><strong>Bộ cần câu Jangbo 2.1M và máy GF 4000 (tặng kèm túi đựng 90CM&nbsp;và dây câu 6.0 )</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>&nbsp;Câu cá là một môn thể thao giải trí hết sức tuyệt vời sau những giờ làm việc căng thẳng. Hãy tận hưởng cảm giác của những tay câu chuyên nghiệp với Bộ Cần Câu 2m1&nbsp;kèm máy,&nbsp;dây câu, bộ lồng mồi câu chép, mè và túi đựng 3 ngăn 90CM&nbsp;mà chúng tôi mang đến cho các bạn hôm nay.</p>\n<p>&nbsp;Bộ cần câu mini có thể xếp lại gọn gàng chỉ 65cm, tạo cho người dùng sự tiện lợi khi du lịch, dã ngoại, cắm trại, thám hiểm,..</p>\n<p>&nbsp;Cần Câu cá được làm bằng kim loại với 4 chốt, rút gọn được&nbsp;chiều dài khi kéo ra là 210 cm, phần tay cầm được bọc lớp cao su êm tay khi dùng, thân cần cấu tạo từ sợi thủy tinh carbon dẻo dai và chắc chắn, tạo sự tiện lợi khi sử dụng.</p>\n<p>Máy câu GF4000 với 2 chức năng kéo khác nhau, vòng thu dây và hệ thống điều chỉnh được thiết kế để có thể xoay một cách nhẹ nhàng, có chế độ cân bằng chống rung.</p>\n<p>Bộ sản phẩm gồm: Cần, máy 4000, cước 6.0, túi 90CM.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-8.jpg?v=1529464776212\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-11.jpg?v=1529464831361\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-9.jpg?v=1529464840853\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-2.jpg?v=1630384149803\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-1.jpg?v=1529464853887\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-2.jpg?v=1529464861154\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-3.jpg?v=1529464869258\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-5.jpg?v=1529464876464\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-7.jpg?v=1529464883885\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-va-tui-210-6.jpg?v=1529464892114\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-6-d7841527-9dba-4e2c-9ce2-27d444882669.jpg?v=1630384169080\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-can-cau-5-ecaa8278-6a9b-4d0c-89f1-6fe1b57eb7c5.jpg?v=1630384180440\" /></strong></em></p>\n<p>&nbsp;</p>', '', 'Cần câu', 'bộ cần câu, Bộ cần câu Jangbo 2.1M và máy GF 4000 tặng kèm túi đựng 90CM và dây câu 4.5, cần câu, cần câu 2.1m, cần câu và máy câu, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '590000', '', '1', '', '', NULL, '', '', '', '3', 'kg', 'images/11964676/bo-can-cau-jangbo-2-1m-va-may-gf-4000-tang-kem-tui-dung-90cm-va-day-cau-4-5.jpg', '<p>Câu cá là một môn thể thao giải trí hết sức tuyệt vời sau những giờ làm việc căng thẳng. Hãy tận hưởng cảm giác của những tay câu chuyên nghiệp với Bộ Cần Câu 2m1&nbsp;kèm máy,&nbsp;dây câ', '11964676', '19136172', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:12', '2024-05-29 06:19:12'),
(1442, 'ro-le-o-to-4-chan-cam-jd2912-12v-24v-80a', 'Rơ le ô tô 4 chân cắm JD2912-12V/24V-80A', '<p><strong><em>Rơ le ô tô 4 chân cắm JD2912-12V/24V-80A</em></strong></p>\n<p>&nbsp;Rơ le là một linh kiện đóng ngắt điện không thể thiếu trong đông cơ ô tô. Sản phẩm là rơ le 4 chân chia làm 2 loại 12V và 24V - 80A</p>\n<p>&nbsp;Chân dẹp phù hợp với hầu hết các dòng xe trên thị trường tiện dụng thay thế đơn giản.</p>\n<p>Thiết kế vỏ trong suốt, chống nước tuyệt đối,&nbsp;kích thước 3.8*2.8*2.7cm</p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ro-le-o-to-2.jpg?v=1529381648860\" /></em></p>\n<p><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ro-le-o-to-3.jpg?v=1529381655186\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ro-le-o-to-1.jpg?v=1529381663173\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ro-le-o-to-4.jpg?v=1529381671071\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ro-le-o-to-8.jpg?v=1529381770219\" /></em></p>', '', 'Rơ le ô tô', 'JD2912-12V/24V-80A, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'JD2912-12V-80A', '', '', '', '', '', '', '', 'deny', '', '35000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11956225/ro-le-o-to-4-chan-cam-jd2912-12v-24v-80a.jpg', '<p>&nbsp;Rơ le là một linh kiện đóng ngắt điện không thể thiếu trong đông cơ ô tô. Sản phẩm là rơ le 4 chân chia làm 2 loại 12V và 24V - 80A</p>\n\n<p>&nbsp;Chân dẹp phù hợp với hầu hết các dòn', '11956225', '19107907', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:12', '2024-05-29 06:19:12'),
(1443, 'logo-umbrella-dan-trang-tri-xe', 'Logo Umbrella dán trang trí xe', '<p><em><strong>Logo Umbrella dán trang trí xe</strong></em></p>\n<p>&nbsp;Logo dán xe thiết kế đẹp màu sắc bắt mắt nổi bật phù hợp dan nhiều vị trí trên vỏ xe tạo nên sự ấn tượng và phong cách riêng cho xế yêu của bạn.</p>\n<p>Chất liệu làm từ lá nhôm mỏng sơn phủ công nghệ cao, có sãn 3M dễ dàng bóc và dán lên vỏ xe nhanh chóng.</p>\n<p>Kích thước: đường kính 7,5cm, hình chữ nhật 12*2.5cm</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-7.jpg?v=1529309606688\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-2.jpg?v=1529309615845\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-3.jpg?v=1529309623375\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-6.jpg?v=1529309635287\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-8.jpg?v=1529309643629\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-umbrella-1.jpg?v=1529309653432\" /></p>', '', 'Logo', 'logo o to, logo trang trí ô rô, o to, ô tô, phụ  kiện ô tô, trang trí ô tô, Volcano, volcano.vn', '1', 'Phân loại', 'UM1', '', '', '', '', '', '', '', 'deny', '', '86000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11950922/logo-umbrella-dan-trang-tri-xe.jpg', '<p>&nbsp;Logo dán xe thiết kế đẹp màu sắc bắt mắt nổi bật phù hợp dan nhiều vị trí trên vỏ xe tạo nên sự ấn tượng và phong cách riêng cho xế yêu của bạn.</p>\n\n<p>Chất liệu làm từ lá nhôm mỏng', '11950922', '19100789', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:16', '2024-05-29 06:19:16'),
(1444, 'bo-mieng-dan-bao-ve-cua-xe-o-to-bv02', 'Bộ 04 miếng dán bảo vệ cửa xe ô tô BV02', '<p><em><strong>Bộ 04 miếng dán bảo vệ cửa xe ô tô BV02</strong></em></p>\n<p>&nbsp;Xe bạn thường xuyên cọ quệt khi mở cửa nơi chật hẹp làm trầy cánh cửa làm xấu đi xe của bạn, lúc đó bạn thường xuyên lên gara xe để sơn lấp vết trầy. Vậy&nbsp;<em><strong>4 miếng dán cao su bảo vệ cửa xe sẽ</strong></em>&nbsp;giúp bạn yên tâm bảo vệ xế cưng và lái xe an toàn.</p>\n<p>&nbsp;Giúp bảo vệ cánh cửa ô tô một cách an toàn và tiết kiệm được một khoản chi phí không phải&nbsp;sơn&nbsp;lấp vết trầy.</p>\n<p>&nbsp;Bảo vệ cánh cửa ô tô của bạn tránh những va chạm, trầy xước, bong tróc…Ngoài ra bộ sản phẩm cũng phù hợp dán nhiều vị trí có thể bị chày xước trên ô tô</p>\n<p>&nbsp;Dễ dàng sử dụng, có thể tự thao tác với bang dính 3M siêu bền</p>\n<p>&nbsp;Lắp trên mép cánh cửa, chống va đập và xước cửa khi mở ra đập vào tường hoặc xe khác. Sản phẩm phân loại theo từng hãng khác nhau: KIA, TOYOTA, HONDA, FORD...</p>\n<p>Kích thước: 9.15cm và 12*2.1cm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-4-mieng-bao-ve-cua-xe-1.jpg?v=1528425909111\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-4-mieng-bao-ve-cua-xe-5.jpg?v=1528425917385\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bo-4-mieng-bao-ve-cua-xe-6.jpg?v=1528426232017\" /></strong></em></p>', '', 'Bộ miếng dán bảo vệ xe', 'bảo vệ cửa xe, bộ dán bảo vệ cửa xe, bộ miếng dán của xe, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Cờ Mỹ', '', '', '', '', '', '', '', 'deny', '', '89000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11873787/bo-mieng-dan-bao-ve-cua-xe-o-to-bv02.jpg', '<p>Bảo vệ cánh cửa ô tô của bạn tránh những va chạm, trầy xước, bong tróc…Ngoài ra bộ sản phẩm cũng phù hợp dán nhiều vị trí có thể bị chày xước trên ô tô</p>\n\n<p>&nbsp;Dễ dàng sử dụng, có th', '11873787', '18950331', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:25', '2024-05-29 06:19:25'),
(1445, 'decal-carbon-dan-trang-tri-bao-ve-bac-cua-xe-o-to-cuon-4-mieng', 'Decal carbon dán trang trí bảo vệ bậc cửa xe ô tô (cuộn 4 miếng)', '<p><em><strong>Decal carbon dán trang trí bảo vệ bậc cửa xe ô tô (cuộn 4 miếng)</strong></em></p>\n<p>&nbsp;Vừa tạo lên sự mới mẻ, khác biệt và thời trang cho xế lại vừa bảo vệ xế vô cùng hiệu quả trước các va chạm gây xước, gây bẩn xe...<br data-mce-style=\"color: #1d2129; font-size: 14px;\" />\n&nbsp;Chất liệu PVC với lớp ngoài mạ carbon sang trọng, tinh tế dễ dàng dán, dễ dàng vệ sinh chống thấm nước&nbsp;</p>\n<p>&nbsp;Bộ sản phẩm gồm 04 miếng đủ để dán cho cả 4 cánh của xe, kích thước: 39*6.5cm và 59*6.3cm</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-cacbon-dan-cua-xe-4.jpg?v=1528259223930\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-cacbon-dan-cua-xe-5.jpg?v=1528259231261\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-cacbon-dan-cua-xe-1.jpg?v=1528259237922\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-cacbon-dan-cua-xe-2.jpg?v=1528259247144\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-cacbon-dan-cua-xe-6.jpg?v=1528259336482\" /></p>', '', 'Decal carbon', 'decal carbon, Decal carbon dán trang trí bảo vệ bậc cửa xe ô tô, Decal carbon dán trang trí bảo vệ bậc cửa xe ô tô (cuộn 4 miếng), ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '89000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11859404/decal-carbon-dan-trang-tri-bao-ve-bac-cua-xe-o-to-cuon-4-mieng.jpg', '<p>&nbsp;Vừa tạo lên sự mới mẻ, khác biệt và thời trang cho xế lại vừa bảo vệ xế vô cùng hiệu quả trước các va chạm gây xước, gây bẩn xe...<br data-mce-style=\"color: #1d2129; font-size: 14px;', '11859404', '18920849', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:26', '2024-05-29 06:19:26'),
(1446, 'bo-05-luoi-cau-lure-kep-san-chi-leo', 'Bộ 05 lưỡi câu lure kẹp sẵn chì', '<p><em><strong>Bộ 05 lưỡi câu lure kẹp sẵn chì</strong></em></p>\n<p>&nbsp;Bộ 5 lưỡi câu kẹp sẵn chì sử dụng mắc mồi giả mềm&nbsp;trong câu&nbsp;lure.</p>\n<p>Thiết kế to chắc chắn với 2 size là 2G sơn&nbsp;màu đỏ&nbsp;và 3,5G màu trắng bạc.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-kep-chi-4.jpg?v=1527927251961\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-kep-chi-1.jpg?v=1527927259848\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-kep-chi-3.jpg?v=1527927278682\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-kep-chi-5.jpg?v=1527927288035\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/luoi-cau-ca-kep-chi-6.jpg?v=1527927299719\" /></p>', '', 'Lưỡi câu', 'Bộ 05 lưỡi câu lure, Bộ 05 lưỡi câu lure kẹp sẵn chì LEO, cau ca, câu cá, luoi cau, luoi cau ca, Volcano, volcano.vn', '1', 'Kích thước', '2G-màu đỏ', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11835753/bo-05-luoi-cau-lure-kep-san-chi-leo.jpg', '<p>&nbsp;Bộ 5 lưỡi câu kẹp sẵn chì sử dụng mắc mồi giả mềm&nbsp;trong câu&nbsp;lure.</p>\n<p>Thiết kế to chắc chắn với 2 size là 2G sơn&nbsp;màu đỏ&nbsp;và 3,5G màu trắng bạc</p>', '11835753', '18875624', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:35', '2024-05-29 06:19:35'),
(1447, 'bo-04-op-chup-mam-lazang-o-to-ky-13-14-15-inch', 'Bộ 04 Ốp Chụp Mâm (Lazang) Ô Tô KY 13/14/15 Inch', '<p><em><strong>Bộ 04 Ốp Chụp Mâm (Lazang) Ô Tô KY 13/14/15 Inch</strong></em></p>\n<p>Món phụ kiện&nbsp;được gắn vào mâm xe nhằm tạo điểm nhấn đẳng cấp cho chiếc xe, cũng như trang trí làm chiếc mâm xe nổi bật hơn...Đem lại sự sang trọng, thu hút mọi ánh nhìn của người xung quanh.</p>\n<p>&nbsp;Với vật liệu nhựa PP chắc chắn, bền màu với thời gian. Phù hợp với&nbsp;lốp xe có&nbsp;thông số R14, R15, R13</p>\n<p>Màu sắc: Đen trắng, Trắng.</p>\n<p>&nbsp;Lắp đặt đơn giản với lẫy gài chắc chắn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-1-19b3bfb8-833d-4376-9c05-e7303cd34956.jpg?v=1527299092785\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/d1-0bfd9255-bbf8-4db7-a382-cec39ebd49eb.jpg?v=1654311296666\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-2-35dc1717-970c-4877-85ea-577e739dcc9b.jpg?v=1527299101809\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-3-3d8e940a-746a-45bb-a493-39d8f9e0483c.jpg?v=1527299063697\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-4.jpg?v=1527299070951\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-5.jpg?v=1527299080130\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-6.jpg?v=1527299117681\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-mam-xe-6-0c0ab2bc-8ff1-46a7-8f7f-a96374b238fe.jpg?v=1527299163180\" /></strong></em></p>\n<p><em><strong>Phù hợp lắp đặt cho mâm xe có&nbsp;dạng.</strong></em></p>\n<p><img src=\"https://bizweb.dktcdn.net/100/200/904/files/chup-mam-lazang-xe-kia-10-48aab2f7-ece8-499a-a42e-8dccc343faec.jpg?v=1567134728098\" /></p>', '', 'Chụp mâm lazang ô tô', 'Bộ 04 Ốp Chụp Mâm, chụp mâm ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen trắng', 'Kích thước', '13 inch', '', '', '', '', '', 'deny', '', '850000', '', '1', '', '', NULL, '', '', '', '5', 'kg', 'images/11786867/bo-04-op-chup-mam-lazang-o-to-ky-13-14-15-inch.jpg', '<p>Món phụ kiện&nbsp;được gắn vào mâm xe nhằm tạo điểm nhấn đẳng cấp cho chiếc xe, cũng như trang trí làm chiếc mâm xe nổi bật hơn...Đem lại sự sang trọng, thu hút mọi ánh nhìn của người xung', '11786867', '18741676', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:50', '2024-05-29 06:19:50'),
(1448, 'decal-dan-van-cacrbon-dan-trang-tri-xe', 'Decal dán vân cacrbon 3D 127 * 30CM dán trang trí xe', '<p><em><strong>Decal dán vân cacrbon 3D 127 * 30CM&nbsp;dán trang trí xe</strong></em></p>\n<p>&nbsp;Với bề mặt dạng lưới caro phủ bóng rất đẹp, trong ngành trang trí ô tô, chất liệu này làm tăng tính thẩm mỹ và mạnh mẽ cho chiếc xe từ các chi tiết nội thất cho đến vẻ ngoài của chiếc xe.&nbsp;</p>\n<p>&nbsp;Những chi tiết ngoại thất dán carbon được người chơi xe ưa thích là: nắp Ca-pô, cánh gió (Spoiler), Body lip (phần ốp thêm vào cản zin), gương chiếu hậu, khung lưới tản nhiệt (grill), hốc đèn sương mù, tay nắm cửa. Riêng về phần nội thất thì điểm nhẹ carbon trên phần taplô, con ngựa (phần ốp chụp cần số và thắng tay), tapi cửa, chụp cần số, vô lăng, hốc gió điều hòa.</p>\n<p>Sử dụng dán đơn giản chỉ cần bóc tách và dán lên vỏ xe chất ,liệu decal chắc chắn chống thấm hiệu quả</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-cacrbon-dan-xe-5.jpg?v=1527239957752\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-cacrbon-dan-xe-1.jpg?v=1527239964864\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-cacrbon-dan-xe-3.jpg?v=1527239975530\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-cacrbon-dan-xe-4.jpg?v=1527239985470\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/giay-cacrbon-dan-xe-6.jpg?v=1527239995364\" /></p>', '', '', '', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '80000', '', '1', '', '', NULL, '', '', '', '0.5', 'kg', 'images/11783409/decal-dan-van-cacrbon-dan-trang-tri-xe.jpg', '<p>&nbsp;Với bề mặt dạng lưới caro phủ bóng rất đẹp, trong ngành trang trí ô tô, chất liệu này làm tăng tính thẩm mỹ và mạnh mẽ cho chiếc xe từ các chi tiết nội thất cho đến vẻ ngoài của chiế', '11783409', '18732819', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:52', '2024-05-29 06:19:52'),
(1449, 'cong-tac-coi-cong-tac-de-xe-may', 'Công tắc còi-công tắc đề xe máy', '<p><em><strong>Công tắc còi-công tắc đề xe máy</strong></em></p>\n<p>&nbsp;Công tắc thay thế hay chế thêm cho xe máy với 2 công tắc đề và còi, có thể làm công tắc Passing đá đèn hay còi lắp đặt đơn giản với 2 chân công tắc như công tắc zin theo xe</p>\n<p>Kích thươc:&nbsp;4*4*1cm&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-coi-de-1.jpg?v=1526722145232\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-coi-de-5.jpg?v=1526722152520\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-coi-de-3.jpg?v=1526722162845\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-coi-de-2.jpg?v=1526722171172\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cong-tac-coi-de-4.jpg?v=1526722178568\" /></strong></em></p>', '', 'công tắc xe máy', '', '1', 'Phân loại', 'Công tắc còi', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11727082/cong-tac-coi-cong-tac-de-xe-may.jpg', '<p>&nbsp;Công tắc thay thế hay chế thêm cho xe máy với 2 công tắc đề và còi, có thể làm công tắc Passing đá đèn hay còi lắp đặt đơn giản với 2 chân công tắc như công tắc zin theo xe</p>\n\n<p>K', '11727082', '18615340', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:19:57', '2024-05-29 06:19:57'),
(1450, 'nhai-hoi-gia-moi-cau-lure', 'Nhái hơi giả mồi câu lure', '<p><em><strong>Nhái hơi giả&nbsp;mồi câu lure</strong></em></p>\n<p>Nhái hơi màu sắc tươi, đường nét tinh xảo như nhai thật<br />\nLưỡi câu bén, độ nhạy cao, nằm ẩn trên mình nhai<br />\nMồi có tua phía sau lướt trên mặt nước tạo sóng và âm thanh nhẹ, gây sự chú ý với các loài cá<br />\nVới hình dạng giống chú nhai thật, mồi câu tạo sự kích thích và thu hút các loài cá. Phù hợp&nbsp;ở các môi trường sông, hồ, biển, các vùng có khí hậu nhiệt đới.</p>\n<p>&nbsp;Có 4 size: 3cm, 4cm, 5cm màu xanh và màu vàng, 5.5cm</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-4.jpg?v=1526700131233\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-5.jpg?v=1526700138398\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-5-df3a9979-eade-43e4-9a31-527ca578a5cf.jpg?v=1526700139826\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-6.jpg?v=1526700153906\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-7.jpg?v=1526700169456\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-1.jpg?v=1530951891570\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-9.jpg?v=1526700179192\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-10.jpg?v=1526700189415\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nhai-hoi-lure-12.jpg?v=1526700196915\" /></p>', '', '', '', '1', 'Kích thước', '5.5cm', '', '', '', '', '', '', '', 'deny', '', '35000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11723583/nhai-hoi-gia-moi-cau-lure.jpg', '<p>Nhái hơi màu sắc tươi, đường nét tinh xảo như nhai thật<br />\nLưỡi câu bén, độ nhạy cao, nằm ẩn trên mình nhai<br />\nMồi có tua phía sau lướt trên mặt nước tạo sóng và âm thanh nhẹ, gây sự', '11723583', '18610522', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:00', '2024-05-29 06:20:00'),
(1451, 'moi-lure-gia-ca-cung-co-bi-trong-14-5g-9cm', 'Mồi lure giả cá cứng có bi trong', '<p><em><strong>Mồi lure giả cá cứng có bi trong 14.5G-9CM&nbsp;</strong></em></p>\n<p>&nbsp;Câu lure đang dần dần phát triển tại Việt Nam nói chung và các vùng nói riêng,&nbsp;được các&nbsp;cần thủ&nbsp;chào đón 1 cách nhiệt tình và hào hứng...</p>\n<p>&nbsp;Ưu điểm câu lure mồi câu sử dụng được nhiều lần, câu được nhiều loại cá khác nhau, không sợ tay dính bẩn khi pha mồi, bóp mồi, phù hợp cả môi trường nước mặn và nước ngọt</p>\n<p>Phù hợp câu cá loại&nbsp;cá lóc, cá chiên, trê,mú, nhồng, chẽm, măng..(mồi câu phù hợp nước ngọt và nước mặn) hiệu quả</p>\n<p data-mce-style=\"font-size: 12px; text-align: center;\">Chất liệu : nhựa cứng ABS , action đẹp, lưỡi câu 3 tiêu sắc và bén. Sử dụng công nghệ Sơn PS đẹp như vẽ bằng tay gây kích thích khả năng săn mồi của cá</p>\n<p data-mce-style=\"font-size: 12px; text-align: center;\">Trọng lượng: 14.5&nbsp;gram, 12.5&nbsp;gram, Chiều dài: 9&nbsp;cm, 7,5cm, mắt cá:3D</p>\n<p>Mỗi lần câu xong vui lòng ngâm lại bằng nước ngọt, tránh bị gỉ sét lưỡi câu.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-gia-ca-10g-7cm-4.jpg?v=1526532491017\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-gia-ca-10g-7cm-1.jpg?v=1526532305008\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-gia-ca-10g-7cm-2.jpg?v=1526532316388\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-lure-gia-ca-10g-7cm-3.jpg?v=1526532333249\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cung-bi-trong-1.jpg?v=1532836664109\" /></strong></em></p>', '', 'Mồi lure', 'moi cau, môi câu, moi gia, mồi giả, moi gia cau ca, mồi lure, Volcano, volcano.vn', '1', 'Màu sắc', 'Vàng đồng', '', '', '', '', '', '', '', 'deny', '', '58000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11706680/moi-lure-gia-ca-cung-co-bi-trong-14-5g-9cm.jpg', '<p>Phù hợp câu cá loại&nbsp;cá lóc, cá chiên, trê, mú, nhồng, chẽm, măng..(mồi câu phù hợp nước ngọt và nước mặn) hiệu quả</p>\n\n<p data-mce-style=\"font-size: 12px; text-align: center;\">Chất l', '11706680', '18574130', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:03', '2024-05-29 06:20:03'),
(1452, 'moi-cau-ca-dang-hat-u-len-men', 'Mồi câu cá dạng hạt ủ lên men', '<p><em><strong>Mồi câu cá dạng hạt ủ lên men</strong></em></p>\n<p>&nbsp;Mồi câu ủ lên men luôn là loại mồi câu hiệu quả đối với các&nbsp;loài như chép, trắm, diếc, rô...</p>\n<p>&nbsp;Sản phẩm có 2 loại hạt là hạt ngô và hạt lúa mì được ủ với nhiều loại hương vị để nhử cá.Phù hợp với nhiều kiểu câu</p>\n<p>Khối lượng: 55G, lọ hạt ngô hạt lớn hơn với hơn 100 hạt, lọ hạt lúa mì hạt nhỏ với gần 500 hat&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-dang-hat-u-len-men-1.jpg?v=1526459969352\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-dang-hat-u-len-men-2.jpg?v=1526459980114\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-dang-hat-u-len-men-d4.jpg?v=1526459988128\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-dang-hat-u-len-men-3.jpg?v=1526459998374\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-dang-hat-u-len-men-d5.jpg?v=1526460006665\" /></strong></em></p>', '', 'Mồi câu', '', '1', 'Phân loại', 'Hạt ngô', '', '', '', '', '', '', '', 'deny', '', '35000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11697172/moi-cau-ca-dang-hat-u-len-men.jpg', '<p>&nbsp;Mồi câu ủ lên men luôn là loại mồi câu hiệu quả đối với các&nbsp;loài như chép, trắm, diếc, rô...</p>\n\n<p>&nbsp;Sản phẩm có 2 loại hạt là hạt ngô và hạt lúa mì được ủ với nhiều loại ', '11697172', '18555546', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:08', '2024-05-29 06:20:08'),
(1453, 'moc-treo-do-xe-may-moi', 'Móc treo đồ xe máy MoXi', '<p><em><strong>Móc treo đồ xe máy MOXI</strong></em></p>\n<p>&nbsp;Móc treo đồ xe máy với thiết kế từ kim loại chắc chắn, đẹp, gọn gàng.&nbsp;</p>\n<p>&nbsp;Lắp đặt đơn giản với kiểu quay lên sẽ giúp bạn treo được nhiều đồ mag không lo bị rơi hay bay ra khi bạn đi nhanh</p>\n<p>&nbsp;Kích thước: 6.5*1.5, chân ốc 6mm. N hiều màu sắc cho bạn lựa chon để lắp đặt phù hợp với màu xe để sản phẩm khổng để treo đồ mà còn là một món đồ trang trí cho xe của bạn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-4.jpg?v=1526284112308\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-2.jpg?v=1526284119916\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-8.jpg?v=1526284177131\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-3.jpg?v=1526284188434\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-5.jpg?v=1526284197788\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moc-treo-do-xe-may-moxi-7.jpg?v=1526284207939\" /></strong></em></p>', '', 'Móc treo đồ xe máy', '', '1', 'Màu sắc', 'Xanh dương', '', '', '', '', '', '', '', 'deny', '', '38000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11680681/moc-treo-do-xe-may-moi.jpg', '<p><em><strong>Móc treo đồ xe máy với thiết kế từ kim loại chắc chắn, đẹp, gọn gàng.&nbsp;</strong></em></p>\n\n<p><em><strong>&nbsp;Lắp đặt đơn giản với kiểu quay lên sẽ giúp bạn treo được nhi', '11680681', '18521894', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:10', '2024-05-29 06:20:10'),
(1454, 'dau-doc-the-nho-tf-sd-otg-2-trong-1-dau-cam-kep-usb', 'Đầu Đọc Thẻ Nhớ TF SD OTG 2 Trong 1 Đầu Cắm Kép USB', '<p><strong><em>Đầu Đọc Thẻ Nhớ TF SD OTG 2 Trong 1 Đầu Cắm Kép USB</em></strong></p>\n<p>Sản phẩm thiết kế nhỏ, trọng lượng nhẹ và dễ mang theo<br />\nCắm và chạy, không cần nguồn điện ngoài&nbsp;<br />\nHỗ trợ kết&nbsp;máy tính và điện thoại di động&nbsp;&nbsp;OTG<br />\nVới khe thẻ nhớ SD / T-Flash<br />\nTốc độ truyền: 480Mbits<br />\nĐiện áp hoạt động: 2.7V-3.6V DC từ cổng USB<br />\nHỗ trợ thẻ nhớ: Lên đến 32G Byte<br />\nCó sẵn cho: Máy tính và điện thoại OTG v.v.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-6.jpg?v=1525916193248\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-1.jpg?v=1525916201685\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-3.jpg?v=1525916220823\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-7.jpg?v=1525916281111\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-v8.jpg?v=1525916294376\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-5.jpg?v=1525916305201\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-4.jpg?v=1525916312759\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/usb-otg-8.jpg?v=1525916462623\" /></p>', '', 'Đầu đọc thẻ', '', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11646693/dau-doc-the-nho-tf-sd-otg-2-trong-1-dau-cam-kep-usb.jpg', '<p>Sản phẩm thiết kế nhỏ, trọng lượng nhẹ và dễ mang theo<br />\nCắm và chạy, không cần nguồn điện ngoài&nbsp;<br />\nHỗ trợ kết&nbsp;máy tính và điện thoại di động&nbsp;&nbsp;OTG<br />\nVới khe', '11646693', '18456217', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:27', '2024-05-29 06:20:27'),
(1455, 'op-lung-silicon-iphone-6-6s-7-8-6llus-7plus-dap-noi-hinh-cong-chua', 'Ốp lưng silicon Iphone 6,6s,7,8,6Plus,7plus dập nổi hình công chúa', '<p><em><strong>Ốp lưng silicon Iphone 6,6s,7,8,6Plus,7plus dập nổi hình công chúa</strong></em></p>\n<p>&nbsp;Ốp lưng silicon&nbsp;dành cho iPhone mỏng 0.6 mm. Chất liệu silicon cao cấp, có độ đàn hồi cao, uốn cong, bóp không bị biến dạng. Bảo vệ toàn bộ lưng và viền máy, phía mặt trong của ốp lưng tránh hấp hơi khi sử dụng.&nbsp;</p>\n<p>Ốp lưng ôm sát máy dễ dàng thao tác các nút nguồn và tăng giảm âm lượng nhẹ nhàng. Đặc biệt chống hấp hơi và dính lưng máy tuyệt đối. Bảo vệ máy khỏi bụi bần và trầy xước&nbsp; đơn giản, mỏng gọn là sự lựa chọn của mọi lứa tuổi</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-3.jpg?v=1525485866203\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-1.jpg?v=1525485883803\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-8.jpg?v=1525485893323\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-6.jpg?v=1525485905108\" />\\<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-7.jpg?v=1525485913461\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-4.jpg?v=1525485927034\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-9.jpg?v=1525485936078\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-2.jpg?v=1525485944775\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-lung-ip-3d-hinh-cong-chua-12.jpg?v=1525486007424\" /></p>', '', 'Ốp lưng', 'ốp ip, ỐP LƯNG, ốp lưng ipo, Volcano, volcano.vn', '1', 'Màu sắc', 'Váy xanh', 'Bản IP', '6,6S', '', '', '', '', '', 'deny', '', '29000', '80000', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11566409/op-lung-silicon-iphone-6-6s-7-8-6llus-7plus-dap-noi-hinh-cong-chua.jpg', '<p>&nbsp;Ốp lưng silicon&nbsp;dành cho iPhone mỏng 0.6 mm. Chất liệu silicon cao cấp, có độ đàn hồi cao, uốn cong, bóp không bị biến dạng. Bảo vệ toàn bộ lưng và viền máy, phía mặt trong của ', '11566409', '18068704', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:34', '2024-05-29 06:20:34');
