(1456, 'den-led-canh-bao-mo-cua-xe-o-to-bo-2-den', 'Đèn LED cảnh báo mở cửa xe ô tô (bộ 2 đèn)', '<p><em><strong>Đèn LED cảnh báo mở cửa xe ô tô (bộ 2 đèn)</strong></em></p>\n<p>Hàng năm vẫn thường xuyên sảy ra nhiều vụ tai nạn đáng tiếc vì lý do&nbsp;mở cửa xe không chú ý. Tuy nhiên giờ đây, vấn đề này đã có giải pháp nhằm hạn chế được những tai nạn đáng tiếc. Chúng tôi xin giới thiệu Đèn Led Cảnh Báo Mở Cửa Ô Tô thiết kế nhằm mục đích cảnh báo tránh những tai nạn đáng tiếc do mở cửa xe.</p>\n<p>Đèn Led Cảnh Báo Mở Cửa Ô Tô Đèn Led tín hiệu cảnh báo mở cửa xe &nbsp;dùng cho tất cả các loại xe ô tô Đèn Led cảnh báo mở cửa ô tô cảnh báo cách xa 50 -100m. Khi mở cửa xe&nbsp;đèn&nbsp;nhấp nháy&nbsp;để cảnh báo người đi phía sau, tránh các tai nạn đáng tiếc.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-18.jpg?v=1525316791216\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-2.jpg?v=1525316141175\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-3.jpg?v=1525316149021\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-4.jpg?v=1525316156403\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-5.jpg?v=1525316166881\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-8.jpg?v=1525316175341\" /></p>\n<p>Tháo lắp dễ dàng, bạn có thể tự gắn, không cần phải đi dây điện rườm rà</p>\n<p>Công suất : 1,5W<br />\nNhiệt màu : 1400k<br />\nKích thước: Đường kính 2,7 cm, chiều dầy 0,8 cm<br />\nChất liệu: Nhựa tổng hợp, chống thấm nước<br />\nTuổi thọ pin : &gt;10.000 giờ. Tính năng tự động tắt khi cửa mở trên 1 phút</p>\n<p>&nbsp;<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-19.jpg?v=1525316554062\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-gan-cua-xe-6.jpg?v=1525316223411\" /></p>\n<p>Hướng dẫn lắp đặt nhanh chóng</p>\n<p><iframe allow=\"autoplay; encrypted-media\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/Zdx09M_rAnA\" width=\"100%\"></iframe></p>', '', 'Đèn led', '', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11548950/den-led-canh-bao-mo-cua-xe-o-to-bo-2-den.jpg', '<p>Đèn Led Cảnh Báo Mở Cửa Ô Tô Đèn Led tín hiệu cảnh báo mở cửa xe &nbsp;dùng cho tất cả các loại xe ô tô Đèn Led cảnh báo mở cửa ô tô cảnh báo cách xa 50 -100m. Khi mở cửa xe&nbsp;đèn&nbsp;', '11548950', '18040036', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:37', '2024-05-29 06:20:37'),
(1457, 'moi-cau-ca-dang-vien-cam', 'Mồi câu cá dạng viên cám', '<p><em><strong>Mồi câu cá dạng viên cám</strong></em></p>\n<p>&nbsp;Mồi câu đặc biêt mới lạ với kích thước nhỏ nhưng lại có màu sắc thu hút nhiều loại cá như chép , rô phi...Mồi có đình giống với viên cám cá.</p>\n<p>&nbsp;Mồi được ướp với tổng hợp từ&nbsp;6 loại&nbsp;hương vị nhử cá làm từ nguyên liệu như xám gạo ngô và nhiều loại thảo dược khác nhau&nbsp;được say và nến thành viên.&nbsp;</p>\n<p>&nbsp;Phù&nbsp;hợp nhiều kiểu câu từ câu&nbsp;đơn đến câu lancer câu đơn giản chỉ cần mắc trực tiếp mồi lên lưỡi câu.</p>\n<p>&nbsp;Chia làm hai loại với 2 kích cỡ: 6mm, 350Viên/lọ và cỡ 9mm, 120 viên/lọ</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-4.jpg?v=1524477136193\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-3.jpg?v=1524477144394\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-5.jpg?v=1524477150629\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"735\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-1.jpg?v=1524477160831\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-2.jpg?v=1524477168475\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-dang-vien-cam-9.jpg?v=1524477204821\" /></strong></em></p>', '', 'Mồi câu', 'câu cá, mồi câu, mồi câu cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '50000', '', '1', '', '', NULL, '', '', '', '', 'kg', 'images/11474983/moi-cau-ca-dang-vien-cam.jpg', '<p>Mồi câu đặc biêt mới lạ với kích thước nhỏ nhưng lại có màu sắc thu hút nhiều loại cá như chép , rô phi... mồi có đình giống với viên cám cá.</p>\n<p>&nbsp;Mồi được ướp với tổng hợp từ&nbsp', '11474983', '17891376', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:48', '2024-05-29 06:20:48'),
(1458, 'moi-cau-ca-dang-vien-tron', 'Mồi câu cá dạng viên tròn', '<p><em><strong>Mồi câu cá dạng viên tròn</strong></em></p>\n<p>Mồi câu đặc biêt mới lạ với kích thước nhỏ nhưng lại có màu sắc thu hút nhiều loại&nbsp;cá như chép , rô phi...</p>\n<p>Mồi được ướp với tổng hợp từ&nbsp; 6 loại&nbsp;hương vị nhử cá</p>\n<p>Mồi dạng thạch có thể giữ lâu trong nước</p>\n<p>Phù&nbsp;hợp nhiều kiểu câu từ câu&nbsp;đơn đến câu lancer</p>\n<p>Hương vị: vị quả có axit màu xanh, vị quả ngọt màu đỏ, vị mật ong vàng, vị thuốc bắc màu cam, vị sữa màu trắng,&nbsp; vị tanh từ cá màu tím.</p>\n<p>Đường kính nhỏ: 5.5mm</p>\n<p>Số lượng mỗi lọ 200 viên.</p>\n<p>#Mồicâusiêunhạy #Mồicâucáchép&nbsp; #Mồicâucátrắm&nbsp; #Mồicâucátrôi&nbsp; #MồicâuLancer #Mồicâulục&nbsp; #Mồicâuđài&nbsp; #Thínhsiêunhạy #mồicâucá&nbsp; #mồicâucátra&nbsp; #mồicâucátrê #mồicâucámè&nbsp; #mồicâucárôphi&nbsp; #mồicâulure&nbsp; #mồicâulục&nbsp; #mồicâulăngxê&nbsp; #mồicâulục #mồicâulkhoa&nbsp; #mồicâusiêunhạy</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-vien-1.jpg?v=1524466505630\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-vien-2.jpg?v=1524466512710\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-vien-4.jpg?v=1524466521509\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/moi-cau-vien-5.jpg?v=1524466528931\" /></strong></em></p>', '', 'Mồi câu', 'câu cá, mồi câu, mồi câu chép[, mồi chép, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '55000', '', '1', '', '', NULL, '', '', '', '0.25', 'kg', 'images/11471353/moi-cau-ca-dang-vien-tron.jpg', '<p>Mồi câu đặc biêt mới lạ với kích thước nhỏ nhưng lại có màu sắc thu hút nhiều loại&nbsp;cá như chép , rô phi...</p>\n<p>Mồi được ướp với tổng hợp từ&nbsp; 6 loại&nbsp;hương vị nhử cá</p>\n<p', '11471353', '19902135', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:20:52', '2024-05-29 06:20:52'),
(1459, 'tem-logo-chu-noi-honda-dan-trang-tri-xe-hd03', 'Tem logo chữ nổi HONDA dán trang trí xe HD03', '<p><em><strong>Tem logo chữ nổi HONDA dán trang trí xe HD03</strong></em></p>\n<p>&nbsp;Tem chữ nổi làm từ nhựa ABS mạ màu sơn bóng ấn tượng, gắn sẵn keo 3M dán đơn giản phù hợp dán cả ô tô và xe máy. Bộ sản phẩm gồm 2 Tem dán dối xứng hai bên chắc chắn sẽ tạo lên sự mới mẻ và nổi bật cho của bạn Kích thước sản phẩm: 15*2CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-noi-honda-1.jpg?v=1523853439282\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-noi-honda-2.jpg?v=1523853448120\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-noi-honda-3.jpg?v=1523853456854\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-chu-noi-honda-4.jpg?v=1523853465133\" /></strong></em></p>', '', 'Tem logo', '', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '28000', '', '1', '', '', NULL, '', '', '', '0.3', 'kg', 'images/11393323/tem-logo-chu-noi-honda-dan-trang-tri-xe-hd03.jpg', '<p>Tem chữ nổi làm từ nhựa ABS mạ màu sơn bóng ấn tượng, gắn sẵn keo 3M dán đơn giản phù hợp dán cả ô tô và xe máy. Bộ sản phẩm gồm 2 Tem dán dối xứng hai bên chắc chắn sẽ tạo lên sự mới mẻ v', '11393323', '17702861', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:01', '2024-05-29 06:21:01'),
(1460, 'bat-lua-xang-in-hinh-rong-dat-fx-108h', 'Bật lửa xăng in hình rồng đất FX-108H - Khắc Laser Theo Yêu Cầu', '<p><em><strong>Bật lửa xăng in hình rồng đất FX-108H - Khắc Laser Theo Yêu Cầu</strong></em></p>\n<p>&nbsp;Bật lửa với thiết kế đơn giản in hình Rồng đất màu vàng đang tung cánh đẹp mắt. màu ssen chủ chủ dạo một mặt đen bóng.</p>\n<p>Đánh lửa nhạy nhẹ nhàng, tiếng kêu to vang, có sãn phụ kiên bên trong bật.</p>\n<p>Chất liệu kim loại bền bì với thời gian kích như một chiếc zippo bình thường.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-rong-dat-4.jpg?v=1522900605447\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-rong-dat-3.jpg?v=1522900613873\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-rong-dat-1.jpg?v=1522900620871\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-rong-dat-2.jpg?v=1522900630350\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-rong-dat-5.jpg?v=1522900637441\" /></strong></em></p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/e7FgX_4RD10\" title=\"YouTube video player\" widt