(1461, 'tem-logo-chu-noi-mazda-dan-trang-tri-xe', 'Tem logo chữ nổi MAZDA dán trang trí xe', '<p><em><strong>Tem logo chữ nổi MAZDA dán trang trí xe</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>&nbsp;Tem chữ nổi chữ MAZA và số 3 hoặc 6 tùy đời xe&nbsp;làm từ chất liệu nhựa ABS mạ&nbsp;màu&nbsp;trắng bạc bóng đẹp mắt, phù hợp dán đuôi xe.</p>\n<p>&nbsp; Kích thước: Chữ 4.5*2.7cm, số 6: 6*3cm, 3: 5*7cm, dày 0.5cm.&nbsp;có keo dán 3M sẵn mặt dưới sản phẩm tách dán đơn giản dễ dàng</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-mazda-4.jpg?v=1522656918393\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-mazda-2.jpg?v=1522656479626\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-mazda-5.jpg?v=1522656930801\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-mazda-1.jpg?v=1522656489152\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-logo-noi-mazda-3.jpg?v=1522656499401\" /></strong></em></p>', '', 'Tem logo', 'logo mazda, ô tô, phụ  kiện ô tô, tem logo mazda, Volcano, volcano.vn', '1', 'Phân loại', 'Mazda 3', '', '', '', '', '', '', '', 'deny', '', '128000', '', '1', '', '', NULL, '', 'Tem logo chữ nổi MAZDA dán trang trí xe', 'Tem logo chữ nổi MAZDA dán trang trí xe', '0.3', 'kg', 'images/11230549/tem-logo-chu-noi-mazda-dan-trang-tri-xe.jpg', '<p><em><strong>&nbsp;</strong></em>&nbsp;Tem chữ nổi chữ MAZA và số 3 hoặc 6 tùy đời xe&nbsp;làm từ chất liệu nhựa ABS mạ&nbsp;màu&nbsp;trắng bạc bóng đẹp mắt, phù hợp dán đuôi xe.</p>\n\n<p>&n', '11230549', '17408807', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:26', '2024-05-29 06:21:26'),
(1462, 'tem-chu-noi-lancer-dan-trang-tri-xe', 'Tem chữ nổi LANCER dán trang trí xe', '<p><strong><em>Tem chữ nổi LANCER dán trang trí xe</em></strong></p>\n<p>&nbsp;Tem chữ nổi&nbsp;LANCER làm từ chất liệu nhựa ABS mạo mà trắng bạc bóng đẹp mắt, phù hợp dán đuôi xe Mitsubishi&nbsp;LANCER</p>\n<p>Phân loại theo kích thước: 14*1.7CM và&nbsp;11.3*1.3CM.</p>\n<p>Có keo dán 3M sẵn mặt dưới sản phẩm tách dán đơn giản dễ dàng</p>\n<p>Lưu ý: Qúy khách vui lòng chọn đúng kích thước trước khi đặt hàng.</p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-lancer-4.jpg?v=1522482113973\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-lancer-3.jpg?v=1522482123675\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-lancer-5.jpg?v=1522482132256\" /></em></strong></p>\n<p><strong><em><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-lancer-1.jpg?v=1522482139805\" /></em></strong></p>\n<p>&nbsp;</p>', '', 'Tem logo', 'ô tô, phụ  kiện ô tô, Tem chữ nổi LANCER, Tem chữ nổi LANCER dán trang trí xe, Volcano, volcano.vn', '1', 'Kích thước', '14*1.7CM', '', '', '', '', '', '', '', 'deny', '', '86000', '', '1', '', '', NULL, '', 'Tem chữ nổi LANCER dán trang trí xe', 'Tem chữ nổi LANCER dán trang trí xe', '0.3', 'kg', 'images/11215010/tem-chu-noi-lancer-dan-trang-tri-xe.jpg', '<p>&nbsp;Tem chữ nổi&nbsp;LANCER làm từ chất liệu nhựa ABS mạo mà trắng bạc bóng đẹp mắt, phù hợp dán đuôi xe Mitsubishi&nbsp;LANCER</p>\n<p>Phân loại theo kích thước: 14*1.7CM và&nbsp;11.3*1.', '11215010', '17373349', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-0