(1463, 'hop-nhac-loa-ken-co-dien-trang-tri', 'Hộp nhạc loa kèn cổ điển trang trí', '<p><em><strong>Hộp nhạc loa kèn cổ điển trang trí</strong></em></p>\n<p>&nbsp;Nếu bạn là người ưa thích phong cách vintage thì chắc hẳn không thể bỏ qua chiếc hộp nhạc máy hát cổ điển thường thấy trong hoàng gia quý tộc xưa với nét đẹp cổ kính, quý phái.</p>\n<p>Hộp nhạc này được thiết kế tinh xảo từ vật liệu ABS cao cấp cứng rắn bền màu và không bị giòn vỡ theo thời gian.</p>\n<p>Ngoài ra hộp nhạc còn được thiết kế thêm phần ngăn kéo rất tiện lợi, có thể dùng để kim chỉ hoặc đồ trang sức như nhẫn,..hộp nhạc chạy bằng dây cót phát ra âm thanh khi kéo ngăn kéo ra làm đĩa nhạc quay đông thời tạo ra âm thanh</p>\n<p>Kích thước: 12,5 x 10,5 x 21,5 CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac119.jpg?v=1522315293939\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac118.jpg?v=1522315309470\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac117.jpg?v=1522315321889\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac16.jpg?v=1522315339406\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac14.jpg?v=1522315348019\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac13.jpg?v=1522315358680\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac12.jpg?v=1522315373120\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac11.jpg?v=1522315384246\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac-1.jpg?v=1522313486851\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ken-nhac-2.jpg?v=1522313500571\" /></p>', '', 'Hộp nhạc loa kèn cổ điển', 'Hộp nhạc loa kèn cổ điển, Hộp nhạc loa kèn cổ điển trang trí, trang trí, trang trí nhà cưa, Volcano, volcano.vn', '1', 'Màu sắc', 'Màu trắng', '', '', '', '', '', '', '', 'deny', '', '199000', '', '1', '', '', NULL, '', 'Hộp nhạc loa kèn cổ điển trang trí', 'Hộp nhạc loa kèn cổ điển trang trí', '1', 'kg', 'images/10273875/hop-nhac-loa-ken-co-dien-trang-tri.jpg', '<p>Hộp nhạc này được thiết kế tinh xảo từ vật liệu ABS cao cấp cứng rắn bền màu và không bị giòn vỡ theo thời gian.</p>\n\n<p>Ngoài ra hộp nhạc còn được thiết kế thêm phần ngăn kéo rất tiện lợi', '10273875', '16472157', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:30', '2024-05-29 06:21:30'),
(1464, 'tham-chong-nong-taplo-toyota-corolla', 'Thảm chống nóng taplo Toyota Corolla', '<p><em><strong>Thảm chống nóng taplo Toyota Corolla</strong></em></p>\n<p>&nbsp;Taplo có vai trò vô cùng quan trọng với ô tô, nó vừa là bộ mặt của chiếc xe vừa là phần linh kiện nội thất tiếp xúc trực tiếp với ánh sáng mặt trời chiếu qua kính của lái xe. Bởi vậy, để đảm bảo cho taplo không bị bạc màu, nứt nẻ, trầy xước khi cọ sát với các đồ vật trên xe cũng như đảm bảo cho việc lái xe được an toàn, thì việc che chắn – bảo vệ bộ phận taplo xe ô tô là việc vô cùng cần thiết.</p>\n<p>&nbsp;Thảm chống nóng taplo <em><strong>Toyota Corolla&nbsp;</strong></em>được thiết kế trên dây chuyền hiện đại. Sản phẩm được cắt định hình hoàn toàn tự động trên công nghệ 3D, đảm bảo chuẩn xác từng mm phom taplo và khớp từng model xe, đời xe. Sản phẩm được thiết kế hết sức chi tiết dựa trên thiết kế taplo của nhà sản xuất, đảm bảo trùng khớp hoàn toàn tất cả khe thông gió, bộ phận cảm biến nguyên bản của xe.</p>\n<p>&nbsp;thảm được sản xuất từ sợi polyester chống cháy, thân thiện môi trường, chất liệu đảm bảo an toàn cho người sử dụng (không tạo khí độc ngay cả trong điều kiện nhiệt độ cao &gt; 60 độ C trong thời gian dài).</p>\n<p>&nbsp;Sản phẩm có phom chia theo đời xe quá khách vui lòng chọn đúng mẫu.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-taplo-chong-nong-corolla-1.jpg?v=1522054906911\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-taplo-chong-nong-corolla-2.jpg?v=1522054914214\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-taplo-chong-nong-corolla-3.jpg?v=1522054926139\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-taplo-chong-nong-corolla-5.jpg?v=1522054937062\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-taplo-chong-nong-corolla-6.jpg?v=1522054949082\" /></strong></em></p>', '', 'Thảm chống nóng taplo', 'ô tô, phụ  kiện ô tô, Thảm chống nóng taplo Toyota Corolla, Volcano, volcano.vn', '1', 'Phân loại', 'Đời 2014-2017', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', 'Thảm chống nóng taplo Toyota Corolla', 'Thảm chống nóng taplo Toyota Corolla', '2', 'kg', 'images/10241139/tham-chong-nong-taplo-toyota-corolla.jpg', '<p>&nbsp;Thảm&nbsp;taplo <em><strong>Toyota Corolla chống&nbsp;</strong></em>taplo không bị bạc màu, nứt nẻ, trầy xước khi cọ sát với các đồ vật trên xe cũng như đảm bảo cho việc lái xe được ', '10241139', '16414371', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:35', '2024-05-29 06:21:35'),
(1465, 'bo-02-logo-kia-tieu-chuan-truoc-va-sau', 'Bộ 02 logo KIA tiêu chuẩn trước và sau', '<p><em><strong>Bộ 02 logo KIA trước và sau</strong></em></p>\n<p>&nbsp;Bộ sản phẩm là 2 logo tiêu chuẩn tỉ lệ 1:1 với logo nguyên bản thay thế đơn giản với&nbsp;sẵn keo 3M&nbsp;</p>\n<p>Logo có đủ loại có chân và loại dán, chất ABS + hợp kim nhôm&nbsp;chắc chắn màu sơn bóng đẹp.</p>\n<p>Khách hàng vui lòng chọn đúng kích thước logo xe để lắp đặt đúng logo</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-7.jpg?v=1521866239631\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-1.jpg?v=1521866249743\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-3.jpg?v=1521866256587\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-4.jpg?v=1521866264680\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-5.jpg?v=1521866271508\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-kia-6.jpg?v=1521866279623\" /></p>', '', 'Logo KIA', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích thước', '11.5*5.8 ( hai chân) và 13*6.5(Ba chân)', '', '', '', '', '', '', '', 'deny', '', '268000', '', '1', '', '', NULL, '', 'Bộ 02 logo KIA tiêu chuẩn trước và sau', 'Bộ 02 logo KIA trước và sau', '0.5', 'kg', 'images/10223124/bo-02-logo-kia-tieu-chuan-truoc-va-sau.jpg', '<p>&nbsp;Bộ sản phẩm là 2 logo tiêu chuẩn tỉ lệ 1:1 với logo nguyên bản thay thế đơn giản với sẵn keo 3M&nbsp;</p>\n\n<p>Logo có đủ loại có chân và loại dán, chất ABS + hợp kim nhôm&nbsp;chắc c', '10223124', '16383358', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:37', '2024-05-29 06:21:37'),
(1466, 'bat-lua-lien-minh-huyen-thoai', 'Bật lửa Liên Minh Huyền Thoại - Khắc Laser Theo Yêu Cầu', '<p><strong><em>Bật lửa Liên Minh Huyền Thoại - Khắc Laser Theo Yêu Cầu</em></strong></p>\n<p>Bật lửa Liên Minh Huyền Thoại&nbsp;là sản phẩm có thiết kế tinh sảo, sắc nét. Nhà sản xuất đã quan tâm tới từng chi tiết nhỏ để mang lại cho người dùng một chiếc bật lửa hoàn hảo, phù hợp với mọi lửa tuổi.</p>\n<p>Khoác trên mình chiếc áo kim loại được dập nổi 3D hình các tướng trong game Liên Minh Huyền Thoại là sản phẩm đang được đông đảo các fan LOL quan tâm và lựa chọn</p>\n<ul>\n<li>Được thiết kế tinh sảo, mang phong cách Zippo.</li>\n<li>Vỏ kim loại chất lượng cao, chắc chắn, chống trầy xước tốt.</li>\n<li>Dập hổi 3D hình các nhân vật trong Game LMHT với chi tiết sắc nét.</li>\n<li>Sử dụng xăng zippo, dễ dàng thay thế trong quá trình sử dụng.(Lưu ý: tuyệt đối không sử dụng xăng A92, vì dễ làm giảm độ bền của bật lửa.</li></ul>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-11.jpg?v=1521712903354\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-4.jpg?v=1521712147522\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-2.jpg?v=1521712156888\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-3.jpg?v=1521712165134\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-5.jpg?v=1521712173740\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-6.jpg?v=1521712179998\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-7.jpg?v=1521712186577\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-8.jpg?v=1521712193258\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-9.jpg?v=1521712295030\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-lol-1.jpg?v=1521712207487\" /></p><iframe width=\"750\" height=\"380\" src=\"https://www.youtube.com/embed/e7FgX_4RD10\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Bật lửa', 'bật lủa, bật lửa độc, Bật lửa Liên Minh Huyền Thoại, bật lửa trang trí, hộp quẹt, phụ kiện xe máy, Volcano, volcano.vn', '1', 'Phân loại', 'LOL 01', '', '', '', '', '', '', '', 'deny', '', '45000', '120000', '1', '', '', NULL, '', 'Bật lửa Liên Minh Huyền Thoại', 'Bật lửa Liên Minh Huyền Thoại', '0.5', 'kg', 'images/10200497/bat-lua-lien-minh-huyen-thoai.jpg', '<ul>\n<li>Được thiết kế tinh sảo, mang phong cách Zippo.</li>\n<li>Vỏ kim loại chất lượng cao, chắc chắn, chống trầy xước tốt.</li>\n<li>Dập hổi 3D hình các nhân vật trong Game LMHT với chi tiết', '10200497', '16352213', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:45', '2024-05-29 06:21:45'),
(1467, 'tham-chong-nong-taplo-vios', 'Thảm chống nóng TAPLO VIOS', '<p><em><strong>Thảm chống nóng TAPLO VIOS</strong></em></p>\n<p>&nbsp; Taplo có vai trò vô cùng quan trọng với ô tô, nó vừa là bộ mặt của chiếc xe vừa là phần linh kiện nội thất tiếp xúc trực tiếp với ánh sáng mặt trời chiếu qua kính của lái xe. Bởi vậy, để đảm bảo cho taplo không bị bạc màu, nứt nẻ, trầy xước khi cọ sát với các đồ vật trên xe cũng như đảm bảo cho việc lái xe được an toàn, thì việc che chắn – bảo vệ bộ phận taplo xe ô tô là việc vô cùng cần thiết.</p>\n<p>&nbsp;Thảm chống nóng taplo Toyota Vios được thiết kế trên dây chuyền hiện đại. Sản phẩm được cắt định hình hoàn toàn tự động trên công nghệ 3D, đảm bảo chuẩn xác từng mm phom taplo và khớp từng model xe, đời xe. Sản phẩm được thiết kế hết sức chi tiết dựa trên thiết kế taplo của nhà sản xuất, đảm bảo trùng khớp hoàn toàn tất cả khe thông gió, bộ phận cảm biến nguyên bản của xe.</p>\n<p>&nbsp;thảm được sản xuất từ sợi polyester chống cháy, thân thiện môi trường, chất liệu đảm bảo an toàn cho người sử dụng (không tạo khí độc ngay cả trong điều kiện nhiệt độ cao &gt; 60 độ C trong thời gian dài).</p>\n<p>&nbsp;Sản phẩm có phom chia theo đời xe quá khách vui lòng chọn đúng mẫu.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-3.jpg?v=1521445559992\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-4.jpg?v=1521445829680\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-8.jpg?v=1521446327028\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-2.jpg?v=1521445927954\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-7.jpg?v=1521446166730\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tham-trai-taplo-o-to-6.jpg?v=1521446155807\" /></p>\n<p>&nbsp; &nbsp; &nbsp;</p>', '', 'Thảm taplo', 'ô tô, phụ  kiện ô tô, thảm chống nóng taplo, thảm táp to, thảm taplo toyota, thảm taplo vios, Volcano, volcano.vn', '1', 'Phân loại', 'Đời 2014-2017', '', '', '', '', '', '', '', 'deny', '', '250000', '', '1', '', '', NULL, '', 'Thảm chống nóng TAPLO VIOS', 'Thảm chống nóng TAPLO VIOS', '2', 'kg', 'images/10158294/tham-chong-nong-taplo-vios.jpg', '<p>Thảm chống nóng taplo Toyota Vios được thiết kế trên dây chuyền hiện đại. Sản phẩm được cắt định hình hoàn toàn tự động trên công nghệ 3D, đảm bảo chuẩn xác từng mm phom taplo và khớp từng', '10158294', '16276785', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:21:56', '2024-05-29 06:21:56'),
(1468, 'tem-chu-noi-honda-dan-trang-tri-xe-hd02', 'Tem chữ nổi HONDA dán trang trí xe HD02', '<p><em><strong>Tem chữ nổi HONDA dán trang trí xe HD02</strong></em></p>\n<p>&nbsp;Tem chữ nổi làm từ nhựa ABS mạ màu sơn bóng ấn tượng, gắn sẵn keo 3M dán đơn giản phù hợp dán cả ô tô và xe máy.</p>\n<p>Bộ sản phẩm gồm 2 Tem dán dối xứng hai bên chắc chắn sẽ tạo lên sự mới mẻ và nổi bật cho của bạn</p>\n<p>Kích thước sản phẩm:&nbsp; 15*2*0.4CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-honda-dai-2.jpg?v=1521171307464\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-honda-1.jpg?v=1527042357061\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-honda-2-68314642-dcf6-4528-8e3c-513d1585b7e4.jpg?v=1527042372934\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-honda-dai-4.jpg?v=1521171462671\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-honda-dai-v3.jpg?v=1521171473187\" /></p>', '', 'Tem logo', 'logo honda, logo nổi, logo nổi honda, ô tô, phụ  kiện ô tô, phụ kiện xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Trắng bạc', '', '', '', '', '', '', '', 'deny', '', '65000', '', '1', '', '', NULL, '', 'Tem chữ nổi HONDA dán trang trí xe HD02', 'Tem chữ nổi HONDA dán trang trí xe HD02', '0.3', 'kg', 'images/10120335/tem-chu-noi-honda-dan-trang-tri-xe-hd02.jpg', '<p>&nbsp;Tem chữ nổi làm từ nhựa ABS mạ màu sơn bóng ấn tượng, gắn sẵn keo 3M dán đơn giản phù hợp dán cả ô tô và xe máy.</p>\n\n<p>Bộ sản phẩm gồm 2 Tem dán dối xứng hai bên chắc chắn sẽ tạo l', '10120335', '16213516', NULL, NULL, NULL, NULL, NULL, NULL,