(1473, 'bo-02-guong-chieu-hau-xe-may-inverter-mirror', 'Bộ 02 gương chiếu hậu xe máy Inverter Mirror', '<p><em><strong>Bộ 02 gương chiếu hậu xe máy Inverter Mirror</strong></em></p>\n<p><em><strong>&nbsp;</strong></em>Gương chiếu hậu xe máy làm từ chất&nbsp;liệu kim loại chắc chắn, thiết kế&nbsp;kiểu dáng thời trang đẹp trẻ trung thay thế cho bộ gương truyền thống.</p>\n<p>Mặt gương sáng trong giúp người điều khiển xe quan xát rõ phía sau lái xe an toàn hơn. Đặc biệt gương có thể soay&nbsp;đến 360 độ tùy theo phong cách lắp của mỗi người.</p>\n<p>&nbsp;Bộ 2 gương&nbsp;có kèm theo là 02 chân chuyển đổi nên sẽ hỗ trợ lắp đặt&nbsp;với tất cả các dòng xe</p>\n<p>Kích thước: Gương: 12.5*5cm. phần tay gương 14cm, chân gương 10mm, ốc chuyển từ 8 lên chân 10mm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-3.jpg?v=1520564750322\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-1.jpg?v=1520564760119\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-4.jpg?v=1520564767068\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-6.jpg?v=1520564777468\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-5.jpg?v=1520564788465\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-2.jpg?v=1520564799603\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-9.jpg?v=1520564862901\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-7.jpg?v=1520564873261\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/guong-chieu-hau-xe-may-inverter-mirror-8.jpg?v=1520564879388\" /></strong></em></p>', '', 'Gương xe máy', 'gương, guong tghoiwf trang, guong xe may, gương xe máy, gương xe máy thời trang, phụ kiện xe máy, Volcano, volcano.vn, xe may, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '185000', '200000', '1', '', '', NULL, '', 'Bộ 02 gương chiếu hậu xe máy Inverter Mirror', 'Bộ 02 gương chiếu hậu xe máy Inverter Mirror', '0.6', 'kg', 'images/10040038/bo-02-guong-chieu-hau-xe-may-inverter-mirror.jpg', '<p>Mặt gương sáng trong giúp người điều khiển xe quan xát rõ phía sau lái xe an toàn hơn. Đặc biệt gương có thể soay&nbsp;đến 360 độ tùy theo phong cách lắp của mỗi người.</p>\n\n<p>&nbsp;Bộ 2 ', '10040038', '16074848', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:15', '2024-05-29 06:22:15');
