(1474, 'mieng-dan-hinh-quoc-ki-che-vet-xuoc-xe', 'Tem dán nổi trang trí xe ô tô hình quốc kì các nước QK02', '<p><em><strong>Tem dán nổi&nbsp;trang trí xe ô tô hình quốc kì các nước</strong></em></p>\n<p>Tạo nét cá tính cho xế yêu của ban độc đáo cá tính với&nbsp;Miếng dán hình quốc kì&nbsp; các nước: Anh, Mỹ, Đức, Nhật bản sẽ&nbsp;tạo cho xe sự sành điệu, đẹp độc và lạ nhất.</p>\n<p>Gắn kết bằng băng keo chuyên dụng, không làm ảnh hưởng đến cấu trúc, màu sơn của xe</p>\n<p>Dễ dàng tự lắp đặt, không cần thợ</p>\n<p>Chất liệu nhôm mỏng, vô cùng bền màu</p>\n<p>Kích thước: Quốc kì nước Anh 6*4CM,&nbsp;quốc kì&nbsp; các nước&nbsp;Mỹ, Đức, Nhật Bản: 8*5CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-1.jpg?v=1520495172143\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-8.jpg?v=1520495180930\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-2.jpg?v=1520495188120\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-6.jpg?v=1520495197239\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-3.jpg?v=1520495203963\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-4.jpg?v=1520495211466\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-5.jpg?v=1520495217914\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-7.jpg?v=1520495227925\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-quoc-ki-9.jpg?v=1520497268568\" /></p>\n<p>&nbsp;</p>', '', 'Tem dán xe', 'dán che vết xước ô tô, dán o to, Miếng dán hình quốc kì che vết xước xe, ô tô, phụ  kiện ô tô, trang trí ô tô, Volcano, volcano.vn', '1', 'Quốc kỳ', 'Anh', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', 'Miếng dán hình quốc kì che vết xước xe', 'Miếng dán hình quốc kì che vết xước xe', '0.25', 'kg', 'images/10034225/mieng-dan-hinh-quoc-ki-che-vet-xuoc-xe.jpg', '<p>Tạo nét cá tính cho xế yêu của ban độc đáo cá tính với&nbsp;Miếng dán hình quốc kì&nbsp; các nước: Anh, Mỹ, Đức, Nhật bản sẽ&nbsp;tạo cho xe sự sành điệu, đẹp độc và lạ nhất. Gắn kết bằng ', '10034225', '16065895', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:16', '2024-05-29 06:22:16'),
(1475, 'op-lung-iphone-cho-meo-than-tai-xuan-mau-tuat-2018', 'Ốp lưng Iphone chó mèo thần tài xuân Mậu Tuất 2018', '<p><strong><em>Ốp lưng Iphone chó mèo thần tài xuân Mậu Tuất 2018</em></strong></p>\n<p>&nbsp;Toàn bộ sản phẩm được làm từ chất liệu đặc biệt&nbsp;vừa có tính mềm dẻo lại không quá cứng như các loại ốp nhựa thông thường khác. Không chỉ vậy bề mặt ngoài phủ một lớp màu đỏ đẹp với hai hình chó mà mèo thần tài đẹp mắt&nbsp;biểu tượng cho may mắn và thịnh vượng tiền tài.</p>\n<p>&nbsp;Ốp dẻo&nbsp;lắp và tháo&nbsp;đơn giản có đầy đủ ốp phù hợp cho tất cả các bản&nbsp;điện thoại Iphone</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-in-hinh-cho-phu-quy-2018-4.jpg?v=1516432175394\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-in-hinh-cho-phu-quy-2018-5.jpg?v=1516432183607\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-in-hinh-cho-phu-quy-2018-1.jpg?v=1516432194745\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-in-hinh-cho-phu-quy-2018-2.jpg?v=1516432201726\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-in-hinh-cho-phu-quy-2018-3.jpg?v=1516432209778\" /></p>', '', 'Ốp lưng Iphone', 'ốp lưng, ốp lưng chó thần tài, ốp lưng điện thoạt, ốp lưng ip, ốp lưng ip đẹp, ốp mèo thần tài, Volcano, volcano.vn', '1', 'Bản Iphone', '6 6s', 'Phân loại', 'Chó thần tài', '', '', '', '', '0', 'deny', '', '29000', '80000', '1', '', '', NULL, '', 'Ốp lưng Iphone chó mèo thần tài xuân Mậu Tuất 2018', 'Ốp lưng Iphone chó mèo thần tài xuân Mậu Tuất 2018', '0.3', 'kg', 'images/9703933/op-lung-iphone-cho-meo-than-tai-xuan-mau-tuat-2018.jpg', '<p>Toàn bộ sản phẩm được làm từ chất liệu đặc biệt&nbsp;vừa có tính mềm dẻo lại không quá cứng như các loại ốp nhựa thông thường khác. Không chỉ vậy bề mặt ngoài phủ một lớp màu đỏ đẹp với ha', '9703933', '15497334', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:27', '2024-05-29 06:22:27'),
(1476, 'cap-otg-ket-noi-du-lieu-voi-dien-thoai-android', 'Cáp OTG kết nối dữ liệu với điện thoại android', '<p><em><strong>Cáp OTG kết nối dữ liệu với điện thoại android</strong></em></p>\n<p>&nbsp;Công nghệ OTG là một tính năng không thể thiếu trên&nbsp;smartphone&nbsp;hiện nay, công nghệ giúp các smartphone có thể kết nối với các dữ liệu (usb, thẻ nhớ...) và&nbsp;thiết bị ngoại vi (như chuột, bàn phím...)sử dụng chúng một cách bình thường như khi ta đang thao tác trên máy tính.</p>\n<p>Công nghệ OTG sẽ được&nbsp;sử dụng thông qua sản phẩm&nbsp;Cáp OTG kết nối dữ liệu với điện thoại chiếc cổng sạc của smartphone làm cổng kết nối OTG:</p>\n<ul>\n<li>Giúp điện thoại có thể mở rộng bộ nhớ thông qua việc kết nối với ổ cứng di động, hoặc USB OTG.</li>\n<li>Có thể chơi game trên điện thoại bằng tay cầm chuyên dụng.</li>\n<li>Kết nối chuột và bàn phím để thao tác như một máy tính.</li></ul>\n<p>Thông số:</p>\n<ul>\n<li>Áp dụng cho các dòng điện thoại&nbsp;android có hỗ trợ OTG</li>\n<li>&nbsp;Kết nối:&nbsp;<strong>USB 2.0.&nbsp;</strong>Hỗ trợ truyền dữ liệu lên đến 480Mbps</li>\n<li>Dây&nbsp;cáp chống ăn mòn,&nbsp;che chắn cung cấp dẫn tối đa và giảm thiểu mất mát dữ liệu</li>\n<li>Chiều dài: 15cm.</li></ul>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-8.jpg?v=1515489722581\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-9.jpg?v=1515490226345\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-10.jpg?v=1515490236500\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-7.jpg?v=1515490244423\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-3.jpg?v=1515490252578\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-1.jpg?v=1515490261443\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-2.jpg?v=1515490268328\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/cap-otg-androi-4.jpg?v=1515490278511\" /></p>', '', 'Cáp OTG androi', 'CÁP OTG, cáp otg androi, cap truyền dữ liệu otg, otg, Volcano, volcano.vn', '1', 'Màu sắc', 'vàng', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', 'Cáp OTG kết nối dữ liệu với điện thoại android', 'Cáp OTG kết nối dữ liệu với điện thoại android', '', 'kg', 'images/9603275/cap-otg-ket-noi-du-lieu-voi-dien-thoai-android.jpg', '<p>Công nghệ OTG là một tính năng không thể thiếu trên&nbsp;smartphone&nbsp;hiện nay, công nghệ giúp các smartphone có thể kết nối với các dữ liệu (usb, thẻ nhớ...) và&nbsp;thiết bị ngoại vi ', '9603275', '15319269', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:30', '2024-05-29 06:22:30'),
(1477, 'kinh-chan-gio-xe-may-wind-protecf-screen-1', 'Kính chắn gió xe máy WIND PROTECF SCREEN', '<p><em><strong>Kính chắn gió xe máy WIND PROTECF SCREEN</strong></em></p>\n<p>&nbsp;Kính chắn gió xe máy chỉ những người dùng sản phẩm mới đánh giá được các công dụng&nbsp;nó mang lại khi lưu thông xe máy trong điều kiện bụi, ẩm, nhiệt như ở Việt Nam.</p>\n<p>&nbsp;Kính chắn gió như một thiết bij bảo vệ khỏi các tác động nhỏ vô tình như các vật rắn gây tổn thương, các loại bụi, bẩn, nước, nóng… &nbsp;mà điều này rất hay gặp khi tham gia giao thông ở việt Nam</p>\n<p>Giữ ấm khi gió lạnh hoặc độc rất phù hợp cho những trẻ nhỏ khi tham gia giao thông cùng người lơn</p>\n<p>Với kính chắn gió&nbsp;xe máy WIND PROTECF SCREEN làm từ nhựa dẻo trong suốt siêu bền và siêu dẻo, viền kính trang bị bằng viền cao su vừa giữ cho kính thêm cứng cáp lại hạn chế gây trầy xước cho người dùng.</p>\n<p>Kích thước: 46*42.5*32CM, dày 2mm, viền cao&nbsp;su 6mm</p>\n<p>Lắp đặt&nbsp;đơn giản với bộ phụ kiện đi kèm, phù hợp lắp đặt với hầu hết&nbsp;tất cả các dòng xe</p>\n<p>#kinhchangio #kính- chắn - gió #kínhchắngióxemáy #kinhchangioxemay #Kínhchắngióxemáy</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-deo-5-6093dba1-ca3f-4b9f-b6b9-1e2d3ac3687f.jpg?v=1515118775845\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-deo-5-298ec85e-20d0-4eaf-9b90-7d7bf95de897.jpg?v=1700185571658\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-deo-4.jpg?v=1515118483626\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-deo-1.jpg?v=1515118494140\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-deo-7.jpg?v=1515119003080\" /></strong></em></p>\n<p>&nbsp;</p>\n<p><em><strong>Hướng dẫn lắp đặt:</strong></em></p>\n<ol>\n<li><em><strong>Tháo&nbsp;gương xe&nbsp;</strong></em></li>\n<li>Lắp 2 tai kim loại và lắp lại gương.</li>\n<li>Lắp 2 tay đỡ chữ L lên 2 bên tai kim loại vừa lắp bước (2)</li>\n<li>Uớm kính với 2 tay đỡ để tùy chỉnh cho phù hợp với 4 lỗ có sẵn trên kính</li>\n<li>Lắp 4 tai cao su lên 2 tay đỡ chữ L</li>\n<li>Vặn 4 ốc lại lưu ý phải&nbsp;lót long đen</li></ol>\n<p>Chúc quý khách lắp đặt thanh công và lái xe an toàn</p>\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"380\" src=\"https://www.youtube.com/embed/1Q8IUeKfUeM\" title=\"YouTube video player\" width=\"100%\"></iframe></p>', '', 'kính chắn gió', 'chắn gió xe máy, kính chắn gió, kinh chan gio xe máy, kính chắn gió xe máy, phụ kiện xe máy, Volcano, volcano.vn, xe may, xe máy', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '128000', '', '1', '', '', NULL, '', 'Kính chắn gió xe máy WIND PROTECF SCREEN', 'Kính chắn gió xe máy WIND PROTECF SCREEN', '1', 'kg', 'images/9553750/kinh-chan-gio-xe-may-wind-protecf-screen-1.jpg', '<p>Kính chắn gió xe máy chỉ những người dùng sản phẩm mới đánh giá được các công dụng&nbsp;nó mang lại khi lưu thông xe máy trong điều kiện bụi, ẩm, nhiệt như ở Việt Nam.</p>\n<p>Với kính chắn', '9553750', '15247992', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:34', '2024-05-29 06:22:34'),
(1478, 'muc-mem-gia-moi-cau-ca-phat-sang-trong-bong-toi-8-gr-02-con', 'Mực mềm giả mồi câu cá phát sáng trong bóng tối 8 Gr (02 con)', '<p><em><strong>Mực mềm giả mồi câu cá phát sáng trong bóng tối 8Gr (02 con)</strong></em></p>\n<p>Mồi mực giả chuyên câu lure cá loại cá biển như cá mú cá ngừ cá chẽm cá nhồng...</p>\n<p>Mồi mực mềm câu cá chẽm được mô phỏng giống mồi thật đang bơi trong nước giúp thu hút của những cá săn mồi.</p>\n<p>Bộ mồi mềm câu cá được làm từ nhựa dẻo giúp có action chuẩn khi lure</p>\n<p>Chất liệu: Nhựa dẻo<br />\n- Nặng 8 gram<br />\n- Dài 11 cm<br />\n- Giá sản phẩm: giá 2 con.</p>\n<p>#moi_mem_cau_lure​ #moi_mem_jig_head​ #moi_mem_cau_ca_chem​ #moi_mem_lure_ca_loc​ #moi_mem_cau_bien​ #luoi_cau_moi_mem​ #moi_muc_gia_cau_ca​ #muc_gia​ #mồi_câu_cá_mú_biển​ #mồi_giả_câu_cá_mú_biển​ #mồi_mềm_câu_lure​ #mồi_câu_cá_biển​ #mồi_câu​¬_cá #mồi_câu_cá_chẽm​ #mồi_giả_câu_cá_ngừ_đại_dương​ #mồi_giả​ #mực_giả​ #mồi_mực_giả​ #mồi_mực_mềm</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/muc-mem-gia-moi-cau-1.jpg?v=1514865940179\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/muc-mem-gia-moi-cau-2.jpg?v=1514865946976\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/muc-mem-gia-moi-cau-4.jpg?v=1514865955949\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/muc-mem-gia-moi-cau-3.jpg?v=1514865965623\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/muc-mem-gia-moi-cau-5.jpg?v=1514865973827\" /></strong></em></p>', '', 'Mồi mực giả', 'mồi câu, mồi câu biển, mồi lure, Mồi mực, Mực mềm giả mồi câu cá phát sáng trong bóng tối 8 Gr (02 con), ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '39000', '', '1', '', '', NULL, '', 'Mực mềm giả mồi câu cá phát sáng trong bóng tối 8 Gr (02 con)', 'Mực mềm giả mồi câu cá phát sáng trong bóng tối 8Gr (02 con)  Mực mềm phát ánh sáng xanh lục ban đêm, là một trong những phụ kiện thiết yếu cho các câu thủ với', '0.1', 'kg', 'images/9522771/muc-mem-gia-moi-cau-ca-phat-sang-trong-bong-toi-8-gr-02-con.jpg', '<p>Mồi mực giả chuyên câu lure cá loại cá biển như cá mú cá ngừ cá chẽm cá nhồng...</p>\n<p>Mồi mực mềm câu cá chẽm được mô phỏng giống mồi thật đang bơi trong nước giúp thu hút của những cá s', '9522771', '15202233', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:40', '2024-05-29 06:22:40'),
(1479, 'tem-decal-dan-4-x-4-king-of-overlander-trang-tri-xe', 'Tem Decal dán 4 X 4 KING OF OVERLANDER trang trí xe', '<p><em><strong>&nbsp;Tem Decal dán 4 X 4 KING OF OVERLANDER trang trí xe</strong></em></p>\n<p>&nbsp;Decal được sản xuất với chất liệu cao cấp, độ dính cao. Máu sắc bền, chịu được lau rửa.</p>\n<p>&nbsp;Trang trí, tạo điểm nhấn cho chiếc xe hơi của bạn. Có thể dán được tại mọi vị trí trên vỏ xe, với thiết kế độc đáo, khá khỏe với kiểu dáng thể thao.</p>\n<p>&nbsp;Kích thước 18*8CM. Màu sắc: Trắng và đen (Phù hợp dán cho những xem tối&nbsp;màu như Đen, xám, đỏ, xanh đậm...)</p>\n<p>Sản phẩm hầu hết phù hợp với các loại xe ô tô.</p>\n<p>Tự dán rất đơn&nbsp;giản,&nbsp;lau sạch chỗ muốn dán, sau đó bóc tấm giấy bóng cứng trên decal ra, rồi từ từ dán đều lên xe, lấy khăn miết đều cho không bị phồng, sau đó bóc lớp giấy bóng mỏng ra là xong, chúc bạn&nbsp;có bộ decal ưng ý.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-7.jpg?v=1514863041614\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-6.jpg?v=1514863051879\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-1.jpg?v=1514863065330\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-2.jpg?v=1514863073183\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-4.jpg?v=1514863080387\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-5.jpg?v=1514863088875\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-8.jpg?v=1514863096190\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/decal-dan-4x4-king-of-9.jpg?v=1514863103286\" /></p>', '', 'Decal', 'decal dán trang trí xe, decal dán xe, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Màu sắc', 'Đen', '', '', '', '', '', '', '', 'deny', '', '68000', '', '1', '', '', NULL, '', 'Tem Decal dán 4 X 4 KING OF OVERLANDER trang trí xe', 'Tem Decal dán 4 X 4 KING OF OVERLANDER trang trí xe  Decal được sản xuất với chất liệu cao cấp, độ dính cao. Máu sắc bền, chịu được lau rửa.   Trang trí, tạo', '0.3', 'kg', 'images/9522079/tem-decal-dan-4-x-4-king-of-overlander-trang-tri-xe.jpg', '<p>&nbsp;Decal được sản xuất với chất liệu cao cấp, độ dính cao. Máu sắc bền, chịu được lau rửa.</p>\n\n<p>&nbsp; Trang trí, tạo điểm nhấn cho chiếc xe hơi của bạn. Có thể dán được tại mọi vị t', '9522079', '15201314', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:42', '2024-05-29 06:22:42'),
(1480, 'mu-bao-hiem-zhc-805-helmet', 'Mũ bảo hiểm 3/4 ZHC-805 HELMET', '<p><em><strong>Mũ bảo hiểm ZHC-805 HELMET</strong></em></p>\n<p>&nbsp;Mũ bảo hiểm với kiểu 3/4 rất thịnh hành hiện nay với thiết kế chắc chắn có kính trong siêu bền.&nbsp;</p>\n<p>Chất kiệu nhựa PP siêu&nbsp;bền bỉ&nbsp; màu sắc đẹp có thể gắn kính không gắn kính khi sử dụng.&nbsp;đường viền quanh nón và lớp lót bên trong được phối màu rất tinh tế so với nền sơn của nón. Điều này khiến cho lớp lót nón không chỉ có công dụng thấm hút mồ hôi, làm êm da đầu mà còn có công năng thẩm mỹ tinh tế,&nbsp;đẹp hơn, bắt mắt hơn</p>\n<p>Trọng lượng mũ nhẹ chỉ 0.9kg tạo cảm giác thoải mái cho người dùng, quai cài dễ sử dụng</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-10.jpg?v=1514520762226\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-9.jpg?v=1514520773472\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-11.jpg?v=1514520786425\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-8.jpg?v=1514520912651\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-6.jpg?v=1514520835083\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-7.jpg?v=1514520846073\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/mu-bao-hiem-zhg-1.jpg?v=1514520856241\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\