(1482, 'tem-chu-noi-dung-tich-o-to-1-6t-1-8t-2-0t', 'Decal chữ nổi dung tích ô tô (1.6T, 1.8T, 2.0T)', '<p><em><strong>Decal chữ nổi dung tích ô tô (1.6T, 1.8T, 2.0T)</strong></em></p>\n<p>&nbsp;Decal dán trang trí xe&nbsp; đang dần trở thành một xu hướng và rất được ưa chuộng,&nbsp;vì nó tạo nên sự khác biệt để giúp cho việc nhận diện trở nên dễ dàng hơn.</p>\n<p>Decal dung tích xe làm từ hợp&nbsp;kim&nbsp;chắc chắn bóng sáng bền màu không thấm nước, bóc dán vô cùng đơn giản,&nbsp;phù hợp dán đuôi xe.</p>\n<p>Kích thước: 2.5*2.4CM</p>\n<p>Lắp đặt đơn giản:</p>\n<ul>\n<li data-spm-anchor-id=\"a2o4n.prod.0.i3.45ecfd55njCzXE\">Xác Định vị trí dán</li>\n<li>Làm sạch các bề mặt vị trí bạn muốn dán.</li>\n<li>Bóc miếng dán 2 mặt(3M),&nbsp;làm nóng chất kết dính hai mặt, độ dích&nbsp;sẽ được tăng lên rất nhiều sau đó dán vào vị trí đã chọn</li>\n<li>Không di chuyển decal hoặc rửa xe của bạn trong 24 giờ sau khi dán</li></ul>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-6.jpg?v=1514256069490\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-dung-tich-xe-1.jpg?v=1521277383039\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-7.jpg?v=1514256088611\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-1.jpg?v=1514256170928\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-2.jpg?v=1514256179051\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-3.jpg?v=1514256137344\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-4.jpg?v=1514256145524\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/logo-t-5.jpg?v=1514256155263\" /></strong></em></p>', '', 'decal dung tích ô tô', 'decal dung tích ô tô, logo dung tích ô tô, ô tô, phụ  kiện ô tô, tem dung tích ô tô, Volcano, volcano.vn', '1', 'Phân loại', '2.0 T', '', '', '', '', '', '', '', 'deny', '', '45000', '', '1', '', '', NULL, '', 'Tem chữ nổi dung tích ô tô (1.6T, 1.8T, 2.0T)', 'Tem chữ nổi dung tích ô tô (1.6T, 1.8T, 2.0T)', '0.25', 'kg', 'images/9462620/tem-chu-noi-dung-tich-o-to-1-6t-1-8t-2-0t.jpg', '<p>&nbsp;Decal dán trang trí xe&nbsp; đang dần trở thành một xu hướng và rất được ưa chuộng,&nbsp;vì nó tạo nên sự khác biệt để giúp cho việc nhận diện trở nên dễ dàng hơn.</p>\n\n<p>Decal dung', '9462620', '15105212', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:53', '2024-05-29 06:22:53'),
(1483, 'tom-gia-moi-cau-ca-3-tom', 'Tôm giả mồi câu cá (3 tôm)', '<p><em><strong>Tôm giả mồi câu cá (3 tôm)</strong></em></p>\n<p><i>V</i>ới công nghệ hiện đại&nbsp;mồi câu giả với hình dạng y hệt tôm thật đã được&nbsp;sản xuất với chất liệu nhựa,&nbsp;mềm mại kích thước nhỏ gọn chắc chắn sẽ thu hút được nhiều loài cá ăn mồi tôm.</p>\n<p>Chất liệu nhựa mềm n màu sắc bắt mắt sức&nbsp;thu hút đối với cá cao với một lưỡi câu được trang bị sẵn sàng cho các cần thủ sử dụng.</p>\n<p>Kích thước mồi: dài 4,5cm.</p>\n<p>Trọng lượng: 1.3gr.</p>\n<p>Giá sản phẩm: giá 3 tôm.</p>\n<p>#lure&nbsp; #cá_mềm&nbsp; #mồi_mềm #mồi_câu #tôm_mềm&nbsp; #mồi_giả #câu_cá #docauca</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-3.jpg?v=1513322046739\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-4.jpg?v=1513322204840\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-5.jpg?v=1513322213096\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-2.jpg?v=1513322221957\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-1.jpg?v=1513322231061\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tom-gia-cau-ca-7.jpg?v=1513322536256\" /></p>', '', 'mồi câu cá', 'câu cá, mồi câu, mồi câu cá, mồi giả câu cá, mồi tôm giả câu  cá, tôm giả caai cá, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '30000', '', '1', '', '', NULL, '', 'Tôm giả mồi câu cá (3 tôm)', 'Tôm giả mồi câu cá (3 tôm)', '0.3', 'kg', 'images/9360061/tom-gia-moi-cau-ca-3-tom.jpg', '<p>Tôm mồi câu giả với hình dạng y hệt tôm thật đã được&nbsp;sản xuất với chất liệu nhựa,&nbsp;mềm mại kích thước nhỏ gọn chắc chắn sẽ thu hút được nhiều loài cá ăn mồi tâm.</p>\n<p>Chất liệu ', '9360061', '14946435', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:22:58', '2024-05-29 06:22:58'),
(1484, 'bo-4-mieng-dan-cao-su-bao-ve-cua-xe-cac-hang', 'Bộ 4 miếng dán cao su bảo vệ cửa xe (các hãng)', '<p><em><strong>Bộ 4 miếng dán cao su bảo vệ cửa xe (các hãng)</strong></em></p>\n<p>Xe bạn thường xuyên cọ quệt khi mở cửa nơi chật hẹp làm trầy cánh cửa làm xấu đi xe của bạn, lúc đó bạn thường xuyên lên gara xe để sơn lấp vết trầy. Vậy&nbsp;<em><strong>4 miếng dán cao su bảo vệ cửa xe sẽ</strong></em>&nbsp;giúp bạn yên tâm bảo vệ xế cưng và lái xe an toàn.</p>\n<p>&nbsp;Giúp bảo vệ cánh cửa ô tô một cách an toàn và tiết kiệm được một khoản chi phí không phải&nbsp;sơn&nbsp;lấp vết trầy.</p>\n<p>&nbsp;Bảo vệ cánh cửa ô tô của bạn tránh những va chạm, trầy xước, bong tróc…</p>\n<p>&nbsp;Dễ dàng sử dụng, có thể tự thao tác với bang dính 3M siêu bền</p>\n<p>&nbsp;Lắp trên mép cánh cửa, chống va đập và xước cửa khi mở ra đập vào tường hoặc xe khác. Sản phẩm phân loại theo từng hãng khác nhau: KIA, TOYOTA, HONDA, FORD...</p>\n<p>Kích thước: 12.7*2.7*1.8CM</p>\n<p>&nbsp;<img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-4.jpg?v=1512009615985\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-2.jpg?v=1512009622377\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-1.jpg?v=1512009644282\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-3.jpg?v=1512009652042\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-6.jpg?v=1512009662944\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-56.jpg?v=1512009670128\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-57.jpg?v=1512009678020\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-59.jpg?v=1512010276619\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/4-dan-bao-ve-cua-xe-theo-hang-xe-99.jpg?v=1512011204293\" /></p>', '', 'Dán bảo vệ cửa xe', 'bảo vệ cửa xe, dan bao ve cua o to, dán bảo vệ cửa xe, dán xe, o to, ô tô, phu kien o to, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Hãng', 'TRD', '', '', '', '', '', '', '', 'deny', '', '120000', '', '1', '', '', NULL, '', 'Bộ 4 miếng dán cao su bảo vệ của xe (các hãng)', 'Bộ 4 miếng dán cao su bảo vệ của xe (các hãng)', '0.35', 'kg', 'images/9185953/bo-4-mieng-dan-cao-su-bao-ve-cua-xe-cac-hang.jpg', '<p>Giúp bảo vệ cánh cửa ô tô một cách an toàn và tiết kiệm được một khoản chi phí không phải&nbsp;sơn&nbsp;lấp vết trầy.</p>\n\n<p>&nbsp;Bảo vệ cánh cửa ô tô của bạn tránh những va chạm, trầy x', '9185953', '14652669', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:23:12', '2024-05-29 06:23:12'),
(1485, 'gia-do-da-nang-gan-chan-guong-xe-may-gd02', 'Giá đỡ đa năng gắn chân gương xe máy GD02 - Khắc Laser Theo Yêu Cầu', '<p><strong><em>Giá đỡ đa năng gắn chân gương xe máy GD02&nbsp;- Khắc Laser Theo Yêu Cầu</em></strong></p>\n<p>Phụ kiện gắn chân gương xe máy&nbsp;vời nhiều chức năng như giá đỡ điện thoại, gắn đèn trợ sáng, đèn led, chớp, camera hành trình.... lại là một&nbsp;phụ kiện trang trí độc và đẹp.</p>\n<p>Thiết kế kim loại chắc chắn với ốc chốt, tiện dụng với nhiều chân ốc cỡ 6mm, 8,8mm, 10mm cho bạn them nhiều lựa chọn khi sử dụng.</p>\n<p>Lắp đặt đơn giản với chân gương tương thích hầu hết mọi loại xe trên thị trường.</p>\n<p>&nbsp;Kích thước sản phẩm: 12*2.1CM.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-xe-may-5.jpg?v=1511402471600\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-xe-may-4.jpg?v=1511402483573\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-xe-may-8.jpg?v=1511402495622\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-xe-may-7.jpg?v=1511402504253\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/gia-do-xe-may-6.jpg?v=1511402518727\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750