(1486, 'tem-chu-noi-kawasaki-dan-trang-tri-xe', 'Tem chữ nổi KAWASAKI dán trang trí xe', '<p><em><strong>Tem chữ nổi KAWASAKI dán trang trí xe</strong></em></p>\n<p>Tem dán nổi với logo&nbsp;nổi KAWASAKI , làm từ chất liệu nhựa dẻo phủ một lớp sơn màu cao cấp chống mờ chống thấm tuyệt đối.</p>\n<p>Màu sắc đẹp với 2 màu: Đỏ, Vàng, trắng.&nbsp;Sản phẩm gồm 2 tem dán 2 bên đối xứng.</p>\n<p>&nbsp;Kích thước: 14*2.2cm</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-6.jpg?v=1510907793551\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-1.jpg?v=1510907803919\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-3.jpg?v=1510907812265\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-4.jpg?v=1510907825369\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-2.jpg?v=1510907838514\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-5.jpg?v=1510907847069\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/tem-chu-noi-kawasaki-5-57efca88-4f14-4cc2-b40b-19c232da91b9.jpg?v=1510907848142\" /></p>', '', 'Tem dán xe', 'phụ kiện xe máy, Tem chữ nổi KAWASAKI dán trang trí xe, tem dán trnag trí xe, tem dán xe, trang trí xe máy, Volcano, volcano.vn, xe máy', '1', 'Màu sắc', 'Đỏ', '', '', '', '', '', '', '', 'deny', '', '29000', '', '1', '', '', NULL, '', 'Tem chữ nổi KAWASAKI dán trang trí xe', 'Tem chữ nổi KAWASAKI dán trang trí xe', '0.25'