(1491, 'op-lung-dang-luoi-tan-nhiet-iphone-6-7-6s-7s-6plus-7plus-8-ipx', 'Ốp lưng dạng lưới tản nhiệt Iphone 6, 7, 6S, 6Plus, 7Plus, 8, IpX', '<p><em><strong>Ốp lưng dạng lưới&nbsp;tản nhiệt Iphone 6,&nbsp;6S, 6Plus,&nbsp;7, 7Plus, 8, 8Plus, IpX</strong></em></p>\n<p>Sản phẩm dành riêng cho dòng máy Iphone <em>6, 7, 6S, 7S, 6Plus, 7Plus, 8Plus, IpX</em>&nbsp;với thiết kế mặt sau được làm sần từ lưỡi các&nbsp;lỗ nhỏ&nbsp;&nbsp;tạo cảm giác cầm&nbsp;</p>\n<p>nắm \"dế yêu\"&nbsp;của bạn được chắc&nbsp;chắn&nbsp;hơn, với chất liệu nhựa siêu nhẹ tạo cho người dùng cảm thấy thoải mái với ốp lưng này:</p>\n<p><b><i>+&nbsp;</i></b>Chất liệu nhựa&nbsp;TPU&nbsp;cao cấp bền bỉ</p>\n<p>+ Thiết kế sang trọng, thời trang,&nbsp;ôm sát thân máy</p>\n<p>+ Bảo vệ máy tối đa, tránh va đập trầy xước&nbsp;</p>\n<p>+ Ốp dạng lưới tản nhiệt tốt hơn cho máy, tránh tổn hại tới pin</p>\n<p>+ Phầm chân cắm&nbsp;cáp sạc, tai nghe, nút âm lượng, logo của Apple đc khoét cẩn thận và tỉ mỉ</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip1122.jpg?v=1509078862382\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip7.jpg?v=1509078892677\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip8.jpg?v=1509078904229\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip6.jpg?v=1509078920562\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip4.jpg?v=1509078929124\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip5.jpg?v=1509078937087\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip9.jpg?v=1509078954433\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip114.jpg?v=1509078964917\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip115.jpg?v=1509078975629\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip116.jpg?v=1509078982936\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip118.jpg?v=1509079025074\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip119.jpg?v=1509078998620\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/op-ip-cac-mau-ip1120.jpg?v=1509079013571\" /></strong></em></p>', '', 'Ốp lưng Iphone', 'ốp ip, ốp lưng, op lung ip, Volcano, volcano.vn', '1', 'Màu sắc', 'Đỏ', 'Bản', '6 6s', '', '', '', '', '', 'deny', '', '29000', '80000', '1', '', '', NULL, '', 'Ốp lưng dạng lưỡi tản nhiệt Iphone 6, 7, 6S, 7S, 6Plus, 7Plus, 8, IpX', 'Ốp lưng dạng lưỡi tản nhiệt Iphone 6, 7, 6S, 7S, 6Plus, 7Plus, 8Plú, IpX Sản phẩm dành riêng cho dòng máy Iphone 6, 7, 6S, 7S, 6Plus, 7Plus, 8Plus, IpX với', '0.3', 'kg', 'images/8805720/op-lu