độ bóng, dộ sắc nét của chi tiết decal&nbsp;và đặc b', '8705627', '13822942', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:23:38', '2024-05-29 06:23:38'),
(1493, 'dien-thoai-ban-trang-tri-vintage-v02', 'Điện thoại bàn trang trí vintage V02', '<p><em><strong>Điện thoại bàn trang trí vintage V02</strong></em></p>\n<p>Mô hình cho bộ sưu tập đồ cổ của bạn&nbsp;Điện thoại cổ với bàn phím xoay một thời là món đồ xa xỉ chỉ có những gia đình thượng lưu mới có.</p>\n<p>Sản phẩm là mô hình để trang trí tuy không sử dụng được nhưng lại mang giá trị&nbsp;gợi lên không gian cổ điển&nbsp;trang nhã cho không gian</p>\n<p>Có thể trang trí góc học tập, cửa hàng thời trang, hay là quán cà phê, gợi lên không gian cổ điển, vintage cũ nhưng không bao giờ lỗi thời&nbsp;theo phong cách trang nhã</p>\n<p>Điểm nhấn đặc biệt sản phẩm là có thể xoay được bàn phím và có âm thanh phát lên từ điện thoại rất ấn tượng và còn được thiết kế thêm 2 ngăn để bên trong hộp để bạn có thể cho một số đồ dùng nhỏ</p>\n<p>Chất liệu: Nhựa tổng hợp</p>\n<p>Kích thước sản phẩm: 18*17*18CM</p>\n<p>Màu sắc: Với 2 màu đen và trắng cho khách hàng lựa chọn.</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-4.jpg?v=1507861856662\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-1.jpg?v=1507861727146\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-2.jpg?v=1507861894077\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-3.jpg?v=1507861909884\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-6.jpg?v=1507861933615\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-5.jpg?v=1507861941972\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/dong-ho-co-trang-tri-trai-tim-7.jpg?v=1507861961403\" /></strong></em></p>', '', 'Điện thoại bàn trang trí', 'điện thoại bàn trang trí, điện thoại cổ trang trí, điện thoai cổ trang trí để bàn, điện thoại trang trí bàn, trang trí, Volcano, volcano.vn', '1', 'Màu sắc', 'Màu đen', '', '', '', '', '', '', '', 'deny', '', '220000', '', '1', '', '', NULL, '', 'Điẹn thoại bàn trang trí vintage V02', 'Điẹn thoại bàn trang trí vintage V02 Mô hình cho bộ sưu tập đồ cổ của bạn Điện thoại cổ với bàn phím xoay một thời là món đồ xa xỉ chỉ có những gia đình thượng', '0.7', 'kg', 'images/8637889/dien-thoai-ban-trang-tri-vintage-v02.jpg', '<p>Mô hình cho bộ sưu tập đồ cổ của bạn Điện thoại cổ với bàn phím xoay một thời là món đồ xa xỉ chỉ có những gia đình thượng lưu mới có. Sản phẩm là mô hình để trang trí tuy không sử dụng đư', '8637889', '13704049', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:23:58', '2024-05-29 06:23:58'),
(1494, 'boc-vo-lang-o-to-cao-cap-188', 'Bọc vô lăng ô tô cao cấp 188', '<p><em><strong>Bọc vô lăng ô tô cao cấp 188</strong></em></p>\n<p>&nbsp;Bọc vô lăng cao cấp chất liệu da&nbsp;bền cầm êm tay thoải mái&nbsp; hỗ trợ người cầm lái chắc chắn và thật tay hơn. Thiết kế sang trọng với đa dạng màu sắc phù hợp với mọi nội thất xe hơi của bạn.&nbsp;</p>\n<p>Thiết kế đẹp với đường viền chỉ trắng, đỏ phối với đen. Bề mặt là các lỗ&nbsp;thấm mồ khi lái xe</p>\n<p>&nbsp;Dễ dàng sử dụng và lắp đặt.</p>\n<p>Màu sắc: viền đỏ phối đen và viền trắng đen</p>\n<p>Kích thước: 38CM</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-06.jpg?v=1506593740060\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-04.jpg?v=1506593752234\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-07.jpg?v=1506593761799\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-01.jpg?v=1506593768987\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-05.jpg?v=1506593780000\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/boc-vo-lang-o-to-cao-cap-03.jpg?v=1506593787090\" /></strong></em></p>', '', 'Bọc vô lăng', '', '1', 'Màu sắc', 'Màu đỏ phối đen', '', '', '', '', '', '', '', 'deny', '', '188000', '', '1', '', '', NULL, '', 'Bọc vô lăng ô tô cao cấp 188', 'Bọc vô lăng ô tô cao cấp 188  Bọc vô lăng cao cấp chất liệu da bền cầm êm tay thoải mái  hỗ trợ người cầm lái chắc chắn và thật tay hơn. Thiết kế sang trọng với', '0.8', 'kg', 'images/8461178/boc-vo-lang-o-to-cao-cap-188.jpg', '<p>&nbsp;Bọc vô lăng cao cấp chất liệu da PU bền cầm êm tay thoải mái&nbsp; hỗ trợ người cầm lái chắc chắn và thật tay hơn. Thiết kế sang trọng với đa dạng màu sắc phù hợp với mọi nội thất xe', '8461178', '13412108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:24:25', '2024-05-29 06:24:25'),
(1495, 'khan-uot-lau-noi-that-o-to-areon-chinh-hang-lau-kinh-da-taplo-vo-lang', 'Khăn ướt lau nội thất ô tô AREON chính hãng  (Lau Kính, Da, Taplo, Vô lăng)', '<p><em><strong>Khăn ướt lau nội thất ô tô Areon (Lau Kính, Da, Taplo, Vô lăng)</strong></em></p>\n<p>Sản phẩm khăn lau chăm sóc xe chính hãng của AREON chứa chất dưỡng chuyên dụng giúp làm sạch, sáng, bóng cho nội thất xe.</p>\n<p>&nbsp;&nbsp;Khăn ướt lau kính&nbsp;Areon Glass Wipes được thiết kế chuyên dụng giúp lau sạch bóng các sản phẩm gương, kính&nbsp;trong xe hơi cũng như trong&nbsp;nhà.</p>\n<p>&nbsp; Khăn ướt lau táp lô&nbsp;xe hơi Areon Dashboard&nbsp;Wipes được thiết kế chuyên dụng giúp lau sạch bóng phần bảng đồng hồ và táp lô.</p>\n<p>&nbsp; Khăn ướt lau da trên ô tô&nbsp; Areon Leather&nbsp;Wipes thiết kế chuyên dụng lau da trên ô tô giúp các phần như bọc ghế, gối tựa...</p>\n<p>Một túi sản phẩm gồm 25 miếng, có mùi hương tự nhiên êm dịu mang đến cho bạn cảm giác thoải mái, tràn đầy cảm xúc.&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-uot-areon-leather-04.jpg?v=1506564543776\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-uot-areon-leather-02.jpg?v=1506564565185\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-uot-areon-leather-03.jpg?v=1506564574924\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/khan-uot-areon-leather-01.jpg?v=1506564587201\" /></p>\n<p><strong>Thông tin thương hiệu</strong></p>\n<p>Areon là thương hiệu&nbsp;nổi tiếng đến từ Bungary với các sản phẩm&nbsp;đáp ứng yêu cầu nghiêm ngặt của Liên minh châu Âu về độ an toàn và chất lượng. Areon có nhiều dòng sản phẩm phù hợp với mọi không gian nội thất xe hơi.&nbsp;Sản phẩm của&nbsp;Areon nhiều năm liền đứng trong top 3 trên thế giới, gồm 2 dòng sản phẩm chính: nước hoa cho gia đình và nước hoa cho ô tô. Đặc biệt là dòng sản phẩm nước hoa cho ô tô đứng top 1 thế giới với nhiều ưu điểm nổi bật.</p>', '', 'Khăn ướt lau nội thất', 'khắn ướt lau da ô tô, khăn ướt lau kính ô tô, khăn ướt lau nội thất ô tô, khăn ướt lau táp lô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Loại', 'Lau kính Areon Glass Wipes', '', '', '', '', '', '', '', 'deny', '', '90000', '', '1', '', '', NULL, '', 'Khăn ướt lau nội thất ô tô AREON chính hãng  (Lau Kính, Da, Taplo, Vô', 'Khăn ướt lau nội thất ô tô Areon (Lau Kính, Da, Taplo, Vô lăng) Sản phẩm khăn lau chăm sóc xe chính hãng của AREON chứa chất dưỡng chuyên dụng giúp làm sạch,', '', 'kg', 'images/8452373/khan-uot-lau-noi-that-o-to-areon-chinh-hang-lau-kinh-da-taplo-vo-lang.jpg', '<p><em><strong>Khăn ướt lau nội thất ô tô Areon (Lau Kính, Da, Taplo, Vô lăng)</strong></em></p>\n\n<p>Sản phẩm khăn lau chăm sóc xe chính hãng của AREON chứa chất dưỡng chuyên dụng giúp làm sạ', '8452373', '13398640', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:24:34', '2024-05-29 06:24:34'),
(1496, 'bo-02-den-led-o-to', 'Bộ 02 Đèn Led Cob Ô Tô ( ánh sáng trắng, viền tròn đỏ, xanh dương)', '<p><em><strong>Bộ 02 Đèn Led Cob&nbsp;Ô Tô ( ánh sáng trắng, viền tròn đỏ,, xanh dương)</strong></em></p>\n<p>Đèn cos có góc chiếu thấp giúp người lái xe quan sát được tình trạng mặt đường và các vật cản phía trước trong phạm vi gần, thường được sử dụng khi lái xe di chuyển trong khi đô thị hoặc ở tốc độ chậm</p>\n<p>Bộ sản phẩm là&nbsp;thiết bị chiếu sáng ở phía trước ô tô, được lắp đặt theo một cặp</p>\n<p>Ánh sáng trắng trẻ trung với anh sáng trắng và led viền màu đỏ, tuổi thọ cao</p>\n<p>Phù hợp với nhiều loại xe, Công nghệ LED mới, vượt trội về tuổi thọ - độ bền - phổ sáng</p>\n<p>Giúp tăng độ sáng trực quan, 2 xe chạy ngược chiều nhau&nbsp;giúp người lái dễ phát hiện ra nhau từ xa hơn.</p>\n<p>Nguồn sáng: COB điện nguồn 12V</p>\n<p>Công xuất: 30W</p>\n<p>Cường độ ánh sáng: 1200LM</p>\n<p>Nhiệt độ màu: 7000k-8000k</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/led-cos-o-to-6.jpg?v=1506572851447\" /><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-3.jpg?v=1505530662933\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-6-286b8962-c07f-494b-bd10-e8b0970518f7.jpg?v=1505530846296\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-9.jpg?v=1505530788637\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-1.jpg?v=1505530693937\" /></strong></em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-4.jpg?v=1505530865043\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/led-cos-o-to-7.jpg?v=1506572900939\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/led-cos-o-to-8.jpg?v=1506572917815\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-5-a2544090-f787-4d23-978e-bab93a42acf3.jpg?v=1505530883354\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-8.jpg?v=1505530974380\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/den-led-chieu-gam-7-e7a81e8f-233d-4b08-bb80-14b2a03ff555.jpg?v=1505530983088\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/led-cos-o-to-10.jpg?v=1506572966208\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/led-cos-o-to-9.jpg?v=1506572974300\" /></p>\n<p>&nbsp;Test đèn nhanh</p>\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"300\" src=\"https://www.youtube.com/embed/4BsNPq5gUR4\" width=\"100%\"></iframe></p>', '', 'Đèn', 'đèn led ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn', '1', 'Kích cỡ', '64MM viền tròn đỏ', '', '', '', '', '', '', '', 'deny', '', '250000', '350000', '1', '', '', NULL, '', 'Bộ 02 Đèn Led Cob Ô Tô ( ánh sáng trắng, vòng tròn đỏ)', 'Bộ 02 đèn led ô tô Bộ sản phẩm là thiết bị chiếu sáng ở phía trước ô tô, được lắp đặt theo một cặp Ánh sáng trắng trẻ trung với anh sáng trắng và led viền màu', '0.5', 'kg', 'images/8296955/bo-02-den-led-o-to.jpg', '<p>Ánh sáng trắng trẻ trung với anh sáng trắng và led viền màu đỏ, tuổi thọ cao</p>\n\n<p>Phù hợp với nhiều loại xe</p>\n\n<p>Công nghệ LED mới, vượt trội về tuổi thọ - độ bền - phổ sáng</p>\n\n<p>', '8296955', '13405115', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:25:50', '2024-05-29 06:25:50'),
(1497, 'chup-van-kiem-moc-khoa-logo-o-to-cac-hang', 'Chụp van kiêm móc khóa logo ô tô (các hãng)', '<p><em><strong>Chụp van kiêm móc khóa logo ô tô (các hãng)</strong></em></p>\n<p>&nbsp;Bộ chụp van logo với nhiều hãng xe phổ biến trên thị trường hiện nay với thiết kế từ kim loại chắc chắn đảm bảo không chầy xước hay mất màu.&nbsp;</p>\n<p>&nbsp;Phù hợi với tất cả các van xe hơi với logo dán chìm đảm đảo không bong &nbsp;chống nước tốt.&nbsp;</p>\n<p>Sản phẩm vừa là một phụ kiện và là một vật trang trí cho xe của bạn.</p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa14.jpg?v=1504174152790\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa15.jpg?v=1504174166506\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa13.jpg?v=1504174192055\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa8.jpg?v=1504174211204\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa16.jpg?v=1506065209651\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa17.jpg?v=1506065220048\" /></p>\n<p>&nbsp;</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-khoa7.jpg?v=1504174274761\" /></p>\n<p><img data-thumb=\"original\" original-height=\"438\" original-width=\"700\" src=\"//bizweb.dktcdn.net/100/200/904/files/chup-van-xe-kem-moc-kho2.jpg?v=1504174289071\" /></p>\n<p><i