(1503, 'kinh-chan-gio-xe-may-1', 'Kính chắn gió xe máy', '<p><em><strong>Kính chắn gió xe máy</strong></em></p>\n<p>Thiết kế thời trang, giúp cản gió và bụi khi&nbsp;đi xe. Chất liệu nhựa dẻo trong suốt,&nbsp;khung cứng, lắp&nbsp;đặt&nbsp;đơn giản và phù hợp với&nbsp;đa số các dòng xe.</p>\n<p>&nbsp;Kích thước sản phẩm:&nbsp;&nbsp;Rộng: 40CM,&nbsp;cao: 30cm, dày: 2mm</p>\n<p>#kinhchangio #kính- chắn - gió #kínhchắngióxemáy #kinhchangioxemay #Kínhchắngióxemáy</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-2.jpg?v=1498447388529\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-02.jpg?v=1498447405844\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-04-78021f88-e0d6-4126-85f3-3b2bf249b7f3.jpg?v=1498447529314\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-04-5d7aa9cb-2772-4aed-9a75-18a50408f508.jpg?v=1498447414012\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-05.jpg?v=1498447430187\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-06.jpg?v=1498447436192\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/kinh-chan-gio-07.jpg?v=1498447442252\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"75