(1505, 'ruot-bat-lua-xang', 'Ruột bật lửa xăng', '<p><em><strong>Ruột bật lửa xăng</strong></em></p>\n<p>Chất liệu kim loại chóng gỉ tối</p>\n<p>Có sẵn bông, đá chỉ việc tẩm xăng và sử dụng.</p>\n<p>Lắp vừa cho các loại bật xăng, zippo</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-1.jpg?v=1493797882447\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-2.jpg?v=1493797888836\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-3.jpg?v=1493797894905\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-4.jpg?v=1493797900953\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-5.jpg?v=1493797910969\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/ruot-bat-lua-xang-6.jpg?v=1493797916681\" /></strong></em></p>', '', 'Bật lửa', 'bật lửa, bật lửa trang trí, bật lửa độc, phụ kiện bật lửa, ruột bật lửa, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '45000', '85000', '1', '', '', NULL, '', 'Ruột bật lửa xăng', 'Ruột bật lửa xăng', '0.3', 'kg', 'images/6648286/ruot-bat-lua-xang.jpg', '<p>Chất liệu kim loại chóng gỉ tối</p>\n<p>Có sẵn bông, đá chỉ việc tẩm xăng và sử dụng.</p>\n<p>Lắp vừa cho các loại bật xăng, zippo</p>', '6648286', '10565583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL