(1507, 'bat-lua-vuong-mien', 'Bật lửa vương miện', '<p><em><strong>Bật lửa vương miện</strong></em></p>\n<p>Chất liệu kim loại khắc nổi họa tiết vương miện sang trong 1 mặt.</p>\n<p>Sử dụng nhiên liệu xăng.</p>\n<p>Bật có full bông, bấc, đá lửa.</p>\n<p>&nbsp;</p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-vuong-mien-2.jpg?v=1493783450797\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-vuong-mien-4.jpg?v=1493783461053\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-vuong-mien-3.jpg?v=1493783469807\" /></strong></em></p>\n<p><em><strong><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-lua-vuong-mien-1.jpg?v=1493783476689\" /></strong></em></p>', '', 'Bật lửa', 'bật lửa trang trí, bật lửa vương miện, bật lửa đẹp, bật lửa độc, Volcano, volcano.vn', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '45000', '120000', '1', '', '', NULL, '', 'Bật lửa vương miện', 'Bật lửa vương miện', '0.3', 'kg', 'images/6644732/bat-lua-vuong-mien.jpg', '<p>Chất liệu kim loại khắc nổi họa tiết vương miện sang trong 1 mặt.</p>\n<p>Sử dụng nhiên liệu xăng.</p>\n<p>Bật có full bông, bấc, đá lửa.</p>', '6644732', '10560984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:27:14', '2024-05-29 06:27:14'),
(1508, 'dai-dieu-chinh-day-an-toan-o-to', 'Đai điều chỉnh dây an toàn ô tô', '<p><em><strong>Đai điều chỉnh dây an toàn ô tô</strong></em></p>\n<p>Trẻ em còn nhỏ và khá hiếu động. Vì vậy, sẽ rất nguy hiểm nếu cho bé ngồi một mình ở phía trước trong khi đang lưu thông trên đường. Tuy nhiên, dây thắt đai an toàn lại không vừa người với trẻ, gây khó chịu làm trẻ không thích thắt đai. Bộ điều chỉnh dây đai an toàn cho trẻ khi đi xe hơi vô cùng tiện lợi, dễ lắp đặt và sử dụng, tạo nên sự thoải mái cho người dùng</p>\n<p>&nbsp;Kích thước: 25*22.5CM</p>\n<p>Màu sắc: Tím, đỏ, xanh dương.</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/deu-chinh-day-an-toan-o-to-1.jpg?v=1493696576675\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/deu-chinh-day-an-toan-o-to-2.jpg?v=1493696584642\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/deu-chinh-day-an-toan-o-to-3.jpg?v=1493696591464\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/deu-chinh-day-an-toan-o-to-4.jpg?v=1493696597434\" /></p>\n<p>&nbsp;</p>', '', 'Đai điều chỉnh', 'an toàn ô tô, ô tô, phụ  kiện ô tô, Volcano, volcano.vn, đai điều chỉnh dây an toàn', '1', 'Màu sắc', 'Tím', '', '', '', '', '', '', '', 'deny', '', '35000', '45000', '1', '', '', NULL, '', 'Đai điều chỉnh dây an toàn ô tô', 'Đai điều chỉnh dây an toàn ô tô Trẻ em còn nhỏ và khá hiếu động. Vì vậy, sẽ rất nguy hiểm nếu cho bé ngồi một mình ở phía trước trong khi đang lưu thông trên', '0.2', 'kg', 'images/6635119/dai-dieu-chinh-day-an-toan-o-to.jpg', '<ul>\n	<li>Vải chất lượng cao; sức đề kháng cao</li>\n	<li>Dày 0;3 mm; chống cháy bọt biển; không có mùi đặc biệt</li>\n	<li>Có thể giặt được; không phai; không co lại; không có biến dạng</li>\n	', '6635119', '14046828', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:27:24', '2024-05-29 06:27:24'),
