(1516, 'dong-ho-dien-tu-mini-gan-kinh-o-to', 'Đồng hồ điện tử mini gắn kính ô tô', '<p><em><strong>Đồng hồ điện tử mini gắn kính ô tô</strong></em></p>\n<p>Một chiếc đồng hồ điện tử nhỏ nhắn, xinh xắn vừa giúp bạn xem được chính xác thời gian lại rất tiện lợi khi có thể gắn được ngay trên mặt kính xe. Nhỏ gọn, dễ sử dụng. Màn hình hiển thị giờ và phút, có nút bấm chuyển sang hiển thị ngày, tháng, năm,... Thông số kỹ thuật: - Sử dụng 1 pin AG10 - Kích thước: 9 x 2.7CM</p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-mini-1.jpg?v=1492934571922\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-mini-2.jpg?v=1492934578849\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-mini-3.jpg?v=1492934584983\" /><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/nuoc-hoa-mini-4.jpg?v=1492934595041\" /></p>', '', 'Đồng hồ điện tử mini gắn kính ô tô', 'ô tô, phụ  kiện ô tô, Volcano, volcano.vn, đồng hồ gắn kính ô tô, đồng hồ mini ô tô, đồng hồ ô tô', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '60000', '', '1', '', '', NULL, '', 'Đồng hồ điện tử mini gắn kính ô tô', 'Đồng hồ điện tử mini gắn kính ô tô Một chiếc đồng hồ điện tử nhỏ nhắn, xinh xắn vừa giúp bạn xem được chính xác thời gian lại rất tiện lợi khi có thể gắn được', '0.2', 'kg', 'images/6544120/dong-ho-dien-tu-mini-gan-kinh-o-to.jpg', '<p>Một chiếc đồng hồ điện tử nhỏ nhắn, xinh xắn vừa giúp bạn xem được chính xác thời gian lại rất tiện lợi khi có thể gắn được ngay trên mặt kính xe. Nhỏ gọn, dễ sử dụng. Màn hình hiển thị gi', '6544120', '10409521', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-05-29 06:28:00'