(1517, 'bat-lua-trang-tron-co-dien', 'Bật lửa trắng trơn cổ điển- Khắc Laser Theo Yêu Cầu', '<p><em><strong>Bật lửa trắng trơn cổ điển - Khắc Laser Theo Yêu Cầu</strong></em></p>\n<p>Với vỏ ngoài chắc chắn nên rất bền với thời gian.</p>\n<p>Bật lửa&nbsp;sử dụng xăng, bấc và đá nên có thể dễ dàng thay thế</p>\n<p>Được thiết kế tinh sảo, mang phong cách Zippo</p>\n<p>Vỏ kim loại chất lượng cao, chắc chắn, chống trầy xước tốt.</p>\n<p><em>Shop có dịch&nbsp;vụ khắc laser&nbsp;tên, logo, chữ, số điện thoại&nbsp;lên sản&nbsp;phẩm theo yếu cầu của khác hàng. Khách hàng vui lòng liên hệ trực tiếp với shop để được hỗ trợ: Hotline 0868.533.299 - zalo&nbsp;0868.533.299.</em></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-co-dien-1.jpg?v=1492933881596\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-co-dien-2.jpg?v=1492933888501\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-co-dien-4.jpg?v=1492933896637\" /></p>\n<p><img data-thumb=\"original\" original-height=\"400\" original-width=\"750\" src=\"//bizweb.dktcdn.net/100/200/904/files/bat-co-dien-5.jpg?v=1492933908964\" /></p>\n<p>&nbsp;</p><iframe width=\"720\" height=\"380\" src=\"https://www.youtube.com/embed/7wUjRl_lhZo\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '', 'Bật lửa', 'bật lửa cổ điển, bật lửa trang trí, bật lửa zippo, bật lửa độc, freeship, hộp quẹt, Volcano, volcano.vn, zippo', '1', 'Title', 'Default Title', '', '', '', '', '', '', '', 'deny', '', '120000', '190000', '1', '', '', NULL, '', 'Bật lửa trắng trơn cổ điển', 'Bật lửa trắng trơn cổ điển được sản xuất bởi hãng Eath, 1 hãng bật lửa nổi tiếng của Hồng Kông. Với vỏ n